eval("var chinese_medicine_data = [{\n  // \"id\":1,\n  \"name\": \"解表药\",\n  \"num\": 34,\n  \"content\": [\n  { \"name\": \"麻黄根\", \"xing\": \"无\", \"wei\": \"①《纲目》：\\\"甘，平，无毒。\\\"\", \"liang\": \"内服：煎汤，3～5钱；或入丸、散。外用：研细作扑粉。\", \"zhi\": \"治体虚自汗、盗汗。\" },\n  { \"name\": \"桂枝\", \"xing\": \"1.肉桂，常绿乔木，高12-17m。树皮灰褐色，芳香，幼枝略呈四棱形。叶互生，革质；长椭圆形至近披针形，长8-17cm，宽3.5-6cm，先端尖，基部钝，全缘，上面绿色，有光泽，下面灰绿色，被细柔毛；具离基3出脉，于下面明显隆起，细脉横向平行；叶柄粗壮，长1-2cm。圆锥花序腋生或近顶生，长10-19cm，被短柔毛；花小，直径约3cm；花梗长约5mm；花被管长约2mm，裂片6，黄绿色，椭圆形，长约3mm，内外密生短柔毛；发育雄蕊9，3轮，花药矩圆形，4室，瓣裂，外面2轮花丝上无腺体，花药内向，第3轮雄蕊外向，花丝基部有2腺体，最内尚有1轮退化雄蕊，花药心脏形；雌蕊稍短于雄蕊，子房椭圆形，1室，胚珠1，花柱细，与子房几等长，柱头略呈盘状。浆果椭圆形或倒卵形，先端稍平截，暗紫色，长约12-13mm，外有宿存花被。种子长卵形，紫色。花期5-7月。果期至次年2-3月。\", \"wei\": \"辛；甘；性温\", \"liang\": \"内服：煎汤1.5-6g，大剂量，可用至15-30g；或入丸、散。\", \"zhi\": \"散寒解表；温通经脉；通阳化气。主风寒表证；寒湿痹痛；四肢厥冷；经闭痛经；症瘕结块；胸痹；心悸；痰饮；小便不利\" },\n  { \"name\": \"紫苏叶\", \"xing\": \"一年生草本，高30-200cm。具有特殊芳香。茎直立，多分枝，紫色、绿紫色或绿色，钝四棱形，密被长柔毛。叶对生；叶柄长3-5cm，紫红色或绿色，被长节毛；叶片阔卵形、卵状圆形或卵状三角形，长4-13cm，宽2.5-10cm，先端渐尖或突尖，有时呈短尾状，基部圆形或阔楔形，边缘具粗锯齿，有时锯齿较深或浅裂，两面紫色或仅下面紫色，上下两面均疏生柔毛，沿叶脉处较密，叶下面有细油腺点；侧脉7-8对，位于下部者稍靠近，斜上升。轮伞花序，由2花组成偏向一侧成假总状花序，顶生和腋生，花序密被长柔毛；苞片卵形、卵状三角形或披针形形，全缘，具缘毛，外面有腺点，边缘膜质；花梗长1-1.5mm，密被柔毛；花萼钟状，长约3mm，10脉，外面部密被长柔毛和有黄色腺点，顶端5齿，2唇，上唇宽大，有3齿，下唇有2齿，结果时增大，基部呈囊状；花冠唇形，长3-4mm，白色或紫红色，花冠筒内有毛环，外面被柔毛，上唇微凹，下唇3裂，裂片近圆形，中裂片较大；雄蕊4，二强，着生于花冠筒内中部，几不伸出花冠外，花药2室；花盘在前边膨大；雌蕊1，子房4裂，花柱基底着生，柱头2室；花盘在前边膨大；雌蕊1，子房4裂，花柱基底着生，柱头2裂。小坚果近球形，灰棕色或褐色，直径1-1.3mm，有网纹，果萼长约10mm。花期6-8月，果期7-9月。<br>这一变种与紫苏的区别在于：果萼小，长4-5.5mm，下面被疏柔毛，具腺点；茎被短柔毛；叶较小，卵形，长4.5-7.5cm，宽2.8-5cm，两面被疏柔毛。小坚果较小，土黄色，直径1-1.5mm。花期6-8月，果期7-9月。\", \"wei\": \"味辛；性温\", \"liang\": \"内服：煎汤，5-10g。外用：适量，捣敷、研末掺或煎汤洗。\", \"zhi\": \"散寒解表；宣肺化痰；行气和中；安胎；角鱼蟹毒。主风寒表证；咳嗽痰多；脆胀满；恶心呕吐；腹痛吐泻；胎气不和；妊娠恶阴；食鱼蟹中毒\" },\n  { \"name\": \"紫苏梗\", \"xing\": \"一年生草本，高30-200cm。具有特殊芳香。茎直立，多分枝，紫色、绿紫色或绿色，钝四棱形，密被长柔毛。叶对生；叶柄长3-5cm，紫红色或绿色，被长节毛；叶片阔卵形、卵状圆形或卵状三角形，长4-13cm，宽2.5-10cm，先端渐尖或突尖，有时呈短尾状，基部圆形或阔楔形，边缘具粗锯齿，有时锯齿较深或浅裂，两面紫色或仅下面紫色，上下两面均疏生柔毛，沿叶脉处较密，叶下面有细油腺点；侧脉7-8对，位于下部者稍靠近，斜上升。轮伞花序，由2花组成偏向一侧成假总状花序，顶生和腋生，花序密被长柔毛；苞片卵形、卵状三角形或披针形形，全缘，具缘毛，外面有腺点，边缘膜质；花梗长1-1.5mm，密被柔毛；花萼钟状，长约3mm，10脉，外面部密被长柔毛和有黄色腺点，顶端5齿，2唇，上唇宽大，有3齿，下唇有2齿，结果时增大，基部呈囊状；花冠唇形，长3-4mm，白色或紫红色，花冠筒内有毛环，外面被柔毛，上唇微凹，下唇3裂，裂片近圆形，中裂片较大；雄蕊4，二强，着生于花冠筒内中部，几不伸出花冠外，花药2室；花盘在前边膨大；雌蕊1，子房4裂，花柱基底着生，柱头2室；花盘在前边膨大；雌蕊1，子房4裂，花柱基底着生，柱头2裂。小坚果近球形，灰棕色或褐色，直径1-1.3mm，有网纹，果萼长约10mm。花期6-8月，果期7-9月。<br>这一变种与紫苏的区别在于：果萼小，长4-5.5mm，下面被疏柔毛，具腺点；茎被短柔毛；叶较小，卵形，长4.5-7.5cm，宽2.8-5cm，两面被疏柔毛。小坚果较小，土黄色，直径1-1.5mm。花期6-8月，果期7-9月。\", \"wei\": \"味辛；性温\", \"liang\": \"内服：煎汤，5-10g；或入散剂。\", \"zhi\": \"理气宽中；安胎；和血。主脾胃气滞；脘腹痞满，胎气不和，水肿脚气，咯血吐衄\" },\n  { \"name\": \"生姜\", \"xing\": \"姜，多年生草本，高50-80cm。根茎肥厚，断面黄白色，有浓厚的辛辣气味。叶互生，排成2列，无柄，几抱茎；叶舌长2-4mm；叶片披针形至线状披针形，长15-30cm，宽1.5-2.2cm，先端渐尖，基部狭，叶革鞘状抱茎，无毛。花葶自根茎中抽出，长15-25cm；穗状花序椭圆形，长4-5cm；苞片卵形，长约2.5cm，淡绿色，边缘淡黄色，先端有小尖头；花萼管长约1cm，具3短尖齿；花冠黄绿色，管长2-2.5cm，裂片3，披针形，长不及2cm，唇瓣的中间裂片长圆状倒卵开，较花冠裂片短，有紫色条纹和淡黄色斑点，两侧裂片卵形，黄绿色，具紫色边缘；雄蕊1，暗紫色，花药长约9m，药隔附属体包裹住花柱；子房3室，无毛，花柱1，柱头近球形。蒴果。种子多数，黑色。花期8月。\", \"wei\": \"味辛；性温\", \"liang\": \"内服：煎汤，3-10g；或捣汁冲。外用：适量，捣敷；或炒热熨；或绞汁调搽\", \"zhi\": \"散寒解表；降逆止呕；化痰止咳。主风寒感冒；恶寒发热；头痛鼻塞；呕吐；痰饮喘咳；胀满；泄泻\" },\n  { \"name\": \"生姜皮\", \"xing\": \"姜，多年生草本，高50-80cm。根茎肥厚，断面黄白色，有浓厚的辛辣气味。叶互生，排成2列，无柄，几抱茎；叶舌长2-4mm；叶片披针形至线状披针形，长15-30cm，宽1.5-2.2cm，先端渐尖，基部狭，叶革鞘状抱茎，无毛。花葶自根茎中抽出，长15-25cm；穗状花序椭圆形，长4-5cm；苞片卵形，长约2.5cm，淡绿色，边缘淡黄色，先端有小尖头；花萼管长约1cm，具3短尖齿；花冠黄绿色，管长2-2.5cm，裂片3，披针形，长不及2cm，唇瓣的中间裂片长圆状倒卵开，较花冠裂片短，有紫色条纹和淡黄色斑点，两侧裂片卵形，黄绿色，具紫色边缘；雄蕊1，暗紫色，花药长约9m，药隔附属体包裹住花柱；子房3室，无毛，花柱1，柱头近球形。蒴果。种子多数，黑色。花期8月。\", \"wei\": \"味辛；性凉\", \"liang\": \"内服：煎汤，2-6g。\", \"zhi\": \"行水消肿。主水肿初起，小便不利\" },\n  { \"name\": \"生姜汁\", \"xing\": \"无\", \"wei\": \"辛，微温。\", \"liang\": \"三滴至十滴，冲服。\", \"zhi\": \"有化痰、止呕的功效，主要用于恶心呕吐及咳嗽痰多等症。\" },\n  { \"name\": \"香薷\", \"xing\": \"直立草本，茎高55-65cm。基部分枝较长，向上分枝渐短。茎四棱形，基部类圆形，中上部茎具细浅纵槽数条，四棱上疏生长柔毛，柄内为郑曲柔毛。叶对生；叶柄长0.7-1cm，被小纤毛；叶片披针形，长3-6cm，宽0.6-1cm，先端渐尖，基部渐狭，边缘具5-9个锐浅锯齿，侧脉明显，上面黄绿色，被短柔毛，间有长绵毛，下面较淡，主脉上为长柔毛，余为短柔毛，两面均具凹陷腺点。总状花序密集成穗状，长2-3.5cm，苞片覆瓦状排列，倒卵圆形或圆卵形，长5-6mm，宽4-4.5mm，先端短尾尖，全缘，上面上半部被疏柔毛，下部近无毛；下面密被白色长柔毛，半部密生凹陷腺点，边缘具长睫毛，脉7-9条，自基部掌状生出。花梗长1-1.5mm，被短柔毛。化萼钟形，长4mm，宽2-2.5mm，外被白色柔毛及凹陷腺点，内面在喉部以上被白色绵毛，下部无毛，萼齿5，钻形或披针形，近相等，约为全长的2/3，果时基部膨大；花冠淡紫色，或少有白色，长0.6-0.8cm，伸出苞片，外被微柔毛，内面在下唇之下方冠筒上簇生长柔毛，冠筒基部具一圈长毛环，余部脉上具疏短毛茸，下唇中裂片边缘具不规则圆或尖锯齿，先端凹入；雄蕊、雌蕊内蒙，退化雄蕊2，发育，二药室近相等，花丝极短，无毛，着生于花冠筒内；柱头2裂，反卷；花盘前方指状膨大。小坚果扁圆球形，直径0.9-1.4mm，表面具疏网纹，网眼内平坦，具疣状突起。花期6月，果期7月。\", \"wei\": \"味辛；性微温\", \"liang\": \"内服：煎汤，3-9g；或入丸、散，或煎汤含漱。外用：适量，捣敷。\", \"zhi\": \"发汗解暑，和中结湿，行水消肿。主夏月外感风寒；内伤于湿；恶寒发热；头痛无汗；脘腹疼痛；呕吐腹泻；小便不利；水肿\" },\n  { \"name\": \"荆芥\", \"xing\": \"一年生草本，高60～90厘米。茎直立，四棱形，基部稍带紫色，上部多分枝，全株被短柔毛，叶对生，羽状深裂，茎基部的叶裂片5；中部及上部的叶裂片3～5，线形或披针形，长1.5～2厘米，宽2～4毫米，全缘，两面均被柔毛:下面具凹陷腺点，穗状轮伞花序，多密集于枝端，长3～8厘米；苞片叶状，线形，长乱0.4～1.7厘米，绿色，无柄；花萼钟形，长约3毫米，距纵脉5条，被毛，先端5齿裂；花冠淡紫色，2唇形，长约4毫米，上唇2裂，下唇较大，3裂；雄蕊4，2强；子房4裂，花柱基生，柱头2裂。小坚果4，卵形或椭圆形，长约1毫米，棕色。花期6～8月。果期7～9月。\", \"wei\": \"辛，温。\", \"liang\": \"内服:煎汤，1.5～3钱；或入丸、散。外用:捣敷、研末调敷或煎水洗。\", \"zhi\": \"治疗皮肤瘙痒症:取净荆芥穗一两，碾为细面，过筛后装入纱布袋内，均匀地撒布患处（如范围广，可分片进行），然后用手掌来回反复的揉搓，磨擦至手掌与患部发生热感为度。治疗急慢性荨麻疹及一切皮肤瘙痒病，轻者1～2次，重者2～4次即奏效。\" },\n  { \"name\": \"防风\", \"xing\": \"多年生草本，高30-80cm。根粗壮，长圆柱形，有分枝，淡黄桂冠色，根斜上升，与主茎近等长，有细棱。基生叶丛生，有扁长的叶柄，基部有宽叶鞘，稍抱茎；叶片卵形或长圆形，长14-35cm，宽6-8（-18）cm，二至三回羽状分裂，第一回裂片卵形或长圆形，有柄，长5-8cm，第二回裂片下部具短柄，末回裂片狭楔形，长2.5-5cm，宽1-2.5cm；顶生叶间化，有宽叶鞘。复伞形花序多数，生于茎和分枝顶端，顶生花序梗长2-5cm，伞辐5-7，长3-5cm，无毛，无总苞片；小伞形花序有死4-10，小总苞片4-6，线形或披针形，长约3mm；萼齿三角状卵形；花瓣倒卵形，白色，长约1.5mm，无毛，先端微凹，具内折小舌片。双悬果狭圆形或椭圆形，长4-5mm，宽2-3mm，幼时有疣状突起，成熟时渐平滑；每棱槽内有油管1，合生面有油管2。花期8-9月，果期9-10月。\", \"wei\": \"味辛；甘；性微温\", \"liang\": \"内服：煎汤，5-10g；或入丸、散。外用：适量，煎水熏洗。\", \"zhi\": \"祛风解表；胜湿止痛；解痉；止痒。主外感风寒；头痛身痛；风湿痹痛；骨节酸痛；腹痛泄泻；肠风下血；破伤风；风疹瘙痒；疮疡初起\" },\n  { \"name\": \"羌活\", \"xing\": \"1、多年生草本，高60-150cm。根茎粗壮，圆柱形或不规则块状，暗棕色至棕红色，顶端有枯萎叶鞘，有特殊香气。茎直立，圆柱形，中空，表面淡紫色，有纵直细条纹。基生叶及茎下部叶有长柄，叶柄由基部向两侧扩展成膜质叶鞘，抱茎；叶片为三出三回羽状复叶，小叶3-4对，末回裂片卵状披针形至长圆卵形，长2-5cm，宽0.5-2cm，边缘缺刻状浅裂至羽深裂；茎上部叶简化成鞘状，近无柄，先端有羽状分裂的小叶片。复伞形花序顶生或腋生，直径3-13cm，侧生者常不育，总苞片3-6，线形，早落；伞辐7-18（-39），长2-10cm；小伞形花序直径1-2cm，小总苞片6=10，线形，长3-5mm；花多数，萼齿卵状三角形；花瓣5，白色，倒卵形，先端钝而内凹；雄蕊的花丝内弯，黄色；花柱2，很短，花柱基平压，稍隆起。分果长圆形，长4-6mm，宽约3mm，主棱均扩展为宽约1mm的翅，油管明显，每棱槽内3-4，合生面5-6，胚乳腹面内凹成沟槽状。花期7-9月，果期8-10月。<br>2、本种与羌活的区别点在于：植株高80-180cm。叶片大，三出二至三回羽状复叶，末回裂片长圆状卵形至卵状披针形，长3-8cm，宽1-3cm，先端钝或渐尖，基部略带楔形，边缘有粗锯齿，脉上及叶缘有微毛；茎上部叶少数，叶片简化，仅有3小叶。复伞形花序有伞辐10-17（-23），花瓣淡黄色。分生果近圆形，长约5mm，宽4mm，每棱槽内有油管3-4，合生面有油管4。花期7-8月，果期8-9月。\", \"wei\": \"味辛；苦；性温\", \"liang\": \"内服：煎汤，3-10g；或入丸、散。\", \"zhi\": \"散表寒；祛风湿；利关节；止痛。主外感风寒；头痛无汗；油印寒湿痹；风水浮肿；疮疡肿毒\" },\n  { \"name\": \"白芷\", \"xing\": \"无\", \"wei\": \"辛，温。\", \"liang\": \"3～9g。\", \"zhi\": \"散风除湿，通窍止痛，消肿排脓。用于感冒头痛，眉棱骨痛，鼻塞，鼻渊，牙痛，白带，疮疡肿痛。\" },\n  { \"name\": \"细辛\", \"xing\": \"1.辽细辛 多年生草本。根茎横走。叶卵状心形或近肾形，长4-9cm，宽5-13cm，先端急尖或钝，基部心形，上面脉上有毛，有时全体疏生短毛，下面毛较密；芽胞叶近圆形。花紫棕色，稀紫绿色；花梗长3-5cm，花期在顶部成直角弯曲，果期直立；花被管壶状或半球状，直径约1cm，喉部稍缢缩，花被裂片三角状卵形，片三角状卵形，长约7mm，宽约9mm，由基部向外反折，贴靠于花被管上；雄蕊着生于子房中部，花丝常较花药稍短，药隔不伸出；子房半下位或几近上位，近球形，花柱6，先端2裂，住头侧生。蒴果半球状，直径约12mm。花期5月，果期6-7月。<br>2．细辛 多年生草本。根茎直立或横走，节间长1-2cm。叶通常2枚，叶柄长8-18cm；芽胞叶肾圆形，边缘疏被柔毛；叶片心形或卵状心形，长4-llcm，宽4.5-13.5cm，先端渐尖或急尖，基部深心形，上面疏生短毛，脉上较密，下面仅脉上被毛。花紫黑色；花便长2-4cm；花被管钟状，直径1-1.5cm，内壁有疏离纵行脊皱；花被裂片三角状卵形，直立或近乎展；雄蕊着生子房中部，花丝与花药近等长或稍长，药隔突出，短锥形；子房半下位或几近上位，球状，花往6，较短，先端2裂，柱头侧生。葫果近球状，直径约1.5cm。花期4-5月。<br>3．汉城细辛 本变型与细辛相似，但叶片背面密生短毛，叶柄被疏毛，可以区别。\", \"wei\": \"辛；温；小毒\", \"liang\": \"内服：煎汤，1.5-9g；研末，1-3g。外用：适量，研末吹鼻、塞耳、敷脐；或煎水含漱。\", \"zhi\": \"散寒祛风；止痛；温肺化饮；通窍。主风寒表证；头痛，牙痛；风湿痹痛；痰饮咳喘；鼻塞；鼻渊；口疮\" },\n  { \"name\": \"藁本\", \"xing\": \"①藁本，又名：山园荽（《救荒本草》）。<br>多年生草本。茎直立，中空，表面有纵直沟纹。叶互生；基生叶三角形，长8～15厘米，2回羽状全裂，最终裂片3～4对，卵形，上面叶脉上有乳头状突起，边缘具不整齐的羽状深裂，先端渐尖；叶柄长9～20厘米；茎上部的叶具扩展叶鞘。复伞形花序，顶生或腋生；总苞片羽状细裂，远较伞梗为短；伞梗16～20个或更多；小伞形花序有花多数，小伞梗纤细，长不超过1厘米：小总苞线形或狭披针形，较小伞梗为短；花小，无花萼；花瓣5，白色，椭圆形至倒卵形，中央有短尖突起，向内折卷；雄蕊5，花丝细软，弯曲，花药椭圆形，2室，纵裂；花柱2，细软而反折，子房卵形，下位，2室。双悬果广卵形，无毛，分果具5条果棱，棱槽中各有3个油管，合生面有5个油管。花期7～8月，果期9～10月。<br>野生于向阳山坡草丛中或润湿的水滩边。分布河南、陕西、甘肃、江西、湖北、湖南、四川、山东、云南等地。<br>②辽藁本，又名：家藁本、水藁本。<br>多年生草本，高15～60厘米。根茎短。茎直立，通常单一，中空，表面具纵棱，常带紫色。基生叶在花期时雕落；茎生叶互生，在下部和中部的叶有长柄；叶片全形为广三角形，通常为3回3出羽状全裂，最终裂片卵形或广卵形，先端短渐尖，基部楔形，或近圆形，边缘有少数缺刻状牙齿，上面绿色，沿脉有细微的乳头突起，下面灰绿色；茎上部的叶较小，叶柄鞘状，2回3出羽状全裂。复伞形花序顶生；总苞片少数，早落；伞梗6～19个；小总苞片锥形，10枚左右，花梗20左右；萼齿不明显；花瓣5，白色，椭圆形；雄蕊5，较花瓣长，花药黑紫色；子房下位，花柱呈压扁的圆锥形。双悬果椭圆形，分果具5条果棱，果棱具狭翅，背棱棱槽中有油管1个，侧棱棱槽中有油管1～2个，合生面有油管2～4个。花期7～9月。果期9～10月。<br>生于山地林缘，以及多石砾的山坡林下。分布吉林、辽宁、河北、山东、山西等地。<br>③火藁本<br>形态与辽藁本相似，但根较粗大。叶为3～4回3出羽状细裂，裂片线形。无总苞或有1～2枚总苞，白色，披针形，比伞梗短，花药绛红色。果实油管在背棱上有1个，侧棱上有2个，接合面上2个。<br>分布东北地区。\", \"wei\": \"辛，温。<br>①《本经》：辛，温。<br>②《药性论》：微温。<br>③《本草正》：味甘辛，性温。\", \"liang\": \"内服：煎汤，1～3钱。外用：煎水洗或研末调涂。\", \"zhi\": \"散风寒湿邪。治风寒头痛，巅顶痛，寒湿腹痛，泄泻，疝瘕，疥癣。<br>①《本经》：主妇人疝瘕，阴中寒，肿痛，腹中急，除风头痛。<br>②《别录》：辟雾露润泽；疗风邪疽罚金疮。<br>③《药性论》：治恶风流入腰，痛冷，能化小便，通血，去头风鼾疱。<br>④《日华子本草》：治病疾，并皮肤疵、酒O、粉刺。<br>⑤《医学启源》：治头痛，胸痛，齿痛。<br>⑥李杲：治头面及遍身皮肤风湿。<br>⑦王好古：治督脉为病，脊强而厥。<br>⑧《纲目》：治痈疽，排脓内塞。<br>⑨《本草正》：疗风湿泄泻，风痫雾露瘴疫。<br>⑩《本草再新》：治风湿痛痒，头风目肿，泄泻疟痢。\" },\n  { \"name\": \"苍耳子\", \"xing\": \"1.苍耳 一年生草本，高20-90cm。根纺锤状，分枝或不分枝。茎直立不分枝或少有分枝，下部圆柱形， 上部有纵沟，被灰白以糙伏毛。叶互生；有长柄，长3-11cm；叶片三角状卵形或心表，长4-9cm，宽5-10cm，的全缘，或有3-5不明显浅裂，先尖或钝，基出三脉，上面绿色，下面苍白色，被粗糙或短白伏毛。头状花序近于无柄，聚生，单性同株；雄花序球形，，总苞片，总苞片小，1列，密生柔生，花托柱状，托片倒披针表，小花管状，先端5齿裂，雄蕊5，花药长圆状线形；雌花序卵形，总苞片2-3列，外列苞片小，内列苞片大，结成囊状卵形，2室的硬体，外面有倒刺毛，顶有2圆锥状的尖端，小花2朵，无花冠，子房在总苞内，每室有1花，花柱线形，突出在总苞外。成熟具瘦果的总苞变墅坚硬，卵形或椭圆形，边同喙部长12-15mm，宽4-7mm，绿色，淡黄色或红褐色，喙长1.5-2.5mm；瘦果2，倒卵形，瘦果内含1颗种子。花花期7-8月，果期9-10月。\", \"wei\": \"味苦；甘；辛；性温；小毒\", \"liang\": \"内服：煎汤，3-10g；或入丸、散。外用：适量，捣敷；或煎水洗。\", \"zhi\": \"散风寒；通鼻窍；祛风湿；止痒。主鼻渊；风寒头痛；风湿痹痛；风疹；湿疹；疥癣\" },\n  { \"name\": \"辛夷\", \"xing\": \"①辛夷，又名：林兰（《本经》），木栏、桂栏（《广雅》），杜兰（《别录》），木兰、紫玉兰。\", \"wei\": \"辛，温。\", \"liang\": \"内服：煎汤，1～3钱；或入丸、散。外用：研末塞鼻或水浸蒸馏滴鼻。\", \"zhi\": \"治疗鼻炎：取辛夷50克碾碎后，用醇浸泡3天过滤，滤液加热蒸发浓缩成粘稠状浸膏，以20克无水羊毛脂混合调匀，再加凡士林100克调匀即成软膏。用时作成12x3厘米的油纱条，填入鼻腔，如下鼻甲甚肥大，纱条不易填入时，可先滴1％麻黄素后再填入。纱条之一端应露于鼻孔之外，并加粘膏固定，以免滑入咽内。2～3小时后取出。每日或隔日填塞1次，10次为一疗程。一般皆在4～5次后鼻通气情况开始好转，但亦有10次后始见效果的。鼻腔通气好转后仍需继续填塞5～10次，以期巩固。治疗肥大性鼻炎100例，多数经2年观察，痊愈者（鼻腔通气良好，头痛消失，分泌物减少，鼻甲已不肥大）44％；进步者（鼻通气情况及鼻甲肥大情况均较前大有改善，但仍未完.全正常）44％；无效者（经一疗程以上自觉或他觉症状皆无改善）12％。此外，亦可将辛夷制成煎剂、油剂、乳剂、麻油合剂等，用棉条浸透后塞鼻。据228人次的观察，对肥厚性鼻炎和急性鼻炎的收敛作用很明显；一般以乳剂与浓油效果最佳，油剂次之，煎剂又次之，麻油合剂较差。\" },\n  { \"name\": \"葱白\", \"xing\": \"葱，多年生草本，高可达50cm。通常簇生、全体具辛臭，折断后有辛味之粘液。须根丛生，白色。鳞茎圆柱形，先端稍肥大，鳞叶成层，白色，上具白色纵纹。叶基生，圆柱形，中空，长约45cm，径1.5-2cm，先端尖，绿色，具纵纹；叶鞘浅绿色。花茎自叶丛抽出，通常单一，中央部膨大，中空，绿色，亦有纵纹；伞形花序圆球状；总苞膜质，卵形或卯状披针形；花被6，披针形，白色，外轮3枚较短小，内轮3枚较长大，花被片中央有一条纵脉；雄蕊6，花丝伸出，花药黄色，丁字着生；子房3室。蒴果三棱形。种子黑色，三角状半圆形，花期7-9月。果期8-10月。\", \"wei\": \"味辛；性温\", \"liang\": \"内服：煎汤，9-15g；或酒煎。煮粥食，每次可用鲜品15-30g。外用：适量，捣敷，炒熨，煎水洗，蜂蜜或醋调敷。2\", \"zhi\": \"1.治疗感冒：取葱白、生姜各半两，食盐1钱，捣成糊状，用纱布包裹，涂擦五心(前胸、后背、脚心、手心、窝、肘窝)一遍后让患者安卧。部分病例半小时后出汗退热，自觉症状减轻，次日可完全恢复。治疗107例，均在1-2日内见效。一般用1次，少数病例用2次。\" },\n  { \"name\": \"胡荽\", \"xing\": \"一年生草本，全株无毛。主根细，通常纺锤形，具多数支根。茎直立，中空，高20～60厘米，具细条棱。初生的根生叶具长柄，1～2回羽状分裂，裂片广卵形或扇形，基部楔形；茎生叶互生，叶柄较短，2～3回羽状全裂，最终裂片狭线形。复伞形花序顶生，或与叶对生；伞梗3～6，长约2～6厘米，通常无总苞片；小总苞片通常3枚，线状锥形；花小形，白色或淡红色；花萼先端5齿裂；花瓣5，倒卵形，在小伞形花序周边的花不整齐。具大形的辐射瓣；雄蕊5，与花瓣互生，花药长卵形，背着，花丝先端略弯；雌蕊1，子房下位，花柱细长，顶端二歧，柱头头状。果实近球形，直径3～5毫米，有10条波浪形的初生肋线和12条纵直的次生肋线。花期4～7月。果期7～9月。\", \"wei\": \"辛，温。<br>①《食疗本草》:平。<br>②《本草拾遗》:味辛，温。<br>③《嘉v本草》:辛，温，微毒。一云微寒。\", \"liang\": \"内服:煎汤，3～5钱（鲜者1～2两）；或捣汁。外用:煎水熏洗或捣敷。\", \"zhi\": \"发汗透疹，消食下气。治麻疹透发不快，食物积滞。<br>①崔禹锡《食经》:调食下气。<br>②《食疗本草》:利五脏，补筋脉，主消谷能食，治肠风，热饼裹食。<br>③《嘉v本草》:消谷，治五脏，补不足，利大小肠，通小腹气，拔四肢热，止头痛，疗痧疹、豌豆疮不出，作酒喷之立出，通心窍。<br>④《日用本草》:消谷化气，通大小肠结气。治头疼齿病，解鱼肉毒。<br>⑤《医林纂要》:升散阴气，辟邪气，发汗，托疹。<br>⑥陈念祖:化痰。\" },\n  { \"name\": \"西河柳\", \"xing\": \"无\", \"wei\": \"甘、辛，平。\", \"liang\": \"3～6g。外用适量，煎汤擦洗。\", \"zhi\": \"散风，解表，透疹。用于麻疹不透，风湿痹痛。\" },\n  { \"name\": \"薄荷\", \"xing\": \"多年生芳香草本，茎直立，高30-80cm。具匍匐的根茎，深入土壤可至13cm，质脆，容易折断。茎锐四棱形，多分枝，四侧无毛或略具倒生的柔毛，角隅及近节处毛较显着。单叶对生；叶柄长2-15mm；叶形变化较大，披针形、卵状披针形、长圆状披针形至椭圆形，长2-7cm，宽1-3cm，先端锐尖或渐尖，基部楔形至近圆形，长级在基部以上疏生粗大的牙齿状锯齿，侧脉5-6对，上面深绿色，下面淡绿色，两面具柔毛及黄色腺鳞，以下面分布较密。轮伞花序腋生，轮廓球形，花时径约18mm，愈向茎顶，则节间、叶及花序递渐变小；总梗上有小苞片数枚，线状披针形，长在2mm以下，具缘毛；花柄纤细，长2.5mm，略被柔毛或近无毛；花萼管状钟形，长2-3mm，外被柔毛及腺镤，具10脉，萼齿5，铗三角状钻形，长约0.7mm，缘有纤毛；花冠淡紫色至白色，冠檐4裂，上裂片先端2裂，较大，其余3片近等大，花冠喉内部被微柔毛；雄蕊4，前对较长，常伸出花冠外或包于花冠筒内，花丝丝状，无毛，花药卵圆形，2室，药室平行；花柱略超出雄蕊，先端近相等2浅裂，裂片钻形。小是对果长卵球形，长0.9mm，宽0.6mm，黄褐色或淡褐色，具小腺窝。花期7-9月，果期10-11月。\", \"wei\": \"味辛；性凉\", \"liang\": \"内服：煎汤，3-6g，不可久煎，宜作后下；或入丸、散。外用：适量，煎水先或捣汁涂敷。\", \"zhi\": \"散风热；清头目；利咽喉；透疹；解郁。主风热表证；头痛目赤；咽喉肿痛；麻疹不透；陷疹瘙痒；肝郁胁痛\" },\n  { \"name\": \"牛蒡子\", \"xing\": \"牛蒡 二年生草本，高1-2m。根粗壮，肉质，圆锥形。茎直立，上部多分枝，带紫褐色，有纵条棱。基生叶大形，丛生，有长柄；茎生叶互生；叶片长卵形或广卵形，长20-50cm，宽15-40cm。先端钝，具刺尖，基部常为心形，全缘或具不整齐波状微齿，上面绿色或暗绿色。具疏毛，下面密被灰白色短绒毛。头状花序簇生于茎顶或排列成伞房状，直径2-4cm，花序梗长3-7cm，表面有浅沟，密被细毛；总苞球形，苞片多数，覆瓦状排列，披针形或线状披针形，先端钩曲；花小，红紫色，均为管状花，两性，花冠先端5浅裂，聚药雄蕊5，与花冠裂片互生，花药黄色；子房下位，1室，先端圆盘状，着生短刚毛关冠毛；花柱细长，柱头2裂。瘦果长圆形或长圆状倒卵形，灰褐色，具纵棱，冠毛短刺状，淡黄棕色。花期6-8月，果期8-10月。\", \"wei\": \"味辛；苦；性寒\", \"liang\": \"内服：煎汤，5-10g；或入散剂。外用：适量，煎汤含漱。\", \"zhi\": \"疏散风热；宣肺透疹；利咽散结；解毒消肿。主风热咳嗽；咽喉肿痛；斑疹不透；风疹瘙痒；疮疡肿毒\" },\n  { \"name\": \"蝉蜕\", \"xing\": \"无\", \"wei\": \"甘咸，凉。\", \"liang\": \"内服：煎汤，1～2钱；或入丸、散。外用：煎水洗或研末调敷。\", \"zhi\": \"①治疗破伤风\" },\n  { \"name\": \"桑叶\", \"xing\": \"落叶灌木或小乔木，高3-15m。树皮灰白色，有条状浅裂；根皮黄棕色或红黄色，纤维性强。单叶互生；叶柄长l-2.5cm；叶片卵形或宽卵形，长5-20cm，宽4-10cm，先端锐尖或渐尖，基部圆形或近心形，边缘有粗锯齿或圆齿，有时有不规则的分裂，上面无毛，有光泽，下面脉上有短毛，腋间有毛，基出脉3条与细脉交织成网状，背面较明显；托叶披针形，早落。花单性，雌雄异株；雌、雄花序均排列成穗状葇荑花序，腋生；雌花序长l-2cm，被毛，总花梗长5-10mm；雄花序长1-2.5cm，下垂，略被细毛；雄花具花被片4，雄蕊4，中央有不育的雌蕊；雌花具花被片4，基部合生，柱头2裂。瘦果，多数密集成一卵圆形或长圆形的聚合果，长l-2.5cm，初时绿色，成熟后变肉质、黑紫色或红色。种子小。花期4-5月，果期5-6月。\", \"wei\": \"味苦；甘；性寒\", \"liang\": \"内服：煎汤，4.5～9g；或入丸、散。外用：适量，煎水洗或捣敷。\", \"zhi\": \"治疗下肢象皮肿。采用10%桑叶注射液肌肉注射，每次5ml，每日1-2次；或25-5O%溶液4ml，每日1次。15-21天为一疗程，必要时间隔10天后丙给以第二或第三疗程。在注射三天后同时开始绑扎患胶。临床观察各期象皮肿病人共512例计352条腿，经一疗程后基本治愈(腿围缩小恢复正常或接近正常，皮肤变薄，皮下组织极度松软，自觉症状消失，劳动力完全恢复)看计36条腿，占10.2形；显着进步(腿围显着缩小，皮肤、皮下组织大部松软，自觉症状显着改善，劳动力有所提高)者计166条腿，占全7.2密；进步(腿围稍有缩小，皮肤、皮下组织略感松软，自觉症状稍减，劳动力稍微增进)者计149条腿，占42.3%；无效者仅l条腿，占0.3%。凡一、二期象皮肿患者，治疗后多数腿围能接近正常或明显缩小，三期以上病人则多难恢复到健胶水平。亦有单用桑叶注射液观察20例，结果证明对丝虫病的淋巴管炎有肯定疗效，对象皮肿有一定的软化及消肿作用。经验认为，绑扎是治疗中的重要一环，可昼绑夜松，绑扎得好的腿围缩小较快，如绑扎不紧、走路过多或不能长期坚持者，则疗效不佳。如能同时绑扎躁部及足背，易于取得确实效果。疗程结束后仍需长期坚持纫扎。副作用：注射局部疼痛，部分患者有发冷、发热、头晕等反应(可能与制剂不纯有关)，一般较轻微，不影响治疗；个别病人注药后发生全身不适，腰、背及下胶疼痛、不能活动，需卧床1-2日，可逐渐减轻。\" },\n  { \"name\": \"菊花\", \"xing\": \"多年生草本，高50～140厘米，全体密被白色绒毛。茎基部稍木质化，略带紫红色，幼枝略具棱。叶互生，卵形或卵状披针形，长3.5～5厘米，宽3～4厘米，先端钝，基部近心形或阔楔形，边缘通常羽状深裂，裂片具粗锯齿或重锯齿，两面密被白绒毛；叶柄有浅槽。头状花序顶生成腋生，直径2.5～5厘米；总苞半球形，苞片3～4层，绿色，被毛，边缘膜质透明，淡棕色，外层苞片较小，卵形或卵状披针形，第二层苞片阔卵形，内层苞片长椭圆形；花托小，凸出，半球形；舌状花雌性，位于边缘，舌片线状长圆形，长可至3厘米，先端钝圆，白色、黄色、淡红色或淡紫色，无雄蕊，雌蕊1，花柱短，柱头2裂；管状花两性，位于中央，黄色，每花外具1卵状膜质鳞片，花冠管长约4毫米，先端5裂，裂片三角状卵形，雄蕊5，聚药，花丝极短，分离，雌蕊1，子房下位，矩圆形，花柱线形，柱头2裂。瘦果矩圆形，具4棱，顶端平截，光滑无毛。花期9～11月。果期10～11月。\", \"wei\": \"甘苦，凉。<br>①《本经》：味苦，平。<br>②《别录》：甘，无毒。<br>③《天宝单方图》：白菊：味辛，平，无毒。<br>④《随息居饮食谱》：甘，凉。\", \"liang\": \"内服：煎汤，1.5～3钱；泡茶或入丸、散。\", \"zhi\": \"疏风，清热，明目，解毒。治头痛，眩晕，目赤，心胸烦热，疔疮，肿毒。<br>①《本经》：主诸风头眩、肿痛，目欲脱，泪出，皮肤死肌，恶风湿痹，利血气。<br>②《别录》：疗腰痛去来陶陶，除胸中烦热，安肠胃，利五脉，调四肢。<br>③陶弘景：白菊：主风眩。<br>④《药性论》：能治热头风旋倒地，脑骨疼痛，身上诸风令消散。<br>⑤《日华子本草》：利血脉，治四肢游风，心烦，胸膈壅闷，并痈毒，头痛；作枕明目。<br>⑥《珍珠囊》：养目血。<br>⑦《用药心法》：去翳膜，明目。<br>⑧王好古：主肝气不足。<br>⑨《纲目拾遗》：专入阳分。治诸风头眩，解酒毒疔肿。黄茶菊：明目祛风，搜肝气，治头晕目眩，益血润容，入血分；白茶菊：通肺气，止咳逆，清三焦郁火，疗肌热，入气分。\" },\n  { \"name\": \"蔓荆子\", \"xing\": \"无\", \"wei\": \"辛、苦，微寒。\", \"liang\": \"5～9g。\", \"zhi\": \"疏散风热，清利头目。用于风热感冒头痛，齿龈肿痛，目赤多泪，目暗不明，头晕目眩。\" },\n  { \"name\": \"柴胡\", \"xing\": \"①北柴胡，又名：竹叶柴胡（《植物名实图考》），铁苗柴胡、蚂蚱腿、山根菜、黑柴胡、山柴胡。\", \"wei\": \"苦，凉。\", \"liang\": \"内服：煎汤，0.8～1.5钱；或入丸、散。\", \"zhi\": \"用于退热 北柴胡对普通感冒、流行性感冒、疟疾、肺炎等有较好的退热效果。据143例的临床观察：流行性感冒于24小时退热者达98.1％，普通感冒于24小时退热者达87.9％。制剂及用法：用北柴胡的干燥根，以蒸馏法制成注射液，每安瓿2毫升，相当于原生药2克。肌肉或静脉注射，每日1～2次，成人每次2毫升，周岁以内婴儿每次1～1.5毫升。\" },\n  { \"name\": \"升麻\", \"xing\": \"无\", \"wei\": \"辛、微甘，微寒。\", \"liang\": \"3～9g。\", \"zhi\": \"发表透疹，清热解毒，升举阳气。用于风热头痛，齿痛，口疮，咽喉肿痛，麻疹不透，阳毒发斑；脱肛，子宫脱垂。\" },\n  { \"name\": \"葛根\", \"xing\": \"1.野葛 多年生落叶藤本，长达10m。全株被黄褐色粗毛。块根圆柱状，肥厚，外皮灰黄色，内部粉质，纤维性很强。茎基部粗壮，上部多分枝。三出复叶；顶生小叶柄较长；叶片菱状圆形，长5.5-19cm，宽4.5-18cm，先端渐尖，基部圆形，有时浅裂，侧生小叶较小，斜卵形，两边不等，背面苍白色，有粉霜，两面均被白色伏生短柔毛；托叶盾状着生，卵状长椭圆形，小托叶针状。总状花序腋生或顶生，花冠蓝紫色或紫色；苞片狭线形，早落，小苞片卵形或披针形；萼钟状，长0.8-1cm，萼齿5，披针形，上面2齿合生，下面1齿较长；旗瓣近圆形或卵圆形，先端微凹，基部有两短耳，翼辩狭椭圆形，较旗瓣短，常一边的基部有耳，龙骨瓣较翼瓣稍长；雄蕊10，二体；子房线形，花柱弯曲。荚果线形，长6-9cm，宽7-10mm，密被黄褐色长硬毛。种子卵圆形，赤褐色，有光泽。花期4-8月，果期8-10月。\", \"wei\": \"甘；辛；平\", \"liang\": \"内服：煎汤，10-15g；或捣汁。外用：适量，捣敷。\", \"zhi\": \"1.治疗高血压病颈项强痛：根据用葛根治疗外感病项背强痛的经验，试用于治疗高血压病的颈项强痛，亦取得疗效。\" },\n  { \"name\": \"葛花\", \"xing\": \"形态详葛根条。\", \"wei\": \"甘，凉。<br>①《滇南本草》：性微寒，味甘平微苦。<br>②《纲目》：甘，平，无毒。<br>③《医林纂要》：甘，寒。\", \"liang\": \"内服：煎汤，1.5～3钱；或入丸、散。\", \"zhi\": \"解酒醒脾。治伤酒发热烦渴，不思饮食，呕逆吐酸，吐血，肠风下血。<br>①《别录》：消酒。<br>②《滇南本草》：治头晕，憎寒，壮热，解酒醒脾，酒痢，饮食不思，胸膈饱胀，发呃，呕吐酸痰，酒毒伤胃，吐血，呕血，消热。<br>③《纲目》：治肠风下血。<br>④《医林纂要》：清肺。\" },\n  { \"name\": \"淡豆豉\", \"xing\": \"植物形态详\\\"黑大豆\\\"条。\", \"wei\": \"苦，寒。\", \"liang\": \"内服：煎汤，2～4钱：或入丸剂。外用：捣敷或炒焦研末调敷。\", \"zhi\": \"解表，除烦，宣郁，解毒。治伤寒热病，寒热，头痛，烦躁，胸闷。\" },\n  { \"name\": \"大豆黄卷\", \"xing\": \"大豆 一年生直立草本，高60-180cm。茎粗壮，密生褐色长硬毛。叶柄长，密生黄色长硬毛；托叶小，披针形；三出复叶，顶生小叶菱状卵形，长7-13cm，宽3-6cm，先端渐尖，基部宽楔形或圆形，两面均有白色长柔毛，侧生小叶较小，斜卵形；叶轴及小叶柄密生黄色长硬毛。总状花序腋生；苞片及小苞片披针形，有毛；花萼钏状，萼齿5，披针形，下面1齿最长，均密被白色长柔毛；花冠小，白色或淡紫色，稍较萼长；旗瓣先端微凹，翼瓣具1耳，龙骨瓣镰形；雄蕊10，二体；子房线形，被毛。荚果带状长圆形，略弯，下垂，黄绿色，密生黄色长硬毛。种子2-5颗，黄绿色或黑色，卵形至近球形，长约1cm。花期6-7月，果期8-10月。\", \"wei\": \"甘；平\", \"liang\": \"内服：煎汤，6-15g；或捣汁；或入散剂。\", \"zhi\": \"清热透表；除湿利气。主湿温初起；暑湿发热；食滞脘痞；湿痹；筋挛；骨节烦疼；水肿胀满；小便不利\" },\n  { \"name\": \"浮萍\", \"xing\": \"无\", \"wei\": \"辛，寒。\", \"liang\": \"3～9g。外用适量，煎汤浸洗。\", \"zhi\": \"宣散风热，透疹，利尿。用于麻疹不透，风疹瘙痒，水肿尿少。\" },\n  { \"name\": \"木贼\", \"xing\": \"木贼，多年生草本，高50cm以上。根茎短，黑色，匍匐，节上长出密集成轮生的黑褐色根。茎丛生，坚硬，直立不分枝，圆筒形，直径4-8mm，有关节状节，节间中空，茎表面有20-30条纵肋棱，每棱有两列小疣状突起。叶退化成鳞片状，基部合生成筒状的鞘，鞘长6-10mm，基部有1暗褐色的圈，上部淡灰色，先端有多数棕褐色细齿状裂片，裂片披针状锥形，先端长，锐尖，背部中央有1浅沟，裂片早落，仅在茎先端及幼茎上者不脱落。孢子囊穗生于茎顶，长圆形，长1-1.5cm，先端具暗褐色的小尖头，由许多轮状排列的六角形盾状孢子叶构成，沿孢子叶的边缘生数个胞子囊，孢子囊大形。孢子多数，同型，圆球形，有2条丝状弹丝，十字形着生，卷绕在孢子上，遇水即弹开，以便繁殖。孢子囊穗6-8月间抽出。\", \"wei\": \"甘苦；平；无毒\", \"liang\": \"内服：煎汤，3-10g；或入丸、散。外用：适量，研末撒敷。\", \"zhi\": \"疏风清热；凉血止血；明目退翳。主风热目赤；目生云翳；迎风流泪；肠风下血；痔血；血痢；妇人月水不断；脱肛\" },\n  { \"name\": \"谷精草\", \"xing\": \"一年生草本。叶簇生，线状披针形，长8～18厘米，中部宽3～4毫米，先端稍钝，无毛.花茎多数，簇生，长可达25厘米，鞘部简状，上部斜裂；头状花序半球形，直径5～6毫米，总苞片倒卵形，苞片膜质，楔形，于背面的上部及边缘密生白色棍状短毛；花单性，生于苞片腋内，雌雄花生于同一花序上，有短花梗；雄花少数，生于花序中央，萼片愈合成佛焰苞状，倒卵形，侧方开裂。先端3浅裂，边缘有短毛；花瓣连合成倒圆锥形的管，先端3裂，裂片卵形，上方有黑色腺体1枚，雄蕊6，花药圆形，黑色；雌花多数，生于花序周围，几无花梗，花瓣3，离生，匙状倒披针形，上方的内面有黑色腺体1枚，质厚；子房3室，各室具1胚珠，柱头3裂。蒴果3裂。花、果期6～11月。\", \"wei\": \"辛甘，凉。\", \"liang\": \"内服：煎汤，3～4钱；或入丸、散。外用：烧存性研末撒。\", \"zhi\": \"祛风散热，明目退翳。治目翳，雀盲，头痛，齿痛，喉痹，鼻衄。\" }] },\n\n{\n  // \"id\":2,\n  \"name\": \"清热药\",\n  \"num\": 72,\n  \"content\": [\n  { \"name\": \"石膏\", \"xing\": \"单斜晶系。晶体常作板状，集合体常呈致密粒状、纤维状或叶片状。颜色通常为白色，结晶体无色透明，当成分不纯时可呈现灰色、肉红色、蜜黄色或黑色等。条痕白色。透明至半透明。解理面呈玻璃光泽或珍珠状光泽，纤维状者呈绢丝光泽。片状解理显着。断口贝状至多片状。硬度1.5-2。比重2.3。具柔性和挠性。\", \"wei\": \"辛甘；寒；无毒\", \"liang\": \"内服：煎汤，0.3-1两(大剂可用6-8两)；或入丸、散。外用：煅研撒或调敷。\", \"zhi\": \"解肌清热；除烦止渴。主热病壮热不退；心烦神昏；谵语发狂；口渴咽干；肺热喘急；中暑自汗；胃火头痛；胃火牙痛；热毒壅盛；发斑发疹；口舌生疮；痈疽疮疡；溃不收口；汤火烫伤\" },\n  { \"name\": \"寒水石\", \"xing\": \"1.晶体结构属单斜晶系。单个晶体呈板状，集合体呈块状、片状、纤维状或粉末状。无色或白色、粉红色。有时透明，具玻璃光泽，解理面显珍珠光泽，纤维状者显丝绢光泽。硬度2，薄片具挠性。相对密度2.3-2.37。<br>2.方解石 Calcite 参见方解石条\", \"wei\": \"辛咸；寒\", \"liang\": \"内服：煎汤，3-5钱；或入丸、散。外用：研末掺或调敷。\", \"zhi\": \"清热降火；利窍；消肿。主时行热病；壮热烦渴；咽喉肿痛；水肿；尿闭；口舌生疮；痈疽；丹毒；烫伤\" },\n  { \"name\": \"知母\", \"xing\": \"知母，多年生草本。全株无毛。根茎横生，粗壮，密被许多黄褐色纤维状残叶基，下面生有多数肉质须根。叶基生，丛出，线形，长20-70cm，宽3-7mm，上面绿色，下面深绿色，无毛，质稍硬，叶基部扩大包着根茎。花葶直立，不分枝，高50-120cm，下部具披针形退化叶，上部疏生鳞片状小苞片；花2-6朵成一簇，散生在花葶上部呈总状花序，长20-40cm；花黄白色，干后略带比色，多于夜间开放，具短梗；花被片6，基部稍连合，2轮排列，长圆形，长5-8mm，宽1-1.5mm，先端稍内折，边缘较薄，具3条淡绿色纵脉纹；发育雄蕊3，着生于内轮花被片近中部，花药黄色，退化雄蕊3，着生于外轮花被片近基部，不具花药；雌蕊1，子房长卵形，3室，花柱短，柱头1。蒴果卵圆形，长10-15mm，直径5-7mm，成熟时沿腹缝线上方开裂为3裂片，每裂片内能常具1颗种子。种子长卵形，具3棱，一端尖，长8-12mm，黑色。花期5-8月。果期7-9月。\", \"wei\": \"味苦；性寒\", \"liang\": \"内服：煎汤，6-12g，或入丸、散。清热泻火，滋阴润燥宜生用；入肾降火滋阴宜盐水炒。\", \"zhi\": \"清热泻火；滋阴润燥；止渴除烦。主温热病；高热烦渴；咳嗽气喘；燥咳；便秘；骨蒸潮热；虚烦不眠；消渴淋浊\" },\n  { \"name\": \"芦根\", \"xing\": \"无\", \"wei\": \"甘，寒。\", \"liang\": \"15～30g；鲜品用量加倍，或捣汁用。\", \"zhi\": \"清热生津，除烦，止呕，利尿。用于热病烦渴，胃热呕哕，肺热咳嗽，肺痈吐脓，热淋涩痛。\" },\n  { \"name\": \"天花粉\", \"xing\": \"攀援藤本，长可达10m。块根圆柱状，肥厚，富含淀粉。茎较粗，多分枝，具纵棱及槽，被白色伸展柔毛。叶互生；叶柄长3-10cm，具纵条纹，被条柔毛；卷须3-7分歧，被柔毛；叶片低质，轮廓近圆形或近心形，长宽均约5-20cm，常3-5（-7）浅裂至中裂，稀深裂或不分裂而仅有不等大粗齿，裂片菱状倒卵形、长圆形，先端钝，急尖，边缘常再浅裂，基部心形，弯缺深3-4cm，表面深绿色，粗糙，背面淡绿色，两面沿脉被长柔毛状硬毛，基出掌状脉5条，细脉网状。雌雄异株；雄总状花序单生或与一单花并生，或在枝条上部者单生，总太花序长10-20cm，粗壮，具纵棱及槽，被微柔毛，顶端有5-8花，单花花梗长约15cm，小花梗长约3mm，小苞片倒卵形或阔卵形，长1.5-2.5(-3)cm，宽1-2cm，中上部具粗齿，基部具柄，被短柔毛；花萼筒筒状，长2-4cm，先端扩大，径约10mm，中、下部径约5mm，被短柔毛，裂片披针形，长10-15cm，宽3-5mm，全缘；花冠白色，裂片倒卵形，长约20mm，宽约18mm，先端中央具1绿色尖头，两侧具丝状流苏，被柔毛；花药靠合，长约2mm，径约4mm，花丝分离，粗壮，被长柔毛；雌花单生，花梗长7.5cm，被柔毛；花萼筒圆形，长2.5cm，径1.2cm，裂片和花冠同雄花；子房椭圆形，绿色，长2cm，花柱长2cm，柱头3。果实椭圆形，压扁，长11-16mm，宽7-12mm，淡黄褐色，近边缘处具棱线。花期5-8月，果期8-10月。\", \"wei\": \"味甘；微苦；性微寒\", \"liang\": \"内服：煎汤，9-15g；或入丸、散。外用：适量，研末撒布或调敷。\", \"zhi\": \"清热生津；润肺化痰；消肿排浓。主热病口渴；消渴多饮；肺热燥咳；疮疡肿毒\" },\n  { \"name\": \"竹叶\", \"xing\": \"1.淡竹 植株木质化，呈乔木状。竿高6-18m，直径5-7cm，成长后仍为绿色，或老时为灰绿色，竿环及箨环均甚隆起。箨鞘背面无毛或上部具微毛，黄绿至淡黄色而具有灰黑色之斑点和条纹；箨耳及其Z毛均极易脱落；箨叶长披针形，有皱折，基部收缩；小技具叶1-5片，叶鞘鞘口无毛；叶片深绿色，无毛，窄披针形，宽1-2cm，次脉6-8对，质薄。穗状花序小技排列成覆瓦状的圆锥花序；小穗含2-3花，顶端花退化，颖工或2片，披针形，具微毛；外稃锐尖，表面有微毛；内稃先端有2齿，生微毛，长12-15mm；鳞被数目有变化，3至1枚或缺如，披钍形，长约3mm；花药长7-10mm，开花时，以具有甚长之花丝而垂悬于花外；子房呈尖卵形，顶生一长形之花柱，两者共长约7mm，柱头3枚，各长约smm，呈帚刷状。笋期4-5月，花期10月至次年5月。 2.青竿竹 植株木质化，呈乔木状。植株丛生，无刺。竿直立或近直立，高达15m，径约6cm。顶端不弯垂，竿的节上分枝较多；节间圆柱形，竿的节间和箨光滑无毛。 3.大头典竹 植株木质化，是乔木状。竿高达15m。多少有些作之字形折曲，幼竿被毛和中部以下的竿节上通常具毛环，节间通常较短；箨鞘背部疏被黑褐色、贴生前向刺毛；释片基部较狭；释舌较长，长约5mm；小穗通常呈麦秆黄色；内稃背部被柔毛，脊上具较长而密的缘毛。叶鞘通常被毛；叶舌较长以及外稃背面被疏柔毛。花期3-5月，笋期6-7月。\", \"wei\": \"甘；淡；寒\", \"liang\": \"内服：煎汤，6-12g。\", \"zhi\": \"清热除烦；生津利尿。主热病烦渴；小儿惊G；咳逆吐衄；小便短赤；口糜舌疮\" },\n  { \"name\": \"淡竹叶\", \"xing\": \"多年生草本，高40～100厘米。有短缩而稍木质化的根茎，须根中部常膨大为纺锤形的块根。茎丛生，细长直立，中空，表面有微细的纵纹，基部木质化。叶互生；叶片披针形，长5～20厘米，宽2～3.5厘米，先端渐尖，基部楔形而渐狭缩成柄状，全缘，两面无毛或具小刺毛，脉平行，小横脉明显，中脉在背面明显突起；叶鞘光滑或一边有纤毛；叶舌截形，长0.5～1毫米，质硬，边缘有毛。圆锥花序顶生，长10～30厘米，分枝较少，小穗疏生，长7～12毫米，宽1.5～2.5毫米，伸展或成熟时扩展，基部光滑或被刺毛，具极短的柄；颖矩圆形，具5脉，先端钝，边缘膜质，第一颖较第二颖短；外稃较颖长，披针形，具7～9脉，顶端的数枚外稃中空，先端具短芒，内稃较短，膜质透明；子房卵形，花柱2枚，柱头羽状。花期7～9月。果期10月。\", \"wei\": \"甘淡，寒。<br>①《纲目》：甘，寒，无毒。<br>②《生草药性备要》：味甜辛淡，性寒。\", \"liang\": \"内服：煎汤，3～5钱。\", \"zhi\": \"清心火，除烦热，利小便。治热病口渴，心烦，小便赤涩，淋浊，口糜舌疮，牙龈肿痛。<br>①《纲目》：去烦热，利小便，清心。<br>②《生草药性备要》：消痰止渴，除上焦火，明眼目，利小便，治白浊，退热，散痔疮毒。<br>③《握灵本草》：去胃热。<br>④《本草再新》：清心火，利小便，除烦止渴，小儿痘毒。外症恶毒。<br>⑤《草木便方》：消痰，止渴。治烦热，咳喘，吐血，呕哕，小儿惊痫。<br>⑥《分类草药性》：治咳嗽气喘，眼捕。<br>⑦《现代实用中药》：清凉解热，利尿。治热病口渴，小便涩痛，烦热不寐，牙龈肿痛，口腔炎。<br>⑧《广西中药志》：治鼻衄。\" },\n  { \"name\": \"鸭跖草\", \"xing\": \"鸭跖草，一年生草本。高15-60cm。多有须根。茎多分枝，具纵棱，基部匍匐，上部直立，仅叶鞘及茎上部被短毛。单叶互生，无柄或近无柄；叶片卵圆状披针形或披针形，长4-10cm，宽1-3cm，先端渐尖，基部下延成膜质鞘，抱茎，有白色缘毛，全缘总苞片佛焰苞状，有1.5-4cm长的柄，与叶对生，心形，稍镰刀状弯曲，先端短急尖，长1.5-2.4cm，边缘常有硬毛。聚伞花序生于枝上部者，花3-4朵，具短梗，生玩弄枝最下部者，有花1朵，梗长约8mm；萼片3，卵形，长约5mm，宽约3mm，膜质；花瓣3，深蓝色，较小的1片卵形，长约9mm，较大的2片近圆形，有长爪，长约15mm；雄蕊6，能育者3枚，花丝长约13mm，不育者3枚，花丝较短，无毛，先端蝴蝶状；雌蕊1，子房上倍，卵形，花柱丝状而长。蒴果椭圆形，长5-7mm，2室，2瓣裂，每室种子2颗。种子长2-3mm，表面凹凸不平，具白色小点。花期7-9月，果期9-10月。\", \"wei\": \"甘；寒；淡\", \"liang\": \"内服：煎汤，15-30g；鲜品60-90g，或捣汁。外用：适量，捣敷。\", \"zhi\": \"1.取鸭跖草1-2两(鲜草2-4两)，水煎2次分服。治疗30例，有效( 1-3天内体温降到正常)190例，无效(4天以上退热)21例。预防以片剂(每片含干生药10.3g )内服，每日3次，每次2片；或用冲剂每日一包(含干草2两)，开水冲服；亦可用煎剂内服。 均连服4天。结果290人中无1例发病；而对照组(未服药)371人中，则有23人发病。\" },\n  { \"name\": \"栀子\", \"xing\": \"山栀（《药性论》），又名：林兰（《谢康乐集》）。\", \"wei\": \"苦，寒。\", \"liang\": \"内服：煎汤，2～4钱；或入丸、散。外用：研末调敷。\", \"zhi\": \"①治疗急性黄疸型肝炎\" },\n  { \"name\": \"夏枯草\", \"xing\": \"多年生草本，茎高15-30cm。有匍匐地上的根状茎，在节上生须根。茎上升，下部伏地，自基部多分枝，钝四棱形，具浅槽，紫红色，被稀疏的糙毛或近无毛。叶对生，具柄；叶柄长0.7-2.5cm，自下部向上渐变短；叶片卵状长圆形或圆形，大小不等，长1.5-6am，宽0.7-2.5cm，先端钝，基部圆形、截形至宽楔形，下延至叶柄成狭隘翅，边缘不明显的波状齿或几近全缘。轮伞花序密集排列成顶生长2-4cm的假穗状花序，花期时较短，随后逐渐伸长；苞片肾形或横椭圆形，具骤尖头；花萼钟状，长达10mm，二唇形，上唇扁平，先端截平，有3个不明显的短齿，中齿宽大，下唇2裂，裂片披针形，果时花萼由于下唇2齿斜伸耐闭合；花冠紫、蓝紫或红紫色，长约13mm，略超出于萼，长绝不达萼长之2倍，下唇中裂片宽大，边缘具流苏状小裂片；雄蕊4，二强，花丝先端2裂，1裂片能育具花药，花药2室，室极叉开；子房无毛。小坚果黄褐色，长圆状卵形，长1.8mm，微具沟纹。花期4-6月，果期6-8月mm。\", \"wei\": \"味苦；辛；性寒\", \"liang\": \"内服：煎汤，6-15g，大剂量可用至30g；熬膏或入丸、散。久用：适量，煎水洗或捣敷。\", \"zhi\": \"1.治疗肺结核：对浸润型、慢性纤维空洞型、血型播散型肺结核，均有一定疗效。取夏桔草2两，水煎分2-3次口服；或用夏枯草20斤加水煎至5000ml时，加红糖2市斤收膏，早晚各服1次，每次8-15ml， 1个月为一疗程。服药后咳嗽、胸痛、咯痰、发烧、咯血等症状均见消失或减轻，病灶亦见不同程度的吸收好转。对肺结核咯血者，可用夏枯草1两，以黄酒2两加水适量浸泡，然后蒸至无酒味时过滤，成人每次20-40ml，日服3-4次，有止血效果。\" },\n  { \"name\": \"决明子\", \"xing\": \"1.决明 一年生半灌木状草本，高0.5-2m。上部分枝多。叶互生，羽状复叶；叶柄长2-5cm；小叶3对，叶片倒卵形或倒卵状长圆形，长2-6cm，宽1.5-3.5cm，先端圆形，基部楔形，稍偏斜，下面及边缘有柔毛，最下1对小叶间有1条形腺体，或下面2对小叶间各有一腺体。花成对腋生，最上部的聚生；总花梗极短；小花梗长约1-2cm；萼片5，倒卵形；花冠黄色，花瓣5，倒卵形，长12-15mm，基部有爪；雄蕊10，发有雄蕊7，3个较大的花药先端急狭成瓶颈状；子房细长，花柱弯曲。荚果细长，近四棱形，长15-20cm，宽3-4mm，果柄长2-4cm。种子多数，菱柱形或菱形略扁，淡褐色，光亮，两侧各有1条线形斜凹纹。花期6-8月，果期8-10月。\", \"wei\": \"咸苦；平凉；无毒\", \"liang\": \"内服：煎汤，9-15g。\", \"zhi\": \"祛风清热，解毒利湿。主风热感冒，流感，急性结膜炎，湿热黄疸，急慢性肾炎，带下，瘰疬，疮痈疖肿，乳腺炎\" },\n  { \"name\": \"密蒙花\", \"xing\": \"无\", \"wei\": \"甘，微寒。\", \"liang\": \"3～9g。\", \"zhi\": \"清热养肝，明目退翳。用于目赤肿痛，多泪羞明，眼生翳膜，肝虚目暗，视物昏花。\" },\n  { \"name\": \"青葙子\", \"xing\": \"一年生草本，高30-90cm。全株无毛。茎直立，通常上部分枝，绿色或红紫色，具条纹。单叶互生；叶柄长2-15mm，或无柄；叶片纸质，披针形或长圆状披外形，长5-9cm，宽1-3cm，先端尖或长尖，基部渐狭且稍下延，全缘。花着生甚密，初为淡红色，后变为银白色，穗状花序单生于茎项或分枝顶，呈圆柱形或圆锥形，长3-10cm，苞片、小苞片和花被片子膜质，白色光亮；花被片5，白色或粉红色，披针形；雄蕊5，下部合生成杯状，花药紫色。胞果卵状椭圆形，盖裂，上部作帽状脱落，顶端有宿存花柱，包在宿存花被片内。种子扁圆形，黑色，光亮。花期5-8月.果期6-10月。\", \"wei\": \"苦；性寒\", \"liang\": \"内服：煎汤，3～15g。外用：适量，研末调敷；捣汁灌鼻。\", \"zhi\": \"祛民热；清肝火；明目退翳。主目赤肿痛；眼生翳膜；视物昏花；高血压病；鼻衄；皮肤风热瘙痒；疮癣\" },\n  { \"name\": \"黄芩\", \"xing\": \"黄芩，又名：空心草、黄金茶。<br>多年生草本，主根长大，略呈圆锥状，外皮褐色。茎方形，高25～60厘米，基部多分歧，光滑或被短毛。叶对生，卵状披针形、披针形或线状披针形，长1.5～4.5厘米，宽3～12毫米，先端钝或急尖，基部圆形，全缘，具睫毛，上面光滑或被短毛，下面有腺点，光滑或仅在中肋有短毛；无柄或有短柄。总状花序脓生，花偏向一方；萼钟形，被白色长柔毛，先端5裂；花冠唇形，上唇比下唇长，筒状，上部膨大，基部甚细，紫色，长2～2.5厘米，表面被白色短柔毛；雄蕊4，2强；雌蕊1，子房4深裂，花柱基底着生。小坚果4，近圆形，黑色。花期7～8月。果期8～9月。\", \"wei\": \"苦，寒。<br>①《本经》：味苦，平。<br>②《别录》：大寒，无毒。<br>③《药性论》：味苦甘。\", \"liang\": \"内服：煎汤，1～3钱；或入丸、散。外用：煎水洗或研末撤。\", \"zhi\": \"泻实火，除湿热，止血，安胎。治壮热烦渴，肺热咳嗽，湿热泻痢，黄疸，热淋，吐、衄、崩、漏，目赤肿痛，胎动不安，痈肿疔疮。<br>①《本经》：主诸热黄疸，肠荩泄利，逐水，下血闭，（治）恶疮，疽蚀，火疡。<br>②《别录》：疗痰热，胃中热，小腹绞痛，消谷，利小肠，女子血闭，淋露下血，小儿腹痛。<br>③陶弘景：治奔豚，脐下热痛。<br>④《药性论》：能治热毒，骨蒸，寒热往来，肠胃不利，破壅气，治五淋，令人宣畅，去关节烦闷，解热渴，治热腹中L痛，心腹坚胀。<br>⑤《日华子本草》：下气，主天行热疾，疔疮，排脓。治乳痈，发背。<br>⑥《珍珠囊》：除阳有余，凉心去热，通寒格。<br>⑦李杲：治发热口苦。<br>⑧《滇南本草》：上行泻肺火，下行泻膀胱火，（治）男子五淋，女子暴崩，调经清热，胎有火热不安，清胎热，除六经实火实热。<br>⑨《纲目》：治风热湿热头疼，奔豚热痛，火咳，肺痿喉腥，诸失血。<br>⑩《本草正》：枯者清上焦之火，消痰利气，定喘嗽，止失血，退往来寒热，风热湿热，头痛，解瘟疫，清咽，疗肺痿肺痈，乳痈发背，尤祛肌表之热，故治斑疹、鼠瘘，疮疡、赤眼；实者凉下焦之热，能除赤痢，热蓄膀胱，五淋涩痛，大肠闭结，便血、漏血。<br>⑾《科学的民间药草》：外洗创口，有防腐作用。\" },\n  { \"name\": \"黄连\", \"xing\": \"①黄连\", \"wei\": \"苦，寒。\", \"liang\": \"内服：煎汤，0.5～1钱；或入丸、散。外用：研末调敷、煎水洗或浸汁点眼。\", \"zhi\": \"①治疗细菌性痢疾\" },\n  { \"name\": \"黄柏\", \"xing\": \"1．黄檗 落叶乔木，高10-25m。树皮厚，外皮灰褐色，木栓发达，不规则网状纵沟裂，内皮鲜黄色。小枝通常灰褐色或淡棕色，罕为红棕色，有小皮孔。奇数羽状复叶对生，小叶柄短；小叶5-15枚，披针形至卵状长圆形，长3-11cm，宽1.5-4cm，先端长渐尖，叶基不等的广楔形或近圆形，边缘有细钝齿，齿缝有腺点，上面暗绿色无毛，下面苍白色，仅中脉基部两侧密被柔毛，薄纸质。雌雄异株；圆锥状聚伞花序，花轴及花枝幼时被毛；花小，黄绿色；雄花雄蕊5，伸出花瓣外，花丝基部有毛；雌花的退化雄蕊呈小鳞片状；雌蕊1，子房有短柄，5室，花枝短，柱头5浅裂。浆果状核果呈球形，直径8-10mm，密集成团，熟后紫黑色，内有种子2-5颗。花期5-6月，果期9-10月。<br>2.黄皮树 落叶乔木，高10-12m。树皮外观棕褐色，可见唇形皮孔，外层木栓较薄。奇数羽状复叶对生；小叶7-15，长圆状披针形至长圆状卵形，长9-15cm，宽3-5cm，先端长渐尖，基部宽楔形或圆形，不对称，近全缘，上面中脉上具有锈色短毛，下面密被锈色长柔毛，小叶厚纸质。花单性，雌雄异株；排成顶生圆锥花序，花序轴密被短毛。花紫色；雄花有雄蕊5-6，长于花瓣，退化雌蕊钻形；雌花有退化雄蕊5-6，子房上位，有短柄，5室，花柱短，柱头5浅裂。果轴及果皮粗大，常密被短毛；浆果状核果近球形，直径l-1.5cm，密集成团，熟后黑色，内有种子5-6颗。花期5-6月，果期10-11月。\", \"wei\": \"苦；寒\", \"liang\": \"内服：煎汤，3-9g；或入丸、散。外用：适量，研末调敷，或煎水浸洗。\", \"zhi\": \"清热燥湿；泻火解毒。主湿热痢疾、泄泻、黄疸；梦遗、淋浊、带下；骨蒸劳热；以及口舌生疮；目赤肿痛；痈疽疮毒；皮肤湿疹\" },\n  { \"name\": \"龙胆\", \"xing\": \"1 .多年生草本，高30-60cm。根茎短，其上丛生多数细长的根，长可达30cm。花茎单生，不分枝。叶对生；无柄；下部叶成鳞片状，基部合生，长5-10mm，中部和上部叶近革质，叶片卵形或卵状披针形，长2.5-7cm，宽0.7-3cm，先端急尖或长渐尖，基部心形或圆形，表面暗绿色，下面色淡，边缘外卷，粗糙；叶脉3-5条。花多数，簇生枝顶和叶腋，无花梗；每花下具2个披针形或线状披针形苞片，长2-2.5cm；花萼钟形，长2.5-3cm，先端5裂，常外反或开展，不整齐；花冠筒状钟形，蓝紫色，长4-5.5cm，有时喉部具多数黄绿色斑点，花冠先端5裂，裂片卵形，褶三角形；雄蕊5，着生于花筒中部，花丝基部宽；子房狭椭圆形或披外形，长1-1.4cm，子房柄长约1cm，花柱短，柱头2裂。蒴果内藏，长圆形，有柄。种子多数，褐色，有光泽，具网纹，两端具宽翅。花期8-9月，果期9-10月。<br>2.本种与龙胆不同点在于：叶厚，近革质，无柄，上部叶线状披针形至线形，基部钝，边缘微外卷。花1-2朵；花萼裂片线状披针形，长于或等长于萼筒；花冠裂片先端渐尖。<br>3.本种与上2种不同点在于：中上部叶近革质，线状披针形至线形，基部圆形。花3朵，稀5朵；花萼裂片狭三角形，短于萼筒；花冠裂片先端钝圆。<br>4.与前3种不同点在干：无莲座叶丛，茎生叶多对，二型，下部叶2-4对，鳞片状，中上部叶片卵状长圆形、倒卵形或卵形，基部楔形，边缘略外卷。花多数，簇生枝顶呈头状，稀腋生，被包围于最上部苞叶状的叶丛中；萼裂片不整齐，2枚大，倒卵状长圆形，基部狭缩成爪；雄蕊着生于冠筒下部。种子黄褐色。\", \"wei\": \"苦；性寒\", \"liang\": \"内服：煎汤，3-6g；或入丸、散。外用：适量，煎水洗；或研末调搽。\", \"zhi\": \"清热燥湿；泻肝定惊。主湿热黄疸；小便淋痛；阴肿阴痒；湿热带下；肝胆实火之头胀头痛；目赤肿痛；耳聋耳肿；胁痛口苦；热病惊风抽搐\" },\n  { \"name\": \"秦皮\", \"xing\": \"1.落叶大乔木，高12-15m。树皮灰褐色，光滑，老时浅裂。冬芽阔卵形.先端尖，黑褐色.具光泽，内侧密被棕色曲柔毛。当年生枝淡黄色，通直，无毛，去年生枝暗褐色，皮孔散生。叶轴上面具浅沟，小叶着生处具关节，节上有时。簇生棕色曲柔毛；小叶5-7枚，革质，阔卵形、倒卵形或卵状披针形，长3-11cm，宽2-6cm，营养枝的小叶较宽大，顶生小叶显着大于侧生小叶，下方1对最小，先端渐尖、骤尖或尾尖，基部钝圆，叶绿呈不规则粗锯齿，齿尖稍向内弯，有时也呈波状，通常下部近全缘，沿脉腋被白色柔毛，渐秃净。圆锥花序顶生或腋生于当年生枝梢，长约10cm；苞片长披针形，长约5mm，早落；花梗长约5mm；雄花与两性花异株；花萼浅杯状，长约1mm，萼片三角形无毛；无花冠；两性花具雄蕊2，长约4mm；雌蕊具短花柱，柱头2叉深裂；雄花花萼小，花丝细，长达3mm；翅果线形，先端坚果长约1cm，略隆起；具宿存萼。花期4-5月，果期9-10月。<br>2.本种与大叶q的不同点在干：小枝、叶轴和小叶下面被毛。小叶3-5（-7）片，小叶先端长渐尖至尾尖，下面常在中脉基部被白色柔毛。花无花冠，与叶同时开放；花萼杯状，与坚果基部疏离。<br>3.与前两种不同点在于：小叶卵形、倒卵状长圆形至披针形，先端锐尖至渐尖；花萼筒状，紧贴坚果基部。<br>4.本种与前3种不同点在于：小叶无柄或近于无柄，叶片卵状披针形至阔披针形，叶轴细而直；花具花冠，先叶后花；萼齿明显。\", \"wei\": \"苦；涩；性寒\", \"liang\": \"内服：煎汤，6-12g。外用：适量，煎水洗眼或取汁点眼。\", \"zhi\": \"清热燥湿；清肝明目；止咳平喘。主湿热泻痢；带下，目赤肿痛；睛生疮翳；肺热气喘咳嗽\" },\n  { \"name\": \"苦参\", \"xing\": \"无\", \"wei\": \"苦，寒。\", \"liang\": \"4。5～9g。外用适量，煎汤洗患处。\", \"zhi\": \"清热燥湿，杀虫，利尿。用于热痢，便血，黄疸尿闭，赤白带下，阴肿阴痒，湿疹，湿疮，皮肤瘙痒，疥癣麻风；外治滴虫性阴道炎。\" },\n  { \"name\": \"白鲜皮\", \"xing\": \"1.白鲜 多年生草本，基部木质，高达1m。全株有特异的香味。根肉质，多侧根，外皮黄白至黄褐色。奇数羽状复叶互生；叶轴有狭翼，无叶柄；小叶9-13，叶片卵形至椭圆形，长3.5-9cm，宽2-4cm，先端锐尖，基部楔形，边缘具细锯齿，上面深绿色，密布腺点，下面白绿色，腺点较稀。总状花序顶生，长达30cm，花轴及花柄混生白色柔毛及黑色腺毛；花柄长1-2.5cm，基部有线形苞片1枚；萼片5，卵状披针形，长约5mm，宽约2mm，基部愈合；花瓣5，色淡红而有紫红色线条，倒披针形或长圆形，长约25mm，宽5-7mm，某部渐细呈柄状：雄蕊10；子房上位，5室。蒴果，密被腺毛，成熟时5裂，每瓣片先端有一针尖。种子2-3颗，近球形，直径约3mm，先端短尖，黑色，有光泽。花期4-5月，果期6月。\", \"wei\": \"苦；咸；寒\", \"liang\": \"内服：煎汤，6-15g；或入丸、散。外用：适量，煎水洗或研末敷。\", \"zhi\": \"清热燥湿；祛风止痒；解毒。主风热湿毒所致的风疹；湿疹；疥癣；黄疸；湿热 痹\" },\n  { \"name\": \"金银花\", \"xing\": \"木质藤本，长2～4m。树皮黄褐色渐次变为白色，嫩时有短柔毛。叶对生，卵圆形至椭圆形，长4～8cm，宽3.5～5cm，上面绿色，主脉上有短疏毛，下面带灰白色，密生白色短柔毛；花冠管状，长1.6～2cm，稍被柔毛，初开时白色，后变黄色。花期6～9月，果期10～11月。\", \"wei\": \"甘，寒。\", \"liang\": \"内服：煎汤，3～5钱；或入丸、散。外用：研末调敷。\", \"zhi\": \"①降低人群咽喉部带菌率\" },\n  { \"name\": \"忍冬藤\", \"xing\": \"1.忍冬 多年生半常绿缠绕木质藤本，长达9m。茎中空，多分枝，幼枝密被短柔毛和腺毛。叶对生；叶柄长4-10cm，密被短柔毛；叶纸质，叶片卵形、长圆卵形或卵状披针形，长2.5-8cm，宽1-5.5cm，先端短尖、渐尖或钝圆，基部圆形或近心形，全缘，两面和边缘均被短柔毛。花成对腋生，花梗密被短柔毛和腺毛；总花梗通常单生于小枝上部叶腋，与对柄等长或稍短，生于下部者长2-4cm，密被短柔毛和腺毛；苞片2枚，叶状，广卵形或椭圆形，长约3.5mm，被毛或近无毛；小苞片长约1mm，被短毛及腺毛；花萼短小，萼筒长约2mm，无毛，5齿裂，裂片卵状三角形或长三角形，先端尖，外面和边缘密被毛；花冠唇形，长3-5cm，上唇4浅裂，花冠筒细长，外面被短毛和腺毛，上唇4裂片先端钝形，下唇带状而反曲，花初开时为白色，2-3d后变金黄色；雄蕊5，着生于花冠内面筒口附近，伸出花冠外；雌蕊1，子房下位，花柱细长，伸出。浆果球形，直径6-7mm，成熟时蓝黑色，有光泽。花期4-7月，果期6-11月。\", \"wei\": \"味甘；性寒\", \"liang\": \"内服：煎汤，10-30g；或入丸、散；或浸酒。外用：适量，煎水熏洗，或熬膏贴，或研末调敷衍，赤可用鲜品捣敷。\", \"zhi\": \"清热解毒；通络。主温病发热；疮痈肿毒；热毒血痢；风湿热痹\" },\n  { \"name\": \"连翘\", \"xing\": \"无\", \"wei\": \"苦，微寒。\", \"liang\": \"6～15g。\", \"zhi\": \"清热解毒，消肿散结。用于痈疽，瘰疠，乳痈，丹毒，风热感冒，温病初起，温热入营，高热烦渴，神昏发斑，热淋尿闭。\" },\n  { \"name\": \"穿心莲\", \"xing\": \"一年生草本，高40～80厘米。茎方形，多分枝，节呈膝状膨大，茎叶具有苦味。叶对生，纸质，叶片长圆状卵形至披针形，长2～8厘米，宽1～3厘米，先端渐尖，基部楔形，全缘或有浅齿，叶柄短或近于无柄。疏散圆锥花序生于枝顶或叶腋；花冠白色，近唇形，常有淡紫色条纹。蒴果长椭圆形，长约1.5厘米，宽约0.5厘米，成熟时2瓣开裂。种子细小，红色。\", \"wei\": \"《泉州本草》：\\\"味苦，性寒，无毒。\\\"\", \"liang\": \"内服：煎汤，3～5钱；或研末。外用：煎汁涂或研末调敷。\", \"zhi\": \"①治疗各种感染性疾病\" },\n  { \"name\": \"大青叶\", \"xing\": \"1、菘蓝 相态描述参阅板蓝根项下。\", \"wei\": \"苦，寒。\", \"liang\": \"0.3～1两。\", \"zhi\": \"清热凉血，解毒。主治：流行性乙型脑炎，流行性感冒，流行性腮腺炎，上呼吸道感染，肺炎，急性肝炎，热病发斑，丹毒，疔疮肿毒，蛇咬伤。\" },\n  { \"name\": \"板蓝根\", \"xing\": \"无\", \"wei\": \"苦，寒。\", \"liang\": \"9～15g。\", \"zhi\": \"清热解毒，凉血利咽。用于温毒发斑，舌绛紫暗，痄腮，喉痹，烂喉丹痧，大头瘟疫，丹毒，痈肿。\" },\n  { \"name\": \"青黛\", \"xing\": \"1.马蓝 多年生草本，高30-70cm。干时茎叶呈蓝色或黑绿色。根茎粗壮，断面呈蓝色。地上茎基部稍木质化，略带方形，稍分枝，节膨大，幼时被褐色微毛。叶对生；叶柄长1-4cm；叶片倒卵状椭圆形或卵状椭圆形，长6-15cm，宽4-8cm；先端急尖，微钝头，基部渐狭细，边缘有浅锯齿或波状齿或全缘，上面无毛，有稠密狭细的钟乳线条，下面幼时脉上稍生褐色微软毛，侧脉5-6对。花无梗，成疏生的穗状花序，顶生或腋生；苞片叶状，狭倒卵形，早落；花萼裂片5，条形，长1-1.4cm，通常一片较大，呈匙形，无毛；花冠漏斗状，淡紫色，长4.5-5.5cm，5裂近相等，长6-7mm，先端微凹；雄蕊4，2强，花粉椭圆形，有带条，带条上具两条波形的脊；子房上位，花柱细长。蒴果为稍狭的匙形，长1.5-2cm。种子4颗，有微毛。花期6-10月，果期7-11月。<br>2.蓼蓝 一年生草本，高50-80cm。茎圆柱形，分枝或不分枝，无毛，具明显的节。单叶互生；叶柄长5-10mm；基部有鞘状膜质托叶，淡褐色，先端截形，边缘长睫毛；叶片卵形或卵状披针形，长3-8cm，宽1.5-5.5cm，先端钝，基部圆形或楔形，全缘，有缘毛，干后两面均蓝绿色。穗状花序顶生或腋生，排列紧密；苞片钟形，近革质，有睫毛；花小，红色，花被5裂，裂片倒卵形，淡红色；雄蕊6-8；雌蕊1，花柱不伸出，柱头3叉。瘦果椭圆状三棱形或两凸形，有光泽，包于宿存花被内。花期7-9月，果期8-10月。<br>3.木蓝 小灌木，高50-80cm，罕更高。茎直立，小枝被银白色短毛。叶互生；奇数羽状复叶，长2.5-5cm，小叶对生；托叶小，锥形；小叶9-13，叶片卵状长圆形或倒卵状椭圆形，长1-2cm，宽0.5-1.5cm，先端钝圆，有小尖，基部楔形，全缘，两面被丁字毛，叶干时常带蓝色。总状花序疏松，通常腋生，远较叶为短，有花约20朵；萼钟形，被银白色毛，上部5齿裂；花冠蝶形，红黄色，长约4mm，旗瓣宽卵形至长圆形，外面有毛，翼瓣卵圆形，微与龙骨瓣相连，龙骨瓣匙形，爪上有距；雄蕊10，两体；子房无柄，花柱短，内弯，柱头头状。荚果线状圆柱形，直或稍弯，长约2cm，棕黑色，无毛。种子长圆形状圆柱形，直或稍弯，长约2cm，棕黑色，无毛。种子长圆形，5-12颗，种子长约1.5mm。花期5-6月，果期7-8月4.蓼蓝：（靛青叶、蓝靛叶、靛叶）一年本草、高50-80cm，茎直立，单一分枝，有棱和明显的节，带红紫色，几无毛。单叶互生，有柄；托叶鞘圆筒状，具长睫毛；叶片卵形至宽椭圆形，长3-8cm，宽2-5cm，先端圆钝，基部近圆形或平截，全绿，无毛或沿脉补短毛，蓝绿色，干后变暗蓝色。夏季开淡红色小花，穗状花序顶生或腋生。花密集，苞片膜质，具纤毛，花被5；卵形；、雄蕊6-8个，短天花被。瘦果宽卵形，三棱，棕色，有光泽，包于宿存的膜质花被内。\", \"wei\": \"味咸；性寒\", \"liang\": \"内服：研末，1.5-6g；或入丸剂。外用：适量，干撒或调敷。\", \"zhi\": \"清热解毒；凉血止血；清肝泻火。主温病热毒斑疹；血热吐血；衄血；咯血；肝热惊痫；肝火犯肺咳嗽；咽喉肿痛；丹毒；痄；疮肿；蛇虫咬伤\" },\n  { \"name\": \"贯众\", \"xing\": \"①粗茎鳞毛蕨，又名:绵马鳞毛蕨、鸡膀鳞毛蕨，野鸡膀子、绵马羊齿、东绵马、日本绵马、牛毛黄。<br>多年生草本，高50～100厘米。地下根茎斜生，粗大块状，坚硬，有许多叶柄残基及须根，并密生锈色或深褐色的大形鳞片，鳞片长披针形至线形，长1～2.5厘米。叶簇生于根茎顶端；叶柄长10～25厘米，自基部直达叶轴均密生棕色条形至钻形狭鳞片；叶片草质，广倒披针形，长60～100厘米，中部稍上方最宽处约25厘米，二回羽状全裂或深裂:中部羽片长10～15厘米，宽2～3厘米；小裂片密接，长圆形，圆头，几全缘或先端有钝锯齿，两面多少被锈色鳞片，下面淡绿色；侧脉羽状分叉。孢子囊群分布于叶片中部以上的羽片上，生于小脉中部以下，每裂片2～4对；囊群盖肾圆形，直径约1毫米，棕色。<br>生于林下沼地。分布黑龙江、吉林、辽宁、河北等地。<br>②蛾眉蕨，又名:亚美蹄盖蕨。<br>多年生草本，高30～90厘米。根状茎粗短，直立或斜生，有较多坚硬的叶柄残基，先端有阔披针形鳞片。叶簇生；叶柄长15～20厘米，禾秆色；叶片草质，长约60厘米，宽约20厘米，先端渐尖，沿叶轴、羽轴和主脉有棕色短毛，2回羽状全裂和深裂，中部羽片长12～15厘米，宽1～2厘米，羽裂几达羽轴；裂片椭圆形，先端钝或浑圆，宽3～4毫米，边缘有浅圆齿，有单一的侧脉5～7对。孢子囊群狭长圆形，囊群盖新月形，全缘，质厚。<br>生于山谷林下或灌丛中。分布东北及河北、河南、陕西、四川、云南西北部。<br>③荚果蕨，又名:小叶贯众。<br>多年生草本，高50～90厘米。根状茎直立，连同叶柄基部密生披针形鳞片。叶簇生，2型，有柄；不育叶片圆倒披针形，长45～90厘米，宽14～25厘米，2回深羽裂，中部羽片宽1～2厘米；裂片边缘浅波状或顶端具圆齿；侧脉单一；下部羽片向下逐渐缩短成耳状。能育叶较短小，挺立，具粗硬的长柄，一回羽状，纸质，羽片向下反卷成有节的荚果状，包被囊群。孢子囊群圆形，生于侧脉分支的中部，成熟时汇合成条形；囊群盖白色膜质，熟后破裂消失。<br>生于高山林下。分布东北、华北以及四川、西藏、陕西等地。<br>④紫萁，又名:高脚贯众、老虎牙、水骨菜。<br>多年生草本，高50～80厘米。根状茎粗壮，横生或斜升。叶2型，幼时密被绒毛；不育叶片三角状阔卵形，长30～50厘米，宽25～40厘米，顶部以下2回羽状，小羽片长圆形或长圆披针形，先端钝或尖，基部圆形或宽楔形，边缘有匀密的微钝锯齿。能育叶强度收缩，小羽片条形，长1.5～2厘米，沿主脉两侧密生孢子囊，成熟后枯萎。<br>生于林下或溪边的酸性土壤上。分布河南、山东、安徽、江苏、浙江、福建、台湾、广东、广西、江西、湖北、四川、贵州、云南、陕西等地。<br>⑤乌毛蕨，又名:龙船蕨、赤蕨头。形态参见东方乌毛蕨叶条。<br>⑥苏铁蕨<br>常绿粗大多年生草本，高约1.2米。根状茎木质，粗短，直立；有圆柱状主轴，连同根茎密生红棕色长钻形鳞片。叶多数，簇生主轴顶部；叶柄长6～20厘米，黄棕色；叶片革质，光滑，长圆披针形，长60～100厘米，宽10～30厘米，1回羽状，羽片条状披针形，长10～15厘米，宽1～1.5厘米，先端渐尖，基部斜心形，边缘有细密钝锯齿，常向下反卷；叶脉下凹，主脉两侧各有一行斜上的三角形网眼，网眼外的小脉分离。孢子囊最初沿网脉生长，以后向外布满叶脉全部，无囊群盖。<br>生于山地干旱荒坡上。分布广东、广西、台湾和云南、贵州等地。<br>⑦狗脊蕨，又名:大叶贯众。<br>多年生草本，高50～90厘米。根状茎租短，倾斜，密生棕色披针形大鳞片。叶簇生；叶柄长30～50厘米，黄棕色，被多数鳞片；叶片厚纸质，长圆形，长30～80厘米，宽20～40厘米，2回羽裂，仅羽轴下部有小鳞片；下部羽片长15厘米左右，宽2～3厘米，羽裂1／2或略深；裂片三角形或三角状长圆形，先端尖，具微锯齿；叶脉网状，有网眼1～2行，网眼外的小脉分离，无内藏小脉。孢子囊群长形，生于主脉两侧相对的网脉上；囊群盖长肾形，褐色，革质，以外侧边着生网脉上，开向主脉。<br>生于山坡疏林下阴湿处。分布西南、华南、华东及长江流域各地。\", \"wei\": \"苦，凉。<br>①《本经》:味苦，微寒。<br>②《吴普本草》:神农、歧伯:苦，有毒。一《经》甘，有毒。黄帝:咸酸，一《经》苦，无毒。<br>③《滇南本草》:性寒，味咸涩。<br>④《陕西中草药》:味涩、苦，性寒，有小毒。<br>⑤金华《常用中草药单方验方选编》:苦甘，温。\", \"liang\": \"内服:煎汤，1.5～3钱；或入丸、散。外用:研末调涂。\", \"zhi\": \"杀蛔、绦、蛲虫，清热，解毒，凉血，止血。治风热感冒。温热斑疹，吐血，衄血，肠风便血，血痢，血崩，带下，疮疡，尿血，月经过多，刀伤出血，蛔虫、饶虫、绦虫病，人工流产，产后出血。<br>①《本经》:主腹中邪热气，诸毒，杀三虫。<br>②《别录》:去寸白，破Y瘕，除头风，止金疮。<br>③《本草图经》:止鼻衄。<br>④《滇南本草》:祛毒，止血，解水毒。<br>⑤《纲目》:治下血崩中，带下，产后血气胀痛，斑疹毒，漆毒，骨哽。<br>⑥《会约医镜》:治邪热腹痛，解时行疫气。<br>⑦《奉经续疏》:治喉痹，消顽肿。<br>⑧《东北常用中草药手册》:驱虫，止血，清热解毒。治蛔虫，绦虫，虫积腹痛；子宫功能牲出血，白带。贯众放在水缸中，饮用其水，预防流行性感冒、感冒、流行性脑脊髓膜炎、麻疹。<br>⑨《陕西中草药》:清热解毒，止血杀虫。预防流行性乙型脑炎、流行性腮腺炎等传染病。治便血。尿血、鼻衄、月经过多、蛔虫症、蛲虫症。<br>⑩金华《常用中草药单方验方选编》:祛风活血，补肝肾。治风寒湿痹，腰膝酸痛，遗尿。\" },\n  { \"name\": \"蒲公英\", \"xing\": \"多年生草本，含白色乳汁，高10～25厘米。根深长，单一或分枝。叶根生，排成莲座状；叶片矩圆状披针形、倒披针形或倒卵形，长6～15厘米，宽2～3.5厘米，先端尖或钝，基部狭窄，下延成叶柄状，边缘浅裂或作不规则羽状分裂，裂片齿牙状或三角状，全缘或具疏齿，绿色，或在边缘带淡紫色斑，被白色丝状毛。花茎上部密被白色丝状毛；头状花序单一，顶生，直径2.5～3.5厘米，全部为舌状花，两性：总苞钟状，总苞片多层，外层较短，卵状披针形，先端尖，有角状突起，内层线状披针形，先端呈爪状；花冠黄色，长1.5～1.8厘米；宽2～2.5毫米，先端平截，5齿裂；雄蕊5，着生于花冠管上，花药合生成筒状，包于花柱外，花丝分离，白色，短而稍扁；雌蕊1，子房下位。长椭圆形，花柱细长，柱头2裂，有短毛。瘦果倒披针形，长4～5毫米，宽约1.5毫米，外具纵棱，有多数刺状突起，顶端具喙，着生白色冠毛。花期4～5月。果期6～7月。\", \"wei\": \"苦甘，寒。<br>①《唐本草》：味甘，平，无毒。<br>②李杲：微苦，寒。<br>③《本草述》：甘，平微寒。<br>④广州部队《常用中草药手册》：苦甘，寒。\", \"liang\": \"内服：煎汤，0.3～1两（大剂2两）；捣汁或入散剂。外用：捣敷。\", \"zhi\": \"清热解毒，利尿散结。治急性乳腺炎，淋巴腺炎，瘰疬，疔毒疮肿，急性结膜炎，感冒发热，急性扁桃体炎，急性支气管炎，胃炎，肝炎，胆囊炎，尿路感染。<br>①《唐本草》：主妇人乳痈肿。<br>②《本草图经》：敷疮，又治恶刺及狐尿刺。<br>③《本草衍义补遗》：化热毒，消恶肿结核，解食毒，散滞气。<br>④《滇南本草》：敷诸疮肿毒，疥癞癣疮；祛风，消诸疮毒，散瘰疬结核；止小便血，治五淋癃闭，利膀胱。<br>⑤《纲目》：乌须发，壮筋骨。<br>⑥《医林纂要》：补脾和胃，泻火，通乳汁，治噎膈。<br>⑦《纲目拾遗》：疗一切毒虫蛇伤。<br>⑧《随息居饮食谱》：清肺，利嗽化痰，散结消痈，养阴凉血，舒筋固齿，通乳益精。<br>⑨《岭南采药录》：炙脆存性，酒送服，疗胃脘痛。<br>⑩《山东中药》：为解毒、消炎、清热药。治黄疸，目赤，小便不利，大便秘结。<br>⑾广州部队《常用中草药手册》：清热解毒，凉血利尿，催乳。治疔疮，皮肤溃疡，眼疾肿痛，消化不良，便秘，蛇虫咬伤，尿路感染。<br>⑿《上海常用中草药》：清热解毒，利尿，缓泻。治感冒发热，扁桃体炎，急性咽喉炎，急性支气管爽，流火，淋巴腺炎，风火赤眼，胃炎，肝炎，骨髓炎。\" },\n  { \"name\": \"紫花地丁\", \"xing\": \"多年生草本，高4-14cm；果期高可达20余cm。根茎短，垂直，淡褐色，长4-13mm，粗2-7mm；节密生，有数条细根。叶多数，基生，莲座状；叶柄于花期长于叶片1-2倍，具狭翅，于果期长可达10余cm，上部者较长，呈长圆形、狭卵状披针形或长圆状卵形，长1.5-4cm，宽0.5-1cm，先端圆钝，基部截形或楔形，稀微心形，边缘较平的圆齿，两面无毛或被细短毛，果期叶片增大；托叶膜质，苍白色或淡绿色，2/3-4/5与叶柄合生，离生部分线状披针形。花梗通常多数，细弱，与叶片等长或高出叶片；花紫堇色或淡紫色，稀呈白色，喉部色较淡并带有紫色条纹；萼片5，卵状披针形或披针形，基部附属物短，末端圆或截形；花瓣5，倒卵形或长圆状倒卵形；距细管状，长4-8mm，末端圆；雄蕊5，花药长约2mm，药隔先端的附属物长约1.5mm；子房卵形，花柱棍棒状，柱头三角形。蒴果长圆形，长5-12mm，无毛。种子卵球形，长1.8mm，淡黄色。花、果期4月中旬至9月。\", \"wei\": \"苦、辛；寒\", \"liang\": \"15-30g。外用鲜品适量，捣烂敷患处。\", \"zhi\": \"清热解毒；凉血消肿。主用于疔疮肿毒；痈疽发背；丹毒；毒蛇咬伤\" },\n  { \"name\": \"野菊花\", \"xing\": \"1.野菊 多年生草本，高25-100cm。根茎粗厚，分枝，有长或短的地下匍匐枝。茎直立或基部铺展。基生叶脱落；茎生叶卵形或长圆状卵形，长6-7cm，宽1-2.5cm，羽状分裂或分裂不明显；顶裂片大；侧裂片常2对，卵形或长圆形，全部裂片边缘浅裂或有锯齿；上部叶渐小；全部叶上面有腺体及疏柔毛，下面灰绿色，毛较多，基部渐狭成具翅的叶柄；托叶具锯齿。头状花序直径2.5-4(-5)cm，在茎枝顶端排成伞房状圆锥花骗子或不规则的伞房花序；总苞直径8-20mm，长5-6mm；总苞片边缘宽膜质；舌状花黄色，雌性；盘花两性，筒状。瘦果全部同形，有5条极细的纵肋，无冠状冠毛。花期9-10月。<br>2.岩香菊 本种与野菊的区别在于：叶为羽状深裂，绿色或淡绿色，两面被稀疏的呀下面稍多膨松的柔毛；头状花序多数在茎枝顶端排成疏松的伞房或复伞房花序，舌状花黄色。花果期5-11月。\", \"wei\": \"味苦；辛；性平\", \"liang\": \"内服：煎汤，10-15g，鲜品可用至30-60g。外用：适量，捣敷；煎水漱口或淋洗。\", \"zhi\": \"清热解毒；疏风平肝。主疔疮；痈疽；丹毒；湿疹；皮炎；风热感冒；咽喉肿痛；高血压病\" },\n  { \"name\": \"重楼\", \"xing\": \"多年生草本，高35～60厘米，全株无毛。根茎粗壮，匍匐。茎直立，有纵条纹，绿色，有时带红色。叶通常为4片，有时5～7片，轮生于茎顶；叶柄长1～4.5厘米；叶片草质，广卵形，长7.3～11.5厘米，宽3.8～7.2厘米，先端短尖而微弯，全缘，基部略近心脏形或截形，主脉3条，基出。花单一，顶生，花柄长10.5～16厘米；花两性，外列被片4瓣，绿色，卵状披针形，长约3厘米，宽1～1.3厘米，先端渐尖，基部具短柄；内列被片4瓣，狭线形，黄绿色，长4.5～6.5厘米；雄蕊12，长约1.2厘米，花丝扁平，花药线形，药隔于顶端延伸成小尖头，长约1毫米；花柱4～5，先端反卷。浆果近于球形，直径约1.8毫米，外有宿存的花被；种子多数，近球形，淡褐色。花期6月。果期7～8月。\", \"wei\": \"无\", \"liang\": \"无\", \"zhi\": \"作成膏药外用，治肿伤中毒。\" },\n  { \"name\": \"拳参\", \"xing\": \"无\", \"wei\": \"苦、涩，微寒。\", \"liang\": \"4.5～9g。外用适量。\", \"zhi\": \"清热解毒，消肿，止血。用于赤痢，热泻，肺热咳嗽，痈肿，瘰疬，口舌生疮，吐血，衄血，痔疮出血，毒蛇咬伤。\" },\n  { \"name\": \"漏芦\", \"xing\": \"①祁州漏芦，又名：和尚头、独花山牛蒡。\", \"wei\": \"苦咸，寒。\", \"liang\": \"内服：煎汤，1.5～3钱（鲜者1～2两）；或入丸、散。外用：煎水洗或研末调敷。\", \"zhi\": \"清热解毒，消肿排脓，下乳，通筋脉。治痈疽发背，乳房肿痛。乳汁不通，瘰疬恶疮，湿痹筋脉拘牵，骨节疼痛，热毒血痢，痔疮出血。\" },\n  { \"name\": \"土茯苓\", \"xing\": \"多年生攀援灌木，茎无刺。根状茎横生于土中，细长，生多数须根，每隔一段间距生一肥厚的块状结节，块根根状茎5～15厘米，直径2～5厘米，深入土中可达1米余，质颇坚实，外皮坚硬，褐色，凹凸不平，内面肉质粉性，黄白色，密布淡红色小点。单叶互生，革质，长圆形至椭圆状披针形，长5～12厘米，宽1～5厘米，先端渐尖，基部圆或楔形，全缘，表面绿色，下面有白粉，主脉3条显著，细脉网状；叶柄长1～2厘米，托叶变为2条卷须。7～8月间开小白花，花单性，雌雄异株，为腋生伞形花序，花序梗极短，长1～3毫米，小花梗纤细，长1～1.7厘米，基部有多枚宿存的三角形小苞片。花被裂片6，二轮；雄蕊6，花丝较花药短；子房上位，3室，柱头3，稍反曲。浆果球形，熟时紫红色，外被白粉。\", \"wei\": \"甘、淡、平。\", \"liang\": \"0.3～2两。\", \"zhi\": \"清热解毒，利湿。主治钩端螺旋体病，梅毒，风湿关节痛，痈疖肿毒，湿疹，皮炎，汞粉、银朱慢性中毒。\" },\n  { \"name\": \"鱼腥草\", \"xing\": \"蕺菜 多年生腥臭草本，高60cm。茎下部伏地，节上轮生小根，上部直立，无毛或节上被毛。叶互生，薄纸质，有腺点；叶柄长1-4cm；托叶膜质，条形，长约2.5cm，下部与叶柄合生为叶鞘，基部扩大，略抱茎；叶片卵形或阔卵形，长4-10cm，宽3-6cm，先端短渐尖，基部心形，全缘，上面绿色，下面常呈紫红色，两面脉上被柔毛。穗状花序生于茎顶，长约2cm，宽约5mm，与叶对生；总苞片4枚，长圆形或倒卵形，长1-1.5cm，宽约0.6cm，白色；花小而密，无花被；雄蕊3，花丝长为花药的3倍，下部与子房合生；雌蕊1，由3心皮组成，子房上位，花柱3，分离。蒴果卵圆形，长2-3cm，先端开裂，具宿存花柱。种子多数，卵形。花期5-6月，果期10-11月。\", \"wei\": \"辛；寒\", \"liang\": \"内服：煎汤，15-25g，不宜久煎；或鲜品捣汁，用量加倍。外用：适量，捣敷或煎汤熏洗。\", \"zhi\": \"清热解毒；排脓消痈；利尿通淋。主肺痈吐脓；痰热喘咳；喉哦；热痢；痈肿疮毒；热淋\" },\n  { \"name\": \"金荞麦\", \"xing\": \"无\", \"wei\": \"微辛、涩，凉。\", \"liang\": \"15～45g，用水或黄酒隔水密闭炖服。\", \"zhi\": \"清热解毒，排脓祛瘀。用于肺脓疡，麻疹肺炎，扁桃体周围脓肿。\" },\n  { \"name\": \"大血藤\", \"xing\": \"落叶木质藤本，长达10米。茎圆柱形，褐色扭曲，有条纹，砍断时有红色液汁渗出，故称“大血藤”。三出复叶互生，有长柄；中间小叶倒卵形，长7～12厘米，宽3～7厘米，侧生小叶较大，斜卵形，先端尖，基部两侧不对称。春季开黄色或黄绿色花，有香气，单性，雌雄异株，总状花序出自上年生叶腋基部，长达12厘米，下垂。萼片和花瓣均6片；雄花有雄蕊6个，雄蕊与花瓣对生；雌花有退化雄蕊6个，心皮多数，离生，螺旋排列，胚珠1。浆果卵形，肉质，有柄，多数着生于一球形的花托上。种子卵形，黑色，有光泽。\", \"wei\": \"苦、涩，平。\", \"liang\": \"0.3～1两。\", \"zhi\": \"活血通经，祛风除湿，驱虫。主治：阑尾炎，经闭腹痛，风湿筋骨酸痛，四肢麻木拘挛，钩虫病，蛔虫病。\" },\n  { \"name\": \"败酱草\", \"xing\": \"无\", \"wei\": \"辛、苦，凉。\", \"liang\": \"0.5～1两，鲜全草2～4两；外用适量，捣烂敷患处。\", \"zhi\": \"清热解毒，消痈排脓，活血行瘀。用于肠痈、肺痈及疮痈肿毒，实热瘀滞所致的胸腹疼痛，产后瘀滞腹痛等症。\" },\n  { \"name\": \"墓头回\", \"xing\": \"①异叶败酱<br>多年生草本，高达1.5米。茎圆柱形，节明显，幼枝被短毛。单叶对生；茎基部的叶较大，阔卵圆形至卵圆形，长13～20厘米，宽7～8厘米，先端急尖，基部楔形而下延，边缘具钝锯齿，基部往往羽状全裂，裂片1～2对，倒卵状披针形，上部的叶3裂，两侧裂片长卵形，中央裂片卵形；无叶柄。圆锥状聚伞花序生于枝顶及叶腋；花序轴被白色短柔毛；苞片披针形，小苞片近肾形，淡绿色；花小，两性，黄色；萼管与子房壁合生；花冠钟状，裂片5，卵形；雄蕊4，花药2室：子房下位，8室，花柱1枚，柱头头状。果实为不开裂的干果，小苞片增大成翅状，膜质，近圆形，种子1粒。花期9～10月。果期10～11月。<br>分布于辽宁、河北、山西、河南、陕西、甘肃、广西等地。<br>②糙叶败酱<br>多年生草本，高20～40厘米。茎丛生，茎上部多分枝，分枝处有节纹。叶对生；革质，羽状分裂，裂片倒披针形、狭披针形或长圆形，有牙齿，顶端裂片较侧裂片略大，叶缘及叶面被毛。聚伞花序顶生，呈伞房状排列；花轴及花梗上生细毛；苞片狭窄，寓生；花小，黄色，花冠合瓣，5裂；雄蕊4；子房3室，柱头头状。果实翅状，卵形或近圆形，扁薄如纸，直径约6毫米，有网纹，种子位于中央。<br>野生于墓地及荒地边。分布河南、河北、山西及东北等地。\", \"wei\": \"《广西中药志》：味辛，性温。\", \"liang\": \"内服：煎汤，2～3钱。外用：煎水洗。\", \"zhi\": \"治温疟，妇女崩中，赤白带下，跌打损伤。<br>①《本草原始》：治伤寒，温疟。<br>②《河南中药手册》：洗脚，治脚痛。<br>③《山西中药志》：敛肝燥湿，止血。治妇人髋疽，赤白带下。<br>④《广西中药志》：祛瘀，消肿。治跌打。\" },\n  { \"name\": \"射干\", \"xing\": \"多年生草本，高50～120厘米，根茎鲜黄色，须根多数。茎直立。叶2列，扁平，嵌叠状广剑形，长25～60厘米，宽2～4厘米，绿色，常带白粉，先端渐尖，基部抱茎，叶脉平行。总状花序顶生，二叉分歧；花梗基部具膜质苞片，苞片卵形至卵状披针形，长1厘米左右；花直径3～5厘米，花被6，2轮，内轮3片较小，花被片椭圆形，长2～2.5厘米，宽约1厘米，先端钝圆，基部狭，橘黄色而具有暗红色斑点；雄蕊3，短于花被，花药外向；子房下位，3室。花柱棒状，柱头浅3裂。蒴果椭圆形，长2.5～3.5厘米，具3棱，成熟时3瓣裂。种子黑色，近球形。花期7～9月。果期8～10月。\", \"wei\": \"苦，寒，有毒。<br>①《本经》：味苦，平。<br>②《蜀本草》：微寒。<br>③《滇南本草》：性微寒，苦辛，有小毒。\", \"liang\": \"内服：煎汤，0.8～1.5钱；入散剂或鲜用捣汁。外用：研末吹喉或调敷。\", \"zhi\": \"降火，解毒，散血，消痰。治喉痹咽痛，咳逆上气，痰涎壅盛，瘰疬结核，疟母，妇女经闭，痈肿疮毒。<br>①《本经》：主咳逆上气，喉痹咽痛，不得消息，散结气，腹中邪逆，食饮大热。<br>②《别录》：疗老血在心脾间，咳唾，言语气臭，散胸中热气。<br>③陶弘景：疗毒肿。<br>④《药性论》：治喉痹水浆不入，通女人月闭，治疰气，消瘀血。<br>⑤《日华子本草》：消痰，破Y结，胸膈满，腹胀，气喘，痃癖，开胃下食，消肿毒，镇肝明目。<br>⑥《珍珠囊》：去胃中痈疮。<br>⑦《滇南本草》：治咽喉肿痛，咽闭喉风，乳蛾，痄腮红肿，牙根肿烂，攻散疮痈一切热毒等症。<br>⑧《纲目》：降实火，利大肠，治疟母。<br>⑨《生草药性备要》：敷疮洗肿，拔毒散血，跌打亦用。<br>⑩《分类草药性》：治妇人白带。<br>⑾《南京民间药草》：根茎、花和种子，泡酒服，治筋骨痛。\" },\n  { \"name\": \"山豆根\", \"xing\": \"广豆根，又名：柔枝槐。<br>灌木，直立或近平卧，高1～2米。根通常2～5条，圆柱形，黄褐色。茎圆柱形，表面具沟槽，密被短柔毛，茎上部常作之字形弯曲。单数羽状复叶，互生，小叶片11～17，长（团状卵形或卵形，长1～2.5厘米，宽0.5～1.5厘米，顶端1小叶较大，多为椭圆形，全缘，上面深绿色，被短毛，下面灰棕色，密被灰棕色短柔毛；小叶柄短，密被短柔毛。总状花序顶生；长12～15厘米，密被短毛；花萼阔钟状，外被稀毛，顶端有5个三角状的短齿；蝶形花冠黄白色；雄蕊10，花药背着，花丝细长；雌蕊1，子房上位，圆柱形，花柱弯曲，柱头圆形，簇生长柔毛。荚果紫黑色，串珠状。花期4～5月。\", \"wei\": \"苦，寒。<br>①《开宝本草》：味甘，寒，无毒。<br>②《梦溪笔谈・药议》：味极苦。<br>③《本草正》：味大苦，大寒。\", \"liang\": \"内服：煎汤，3～5钱；或磨汁。外用：含漱或捣敷。\", \"zhi\": \"清火，解毒，消肿，止痛。治喉痈，喉风，喉痹，牙龈肿痛，喘满热咳，黄疸，下痢，痔疾，热肿，秃疮，疥癣，蛇、虫、犬咬伤。<br>①《开宝本草》：主解诸药毒，止痛。消疮肿毒，急黄发热咳嗽，杀小虫。<br>②《本草图经》：含以解咽喉肿痛。\" },\n  { \"name\": \"北豆根\", \"xing\": \"无\", \"wei\": \"苦，寒；有小毒。\", \"liang\": \"3～9g。\", \"zhi\": \"清热解毒，祛风止痛。用于咽喉肿痛，肠炎痢疾，风湿痹痛。\" },\n  { \"name\": \"马勃\", \"xing\": \"①脱皮马勃<br>子实体近球形至长圆形，直径15～20厘米。包被薄，易消失，外包被成块地与内包被脱离，内包被纸状，浅烟色，成熟后全部消失，遗留成团的孢体随风滚动。孢体紧密。有弹性，灰褐色，渐退成浅烟色，由孢丝及孢子组成；孢丝长，分枝，相互交织，浅褐色，粗2～4.5微米；孢子褐色，球形，有小刺。直径4.5～5微米.<br>生于草地上。分布内蒙古、河北、陕西、甘肃、新疆、江苏、安徽、湖北、湖南、贵州等地。<br>②大颓马勃<br>孑实体球形或近球形，直径15～20厘米，或更大，不孕基部无或很小；包被白色，后变浅黄或淡青黄色，由膜状外被和较厚的内被所组成，初微具绒毛，渐变光滑，质脆，成熟后开裂成块而脱落，露出浅青褐色的孢体；孢子粉状，球形，光滑或有时具细微小疣，淡青黄色，直径3.5～5微米；孢丝长，与孢子同色，稍分枝，有稀少横隔，粗2.5～6微米。<br>生于旷野草地上。分布辽宁、内蒙古、河北、山西、甘肃、新疆、青海、江苏等地。<br>③紫颓马勃<br>子实体陀螺形，直径5～12厘米，不孕基部发达；包被薄，两层，上部常裂成小块，逐渐脱落，内部紫色，当孢子及孢丝散失后遗留的不孕基部呈杯状；孢子粉状，球形，直径4～5.5微米，上有小刺；孢丝很长，分枝，有横隔，互相交织，色淡，粗2～5微米，<br>生旷野草地上。分布河北、新疆、青海、四川、湖北、安徽、江苏、广西、福建、海南等地。\", \"wei\": \"辛，平。<br>①《别录》：味辛，平，无毒。<br>②《医林纂要》：辛咸，平。\", \"liang\": \"内服：煎汤，0.5～1钱；或入丸、散。外用：研末撒、调敷、或作吹药。\", \"zhi\": \"清肺利咽，解毒，止血。治喉痹咽痛，咳嗽失音，吐血，衄血，外伤出血。<br>①《别录》：主恶疮、马疥。<br>②陶弘景：敷诸疮。<br>③《本草衍义》：去膜，以蜜揉拌，少以水调呷，治喉闭咽痛。<br>④《纲目》：清肺，散血热，解毒。能清肺热咳嗽，喉痹，衄血，失音诸病。<br>⑤《玉楸药解》：治骨鲠吐血。\" },\n  { \"name\": \"青果\", \"xing\": \"常绿乔木，高10～20m。羽状复叶互生；小叶9～15，对生，革质，长圆状披针形，长6～19cm，宽3～8cm，先端尾状渐尖，下面网脉上有小窝点。圆锥花序顶生或腋生；花小，两性或杂性；萼杯状，3浅裂；花瓣3～5，白色，芳香；雄蕊6，子房上位，3室，每室胚珠2。核果卵形，长约3cm,青黄色。花期4～5月，果期8～10月。\", \"wei\": \"性平，味甘、酸。\", \"liang\": \"无\", \"zhi\": \"清热，利咽，生津，解毒。用于咽喉肿痛、咳嗽、烦渴、鱼蟹中毒。\" },\n  { \"name\": \"木蝴蝶\", \"xing\": \"木蝴蝶 木乔木，高7-12m。树皮厚，有皮孔。小枝皮孔极多而突起，叶痕明显而大。叶对生；大型奇数二至四回羽状复叶，着生于茎干近顶端，长60-160cm，宽20-80cm；小叶多数，小叶柄长5-10mm，小叶片三角状卵形，长6-14cm，宽4-9cm，先端短渐尖，基部圆形或宽楔形而偏斜，全缘，上面绿色，下面淡绿色，两面无毛，干后发蓝色。总状聚伞花序顶生，长40-150cm，花梗长约7cm；花萼钟状，长2.2-4.5cm，宽2-3cm，紫色，先商平截，宿存；花冠橙红色，肉质，长3-9cm，钟形，直径5-8.5cm，先端5浅裂，裂片大小不等；雄蕊5，插生于花冠筒中部，伸出于花冠外；花丝基部被绵毛，其中1花丝较短；花盘磊，肉质；花柱长5-7cm，柱头2片开裂。蒴果木质，扁平，阔线形，下垂，长40-120cm，宽5-8.5cm，先端短尖，基部楔形，边缘稍内弯，中间有一条微突出的背缝，成熟时棕黄色，沿腹缝线裂开，果瓣具中肋。种子多数，种子连翅长6-7.5cm，宽3.5-4cm，除基部外，全被白色半透明的薄翅包围。花期7-10月，果期10-12月。\", \"wei\": \"味微苦；甘；性微寒\", \"liang\": \"内服：煎汤，6-9g；研末，1.5-3g。外用：适量，敷贴；或研末撒患处。\", \"zhi\": \"利咽润肺；疏肝和胃；敛疮生肌。主咽痛喉痹；声音嘶哑；咳嗽；肝胃气痛；疮疡久溃不敛；浸淫疮\" },\n  { \"name\": \"白头翁\", \"xing\": \"1.白头翁，多年生草本，高15-35cm。根状茎粗，直径8-15mm。基生叶4-5，开花时长出地面，叶3全裂；叶柄长7-15cm，被密长桑毛；叶片轮廓宽卵形，长4.5-14cm，宽6.5-16cm，上面疏被毛，后期脱落无毛，下面密被长柔毛，3全裂，中央全裂片有柄或近无柄，3深裂，中央深裂片楔状卵形，或狭楔形，全缘或有齿，侧深裂片不等2浅裂；侧全裂片无柄或近无柄，不等3深裂。花争1-2，花后生长，高15-35cm，苞片3，基部合生，简长3-10mm，裂片条形，外面密被长柔毛，内面无毛；花两性，单朵，直立，花梗长2.5-5.5cm；萼片6，排成2轮，狭卵形或长圆状卵形，长2.8-4.4cm，宽9-20mm，蓝紫色，外面密被柔毛；花瓣无；雄蕊多数，长约为萼片之半；心皮多数，被毛。瘦果长3-4mm，被长柔毛，顶部有羽毛状宿存花柱，长3.5-6.5cm。花期4-5月，果期6-7月。\", \"wei\": \"味苦；性寒\", \"liang\": \"内服：煎汤，15-30g；或入丸、散。外用：适量，煎水洗或捣敷。\", \"zhi\": \"清热解毒；凉血止痢；燥湿杀虫。主赤白痢疾；鼻衄；崩漏；血痔；寒热温疟；带下；阴痒；湿疹；瘰疬；痈疮；眼目赤痛\" },\n  { \"name\": \"马齿苋\", \"xing\": \"一年生草本，肥厚多汁，无毛，高10-30cm。茎圆柱形，下部平卧，上部斜生或直立，多分枝，向阳面常带淡褐红色。叶互生或近对生；倒卵形、长圆形或匙形，长1-3cm，宽5-15mm，先端圆钝，有时微缺，基部狭窄成短柄，上面绿色，下面暗红色。花常3-5朵簇生于枝端；总苞片4-5枚，三角状卵形；萼片2，对生，卵形，长宽约4cm；花瓣5，淡黄色，倒卵形，基部与萼片同生于子房上；雄蕊8-12，花药黄色；雌蕊1，子房半下位，花柱4-5裂，线形，伸出雄蕊外。蒴果短圆锥形，长约5mm，棕色，盖裂。种子黑色，直径约1mm，表面具细点。花期5-8月，果期7-10月。\", \"wei\": \"酸；性寒\", \"liang\": \"内服：煎汤，10-15g，鲜品30-60g；或绞汁。外用：适量，捣敷；烧灰研末调敷；或煎水洗。\", \"zhi\": \"清热解毒；凉血止痢；除湿 通淋。主热毒泻痢；热淋；尿闭；赤白带下；崩漏；痔血；疮疡痈疖；丹毒；瘰疬；湿癣；白秃\" },\n  { \"name\": \"鸦胆子\", \"xing\": \"鸦胆子 常绿灌木或小乔木，高1.5-3(-8)m，金株均被黄黄色柔毛。小枝具有黄白色皮孔。奇数羽状复叶互生，长20-40cm；小叶5-11，通常7，对生，卵状披针形，长4-11cm，宽2-4.5cm，先端渐尖，基部宽楔形，偏斜，边缘具三角形粗锯齿，上面疏被、下面密彼伏柔毛，脉上尤密。聚伞状圆锥花序腋生，狭长，可达50cm；雄花序长过于叶，萼片4，卵形，长不及1mm，外面流被淡黄色硬伏毛，边缘疏生腺体，花瓣4，长圆状披针形，外面有硬毛，边缘有腺体，雄蕊4，花盘发达，半球形；雌花序短于叶，萼片、花瓣同雄花，但稍大，雄蕊具不发育的花药，花盘杯状，4浅裂，心皮通常4，卵圆形，无毛，花柱反折，紧贴子房。核果椭圆形，紫红色转黑色，长约8mm，宽5-6mm，干时具凸起的网状皱纹，略偏斜。花期4-6月，果期8-10月。\", \"wei\": \"味苦；性寒；小毒\", \"liang\": \"内服：多去壳取仁，用胶囊或龙眼肉包裹吞服，治疟疾第次10-15粒，治痢疾第次10-30粒。外用：适量，捣敷；或制成鸦胆子油局部涂敷；或煎水洗。\", \"zhi\": \"清热；解毒；杀虫；截疟；。主热毒血痢；冷痢；休息痢；疟疾；痔疮；痈肿；阴痒；白带；瘊疣；鸡眼\" },\n  { \"name\": \"地锦草\", \"xing\": \"一年生草本，含白色乳汁。茎通常从根际成二歧分生为数枝，平卧地面，呈红色，通常无毛。叶2列对生：椭圆形，长5～10毫米，宽4～6毫米，先端圆，基部不等形，边缘有细锯齿，上面绿色，下面绿白色；叶柄极短；托叶线形，通常3深裂。杯状聚伞花序，单生于枝腋或叶腋；总苞倒圆锥形，淡红色，边缘4裂；腺体4枚，椭圆形；雄花数朵和雌花1朵同生于总苞内；雄花仅雄蕊1；雌花位于花序中央，子房有长柄，3室，花柱3，2裂。蒴果扁卵形而小，有3棱，无毛。种子卵形。花朋7～8月。\", \"wei\": \"辛，平。<br>①《别录》：味苦，平，无毒。<br>②《嘉祜本草》：味辛，无毒。<br>③《四川中药志》：性子，味辛微苦涩，无毒。\", \"liang\": \"内服：煎汤，1～2钱（鲜用0.5～1两）；或入散剂。外用：捣敷或研末撒。\", \"zhi\": \"清热解毒，活血，止血，利湿，通乳。治菌痢，肠炎，咳血，吐血，便血，崩漏，外伤出血，湿热黄疸，乳汁不通，痈肿疔疮，跌打肿痛。<br>①《别录》：主心气，女子阴疝血结。<br>②《嘉v本草》：主通流血脉，亦可用治气。<br>③《品汇精要》：主调气和血。<br>④《纲目》：主痈肿恶疮，金刃扑损出血，血痢，下血，崩中，能散血止血，利小便。<br>⑤《民间常用草药汇编》：治胃部痞满疼痛，冷骨风，臭痰，痔疮及下乳。<br>⑥《浙江民间草药》：健胃止泻，治小儿疳积。<br>⑦《上海常用中草药》：止血，利尿，健胃，活血解毒。治黄疸，痢疾，腹泻，尿路感染，便血，尿血，子宫出血，痔疮出血，跌打肿痛，女人乳汁不通，蛇咬伤，头疮，皮肤疮毒。<br>⑧《福建中草药》：清热凉血，消肿解毒。\" },\n  { \"name\": \"半边莲\", \"xing\": \"无\", \"wei\": \"辛，平。\", \"liang\": \"9～15g。\", \"zhi\": \"利尿消肿，清热解毒。用于大腹水肿，面足浮肿，痈肿疔疮，蛇虫咬伤；晚期血吸虫病腹水。\" },\n  { \"name\": \"半枝莲\", \"xing\": \"无\", \"wei\": \"辛、苦，寒。\", \"liang\": \"15～30g；鲜品30～60g。外用鲜品适量，捣敷患处。\", \"zhi\": \"清热解毒，化瘀利尿。用于疔疮肿毒，咽喉肿痛，毒蛇咬伤，跌扑伤痛，水肿，黄疸。\" },\n  { \"name\": \"白花蛇舌草\", \"xing\": \"一生生披散草本，高15-50cm。根细长，分枝，白以。茎略带方形或扁圆柱形，光滑无毛，从基部发出多分枝。叶对生；无柄；叶片线形至线状披针形，长1-3.5cm，宽1-3mm，先端急尖，上面光滑，下面有时稍粗糙，侧脉不明显；托叶膜质，基部合生成鞘状，长1-2mm，先端芒尖。花单生或成对生于叶腋，常具短而咯粗的花梗，稀无梗；萼简球形，4裂，裂片长圆状披针形，长1.5-2mm，边缘具睫毛；花冠白色，漏斗形，长3.5-4mm，先端4深裂，裂片卵状长圆形，长约2mm，秃净；雄蕊4，着生于冠简喉部，与花冠裂片互生，花丝扁，花药卵形，背着，2室，纵裂；子房下位，2室。柱头2浅裂呈半球形。蒴果扁球形，直径2-2.5mm，室背开裂，花萼宿存。种子棕黄色，细小，且3个棱角。花期7-9月，果期8-10月。\", \"wei\": \"苦甘；寒；无毒\", \"liang\": \"内服：煎汤，15-30g，大剂量可用至60g；或捣汁。外用：捣敷。\", \"zhi\": \"清热解毒；利湿。主肺热喘咳；咽喉肿痛；肠痈；疖肿疮疡；毒蛇咬伤；热淋涩痛；水肿；痢疾；肠炎；湿热黄疸；癌肿\" },\n  { \"name\": \"山慈菇\", \"xing\": \"1.瓶状独蒜兰 多年生草本。假球茎近于烧瓶状，长0.5~3厘米，基部宽5~15毫米，肉质，外表绿白色带粉红色，内面白色，粘质，下部生多数灰白色须根。每年早春从假球茎下部侧方生小假球茎，常常数个横生成串。叶1片，顶生于假球茎之上，长披针形或椭圆形，通常长8~10厘米或更长，宽3~5厘米或偶达6厘米，先端渐尖，基部鞘状抱茎。夏季抽叶开花（花叶同期），花葶生于假球茎顶端，直立；花1朵，俯垂，桃粉红色，长3~4厘米；花瓣与背萼片先端急尖，唇瓣前部边缘流苏状，其中间有3~5（少数为2）条呈波状或平直的褶片，先端近平截，有时且凹缺；子房较花短。蒴果圆筒形，具棱。\", \"wei\": \"甘、微辛，寒。有小毒。\", \"liang\": \"0.8～1.5钱；外用适量，捣烂或醋磨涂患处。\", \"zhi\": \"清热解毒，消肿散结。用于痈肿疔毒，淋巴结结核，蛇咬伤。\" },\n  { \"name\": \"千里光\", \"xing\": \"多年生蔓性草木，长2～5米。根状茎圆柱形，土黄色，下生多条粗壮根及少量须根。茎圆柱形细长，曲折稍呈之字形上升，上部多分枝，有毛，后渐脱落。叶椭圆状或卵状披针形。秋季开花，头状胡须生于枝端，成圆锥状伞房花丛。瘦果圆筒形，长约3毫米，有细毛；冠毛长约7毫米，白色。\", \"wei\": \"苦，辛，凉。有小毒。\", \"liang\": \"五钱至一两，煎服。外用鲜全草适量，捣烂敷或煎水洗。\", \"zhi\": \"清热解毒，凉血消肿，清肝明目。用于风火赤眼，疮疖肿毒，皮肤湿疹及痢疾腹痛等病症。\" },\n  { \"name\": \"白蔹\", \"xing\": \"白蔹，又名：菟核、白草（《本经》），野葡萄秧、小老鸹眼、七角莲、上竹龙、早黄钳、白天天秧。藤本，以卷须攀援他物上升。块根纺锤形或块状，深棕红色，根皮栓化，易剥落。小枝光滑，棕褐色，具纵纹。吁互生，掌状复叶，具柄；小叶片通常5枚，再次作掌状或羽状分裂；小叶有短柄或几无柄，最终裂片披针形残菱形，大小不等，先端尖，基部楔形，边，缘有不规则缺刻状粗齿，叶轴及小叶柄有翅；叶上面暗绿色，下面淡绿色，均光滑无毛。聚伞花序与叶对生，总花梗长4～9厘米，常缠绕，花小，直径1.5～2毫米，淡黄色；花萼5片，不明显；花瓣5片，卵圆形，后脱落；雄蕊5枚，花丝短；花盘杯状，明显；子房着生花盘中央，2室，花柱1枚，甚短。浆果球形，直径6～7毫米，蓝色或蓝紫色。花期6～7月。果期8～9月。\", \"wei\": \"苦甘辛，凉。\", \"liang\": \"外用：研末撒或调涂。内服：煎汤，1～3钱。\", \"zhi\": \"①治疗外科炎症\" },\n  { \"name\": \"四季青\", \"xing\": \"常绿乔木，高达13m，树皮灰色，有纵沟。叶互生，薄革质，狭长椭圆形或披针形，长6～10cm，宽2～3.5cm，先端渐尖，基部楔形，边缘有浅圆锯齿，干后呈红褐色有光泽；叶柄有的为暗紫色。雌雄异株，聚伞花序生叶腋或叶腋外；花瓣紫红色或淡红色；雄花10～30朵，4～5出数，花萼钟形，花冠长2.5mm；雌花序有花3～7朵，退化雄蕊长约花瓣的1/2，柱头厚盘状。果实椭圆形，深红色，分核4～5粒，背面有一深沟。花期5月，果期10月。\", \"wei\": \"无\", \"liang\": \"无\", \"zhi\": \"清热解毒，消肿祛瘀。用于肺炎、急性咽喉炎、痢疾、胆道感染、尿路感染；外治烧伤、下肢溃疡、麻风溃疡。\" },\n  { \"name\": \"绿豆\", \"xing\": \"绿豆 一年生直立或顶端微缠绕草本。高约60cm，被短褐色硬毛。三出复叶，互生；叶柄长9-12cm；小叶3，叶片阔卵形至菱状卵形，侧生小叶偏斜，长6-10cm，宽2.5-7.5cm，先端渐尖，基部圆形、楔形或截形，两面疏被长硬毛；托叶阔卵形，小托叶线形。总状花序腋生，总花梗短于叶柄或近等长；苞片卵形或卵状长椭圆形，有长硬毛；花绿黄色；萼斜钟状，萼齿4，最下面1齿最长，近无毛；旗瓣肾形，翼瓣有渐窄的爪，龙骨瓣的爪截形，其中一片龙骨瓣有角；雄蕊10，二体；子房无柄，密被长硬毛。荚果圆柱形，长6-8cm，宽约6.mm，成熟时黑色，被疏褐色长硬毛。种子绿色或暗绿色，长圆形。花期6-7月，果期8月。\", \"wei\": \"味甘；性寒\", \"liang\": \"内服：煎汤，15-30g，大剂量可用120g；研末；或生研绞汁。外用：适量，研末调敷。\", \"zhi\": \"清热；消暑；利水；解毒。主暑热烦渴；感冒发热；霍乱吐泻；痰热哮喘；头痛目赤；口舌生疮；水肿尿少；疮疡痈肿；风疹丹毒；药物及食物中毒\" },\n  { \"name\": \"绿豆衣\", \"xing\": \"无\", \"wei\": \"甘，寒。\", \"liang\": \"1～3钱，煎服。\", \"zhi\": \"解热毒，退目翳。\" },\n  { \"name\": \"赤小豆\", \"xing\": \"1.赤小豆 一年生半攀援草本。茎长可达1.8m，密被倒毛。三出复叶；叶柄长8-16cm；托叶披针形或卵状披针形；小叶3枚，被针形、长圆状披针形，长6-10cm，宽2-6cm，先端渐尖，基部阔三角形或近圆形，全缘或具3浅裂，两面均无毛，纸质；小叶具柄，脉3出。总状花序腋生，小花多枚，花柄极短；小苞2枚，披针状线形，长约5mm，具毛；萼短钟状，萼齿5；花冠蝶形，黄色，旗瓣肾形，顶面中央微凹，基部心形，翼瓣斜卵形，基部具渐狭的爪，龙骨瓣狭长，有角状突起；雄蕊10，二体，花药小；子房上位，密被短硬毛，花柱线形。荚果线状扁圆柱形。种子6-10颗，暗紫色，长圆形，两端圆，有直而凹陷的种脐。花期5-8月，果期8-9月。\", \"wei\": \"味甘；酸；性微寒\", \"liang\": \"内服：煎汤，10-30g；或入散剂。外用：适量，生研调敷；或煎汤洗。\", \"zhi\": \"利水消肿退黄；清热解毒消痈。主水肿；脚气；黄疸；淋病；便血；肿毒疮疡；癣疹\" },\n  { \"name\": \"地黄\", \"xing\": \"无\", \"wei\": \"鲜地黄：甘、苦，寒。<br>生地黄：甘，寒。\", \"liang\": \"鲜地黄：12～30g。生地黄：9～15g。\", \"zhi\": \"鲜地黄：清热生津，凉血，止血。用于热病伤阴，舌绛烦渴，发斑发疹，吐血，衄血，咽喉肿痛。<br>生地黄：清热凉血，养阴，生津。用于热病舌绛烦渴，阴虚内热，骨蒸劳热，内热消渴，吐血，衄血，发斑发疹。\" },\n  { \"name\": \"玄参\", \"xing\": \"多年生草本，高60～120厘米。根圆柱形，长5～12厘米，直径1.5～3厘米，下部常分叉，外皮灰黄褐色。茎直立，四枝形，光滑或有腺状柔毛。叶对生；叶柄长0.5～2厘米；叶片卵形或卵状椭圆形，长7～20厘米，宽3.5～12厘米，先端渐尖，基部圆形或近截形，边缘具钝锯齿，下面有稀疏散生的细毛。聚伞花序疏散开展，呈圆锥状；花梗氏1～3匣米，花序和花梗都有明显的腺毛；萼片5裂，卵圆形，先端钝，外面有腺状细毛；花冠暗紫色，管部斜壶状，长约8毫米，有5裂片，上面2裂较长而大，侧面2裂片次之，下面裂片最小；雄蕊4，2强，另有1枚退化的雄蕊，呈鳞片状，贴生在花冠管上；花盘明显；子房上位，2室，花柱细长。蒴果卵圆形，先端短尖，深绿或暗绿色，长约8毫米，萼宿存。花期7～8月。果期8～9月。\", \"wei\": \"苦咸，凉。\", \"liang\": \"内服：煎汤，3～5钱；或入丸，散。外用：捣敷或研末调敷。\", \"zhi\": \"滋阴，降火，除烦，解毒。治热病伤阴，舌绎烦渴，发斑，骨蒸劳热，夜寐不宁，自汗盗汗，津伤便秘，吐血衄血，咽喉肿痛，痈肿，瘰疬，温毒发斑、目赤、白喉、疮毒。\" },\n  { \"name\": \"牡丹皮\", \"xing\": \"牡丹 落叶小灌木，高1-2m。根粗大。茎直立，枝粗壮，树皮黑灰色。叶互生，纸质；叶柄长5-11cm，无毛；叶通常为二回三出复叶，或二回羽状复叶，近技项的叶为三小叶，顶生小叶常深3裂，长7-8cm，宽5.5-7cm，裂片2-3浅裂或不裂，上面绿色，无毛，下面淡绿色，有时被白粉，沿叶脉疏被短柔毛或近无毛，小叶柄长1.2-3cm；侧生小叶狭卵形或长圆状卵形，长4.5-6.5cm，宽2.5-4cm，2-3浅裂或不裂，近无柄。花两性，单生枝项，直径10-20cm；花梗长4-6cm；苞片5，长椭圆形，大小不等；萼片5，宽卵形，大小不等，绿色，宿存；花瓣5，或为重瓣，倒卵形，长5-8cm，宽4.2-6cm，先端呈不规则的波状，紫色、红色、粉红色、玫瑰色、黄色、豆绿色或白色，变异很大；雄蕊多数，长l-1.7cm，花丝亦具紫红等色，花药黄色；花盘杯状，草质，顶端有数个锐齿或裂片，完全包裹心皮，在心皮成熟时裂开；心皮5，稀更多，离生，绿色，密被柔毛。u果长圆形，腹缝线开裂，密被黄褐色硬毛。花期4-5月，果期6-7月。\", \"wei\": \"辛苦；凉；微寒\", \"liang\": \"内服：煎汤，6-9g；或入丸、散。\", \"zhi\": \"清热；活血散瘀。主温热病热入血分；发斑；吐衄；热泪盈眶病菌后期热伏阴分发热；阴虚骨蒸潮热；血滞经闭；痛经；痈肿疮毒；跌扑伤痛；风湿热痹\" },\n  { \"name\": \"赤芍\", \"xing\": \"1.芍药 多年生草本，高40-70cm，无毛。根肥大，纺锤形或圆柱形，黑褐色。茎直立，上部分枝，基部有数枚鞘状膜质鳞片。叶互生；叶柄长达9cm，位于茎顶部者叶柄较短；茎下部叶为二回三出复叶，上部叶为三出复叶；小叶狭卵形、椭圆形或披针形，长7.5-12cm，宽2-4cm，先端渐尖，基部楔形或偏斜，边缘具白色软骨质细齿，两面无毛，下面沿叶脉疏生短柔毛，近革质。花两性，数朵生茎顶和叶腋，直径7-12cm；苞片4-5，披针形，大小不等；萼片4，宽卵形或近圆形，长1-1.5cm，宽1-1.7cm，绿色，宿存；花瓣9-13，倒卵形，长3.5-6cm，宽1.5-4.5cm，白色，有时基部具深紫色斑块或粉红色，栽培品花瓣各色并具重瓣；雄蕊多数，花丝长7-12mm，花药黄色；花盘浅杯状，包裹心皮基部，先端裂片钝圆；心皮2-5，离生，无毛。蓇葖果卵形或卵圆形，长2.5-3cm，直径1.2-1.5cm，先端具椽，花期5-6月，果期6-8月。\", \"wei\": \"苦；微寒\", \"liang\": \"内服：煎汤，4-10g；或入丸、散。\", \"zhi\": \"冠芍片赤芍1500g，三七90g，佛手900g，泽泻900g，甘草150g。以上五味，先将赤芍10％量与三七粉碎成细粉，其余药物加水煎煮3次，滤过，合并滤液，减压浓缩至相对密度1.35-1.40（50℃测）的稠膏；膏粉混合，干燥，粉碎成细粉，制粒，干燥，压片，片心重0.3g，包糖衣。本品除去糖衣呈浅褐色，气微香，味微香甜。功能活血化瘀，理气止痛，有扩张冠状动脉，增加血流量的作用。用于冠心病的胸闷，心绞痛，高脂血症。口服，每次5片，每日3次。（《北京市药品标准》1983年；《江苏省药品标准》1977年）\" },\n  { \"name\": \"紫草\", \"xing\": \"1.软紫草 多年生草本，高15-40cm。全株被白色或淡黄色长硬毛。根粗壮。略呈圆锥形，根部常与数个侧根扭卷在一起，外皮暗红紫色。茎直立，单一或基部分成两歧，基部有残存叶基形成的茎鞘。基生叶丛生，线状披针形或线形，长5-20cm，宽5-15cm，先端短渐尖，基部无鞘状；无叶柄。镰状聚伞花序密集于茎上叶腋，长2-6cm；花两性，苞片叶状，披针形，具硬毛；花萼短简状，5裂，裂片狭条形，两面均密生淡黄色硬毛；花冠简状钟形，紫色或淡紫色，长1-.5cm ,裂片椭圆形，开展；外侧略被白毛，喉部与基部光滑，无附属物；雄蕊5，花丝短或无，关睡于花冠简中部或喉部；子房4深裂，花柱纤细，先端浅2裂，柱头2，倒卵形。小坚果宽卵形，褐色，长3.5mm，宽约3mm。有粗网纹和少数疣突起。花期6-7月，果期8-9月。\", \"wei\": \"苦；寒\", \"liang\": \"内服：煎汤，3-9g：或入散剂。外用：适量，熬膏或制油涂。\", \"zhi\": \"1.治疗急慢性肝炎：用从紫草根中提取的紫草红(素)干燥粉末为熔质，以氢氧化钠溶液为溶剂，制成0.2%紫草注射液。肌肉注射，每日1-2次，每次2ml。计观察黄疸型传染性肝炎13例，均治愈；急性无黄痘型传染性肝炎157例，治愈139例，显效6例，好转12例；慢性肝炎 113例，治愈84例，显效 14例，好转2例，无效13例。此外，尚治疗肝硬化4例，亦取得一定疗效。\" },\n  { \"name\": \"紫草茸\", \"xing\": \"紫胶虫，雌虫身体为不规则的圆球状，紫色，深藏于胶质中。表面有3个突起；其1为肛门；另2个为中胸气门，周围环绕有丝状蜡质。肛门四周有肛门环和肛门棘包围。雄虫体小，分有翅和无翅两型。有翅型体长1mm，宽0.4mm，紫红色。翅膜质。复部8节，腹端着生一角质化的阴茎鞘，两侧各具一根白蜡丝。无翅型体长2-3mm。触角1对，细长，向前伸。足3对，细弱，呈浅黄色。\", \"wei\": \"味甘；咸；性平\", \"liang\": \"内服：煎汤，3-10g；研末，1.5-3g。外用：适量，研末撒或熬膏涂敷。\", \"zhi\": \"清热；凉血；解毒。主麻疹、斑疹不透；月经过多；崩漏；疮疡；湿疹\" },\n  { \"name\": \"水牛角\", \"xing\": \"无\", \"wei\": \"苦，寒。\", \"liang\": \"15～30g，宜先煎3小以上。\", \"zhi\": \"清热解毒，凉血，定惊。用于温病高热，神昏谵语，发斑发疹，吐血衄血，惊风，癫狂。\" },\n  { \"name\": \"青蒿\", \"xing\": \"黄花蒿 一年生草本，高40-150cm。全株具较强挥发油气味。茎直立，具纵条纹，多分枝，光滑无毛。基生叶平铺地面，开花时凋谢；茎生叶互生，幼时绿色，老时变为黄褐色，无毛，有短柄，向上渐无柄；叶片通常为三回羽状全裂，裂片短细，有极小粉末状短柔毛，上面深绿色，下面淡绿色，具细小的毛或粉末状腺状玟点；叶轴两侧具窄翅；茎上部的叶向下膛渐细小呈条形。头关花序细小，球形，径约2mm，具细软短梗，多数组成圆锥状；总苞小，于状，花全为管状花，黄色，外围为雌花，中央为两性花。瘦果椭圆形。花期8-10月，果期10-11月。\", \"wei\": \"味苦；微辛；性寒\", \"liang\": \"内服：煎汤，6-15g，治疟疾可用20-40g，不宜久煎；鲜品用量加倍，水浸绞汁饮；或入丸、散。外用：适量，研末调敷；或鲜品捣敷；或煎水洗。\", \"zhi\": \"清热；解暑；除蒸；截疟。主暑热；暑湿；湿温；阴虚发热；疟疾；黄疸\" },\n  { \"name\": \"白薇\", \"xing\": \"1.白微又名：直立白薇。多年生草本，高40-70cm。植物体具白色乳汁。根茎短，簇生多数细长的条状根，根长达20cm以上，直径2-3mm,外皮土黄色。茎直立，绿色，圆柱形，通常不分枝，密被灰白色短柔毛。叶对生；具短柄；叶片卵形，或卵状长圆形，长约5-10cm，宽约3-7cm，先端短渐尖，基部圆形，全缘，两面均被白色绒毛，尤以叶背及脉上为密；侧脉6-7对。花多数，在茎梢叶腋密集成伞形聚伞花序；无总花梗，花深紫色，直径约10mm；花萼绿色，5深外面有绒毛，内面基部有小腺体5个。花冠幅状，5深裂，外面有短柔毛，并具缘毛；副花冠5裂，裂片盾状圆形，与合蕊柱等长；花药先端具一圆形的膜片；花粉块每室1个，下垂，长圆状膨大；柱头扁平。蓇葖果单生，长5-9cm，直径5-15mm，先端渐尖，基部钝形，中间膨大。种子多数，卵圆形，有狭翼，长约4mm；种毛白色，长约3cm。花期5-7月，果期8-10月。\", \"wei\": \"味苦；咸；性寒\", \"liang\": \"内服：煎汤，3-15g；或入丸、散。\", \"zhi\": \"清热益阴；利尿通淋；解毒疗疮。主主治温热；身热斑疹；潮热骨蒸；肺热咳嗽；产后虚烦；热淋；血淋；咽喉肿痛；疮痈肿毒；毒蛇咬伤\" },\n  { \"name\": \"地骨皮\", \"xing\": \"无\", \"wei\": \"甘，寒。<br>①《本经》：味苦，寒。<br>②《别录》：大寒，无毒。<br>③《纲目》：味甘淡，寒。\", \"liang\": \"内服：煎汤，3～6钱；或入丸、散。外用：煎水含漱、淋洗，研末撒或调敷。\", \"zhi\": \"清热，凉血。治虚劳潮热盗汗，肺热咳喘，吐血，衄血，血淋，消渴，高血压，痈肿，恶疮。<br>①《本经》：主五内邪气，热中消渴，周痹。<br>②《别录》：主风湿，下胸胁气，客热头痛，补内伤大劳嘘吸，坚筋，强阴，利大小肠，耐寒暑。<br>③《药性论》：细锉，面拌熟煮吞之，主治肾家风。<br>④《食疗本草》：去骨热消渴。<br>⑤《本草别说》：治金疮。<br>⑥李杲：治在表无定之风邪，传尸有汗之骨蒸。<br>⑦王好古：泻肾火，降肺中伏火，去胞中火，退热，补正气。<br>⑧《日用本草》：治上膈吐血；煎汤漱口，止齿血，治骨槽风。<br>⑨《纲目》：去下焦肝肾虚热。<br>⑩《本草述》：主治虚劳发热，往来寒热，诸见血证、鼻衄、咳嗽血，咳嗽、喘，消瘅，中风，眩晕，痉痼，腰痛，行痹，脚气，水肿，虚烦，悸，健忘，小便不通，赤白浊。\" },\n  { \"name\": \"银柴胡\", \"xing\": \"多年生草本，高20-40cm。主根圆柱形，直径1-3cm，外皮淡黄色，根头处有许多疣状的茎部残基。茎直立而纤细，上部二叉状分枝，密被短毛或腺毛；节略膨大。单叶对生；无柄；叶片披针形，长4-30mm，宽1.5-4mm，先端锐关，基都圆形，全缘，上面疏被短毛或几无毛，下面被短毛。花单生于叶腋，直径约3mm；花梗长约2cm；萼片5，披针形，长约4mm，绿色，边缘白色膜质；花瓣5，较导片为短，白色，先端2深裂；雄蕊10，2轮，花丝基部合生，黄色；子房上位，花柱3，细长。蒴果近球形，外被宿萼，成熟时先端6齿裂。种子通常1粒，椭圆形，深棕色，种皮有多数小突起。花期 6-7月，果期8-9月。\", \"wei\": \"甘；性微寒\", \"liang\": \"内服：煎汤，5-9g；或入丸、散。\", \"zhi\": \"清虚热；除疳热。主阴虚发热；骨蒸劳热；小儿疳积发热\" },\n  { \"name\": \"胡黄连\", \"xing\": \"1.西藏胡黄连 多年生草本，高5-10cm。根茎粗壮，长圆锥形，横走，长15-50cm，节间紧密，常有暗棕色鳞片状老叶及圆柱状支根。叶近基生，常集成莲座状；叶片匙形至卵表，长2-7cm，宽1.5-3.5cm，先端圆或钝，基部渐窄成短柄，边缘除基部外均有钝锯齿，无毛，干时变黑。花葶自叶丛中生出，高5-15cm，被腺毛，花密集成顶生穗状的圆锥聚伞花序；苞片、花萼均被毛，苞片卵形；萼片4，长5-6mm，其中一裂片几线形，其他4裂片近披针形、狭长圆形至狭长椭圆形；花冠暗紫色或浅蓝色，二唇形，内外具疏柔毛；雄蕊4，二强，着生于花冠管中部；子房2室；胚珠每室多数，花柱细长，柱头头状。蒴果卵圆形，长9-12mm，先端4裂。种子多数，长圆形，有光泽，具网眼。花期6-8月，果期8-9月。<br>2.胡黄连 多年生草本，有毛。根茎圆柱形，稍带木质，长15-20cm。叶近于根生，稍带革质；叶片匙形，长5-10cm，先端尖，基部狭窄成有翅的具鞘叶柄，边缘有细锯齿。花茎长于叶；穗状花序长5-10cm，下有少数苞片；苞片长圆形或披针形，与萼等长；萼片5，披针形，长约5mm，有缘毛；花冠短于花萼，先端5相等的裂片，裂片卵形，具缘毛，内面具疏柔毛，外面无毛或近无毛；雄蕊4，花丝细长，伸出花冠，无毛；子房2室，花柱细长，柱头单一。蒴果长卵形，长6mm，侧面稍有槽，主要室间开裂。种子长圆形，长1mm。花期6月，果期7月。\", \"wei\": \"味苦；性寒\", \"liang\": \"内服：煎汤，6-12g；或入丸、散。外用：适量，研末调敷；或浸汁点眼。\", \"zhi\": \"退虚热；消疳热；清热燥湿；泻火解毒。主阴虚骨蒸；潮热盗汗；小儿疳疾；湿热泻痢；黄疸；吐血；衄血；目赤肿痛；痈肿疮疡；痔疮肿毒\" }] },\n\n{\n  \"name\": \"泻下药\",\n  \"num\": 17,\n  \"content\": [\n  { \"name\": \"大黄\", \"xing\": \"1、掌叶大黄 多年生草本，高达2米。地下有粗壮的肉质根及根状茎。茎粗壮，中空，绿色，平滑，无毛，有不甚明显的纵纹。单叶互生；具粗壮长柄，柄上密生白色短刺毛；基生叶叶片圆形或卵圆形，长宽近相等，达35厘米，掌状5～7深裂，裂片矩圆形或宽披针形，先端尖，边缘有大的尖裂齿，叶上面疏生乳头状小突起和白色短刺毛，下面有白色柔毛，以脉上为多，并疏生黑色腺点，叶基部心形；茎生叶较小，有短柄；托叶鞘大，筒状，绿色，有纵纹，密生白色短柔毛。秋季开淡黄白色花，大圆锥花序顶生；花梗纤细，中下部有关节；花被6裂，长约1.5毫米，排为2轮；雄蕊9个。瘦果矩卵圆形，有3棱，沿棱生翅，翅边缘半透明，顶端稍凹陷，基部呈心形。\", \"wei\": \"苦，寒。\", \"liang\": \"1～4钱；外用适量。\", \"zhi\": \"泻实热，破积滞，行瘀血。主治：实热便秘，食积停滞，腹痛，急性阑尾炎，急性传染性肝炎，血瘀经闭，牙痛，衄血，急性结膜炎；外用治烧烫伤，化脓性皮肤病，痈肿疮疡。\" },\n  { \"name\": \"芒硝\", \"xing\": \"单斜晶系。晶体为短柱状，通常成致密粒状、被膜状。无色透明，但常带浊白、浅黄、淡蓝、淡绿等色。条痕为白色。玻璃样光泽。断口贝壳状，硬度1.5～2。比重1.5。性脆。形成于含钠离子和硫酸根离子饱和溶液的内陆盐湖中。\", \"wei\": \"辛苦咸，寒。\", \"liang\": \"内服：溶入汤剂，1.5～3钱；或入丸、散。外用：研细点眼或水化涂洗。\", \"zhi\": \"①用于退乳\" },\n  { \"name\": \"番泻叶\", \"xing\": \"1.狭叶番泻 草本状小灌木，高约1m。托叶卵状披针形，长2-4mm；偶数羽状复叶，互生；具短柄；小叶5-8对，叶片卵状披针形至线状披针形，长2-4cm，宽0.7-1.2cm，先端急尖，基部稍不对称，无毛或几无毛。总状花序腋生或顶生；花6-14朵，花梗基部有一卵形易落的苞片；萼片5，长卵形，略不等大；花瓣5，黄色，倒卵形，下面两瓣较大；雄蕊10，上部3枚小形，不育，中央4枚等长，最下面3枚向下弯曲，两侧者较长，花药稍呈四方形，基部箭形，4室；雌蕊弯曲如镰，子房具柄，被疏毛。荚果长方形，扁平，长4-6cm，宽1-1.7cm，先端尖突微小，不显着，幼时有毛；种子4-7颗，种皮棕绿色，有细线状种柄，具疣状皱纹。花期9-12月，果期翌年3月。\", \"wei\": \"甘苦；寒凉\", \"liang\": \"内服：煎汤，3-6g。，后下；或泡茶；或研末，1.5-3g。\", \"zhi\": \"治疗产褥期便秘：取番泻叶2.5钱， 冲开水约150ml，经3-5分钟，弃渣1次服下。如便秘时间过久，隔10分钟后将药渣再泡服1次。治疗100例，多数服1次即见效。服药后少数有轻度下腹疼痛。未见乳汁减少、恶露增多或全身不适等不良影响；且通便后子宫复旧良好，恶露减少。但平素脾胃虚弱者不宜服用。\" },\n  { \"name\": \"芦荟\", \"xing\": \"①库拉索芦荟\", \"wei\": \"苦，寒。\", \"liang\": \"内服：入丸、散，0.5～1.5钱。外用：研末调敷。\", \"zhi\": \"治疗臭鼻症（萎缩性鼻炎）：先以2％地卡因浸湿之棉片贴附注射部位5～10分钟，然后用20％芦荟浸出液注射于两侧下鼻甲前端粘膜下，其深浅以注射部粘膜出现苍白水肿状为度，每侧注射药液2毫升，再用棉球轻压注射部位以防出血。每周1次，4次为一疗程。观察48例，经治一疗程29人，一疗程以上6人，不足一疗程13人。其中2例于第1次注射后即觉鼻内舒服，干燥减轻，窒感消失；24例于注射2～3次后觉头昏、头痛及恶臭减轻或消失，痂皮减少，鼻涕变稀，容易擤出；有的注射15次后始感到部分症状改善。大多数病人的主要症状如结痂、恶臭、头昏、头痛等，均有不同程度的改善；少数无效。治程中无不良反应。\" },\n  { \"name\": \"火麻仁\", \"xing\": \"大麻（《本草经集注》），又名：麻（《诗经》），汉麻（《事物纪原》），火麻（《日用本草》），山丝苗（《救荒本草》），黄麻（《纲目》）。\", \"wei\": \"甘，平。\", \"liang\": \"内服：煎汤，3～6钱；或入丸、散。外用：捣敷或榨油涂。\", \"zhi\": \"润燥，滑肠，通淋，活血。治肠燥便秘，消渴，热淋，风痹，痢疾。月经不调，疥疮，癣癞。\" },\n  { \"name\": \"郁李仁\", \"xing\": \"①郁李（《本经》），又名：英梅（《尔雅》），爵李（《本经》），白橡（《说文》），雀李、车下李（《吴普本草》），山李、爵梅（《广雅》），样藜（《滇南本草》），千金藤（《医学正传》），秧李、穿心梅（《植物名实图考长编》），侧李。<br>落叶灌木，高1～1.5米。树皮灰褐色，有不规则的纵条纹；幼枝黄棕色，光滑。叶互生；叶柄长2～3毫米，被短柔毛；托叶2枚，线形，呈篦状分裂，早落；叶片通常为长卵形或卵圆形，罕为卵状披针形，长5～6厘米，宽2.5～3厘米，先端渐尖，基部圆形，边缘具不整齐之重锯齿，背面沿主脉具短柔毛。花先叶开放，2～3朵簇生；花梗长2～5毫米，有棱，散生白色短柔毛，基部为数枚茶褐色的鳞片包围，鳞片长圆形，密被锈色绒毛，有细齿；花萼5，基部成浅萼筒，先端锐尖，边缘疏生乳突状锯齿，网脉明显；花瓣5，浅红色或近白色，具浅褐色网纹，斜长圆形，边缘疏生浅齿；雄蕊多数，花药圆形或略呈方形，花丝不等长；雌蕊1，子房长圆形，1室，花柱被柔毛。核果近圆球形，暗红色。花期5月。果期6月。<br>生长在向阳山坡、路旁或小灌木丛中。分布辽宁、内蒙古、河北、河南、山西、山东、江苏、浙江、福建、湖北、广东等地。<br>本植物的根（郁李根）亦供药用，另详专条。<br>②欧李（《异域录》），又名：酸丁（《热河志》），乌拉柰、欧梨。<br>落叶灌木，高1～1.5米。多分枝，小枝被柔毛。叶互生；叶柄长约2毫米；叶片长圆形或椭圆状披针形，长1.5～5厘米，宽约2厘米，先端尖或短渐尖，基部楔形，边缘有浅细锯齿，两面均光滑，间或在叶背面沿主脉散生短柔毛。花与叶同时开放，单生或2朵并生；花梗长6～8毫米，光滑；花萼5；花瓣5，白色或稍近粉红色，上具较深的同色网纹，长倒卵形至倒卵形；雄蕊多数，花药长圆形至宽线形，花丝不等长；雌蕊1，子房1室，花柱无毛。核果球形。成熟时鲜红色，有光泽。花期4～5月。果期5～6月。<br>生长于向阳山坡上。分布辽宁、吉林、黑龙江、内蒙古、山东、河南、河北等地。<br>③长梗郁李<br>形态与郁李相似，主要不同点为花梗较长，长达1.5厘米以上。<br>分布黑龙江、辽宁、吉林、内蒙古等地。\", \"wei\": \"辛苦甘，平。<br>①《本经》：味酸，平。<br>②《别录》：无毒。<br>③《药性论》：味苦辛。<br>④《蜀本草》：甘酸。\", \"liang\": \"内服：煎汤，1～3钱；或入丸、散。\", \"zhi\": \"润燥，滑肠，下气，利水。治大肠气滞，燥涩不通，小便不利，大腹水肿，四肢浮肿，脚气。<br>①《本经》：主大腹水肿，面目、四肢浮肿，利小便水道。<br>②《药性论》：治肠中结气，关格不通。<br>③《食疗本草》：破癖气，下四肢水。<br>④《日华子本草》：通泄五脏，膀胱急痛，宣腰胯冷脓，消宿食，下气。<br>⑤《珍珠囊》：破血润燥。<br>⑥李杲：专治大肠气滞，燥涩不通。<br>⑦《本草再新》：行水下气，破血消肿，通关节，治眼长翳。\" },\n  { \"name\": \"松子仁\", \"xing\": \"无\", \"wei\": \"甘，温。\", \"liang\": \"2～5钱。\", \"zhi\": \"润肺，滑肠。用于肺燥咳嗽，慢性便秘。\" },\n  { \"name\": \"甘遂\", \"xing\": \"甘遂，又名：猫儿眼。<br>多年生肉质草本，高25～40匣米，全草含乳汁。根细长而微弯曲，部分呈连珠状或棒状，亦有呈长椭圆形者，外皮棕褐色。茎直立，淡紫红色。单叶互生，狭技针形或线状披针形，长3～5厘米，宽6～10毫米，先端钝，基部阔楔形，全缘；无柄或具短柄。杯状聚伞花序成聚伞状排列，通常5～9枝簇生于茎端，基部轮生叶状苞片多枚；有时从茎上部叶腋抽生1花枝，每枝顶端再生出1～2回聚伞式3分枝；苞叶对生；萼状总苞先端4裂，腺体4枚：花单性，无花被；雄花多数和雌花1枚生于同一总苞中；雄花仅有雄蕊1；雌花位于花序中央，雌蕊1，子房三角卵形，3室，花柱3，柱头2裂。蒴果圆形。种子卵形，棕色。花期6～9月。\", \"wei\": \"苦甘，寒，有毒。<br>①《本经》：味苦，寒。<br>②《吴普本草》：神农、桐君：苦，有毒。<br>③《别录》：甘，大寒，有毒。\", \"liang\": \"内肠煎汤，0.5～1钱；或入丸、散。外用：研末调敷。\", \"zhi\": \"泻水饮，破积聚。通二便。治水肿胀满，留饮，结胸，痢痫，噎膈，Y瘕积聚，二便不通。<br>①《本经》：主大腹疝瘕，腹满，面目浮肿，留饮宿食，破Y坚积聚，利水谷道。<br>②《别录》：下五水，散膀胱留热，皮中痞，热气肿满。<br>③《药性论》：能泻十二种水疾，治心腹坚满，下水，去痰水，主皮肤浮肿。<br>④《纲目》：泻肾经及隧道水湿，脚气，阴囊肿坠，痰迷癫痫，噎膈痞塞。\" },\n  { \"name\": \"京大戟\", \"xing\": \"多年生草本，全株含乳汁。茎直立，被白色短柔毛，上部分枝。叶互生，长圆状披针形至披针形，长3～8cm，宽5～13mm，全缘。伞形聚伞花序顶生，通常有5伞梗，腋生者多只有工梗，伞梗顶生1杯状聚伞花序，其基部轮生卵形或卵状披针形苞片5，杯状聚伞花序总苞坛形，顶端4裂，腺体椭圆形；雄花多数，雄蕊1；雌花1，子房球形，3室，花柱3，顶端 2浅裂。蒴果三棱状球形，表面有疣状突起。花期4～5月，果期6～7月。\", \"wei\": \"无\", \"liang\": \"无\", \"zhi\": \"泻水逐饮。\" },\n  { \"name\": \"红大戟\", \"xing\": \"红大戟，多年生草本，高30-100cm。块根通常2-3个，纺锤形，红褐色或棕褐色。茎直立或上部稍呈蔓状，稍具棱。叶对生，无柄；叶片长椭圆形至条状披针形，长2-10cm，宽0.5-3cm，先端窄或短渐尖，基部楔形，全缘，上面被白色柔毛，下面沿脉及叶脉被毛；托叶2-4裂，裂片钻形。聚伞花序，花多数，密集成球形，直径1-1.5cm，花小，淡紫红色；花萼浅4裂，3片小，1片大；花冠管状漏斗形，先端4裂，裂片舌状，喉部密被长毛；雄蕊4，着生在花冠管中部；子房下位，2室，花柱细长，柱头2裂。果实很小，卵形或椭圆形。花期9月，果期10月。\", \"wei\": \"苦；寒；有毒\", \"liang\": \"内服：煎汤，1.5-3g；研末，0.3-1g；或入丸、散；或泡酒。外用：适量，捣敷；或煎汤洗。\", \"zhi\": \"用于水肿胀满，痰饮喘急。红大戟苦寒泄降，能通利二便而泻水逐饮，为近代治水肿痰饮者所常用，证轻者单用，重者多入复方。治水肿，常与芫花、甘遂、大枣等配伍，有泻水护胃之效；治痰饮喘急，常与白芥子、甘遂等同用，以增强消痰逐饮之力。用于痈疮肿毒。红大戟解毒散结，治疮痈肿毒，内服或外用，单用或入复方，均可收效。\" },\n  { \"name\": \"芫花\", \"xing\": \"芫花 直立落叶灌木，高达1m。根长者可达10cm，主根直径0.6-1.5cm，有分歧，外表黄棕色至黄褐色；根皮富韧性。茎直径至1cm，暗棕色；枝细长，褐紫色，幼时密生绢状短柔毛。叶对生，间或互生；有短柄，长约1mm，被短柔毛；叶片椭圆形至长椭圆形，长2.5-5cm，宽0.8-2cm，稍带革质，先端尖，全缘，幼时叶之两面流生绢状短柔毛，以脉上为密，老则渐脱。花淡紫色，腋生，先叶开放，通常3-7朵生叶腋间短梗上，以枝端为多；花两性，无花瓣；花被管细长，长约1cm，密被绢状短柔毛，先端4裂，裂片卵形，长不及1cm；雄蕊8，2轮，着生于花被管上，不具花丝；雌蕊1，子房上位，1室，花柱极短或缺如，柱头头状。核果革质，白色。种子1颗，黑色。花期3-4月，果期5月。\", \"wei\": \"辛；苦；性温；有毒\", \"liang\": \"内服：煎汤，1.5-3g；研末服0.6-1g，每日1次。外用：研末调敷或煎水洗。\", \"zhi\": \"泻水逐饮；祛痰止咳；解毒杀虫。主水肿；膨胀；痰饮胸水；喘咳；痈疖疮癣\" },\n  { \"name\": \"狼毒\", \"xing\": \"①瑞香狼毒，又名：断肠草、打碗花、山丹花、闷头花、一把香。<br>多年生草本，高20～40厘米。根圆柱形。茎丛生，平滑无毛，下部几木质，带褐色或谈红色。单叶互生，较密；狭卵形至线形，长1～3厘米，宽2～10毫米，全缘，两面无毛；老时略带革质；叶柄极短。头状花序顶生，直径约2.5厘米，花多数；萼常呈花冠状，白色或黄色，带紫红色，萼筒呈细管状，先端5裂，裂片平展，矩圆形至倒卵形；雄蕊10，成2列着生于喉部；子房上位，上部密被细毛，花柱短，柱头头状。果卵形，为花被管基部所包。种子1枚。花期5～6月。<br>生于高山及草原。分布东北、华北、西北、西南等地。<br>②狼毒大戟<br>多年生草本，高15～40厘米，全体含白色乳汁。根肉质肥大。茎下部叶鳞片状，膜质，淡褐色；中、上部叶3～5片轮生，无柄；叶片长圆形或长圆状卵形，长4～6.5厘米，宽1～3厘米。先端钝或急尖，基部圆。杯状聚伞花序顶生，排成复伞形；伞梗5枝，基部轮生叶状苞片5；每枝再分3枝，分枝处有3片三角卵形的苞叶，小枝先端具2片较小的苞叶及1～3个杯状聚伞花序；雄花多数和雌花1枚同生于杯形的总苞内，总苞先端5裂，腺体5个与裂片互生；雄花仅有雄蕊1；雌花仅有雌蕊1，子房扁圆形，花柱3，先端浅裂成2叉状柱头。蒴果扁球形，有3纵沟，褐色。花期5～6月。果期6～7月。<br>生于山坡及山野向阳处。分布东北及河北、内蒙古、山西等地。<br>③月腺大戟<br>多年生草本，高30～50厘米。叶互生；叶片狭椭圆形或椭圆状披针形，长4～8厘米，宽1.5～2厘米，先端圆，基部楔形。杯状聚伞花序，排成复伞形；伞梗5枝，基部具卵状披针形或三角状长卵形的叶状苞片4～5枚；每枝再分2枝，分枝处有三角卵形或广卵形苞叶2枚，小枝先端具2片较小的苞叶及1个杯状聚伞花序；雌雄花同生于萼状杯形的总苞内，总苞先端4浅裂，腺体4个。蒴果光滑无毛。花期5～6月。<br>生于山坡或林下草丛中。分布几遍全国。\", \"wei\": \"苦辛，平，有毒。<br>①《本经》：味辛，平。<br>②《别录》：有大毒。<br>③《药性论》：味苦辛，有毒。<br>④《本经逢原》：苦辛，寒，大毒。\", \"liang\": \"内服：煎汤，3～8分；或入丸、散。外用：磨汁涂或研末调敷。\", \"zhi\": \"逐水祛痰，破积杀虫。治水肿腹胀，痰、食、虫积，心腹疼痛，慢性气管炎，咳嗽，气喘，淋巴结、皮肤、骨、副睾等结核，疥癣，痔瘘。<br>①《本经》：主咳逆上气，破积聚，饮食，寒热，水气，恶疮，鼠瘘疽蚀，蛊毒。<br>②《别录》：疗胁下积癖。<br>③《药性论》：治痰饮，Y瘕。<br>④《滇南本草》：治胃中年深日久饮食结住，积久稠痰，状粘如胶。攻虫积，利水道，下气，消水肿，吐痰涎。<br>⑤《本草通玄》：主咳逆，治虫疽，瘰疬，结痰，驱心痛。<br>⑥《高原中草药治疗手册》：下气杀虫。治痰饮停留，骨膜发炎，结核顽疮，酒齄鼻。\" },\n  { \"name\": \"商陆\", \"xing\": \"1 .多年生草本，高达1.5m。全株光滑无毛。根粗壮，圆锥形，肉质，外皮淡黄色，有横长皮孔，侧根甚多。茎绿色或紫红色，多分枝。单叶互生，具柄；柄的基部稍扁宽；叶片卵状椭圆形或椭圆形，长12-15cm，宽5-8cm，先端急尖或渐尖，基部渐狭，全缘。总状花序生于技端或侧生于茎上，花序直立；花被片5，初白色后渐变为淡红色；雄蕊8-10；心皮8-10个，分离，但紧密靠拢。浆果，扁圆状，有宿萼，熟时呈深红紫色或黑色。种子肾形黑色。花、果期5-10月。\", \"wei\": \"苦；性寒；有毒\", \"liang\": \"内服：煎汤，3-10g；或入散剂。外用：适量，捣敷。\", \"zhi\": \"1.治疗血小板减少性紫癜：取干燥根切成薄片，加水煎半小时，浓缩成100%的煎剂。首次服30ml，以后每日3次，每次10ml。或成人以4-8钱，小儿2-3钱为1日量，久煎3-4小时以减低毒性。用100%煎剂治疗21例，除1例疗效不显外，其余均在2-4天内紫癜逐渐消失，鼻衄、齿龈出血好转，仅少数病例仍偶于四肢出现新的散在性针尖样出血点；有半数病例在服后第2周左右血小板计数可恢复到正常范围，其中部分病人表现有波动性，个别亦有不恢复的。9例患者经骨髓相复查，6例患者的巨核细胞已出现有血小板形成，表明对骨髓病变有缓解作用。此外，对过敏性紫癜、咯血等亦有良好效果。\" },\n  { \"name\": \"牵牛子\", \"xing\": \"①牵牛（《雷公炮炙论》），又名:盆甑草（《酉阳杂俎》），狗耳草（《纲目》），牵牛花（《花镜》），勤娘子、姜花（《植物名实图考》），裂叶牵牛、打碗花、江良种、常春藤叶牵牛、喇叭花。<br>一年生攀援草本。茎缠绕，多分枝。叶互生，心脏形，3裂至中部，中间裂片卵圆形，先端短渐尖，两侧裂片斜卵形，全缘，两面均被毛；叶柄较花梗为长。花2～3朵腋生，具总梗；小花梗长约1厘米，具2细长苞片；萼5深裂，裂片狭披针形，长2～3厘米，先端长尖，基部被硬毛；花冠漏斗状，先端5浅裂，紫色或淡红色，上部色较深，下部色浅或为白色；雄蕊5，生于花冠近基部，花药长圆形；子房圆形，3室，花柱长于雄蕊，柱头头状。蒴果球形，种子5～6枚，黑褐色或白色、浅黄色，无毛。花期6～9月。果期7～9月。<br>生于山野、田野，或墙脚下、路旁，也有栽培。全国各地均有分布。<br>②毛牵牛，又名:圆叶牵牛、紫花牵牛。<br>一年生攀援摹本，全体具白色长毛。叶阔心脏形，长7～12厘米，宽7～13厘米，先端短尖，基部心形，全缘。花1～5朵成簇腋生，花梗多巧叶柄等长；花萼裂片卵状披针形，长约1.5厘米，基部皆被伏刺毛；花冠漏斗状，通常为蓝紫色、粉红或白色。蒴果球形，种子黑色或黄白色，无毛。花期7～8月。果期9～10月。<br>多生子路旁、田间、墙脚下，或灌丛中。全国大部分地区有分布。\", \"wei\": \"苦辛，寒，有毒。<br>①《别录》:苦，寒，有毒。<br>②《药性沦》:味甘，有小毒。<br>③《日华子本草》:味苦莶。\", \"liang\": \"内服:入丸、散，1～3分；煎汤，1.5～3钱。\", \"zhi\": \"泻水，下气，杀虫。治水肿，喘满。痰饮，脚气，虫积食滞，大便秘结。<br>①《别录》:主下气，疗脚满水肿，除风毒，利小便。<br>②《药性论》:治痃癖气块，利大小便，除水气，虚肿。落胎。<br>③《日华子本草》:取腰痛，下冷脓，并一切气壅滞。<br>④李杲:除气分湿热，三焦塑结。<br>⑤《纲目》:逐痰消饮，通大肠气秘风秘，杀虫。<br>⑥《江苏植药志》:适用于急性关节炎。<br>⑦《新疆中草药手册》:泻下，利尿，杀虫。治便秘，消化不良，肾炎水肿，小儿咽喉炎。\" },\n  { \"name\": \"巴豆霜\", \"xing\": \"无\", \"wei\": \"辛，热；有大毒。\", \"liang\": \"0.1～0.3g，多入丸散用。\", \"zhi\": \"峻下积滞，逐水消肿，豁痰利咽。用于寒积便秘，乳食停滞，下腹水肿，二便不通，喉风，喉痹。\" },\n  { \"name\": \"巴豆\", \"xing\": \"巴豆 灌木或小乔木，高2-10m。幼枝绿色，被稀疏星状毛，老枝无毛。单叶互生；叶柄长2-6cm；托叶线形，长2-4mm，早落；叶膜质卵形至长圆状卵形，长5-15cm，宽2.5-8cm，先端渐尖或长渐尖，基部圆形或阔楔形，近叶柄处有2枚无柄的杯状腺体，叶缘有疏浅锯齿，齿尖常具小腺体，幼时两面均有稀疏星状毛，后变无毛或在下面被极少数星状毛，干时呈淡黄色。总状花序顶生，长5-14cm，有时达观20cm，上部着生雄花，下部着生雌花，也有全为雄花而无雌花的；苞片钻状，长约2mm；雄花花梗细而短，长3-4mm，有星状毛；雄花绿色，较小；花萼5深裂，先端疏生星状毛，裂片卵形，长约2mm；花瓣5，长圆形，与花萼几等大，反卷，内面和边缘生细绵毛；雄蕊15-20，着生花盘边缘，花丝上部被柔毛，花药干时呈黑色；花盘盘状，边缘有浅缺刻；无退化子房；雌花花梗较粗，长2-3mm；花萼5深裂，裂片长圆形，外被星状毛，长约2.5mm；无花瓣；子房倒卵形，密被粗短的星状毛，3室，每室1胚珠，花柱3，每个2深裂。蒴果倒卵形至长圆形，有3钝角，长约2cm，近无毛或被稀疏星状毛，种子3颗，长卵形，背面稍凸，淡黄褐色，长约是1cm，宽6-7mm。花期3-10月，果期7-11月。\", \"wei\": \"辛；热；大毒\", \"liang\": \"内服：巴豆霜入丸、散，0.1-0.3g。外用：适量，捣膏涂；或以纱包擦患处。\", \"zhi\": \"泻下寒积；逐水退肿；祛痰利咽；蚀疮杀虫。主寒邪食积所致的胸腹胀满急痛；大便不通；泄泻痢疾；水肿腹大；痰饮喘满；喉风喉痹；痈疽；恶疮疥癣\" },\n  { \"name\": \"千金子\", \"xing\": \"续随子，又名：拒冬（《开宝本草》），半枝莲（《纲目拾遗》），千层楼、铁蜈蚣。<br>二年生草本，高达1米，全株微被白霜，内含乳汁。茎直立，分枝多。单叶交互对生；具短柄或近无柄；茎下部的叶较密，由下而上叶渐增大，线状披针形至阔披针形，长6～12厘米，宽0.8～1.3厘米，基部近截形，先端渐尖，全缘。杯状聚伞花序，通常4枝排成伞状，基部轮生叶状苞4片，每枝再叉状分枝，分枝处对生卵形或卵状披钟形的苞叶2片；花单性，无花被；雄花多数和雌花1枚同生于萼状总苞内，总苞4～5裂；雄花仅具雄蕊1；雌花生于花序中央，雌蕊1，子房3室，花柱3，先端2歧。蒴果近球形，表面有褐黑两色相杂斑纹。花期4～7月。果期7～8月。\", \"wei\": \"辛，温，有毒。<br>①《开宝本草》：辛，温，有毒。<br>②《本草再新》：辛，温，无毒。\", \"liang\": \"内服：入丸、散，0.5～1钱。外用：研敷。\", \"zhi\": \"逐水消肿，破Y杀虫。治水肿胀满，痰饮，宿滞，Y瘕积聚；妇女经闭；疥癣疮毒，蛇咬，疣赘。具抗肿瘤作用。用于水肿、痰饮积滞胀满、二便不通、血瘀闭经。<br>①《蜀本草》：治积聚痰饮，不下食，呕逆及腹内诸疾。<br>②《日华于本草》：宣一切宿滞，治肺气水气，敷一切恶疮疥癣。<br>③《开宝本草》：主妇人血结月闭，Y瘕痃癖，瘀血蛊毒，心腹痛，冷气胀满；利大小肠。<br>④《本草正》；逐水杀虫。<br>⑤江西《草药手册》：治晚期血吸虫病，肝脾肿大。\" }] },\n\n{\n  \"name\": \"祛风湿药\",\n  \"num\": 35,\n  \"content\": [\n  { \"name\": \"独活\", \"xing\": \"多年生高大草本。根类圆柱形，棕褐色，长至15cm，直径1-2.5cm，有特殊香气。茎高1-2m，粗至1.5cm，中空，常带紫色，光滑或稍有浅纵沟纹，上部有短糙毛。叶二回三出式羽状全裂，宽卵形，长20-30（-40）cm，宽15-25cm；茎生叶叶柄长达30-50cm，基部膨大成长管状、半抱茎的厚膜质叶鞘。开展，背面无毛或稍被短柔毛；末回裂片膜质，卵圆形至长椭圆形，长5.5-18cm，宽3-3.6cm，先端渐尖，基部楔形，边缘有不整齐的尖锯齿或重锯齿，齿端有内曲的短尖头，顶生的末回裂片多3深裂，基部常沿叶轴下延成翅状，侧生的具短柄或无柄，两面沿叶脉及边缘有短柔毛；痛托叶简化成囊状膨大的叶鞘，无毛，偶被疏短毛。复伞形花序顶生和侧生，花序梗长5-16（-20）cm，密被短糙毛；总苞片1，长钻形，有缘毛，早落；伞辐10-25，长1.5-5cm，密被短糙毛；伞形花序有花17-28（-36）朵；小总苞片5-10cm，阔披针形，比花柄短，先端有长尖，背面及边缘被短毛；花白色；无萼齿；花瓣倒卵形，先端内凹；花柱基扁圆盘状。果实椭圆形，长6-8mm，宽3-5mm，侧翅与果体等宽或略狭，背棱线形，隆起，棱槽间有油管1（-）2-3，合生面有油管2-4（-6）。花期8-9月，果期9-10月。\", \"wei\": \"味苦；辛；性微湿\", \"liang\": \"内服：煎汤，3-10g；或浸酒；或入丸、散。外用：适量，煎汤洗。\", \"zhi\": \"治疗慢性气管炎。取独活3钱，红糖5钱，加水煎成100ml，分3-4次服，疗程 l周。治疗422例，显效29例(6.9%)，有效282例(66.8%)。有效病例均显示一定的镇咳、平喘作用。副作用有头昏、头痛、舌发麻、恶心、呕吐、胃部不适等，一般不必停药。\" },\n  { \"name\": \"威灵仙\", \"xing\": \"1.威灵仙，木质藤本，长3-10m。干后全株变黑色。茎近无毛。叶对生；叶柄长4.5-6.5cm；一回羽状复叶，小叶5有时3或7；小叶片纸质，窄卵形、卵形或卵状披针形。或线状披针形，长1.5-10cm，宽1-7cm，先端锐尖或渐尖，基部圆形、宽楔形或浅心形，全缘，两面近无毛，或下面疏生短柔毛。圆锥状聚伞花序，多花，腋生或顶生；花两性，直径1-2cm；萼片4，长圆形或圆状倒卵形，长0.5-1.5cm，宽1.5-3mm，开展，白色，先端常凸尖，外面边缘密生绒毛，或中间有短柔毛；花瓣无；雄蕊多数，不等长，无毛；心皮多数，有柔毛。瘦果扁、卵形，长3-7mm，疏生紧贴的柔毛，宿存花柱羽毛状，长达2-5cm。花期6-9月，果期8-11月。\", \"wei\": \"味辛；咸；微苦；性温；小毒\", \"liang\": \"内服：煎汤，6-9g，冶骨哽咽喉可用到30g；或入丸、散；或浸酒。外用：适量，捣敷；或煎水熏洗；或作发泡剂。\", \"zhi\": \"1.治疗腮腺炎： 取鲜威灵仙根洗净、切细、捣烂，每用1斤加米醋半斤，浸于玻璃瓶内，盖紧勿令泄气。3日后取出醋浸液，用棉签蘸涂患处，每2-3小时涂抹1次。治疗32例，除4例效果不明外，均于1-3天内症状消失。\" },\n  { \"name\": \"徐长卿\", \"xing\": \"多年生草本，高约65厘米。根茎短，须状根多数。茎细，刚直，节间长。叶对生，披针形至线形，长约5～14厘米，宽约2～8毫米，先端尖，全缘，边缘稍外反，有缘毛，基部渐狭，下面中脉隆起。圆锥花序顶生于叶腋，总花柄多分枝，花梗细柔，花多数；花萼5深裂，卵状披针形，花冠5深裂，广卵形，平展或下反，黄绿色；副花冠5枚，黄色，肉质，肾形，基部与雄蕊合生；雄蕊5，连成筒状，药2室；雌蕊1，子房上位，由2个离生心皮组成，花柱2，柱头合生。蓇葖果角状。种子顶端着生多数银白色绒毛。花期6～7月。果期9～10月。\", \"wei\": \"辛，温。\", \"liang\": \"内服：煎汤，1～3钱；入丸剂或浸酒。外用：捣敷或煎水洗。\", \"zhi\": \"①治疗慢性气管炎\" },\n  { \"name\": \"川乌\", \"xing\": \"无\", \"wei\": \"辛、苦，热；有大毒。\", \"liang\": \"一般炮制后用。\", \"zhi\": \"祛风除湿，温经止痛。用于风寒湿痹，关节疼痛，心腹冷痛，寒疝作痛，麻醉止痛。\" },\n  { \"name\": \"草乌\", \"xing\": \"无\", \"wei\": \"辛、苦，热；有大毒。\", \"liang\": \"一般炮制后用。\", \"zhi\": \"祛风除湿，温经止痛。用于风寒湿痹，关节疼痛，心腹冷痛，寒疝作痛，麻醉止痛。\" },\n  { \"name\": \"蕲蛇\", \"xing\": \"无\", \"wei\": \"甘、咸，温；有毒。\", \"liang\": \"3～9g；研末吞服，一次1～1。5g，一日2～3次。\", \"zhi\": \"祛风，通络，止痉。用于风湿顽痹，麻木拘挛，中风口眼歪斜，半身不遂，抽搐痉挛，破伤风，麻风疥癣。\" },\n  { \"name\": \"金钱白花蛇\", \"xing\": \"银环蛇，成蛇全长1m左右。头椭圆形，与颈略可区分。体较细长，尾末端尖细。头部黑色或黑褐色，躯干及尾背面黑色或黑褐色，有白色横纹（20-50）+（7-17）个，腹面乳白色，或缀以黑褐色细斑。无颊鳞，眶前鳞1，眶后鳞2；颞鳞1+2，上唇鳞2-2-3式。背鳞平滑，通身15行，脊鳞括大呈六角形；腹鳞203-231；肛鳞完整，尾下鳞单行，37-55。\", \"wei\": \"味甘；咸；性温；有毒\", \"liang\": \"内服：水煎，3-4.5g；或研末，0.5-1g；或浸酒3-9g。\", \"zhi\": \"祛风通络；定惊止痉。主风湿痹痛；筋脉拘急；中风口眼?斜；半身不遂；小儿惊风；破伤风；麻风；疥癣；梅毒；恶疮\" },\n  { \"name\": \"乌梢蛇\", \"xing\": \"无\", \"wei\": \"甘，平。\", \"liang\": \"9～12g。\", \"zhi\": \"祛风，通络，止痉。用于风湿顽痹，麻木拘挛，中风口眼歪斜，半身不遂，抽搐痉挛，破伤风，麻风疥癣，瘰疬恶疮。\" },\n  { \"name\": \"蛇蜕\", \"xing\": \"1.王锦蛇，体粗状，全长2m左右。全身黑色，杂以黄色花斑，形似菜花，体前部有若干黄色横纹，头背棕黄色，鳞缘黑色，散以黑色斑，在尾下形成黑色纵纹。眶前鳞1，其下方常有1-2枚小鳞，眶后鳞2（3）；颞鳞2（3、1）+3（2、4），上唇鳞3-2-3式，背鳞23（25）-23（21）-19（17）行，除最外1-2行平滑，余均具强棱；腹鳞203-224；肛鳞2分，尾下鳞69-102对。\", \"wei\": \"味甘；咸；性平\", \"liang\": \"内服：煎汤，3-6g；研末，每次1.5-3g。外用：适量，煎汤洗；研末撒或调敷。\", \"zhi\": \"1.治疗脑囊虫病：将蛇蜕研成细粉，开水送服，每次 1钱，日服2次。同时配 服大戟汤(槟榔2两、大戟1钱、木瓜6钱、钩藤4钱，头晕加菊花4钱，有肝炎者去槟榔加雷丸 6钱，加水500ml，煎成150ml，每日2次，每次50ml，可连服30剂左右)。据10余年来千余例的观察，大多在用药后3-4个月内出现效果：脑压迫症状(抽搐、失明、失语、头 痛等)减轻，结节减少或消失；用药1年以上，有的病人症状可完全消失，坚持服药2年以上的可收到更好的效果。其中250例经1年以上治疗，结果显效38例(15.2%)，有效160例(64%)，无效50例(20%)，死亡2例(0.8%)。\" },\n  { \"name\": \"木瓜\", \"xing\": \"贴梗海棠（《群芳谱》）<br>灌木，高2～3米。枝棕褐色，有刺，皮孔明显。叶柄长3～15毫米；托叶近半圆形，变化较大，往往脱落；叶片卵形至椭圆状披针形，长2.5～14厘米，宽1.5～4.5厘米，先端尖或钝圆形；基部宽楔形至近圆形，边缘有腺状汉锯齿，有时有不整齐的重锯齿，上面绿色，下面淡绿色，两面均无毛，或幼时在下面中肋上有淡棕色柔毛。花数朵簇生，绯红色，也有白色或粉红色，花梗极短；萼片5，直立，紫红色，近于长圆形，长约5毫米，边缘和内面有黄色柔毛；花瓣5，近圆形，长约1.7厘米；雄蕊多数，约分4层，花药背着，长圆形，2室；雌蕊1，子房下位，5室，花柱5，下部稍连合。梨果卵形或球形，长约8厘米，黄色或黄绿色，芳香。花期3～4月。果期9～10月。\", \"wei\": \"酸，温。<br>①《雷公炮炙论》：香，甘酸。<br>②《别录》：味酸，温，无毒。<br>③《千金・食治》：味酸咸，温，涩，无毒。<br>④《药品化义》：味酸，性凉。<br>⑤《玉楸药解》：味辛，性涩，微寒。\", \"liang\": \"内服：煎汤，1.5～3钱；或入丸、散。外用：煎水熏洗。\", \"zhi\": \"平肝和胃，去湿舒筋。治吐泻转筋，湿痹，脚气，水肿，痢疾。<br>①《雷公炮炙论》：调营卫，助谷气。<br>②《别录》：主湿痹邪气，霍乱大吐下，转筋不止。<br>③《食疗本草》：治呕畹风气，吐后转筋，煮汁饮之。<br>④《本草拾遣》：下冷气，强筋骨，消食，止水痢后渴不止，作饮服之。又脚气冲心，取一颗去子，煎服之，嫩者更佳。又止呕逆，心膈痰唾。<br>⑤《海药本草》：敛肺和胃，理脾伐肝，化食止渴。<br>⑥《日华子本草》：止吐泻奔豚及脚气水肿，冷热痢，心腹痛，疗渴。<br>⑦王好古：去湿和胃，滋脾益肺。治腹胀善噫，心下烦痞。<br>⑧《日用本草》：治脚气上攻，腿膝疼痛，止渴消肿。<br>⑨《本草再新》：敛肝和脾胃，活血通经。\" },\n  { \"name\": \"蚕沙\", \"xing\": \"家蚕蛾，雌、雄蛾全身均密被白色鳞片。体长1.6-2.3cm。翅展3.9-4.3cm。体翅黄白色至灰白色。前翅外缘顶角后方向内凹切，各横线色稍暗，不甚明显，端线与翅脉灰褐色，后翅较前翅色淡，边缘有鳞毛稍长。雌蛾腹部肥硕，末端钝圆；雄蛾腹部狭窄，末端稍尖。幼虫即家蚕，体色灰白至白色，胸部第2、第3节稍见膨大，有皱纹。腹部第8节背面有一尾角。\", \"wei\": \"味甘；辛；性温\", \"liang\": \"内服：煎汤，10-15g，纱布包煎；或入丸、散。外用：适量炒热熨；煎水洗或研末调敷。\", \"zhi\": \"祛风除湿；和胃化浊；活血通经。主风湿痹痛；肢体不遂；风疹瘙痒；吐泻转筋；闭经；崩漏\" },\n  { \"name\": \"伸筋草\", \"xing\": \"无\", \"wei\": \"微苦、辛，温。\", \"liang\": \"3～12g。\", \"zhi\": \"祛风除湿，舒筋活络。用于关节酸痛，屈伸不利。\" },\n  { \"name\": \"松节\", \"xing\": \"1.乔木，高达25m，胸围可达1m以上。树皮灰褐色，呈不规则鳞甲状裂，裂隙红褐色。枝轮生，小枝粗壮，淡橙黄色或灰黄色；冬芽宽椭圆形，先端尖，红褐色。叶针形，2针一束，深绿色，粗硬，长10-15cm，径约1.5mm，边缘有细齿，两面有气孔线；叶鞘初时淡褐色，渐变成暗灰色。雄球花圆柱形，长1.2-1.8cm，在新枝上聚生成穗状；雌球花序阔卵形，长7mm，紫色，着生于当年新枝上。球果卵形或圆卵形，长4-9cm，有短梗，向下弯垂，熟时淡黄色或淡褐黄色，宿存数年之久；中部种鳞近长圆状倒卵形，长1.6-2cm，鳞盾肥厚，隆起或微隆起，扁菱形或菱状多角形，横脊显着，鳞脐凸起有尖刺。种子卵圆形或长卵圆形，淡褐色，有斑纹，连翅长1.5-1.8cm。花期4-5月，果熟期翌年10月。<br>2.乔木，高达45m，胸围1.5m。树皮红褐色，下部灰褐色，成不规则长块状裂。小枝常轮生，淡黄褐色，无白粉，无毛；冬芽卵状圆柱形，褐色，先端尖，芽鳞边缘丝状，先端尖或有长尖头。叶针形，2针一束，稀3针一束，长12-30cm，细长而柔软，叶缘有细锯齿，树脂道约4-8个，在背面边生，或腹面也有2个边生；叶鞘初呈褐色，后渐变成灰黑色，宿存。雄球花淡红褐色，圆柱形，弯垂，长1-1.5cm，聚生于新枝下部苞腋，穗状；雌球花单生或2-4个聚生于新枝顶端，淡紫红色。球果卵圆形或圆锥状卵形，长4-7cm，径2.5-4m，有短梗，下垂，熟时粟褐色；中部种鳞近长圆状倒卵形，长约3cm；鳞盾菱形，微隆起或平，鳞脐微凹，无刺。种子长卵圆形，长4-6mm，连翅长2-2.7cm。花期4-5月，果熟期翌年10-12月。<br>3..乔木，高达30m，胸围达1.5m。树皮橘红色，不规则鳞片状脱落。一年生枝淡黄色或红黄色，微有白粉，无毛；冬芽长圆状卵圆形，暗红褐色，针叶2针一束，长5-12cm，径约1mm，先端微尖，两面有气孔线，边缘有细锯齿，横切面半圆形，树脂道约4-6个，边生。雄球花淡红黄色，圆筒形，5-12mm，聚生于新枝下部呈短穗状；雌球花淡红紫色，单生或2-3个聚生，一年生小球果的种鳞先端有短刺。球果熟时暗黄褐色或淡褐黄色；种鳞张开，易脱落，有微隆起的横脊，鳞脐平或微凸起，有短刺。种子倒卵状椭圆形或卵圆形，长4-7mm，连翅长1.5-2m，种翅宽5-7mm。花期4月，果熟期翌年9-10月。<br>4.乔木，高达30cm，胸围1m。树皮灰褐色，不规则鳞片状深裂，易脱落。一年生枝粗壮，红褐色，二三年生小枝上苞片状鳞叶易脱落，露出褐色内皮；冬芽圆锥状卵形，红褐色，芽鳞披针形，先散开，有白色丝状毛。针叶3针一束，稀2针一束，长10-30cm，径约1.2mm，柔软，稍下垂，横切面扇状三角形，树脂道4-5个，中生与边生并存，叶鞘宿存。球果圆锥状卵圆形，长5-11cm，梗长约5mm，熟时栗褐色或黄褐色；鳞盾肥厚隆起，有横脊；鳞脐微凹或微隆起，有短刺。种子近卵圆状倒卵形，边翅长1.6-1.9cm。花期4-5月，果熟期翌年10-11月。\", \"wei\": \"苦；性温\", \"liang\": \"内服：煎汤，10-15g；或浸酒、醋等。外用：适量，浸酒涂擦；或炒研末调敷。\", \"zhi\": \"祛风燥湿；舒筋通络；活血止痛。。主风寒湿痹，历节风痛；脚痹痿软；跌打伤痛。\" },\n  { \"name\": \"松花粉\", \"xing\": \"植物形态详\\\"松节\\\"条。\", \"wei\": \"甘，温。\", \"liang\": \"内服：煎汤，1～2钱；浸酒或调服。外用：干掺或调敷。\", \"zhi\": \"祛风益气，收湿，止血。治头旋眩晕，中虚胃疼，久痢，诸疮湿烂，创伤出血。\" },\n  { \"name\": \"海风藤\", \"xing\": \"常绿攀缘藤本，全株有特殊香气。茎灰色，略扁，有关节，表面具纵沟；枝通常两分歧，关节处常生有不定根。叶互生，有长柄，叶片狭卵形至卵形，长5～8.5厘米，宽2.8～4.5厘米，先端长锐尖或骤尖，基部圆形，全缘，质稍厚，上面暗绿色，下面淡绿色，常散生白色软毛，叶脉5～7条。穗状花序生于枝梢，与叶对生，长2～8厘米，直径2.5～3毫米，下垂；花单性，雌雄异株；无花被，苞片盾状；雄蕊3枚，罕为2枚，花药2室；雌蕊1枚，子房上位，1室。浆果近球形，熟时红色，直径3～4毫米。花期5～6月。果期8～9月。\", \"wei\": \"辛苦，微温。《中药志》：\\\"辛，微温。\\\"\", \"liang\": \"内服：煎汤，2～5钱；或浸酒。\", \"zhi\": \"祛风湿，通经络，理气。治风寒湿痹，关节疼痛，筋脉拘挛，跌打损伤，哮喘，久咳。\" },\n  { \"name\": \"青风藤\", \"xing\": \"①青藤，又名：大叶青藤、土木通、土藤、大青木香、岩见愁、排风藤。\", \"wei\": \"苦，平。\", \"liang\": \"内服，煎汤，3～5钱；浸酒或熬膏。外用：煎水洗。\", \"zhi\": \"祛风湿，利小便。治风湿痹痛，鹤膝风，水肿，脚气。\" },\n  { \"name\": \"丁公藤\", \"xing\": \"1.丁公藤 木质藤本，长约12cm。小枝干后黄褐色，明显有棱，不被毛。单叶互生，叶柄长0.8-1.2cm，无毛，叶片革质椭圆形，或倒长卵形，长6.5-9cm，宽2.5-4cm，先端钝或钝圆，基部渐狭成楔开，两面无；侧脉4-5对，至边缘以内风结上举。聚伞花序腋生和顶生腋生的花少至多数，顶生的排列成总状，花序轴和花梗被淡褐色柔毛；花萼球形，萼片5，近圆形，外面被淡褐色柔毛并有缘毛；花冠白色，5裂，裂片长圆形，全缘或浅波状，雄蕊5，不等长，花药先端渐尖，花丝之间有鳞片；子房圆柱形，柱头圆锥状，贴着子房。浆果卵状椭圆形，长约1.4cm。种子1颗。花期6-8月。\", \"wei\": \"辛；温；有毒\", \"liang\": \"内服：煎汤，3-6g；或浸酒。外用：适量，浸酒外擦。\", \"zhi\": \"治疗风湿骨痛及神经痛。丁公藤制成注射液，每支2ml，含原生药5g。每次2-4ml，每天l-2次，肌注。治疗急慢性风湿性关节炎、类风湿性关节炎、坐骨神经痛、腰肌劳损、肥大性腰椎炎及外伤性关节炎计88例，症状明显改善，止痛作用良好看39例，症状好转者39例，无效者10例。未发现副作用。注射后常有轻微出汗，此属正常现象，如汗出不止，可饮糖开水1杯，孕妇忌用。\" },\n  { \"name\": \"昆明山海棠\", \"xing\": \"昆明山海棠 落叶蔓生或攀援状灌木，植株高2-3m。根圆柱状，红褐色。小枝有棱，红褐色，有圆形疣状突起，疏被短柔毛或近无毛。单叶互生；叶柄长约lcm；叶片卵形或宽椭圆形，长6-12cm，宽3-6cm，先端渐尖，边缘有细锯齿，基部近圆形或宽楔形，上面绿色，下面粉白色。圆锥花序顶生，总花梗长10-15cm；花小，白色，花萼5；花瓣5；雄蕊5，着生于花盘的边缘；子房上位，三棱形。翅果赤红色，具膜质的3翅。花期夏季。\", \"wei\": \"苦；辛；微温；有大毒\", \"liang\": \"内服：煎汤，6-15g，先煎；或浸酒。外用：适量，研末敷；或煎水涂；或鲜品捣敷。\", \"zhi\": \"祛风除湿；活血止血；舒筋接骨；解毒杀虫。主风湿痹痛；半身不遂；疝气痛；痛经；月经过多；产后腹痛；出血不止；急性传染性肝炎；慢性肾炎；红斑狼疮；癌肿；跌打骨折；骨髓炎；骨结核；副睾结核；疮毒；银屑病；神经性皮炎\" },\n  { \"name\": \"路路通\", \"xing\": \"无\", \"wei\": \"苦，平。\", \"liang\": \"5～9g。\", \"zhi\": \"祛风活络，利水通经。用于关节痹痛，麻木拘挛，水肿胀满，乳少经闭。\" },\n  { \"name\": \"穿山龙\", \"xing\": \"1.穿龙薯蓣，多年生缠绕草本，长达5m。根茎横生，圆柱形，木质，多分枝，栓皮层显着剥离。茎左旋，圆柱形，近无毛。单叶互生；叶长10-20cm；叶片掌状心形，变化较大，茎基部叶长10-15cm，宽9-13cm，边缘作不等大的三角状浅裂、中裂或深裂，先端叶片小，近于全缘，叶表面黄绿色，有光泽，无毛或有稀疏的白色细柔毛，尤以脉上较密。花单性，雌雄异株。雄花序为腋生的穗状花序，花序基部常由2-4朵集成小伞状，花序顶端常为单花；苞片披针形，先端渐尖，短于花被；花被碟形，6裂，裂片先端钝圆；雄蕊6，着生于花被裂片的中央，花药内向。雌花序穗状，单生；花被6裂，裂片披针形；雌蕊柱头3裂，裂片再2裂。蒴果成熟后枯黄色，三棱形，先端凹入，基部近圆形，每棱翅状，大小不一，一般长约2cm，宽约1.5cm。种子每室2，有时仅1颗发育，着生于中轴基部，四周有不等的薄膜状翅，上方呈长方形，长约比宽大2倍。花期6-8月。 2.柴黄姜 本亚种与穿龙薯蓣十分相似，主要区别在于：植株较粗壮，根茎没有剥落的栓皮，花多少有柄，叶片有较多小刺毛。花期6-8月，果期8-10月。\", \"wei\": \"平；苦\", \"liang\": \"内服：煎汤，干品6-9g，鲜品30-45g；或浸酒。外用：适量，鲜品捣敷。\", \"zhi\": \"1.治疗慢性气管炎：应用穿山龙片剂(每片含原生药2.5g)，第一疗程每日2次，每次2片；第二疗程每日3次，每次2片，均以10天为一疗程。治疗26例，第一疗程的有效率为80.8%，显效率30.8%；第二疗程的有效率84%，显效率60%。 临床证明穿山龙片对咳、痰、喘、炎均有疗效，尤以镇咳、祛痰作用较强。在中医分型方面，以脾湿型的疗效较高。亦有用穿山龙配合黄芩、桔梗制成复方注射液，每2ml含上述生药各2g。肌肉注射，每日2次，每次2ml。6天为一疗程，休息3天后再行第二疗程，也可连续治疗12天。 l17例患者经 l-2个疗程治疗后，近期治愈61例(52.1%)，显效37例(31.6%)，好转19例(16.2%)。复方穿山龙注射剂具有良好的祛痰效果，一般在用药后 l-2天即可使痰变稀，随之痰量显着减少；但镇咳作用不够强。治疗中有部分病人食欲增加，睡眠好转，未发现不良副作用。实验证明此注射液对肺炎双球菌、甲型链球菌、卡他球菌都有抑菌作用。\" },\n  { \"name\": \"秦艽\", \"xing\": \"1.多年生草本，高20-60cm。主根粗长，圆柱形，上租下细，扭曲不直，有少数分枝，中部多呈罗纹状；根茎部有许多纤维状残存叶基。茎直立或斜生，圆柱形，无毛。基生叶多丛生，无柄，叶片披针形或长圆披针形，长达40cm，宽3-5cm，先端尖，全缘，主脉5条；茎生叶3-4对，对生，较小，基部连合。花多集成顶生及茎上部腋生的轮伞花序；花萼管一侧裂开过半，萼齿浅；花冠管状，深蓝紫色，长约2cm，先端5裂，裂片间有5片短小褶片；雄蕊5，着生于花冠管中部；子房长圆形，无柄。蒴果长圆形或椭圆形。种子椭圆形，无翅，褐色，有光泽。花期7-9月，果期8-10月。\", \"wei\": \"苦；辛；微寒\", \"liang\": \"内服：煎汤，5-10g；或浸酒；或入丸、散。外用：适量，研末撒。\", \"zhi\": \"1.治疗关节痛、头痛、牙痛等取秦艽10Og，或秦艽、白芷各50g，加入普鲁卡因lg，制成注射液100ml，分装、灭菌备用。肌肉注射每次2ml。曾应用2000多人次，对风寒引起的周身疼痛，以及多年风湿性腰腿痛均有止痛效果。\" },\n  { \"name\": \"防己\", \"xing\": \"①粉防己，又名：石蟾蜍、山乌龟、汉防己、倒地拱、金丝吊鳖、白木香。\", \"wei\": \"苦，寒。\", \"liang\": \"内服：煎汤，1.5～3钱；或入丸、散。\", \"zhi\": \"治疗高血压病:从汉防己中提出的生物碱-汉防己甲素，具有降压作用。一般用片剂口服，每日120毫克，3次分服；血压过高者，增至每日180毫克。据110例Ⅱ期及Ⅲ期患者观察，经用药2～7个月后，显效13例，有效26例，一般疗效24例，无效47例，总有效率为55％。亦可采用注射剂行静脉注射，每次120毫克，每日2次；据200余例使用结果，疗效较口服片剂明显，作用较快，且无突然大幅度下降之反应，故为治疗高血压急症有效而稳妥之制剂。\" },\n  { \"name\": \"桑枝\", \"xing\": \"无\", \"wei\": \"微苦，平。\", \"liang\": \"9～15g。\", \"zhi\": \"祛风湿，利关节。用于肩臂、关节酸痛麻木。\" },\n  { \"name\": \"豨莶草\", \"xing\": \"一年生草本，高达1m以上，枝上部尤其是花序分枝被紫褐色头状有柄长腺毛及白色长柔毛。叶对生，叶片质薄，两面被短毛，沿叶脉有白色长柔毛，中部叶阔卵形至阔卵状三角形，长7～20cm，宽5～18cm，边缘有大小不等的齿，顶端短渐尖。头状花序直径2～3cm，多数，排成伞房状；外层总苞片长1～1.5cm；舌状花长约3.5mm。瘦果长约3.5mm。花期8～10月，果期9～12月。\", \"wei\": \"性寒，味辛、苦。\", \"liang\": \"无\", \"zhi\": \"祛风湿，利关节，解毒。用于风湿痹痛、筋骨无力 、腰膝酸软、四肢麻痹、半身不遂、风疹湿疮。\" },\n  { \"name\": \"臭梧桐\", \"xing\": \"海州常山，灌木或小乔木，高1.5-10m。幼枝、叶柄及花序等多少被黄褐色柔毛或近无毛；老枝灰白色，有皮孔，髓部白色，有淡黄色薄片横隔。单叶对生；叶柄长2-8cm；叶片纸质，宽卵形、卵形、卵状椭圆形或三角状卵形，长5-17cm，宽5-14cm，先端尖或渐尖，基部宽楔形至楔形，偶有心形，全缘或具波状齿，两面疏生短毛或近无毛；侧脉3-5对。伞房状聚伞花序顶生或腑生，疏散，通常二歧分枝，花序长8-18cm，花序梗长3-6cm，具椭圆形叶状苞片，早落；花萼幼时绿白色，后紫红色，基部合生，中部略膨大，具5棱，先端5深裂，裂片三角状披针形或卵形；花冠白色或带粉红色，花冠管细，先端5裂，裂片长椭圆形；雄蕊4，与花柱同伸出花冠外。核果近球形，径6-8mm，包于增大的宿萼内，熟时蓝紫色。花、果期6-11月。\", \"wei\": \"味苦；微辛；性平\", \"liang\": \"内服：煎汤，10-15g，鲜品30-60g；或浸酒；或入丸、散。外用：适量，煎水洗；或捣敷；研末掺或调敷。\", \"zhi\": \"1.治疗高血压病：臭梧桐具有和缓而持久的降压作用，并有解除高血压病症状，恢复心脏功能，对抗小动脉痉挛等作用。据数十例至数百例的治疗结果，降压的总有效率自56.69-81.4%不等。配合地龙应用，疗效有所提高，有效率可达81%以上。一般服药后显着降压出现较晚，大多数在第四、五周血压始明显下降。血压下降后，若停止服药，血压可在 1-2周内迅速回升；如给予较小的维持剂量，则血压常可维持在已下降的水平上。临床症状如心悸、气急、头痛、头晕、失眠及夜尿等大多有明显改善或消失，个别有心绞痛的病例，服药后亦消失。部分病例经检查证明：凡显着降压看心脏增大几乎完全恢复，期外收缩消失，但心串、心音无明显变化，心电图有冠状动脉硬化所引起的缺血现象亦可恢复；大多数眼底小动脉的痉挛可解除削。实践中还观察到，疗效与年龄、病期等有一定关系。40岁以上者降压作用较佳。对早期高血压及晚期高血压尚无严重并发症者均有疗效，对急进型高血压和晚期高血压伴有并发症者，疗效不佳；有动脉硬化者亦有疗效。但也有报告，对三、三期高血压或有明显之动脉硬化着，疗效并不显着。部不适、恶心、呕吐、便秘或稀便等，部分病例有软弱无力感。一般均能忍受，继续服药或酌情减量后可自行消失。\" },\n  { \"name\": \"海桐皮\", \"xing\": \"刺桐（《南方草木状》），又名：山芙蓉、梯枯、空桐树、鸡桐木、海桐。<br>高大乔木，高可达20米。树皮灰棕色，枝淡黄色至土黄色，密被灰色绒毛，具黑色圆锥状刺，2、3年后即脱落。3出复叶，互生，或簇生于枝顶；总叶柄长10～15厘米；小叶片阔卵形至斜方状卵形，长10～15厘米，顶端小叶宽过于长，先端渐尖而钝，基部近截形，或阔菱形，全缘，上面深绿色，下面粉绿色，两面叶脉均有稀疏毛茸；顶生小叶柄长3.5～4.5厘米，侧生小叶柄短，长约5毫米；托叶2，线形，长1～1.3厘米，早落。总状花序，长约15厘米，被绒毛；总花梗长7～10厘米；萼佛焰状，长约2～3厘米，萼口偏斜，由背开裂至基部；花冠蝶形，大红色，旗瓣长5～6厘米，翼瓣与龙骨瓣近相等，短于萼；雄蕊10，两束，花丝淡紫色，长3～3.5厘米，药黄色；花柱1，浅绿色，柱头不分裂，密被紫色软毛。荚果串珠状，微弯曲。种子1～8颗，球形，暗红色。花期3月。\", \"wei\": \"苦辛，平。<br>①《海药本草》：味苦，温，无毒。<br>②《开宝本草》：味苦，平，无毒。<br>⑧《本草经疏》：味苦辛。\", \"liang\": \"内服：煎汤，2～4钱；或浸酒。外用：煎水洗或研末调敷。\", \"zhi\": \"祛风湿，通经络，杀虫。治风湿痹痛，痢疾，牙痛，疥癣。<br>①《海药本草》：主腰脚不遂，顽痹腿膝疼痛，霍乱，赤白泻痢，血痢，疥癣。<br>②《日华子本草》：治血脉麻痹疼痛，及煎洗目赤。<br>③《开宝本草》：主霍乱中恶，赤白久痢，除甘匿、疥癣。牙齿虫痛，并煮服及含之，水浸洗目，除肤赤。<br>④《纲目》：能行经络，达病所，又入血分及去风杀虫。<br>⑤《岭南采药录》：生肌，止痛，散血，凉皮肤，敷跌打。<br>⑥《南宁市药物志》：消肿，散瘀，止痛。疗咳嗽，止产后瘀血作痛。<br>⑦《贵州草药》：解热祛瘀，解毒生肌。治乳痈，骨折。\" },\n  { \"name\": \"络石藤\", \"xing\": \"常绿木质藤本，长达10m。全株具乳汁。茎圆柱形，有皮孔；嫩枝被黄色柔毛，老时渐无毛。叶对生，革质或近革质，椭圆形或卵状披针形，长2-10cm，宽1-4.5cm；上面无毛，下面被疏短柔毛；侧脉每边6-12条。聚伞花序顶生或腋生，二歧，花白色，芳香；花萼5深裂，裂片线状披针形，顶部反卷，基部具10个鳞片状腺体；花蕾顶端钝，花冠筒圆筒形，中部膨大，花冠裂片5，向右覆盖；雄蕊5，着生于花冠筒中部，腹部粘生在柱头上，花药箭头状，基部具耳，隐藏在花喉内；花盘环状5裂，与子房等长；子房由2枚离生心皮组成，无毛，花柱圆柱状，柱头卵圆形。蓇葖答果叉生，无毛，线状披针形；种子多数，褐色，线形，顶端具白色绢质种毛。花期3-7月，果期7-12月。\", \"wei\": \"苦;辛;性微寒\", \"liang\": \"内服：煎场，6～15g单味可用至30g；浸酒，30-60g；或入丸、散剂。外用：适量，研末调敷或捣汁涂。\", \"zhi\": \"通络止痛;凉血清热;解毒消肿。主风湿痹痛;腰膝酸痛;筋脉拘挛;咽喉肿痛;疔疮肿毒；跌打损伤；外伤出血\" },\n  { \"name\": \"雷公藤\", \"xing\": \"雷公藤 落叶蔓性灌木，长达3m。小枝棕红色，有4-6棱，密生瘤状皮孔及锈色短毛。单叶互生，亚革质；叶柄长约5mm；叶片椭圆形或宽卵形，长4-9cm，宽3-6cm，先端短尖，基部近圆形或宽楔形、边缘具细锯齿，上面光滑，下面淡绿色，主、侧脉在上表面均稍突出，脉上疏生锈褐色柔毛。聚伞状圆锥花序顶生或腋生，长5-7cm，被锈色毛。花杂性，白绿色，直径达5mm；萼为5浅裂；花瓣5，椭圆形；雄蕊5，花丝近基部较宽，着生在杯状花盘边缘；花柱短，柱头6浅裂；子房上位，三棱状。蒴果具3片膜质翅，长圆形，长达14mm，宽约13mm，翅上有斜生侧脉。种子1，细柱状，黑色。花期7-8月，果期9-10月。\", \"wei\": \"苦；辛；大毒\", \"liang\": \"内服：煎汤，去皮根木质部分15-25g；带皮根10-12g。均需文火煎1-2h。也可制成糖浆、浸膏片等。岩研粉装胶囊服，每次0.5-1.5g，每日3次。外用：适量，研粉或捣烂或；或制成酊剂、软膏涂擦。\", \"zhi\": \"1.治疗麻风反应：雷公藤干根彻底去除内外两层皮，将木质部切片晒干。每用4钱，加水2500ml，文火煎(不加盖)3-4小时，取褐色药液250ml，早晚分服，3-4天为一疗程。曾治各型麻风反应167例(其中结核型27例，瘤型140例)，均在服药2-3剂后控制症状。\" },\n  { \"name\": \"老鹳草\", \"xing\": \"无\", \"wei\": \"辛、苦，平。\", \"liang\": \"9～15g。\", \"zhi\": \"祛风湿，通经络，止泻利。用于风湿痹痛，麻木拘挛，筋骨酸痛，泄泻痢疾。\" },\n  { \"name\": \"丝瓜络\", \"xing\": \"植物形态详丝瓜条。\", \"wei\": \"甘，平。<br>①《本草便读》：味甘，性寒。<br>②《南宁市药物志》：甘，平，无毒。\", \"liang\": \"内服：煎汤，1.5～3钱；或烧存性研末。外用：煅存性研末调敷。\", \"zhi\": \"通经活络，清热化痰。治胸胁疼痛，腹痛，腰痛，睾丸肿痛，肺热痰咳，妇女经闭，乳汁不通，痈肿，痔漏。炭：能止血。治便血、血崩。<br>①《医林纂要》：凉血渗血，通经络，托痘毒。<br>②《本草再新》：通经络，和血脉，化痰顺气。<br>③《分类草药性》：治乳肿疼痛，火煅存性冲酒服。研末调香油涂汤火伤。<br>④《现代实用中药》：通乳汁，发痘疮。治痈疽不敛。作黑烧内服，治肠出血，赤痢，子宫出血，睾丸炎肿，痔疮流血等。<br>⑤《陆川本草》：凉血解毒，利水去湿。治肺热痪咳，热病谵妄，心热烦躁，手足抽搐。\" },\n  { \"name\": \"五加皮\", \"xing\": \"①五加（《本经》），又名：豺漆（《本经》），文章草（《巴蜀异物志》），五花（《雷公炮炙论》），豺节（《别录》），木骨、追风使、刺通（《本草图经》），白刺（《纲目》），茨五甲（《草木便方》），白竻树、五叶路刺、细柱五加、老虎獠、五花眉、水面油、白芦刺、五加花、鸡脚风。\", \"wei\": \"辛，温。\", \"liang\": \"内服：煎汤，1.5～3钱；浸酒或入丸、散。外用：捣敷。\", \"zhi\": \"祛风湿，壮筋骨，活血去瘀。治风寒湿痹，筋骨挛急，腰痛，阳痿，脚弱，小儿行迟，水肿，脚气，疮疽肿毒，跌打劳伤。\" },\n  { \"name\": \"桑寄生\", \"xing\": \"1.灌木，高0.5-1m。嫩枝、叶密被锈色星状毛，有时具疏生叠生星状毛，后变无毛；小枝灰褐色，具细小皮孔。叶对生或近对生；叶柄长8-10mm；叶片厚纸质，卵形至长卵形，长2. 5-6cm，宽1.5-4cm，先端圆钝，基部楔形或阔楔形；侧脉3-4对，略明显。伞形花序，1-2个腋生或生于小枝已落叶腋部，具花l-4朵，通常2朵，花序和花被星状毛，总花梗长2-4mm；花梗长6-7mm；苞片鳞片状；花褐色；花托椭圆形或卵球形；副萼环状；花冠花蕾时管状，长2.5-2.7cm，稍弯，下半部膨胀，顶端卵球形，裂片4，匙形，反折；花丝比花药短2/3，药室具横隔；花盘杯状；花柱线形，柱头头状。浆果椭圆状或近球形，果皮密生小瘤体，被疏毛，成熟果浅黄色，长达1cm，果皮变平滑。花、果期4月至翌年1月。<br>2.本种与桑寄生的区别为：嫩叶、枝密被褐色或红褐色星状毛，小枝黑色。总状花序密集呈伞形；花红色；柱头圆锥状。浆果黄绿色，果皮具颗粒状体，被疏毛。花期6-8月。<br>3.1.灌木，高0.5-lm。嫩枝、叶密被锈色星状毛，稍后毛全脱落变无毛；小枝灰褐色，具皮孔。叶对生或近对生，厚纸质；叶柄长5-6mm；叶片卵形至长卵形，长5-8cm，宽2-4cm，先端钝，基部阔楔形；侧脉5-6对，两面均明显。总状花序，1-2(-3)腋生或生于小枝已落叶腋部，各部分均被褐色毛，花序梗和花序轴共长2-3mm，具花3-5(-6)朵，花红色，密集；花梗长2-3mm；苞片三角形；花托陀螺状，长2-2.5mm；副萼环状，全缘；花冠花蕾时管状，长2-2.5cm，稍弯，下半部膨胀，顶部椭圆状，开花时顶部4裂，裂片披针形，长5-8mm，反折；花柱线状，柱头头状。浆果梨形，长约10mm，直径约3mm，下半部骤狭呈长柄状，红黄色，果皮平滑。花、果期10月至翌年1月。<br>4.与前三种的区别在于：成长叶下面被灰黄色、黄褐色或褐色绒毛，嫩枝、叶、花序和花均密被叠生星状毛或星状毛。总状花序；花2-5朵密集呈伞形；花冠长1.2-1.8cm，红黄色。浆果椭圆形，两端圆钝，淡黄色，果皮粗糙，具疏生星状毛。花期8-11月，果期翌年4-5月。\", \"wei\": \"苦；甘；性平\", \"liang\": \"内服：煎汤，10-15g；或入丸、散；或浸酒；或捣汁服。外用：适量，捣烂外敷。\", \"zhi\": \"补肝肾；强筋骨；祛风湿；安胎。主腰膝酸痛；筋骨痿弱；肢体偏枯；风湿痹痛；头错目眩；胎动不安，崩漏下血\" },\n  { \"name\": \"狗脊\", \"xing\": \"多年生树蕨，高达2.5-3m。根茎平卧，有时转为直立，短而粗壮，带木质，密被棕黄色带有金色光泽的长柔毛。叶多数，丛生成冠状，大形；叶柄粗壮，褐色，基部密被金黄色长柔毛和黄色狭长披针形鳞片；叶片卵圆形，长可达2m，3回羽状分裂；下部羽片卵状披针形，长30-60cm，宽15-30cm，上部羽片逐渐短小，至顶部呈狭羽尾状；小羽片线状披针形，渐尖，羽状深裂至全裂，裂片密接，狭矩圆形或近于镰刀形，长0.5-1cm，宽2-4mm；亚革质，上面暗绿色，下面粉灰色，叶脉开放，不分枝。孢子囊群着生于边缘的侧脉顶上，略成矩圆形，每裂片上2-12枚，囊群盖侧裂呈双唇状，棕褐色。\", \"wei\": \"苦；甘；温\", \"liang\": \"内服：煎汤，10-15g；或浸酒。外用：适量，鲜口捣烂敷。\", \"zhi\": \"除风湿；健腰脚；利关节。主肾虚腰痛脊强；足膝软弱无力；风湿痹痛；尿频；遗精；白带过多\" },\n  { \"name\": \"千年健\", \"xing\": \"千年健，多年生草本。根茎匍匐，细长，粗1.5cm。根肉质，密被淡褐色短绒毛，须根纤维状。常具高30-50cm的直立的地茎。鳃叶线状披针形，长达16cm，基部宽2.5cm，向上渐狭，锐尖；叶柄长20-40cm，下部具宽3-5mm的鞘；叶片膜质至纸质，箭状心形至心形，长15-30cm，宽10-28cm，先端骤狭渐尖；侧脉平行向上斜升。花序1-3，生鳞叶之腑，花序柄短于叶柄；佛焰苞绿白色，长圆形至椭圆形，长5-6.5cm，花前度卷成纹锤形，盛花时上部略展开成短舟状；肉穗花序长3-5cm；雌花序长1-1.5cm，粗4-5mm；雄花序长2-3cm，粗3-4mm；子房长圆形，基部一侧具假雄蕊1，子房3室。浆果，种子褐色，长圆形。花期7-9月。\", \"wei\": \"味苦；辛；性温；小毒\", \"liang\": \"内服：煎汤，9-15g；或浸酒。外用：适量，研末，调敷。\", \"zhi\": \"祛风湿；舒筋活络；止痛；消肿。主风湿痹痛；肢节酸育；筋骨痿软；跌打损伤；胃痛；痈疽疮肿\" },\n  { \"name\": \"雪莲花\", \"xing\": \"①绵头雪莲花\", \"wei\": \"甘苦，温（大苞雪莲花有毒）。\", \"liang\": \"内服：煎汤，3～5钱（大苞雪莲花2～5分）；或浸酒。外用：捣敷。\", \"zhi\": \"除寒，壮阳，调经，止血。治阳萎，腰膝软弱，妇女崩带，月经不调，风湿性关节炎，外伤出血。\" }] },\n\n{\n  \"name\": \"化湿药\",\n  \"num\": 11,\n  \"content\": [\n  { \"name\": \"广藿香\", \"xing\": \"无\", \"wei\": \"辛，微温。\", \"liang\": \"3～9g。\", \"zhi\": \"芳香化浊，开胃止呕，发表解暑。用于湿浊中阻，脘痞呕吐，暑湿倦怠，胸闷不舒，寒湿闭暑，腹痛吐泻，鼻渊头痛。\" },\n  { \"name\": \"佩兰\", \"xing\": \"佩兰 多年生草本，高40-100cm。根茎横走。茎直立，绿色或红紫色，下部光滑无毛。叶对生，在下部的叶常枯萎：中部的叶有短柄。叶对生，在下部的叶常枯萎；中部的叶有短柄，叶片较大，通常3全裂或3深裂，中裂片较大，长椭圆形或长椭圆状披针形，长5-10cm，宽1.5-2.5cm；上部的叶较小，常不分裂，或全部茎叶不分裂，先端渐尖，边缘有粗齿或不规则细齿，两面光涌或沿脉疏被柔毛，无腺点。头状花序多数在茎顶及枝端排成复伸房花序，花序径3-6cm；总苞钟状，长6-7mm；总苞片2-3层，覆瓦状排列，外层短，卵状披针形，中、内层苞片渐长，全部苞片紫红色，外面无毛无遥点，先端钝；每个关状花序具花4-6朵，花白色或带微红以，全部为管状花，两性，花冠外面无腺点，先端5齿裂；雄蕊5，聚药；雌蕊1，子房下位，柱头2裂，伸出花冠外。瘦果圆柱形，熟时黑褐色，5棱，长3-4mm，无毛无腺点；冠毛白色，长约5mm。花、果期7-11月。\", \"wei\": \"味辛;性平\", \"liang\": \"内服:煎汤,6-10g;鲜品可用15-20g.\", \"zhi\": \"解暑化湿;辟秽和中。主感受暑湿;寒热头痛;湿润内蕴;脘痞不饥;恶心呕吐;口中甜腻;消洵\" },\n  { \"name\": \"苍术\", \"xing\": \"①南苍术\", \"wei\": \"辛苦，温。\", \"liang\": \"内服：煎汤，1.5～3钱；熬膏或入丸、散。\", \"zhi\": \"健脾，燥湿，解郁，辟秽。治湿盛困脾，倦怠嗜卧，脘痞腹胀，食欲不振，呕吐，泄泻，痢疾，疟疾，痰饮，水肿，时气感冒，风寒湿痹，足痿，夜盲。\" },\n  { \"name\": \"厚朴\", \"xing\": \"1.落叶乔木，高5-15m。树皮紫褐色，小枝粗壮，淡黄色或灰黄色。冬芽粗大，圆锥形，芽鳞被浅黄色绒毛。叶柄粗壮，长2.5-4cm，托叶痕长约为叶柄的2/3。叶近革质，大形，叶片7-9集生枝顶，长圆状倒卵形，长22-46cm,宽15-24cm，先端短尖或钝圆，基部渐狭成楔形，上面绿色，无毛，下面发绿色，被灰色柔毛。花单生，芳香，直径10-15cm，花被9-12或更多，外轮3片绿色，盛开时向外反卷，内两轮白色，倒卵状匙形；雄蕊多数，长2-3cm，花丝红色；雌蕊多数，分离。聚合果长圆形，长9-15cm，（艹骨）（廿突）果具2-3mm的喙。种子三角状倒卵形，外种皮红色。花期4-5月，果期9-10月。<br>2.本种与厚朴十分相似，主要区别是，本种叶先端凹缺成2个钝圆的浅裂片。聚合果基部较窄。花期4-5月，果期9-10月。\", \"wei\": \"苦；辛；性温\", \"liang\": \"内服：煎汤，3-10g；或入丸、散。\", \"zhi\": \"行气消积；燥湿除满；降逆平喘。主食积气滞；腹胀便秘；湿阻中焦，脘痞吐泻；痰壅气逆；胸满喘咳\" },\n  { \"name\": \"厚朴花\", \"xing\": \"1.落叶乔木，高5-15m。树皮紫褐色，小枝粗壮，淡黄色或灰黄色。冬芽粗大，圆锥形，芽鳞被浅黄色绒毛。叶柄粗壮，长2.5-4cm，托叶痕长约为叶柄的2/3。叶近革质，大形，叶片7-9集生枝顶，长圆状倒卵形，长22-46cm,宽15-24cm，先端短尖或钝圆，基部渐狭成楔形，上面绿色，无毛，下面发绿色，被灰色柔毛。花单生，芳香，直径10-15cm，花被9-12或更多，外轮3片绿色，盛开时向外反卷，内两轮白色，倒卵状匙形；雄蕊多数，长2-3cm，花丝红色；雌蕊多数，分离。聚合果长圆形，长9-15cm，（艹骨）（廿突）果具2-3mm的喙。种子三角状倒卵形，外种皮红色。花期4-5月，果期9-10月。<br>2.本种与厚朴十分相似，主要区别是，本种叶先端凹缺成2个钝圆的浅裂片。聚合果基部较窄。花期4-5月，果期9-10月。\", \"wei\": \"辛；微苦；性温\", \"liang\": \"内服：煎汤，3～5g。\", \"zhi\": \"行气宽中；开郁化湿。主肝胃气滞；胸脘胀闷；食欲不振；纳谷不香；感冒咳嗽等证\" },\n  { \"name\": \"砂仁\", \"xing\": \"1.阳春砂，多年生草本，株高1.2-2m。根茎圆柱形，匍匐于地面节上具鞘状膜质鳞片。芽鲜红色，锥状。茎直立，圆柱形。叶无柄或近无柄；叶舌关圆形，长3-5mm，棕红色或有时绿色；叶2列，叶片狭长椭圆形或披针形，长15-40cm，宽2-5cm，先端尾尖，基部渐狭或近圆形，全缘，两面无毛或有时下面有微毛。花葶从根茎上抽出，长7-15cm；总花梗长3-10cm，被细柔毛；鳞片膜质，椭圆形，褐色或绿色，长0.8-2.5cm，先端钝圆，基部常连合成管状，穗状花序椭圆形，总苞片膜质，长椭圆形，长约1.8cm，宽约0.6cm；苞片管状，白色，长约1.1cm，膜质，先端2裂；花萼管状，白色，长约1.7cm ，先端具三浅齿；花冠管细长，白色，长1.8-2.0cm；唇瓣圆匙形，白色，长宽1.6-2.0cm，中央部分稍加厚，呈现淡黄色或黄绿色，间有红色斑点，先端2浅裂，反卷；侧生退化雄蕊2，位于唇瓣的基部，呈乳头状突起；雄蕊1，长约1cm，花药长约6mm，药隔附属体3裂，先端裂片半圆形，反卷，两侧裂片细小，花丝扁平，较花药略短，子房被白色柔毛。蒴果椭圆形，长1.5-2cm，直径约1.5cm，具不分枝的软刺，棕红色。种子多数，聚成一团，有浓郁的香气。花期3-5月，果期7-9月。<br>2.绿壳砂仁本变种与正种外部形态极相似，区别点是：本变种根茎先端的芽、叶舌多呈绿色，果实成熟时变为绿色。花期4-5月，果期7-9月。<br>3.海南砂仁，与砂仁不同之处为：本种叶舌极长，长2-4.5cm。果具明显钝3棱，果皮厚硬，被片状、分裂的柔刺，极易识别。花期4-6月，果期6-9月。\", \"wei\": \"味辛；性温\", \"liang\": \"内服：煎汤，3-6g，后下；或入丸、散。\", \"zhi\": \"化湿开胃；行气宽中温脾止泻安胎。主湿阻气滞；脘腹胀满；不思饮食；恶心呕吐；腹痛泄泻妊娠恶阻；胎动不安\" },\n  { \"name\": \"砂仁壳\", \"xing\": \"无\", \"wei\": \"无\", \"liang\": \"内服:煎汤，0.5～1.5钱；或烧存性研末。外用:煅研撒。\", \"zhi\": \"《中国医学大辞典》:功用与砂仁同，而较为平和。\" },\n  { \"name\": \"豆蔻\", \"xing\": \"多年生草本。叶披针形，顶端有长尾尖，除具缘毛外，两面无毛；无叶柄。叶舌初被疏长毛，后脱落而仅有疏缘毛；叶鞘口无毛；穗状花序圆柱形；苞片卵状长圆形；花萼管被毛；花冠白色或稍带淡黄；唇瓣椭圆形，稍凹入，淡黄色，中脉有带紫边的桔红色带；雄蕊1；子房被长柔毛。花期2～5月，果期6～8月。\", \"wei\": \"性温，味辛。\", \"liang\": \"无\", \"zhi\": \"化湿和胃，行气宽中。用于食欲不振、胸闷恶心、胃腹胀痛。\" },\n  { \"name\": \"豆蔻壳\", \"xing\": \"无\", \"wei\": \"辛，温。\", \"liang\": \"3～6g，入煎剂宜后下。\", \"zhi\": \"化湿行气，温中止呕。适用于寒湿气滞、脘腹胀闷、胃呆、呕吐等症。\" },\n  { \"name\": \"草豆蔻\", \"xing\": \"草豆蔻，多年生草本，株高1.5-3m。叶柄长1.5-2cm；叶片狭椭圆形或线状披针形，长50-65cm，宽6-9cm，先端渐尖，基部渐狭，有缘毛，两面无毛或仅在下面被极疏的粗毛；叶舌卵菜，长5-8mm，外被粗毛。总状花序顶生，直立，长20-30cm，花序轴密被粗毛，小花梗长约3m，小苞片乳白色，阔椭圆形，长约3.5cm，先端钝圆，基部连合；花萼钟状，白色，长1.5-2.5cm，先端有不规则3钝齿，1侧深裂，外被毛；花冠白色，花冠管长约8mm，裂片3，长圆形，上方裂片较大，长约3.5cm，宽约3.0cm，先端2浅裂，边缘具缺刻，前部具红色或红黑色条纹，后部具淡紫红色斑点；侧生退化雄蕊披针形，长4mm或有时不存；雄蕊1，长 2.2-2.5cm，花药椭圆形，药隔背面被腺毛，花丝扁平，长约1.5cm；子房卵圆形，下位，密被淡黄色绢毛。蒴果近圆形，直径约3cm，外被粗毛，熟时黄色。花期4-6月，果期6-8月。\", \"wei\": \"味辛；性温\", \"liang\": \"内服：煎汤，3-6g，宜后下；或入丸、散。\", \"zhi\": \"温中燥湿；行气健脾。主寒湿阴滞脾胃之脘腹冷痛；痞满作胀，呕吐；泄泻；食谷不化；痰馀；脚气；阐疟；口臭\" },\n  { \"name\": \"草果\", \"xing\": \"草果，多年生草本，高2-2.5m。全株有辛辣气味。茎基部膨大，直径达6cm。叶2列，11-14枚，无叶柄，或上部叶有短柄；叶舌带紫色，长1-2cm，膜质，被疏柔毛；叶鞘具条纹，叶舌及叶鞘边缘近革质；叶片长圆状披针形至卵形，长20-83cm，宽5-19cm，先端长渐尖，基部楔形，全缘，两面无毛。花葶从茎基部抽出，长渐尖，基部楔形，全缘，两面无毛。花葶从茎基部抽出，长13-28cm；总花梗长4-13cm；鳞片阔卵形，长1-8cm；穗状花序长9-15cm；苞片淡红色，长圆形，长3.3-4cm，宽7-9mm，外面疏被短柔毛；小苞片管状，长1.7-2cm，2浅裂；外被疏短柔毛；花浅橙色，长5.5-7cm；小花梗长不超过5mm；花萼长2.3-3cm，3齿裂，一侧浅裂，近无毛或疏被短柔毛；花冠管长2.5-2.8cm，被短柔毛，裂片长圆形，长约2.3cm，宽约6mm，后方一枚兜状，长约2.5cm，宽约1.5cm；唇瓣长圆状倒卵形，长3-3.5cm，宽约1.6cm，边缘多皱，中脉两侧各有一条红色条纹；雄蕊长2-2.5cm，花丝长约1cm，花药长1.3-1.5cm，药隔附属体长约5mm，具啮蚀状牙齿；花柱被疏短毛，柱头漏斗状；子房无毛。蒴果成熟时暗紫色，近球形，长2.5-4.5cm，直径2-2.5cm，干时变橄榄形，黑褐色，先端具残存的花被管，基部有短柄。种子多数。花期4-5月，果期8-9月。\", \"wei\": \"味辛；性温\", \"liang\": \"内服：煎汤，3-6g；或入丸、散。\", \"zhi\": \"燥湿温中祛痰截疟。主脘腹冷痛；恶心呕吐；胞膈痞满；泄泻泻；下痢；疟疾\" }] },\n\n{\n  \"name\": \"利水渗湿药\",\n  \"num\": 36,\n  \"content\": [\n  { \"name\": \"茯苓\", \"xing\": \"菌核球形、卵形、椭圆形至不规则形，长10-30cm或者更长，重量也不等，一般重500-5000g。外面吸厚而多皱褶的皮壳，深褐色，新鲜时软干 后变硬；内部白色或淡粉红色，粉粒状。子实体生于菌核表面，全平伏，厚3-8cm，白色，肉质，老后或干后变为浅褐色。菌管密长2-3mm管壁薄，管口圆形、多角形或不规则形，径0.5-1.5cm，口缘裂为齿状。孢子长方形至近圆柱形，平滑，有一歪尖，大小（7.5-9)μm×（3-3.5）μm。\", \"wei\": \"甘；淡；平\", \"liang\": \"内服：煎汤，10-15g；或入丸散。宁心安神用朱砂拌。\", \"zhi\": \"渗湿利水；健脾和胃；宁心安神。主小便不利；水肿胀满；痰饮咳逆；呕吐；脾虚食少；泄泻；心悸不安；失眠健忘；遗精白浊\" },\n  { \"name\": \"茯苓皮\", \"xing\": \"无\", \"wei\": \"甘淡，平。\", \"liang\": \"内服:煎汤，3～5钱。\", \"zhi\": \"利水，消肿。治水肿肤胀。\" },\n  { \"name\": \"茯神\", \"xing\": \"菌核球形、卵形、椭圆形至不规则形，长10-30cm或者更长，重量也不等，一般重500-5000g。外面吸厚而多皱褶的皮壳，深褐色，新鲜时软干 后变硬；内部白色或淡粉红色，粉粒状。子实体生于菌核表面，全平伏，厚3-8cm，白色，肉质，老后或干后变为浅褐色。菌管密长2-3mm管壁薄，管口圆形、多角形或不规则形，径0.5-1.5cm，口缘裂为齿状。孢子长方形至近圆柱形，平滑，有一歪尖，大小（7.5-9)μm×（3-3.5）μm。\", \"wei\": \"甘；淡；性平\", \"liang\": \"内服：煎汤，9-15g；或入丸、散。\", \"zhi\": \"宁心；安神；利水。主惊悸；健忘；健忘失眠；惊痫；小便不利\" },\n  { \"name\": \"薏苡仁\", \"xing\": \"无\", \"wei\": \"甘、淡，凉。\", \"liang\": \"9～30g。\", \"zhi\": \"健脾渗湿，除痹止泻，清热排浓。用于水肿，脚气，小便不利，湿痹拘挛，脾虚泄泻，肺痈，肠痈；扁平疣。\" },\n  { \"name\": \"猪苓\", \"xing\": \"菌核呈长形块状或不规则块状，有的呈关状，稍扁，表面凹凸不平，棕黑色或黑褐色，有皱纹及窟状突起；断面呈白色或淡褐色，半木质化，较轻。子实体从地下菌核内生出，常多数合生，菌柄基部相连或多分枝，形成一丛菌盖，伞形成伞状半圆形，直径达15厘米以上。菌盖肉质，干后硬而脆，圆形，宽1～8厘米，中部脐状，表面浅褐色至红褐色。菌肉薄，白色。菌管与菌肉同色，与菌柄呈延生；管口多角形。孢子在显微镜下呈卵圆形。\", \"wei\": \"甘淡，平。\", \"liang\": \"内服：煎汤，2～4钱；或入丸，散。\", \"zhi\": \"利尿渗湿。治小便不利，水肿胀满，脚气，泄泻，淋、浊，带下。\" },\n  { \"name\": \"泽泻\", \"xing\": \"泽泻，多年生沼生植物，高50-100cm。地下有块茎，球形，直径可达4.5cm， 外皮褐色，密生多数须根。叶根生；叶柄长达50cm，基部扩延成中鞘状，宽5-20mm ;叶片宽椭圆形至卵形，长5-18cm ，宽2-10cm，先端急尖或短尖，基部广楔形、圆形或稍心形，全缘，两面光滑；叶脉5-7条。花茎由叶丛中抽出，长10-100cm，花序通常有3-5轮分枝，分枝下有披针形或线形苞片，轮生的分枝常 再分枝，组成圆锥状复伞形花序，小花梗长短不等；小苞片披针形至线形，尖锐；萼片3，广卵形，绿色或稍带紫色，长2-3mm，宿存；花瓣倒卵形，膜质，较萼片小，白色，脱落；雄蕊6；雌蕊多数，离生；子房倒卵形，侧扁，花柱侧生。瘦果多数，扁平，倒卵形，长1.5-2mm，宽约1mm，背部有两 浅沟，褐色，花柱宿存。花期6-8月，果期7-9月。\", \"wei\": \"味甘；淡；性寒\", \"liang\": \"内服：煎汤，6-12g；或入丸、散。\", \"zhi\": \"利水渗湿；泄热通淋。主小便不利；热淋涩痛；水肿胀满；泄泻；痰饮眩晕；遗精\" },\n  { \"name\": \"冬瓜皮\", \"xing\": \"无\", \"wei\": \"甘，凉。\", \"liang\": \"内服：煎汤，0.3～1两；或入散剂。外用：煎水洗或研末调敷。\", \"zhi\": \"利水消肿。治水肿，腹泻，痈肿。\" },\n  { \"name\": \"冬瓜子\", \"xing\": \"一年生蔓生或架生草本。茎被黄褐色硬毛及长柔毛，有棱沟，长约6m。单叶互生；叶柄粗壮，长5-20cm，被黄褐色硬毛及长柔毛；叶片肾状近圆形，宽15-30cm5-7浅裂或有时中裂，裂片宽卵形，先端急尖，边缘有小齿，基部深心形，两面均被粗毛，叶脉网状，在叶背面稍隆起，密被毛。郑须生于叶腋，2-3歧，被粗硬毛和长柔毛。花单性，雌雄同株；花单生于叶腋，花梗被硬毛；花萼管大辩论，裂片三角卵形，边缘有锯齿，反折；花冠黄色，5裂至基部，外展；雄花有雄蕊3，花丝分生，花药卵形，药室呈S形折曲；雌花子房长圆筒形或长卵形，密被黄褐色长硬毛，柱头3，略扭曲。瓠果大型，肉质，长圆柱状或近球形，长25-60cm，径10-25cm，表面有硬毛和蜡质白粉。种子多数，卵形，白色或淡黄色，压扁。花期5-6月，果期6-8月。\", \"wei\": \"味甘；性微寒\", \"liang\": \"内服：煎汤，10-15g；或研末服。外用：适量，研膏涂敷\", \"zhi\": \"清肺化痰；消痈排脓；利湿。主痰热咳嗽；肺痈；肠痈；白浊；带下；脚气；水肿；淋证\" },\n  { \"name\": \"玉米须\", \"xing\": \"植物形态详\\\"玉蜀黍\\\"条。\", \"wei\": \"甘，平。\", \"liang\": \"内服：煎汤，1～2两；或烧存性研末。外用：烧烟吸入。\", \"zhi\": \"①治疗慢性肾炎\" },\n  { \"name\": \"葫芦\", \"xing\": \"无\", \"wei\": \"甘，平。\", \"liang\": \"0.5～1两。\", \"zhi\": \"利尿，消肿，散结。用于水肿，腹水，颈淋巴结结核。\" },\n  { \"name\": \"香加皮\", \"xing\": \"杠柳，又名：狭叶萝藦、羊奶条、臭槐、羊角槐，羊交叶。\", \"wei\": \"辛苦，微温，有毒。\", \"liang\": \"内服：煎汤，1.5～3钱；浸酒或入丸、散。\", \"zhi\": \"祛风湿，壮筋骨。治风湿性关节炎；小儿筋骨软弱，脚痿行迟；水肿小便不利。\" },\n  { \"name\": \"车前子\", \"xing\": \"无\", \"wei\": \"甘，微寒。\", \"liang\": \"9～15g，入煎剂宜包煎。\", \"zhi\": \"清热利尿，渗湿通淋，明目，祛痰。用于水肿胀满，热淋涩痛，暑湿泄泻，目赤肿痛，痰热咳嗽。\" },\n  { \"name\": \"车前草\", \"xing\": \"无\", \"wei\": \"甘，寒。\", \"liang\": \"9～30g；鲜品30～60g，煎服或捣汁服。外用鲜品适量，捣敷患处。\", \"zhi\": \"清热利尿，祛痰，凉血，解毒。用于水肿尿少，热淋涩痛，暑湿泻痢，痰热咳嗽，吐血衄血，痈肿疮毒。\" },\n  { \"name\": \"滑石\", \"xing\": \"单斜晶系。晶体呈六方形或菱形板状，但完好的晶体极少见，通常为粒状和鳞片状的致密块体。淡绿色、白色或灰色。条痕白色或淡绿色。光泽脂肪状。解理面显珍珠状。半透明至不透明。解理沿底面极完全。硬度1，比重2.7～2.8。性柔。有滑腻感。块滑石能被锯成任何形状，薄片能弯曲，但无弹性。多产于变质岩、石灰岩、白云岩、菱镁矿及页岩中。\", \"wei\": \"甘淡，寒。<br>①《本经》：味甘，寒。<br>②《别录》：大寒，无毒。<br>③《本草经疏》：味甘淡，气寒，无毒。\", \"liang\": \"内服：煎汤（布包），3～4钱；或入丸、散。外用：研末掺或调敷。\", \"zhi\": \"清热，渗湿，利窍。治暑热烦渴，小便不利，水泻，热痢，淋病，黄疸，水肿，衄血，脚气，皮肤湿烂。<br>①《本经》：主身热泄荩女子乳难，癃闭，利小便，荡胃中积聚寒热，益精气。<br>②《别录》：通九窍六腑津液，去留结，止渴，令人利中。<br>③《药性论》：能疗五淋，主难产，除烦热心躁，偏主石淋。<br>④《日华子本草》：治乳痈，利津液。<br>⑤《本草衍义补遗》：燥湿，分水道，实大肠，化食毒，行积滞，逐凝血，解燥渴，补脾胃，降心火之要药。<br>⑥《纲目》：疗黄疸，水肿脚气，吐血衄血，金疮出血，诸疮肿毒。<br>⑦《本草通玄》：利窍除热，清三焦，凉六府，化暑气。<br>⑧《本草再新》：清火化痰，利湿消暑，通经活血，止泻痢呕吐，消水肿火毒。\" },\n  { \"name\": \"木通\", \"xing\": \"1.木通 落叶木质缠绕灌本，长3-15cn，全株无毛。幼枝灰绿色，有纵纹。掌状复叶，小叶片5，倒卵形或椭圆形，长3-6cm，先端圆常微凹至具一细短尖，基部圆形或楔形，全缘。短总状花序腋生，花单性，雌雄同株；花序基部着生1-2朵雌花，上部着生密而较细的雄花；花补3片；雄花具雄蕊6个；雌花较大，有离生雌蕊2-13。果肉质，浆果状，长椭圆形，或略呈肾形，两端圆，长约8cm，直径2-3cm，熟后紫色，柔软，沿腹缝线开裂。种子多数，长卵而稍扁，黑色或黑褐色。花期4-5月，果熟期8月。<br>2.三叶木通 与前种相近。主要区别点：叶为三出复叶；小叶卵圆形、宽卵圆形或长卵形，长宽变化很大，先端钝圆、微凹或具短尖，基部圆形或楔形，有时微呈心形，边缘浅裂或呈波装，侧脉5-6对。<br>3.白木通 本变种形态与三叶木通相近，但小叶全缘，质地较厚。\", \"wei\": \"苦；性寒\", \"liang\": \"内服：煎汤，3-6g；或入丸、散。\", \"zhi\": \"清热利尿；活血通脉。主小便赤赤；淋浊；水肿；胸中烦热；喉喉疼痛；口舌生疮；风湿痹痛；乳汁不通；经闭；痛经\" },\n  { \"name\": \"川木通\", \"xing\": \"1.绣球藤，木质藤本，长达8m。茎圆柱形，有纵条纹；小枝有短柔毛，后脱落变无毛；老茎外皮剥落。叶对生，或数叶与花簇生；叶柄长5-6cm；三出复叶，小叶片卵形、宽卵形或椭圆形，长2-7cm，宽1-5cm，先端急尖或渐尖，3浅裂，边缘有锯齿，两面疏生短柔毛。两性花，1-6朵与叶簇生，直径3-5cm；萼片4，开展，长圆状倒卵形或倒卵形，长1.5-2.5cm，宽0.8-1.5cm，外面疏生短柔毛，内面无毛；花瓣无；雄蕊多数，长约1cm，无毛；心皮多数。瘦果扁，卵形或印圆形，长4-6mm，无毛，宿存花柱羽毛状，长约2.2cm。花期4-6月，果期7-9月。\", \"wei\": \"味淡；微苦；性寒\", \"liang\": \"内服：煎汤，3-6g。\", \"zhi\": \"清热利尿；通经下乳。主湿热癃闭；水肿；淋证；心火上炎之口舌生疮；湿热痹痛；关节不利；妇人闭经；乳汁不通\" },\n  { \"name\": \"通草\", \"xing\": \"无\", \"wei\": \"甘、淡，微寒。\", \"liang\": \"3～5g。\", \"zhi\": \"清热利尿，通气下乳。用于湿温尿赤，淋病涩痛，水肿尿少，乳汁不下。\" },\n  { \"name\": \"瞿麦\", \"xing\": \"①瞿麦，又名：大菊、蘧麦（《尔雅》），地面（《齐民要术》），红花瞿麦、野麦、木碟花、剪刀花、十样景。<br>多年生草本，高达1米。茎丛生，直立，无毛，上部2歧分枝，节明显。叶互生，线形或线状披针形，长1.5～9厘米，宽1～4毫米，先端渐尖，基部成短鞘状包茎，全缘，两面均无毛。花单生或数朵集成稀疏垃式分枝的圆锥花序；花梗长达4厘米；小苞片4～6，排成2～3轮；花萼圆筒形，长达4厘米，先端5裂，裂片披针形，边缘膜质，有细毛；花瓣5，淡红色、白色或淡紫红色，先端深裂成细线条，基部有须毛；雄蕊10；子房上位，1室，花柱2，细长。蒴果长圆形，包在宿存的萼内。花期8～9月。果期9～11月。<br>生于山坡或林下。全国大部分地区有分布。<br>②石竹（《杜工部集》），又名：鹅毛石竹、绣竹（《洛阳花木记》），洛阳花（《纲目》），石柱花。<br>外形与上种相似，主要区别为苞片卵形，叶状，开张，长为萼筒的1/2，先端尾状渐尖；萼筒长2～2.5厘米，裂片阔披针形；花瓣通常紫红色，先端浅裂成锯齿状。花期4～6月。果期6～8月。<br>庭园多有栽培。全国大部分地区有分布。\", \"wei\": \"苦，寒。<br>①《本经》：味苫，寒。<br>②《别录》：辛，无毒。<br>③《本草正》：味苦，微寒。\", \"liang\": \"内服：煎汤，1.5～3钱；或入丸、散。外用：研末调敷。\", \"zhi\": \"清热利水，破血通经。治小便不通，淋病，水肿，经闭，痈肿，目赤障翳，浸淫疮毒。<br>①《本经》：主关格诸癃结，小便不通，出刺，决痈肿，明目去翳，破胎堕子，下闭血。<br>②《别录》：养肾气，逐膀胱邪逆，止霍乱，长毛发。<br>③《药性论》：主五淋。<br>④《日华子本草》：叶：治痔漏并泻血，小儿蛔虫，眼目肿痛，捣敷治浸淫疮并妇人阴疮。子：催生，治月经不通，破血块，排脓。<br>⑤《本草图经》：利小肠为最要。<br>⑥《现代实用中药》：治水肿，尿热涩痛，血淋。\" },\n  { \"name\": \"萹蓄\", \"xing\": \"一年生草本，高15～50厘米。茎匍匐或斜上，基部分枝甚多，具明显的节及纵沟纹；幼枝上微有棱角。叶互生；叶柄短，约2～3毫米，亦有近于无柄者；叶片披针形至椭圆形，长5～16毫米，宽1.5～5毫米，先端钝或尖，基部楔形，全缘，绿色，两面无毛；托鞘膜质，抱茎，下部绿色，上部透明无色，具明显脉纹，其上之多数平行脉常伸出成丝状裂片。花6～10朵簇生于叶腋；花梗短；苞片及小苞片均为白色透明膜质；花被绿色，5深裂，具白色边缘，结果后，边缘变为粉红色；雄蕊通常8枚，花丝短；子房长方形，花柱短，柱头3枚。瘦果包围于宿存花被内，仅顶端小部分外露，卵形，具3棱，长2～3毫米，黑褐色，具细纹及小点。花期6～8月。果期9～10月。\", \"wei\": \"苦，寒。\", \"liang\": \"内服：煎汤，2～3钱；或捣汁。外用：捣敷或煎水洗。\", \"zhi\": \"①治疗细菌性痢疾\" },\n  { \"name\": \"地肤子\", \"xing\": \"地肤（《本经》），又名：箭、王]（《尔雅》），王帚（《尔雅》郭璞注），扫帚（陶弘景），涎衣草（《唐本草》），鸭舌草、独帚（《本草图经》），白地草（《纲目》），黄蒿（《本经逢原》），地面草。<br>一年生草本，高约50～150厘米。茎直立，多分枝，绿色，秋季常变为红色，幼枝有白柔毛。叶互生，无柄；狭披针形至线状披针形，长1～7厘米，宽1～7毫米，先端渐尖，基部楔形，全缘，上面绿色，无毛，下面淡绿色，无毛或有短柔毛；幼叶边缘有白色长柔毛，其后逐渐脱落。花1朵或数朵生于叶腋，成穗状花序；花小，黄绿色；花被筒状，先端5齿裂，裂片三角形，向内弯曲，包裹子房，中肋突起似龙骨状，裂片背部有一绿色突起物；雄蕊5，伸出于花被之外；子房上位，扁圆形，花柱极短，柱头2。胞果扁圆形，基部有宿存花被，展开成5权横生的翅。种子1枚，扁球形，黑色。花期7～9月。果期8～10月。\", \"wei\": \"甘苦，寒。<br>①《本经》：味苦，寒。<br>②《别录》：无毒。<br>③《纲目》：甘，寒。\", \"liang\": \"内服：煎汤，2～5钱；或入丸、散。外用：煎水洗。\", \"zhi\": \"利小便，清湿热。治小便不利，淋病，带下，疝气，风疹，疮毒，疥癣，阴部湿痒。<br>①《本经》：主膀胱热，利小便。补中，益精气。<br>②《别录》：去皮肤中热气，散恶疮，疝瘕，强阴，使人润泽。<br>③《药性论》：与阳起石同服，主丈夫阴痿不起，补气益力；治阴卵癀疾，去热风，可作汤沐浴。<br>④《日华子本草》：治客热丹肿。<br>⑤《滇南本草》：利膀胱小便积热，洗皮肤之风，疗妇人诸经客热，清利胎热，湿热带下。<br>⑥《本草原始》：去皮肤中积热，除皮肤外湿痒。<br>⑦《本草备要》：益精强阴，除虚热，利小便而通淋。<br>⑧《玉楸药解》：疗头目肿痛，狐疝阴颓，腰疼胁痛，血痢，恶疮。\" },\n  { \"name\": \"海金沙\", \"xing\": \"多年生攀援草本，长1-4m。根茎细而匍匐，被细柔毛。茎细弱、呈干草色，有白色微毛。叶为1-2回羽状复叶，纸质，两面均被细柔毛；能育羽片卵状三角形，长12-20cm，宽10-16cm，小叶卵状披针形，边缘有温齿或不规则分裂，上部小叶无柄，羽状或戟形，下部小叶有柄；不育羽片尖三角形，通常与能育羽片相似，但有时为1回羽状复叶，小叶阔线形，或基部分裂成不规则的小片。孢子囊生于能育羽片的背面，在2回小叶的齿及裂片顶端成穗状排列，穗长2-4mm，孢子囊盖鳞片状，卵形，每盖下生一横卵形的孢子囊，环带侧生，聚集一处。孢子囊多在夏秋季产生。同属植物小叶海金沙Lygodium microphyllum(Cav.)R.Br.的全草，在广东、广西民间亦同供药用。与上种的主要区别点：羽片为1回羽状复叶，小叶片基部有关节。\", \"wei\": \"甘；淡；寒；无毒\", \"liang\": \"内服：煎汤，5-9g，包煎；或研末，每次2-3g。\", \"zhi\": \"清热解毒；利水通淋。主热淋；血淋；沙淋；白浊；女子带下；水湿肿满；湿热泻痢；湿热黄疸；吐血；衄血；尿血；外伤出血\" },\n  { \"name\": \"石韦\", \"xing\": \"1.石韦，植株高10-30cm。根状茎细长，横生，与叶柄密被棕色披针形鳞片，顶端渐尖，盾状着生，中央深褐色，边缘淡棕色，有睫毛。叶远生，近二型；叶柄长3-10cm，深棕色，有浅沟，幼时被星芒状毛，以关节着生于根状茎上；叶片革质，披针形至长圆状披针形，长6-20cm，宽2-5cm，先端渐尖，基部渐狭并不延于叶柄，全缘；上面绿色，偶有星状毛和凹点，下面密被灰棕色的星芒状毛；不育叶和能育叶同型或略短而阔；中脉上面稍凹，下面隆起，侧脉多少可见，小脉网状。孢子囊群满布于叶背面或上部，幼时密被星芒状毛，成熟时露出；无囊群盖。\", \"wei\": \"苦；甘；寒\", \"liang\": \"内服：煎汤，9-15g；或研末。外用：适量，研末涂敷。\", \"zhi\": \"利水通淋；清肺化痰；凉血止血。主淋病；水肿；小便不利；痰热咳喘；咯血；吐血；衄血；崩漏；外伤出血\" },\n  { \"name\": \"冬葵子\", \"xing\": \"冬葵（《本经》），又名：葵（《诗经》），葵菜（《说文》），露葵（《尔雅翼》），冬葵菜（《救荒本草》），滑菜（《纲目》），卫足（《鲜芳谱》），马蹄菜，蕲菜（《医林纂要》），滑肠菜（《宁都州志》），金钱葵、金钱紫花葵（《挚经室集》），冬寒菜（《植物名实图考》），冬苋菜（《分类草药性》），茴菜、滑滑菜、奇菜。\", \"wei\": \"甘，寒。\", \"liang\": \"内服：煎汤，2～5钱；或入散剂。\", \"zhi\": \"利水，滑肠，下乳。治二便不通，淋病，水肿，妇女乳汁不行，乳房肿痛。\" },\n  { \"name\": \"灯心草\", \"xing\": \"多年生草本，高35～100厘米。根茎横走，具多数须根。茎圆筒状，直径1～2毫米，外具明显条纹，淡绿色。无茎生叶，基部具鞘状叶，长者呈淡赤褐色，短者呈褐色或黑褐色，有光泽。复聚伞花序，假侧生，由多数小花密聚成簇；花淡绿色，具短柄；花被6，2轮，裂片披针形，长2～2.5毫米，背面被柔毛，边缘膜质，纵脉2条；雄蕊3，较花被短；子房3室，花柱不明显，柱头3枚。蒴果卵状三棱形或椭圆形，长约2毫米，先端钝，淡黄褐色。种子多数，斜卵形。花期5～6月。果期7～8月。\", \"wei\": \"甘淡，寒。<br>①《开宝本草》：味甘，寒，无毒。<br>②《医学启源》：气平，味甘。《主治秘诀》云：辛甘。<br>③《伤寒蕴要》：淡，平。<br>④《本草从新》：甘淡，微寒。\", \"liang\": \"内服：煎汤，5～8分（鲜草单用，0.5～1两）；或入丸、散。外用：煅存性研末撒或吹喉。\", \"zhi\": \"清心降火，利尿通淋。治淋病，水肿，小便不利，湿热黄疸，心烦不寐，小儿夜啼，喉痹，创伤。<br>用于：１、热证小便水利、淋漓涩痛。２、心热烦躁、小儿夜啼、惊痫。此外本品外用吹喉，可治喉痹。<br>①《开宝本草》：主五淋。<br>②《医学启源》：通阴窍涩，利小水，除水肿闭，治五淋。《主治秘诀》云：泻肺。<br>③《本草衍义补遗》：治急喉痹，小儿夜啼。<br>④《纲目》：降心火，止血，通气，散肿，止渴。<br>⑤《分类草药性》：涂痔疮。<br>⑥《北方常用中草药手册》：清热安神，利水通淋。<br>⑦《西藏常用中草药》：清肺，降火，利尿。治心烦不寐。<br>⑧南川《常用中草药手册》：治喉炎及咳嗽。<br>⑨福建龙溪《实用中草药》：治小儿惊热，泌尿系炎症，疮疡，胬肉。\" },\n  { \"name\": \"萆薢\", \"xing\": \"①粉背薯蓣，又名：黄萆薢、黄山姜、土黄连、黄薯。\", \"wei\": \"苦，平。\", \"liang\": \"内服：煎汤，3～5钱；或入丸、散。\", \"zhi\": \"祛风，利湿。治风湿顽痹，腰膝疼痛，小便不利，淋浊，遗精，湿热疮毒。\" },\n  { \"name\": \"茵陈\", \"xing\": \"多年生草本或半灌木状。茎直立，高0.5～1m，基部木质化，表面黄棕色，具纵条纹，多分枝；幼时全体有褐色丝状毛，成长后近无毛。叶1～3回羽头深裂，下部裂片较宽短，常被短绢毛；中部叶裂片细长如发，宽约1mm；上部叶羽头分裂，3裂或不裂，近无毛。头状花序小而多，密集成复总状；总苞片3～4层，无毛，外层卵形，内层椭圆形，中央绿色，边缘膜质；花黄色，管状，外层花3～5，雌性，能育，内层花两性5～7，不育。瘦果长圆形，长约0.8mm，无毛。花期9～10月，果期10～12月。\", \"wei\": \"性微寒，味辛、苦。\", \"liang\": \"无\", \"zhi\": \"清湿热，退黄疸。\" },\n  { \"name\": \"金钱草\", \"xing\": \"多年生蔓生草本。茎柔弱，平卧延伸，长20-60cm，表面灰绿色或带红紫色，全株无毛或被疏毛，幼嫩部分密被褐色无柄腺体，下部节间较短，常发出不定根，中部节间长1.5-5(-10)cm。叶对生；叶柄长1-3cm，无毛；叶片卵圆形、近圆形以至肾圆形，长(1.5-)2-6(-8)cm，宽1-4(-6)cm，先端锐尖或圆钝以至圆形，基部截形至浅心形，稍肉质，透光可见密布的透明腺条，干时腺条变黑色，两面无毛，有腺毛。花单生于叶腋：花梗长1-5cm，通常不超过叶长，花梗幼嫩时稍有毛，多少具褐色无柄腺体；花萼长(4-)5-7(-10)mm，5深裂，分裂近达基部，裂片披针形，椭圆状披针形以至线形或上部稍扩大而近匙形，先端锐尖或稍钝，无毛，被柔毛或仅边缘具缘毛。花冠黄色，辐状钟形，长7-15mm，5深裂，基部合生部分长2-4mm，裂片狭卵形以至近披针形，先端锐尖或钝，具黑色长腺条；雄蕊5，花丝长6-8mm，下半部合生成筒，花药卵圆形，长1-1.5mm；子房卵球形，花柱长6-8mm。蒴果球形，直径3-5mm，无毛，有稀疏黑色腺条，瓣裂。花期5-7月，果期7-10月。\", \"wei\": \"甘；微苦；性凉\", \"liang\": \"内服：煎汤，15-60g，鲜品加倍；或捣汁饮。外用：适量，鲜品捣敷。\", \"zhi\": \"1.胆宁片金钱草200g，人工牛黄30g，水飞蓟素17.5g，盐酸黄连素12.5g，延胡索125g，大黄125g，蒲公英150g，薄荷油2g。延胡索、大黄照渗漉法，以60%乙醇为溶剂渗漉，漉液70℃以下浓缩；蒲公英、金钱草加水煎煮至味尽，浓缩液与上述相合并再浓缩成稠膏状，干燥，粉碎，再与人工牛黄、水飞蓟素、盐酸黄连素及辅料制粒，喷薄荷油，压制成1000片，每片相当于原生药0.66g，包糖衣。片心呈棕褐色，具薄荷香气。功能利胆排石，抗菌消炎，解痉镇痛。用于急、慢性胆囊炎，也可用于胆道感染和胆结石。口服，每次2-3片，每日3-4次，胆囊炎10d为1个疗程。胆结石30d为1个疗程。(《陕西省药品标准》1985年)2.利肝片金钱草3288g，猪胆汁3125g。取金钱草1／2量粉碎成细粉；剩余水煎2次，分次滤过，合并滤液，浓缩成膏，加猪胆汁浓缩至相对密度1.08(热测)，加入乙醇，使含醇量达60%，沉淀，滤过，回收乙醇，浓缩成膏；将粉末、浓缩膏混合，加适量蔗糖粉和辅料，制粒，干燥，压片，包糖衣。每片重0.2g除去糖衣后呈灰褐色；味甘、苦。功能清肝利胆。用于急、慢性传染性肝炎，胆翼炎及肝脏分泌机能障碍。口服，每次2-4片，每日3次。(《吉林省药品标准》1986年；《江苏省药品标准》1977年)3.排石片金钱草1000g，木通300g，海金沙500g，滑石粉300g，车前草300g，地龙300g。地龙研细粉，过筛，备用；金钱草、海金沙、车前草、木通、滑石粉加水煎煮2次，滤过，滤液合并，浓缩至约260m1，加地龙粉混匀，烘干，研碎过18目筛，加硬脂酸镁，混匀，压制成1000片。功能清热利水，通淋排石。用于尿路结石。口服，每次6-8片，每日3次。(《湖南中草药制剂方剂选编》1976年)\" },\n  { \"name\": \"连钱草\", \"xing\": \"多年生草本。茎细，方形，被细柔毛，下部匍匐，上部直立。叶对生，肾形至圆心形，长1.5～3cm，宽1.5～5.5cm，边缘有圆锯齿，两面有毛或近无毛，下面有腺点；叶柄长为叶片的1～2倍。轮伞花序腋生，每轮2～6花；苞片刺芒状；花萼钟状，长7～10mm，萼齿狭三角状披针形，顶端芒状，外面有毛和腺点；花冠2唇形，淡蓝色至紫色，长1.7～2.2cm，下唇具深色斑点，中裂片肾形；雄蕊4，药室叉开。小坚果长圆形，褐色。花期3～4月，果期4～6月。\", \"wei\": \"性微寒，味辛、微苦。\", \"liang\": \"15～30g；外用适量，煎汤洗或取鲜品捣烂敷患处。\", \"zhi\": \"清热解毒，利尿排石，散瘀消肿。用于尿路结石、肝胆结石、湿热黄疸、跌扑损伤。\" },\n  { \"name\": \"广金钱草\", \"xing\": \"半灌木状草本，长达1米。茎平卧或斜举，基部木质，枝呈圆柱形，与叶柄均密被黄色短柔毛。叶互生，有披针形托叶1对，小叶1片，有时3片，中间小叶大而形圆，长2.5～4.5厘米，宽2～4厘米，侧生小叶矩圆形，较小，先端微凹，基部浅心形或近平截，全缘，上面无毛，下面密被银白色丝光毛而呈浅灰绿色，叶脉下凸，侧脉羽状，平行，约为10对，小托叶钻形。夏季茎顶或叶腋抽出总状花序，花密而多，2朵并生，具香气，花梗下弯，长约3毫米；花萼钟状；蝶形花冠紫红色，长约5毫米，旗瓣倒卵形。荚果具3～6荚节，一侧平直，另侧节间呈波状收缩，被有短柔毛和钩状毛，每节有肾形种子1粒。\", \"wei\": \"甘、淡，凉。\", \"liang\": \"0.5～2两。\", \"zhi\": \"清热，利尿，排石。主治：泌尿系感染，泌尿系结石，胆石症，急性黄疸型肝炎。\" },\n  { \"name\": \"江西金钱草\", \"xing\": \"白毛天胡荽，又名：梅花藻叶天胡荽。\", \"wei\": \"《江西中药》：\\\"微甘，寒，无毒。\\\"\", \"liang\": \"内服：煎汤，1～2两；或熬膏。\", \"zhi\": \"①治疗急性传染性肝炎\" },\n  { \"name\": \"小金钱草\", \"xing\": \"多年生草本，匍匐、纤细，长至30厘米，节处着地生不定根，全体通常被丁字形着生的毛。单叶互生，圆形至肾形，径6～10毫米，很少达25毫米，先端圆形，有时微凹，全缘，基部深心形，上面绿色，光滑，下面浅绿色，秃净或有疏柔毛。花小，单生叶腋，花梗短于叶柄；花萼5裂，裂片卵形，长不及1毫米，绿色，宿存；花冠钟状，白色；雄蕊5；子房上位，2室，为两个分离的心皮组成。蒴果近球形，径约2毫米，短于花萼。种子两粒。花期4月。果期7～8月。\", \"wei\": \"苦辛，凉。\", \"liang\": \"内服：煎汤，2～5钱（鲜者1～2两）。外用：捣敷或捣汁滴眼。\", \"zhi\": \"清热，解毒，利水，活血。治黄疸，痢疾，砂石淋痛，白浊，水肿，疔疮肿毒，跌打损伤。\" },\n  { \"name\": \"虎杖\", \"xing\": \"多年生灌木状草本，高达1米以上。根茎横卧地下，木质，黄褐色，节明显。茎直立，圆柱形，表面无毛，散生着多数红色或带紫色斑点，中空。单叶互生，阔卵形至近圆形，长7～12厘米，宽5～9厘米，先端短尖，基部圆形或楔形；叶柄长1～2.5厘米；托鞘膜质，褐色，早落。花单性，雌雄异株，圆锥花序腋生；花梗较长，上部有翅；花小而密，白色，花被5片，外轮3片，背面有翅，结果时增大；雄花有雄蕊8枚；雌花子房上部有花柱3枚。瘦果卵形，具3棱，红褐色，光亮，包在翅状的花被中。花期7～9月。果期9～10月。\", \"wei\": \"苦，平。<br>①《别录》：微温。<br>②《药性论》：味甘，平，无毒。<br>③《本草衍义》：微苦。<br>④《滇南本草》：苦微涩，微寒。<br>⑤《医林纂要》：甘苦辛，温。\", \"liang\": \"内服：煎汤，0.3～1两；浸酒或入丸、散。外用：研末、烧灰撒，熬膏涂或煎水浸渍。\", \"zhi\": \"祛风，利湿，破瘀，通经。治风湿筋骨疼痛，湿热黄疸，淋浊带下，妇女经闭，产后恶露不下，Y瘕积聚，痔漏下血。跌扑损伤，烫伤，恶疮癣疾。<br>①《别录》：主通利月水，破留血Y结。<br>②陶弘景：主暴瘕，酒渍服之。<br>③《药性论》：治大热烦躁，止渴，利小便，压一切热毒。<br>④《本草拾遗》：主风在骨节间及血瘀。煮汁作酒服之。<br>⑤《日华子本草》：治产后恶血不下，心腹胀满。排脓，主疮疖痈毒，妇人血晕，扑损瘀血，破风毒结气。<br>⑥《滇南本草》：攻诸肿毒，止咽喉疼痛，利小便，走经络。治五淋白浊，痔漏，疮痈，妇人赤白带下。<br>⑦《医林纂要》：坚肾，强阳益精，壮筋骨，增气力。敷跌伤折损处，可续筋接骨。<br>⑧《岭南采药录》：治蛇伤，脓疱疮，止损伤痛。<br>⑨《贵州民间方药集》：收敛止血，治痔瘘，去风湿，发表散寒，散瘀血，外用治火伤。<br>⑩《中医药实验研究》：治实火牙痛，湿疮烂腿，脚趾歧湿烂。\" },\n  { \"name\": \"地耳草\", \"xing\": \"一年生草本，高15～40厘米，无毛。根多须状。茎直立，或倾斜，细瘦，有4棱，节明显，基部近节处生细根。单叶，短小，对生，多少抱茎，叶片卵形，长4～15毫米，全缘；先端钝，叶面有微细的透明点。聚伞花序顶生，成叉状而疏，花小，黄色；萼片5，披针形；花瓣5，长椭圆形，内曲，几与萼片等长；雄蕊10个以上，基部连合成3束；子房1室，花柱3枚。蒴果长圆形，长约4毫米，外面包围有等长的宿萼。花期5～6月。\", \"wei\": \"苦甘，凉。\", \"liang\": \"内服：煎汤，0.5～1两（鲜品1～2两，大剂可3～4两）；或捣汁。外用：捣敷或煎水洗。\", \"zhi\": \"①治疗急、慢性传染性肝炎\" },\n  { \"name\": \"垂盆草\", \"xing\": \"垂盆草 多年生肉质草本。全株无毛。根纤维状，不育茎匍匐，长 10-25cm，接近地面的节处易生根。叶常为3片轮生；叶片倒披针形全长圆形，长1.5-2.5cm，宽3-7mm，先端近急尖，基部下延，狭而有距，全缘。聚伞花序，项生，有3-5分枝，花小，无梗；萼片5裂，宽披针形，不等长，长3.5-5mm；花瓣5，黄色，披针形至长圆形，长5-8mm；雄蕊10，2轮，比花瓣短；鳞片5，楔状四方形，先端稍微凹；心皮5，长圆形，略叉开，长5-6mm。蓇葖果，内有多数细小的种子。种子卵圆形，表面有细小的乳头状突起。花期5-7月，果期7-8月。\", \"wei\": \"甘、淡、凉；酸\", \"liang\": \"内服：煎汤，15-30g；鲜品50-100g；或捣汁。外用：适量，捣敷；或研末调搽；或取汁外涂；或煎水湿敷。\", \"zhi\": \"用于湿热黄疸，小便不利，痈肿疮疡；急、慢性肝炎。\" },\n  { \"name\": \"鸡骨草\", \"xing\": \"广东相思子 攀援灌木，长达1m；小枝及叶柄被粗毛。主根粗壮，长达60cm。茎细，深红紫色，幼嫩部分密被黄褐色毛。偶数羽状复叶；小叶7-12对，倒卵状形或长圆形，长5-12mm，宽3-5mm，先端截形而有小芒尖，基部浅心形，上面疏生粗毛，下面被紧贴的粗毛，小脉两面均突起；托叶成对着生。总状花序短，腋生；花长约6mm；萼钟状；花冠突出，淡红色；雄蕊9，合生成管状，与旗瓣紧贴，上部分离；子房近于无柄，花柱短。荚果长圆形，扁平，被疏毛，有种子4-5颗。种子长圆形，扁平，褐黑色，种阜明显，蜡黄色，中间有孔，边缘为1长圆形的环，脐褐色针刺状，紧靠荚缘。花期8月，果期9-10月。\", \"wei\": \"甘、苦；凉；无毒\", \"liang\": \"内服：煎汤，15-30g；或入丸、散。外用：适量，鲜品捣敷。\", \"zhi\": \"清热利湿，散瘀止痛。主黄疸型肝炎，胃痛，风湿骨痛，跌打瘀痛，乳痛\" },\n  { \"name\": \"珍珠草\", \"xing\": \"叶下珠（《植物名实图考》）<br>一年生草本，高10～40厘米，秃净或近秃净。茎直立，分枝常呈赤色，具翅状纵棱。单叶互生，排成2列，形似复叶；叶片长椭圆形，长5～15毫米，宽2～5毫米，先端尖或钝，基部圆形，下面灰绿色；叶柄短或近无柄；托叶小，尖三角形。花单性，雌雄同株，腋生，细小，赤褐色；无柄或具短柄；花萼6枚；花冠缺；雄花2～3朵聚生，雄蕊3，花丝基部合生，药室纵裂；雌花在叶下2列着生，子房3室。蒴果无柄，扁圆形，径约3毫米，赤褐色，表面有鳞状凸起物。种子三角状卵形，淡褐色，有横纹。花期7～8月。\", \"wei\": \"甘苦，凉。<br>①《植物名实图考》:性凉。<br>②《福建民间草药》:苦，寒。<br>③《南宁市药物志》:甘苦。\", \"liang\": \"内服:煎汤，0.5～1两（鲜者1～2两）；或捣汁。外用:捣敷。\", \"zhi\": \"平肝清热，利水解毒。治肠炎，痢疾，传染性肝炎，肾炎水肿，尿路感染，小儿疳积，火眼目翳，口疮头疮，无名肿毒。<br>①《生草药性备要》:治小儿疳眼，疳积，煲肉食或煎水洗。治头上生疮仔成堆，痛痒难抵，煎水洗，研末开油搽亦可。<br>②《临证指南》:治小儿诸疳瘦弱，眼欲盲。为末白汤下，或蒸煮鱼肉食。<br>③《植物名实图考》:治瘴气。<br>④《福建民间草药》:平肝，退火，明目，治蛇咬伤。<br>⑤《贵州民间药物》:理气消肿。<br>⑥广州部队《常用中草药手册》:清肝明目，渗湿利水。治肾炎水肿，尿路感染，尿路结石。\" }] },\n\n{\n  \"name\": \"温里药\",\n  \"num\": 15,\n  \"content\": [\n  { \"name\": \"附子\", \"xing\": \"乌头，多年生草本，高60-120cm。块根通常2个连生，纺锤形至倒卵形，外皮黑褐色；栽培品的侧根（子根）甚肥大，直径达5cm。茎直立或稍倾斜，下部光滑无毛，上部散生贴伏柔毛。叶互生，革质，有柄；叶片卵圆形，宽5-12cm，3裂几达基部，两侧裂片再2裂，中央裂片菱状楔形，先端再3浅裂，裂片边缘有粗齿或缺刻。总状圆锥花序，花序轴有贴伏的柔毛；萼片5，蓝紫色，外被微柔毛，上萼片盔形，长15-18mm，宽约20mm，侧萼片近圆形；花瓣2，无毛；雄蕊多数，花丝下半部扩张成宽线形的翅；心皮3-5个，离生，密被灰黄色的短绒毛。u果长圆形，具横脉，花柱宿存，芒尖状。花期6-7月。果期7-8月。\", \"wei\": \"辛；甘；性热；有毒\", \"liang\": \"内服：煎汤，3-9g（炮制品），回阳球逆可用18-30g；或入丸、散。外用：适量，研末调敷，或切成薄片盖在患处或穴位上，用艾炷炙之。内服宜制用，宜久煎；外用多用生品。\", \"zhi\": \"回阳救逆；补火助阳；散寒除湿。主亡阳欲脱；肢冷脉微；阳痿宫冷；心腹冷痛；虚寒吐泻久痢；阴寒水肿；阳虚外感；风寒湿痹；阴疽疮疡\" },\n  { \"name\": \"干姜\", \"xing\": \"姜，多年生草本，高50-80cm。根茎肥厚，断面黄白色，有浓厚的辛辣气味。叶互生，排成2列，无柄，几抱茎；叶舌长2-4mm；叶片披针形至线状披针形，长15-30cm，宽1.5-2.2cm，先端渐尖，基部狭，叶革鞘状抱茎，无毛。花葶自根茎中抽出，长15-25cm；穗状花序椭圆形，长4-5cm；苞片卵形，长约2.5cm，淡绿色，边缘淡黄色，先端有小尖头；花萼管长约1cm，具3短尖齿；花冠黄绿色，管长2-2.5cm，裂片3，披针形，长不及2cm，唇瓣的中间裂片长圆状倒卵开，较花冠裂片短，有紫色条纹和淡黄色斑点，两侧裂片卵形，黄绿色，具紫色边缘；雄蕊1，暗紫色，花药长约9m，药隔附属体包裹住花柱；子房3室，无毛，花柱1，柱头近球形。蒴果。种子多数，黑色。花期8月。\", \"wei\": \"味辛；性热\", \"liang\": \"内服：煎汤，3-10g；或入丸散。外用：适量，煎汤洗；或研末调敷。\", \"zhi\": \"温中散寒；回阳通脉；温肺化饮。主脘腹冷痛；呕吐；泄泻，亡阳厥逆；寒饮喘咳；寒湿痹痛\" },\n  { \"name\": \"肉桂\", \"xing\": \"无\", \"wei\": \"辛、甘，大热。\", \"liang\": \"1～4.5g。\", \"zhi\": \"补火助阳，引火归源，散寒止痛，活血通经。用于阳痿，宫冷，腰膝冷痛，肾虚作喘，阳虚眩晕，目赤咽痛，心腹冷痛，虚寒吐泻，寒疝，奔豚，经闭，痛经。\" },\n  { \"name\": \"吴茱萸\", \"xing\": \"1.吴茱萸 常绿灌木或小乔木，高3-10m。树皮青灰褐色，幼枝紫褐色，有细小圆形的皮孔；幼技、叶轴及花轴均被锈色绒毛。奇数羽状复叶对生，连叶柄长20-40cm；叶柄长4-8cm，小叶柄长2-5mm；小叶5-9，椭圆形至卵形，长5.5-15cm，宽3-7cm，先端骤狭成短尖，基部楔形至广楔形或圆形，全缘或有不明显的钝锯齿，侧脉不明显，两面均被淡黄褐色长柔毛，脉上尤多，有明显的油点，厚纸质或纸质。雌雄异株，聚伞圆锥花序，顶生；花轴粗壮，密被黄褐色长柔毛，花轴基部有小叶片状的狭小对生苞片2枚；萼片5，广卵形，长约1-2mm，被短柔毛；花瓣5，白色，长圆形，长4-6mm；雄花具5雄蕊，插生在极小的花盘上，花药基着，椭圆形，花丝粗短，被毛，退化子房先端4-5裂；雌花的花瓣较雄花瓣大，退化雄蕊鳞片状，子房上位，长圆形，心皮5，花后增宽成扁圆形，有粗大的腺点，花柱粗短，柱头先端4-5钱裂。果实扁球形，成熟时裂开成5个果瓣，呈u果状，紫红色，表面有粗大油腺点，每分果有种子1个，黑色，有光泽。花期6-8月，果期9-10月。<br>2.石虎 本变种与正种很相似。区别点为变种具有特殊的刺激性气味。小叶3-11，叶片较狭，长圆形至狭披针形，先端渐尖或长渐尖，各小叶片相距较疏远，侧脉较明显，全缘，两面密被长柔毛，脉上最密，油腺粗大。花序轴常被淡黄色或无色的长柔毛。成熟果序不及正种密集。种子带蓝黑色。花期7-8月，果期9-10月。<br>3. 毛脉吴茱萸 与上种相似。小枝被黄锈色或丝光质的疏长毛。叶轴被长柔毛；小叶5-11，叶形变化较大，长圆形、披针形、卵状披针形，上表面中脉略被疏短毛，下面脉上被短柔毛，侧脉清晰，油腺点小。花期7-8月，果期9-10月。\", \"wei\": \"辛；苦；热；小毒\", \"liang\": \"内服：煎汤，1.5-5g；或入丸、散。外用：适量，研末调敷，或煎水洗。\", \"zhi\": \"散寒止痛；疏肝下气；温中燥湿。主脘腹冷痛；厥阴头痛；疝痛；脚气肿痛；呕吐吞酸，寒湿泄泻\" },\n  { \"name\": \"小茴香\", \"xing\": \"多年生草本，高0.4-2m。具强烈香气。茎直立，光滑无毛，灰绿色或苍白色，上部分枝开展，表面细纵沟纹。茎生叶互生；较下部的茎生叶叶柄长5-15cm，中部或上部叶的叶柄部或全部皮鞘状，叶鞘边缘膜质；叶片轮廓主国阔三角形，长约30cm，宽约40cm，四至五回羽状全裂；末回裂片丝状，长0.5-5cm，宽0.5-1cm。复伞形花序顶生或侧生，径3-15cm；小伞形花序有花14-30朵，花柄纤细，不等长，长0.3-1.2cm；花小，无萼齿；花瓣黄色，倒卵形或近倒卵形，淡黄色，长约1.5mm，宽约1mm，中部以上向内郑曲，先端微凹；雄蕊5，花丝略长于花瓣，花药卵圆形，淡黄色，纵裂；子房下位，2室，花柱基圆锥形，花柱极短，向外叉开或贴伏在花柱基上。双悬果长圆形，长3.5-6mm，宽1.5-2mm，主棱5条，尖锐；每棱槽内有油管1，合生面有油管2，胚乳腹面近平直或微凹。花期5-6月，果期7-9月。\", \"wei\": \"味辛；性温\", \"liang\": \"内服：煎汤，3-6g；或入丸、散。外用：适量，研末调敷；或炒热温熨。\", \"zhi\": \"温肾暖肝；行气止痛；和胃。主寒疝腹痛；睾丸偏坠；脘腹冷痛；食少吐泻；胁痛；肾虚腰痛；痛经\" },\n  { \"name\": \"八角茴香\", \"xing\": \"常绿乔木，高10～14米，树皮灰色至红褐色。单叶互生，革质，披针形至长椭圆形，长6～12厘米，宽2～5厘米，先端急尖或渐尖，基部楔形，全缘，下面疏被柔毛，叶脉羽状，中脉下陷，侧脉稍凸起；叶柄粗壮。花单生于叶腋，花梗长1.5～3厘米；花圆球形，花被肉质；萼片3，黄绿色；花瓣6～9，排成2～3轮，淡粉红色或深红色，广卵圆形或长圆形；雄蕊15～19，成2～3轮，心皮8～9，分离，花柱短，基部肥厚，柱头细小。蓇葖果成星芒状排列，幼时绿色，成熟时红棕色，星状体径约2.5～3厘米，开裂。种子扁卵形，棕色有光泽。第1次花期2～3月，果期8～9月。第2次花期在第1次果期之后，第2次果期为翌年2～3月。\", \"wei\": \"辛甘，温。\", \"liang\": \"内服：煎汤，1～2钱；或入丸、散。\", \"zhi\": \"温阳，散寒，理气。治中寒呕逆，寒疝腹痛，肾虚腰痛，干、湿脚气。\" },\n  { \"name\": \"丁香\", \"xing\": \"无\", \"wei\": \"辛，温。\", \"liang\": \"1～3g。\", \"zhi\": \"温中降逆，补肾助阳。用于脾胃虚寒，呃逆呕吐，食少吐泻，心腹冷痛，肾虚阳痿。\" },\n  { \"name\": \"母丁香\", \"xing\": \"无\", \"wei\": \"辛，温。\", \"liang\": \"内服：煎汤，0.3～1钱；或研末。外用：研末调敷或作栓剂。\", \"zhi\": \"治疗小儿疝气：取母丁香粉适量撒在独角莲膏药上，贴于患处。每隔1～2天换-次，至病愈为止。观察19例，15例痊愈，3例好转，1例无效。\" },\n  { \"name\": \"高良姜\", \"xing\": \"多年生草本，高30～80厘米。根茎圆柱状，横走，棕红色或紫红色，有节，节处具环形膜质鳞片，节上生根。茎丛生，直立。叶2列；无柄；叶片狭线状披针形，长15～30厘米，宽1.5～2厘米，先端尖，基部渐狭，全缘或具不明显的疏钝齿，两面无毛；叶鞘开放，抱茎，边缘膜质，叶舌长可达3厘米，挺直，膜质，渐尖，棕色。圆锥形总状花序，顶生，长5～15厘米，花稠密；小苞片宿存，膜质，棕色，环形至长圆形，外面被疏毛；花两性，具短柄；萼筒状，长7～14毫米，3浅圆裂，棕黄色，外面被短毛；花冠管漏斗状，长约1厘米，裂片3枚，长约1.7厘米，浅肉红色，外面被疏短柔毛；唇辩矩卵形至矩状广卵形，浅肉红色，中部具紫红色条纹，长2～2.5厘米；侧生退化雄蕊锥状，雄蕊1，花丝粗壮，药隔膨大，先端阔，2裂呈叉形；子房下位，3室，花柱细长，基部下方具2个合生的圆柱形蜜腺，长约3毫米，柱头2唇状。蒴果不开裂，球形，直径约1.2厦米，被短毛，熟时橘红色。种子具假种皮，有钝棱角，棕色。花期4～10月。\", \"wei\": \"辛，温。\", \"liang\": \"内服：煎汤，0.5～1.5钱；或入丸、散。\", \"zhi\": \"温胃，祛风，散寒，行气，止痛。治脾胃中寒，脘腹冷痛，呕吐泄泻，噎脯反胃，食滞，瘴疟，冷癖。\" },\n  { \"name\": \"红豆蔻\", \"xing\": \"无\", \"wei\": \"辛，温。\", \"liang\": \"3～6g。\", \"zhi\": \"燥湿散寒、醒脾消食。用于脘腹冷痛，食积胀满，呕吐泄泻，饮酒过多。\" },\n  { \"name\": \"胡椒\", \"xing\": \"无\", \"wei\": \"辛，热。\", \"liang\": \"0.6～1.5g，研粉吞服；外用适量。\", \"zhi\": \"温中散寒，下气，消痰。用于胃寒呕吐，腹痛泄泻，食欲不振，癫痫痰多。\" },\n  { \"name\": \"花椒\", \"xing\": \"灌木或小乔木，高约3～6米。茎枝疏生略向上斜的皮刺，基部侧扁；嫩枝被短柔毛。叶互生；单数羽状复叶，长8～14厘米，叶轴具狭窄的翼，小叶通常5～9片，对生，几无柄，叶片卵形；椭圆形至广卵形，长2～5厘米，宽1.5～3厘米，先端急尖；通常微凹，基部为不等的楔形，边缘钝锯齿状，齿间具腺点，下面在中脉基部有丛生的长柔毛。伞房状圆锥花序，顶生或顶生于侧枝上：花单性，雌雄异株，花轴被短柔毛；花被片4～8，三角状披针形：雄花具雄蕊5～7，花药矩圆形，药隔近顶端具腺点，花丝线形，退化心皮2，先端2叉裂；雌花心皮通常3～4，子房背脊上部有凸出的腺点，花柱略外弯，柱头头状，子房无柄。成熟心皮通常2～3。果实红色至紫红色，密生疣状突起的腺点。种子1，黑色，有光泽。花期3～5月。果期7～10月。\", \"wei\": \"辛，温，有毒。<br>①《本经》：味辛，温。<br>②《别录》：生温，热寒，有毒。太热，有毒。<br>③《药性论》：味苦辛，有小毒。\", \"liang\": \"内服：煎汤，0.5～1.5钱；或入丸、散。外用：研末调敷或煎水浸洗。\", \"zhi\": \"温中散寒，除湿，止痛，杀虫，解鱼腥毒。治积食停饮，心腹冷痛，呕吐，噫呃，咳嗽气逆，风寒湿痹，泄泻，痢疾，疝痛，齿痛，蛔虫病，蛲虫病，阴痒，疮疥。<br>①《本经》：主风邪气，温中，除寒痹，坚齿发，明目。主邪气咳逆，温中，逐骨节皮肤死肌，寒湿痹痛，下气。<br>②《别录》：疗喉痹，吐逆，疝瘕，去老血，产后余疾腹痛，出汗，利五脏。除六腑寒冷，伤寒，温疟，大风汗不出，心腹留饮，宿食，肠游下痢，泄精，女子字乳余疾，散风邪瘕结，水肿，黄疸，杀虫鱼毒。开腠理，通血脉，坚齿发，调关节，耐寒暑，可作膏药。<br>③《药性论》：治恶风，遍身四肢顽痹，口齿浮肿摇动；主女人月闭不通，治产后恶血痢，多年痢，主生发，疗腹中冷痛。治头风下泪，腰脚不遂，虚损留结，破血，下诸石水，腹内冷而痛，除齿痛。<br>④《食疗本草》：灭瘢，下乳汁。<br>⑤《日华子本草》：破Y结，开胃，治天行时气温疾，产后宿血，治心腹气，壮阳，疗阴汗，暖腰膝，缩小便。<br>⑥《纲目》：散寒除湿，解郁结，消宿食，通三焦，温脾胃，补右肾命门，杀蛔虫，止泄泻。\" },\n  { \"name\": \"椒目\", \"xing\": \"无\", \"wei\": \"苦辛，寒，有毒。\", \"liang\": \"内服：煎汤，5～8分；或入丸、散。\", \"zhi\": \"用于平喘:将椒目研粉过筛，装胶囊或制成片剂内服，每日2～3次，每次量相当于生药1～1.5钱。观察108例气喘患者（绝大部分系慢性喘息性气管炎），以3天（38例）或10天（65例）为一疗程。结果平均有效率为94.2％，显效以上占40.8％。对咳、痰、喘的有效率分别为82.8％、72.3％、93.2％，以平喘疗效最高，平均显效以上达64.1％。10天一疗程者其疗效比3天一疗程明显增高。药效维持时间据21例观察，最短3小时，最长24小时。副作用：少数有头昏、恶心、痰血、热感，但不影响服药。\" },\n  { \"name\": \"荜茇\", \"xing\": \"荜茇 多年生草质藤本。根状茎直立，多分枝。茎下部匍匐，技横卧，质柔软，有纵校和沟槽，幼时被粉状短柔毛。叶在生；下部的叶卵圆形，具较长的柄，向上的叶渐成为卵状长圆形，柄较短，顶端叶无柄，基都抱茎，下面脉上被短柔毛；掌状腺7条，全部基出。花单性异株，无花被；穗状花序与叶对生；雄花序长4-5cm，直径约3mm；总花梗长2-3cm，被短柔毛；苞片近圆形，盾状；雄蕊2，花丝极短；雌花序长1.5-2.5cm，直径约4mm，于果期延长；苞片直径约lmm；子房卵形，柱头3。浆果下部与花序轴合生，先端有脐状凸起，直径约2mm。花期春季，果期7-10月。\", \"wei\": \"辛；热\", \"liang\": \"内服：煎汤，1-3g；或入丸、散。外用：适量，研末XIU鼻；或为丸纳龋齿孔中，或浸酒擦患处。\", \"zhi\": \"温中散寒；下气止痛。主脘腹冷痛；呕吐；泄泻；头痛；牙痛；鼻渊；冠心病心绞痛\" },\n  { \"name\": \"荜澄茄\", \"xing\": \"①荜澄茄\", \"wei\": \"辛，温。\", \"liang\": \"内服:煎汤，0.5～1钱；或入丸、散。外用:研末擦牙或搐鼻。\", \"zhi\": \"治疗阿米巴痢疾:将荜澄茄子连皮研细，装入胶囊中服。每次1克，隔2小时1次，每日4次，视病情轻重连服3～5日。如服后有胃肠道刺激反应者，可加入等量碳酸镁。治疗60例，其中42例治恬复查大便，结果38例未再发现阿米巴原虫，症状消失；4例无效。未复查大便的18例中，治后16例症状消失，2例无效。\" }] },\n\n{\n  \"name\": \"理气药\",\n  \"num\": 29,\n  \"content\": [\n  { \"name\": \"陈皮\", \"xing\": \"无\", \"wei\": \"苦、辛，温。\", \"liang\": \"3～9g。\", \"zhi\": \"理气健脾，燥湿化痰。用于胸脘胀满，食少吐泻，咳嗽痰多。\" },\n  { \"name\": \"橘红\", \"xing\": \"橘 常绿小乔木或灌木，高3-4m。枝细，多有刺。叶互生；叶柄长0.5-1.5cm，有窄翼，顶端有关节；叶片披针形或椭圆形，长4-llcm，宽1.5-4cm，先端渐尖微凹，基部楔形，全缘或为波状，具不明显的钝锯齿，有半透明油点。花单生或数朵丛生于枝端或叶腋；花萼杯状，5裂；花瓣5，白色或带淡红色，开时向上反卷；雄蕊15-30，长短不一，花丝常3-5个连合成组；雌蕊1，子房圆形，柱头头状。柑果近圆形或扁圆形，横径4-7cm，果皮薄而宽，容易剥离，囊瓣7-12，汁胞柔软多汁。种子卵圆形，白色，一端尖，数粒至数十粒或无。花期3-4月，果期10-12月。\", \"wei\": \"辛；苦；温\", \"liang\": \"内服：煎汤，3-9g；或入丸、散。\", \"zhi\": \"散寒燥湿；理气化痰；宽中健胃。主风寒咳嗽；痰多气逆；恶心呕吐；胸脘痞胀\" },\n  { \"name\": \"橘核\", \"xing\": \"无\", \"wei\": \"《纲目》：\\\"苦，平，无毒。\\\"\", \"liang\": \"内服：煎汤，1～3钱；或入丸、散。\", \"zhi\": \"治疗急性乳腺炎:将橘子仁碾成细末，以25％酒精或一般甜酒、白酒（适当稀释）调湿，均匀铺于纱布上，敷于炎症处。干燥后即须更换。严重病例可另用橘子仁1两，加白酒或甜酒1两，水200毫升，文火煎至100毫升，每天3次，每次口服20毫升。对已有明显脓肿形成的病例，除使用上述方法外必须切开引流。共治疗49例，均获满意疗效。在15例住院病人中，除5例已有脓肿形成外，其余10例早期患者用药后1～3天炎症即消失。\" },\n  { \"name\": \"橘络\", \"xing\": \"无\", \"wei\": \"甘苦，平，<br>①《本草撮要》：味淡微苦。<br>②《本草便读》：甘，寒。<br>③《四川中药志》：性平，味甘苦，无毒。\", \"liang\": \"内服：煎汤，0.8～1.5钱。\", \"zhi\": \"通络，理气，化痰，治经络气滞，久咳胸痛，痰中带血，伤酒口渴。<br>①《日华子本草》：治渴及吐酒，炒煎汤次甚验。<br>②《纲目拾遗》：通经络滞气、脉胀，驱皮里膜外积痰，活血。<br>③《本草求原》：通经络，舒气，化痰，燥胃去秽，和血脉。<br>④《四川中药志》：化痰通络，治肺劳咳痰、咳血及湿热客于经隧等症。\" },\n  { \"name\": \"橘叶\", \"xing\": \"无\", \"wei\": \"苦辛，平。\", \"liang\": \"内服：煎汤，2～5钱（鲜者2～4两）；或捣汁。\", \"zhi\": \"疏肝，行气，化痰，消肿毒。治胁痛，乳痈，肺痈，咳嗽，胸膈痞满，疝气。\" },\n  { \"name\": \"化橘红\", \"xing\": \"①化州柚，又名：化州仙橘（《岭南杂记》）。\", \"wei\": \"苦辛，温。\", \"liang\": \"内服：煎汤，1～2钱；或入丸、散。\", \"zhi\": \"化痰，理气，健胃，消食。治胸中痰滞，咳嗽气喘，呕吐呃逆，饮食积滞。\" },\n  { \"name\": \"青皮\", \"xing\": \"橘 常绿小乔木或灌木，高3-4m。枝细，多有刺。叶互生；叶柄长0.5-1.5cm，有窄翼，顶端有关节；叶片披针形或椭圆形，长4-llcm，宽1.5-4cm，先端渐尖微凹，基部楔形，全缘或为波状，具不明显的钝锯齿，有半透明油点。花单生或数朵丛生于枝端或叶腋；花萼杯状，5裂；花瓣5，白色或带淡红色，开时向上反卷；雄蕊15-30，长短不一，花丝常3-5个连合成组；雌蕊1，子房圆形，柱头头状。柑果近圆形或扁圆形，横径4-7cm，果皮薄而宽，容易剥离，囊瓣7-12，汁胞柔软多汁。种子卵圆形，白色，一端尖，数粒至数十粒或无。花期3-4月，果期10-12月。\", \"wei\": \"苦；辛；温\", \"liang\": \"内服：煎汤，3-10g；或入丸、散。\", \"zhi\": \"疏肝破气；消积化滞。主肝郁气滞之胁肋胀痛；乳房胀痛；乳核；乳痈；疝气疼痛；食积气滞之胃脘胀痛；以及气滞血瘀所至的症瘕积聚；久疟癖块\" },\n  { \"name\": \"枳实\", \"xing\": \"①枸橘，详\\\"枸橘\\\"条。\", \"wei\": \"苦，寒。\", \"liang\": \"内服:煎汤，1～2钱；或入丸、散。外用:研末调涂或炒热熨。\", \"zhi\": \"治疗胃下垂：将川枳实洗净，加2倍量的水，浸泡24小时，待发胀变软取出，剪为细块，再放原液中煮沸1.5小时，过滤，滤渣加水再煎，共煎3次，最后将滤渣挤压弃去；3次滤液，微火浓缩使成66％或132％浓度的煎剂。每日3次，每次10～20毫升，饭前半小时服。治疗21例，经服药15～45天，痊愈8例，X线钡餐检查胃下极位置较未服药前有显着升高，胃运动功能正常，临床自觉和他觉症状消失；好转6例，X线钡餐检查胃下极位置较未服药前有一定升高，胃运动机能有一定改善，临床自觉和他觉症状消失或减轻，或X线检查虽无明显进步，但临床症状消失:有效6例，X线钡餐检查无明显进步，临床自觉和他觉症状减轻；1例无效。又有用川枳实、蓖麻仁等量制成10％之溶液，行游子透入疗法，每日1次，每次10～20分钟，15天为一疗程。治疗18例，痊愈13例，显著好转2例，好转2例，无效1例。治后多数患者之腹胀、腹痛、便秘、胃纳不佳、失眠、头昏、乏力等症状消失；体重有不同程度的增加。\" },\n  { \"name\": \"枳壳\", \"xing\": \"1．酸橙 常绿小乔木。枝三棱形，有长刺。叶互生；叶柄有狭长形或狭长倒心形的叶翼，长8-15mm，宽3-6mm；叶片革质，倒卵状椭圆形或卵状长圆形，长3.5-10cm，宽1.5-5cm，先端短而钝，渐尖或微凹，基部楔形或圆形，全缘或微波状，具半透明油点。花单生或数朵簇生于叶腋及当年生枝条的顶端，白色，芳香；花萼杯状，5裂；花瓣5，长圆形；雄蕊20以上；子房上位，雌蕊短于雄蕊，柱头头状。柑果近球形，熟时橙黄色；味酸。花期4-5月，果期6-11月。<br>2.甜橙 常绿小乔木，高3-8m。树冠圆形，分枝多，无毛，有刺或无刺，幼枝有棱角。叶互生，单身复叶；叶柄长0.6-2cm，叶翼狭窄，宽2-3mm，顶端有关节；叶片质较厚，椭圆形或卵圆形，长6-12cm，宽2.3-5.5cm，先端短尖或渐尖，微凹，基部阔楔形或圆形，波状全缘，或有不明显的波状锯齿，有半透明油腺点。花1至数朵簇生叶液，白色，有柄；花萼3-5裂，裂片三角形；花瓣5，舌形，长约1.5cm，宽约7mm，向外反卷；雄蕊19-28，花丝下部连合成5-12束，雌蕊1，子房近球形，10-13室，柱头头状，花柱细，不脱落。柑果扁圆形或近球形，直径6-9cm，橙黄色或橙红色，果皮较厚，不易剥离，瓤囊8-13，果汁黄色，味甜。种子楔状卵形，表面平滑。花期4月，果熟期11-12月。\", \"wei\": \"苦；酸；性微寒\", \"liang\": \"内服：煎汤，3-9g；或入丸、散。外用：适量，煎水洗或炒热熨。\", \"zhi\": \"胸隔痞满；胁肋胀痛；食积不化；脘腹胀满；下痢后重；脱肛；子宫脱垂\" },\n  { \"name\": \"木香\", \"xing\": \"多年生草本，高1.5～2m，主根粗大。茎被稀疏短柔毛。茎生叶有长柄，叶片三角状卵形或长三角形，长30～100cm，宽15～30cm，基部心形，下延成不规贝勺分裂的翅状，边缘不规则倾波状或浅裂并具稀疏的刺，两面有短毛；茎生叶基部翼状抱茎。头状花序顶生和腋生，花序直径约3cm，常数个集生于花茎顶端，总苞片约10层；花冠暗紫色，5裂；雄蕊5，聚药；子房下位，花柱伸出花冠外。瘦果长锥形，上端有两层羽状冠毛。花期7～8月，果期8～10月。\", \"wei\": \"辛苦，温。\", \"liang\": \"内服：煎汤，0.5～1.5钱：磨汁或入丸，散。外用：研末调敷或密汁涂。\", \"zhi\": \"行气止痛，健脾消食。\" },\n  { \"name\": \"川木香\", \"xing\": \"1.川木香 多年生草本。主根圆柱形，直径1-2cm，外皮褐色，少有分枝。几无茎。叶基生，叶莲座状平铺地面；叶柄长8-20cm，被白色茸毛；叶片卵形、长圆状披针形或椭圆形，长12-30cm，宽8-20cm，羽状中裂或浅裂，少有不分裂，裂片5-7对，卵状披针形，边缘有锯齿，基部有小裂片，两面被糙估毛，下面疏生蛛丝毛和遥点。头状花序6-8密集；总苞宽钟形，直径6cm，总苞片6层，全部苞片质地坚硬，先端尾状渐尖成针刺状，边缘有稀疏的缘毛；花筒状，花冠紫色，长35-40mm，檐部长1cm，5裂，花冠裂片长6mm，细管部长3cm；雄蕊5，花药箭形，先端有长尾，子房下位。瘦果圆柱形，有宿厚冠毛；冠毛刚毛状，向上渐细，淡棕黄色，外层向下皱曲反折包围并紧贴瘦果，内层直立。花果期7-10月。\", \"wei\": \"味辛；苦；性温\", \"liang\": \"内服：煎汤，1.5-9g，宜后下；研末，0.5-0.9.\", \"zhi\": \"行气止痛；温中和胃。主脘腹胀痛；呕吐；肠鸣泄泻；里急后重，两胁不舒；肝胆疼痛\" },\n  { \"name\": \"土木香\", \"xing\": \"1、土木香（祁木香） 多年生草本，高达2米，全株密被短柔毛。根圆柱形至长圆锥形，表面深棕色，有纵皱纹及不明显的横生皮孔，侧根粗大。基生叶大，有长柄；叶片宽椭圆形，长25～50厘米，宽10～18厘米，先端锐尖，叶缘具不整齐锯齿，基部下延；茎生叶无柄，卵形或长椭圆形，长10～30厘米，宽5～14厘米，叶片基部有耳，半抱茎。夏季开花，头状花序大，直径4～8厘米，单生枝端，少数在茎顶排成伞房状，总包半球形，直径2.5～4厘米，总苞片5～6层，外层叶质，长1～1.5厘米，被茸毛，内层干膜质，较外层长。花黄色，边缘花雌性，舌状，宽条形，长2～3厘米，先端3齿裂，中央管状花两性，长约9毫米，花药基部有长尾。瘦果具4～5棱，长4～5毫米，上端截形，无毛；冠毛多，污白色，长约1厘米。\", \"wei\": \"辛，苦，平。\", \"liang\": \"1～3钱。\", \"zhi\": \"理气止痛，开胃驱虫。主治：慢性胃炎，胃肠功能紊乱，慢性肝炎，肋间神经痛，胸壁挫伤，蛔虫病。\" },\n  { \"name\": \"沉香\", \"xing\": \"1.沉香 常绿乔木，高达30m。幼枝被绢状毛。叶互生，稍带革质；具短柄，长约3mm；叶片椭圆状披针形、披针形或倒披针形，长5.5-9cm，先端渐尖，全缘，下面叶脉有时被绢状毛。伞形花序，无梗，或有短的总花梗，被绢状毛；花白色，与小花便等长或较短；花被钟形，5裂，裂片卵形，长0.7-1cm，喉部密被白色绒毛的鳞片10枚，外被绢状毛，内密被长柔毛，花冠管与花被裂片略等长；雄蕊10，着生于花被管上，其中有5枚较长；子房上位，长卵形，密被柔毛，2室，花柱极短，柱头扁球形。蒴果倒卵形，木质，扁压状，长4.6-5.2cm，密被灰白色绒毛，基部有略为木质的宿存花被。种子通常1颗，卵圆形，基部具有角状附属物，长约为种子的2倍。花期3-4月，果期5-6月。\", \"wei\": \"辛；苦；温\", \"liang\": \"内服：煎汤，2-5g，后下；研末，0.5-1g；或磨汁服。\", \"zhi\": \"行气止痛；温中降逆；纳气平喘。主脘腹冷痛；气逆员息；胃寒呕吐呃逆；腰膝虚冷；大肠虚秘；小便气淋\" },\n  { \"name\": \"檀香\", \"xing\": \"无\", \"wei\": \"辛，温。\", \"liang\": \"2～5g。\", \"zhi\": \"行气温中，开胃止痛。用于寒凝气滞，胸痛，腹痛，胃痛食少；冠心病，心绞痛。\" },\n  { \"name\": \"川楝子\", \"xing\": \"川楝 乔木，高达10m。树皮灰褐色；幼嫩部分密被星状鳞片。二至三回奇数羽状复叶，长约35cm；羽片4-5对；小叶卵形或窄卵形，长4-10cm，宽2-4cm，全缘或少有疏锯齿。圆锥花序腋生；花萼灰绿色，萼片5-6；花瓣5-6，淡紫色；雄蕊10或12，花丝合生成筒。核果大，椭圆形或近球形，长约3cm，黄色或粟棕色，果皮为坚硬木质，有棱，6-8室，种子长椭圆形，扁平。花期3-4月，果期9-11月。\", \"wei\": \"苦、寒；有小毒\", \"liang\": \"内服：煎汤，3-10g；或入丸、散。外用：适量，研末调涂。行气止痛炒用，杀虫生用。\", \"zhi\": \"疏肝泄热；行气止痛；杀虫。主脘腹胁肋疼痛；疝气疼痛；虫积腹痛；头癣\" },\n  { \"name\": \"乌药\", \"xing\": \"无\", \"wei\": \"辛，温。\", \"liang\": \"3～9g。\", \"zhi\": \"顺气止痛，温肾散寒。用于胸腹胀痛，气逆喘急，膀胱虚冷，遗尿尿频，疝气，痛经。\" },\n  { \"name\": \"荔枝核\", \"xing\": \"无\", \"wei\": \"甘涩，温。<br>①《纲目》:甘，温，涩，无毒。<br>②《医林纂要》:甘涩，温，微咸。<br>③《广西中药志》:味甘微苦涩，性平，无毒。\", \"liang\": \"内服:煎汤，1.5～3钱；或入丸、散。\", \"zhi\": \"温中，理气，止痛。治胃脘痛，疝气痛，妇女血气刺痛。<br>①《纲目》:行散滞气。治颓疝气痛，妇人血气刺痛。<br>②《本草备要》:辟寒邪，治胃脘痛。\" },\n  { \"name\": \"香附\", \"xing\": \"植物形态详\\\"莎草\\\"条。\", \"wei\": \"辛微苦甘，平。\", \"liang\": \"内服：煎汤，1.5～3钱；或入丸，散。外用：研末撒、调敷或作饼热熨。\", \"zhi\": \"理气解郁，止痛调经。治肝胃不和，气郁不舒，胸腹胁肋胀痛，痰饮痞满，月经不调，崩漏带下。\" },\n  { \"name\": \"佛手\", \"xing\": \"无\", \"wei\": \"辛、苦、酸，温。\", \"liang\": \"3～9g。\", \"zhi\": \"舒肝理气，和胃止痛。用于肝胃气滞，胸胁胀痛，胃脘痞满，食少呕吐。\" },\n  { \"name\": \"香橼\", \"xing\": \"1.枸橼 常绿小乔木或灌木。枝有短硬棘刺，嫩枝光滑，带紫红色。叶互生；具短柄，无叶翼或略有痕迹，与叶片间无明显关节；叶片长圆形或倒卵状长圆形，长8-15cm，宽3.5-6.5cm，先端钝或短锐尖，基部宽楔形，边缘有锯齿，具半透明的油腺点。总状花序，3-10朵花生于叶腋；两性花或因雌蕊退化成雄花，具短柄；花萼浅杯状，上端5浅裂；花瓣5，内面白色，外面淡紫色；雄蕊30-60；雌蕊1，子房10-13室，每室有胚珠多数，花柱肥大，宿存，柱头头状。柑果长圆形、卵形或近球形，长10-25cm，先端有乳头状突起，果皮粗糙或平滑，熟时柠檬黄色，芳香、瓤囊小；种子卵圆形，表面平滑。花期4月，果熟期10-11月。<br>2．香圆 常绿乔木，高9-11m。全株无毛，有短刺。叶互生；叶柄有倒心形宽翅，长约为叶片的1/3-l/4；叶片革质，椭圆形或长圆形，长5-12cm，宽2-5cm，先端短而钝或渐尖，微凹头，基部钝圆，全缘或有波状锯齿，两面无毛，有半透明油腺点。花单生或簇生，也有成总状花序，花白花；雄蕊25-36；子房10-11室。柑果长圆形、圆形或扁圆形，横径5-9cm，先端有乳头状突起，果皮通常粗糙而有皱纹或平滑，成熟时橙黄色，有香气；种子多数。花期4-5月，果熟期10-11月。\", \"wei\": \"辛；苦；酸；温\", \"liang\": \"内服：煎汤，3-6g；或入丸、散。\", \"zhi\": \"理气降逆；宽胸化痰。主胸腹满闷；胁肋胀痛；咳嗽痰多\" },\n  { \"name\": \"玫瑰花\", \"xing\": \"无\", \"wei\": \"甘、微苦，温。\", \"liang\": \"1.5～6g。\", \"zhi\": \"行气解郁，和血，止痛。用于肝胃气痛，食少呕恶，月经不调，跌扑伤痛。\" },\n  { \"name\": \"梅花\", \"xing\": \"落叶乔木，小枝多绿色，枝端尖刺状，无毛，叶互生，宽卵形至卵形，长4～10cm，宽3～5.5cm，先端长渐尖，基部宽楔形或近圆形，边缘有细锯齿，下面色较浅，嫩时两面有毛，老时仅下面脉上有柔毛；叶柄有毛，托叶早落。花1～2朵簇生，先叶开放，有香气，萼片5，常带紫红色，花后常不反折；花瓣5，白色、红色或淡红色，有的重瓣；雄蕊多数，心皮1，密被短柔毛。核果近球形，两边扁，有纵沟，直径2～3cm，熟时黄色，有短柔毛。花期3月，果期5～6月。\", \"wei\": \"性平，味微酸、涩。\", \"liang\": \"无\", \"zhi\": \"开郁和中，化痰，解毒。用于郁闷心烦、肝胃气痛、梅核气、瘰疬疮毒。\" },\n  { \"name\": \"娑罗子\", \"xing\": \"①七叶树（《留青日札》），又名：娑罗树（《留青日札》）。<br>落叶乔木，高达20米，树冠宽广。掌状复叶对生；叶柄长5～16厘米；小叶片5～7枚，长椭圆形或卵状披针形，长8～18厘米，宽2～6.5厘米，先端窄尖，基部楔形，边缘有细锯齿，上面无毛，下面疏生细柔毛或无毛，小叶柄疏生细柔毛。圆锥花序顶生，尖塔形，长18～28厘米；总花梗长6～10厘米，花梗疏生细柔毛；雄花和两性花同株而密生：花小，白色，长1.2厘米；花萼筒形，不整齐的5浅裂，外被短柔毛；花瓣4，椭圆形，上2瓣较下2瓣窄长；雄蕊6～8；两性花的子房上位，有细柔毛，蒴果近于圆球形，顶端扁平或微尖突，密生黄褐色的斑点，3瓣裂，种子1枚，圆球形，直径2.5～4厘米，种脐阔大，占底部的1/2左右，花期5～7月。果期8～9月。<br>野生或栽培，分布甘肃、河北、河南、山西、江苏、浙江等地。<br>②天师栗（《益部方物略记》），又名：猴板栗、刺五加。<br>落叶乔木，高达25米。掌状复叶对生；叶柄长6～15厘米，被短柔毛；小叶片5～7，倒卵状长椭圆形或卵状披针形，长10～20厘米，宽3～8.5厘米，先端窄尖，基部宽楔形或近圆形，边缘有细锯齿，上面主脉上疏生细柔毛，下面密生细柔毛，小叶柄有短柔毛。圆锥花序顶生，长达35厘米；总花梗长达10厘米，花梗被有细柔毛；雄花和两性花同株而疏生；花白色，长1～1.5厘米；花萼筒形，不整齐的5浅裂，裂片近圆形，外面密生细柔毛；花瓣4，椭圆形，上2瓣较窄长，外面和边缘密生细柔毛；雄蕊6～8；两性花的子房上位，卵形。蒴果卵形或倒卵形，顶端突起而尖，外表密生黄褐色斑点。种子1～2枚，圆球状，种脐约为底部的1/3。花期5～7月。果期7～9月。<br>野生或栽培。分布湖北、湖南、四川、贵州、陕西等地。\", \"wei\": \"《纲目》：甘，温，无毒。\", \"liang\": \"内服：煎汤，1～3钱；或烧存性研末。\", \"zhi\": \"宽中，理气，杀虫。治胃寒作痛，脘腹胀满，疳积虫痛，疟疾，痢疾。<br>①《益部方物略记》：久食已风挛。<br>②《通雅》：能下气。<br>③《纲目拾遗》：葛祖遗方，治心胃寒痛，虫痛。宽中下气，治胃脘肝膈膨胀，疳积疟痢，吐血劳伤，平胃通络。\" },\n  { \"name\": \"薤白\", \"xing\": \"1.小根蒜，多年生草本，高30-60cm。鳞茎近球形，直径0.7-1.5cm，旁侧常有1-3个小鳞茎附着，外有白色膜质鳞被，后变黑色。叶互生；叶苍绿色，半圆柱状狭线形，中空，长20-40cm，宽2-4mm，先端渐尖，基部鞘状抱茎。花茎单一，直立，高30-70cm，伞形花序顶生，球状，下有膜质苞片，卵形，先端长尖；花梗长1-2cm，有的花序只有很少的小花，而间以许多的肉质小珠芽，甚而全变不小株芽；花被片6，粉红色或玫瑰色；雄蕊6，比药被长，花丝细长，下部略扩大；子房上位，球形。蒴果倒卵形，先端凹入。花期5-6月，果期8-9月。<br>2.头，与上种相似。主要区别为：鳞茎数枚聚生，狭卵状，直径1-1.5cm；鳞茎外皮白色或带红色，膜质，不破裂。叶基生，2-5枚；具3-5棱的圆柱状，中空，近与花葶长。花葶侧年，圆柱状，高20-40cm，总苞膜质，2裂宿存，伞形花序半球形，松散，花梗为花被的2-4倍长，具苞片；花淡紫色至蓝紫色，花被片6，长4-6mm，宽椭圆形至近圆形，钝头；花丝为花被片的2倍长，仅基生部合生并与花被贴生，内轮的基部扩大，两侧各具1齿，外轮的无齿；子房宽倒卵形，基部具3个有盖的凹穴；花柱伸出花被。花、果期10-11月。<br>3.长梗薤白，植株无葱蒜味。鳞茎单生，卵球状或近球状，直径1-2cm；鳞茎外皮灰黑色，膜质，不破裂，内皮白色。叶圆柱状或近半圆状，中空，具纵棱，沿纵棱具细糙齿，等长于或长于花葶，宽1-3mm。伞形花序疏散；小花梗不等长，长7-11cm，基部具小苞片；花红色至紫红色；花被片基部彼此靠合成管状，花被片长7-10mm，子房每室具6胚珠。花果期7-9月。<br>4.天蓝小根蒜，鳞茎近球形，直径1-2cm，基部常具外皮暗紫色的小鳞茎。鳞茎外皮暗灰色，纸质，不破裂，内皮白色，膜质。叶3-5枚，条形，背面具1条纵棱，有时为三棱状条形，干时常扭卷，比花葶短，宽2-5mm，到花期逐渐枯死；叶片和叶鞘光滑或沿纵脉具细糙齿。花葶高25-85cm；伞形花序球状或半球状，具多而密集的花，有时具珠芽；小花梗近等长，比花被片长2-6倍；花天蓝色，干后常变蓝紫色。花、果期6-8月。\", \"wei\": \"味辛；苦；性温\", \"liang\": \"内服：煎汤，5-10g，鲜品30-60g；或入丸、散，亦可煮粥食。外用：适量，捣敷；或捣汁涂。\", \"zhi\": \"理气宽胸；通阳散结。主胸痹心痛彻背；胸脘痞闷；咳喘痰多；脘腹疼痛；泄痢后重；白带；疮疖痈肿\" },\n  { \"name\": \"大腹皮\", \"xing\": \"槟榔，乔木，高10-18m；不分枝，叶脱落后形成明显的环纹。羽状复叶，丛生于茎顶端，长1.3-2m，光滑，叶轴三棱形；小叶片披针状线或线形，长30-70cm，宽2.5-6cm ，基部较狭，顶端小叶愈合，有不规则分裂。花序着生于最下一叶的基部，有佛焰苞状大苞片，长倒卵形，长达40cm，光滑，花序多分枝；花单性同株；雄花小，多数，无柄，紧贴分枝上部，通常单生，很少对生，萼片3，厚而细小，花瓣3，卵状长圆形，长5-6mm，雄蕊6，花丝短小，退化雌蕊3，丝状；雌花较大而少，无梗，着生于花序轴或分枝基部，萼片3，长圆状卵形，长12-15mm。坚果卵圆形或长圆形，长5-6cm，花萼和花瓣宿存，熟时红色。每年开花2次，花期3-8月，冬花不结果；果期12月至翌年6月。\", \"wei\": \"味辛；性微温\", \"liang\": \"内服：煎汤，5-10g；或入丸、散。外用：适量，煎水洗；或研末调敷。\", \"zhi\": \"下气宽中；行水消肿。主胸腹胀闷；水肿；脚气；小便不利\" },\n  { \"name\": \"甘松\", \"xing\": \"1.甘松 多年生草本，高20-35cm。全株有强烈松脂样香气。基生叶较少而疏生，通常每丛6-9片，叶片窄线状倒披针形或倒长披针形，长6-20cm，宽4-10mm，先端钝圆，中以下渐窄略成叶柄状，基部稍扩展成鞘，全缘，上面绿色，下面淡绿色；主脉三出。聚伞花序呈紧密圆头状；总苞2片，长卵形；小苞片2，甚小；花萼5裂，齿极小；花粉红色；花冠筒状，先端5裂，基部偏突；雄蕊4，伸出花冠；子房下位，花柱细长，伸出花冠外，柱头漏斗状。瘦果倒卵形，长约3mm，萼突破存。花期8月。\", \"wei\": \"味辛；甘；性温\", \"liang\": \"内服：煎汤，3-6g；或入丸、散。外用：适量，感想末敷；或泡水含漱；或煎汤外洗。\", \"zhi\": \"理气止痛；醒脾健胃。主脘腹胀痛；不国民饮食；牙痛；脚气\" },\n  { \"name\": \"九香虫\", \"xing\": \"九香虫，全体椭圆形，一般紫黑色，带铜色光泽。头部狭尖，略呈三角形，复眼突出，卵圆形；单眼1对。喙较短，触角5节。前胸背板及小盾片均具不规则横皱纹。翅2对，前翅为半鞘翅，棕红色，翅末1/3为膜质。足3对，后足最长。腹面密布细刻及皱纹，后胸腹板近前缘区有2个臭孔，能由此放出臭气。\", \"wei\": \"味咸；性温\", \"liang\": \"内服：煎汤，3-9g；或入丸、散，0.6-1.2g。\", \"zhi\": \"行气止痛；温肾壮阳。主肝胃不和或寒郁中焦所致的胸历胁胃脘胀痛以及坚阳不足之腰痛；阳痿\" },\n  { \"name\": \"刀豆\", \"xing\": \"1.刀豆 一年生缠绕草质藤本，长达3m。茎无毛。三出复叶；叶柄长7-15cm；顶生小叶宽卵形，长8-20cm，宽5-16cm，先端渐尖或急尖，基部阔楔形，侧生小叶偏斜，基部圆形；具短柄；托叶细小。总状花序腋生，花疏，有短梗；苞片卵形，早落；花萼钟状，萼管长约1.5cm，二唇形，上萼2裂片大而长，下唇3裂片小而不明显；花冠蝶形，淡红色或淡紫色，长3-4cm，旗瓣圆形，翼瓣较短，约与龙骨瓣等长，龙骨瓣弯曲；雄蕊10，连合为单体，对着旗瓣的1枚基部稍离生，花药同型；子房具短柄，被毛。荚果大而扁，长10-30cm，直径3-5cm，被伏生短细毛，边缘有隆脊，先端弯曲成钩状；种子10-14颗，长约3.5cm，宽约2cm，厚达1.5cm，种皮粉红色或红色，种脐约占种子全长的3/4，扁平而光滑，花期6-7月。果期8-10月。\", \"wei\": \"甘；温；无毒\", \"liang\": \"内服：煎汤，9-15g；或烧存性研未。\", \"zhi\": \"温中下气，益肾补元。主虚寒呃逆，肾虚腰痛\" },\n  { \"name\": \"柿蒂\", \"xing\": \"柿（《礼记》），又名:镇头迦（《纲目》）。\", \"wei\": \"苦涩，平。\", \"liang\": \"内服:煎汤，2～4钱；或入散剂。\", \"zhi\": \"降逆气。止呃忒、呕哕。\" }] },\n\n{\n  \"name\": \"消食药\",\n  \"num\": 8,\n  \"content\": [\n  { \"name\": \"山楂\", \"xing\": \"1.山里红（大山楂、北山楂、山果子）落叶小乔木，高约6米，分枝多，无刺或有少数短刺，无毛。单叶互生，有长柄，长2~6厘米；托叶镰形，较大，边缘有齿；叶片广卵形或棱状卵形，长6~12厘米，宽5~8厘米，有5~9羽裂，仅下面1对裂片较深，先端短渐尖，基部宽楔形，常稍偏斜，边缘有不规则重锯齿，上面有光泽，下面脉上有短柔毛。初夏枝端或上部叶液抽出伞房花序，有花10~12朵；花梗被短柔毛；花萼5齿裂；花冠白色或稍带红晕，花瓣5，宽倒卵形；雄蕊20个，梨果球形，直径可达2.5厘米，深亮红色，有黄白色小斑色，萼片脱落很迟，先端留一深洼，小核3~5。\", \"wei\": \"甘、酸，温。\", \"liang\": \"果3~5钱，根1~2两。叶适量。\", \"zhi\": \"消食华滞，散瘀止痛。果 肉食积滞，消化不良，小儿疳积，细菌性痢疾，肠炎，产后腹痛，高血压病，绦虫病，冻疮。叶煎水当茶饮，可降血压。根治风湿关节痛，痢疾，水肿。\" },\n  { \"name\": \"神曲\", \"xing\": \"无\", \"wei\": \"甘；辛；温；无毒\", \"liang\": \"内服:煎汤，10-15g；或入丸、散。\", \"zhi\": \"健脾和胃；消食化积。主饮食停滞；消化不良；脘腹胀满；食欲不振；呕吐泻痢\" },\n  { \"name\": \"建神曲\", \"xing\": \"无\", \"wei\": \"苦，温。<br>①《药性考》:微苦香甘。<br>②《纲目拾遗》:甘淡，清香。\", \"liang\": \"内服:煎汤，2～3钱；或研末入丸、散。\", \"zhi\": \"健脾消食，理气化湿，解表。治伤食胸痞，腹煮吐泻，痢疾，感冒头痛，小儿伤饥失饱。<br>①《药性考》:搜风解表，调胃行痰，止嗽、疟、痢、吐泻；能安温疫岚瘴，散疹消斑。感冒头痛，食滞心烦，姜煎温服，或二、三钱。<br>②《蔡氏药帖》:治风寒暑湿，头眩发热，表汗；能消积开胸，理膈调胃健牌及四时未定之气；兼能止泻消肿及饮食不进等症。又能止霍乱吐泻，咳嗽，赤白痢疾，小儿伤饥失饱一切症。不服水土，瘴气肚痛皆效。<br>③《饮片新参》:消食滞，止泻，健脾胃。\" },\n  { \"name\": \"麦芽\", \"xing\": \"无\", \"wei\": \"甘，微温。\", \"liang\": \"内服：煎汤，3～5钱；或入丸、散。\", \"zhi\": \"治疗急慢性肝炎:取大麦低温发芽的幼根（长约0.5厘米左右），干燥后磨粉制成糖浆内服，每次10毫升（内含麦芽粉15克），每日3次，饭后服。另适当加用酵母或复合维生素B片。一般以30天为一疗程，连服至治愈后再服一个疗程。治疗161例，有效108例，无效53例，有效率为67.1％。其中急性肝炎56例，有效48例；慢性肝炎105例，有效60例。服药后肝痛、厌食、疲倦、低温等症都有不同程度的改善，尤其对消除厌食更显着。有效病例的肝脏肿大大多有不同程度的缩小，转氨酶亦有不同程度的下降。服药后少数病人有口干、口苦、烦躁、腹泻等副作用。远期疗效有待继续观察。\" },\n  { \"name\": \"稻芽\", \"xing\": \"无\", \"wei\": \"甘，温。\", \"liang\": \"9～15g。\", \"zhi\": \"和中消食，健脾开胃。用于食积不消，腹胀口臭，脾胃虚弱，不饥食少。炒稻芽偏于消食。用于不饥食少。焦稻芽善化积滞。用于积滞不消。\" },\n  { \"name\": \"谷芽\", \"xing\": \"无\", \"wei\": \"甘，温。<br>①《纲目》：甘，温，无毒。<br>②《本草经疏》：味苦，无毒。\", \"liang\": \"内服：煎汤，3～5钱。\", \"zhi\": \"健脾开胃，和中消食。治宿食不化，胀满，泄泻，不思饮食。<br>①《纲目》：快脾开胃，下气和中，消食化积。<br>②《食物本草会纂》：除烦消食。<br>③《中药材手册》：治脾虚，心胃痛，胀满，热毒下痢，烦渴，消瘦。\" },\n  { \"name\": \"莱菔子\", \"xing\": \"无\", \"wei\": \"辛、甘，平。\", \"liang\": \"4.5～9g。\", \"zhi\": \"消食除胀，降气化痰。用于饮食停滞，脘腹胀痛，大便秘结，积滞泻痢，痰壅喘咳。\" },\n  { \"name\": \"鸡内金\", \"xing\": \"家鸡，家禽。嘴短而坚，略呈圆锥状，上嘴稍弯曲。鼻孔裂状，被有鳞状瓣。眼有瞬膜。头上有肉冠，喉部两侧有肉垂，通常呈褐红色；肉冠以雄者为高大，雌者低小；肉垂亦以雄者为大。翼短；羽色雌、雄不同，雄者羽色较美，有长而鲜丽的尾羽；雌者尾羽甚短。足健壮，跗、跖及趾均被有鳞板；趾4，前3趾，后1趾，后趾短小，位略高，雄者跗跖部后方有距。\", \"wei\": \"味甘；性平\", \"liang\": \"内服：煎汤，3-10g；研末，每次1.5-3g；或入丸、散。外用：适量，研末调敷或生贴。\", \"zhi\": \"健脾消食；涩精止遗；消症化石。主消化不良；饮食积滞；呕吐反胃；泄泻下痢；小儿疳积；遗精；遗尿；小便频数；泌尿系结石及胆结石；症瘕经闭；喉痹乳蛾；牙疳口疮\" }] },\n\n{\n  \"name\": \"驱虫药\",\n  \"num\": 9,\n  \"content\": [\n  { \"name\": \"使君子\", \"xing\": \"落叶攀援状灌木，高2-8m。幼枝被棕黄色短柔毛。叶对生或的对生；吉柄无关节，在落叶后宿存；叶片膜质，卵形或椭圆形，长5-11cm，宽2.5-5.5cm，先端短渐尖，基部钝圆，表面无毛，背面有时疏被棕色柔毛，顶生穗状花序组成伞房状序；花两性；苞片卵形至线状披针形，被毛；萼管长5-9cm，被共同色柔毛，先端具广展、外弯、小形的萼齿5枚；花瓣5，长1.8-2.4cm，宽4-10mm，先端钝圆，初为白色，后转淡红色；雄蕊10.2轮，不突出冠外，花药长约1.5 mm；子房下位。果卵形，短尖，长2.7-4cm，径1.2-2.3cm，无毛，具明显的锐棱角5条，成熟时外果皮脆薄，呈青黑色或栗色。种子1颗，折色，圆柱状纺锤形，长2.5cm，径约1cm。花期5-9月，果期秋末。\", \"wei\": \"味甘；性温；小毒\", \"liang\": \"内服：煎汤，6-15g，捣碎入煎；或入丸、散；去壳炒香嚼服，小儿每岁每日1粒-1粒半，总量不起过20粒。\", \"zhi\": \"杀虫；消积；健脾。主蛔虫腹痛；小儿疳积；乳食停滞；腹胀；泻痢\" },\n  { \"name\": \"苦楝皮\", \"xing\": \"①苦楝（《证类本草》），义名：翠树、紫花树、森树、楝枣树、火棯树、花心树、苦辣树、洋花森。\", \"wei\": \"苦，寒，有毒。\", \"liang\": \"内服：煎汤，2～3钱（鲜者1～2两）：或入丸、散。外用：煎水洗或研末调敷。\", \"zhi\": \"苦楝皮驱蛔虫，民间使用已久，疗效确实。解放后，各地临床报道，病例数以万计。但在实践过程中，对药用部分的选择、制备、剂量、服法等均不一致，其驱虫效果及毒性反应差距也很大。现根据部分临床报道，综述于下：\" },\n  { \"name\": \"槟榔\", \"xing\": \"槟榔，乔木，高10-18m；不分枝，叶脱落后形成明显的环纹。羽状复叶，丛生于茎顶端，长1.3-2m，光滑，叶轴三棱形；小叶片披针状线或线形，长30-70cm，宽2.5-6cm ，基部较狭，顶端小叶愈合，有不规则分裂。花序着生于最下一叶的基部，有佛焰苞状大苞片，长倒卵形，长达40cm，光滑，花序多分枝；花单性同株；雄花小，多数，无柄，紧贴分枝上部，通常单生，很少对生，萼片3，厚而细小，花瓣3，卵状长圆形，长5-6mm，雄蕊6，花丝短小，退化雌蕊3，丝状；雌花较大而少，无梗，着生于花序轴或分枝基部，萼片3，长圆状卵形，长12-15mm。坚果卵圆形或长圆形，长5-6cm，花萼和花瓣宿存，熟时红色。每年开花2次，花期3-8月，冬花不结果；果期12月至翌年6月。\", \"wei\": \"味苦；辛；性温\", \"liang\": \"内服：煎汤，6-15g，单用杀虫，可用60-120g；或入丸、散。\", \"zhi\": \"1.治疗绦虫病 ：槟榔对猪肉绦虫，治愈率多在90%以上。但也有报告8例仅治愈4例(50%)，认为与药质不良，制法不当有关。对短小绦虫的疗效，文献报告不一：报告的少数病例(1-6例)都获治愈；8例治愈6例(75%)；32例的排虫率为37.5%，而大便虫卵的阴转率为82.8%。但亦有报告 14例仅治愈3例；治疗儿童8例次均属无效。对阔节裂头绦虫，报告虽均为个别病例，但均获治愈。对牛肉绦虫，疗效较差，治愈率一般在30-50%之间，如与南瓜子合并应用，则疗效可大大提高，治愈率达90-95%成以上；然亦有报告治疗23例，结果见虫头驱出者5例，驱出大部虫体(未见虫头驱出)者 14例，无效4例。实践证明：槟榔与南瓜子对绦虫均有使之瘫痪的作用，但槟榔主要作用于绦虫的头节和未成熟节片(即前段)，南瓜子主要作用于中段与后段的孕卵节片，两者合用，可以提高治疗效果。用法：一般采用煎剂口服。常用量为60-100g，但也有用至120g或更多的。有人认为：超出有效剂量范围之外的增加剂量，并不能提高疗效。煎剂的制备，一般是将槟榔切碎，先用热水300-500ml浸泡数小时，而后用温火煎成200ml左右，于清晨空腹时1次服下。服药前1日晚禁食或进少量流质饮食。服药后可视具体情况在半至2小时左右服硫酸镁20-30g。合并应用南瓜子的，则先服南瓜子粉80-125g，待半至2小时左右再服槟榔煎剂，而后再服硫酸镁。服药完毕至排虫时间由半小时至数小时不等。治愈病例大多只服药1次，但亦有少数需服药2次或2次以上的。根据临床观察，新鲜槟榔较放置已久的效力大；槟榔煎煮前用水浸泡数小时，较即时煎者疗效高；服用泻剂较不服泻剂的效果佳；槟榔煎剂采用十二指肠管注人法较口服法效果好而副作用少。槟榔与南瓜子合并应用，不但对牛肉绦虫效果显着，而且对短小绦虫亦可提高疗效。副作用有恶心、呕吐、腹痛及头昏、心慌，亦有引起呕血或肠阻塞者。经验认为，服药后保持安静，或煎剂冷服，或用2.5%明胶液滴定去除槟榔煎剂中的鞣酸，可以减少恶心、呕吐等副作用。此外，槟榔与阿的平联合治疗牛肉绦虫可提高疗效；槟榔与南瓜子、石榴皮联合治疗猪肉绦虫、短小绦虫亦有较好效果。\" },\n  { \"name\": \"南瓜子\", \"xing\": \"无\", \"wei\": \"《陆川本草》:甘，平。\", \"liang\": \"内服:煎汤，1～2两；研末或制成乳剂。外用:煎水熏洗。\", \"zhi\": \"治绦虫，蛔虫，产后手足浮肿，百日咳，痔疮。<br>①《现代实用中药》:驱除绦虫。<br>②《安徽药材》:能杀蛔虫。<br>③《中国药植图鉴》:炒后煎服，治产后手足浮肿，糖屎病。\" },\n  { \"name\": \"鹤草芽\", \"xing\": \"无\", \"wei\": \"苦、涩、平。\", \"liang\": \"0.3～1两。\", \"zhi\": \"驱虫。用药绦虫病。\" },\n  { \"name\": \"雷丸\", \"xing\": \"菌核体通常为不规则的坚硬块状，歪球形或歪卵形，直径0.8～2.5厘米，罕达4厘米，表面黑棕色，具细密的纵纹；内面为紧密交织的菌丝体，蜡白色，半透明而略带粘性，具同色的纹理。越冬后由菌核体发出新的子实体，一般不易见到。\", \"wei\": \"苦，寒，有小毒。\", \"liang\": \"内服：煎汤，2～3钱；或入丸、散。外用：研粉扑或煎水洗。\", \"zhi\": \"①治疗绦虫病\" },\n  { \"name\": \"鹤虱\", \"xing\": \"无\", \"wei\": \"苦辛，平，有毒。\", \"liang\": \"内服：煎汤，3～5钱；或入丸、散。\", \"zhi\": \"治疗钩虫病:取鹤虱3两，洗净后水煎两次，药液混合浓缩至6O毫升（每10毫升相当原生药5钱），过滤，加少量白糖调味，成人每晚睡前服30毫升，连服两晚。小儿及年老体弱者酌减，观察57例，治疗后15天复查大便，钩虫卵阴性者45例，阳性者12例，阴转率79％。治疗前合并蛔虫感染31例，治疗后复查大便，结果有19例蛔虫卵阴转。说明鹤虱亦有驱蛔作用。少数病例服药后数小时或第二天有轻微头晕、恶心、耳鸣、腹痛等反应，可自行消失。\" },\n  { \"name\": \"榧子\", \"xing\": \"榧（《别录》），又名：野杉（《纲目》），香榧、木榧。<br>常绿乔木，高达25米。树皮灰褐色，枝开张，小枝无毛。叶呈假二列状排列，线状披针形，长1.2～2.5厘米，宽2～3毫米，愈向上部愈狭，先端突刺尖，基部几成圆形，全缘，质坚硬，上面暗黄绿色，有光泽，下面淡绿色，中肋显明，在其两侧各有一条凹下黄白色的气孔带。花单性，通常雌雄异株；雄花序椭圆形至矩圆形，具总花梗，雄蕊排成4～8轮，花药4室；雌花无梗，成对生，只1花发育，基部具数对交互对生的苞片，胚珠1，直生。种子核果状、矩状椭圆形或倒卵状长圆形，长2～3厘米，先端有小短尖，红褐色，有不规则的纵沟；胚乳内缩或微内缩。花期4月。种子成熟期为次年10月。\", \"wei\": \"甘，平。<br>①《本经》：味甘，温。<br>②《别录》：有毒。<br>③《千金・食治》：味甘平涩，无毒。\", \"liang\": \"内服：煎汤，1.5～3钱；或入丸、散。\", \"zhi\": \"杀虫，消积，润燥。治虫积腹痛，小儿疳积，燥咳，便秘，痔疮。<br>①《本经》：主腹中邪气，去三虫，蛇螫。<br>②《别录》：主五痔。<br>③陶弘景：疗寸白。<br>④孟诜：令人能食，消谷，助筋骨，行营卫，明目。<br>⑤《日用本草》：杀腹间大小虫，小儿黄瘦，腹中有虫积者食之即愈。又带壳细嚼食下，消痰。<br>⑥《生主编》：治咳嗽，白浊，助阳道。<br>⑦《本草备要》：润肺，杀虫。<br>⑧《本经逢原》：与使君子同功。<br>⑨《本草再新》：治肺火，健脾土，补气化痰，止咳嗽，定呵喘，去瘀生新。\" },\n  { \"name\": \"芜荑\", \"xing\": \"大果榆，又名：无姑（《尔雅》），山粉榆（《说文》），山榆（《广雅》），姑榆（《尔雅》郭璞注），迸榆、黄榆、扁榆、毛榆、柳榆。\", \"wei\": \"苦辛，温。\", \"liang\": \"内服：煎汤，1.5～3钱；或入丸、散。外用：研末调敷。\", \"zhi\": \"杀虫，消积。治虫积腹痛。小儿疳泻、冷痢，疥癣，恶疮。\" }] },\n\n{\n  \"name\": \"止血药\",\n  \"num\": 24,\n  \"content\": [\n  { \"name\": \"小蓟\", \"xing\": \"无\", \"wei\": \"甘、苦，凉。归心、肝经。\", \"liang\": \"4.5～9g。外用鲜品适量，捣烂敷患处。\", \"zhi\": \"凉血止血，祛瘀消肿。用于衄血，吐血，尿血，便血，崩漏下血，外伤出血，痈肿疮毒。\" },\n  { \"name\": \"大蓟\", \"xing\": \"大蓟 多年生草本。块根纹锤状或萝卜状，直径达7mm。茎直立，高30-80cm，茎枝有条棱，被长毛。基产叶有柄，叶片倒披针形或倒卵状椭圆形，长8-20cm，宽2.5-8cm，羽状深裂或几全裂，侧裂片6-12对，中部侧裂片较大，向上及向下的侧裂片渐小，边缘齿状，齿端具刺；自基部向上的叶渐小，与基生叶同形并等样分裂，但无柄，基部扩大半抱茎；全部茎叶两面同色，绿色，两面沿脉有疏毛。头状花序睦立，单一或数个生于枝端集成圆锥状；总苞钟状，直径3cm；；总苞片约6层，覆瓦状排列，向内层渐长，外层与中层卵状三角形至长三角形，先端有短刺，内层披针形或线状披针形，先端渐尖呈软针刺状；花两性，全部为管状花，花冠紫色或紫红色，长1.5-2cm，5裂，裂片较下面膨大部分短；雄蕊5，花药先端有附片，基部有尾。瘦果长椭圆形，稍扁，苌约4mm；冠毛羽状，暗灰色，稍短于花冠。花期5-8月，果期6-8月。\", \"wei\": \"味甘；微苦；性凉\", \"liang\": \"内服：煎汤，5-10g；鲜品可用30-60g。外用：适量，捣敷衍。用于止血宜炒炭用。\", \"zhi\": \"凉血止血；行瘀消肿。主吐血；咯血；衄血；便血；尿血；妇女崩漏；外伤出血；疮疡肿痛；瘰疬；湿疹；肝炎；肾炎\" },\n  { \"name\": \"地榆\", \"xing\": \"地榆，又名：玉札、玉豉（《神仙服良经》），酸赭（《别录》），豚榆系（《石药尔雅》），野升麻、红绣球、土儿红、山枣仁，一枝箭、紫朵苗子、小紫草、马猴枣、鞭枣胡子、黄瓜香、血箭草。<br>多年生草本，高1～2米。根茎粗壮，生多数肥厚的纺锤形成长圆柱形的根。茎直立，有棱。单数羽状复叶，互生；根生叶较茎生叶大，具长柄，茎生叶近于无柄，有半圆形环抱状托叶，托叶边缘具三角状齿；小叶5～19片，椭圆形至长卵圆形，长2～7厘米，宽0.5～3厘米，先端尖或钝圆，基部截形、阔楔形或略似心形，边缘具尖圆锯齿，小叶柄短或几无柄。花小，密集成倒卵形，短圆柱形或近球形的穗状花序，疏生于茎顶；花序梗细长、光滑或稍被细毛；花暗紫色，苞片2，膜质，披针形，被细柔毛；花被4裂，裂片椭圆形或广卵形；雄蕊4，着生刁：花被筒的喉部，花药黑紫色；子房上位，卵形有毛，花柱细长，柱头乳头状。瘦果椭圆形或卵形，褐色，有4纵棱，呈狭翅状。种子1枚。花、果期6～9月。\", \"wei\": \"苦酸，寒。<br>①《本经》：味苦，微寒。<br>②《别录》：甘酸，无毒。<br>③《滇南本草》：苦涩，温。\", \"liang\": \"内服：煎汤，2～3钱；或入丸、散。外用：捣汁或研末掺。\", \"zhi\": \"凉血上血，清热解毒。治吐血，衄血，血痢，崩漏，肠风，痔漏，痈肿，湿疹，金疮，烧伤。<br>①《本经》：主妇人乳b痛，七伤，带下病，止痛，除恶肉，止汗，疗金疮。<br>②《别录》：止脓血，诸瘘，恶疮，消酒，除消渴，补绝伤，产后内塞，可作金疮膏。主内漏不止，血不足。<br>③《药性论》：止血痢蚀脓。<br>④《唐本草》：主带下十二病。<br>⑤《日华子本草》：排脓，止吐血，鼻洪，月经不止，血崩，产前后诸血疾，赤白痢并水泻，浓煎止肠风。<br>⑥《开宝本草》：别本注云，止冷热痢及疳痢热。<br>⑦李杲；治胆气不足。<br>⑧《滇南本草》：治酒寒，面寒疼，肚腹疼。<br>⑨《纲目》：汁酿酒：治风痹，补脑。捣汁涂虎、犬、蛇.虫伤。<br>⑩《本草正》：清火明日。治带浊痔漏，产后阴气散失。亦敛盗汗，疗热痞。<br>⑾《药品化义》：解诸热毒痈。<br>⑿《药物图考》：调敷汤火伤，疳疮溃烂。<br>⒀《昆明民间常用草药》：治胃痛，胃肠出血。\" },\n  { \"name\": \"槐花\", \"xing\": \"槐（《尔雅》），又名：豆槐、白槐、细叶槐、金药树、护房树。<br>落叶乔木，高达25米。树皮灰色或深灰色，粗糙纵裂。内皮鲜黄色，有臭味；枝棕色，幼时绿色，具毛，皮孔明显。单数羽状复叶互生，长达25厘米，叶柄基部膨大；小叶7～15，卵状长圆形咸卵状披针形，长2.5～5厘米，宽1.5～2.6厘米，先端尖，基部圆形或阔楔形，全缘，上面绿色，微亮，下面伏生白色短毛；小叶柄长2.5毫米；托叶镰刀状，早落。圆锥花序顶生；花乳白色，长1.5厘米；萼钟形，5浅裂；花冠蝶形，旗瓣同心形，有短爪，脉微紫；雄蕊10，分离不等长；子房筒状，有细长毛，花柱弯曲。荚果长2.5～5厘米，有节，呈连珠状，无毛，绿色，肉质，不开裂，种子间极细缩。种子1～6粒，深棕色，肾形。花期7～8月。果期10～11月。\", \"wei\": \"苦，凉。<br>①《日华子本草》：味苦，平，无毒。<br>②《滇南本草》：味苦涩，性寒。<br>③《纲目》：味苦，气凉。<br>④《本草求原》：苦咸，寒。\", \"liang\": \"内服：煎汤，2～5钱；或入丸、散。外用：煎水熏洗或研末撒。\", \"zhi\": \"清热，凉血，止血。治肠风便血，痔血，尿血，血淋，崩漏，衄血，赤白痢下，风热目赤，痈疽疮毒。并用于预防中风。<br>①《日华子本草》：治五痔，心痛，眼赤，杀腹藏虫及热，治皮肤风，并肠风泻血，赤白痢。<br>②《医学启源》：凉大肠热。<br>③《纲目》：炒香频嚼，治失音及喉痹。又疗吐血，衄，崩中漏下。<br>④《本草正》：凉大肠，杀疳虫。治痈疽疮毒，阴疮湿痒，痔漏，解杨梅恶疮，下疳伏毒。<br>⑤《医林纂要》：泄肺逆，泻心火，清肝火，坚肾水。<br>⑥《本草求真》：治大、小便血，舌衄。<br>⑦《本草求原》：为凉血要药。治胃脘卒痛，杀蛔虫。<br>⑧《东北药植志》：治疗糖尿病的视网膜炎。\" },\n  { \"name\": \"槐角\", \"xing\": \"槐 落叶乔木，高8-20m。树皮灰棕色，具不规则纵裂，内皮鲜黄色，具臭味；嫩枝暗绿褐色，近光滑或有短细毛，皮孔明显。奇数现状复叶，互生，长15-25cm，叶轴有毛，基部膨大；小叶7-15，柄长约2mm，密生白色短柔毛；托叶镰刀状，早落；小叶片卵状长圆形，长2.5-7.5cm，宽1.5-3cm，先端渐尖具细突尖，基部宽楔形，全缘，上面绿色，微亮，背面优生白色短毛。圆锥花序顶生，长15-30cm；萼钟状，5浅裂；花冠蝶形，乳白色，旗瓣阔心形，有短爪，脉微紫，翼瓣和龙骨瓣均为长方形；雄蕊10，分离，不等长；于房筒状，有细长毛，花柱弯曲。荚果肉质，串珠状，长2.5-5cm，黄绿色，无毛，不开裂，种子间极细缩。种子1-6颗，肾形，深棕色。花期7-8月，果期10-11月。\", \"wei\": \"味苦；性寒\", \"liang\": \"内服：煎汤，5-15g；或入丸、散；嫩角捣汁。外用：适量，水煎洗；研未掺或油调敷。\", \"zhi\": \"凉血止血；清肝明目。主痔疮出血；肠风下血；血痢；崩漏；血淋；血热吐衄；肝热目赤；头晕目眩\" },\n  { \"name\": \"侧柏叶\", \"xing\": \"常绿乔木，高达20m，胸径可达1m。树皮薄，浅灰褐色，纵裂成条片。小枝扁平，直展，排成一平面。叶鳞形，交互对生，长1-3mm，先端微钝，位于小枝上下两面之叶露出部分倒卵状菱形或斜方形，两侧的叶折覆着上下之叶的基部两侧，呈龙骨状。叶背中部均有腺槽。雌雄同株；球花单生于短枝顶端；雄球花黄色，卵圆形，长约2mm。球果当年成熟，卵圆形，长1.5-2cm,熟前肉质，蓝绿色，被白粉；熟后木质，张开，红褐色；种鳞4对，扁平，背部近先端有反曲的尖头，中部种鳞各有种子1-2颗。种子卵圆形或长卵形，长4-6mm，灰褐色或紫褐色，无翅或有棱脊，种脐大而明显。花期3-4月，球果9-11月成熟。\", \"wei\": \"苦；涩；性微寒\", \"liang\": \"内服：煎汤，6-15g,或入丸、散。外用：适量，煎水洗，捣敷或研末调敷。\", \"zhi\": \"凉血止血；止咳祛痰；祛风湿；散肿毒。主治咯血；吐血；衄血；尿血；血痢；肠风下血；崩漏不止；咳嗽痰多；风湿痹痛；丹毒；痄腮，烫伤。\" },\n  { \"name\": \"白茅根\", \"xing\": \"白茅，多年生草本。高20-100cm。根茎白色，匍匐横走，密被鳞片。秆从生，直产，圆柱形，光滑无毛，基部被多数老叶及残留的叶鞘。叶线形或线状披针形；根出叶长几与植株相等；茎生叶较短，宽3-8mm，叶鞘褐色，无毛，或上部及边缘和鞘口具纤毛，具短叶舌。圆锥花序紧缩呈穗状，顶生，圆筒状，长5-20cm，宽1-2.5cm；小穗披针形或长圆形，成对排列在花序轴上，其中一小穗具较长的梗，另一小穗的梗较短；花两性，每小穗具1花，基部被白色丝状柔毛；两颖相等或第1颖稍短而狭，具3-4脉，第2颖较宽，具4-6脉；稃膜质，无毛，第1外稃卵状长圆形，内稃短，第2外稃披针形，与内稃等长；雄蕊2，花药黄色，长约3mm；雌蕊1，具较长的花柱，柱头羽毛状。颖果椭圆形，暗褐色，成熟的果序被白色长柔毛。花期5-6月，果期6-7月。\", \"wei\": \"甘；寒\", \"liang\": \"内服：煎汤，10-30g，鲜品30-60g；或捣汁。外用：适量，鲜品捣汁涂。\", \"zhi\": \"凉血止血；清热生津；利尿通淋。主血热出血；热病烦渴；胃热呕逆；肺热喘咳；小便淋沥涩痛；水肿；黄疸\" },\n  { \"name\": \"苎麻根\", \"xing\": \"多年生草本或亚灌木，高1～2m。根呈不规则圆柱形，略弯曲。茎直立，分枝，绿色，有短或长毛。叶互生，阔卵形或近圆形，长5～16cm，宽3.5～14cm，先端尾尖，基部宽楔形或圆形，边缘具粗齿，上面粗糙，下面密生白色绵毛。花单性同株，花序圆锥形；雄花序在雌花序下，雄花花被片4，雄花4，有退化雌蕊；雌花序簇生或球形，花被管状，4齿裂，子房1室，内含l胚珠。瘦果椭圆形，有毛，外被宿存花被，顶有宿存柱头，丝状。花期5～8月，果期8～10月。\", \"wei\": \"性寒，味甘。\", \"liang\": \"无\", \"zhi\": \"清热利尿，安胎止血，解毒。用于感冒发热、麻疹高烧、尿路感染、肾炎水肿、孕妇腹痛、胎动不安、先兆流产、跌打损伤、骨折、疮疡肿痛、出血性疾病。\" },\n  { \"name\": \"羊蹄\", \"xing\": \"1.多年生草本，高60-100cm。根粗大，断面黄色。茎直立，通常不分枝。单叶互生，具柄；叶片长圆形至长圆状披针形，基生叶较大，长16-22cm，宽4-9cm，先端急尖，基部圆形至微心形，边缘微状波皱褶。总状花序顶生，每节花簇略下垂；花两性，花被片6，淡绿色，外轮3片展开，内轮3片成果被；果被广卵形，有明显的网纹，背面各具一卵形疣状突起，其表面有细网纹，边缘具不整齐的微齿；雄蕊6，成3对；子房具棱，1室，1胚珠，花柱3，柱头细裂。瘦果宽卵形，有3棱，先端尖，角棱锐利，长约2mm，黑褐色，光亮。花期4月，果期5月。\", \"wei\": \"苦；性寒\", \"liang\": \"内服；煎汤，9-15；捣汁；或熬膏。外用：适量，捣敷；磨汁涂；或煎水洗。\", \"zhi\": \"清热通便；凉血止血；杀虫止痒。主大便秘结；吐血衄血；肠风便血；痔血；崩漏；疥癣；白秃；痈疮肿毒；跌打损伤\" },\n  { \"name\": \"土大黄\", \"xing\": \"多年生草本。根肥厚且大，黄色。茎粗壮直立，高约1m。根生叶大，有长柄；托叶膜质；叶片卵形或卵状长椭圆形；茎生叶互生，卵状披针形或卵状长椭圆形，茎上部叶渐小，变为苞叶圆锥花序，花小，紫绿色至绿色，两性，轮生而作疏总状排列；花被片6，淡绿色，2轮，宿存，外轮3片披针形，内轮3片，随果增 大为果被，缘有牙齿，背中肋上有瘤状突起；雄蕊6；子房1室，具棱，花柱3，柱头毛状。瘦果卵形，具3棱，茶褐色。种子1粒。花果期5-7月。\", \"wei\": \"辛；苦；性凉\", \"liang\": \"内服：煎汤，10～15g。外用：适量，捣敷或磨汁涂。\", \"zhi\": \"清热解毒; 凉血止血; 祛瘀消肿；通便；杀虫。主肺痨咳血；肺痛；吐血；瘀滞腹痛；跌打损伤；大便秘结；痄腮；痈疮肿毒；烫伤；疥癣；湿疹\" },\n  { \"name\": \"三七\", \"xing\": \"多年生草本，高达30～60厘米。根茎短，具有老茎残留痕迹；根粗壮肉质，倒圆锥形或短圆柱形，长约2～5厘米，直径约1～3厘米，有数条支根，外皮黄绿色至棕黄色。茎直立，近于圆柱形；光滑无毛，绿色或带多数紫色细纵条纹。掌状复叶，3～4枚轮生于茎端；叶柄细长，表面无毛；小叶3～7枚；小叶片椭圆形至长圆状倒卵形，长约5～14厘米，宽2～5厘米，中央数片较大，最下2片最小，先端长尖，基部近圆形或两侧不相称，边缘有细锯齿，齿端偶具小刺毛，表面沿脉有细刺毛，有时两面均近于无毛；具小叶柄。总花梗从茎端叶柄中央抽出，直立，长20～30厘米；伞形花序单独顶生，直径约3厘米；花多数，两性，有时单性花和两性花共存；小花梗细短，基部具有鳞片状苞片；花萼绿色，先端通常5齿裂；花瓣5，长圆状卵形，先端尖，黄绿色；雄蕊5，花药椭圆形，药背着生，内向纵裂，花丝线形；雌蕊1，子房下位，2室，花柱2枚，基部合生，花盘平坦或微凹。核果浆果状，近于肾形，长约6～9毫米；嫩时绿色.熟时红色。种子1～3颗，球形，种皮白色。花期6～8月。果期8～10月。<br>本植物的叶（三七叶）、花（三七花）亦供药用，另详专条。\", \"wei\": \"甘微苦，温。<br>①《纲目》：甘微苦，温，无毒。<br>②《本草汇言》：味甘微苦，性平，无毒。\", \"liang\": \"内服：煎汤，1.5～3钱；研末，0.5～1钱。外用：磨汁涂、研末撒或调敷。\", \"zhi\": \"止血，散瘀，消肿，定痛。治吐血，咳血，衄血，便血，血痢，崩漏，Y瘕，产后血晕，恶露不下，跌扑瘀血，外伤出血，痈肿疼痛。<br>①《纲目》：止血，散血，定痛。金刃箭伤，跌扑杖疮，血出不止者，嚼烂涂，或为末掺之，其血即止。亦主吐血，衄血，下血，血痢，崩中，经水不止，产后恶血不下，血运，血痛，赤目，痈肿，虎咬，蛇伤诸病。<br>②《玉揪药解》：和营止血，通脉行瘀，行瘀血而敛新血。凡产后、经期、跌打、痈肿，一切瘀血皆破；凡吐衄、崩漏、刀伤、箭射，一切新血皆止。\" },\n  { \"name\": \"茜草\", \"xing\": \"茜草，多年生攀援草本。根数条至数十条丛生，外皮紫红色或橙红色。茎四棱形，棱上生多数倒生的小刺。叶四片轮生，具长柄；叶片形状变化较大，卵形、三角状卵形、宽卵形至窄卵形，长2-6cm，宽1-4cm，先端通常急尖，基部心形，上面粗糙，下面沿中脉及叶柄均有倒刺，全缘，基出脉5。聚伞花序圆锥状，腋生及顶生；花小，黄白色，5数；花萼不明显；花冠辐状，直径约4mm，5裂，裂片卵状三角形，先端急尖；雄蕊5，着生在花冠管上；子房下位，2室，无毛。浆果球形，直径5-6mm，红色后转为黑色。花期6-9月，果期8-10月。\", \"wei\": \"苦；寒归肝；心经\", \"liang\": \"内服：煎汤，10-15g；或入丸、散；或浸酒。\", \"zhi\": \"用于血热妄行之多种出血证。茜草性寒入血分，能凉血止血，且能化瘀。凡血热妄行之出血证均可选用，兼瘀者尤宜。治血热咯血、吐血、衄血、尿血等证，轻者单用，重者可配小蓟、白茅根、山栀子等，以增强凉血止血之功，方如《十药神书》十灰散。治大肠蕴热之肠风便血，常配黄芩、地榆、槐角等药，以清肠凉血止血。治血热崩漏，常配生地、生蒲黄、侧柏叶等药，以凉血止崩；若气虚不摄，冲任虚损，漏下不止者，再配炙黄芪、山萸肉、乌贼骨等药，以补气摄血，收涩固脱。 用于瘀血经闭，产后瘀阻腹痛，跌打损伤肿痛，兼热者尤宜，因茜草有活血法瘀之功且能凉血。治瘀血经闭，可单用，或配丹参、赤芍、当归等药同用，则可增强活血通经作用；若为血枯兼瘀之经闭，又当配制首乌、熟地黄、川芎等，以养血活血通经。治产后瘀阻腹痛，属热者，常配败酱草、红藤、赤芍等药，以清热化瘀止痛；属寒滞者，常配当归、川芎、炮姜等药，以散寒暖宫、化瘀止痛；兼气虚血亏者，常配炙黄蔑、人参、当归等药，以补虚化瘀。治跌打损伤瘀肿，常配红花、川断、骨碎补等药，以活血消肿疗伤。 用于风湿痹痛。茜草活血通经，故亦治风湿痹痛，若属热痹者，常配忍冬藤、络石藤、秦艾等药，以清热通络止痛；属风寒湿痹者，又当与川乌、独活、海风藤等同用，以祛风除湿、散寒通痹。 用于黄疸。茜草凉血清瘀热而退黄，用治湿热黄疸，可配茵陈、山栀、大黄等药，以清热凉血，利湿退黄。 用于疮痈，痔肿。茜草能凉血化瘀以消散疮痈，治热毒疮疡或乳痈，常配蒲公英、银花、地丁等药；治痔疮肿痛，常配大黄、虎杖、地榆等药。\" },\n  { \"name\": \"蒲黄\", \"xing\": \"无\", \"wei\": \"甘辛，凉。\", \"liang\": \"内服：煎汤，1.5～8钱；或入丸、散。外用：研末撒或调敷。\", \"zhi\": \"动物实验证明，蒲黄对不同动物的离体子宫平滑肌，均有直接使其收缩或增强收缩和紧张性的作用。临床应用于产褥期，于产后开始口服生蒲黄末，每日3次，每次3克，连续3天，以观察其对子宫的收缩作用。据31例产妇的服药结果，产后3日宫底平均下降4.71厘米，而对照组（未服药）30例平均下降3.64厘米；同时服用生蒲黄后产妇的恶露亦渐减少。认为所谓\\\"祛瘀\\\"作用，其本质似在于收缩子宫；并认为蒲黄除能收缩子宫外，还有止血作用。此外，作者还根据蒲黄的作用及临床观察结果，对蒲黄\\\"生用活血行血，炒黑止血\\\"及\\\"阴虚、无瘀忌用\\\"的说法提出了不同意见。认为蒲黄无炒黑的必要，主张一律生用；临床应用除孕妇外，一般无所禁忌。\" },\n  { \"name\": \"花蕊石\", \"xing\": \"蛇纹石大理岩主要由矿物方解石形成的大理岩与蛇纹石组成。<br>1.大理岩 由方解石形成，参见方解石条。<br>2.蛇纹石 为硅酸盐类蛇纹石族矿物。晶体结构结构属单斜晶系。单个晶体呈片状、针状，但罕见。常呈板状、鳞片状或为显微粒状集合体。以纤维状纹理或斑点状团块分散于方解石晶粒中。一般呈绿色，深浅不等，了有呈白色、浅黄色、灰色、蓝绿色或褐黑色者，纤维状或鳞片状者呈丝绢光泽。硬度2.5-3.5,相对密度2.5-3.6,抚摸之有滑感。\", \"wei\": \"酸；涩；平；无毒\", \"liang\": \"内服：入散剂，1-3钱。外用：研末撒。\", \"zhi\": \"化瘀；止血。主吐血；衄血；便血；崩漏；产妇血晕；死胎；胞衣不下；金疮出血\" },\n  { \"name\": \"白及\", \"xing\": \"白及，多年生草本，高15-70cm。根茎（或称假鳞茎）三角状扁球形或不规则菱形，肉质，肥厚，富粘性，常数个相连。茎直立。叶片3-5，披针形或宽披针形，长8-30cm，宽1.5-4cm，先端渐尖，基部下延成长鞘状，全缘。总状花序顶生，花3-8朵，花序轴长4-12cm；苞片披针形，长1.5-2.5cm，早落；花紫色或淡红色，直径3-4cm；萼片和花瓣等长，狭长圆形，长2.8-3cm；唇瓣倒卵形，长2.3-2.8cm，白色或具紫纹，上部3裂，中裂片边缘有波状齿，先端内凹，中央具5条褶片，侧裂片直立，合抱蕊柱，稍伸向中裂片，但不及中裂片的一半；雄蕊与雌蕊合为蕊柱，两侧有狭翅，柱头顶端着生1雄蕊，花药块4对，扁而长；子房下位，圆柱状，扭曲。蒴果圆柱形，长3.5cm，直径约1cm，两端稍尖，具6纵肋。花期4-5月。果期7-9月。\", \"wei\": \"苦；甘；涩；寒\", \"liang\": \"内服：煎汤，3-10g；研末，每次1.5-3g。外用：适量，研末撒或调涂。\", \"zhi\": \"收敛止血；消肿生肌。主咯血；吐血；衄血；便血；外伤出血；痈疮肿毒；烫灼伤；手足皲裂；肛裂\" },\n  { \"name\": \"仙鹤草\", \"xing\": \"无\", \"wei\": \"苦、涩，平。\", \"liang\": \"6～12g。外用适量。\", \"zhi\": \"收敛止血，截疟，止痢，解毒。用于咳血，吐血，崩漏下血，疟疾，血痢，脱力劳伤，痈肿疮毒，阴痒带下。\" },\n  { \"name\": \"紫珠叶\", \"xing\": \"灌木或小乔木，幼枝被灰白色长茸毛。叶对生，长椭圆形至椭圆状披针形，上面有短柔毛，老时稍粗糙，下面密被灰白色茸毛，两面有不明显的金黄色腺点，聚伞花序5～7次分歧，总花梗长2～4cm；花萼4齿裂，被星状柔毛；花冠紫色，管状，先端4裂，略被细毛；雄蕊4；子房上位，4室。浆果状核果，小球形，有腺点，熟时紫红色。花期夏季。\", \"wei\": \"性平，味微辛、苦。\", \"liang\": \"无\", \"zhi\": \"止血消炎，散瘀消肿。用于胃及十二指肠贵疡出血、外伤出血、衄血、齿龈出血、扭伤肿痛、化脓性皮肤溃疡、烧伤、流感。\" },\n  { \"name\": \"大叶紫珠\", \"xing\": \"灌木，稀为小乔木，高3-5m。小枝近方形，密生灰白色粗糠状分枝茸毛。单叶对生；叶柄粗壮，长1-2cm，密生灰白色分阶段枝的茸毛；叶片长椭圆形、椭圆状披针形或卵状椭圆形，长10-24cm，宽5-10cm，先端短渐尖，基部钝圆或宽楔形，边缘有细锯齿，表面有短毛，脉上较密，背面密生灰白色分枝茸毛，两面均有不明显的金黄点腺点；侧脉8-10对。聚伞花序腋生，5-7次分歧，密生灰白色分枝茸毛；苞片线形；花萼杯状，长约1mm，被灰白色星状毛和黄色腺点，萼齿不明显或呈钝三角形；花冠紫红色，长约2.5mm，疏被星状毛；雄蕊4，花丝长约5mm；子房微被毛。果实球形，紫红色，有腺点及微志。花期4-7月，果期7-12月。\", \"wei\": \"辛苦；平\", \"liang\": \"内服：煎汤，15-30g。外用：适量，捣敷；研末撒。\", \"zhi\": \"散瘀止血；消肿止痛。主咯血；衄血；吐血；便血；创伤出血；跌打肿肿；风湿痹痛\" },\n  { \"name\": \"棕榈\", \"xing\": \"无\", \"wei\": \"苦、涩，平。\", \"liang\": \"3～9g,一般炮制后用。\", \"zhi\": \"收涩止血。用于吐血，衄血，尿血，便血，崩漏下血。\" },\n  { \"name\": \"血余炭\", \"xing\": \"无\", \"wei\": \"苦，平。\", \"liang\": \"4.5～9g。\", \"zhi\": \"止血，化瘀。用于吐血，咯血，衄血，尿血，崩漏下血，外伤出血。\" },\n  { \"name\": \"藕节\", \"xing\": \"莲 多年生水生草本。根茎横生，肥厚，节间膨大，内有多数纵行通气孔洞，外生须状不定根。节上生叶，露出水面；叶柄着生于叶背中央，粗壮，圆柱形，多刺；叶片圆形，直径25-90cm，全缘或稍呈波状，上面粉绿色，下面叶脉从中央射出，有1-2次叉状分枝。花单生于花梗顶端，花梗与叶柄等长或稍长，也散生小刺；花直径10-20cm，芳香，红色、粉红色或白色；花瓣椭圆形或倒卵形，长5-10cm，宽3-5cm；雄蕊多数，花药条形，花丝细长，着生于托之一；心皮多数埋藏于膨大的花托内，子房椭圆形，花柱极短。花后结莲蓬，倒锥形，直径5-10cm，有小孔20-30个，每孔内含果实1枚；坚果椭圆形或卵形，长1.5-2.5cm，果皮革质，坚硬，熟时黑褐色。种子卵形，或椭圆形，长1.2-1.7cm，种皮红色或白色。花期6-8月，果期8-10月。\", \"wei\": \"甘；涩；平\", \"liang\": \"内服：煎汤，10-30g；鲜用捣汁，可用60g左右取汁冲服；或入散剂。\", \"zhi\": \"散瘀止血。主吐血；咯血；尿血；便血；血痢；血崩\" },\n  { \"name\": \"艾叶\", \"xing\": \"艾 多年生草本，高50-120cm。全株密被白色茸毛，中部以上或仅上部有开展及斜升的花序枝。叶互生，下部叶在花期枯萎；中部叶卵状三角形或椭圆形，长6-9cm，宽4-8cm，基部急狭或渐狭成短或稍长的柄，或稍扩大而成托叶状；叶片羽状或浅裂，侧裂片约2对，常楔形，中裂片又常三，裂片边缘有齿，上面被蛛丝状毛，有白色密或疏腺点，下面被白色或灰色密茸毛；上部叶渐小，三裂或不分裂，无柄。头状花序多数，排列成复总状，长约3mm，直径2-3mm，花后下倾；总苞片形；总苞片4-5层，边缘膜质，背面被绵毛；花带红色，多数，外层雌性，内层两性。瘦果常几达1mm，无毛。花期7-10月。\", \"wei\": \"味辛；苦；性温\", \"liang\": \"内服：煎汤，3-10g；或入丸、散；或捣汁。外用：适量，捣绒作炷或制成艾条熏灸；工捣敷；或煎水熏洗；或炒热温熨。\", \"zhi\": \"温经止血；散寒止痛；祛湿止痒。主吐血；衄血；吃力血；便血；便血；崩漏；妊娠下血；月经不调；痛经；胎动不安；心腹冷痛；泄泻久痢；霍乱转筋；带下；湿疹；疥癣；痔疮；痈疡\" },\n  { \"name\": \"炮姜\", \"xing\": \"姜，多年生草本，高50-80cm。根茎肥厚，断面黄白色，有浓厚的辛辣气味。叶互生，排成2列，无柄，几抱茎；叶舌长2-4mm；叶片披针形至线状披针形，长15-30cm，宽1.5-2.2cm，先端渐尖，基部狭，叶革鞘状抱茎，无毛。花葶自根茎中抽出，长15-25cm；穗状花序椭圆形，长4-5cm；苞片卵形，长约2.5cm，淡绿色，边缘淡黄色，先端有小尖头；花萼管长约1cm，具3短尖齿；花冠黄绿色，管长2-2.5cm，裂片3，披针形，长不及2cm，唇瓣的中间裂片长圆状倒卵开，较花冠裂片短，有紫色条纹和淡黄色斑点，两侧裂片卵形，黄绿色，具紫色边缘；雄蕊1，暗紫色，花药长约9m，药隔附属体包裹住花柱；子房3室，无毛，花柱1，柱头近球形。蒴果。种子多数，黑色。花期8月。\", \"wei\": \"味苦；辛；性温\", \"liang\": \"内服：煎汤，3-6g；或入丸、散。外用：适量，研末调敷。\", \"zhi\": \"温中止泻；温经止血。主虚寒性脘腹疼痛；呕吐；泻痢；吐血；便血；崩漏\" },\n  { \"name\": \"黄土\", \"xing\": \"一般呈灰黄色。富含钙盐及钙质结核，疏松，有肉眼可见的大孔隙，柱状节理发育。干燥时较坚实，能保持直立陡壁，遇水浸润后易崩解，并发生沉陷。\", \"wei\": \"①《本草拾遗》：\\\"甘，平，无毒。\\\"\", \"liang\": \"内服：煎汤，1～3两。外用：调敷或炒热布裹温熨，或开水冲化澄清洗涤。\", \"zhi\": \"和中解毒。治中暑吐泻，痢疾，痈疽肿毒，跌扑损伤。\" }] },\n\n{\n  \"name\": \"活血化瘀药\",\n  \"num\": 35,\n  \"content\": [\n  { \"name\": \"川芎\", \"xing\": \"多年生草本。地下茎呈不整齐的结节状拳形团块。茎直立，圆柱形，中空，表面有纵直沟纹。叶互生，2～3回单数羽状复叶，小叶3～5对，边缘又作不等齐的羽状全裂或深裂，裂片先端渐尖，两面无毛，仅脉上有短柔毛；叶柄长9～17厘米，基部成鞘抱茎。复伞形花序生于分枝顶端，有短柔毛；总苞和小总苞片线形；花小，白色；萼片5，线形，有短柔毛；花瓣5，椭圆形，先端全缘，而中央有短尖突起，向内弯曲；雄蕊5，与花瓣互生，花药椭圆形，2室，纵裂，花丝细软，伸出于花瓣外；雌蕊子房下位，2室，花柱2。双悬果卵形。\", \"wei\": \"辛，温。\", \"liang\": \"内服：煎汤，1～2钱；或入丸、散，外用：研末撒或调敷。\", \"zhi\": \"治疗心绞痛:取川芎、红花各等分，制成片剂（每12片含川芎、红花生药各5钱），每次4片，日服3次。4～6周为一疗程。治疗84例（其中10例全程加葛根黄酮片，每日3次，每次20毫克；2例于用药2周开始加服乳没片），结果显效9例，改善57例，基本无效17例，加重1例。据观察，病情的轻重与疗效无明显关系；加服葛根黄酮及乳没片者，疗效未见提高；服药后对血脂质影响不大。60例跃服用硝酸甘油的患者，在治疗过程中，停用者20例，减量者15例，部分病例的心电图显示好转。\" },\n  { \"name\": \"延胡索\", \"xing\": \"延胡索 多年生草本，高9-20cm，全株无毛。块茎扁球形，直径7-15mm，上部略凹陷，下部生须根，有时纵裂成数瓣，断面深黄色。<br>茎直立或倾斜，常单一，近基部具鳞片1枚，茎节处常膨大成小块茎，小块茎生新茎，新茎节处又成小块茎，常3-4个成串。基生叶2-4枚；柄长3-8cm；叶片轮廓宽三角形，长3-6cm，宽4-8cm，二回三出全裂，一回裂片具柄，本回裂片近无柄，裂片被针形至长椭圆形，长20-30mm，宽5-8mm，全缘，少数上半部2深裂至浅裂；茎生叶常2枚，互生，较基生叶小而同形。总状花序顶生，长2-5cm，疏生花3-8朵；苞片卵形至狭卵形，位于在序下部者长约10mm，先端3-5栉裂，位于上部者全缘；萼片2，细小，早落；花冠淡紫红色，花瓣4，2轮，外轮上瓣最大，长15-25mm，上部舒展成宽倒卵形至宽椭圆形的兜状瓣片，边缘具小齿，先端有浅凹陷，中下部延伸成长距，下瓣较短，形同上瓣，基部具浅囊状突起，内轮两瓣长10-15mm，合抱裹于雄蕊外，上部宽倒卵形，中、下部细长成爪；雄蕊6，略短于内轮花瓣，每3枚合生成束；于房条形，长8-10mm，花枝细短，柱头近圆形，具乳突8个。葫果条形，长1.7-2.2cm，花柱、柱头宿存，熟时2瓣裂。种子1列，数粒，细小，扁长圆形，黑色，有光泽，表面密布小凹点。栽培品常只开花，果不及成熟即凋落。花期3-4月，果期4-5月。\", \"wei\": \"辛；苦；温；无毒\", \"liang\": \"内服：煎汤，1.5-3钱；或入丸、散。\", \"zhi\": \"活血；散瘀；理气；止痛。主心腹腰膝诸痛；月经不调；症瘕；崩中；产后血晕；恶露不尽；跌打损伤\" },\n  { \"name\": \"郁金\", \"xing\": \"1.温郁金，多年生草本，高80-160cm。主根茎陀罗状，侧根茎指状，内面柠檬色。须根细长，末端常膨大成纹锤形块根，内面白色。叶片4-7，2列，叶柄短，长不及叶片的一半；叶片宽椭圆形，长35-75cm，宽14-22cm，先端渐尖或短尾状渐尖，基部楔形，下延至叶柄，下面无毛。穗状花序圆柱状，先叶于根茎处抽出，长20-30cm，直径4-6cm ，上部无花的苞片长椭圆形，长5-7cm，宽1.5-2.5cm，蔷薇红色，中下部有花的苞片长椭圆形，长3-5cm，宽2-4cm，绿白色；花萼筒白色，先端具不等的3齿；花冠管漏斗状，白色，裂片3，膜质，长椭圆形，后方一片较大，先端略成兜状，近先端处有粗糙毛；侧生退化雄蕊花瓣叛变 ，黄色，唇瓣倒卵形，外折，黄色，先端微凹；能育雄蕊1，花药基部有距；子房被长柔毛，花柱细长。花期4-6月。<br>2.姜黄，姜黄，多年生草本，高1-1.5m。根茎发达，成丛，分枝呈椭圆形或圆柱状，橙黄色，极香；根粗壮，末端膨大成块根。叶基生，5-7片，2列；叶柄长20-45cm；叶片长圆形或窄椭圆形，长20-50cm，宽5-15cm，先端渐尖，基部楔形，下延至叶柄，上面黄绿色，下面浅绿色，无毛。花葶由叶鞘中抽出，总花梗长12-20cm，穗状花序圆柱状，长12-18cm；上部无花的苞片粉红色或淡红紫色，长椭圆形，长4-6cm，宽1-1.5cm，中下部有花的苞片嫩绿色或绿白色，卵形至近圆形，长3-4cm；花萼简绿白色，具3齿；花冠管漏斗形，长约1.5cm，淡黄色，喉部密生柔毛，裂片3；能育雄蕊1，花丝短而扁平，花药长圆形，基部有距；子房下位，外被柔毛，花柱细长，基部有2个棒状腺体，柱头稍膨大，略呈唇形。花期8月。<br>3.广西莪术，多年生草本，高50-110cm。主根茎卵圆形，侧根茎指状，断面白色或微黄色。须根末端常膨大成组锤形块根，断面白色。叶基生，叶柄为叶片长度的1/4，被短柔毛；叶鞘长10-33cm，被短柔毛；叶2-5片，直立，叶片长椭圆形，长14-39cm，宽4.5-7(-9.5)cm，先端短尖至渐尖，基部渐狭，下延，两面密被粗柔毛，有的类型沿中脉两侧有紫晕。稳状花序从根茎中抽出，圆柱形，先叶或与叶同时抽出，长约15cm，直径约7cm，花序下的苞片阔卵形，淡绿色，上部的苞片长圆形，淡红色；花萼白色，长约Icm，一侧裂至中部，先端有3钝齿；花冠近漏斗状，长2-2.5cm，花瓣3，粉红色，长圆形，后方的1片较宽，先端略成兜状；侧生退化雄蕊花瓣状，淡黄色，唇瓣近圆形，淡黄色，先端3浅圆裂，花药基部有距；子房被长柔毛，花柱丝状，柱头头状，有毛。花期5-7月。<br>4.莪术，多年生草本，高80-150cm。主根茎陀罗状至锥状陀罗形，侧根茎指状，内面黄绿色至墨绿色，或有时发蓝色，须根末端膨大成肉质纺锤形，内面黄绿或近白色。叶鞘下段常为褐紫色。叶基生，4-7片；叶柄短，为叶片长度的1/3-1/2或更短；叶片长圆状椭圆形，长20-50cm，宽8-20cm，先端渐尖至短尾尖，基部下延成柄，两面无毛，上面沿中脉两侧有1-2cm宽的紫色晕。穗状花序圆柱状，从根茎中抽出，长12-20cm，有苞片20多枚，上部苞片长椭圆形，长4-6cm，宽1.5-2cm，粉红色呈紫红色；中下部苞片近圆形，长2-3.5cm，宽1.5-3.2cm，淡绿色至白色。花期4-6月。<br>5.川郁金，多年生草本，高80-120cm。块根纹锤形，断面浅黄色至白色。主根茎陀罗形，侧根茎指状，断面黄色。叶2列，4-7枚，叶柄长为叶片的1/4-1/3；叶片长圆形，先端急尖，基部楔形并下延至叶柄，两面有茸毛。穗状花痛圆锥状，从根茎上抽出，缨部苞片粉红色至淡红色，腑内无花，中下部苞片绿色，上面光滑，背部有柔毛，腑内有花数朵，有小苞片数枚，小苞片白色、透明；花萼筒3齿，外被柔毛，白色，膜质；花冠管长约6.5cm，喉部密生柔毛，裂片3，略呈粉红色，上方一片较大，先端卷曲；侧生退化雄蕊花瓣状，黄色，唇瓣近圆形，先端明显3裂；能痛雄蕊1，花丝短而扁平，花药长圆形，长5mm，基部有距；花柱细长，从药室中穿过，基部具2棒状体，子房下位，外被柔毛。花期4-6月。\", \"wei\": \"味辛；苦；性寒\", \"liang\": \"内服：煎汤，3-10g；或入丸散。\", \"zhi\": \"活血止能；行气解郁；清心凉血；疏肝利胆。主胸腹胁肋诸痛；妇女痛经；经闭；症瘕结块；热病神昏；癫狂；惊痫；吐血；衄备；血淋；砂淋；黄疸\" },\n  { \"name\": \"姜黄\", \"xing\": \"姜黄，多年生草本，高1-1.5m。根茎发达，成丛，分枝呈椭圆形或圆柱状，橙黄色，极香；根粗壮，末端膨大成块根。叶基生，5-7片，2列；叶柄长20-45cm；叶片长圆形或窄椭圆形，长20-50cm，宽5-15cm，先端渐尖，基部楔形，下延至叶柄，上面黄绿色，下面浅绿色，无毛。花葶由叶鞘中抽出，总花梗长12-20cm，穗状花序圆柱状，长12-18cm；上部无花的苞片粉红色或淡红紫色，长椭圆形，长4-6cm，宽1-1.5cm，中下部有花的苞片嫩绿色或绿白色，卵形至近圆形，长3-4cm；花萼简绿白色，具3齿；花冠管漏斗形，长约1.5cm，淡黄色，喉部密生柔毛，裂片3；能育雄蕊1，花丝短而扁平，花药长圆形，基部有距；子房下位，外被柔毛，花柱细长，基部有2个棒状腺体，柱头稍膨大，略呈唇形。花期8月。\", \"wei\": \"味苦；辛；性温\", \"liang\": \"内服：煎汤，3-10g；或入丸、散。外用：适量，研末调敷。\", \"zhi\": \"破血行气；通经止痛。主血瘀气滞诸证；胞腹胁痛；妇女痛经；闭经；产后瘀滞腹痛；风湿痹痛；跌打损伤；痈肿\" },\n  { \"name\": \"乳香\", \"xing\": \"矮小灌木，高4～5米，罕达6米。树干粗壮，树皮光滑，淡棕黄色，纸状，粗枝的树皮鳞片状，逐渐剥落。叶互生，密集或于上部疏生，单数羽状复叶，长15～25厘米，叶柄被白毛；小叶7～10对，对生，无柄，基部者最小，向上渐大，小叶片长卵形，长达3.5厘米，顶端者长达7.5厘米，宽1.5厘米，先端钝，基部圆形、近心形或截形，边缘有不规则的圆齿裂，或近全缘，两面均被白毛，或上面无毛。花小，排列成稀疏的总状花序；苞片卵形：花萼杯状，先端5裂，裂片三角状卵形；花瓣5片，淡黄色，卵形，长约为萼片的2倍，先端急尖；雄蕊10，着生于花盘外侧，花丝短；子房上位，3～4室，每室具2垂生胚珠，柱头头状，略3裂。桉果倒卵形，长约1厘米，有三棱，钝头，果皮肉质，肥厚，每室具种子1枚。\", \"wei\": \"辛苦，温。<br>①《别录》：微温。<br>②《日华子本草》：味辛，热，微毒。<br>③李杲：味苦辛，热。\", \"liang\": \"内服：煎汤，1～3钱；或入丸，散。外用：研末凋敷。\", \"zhi\": \"调气活血，定痛，追毒。治气血凝滞、心腹疼痛，痈疮肿毒，跌打损伤，痛经，产后瘀血刺痛。<br>①《别录》：疗风水毒肿，去恶气。疗风瘾疹痒毒。<br>②《本草拾遗》：疗耳聋，中风口噤，妇人血气，能发酒，理风冷，止大肠泄荩疗诸疮令内消。<br>③《日华子本草》：止霍乱，心腹痛。煎膏止痛长肉。<br>④《证类本草》：治不眠。<br>⑤《珍珠囊》：定诸经之痛。<br>⑥《纲目》：消痈疽诸毒，托里护心，活血定痛，伸筋，治妇人难产，折伤。<br>⑦《本草从新》：治癫狂，止泄痢。<br>⑧《要药分剂》：赤白痢腹痛不止者，加入乳香无不效。\" },\n  { \"name\": \"没药\", \"xing\": \"①没药树（《大明一统志》）\", \"wei\": \"苦，平。\", \"liang\": \"内服：煎汤，1～3钱：或入丸、散。外用：研末调敷。\", \"zhi\": \"散血去瘀，消肿定痛。治跌损，金疮，筋骨，心腹诸痛，症瘕，经闭，痈疽肿痛，痔漏，目障，\" },\n  { \"name\": \"五灵脂\", \"xing\": \"复齿鼯鼠，形如松鼠，但较松鼠略大，为中等的一种鼯鼠。体长20-30cm，体生250-400g。头宽、吻较短。眼圆而大，耳壳显着，耳基部前后方生有黑色细长的簇毛。前后肢间有皮膜相连。尾呈扁平状，略短于体长，尾毛长而蓬松。全身背毛为灰黄褐色，毛基部黑灰色，上部黄色，尖端黑褐色。颜脸部较淡，为灰色，耳同身色。腹部毛色较浅。毛基灰白色，毛尖黄棕色。皮膜上下一与背腹面色相同，唯侧缘呈鲜橙黄色。四足色较深，为棕黄色。尾为灰黄色，尾尖有黑褐色长毛。\", \"wei\": \"味苦；甘；性温\", \"liang\": \"内服：煎汤，510g；或入丸、散。外用：适量，研末撒或调敷。\", \"zhi\": \"活血止痛；化瘀止血；消积解毒。主心腹血气诸痛；妇女闭经；产后瘀滞腹痛；崩漏下血；小儿疳积；蛇蝎蜈蚣咬伤\" },\n  { \"name\": \"降香\", \"xing\": \"乔木。幼嫩部分、花序及子房略被短柔毛；树皮褐色，粗糙；小枝近平滑，具密集的苍白色皮孔。羽状复叶互生；小叶9～13，近革质，卵形或椭圆形，基部小叶较小，阔卵形，侧脉和网脉于两面略凸起。圆锥花序腋生；萼钟状，5裂，上部2裂齿短阔；花冠蝶形，淡黄色或乳白色，各瓣近等长，均具爪；雄蕊9枚，1组；子房狭椭圆形，具长约2.5mm的柄。荚果舌状长椭圆形，长4.5～8cm，宽1.5～1.8cm，柄长5～10mm。种子常1枚，稀2枚。花期4～6月。\", \"wei\": \"无\", \"liang\": \"无\", \"zhi\": \"行气活血，止痛，止血。\" },\n  { \"name\": \"丹参\", \"xing\": \"多年生草本，高30-100cm。全株密被淡黄色柔毛及腺毛。茎四棱形，具槽，上部分枝。叶对生，奇数羽状香叶；叶柄长1-7cm；小叶通常5，稀3或7片，顶端小叶最大，侧生小叶较小，小叶片卵圆形至宽宽卵圆形，长2-7cm，宽0.8-5cm，先端急尖或渐尖，基部斜圆形或宽楔形，边具圆锯齿，两面密被白色柔毛。轮伞花序组成顶生或腑生的总状花序，每轮有花3-10朵，下部者疏离，上部者密集；苞片披针形，上面无毛，下面略被毛；花萼近钟状，紫色；花冠二唇形，蓝紫色，长2-2.7cm，上唇直立，呈镰刀状，先端微裂，下唇较上唇短，先端3裂，中央裂片较两侧裂片长且大；发育雄蕊2，着生于下唇的中部，伸出花冠外，退化雄蕊2，线形，着生于上唇喉部的两侧，花药退化成花瓣状；花盘前方稍膨大；子房上位，4深裂，花柱细长，柱头2裂，裂片不等。小坚果长圆形，熟时棕色或黑色，长约3.2cm，径1.5mm，包于宿萼中。花期5-9月，果期8-10月。\", \"wei\": \"味苦；性微寒\", \"liang\": \"内服：煎汤，5-15g，大剂量可用至30g。\", \"zhi\": \"活血祛瘀；调经止痛；养血安神；凉血消痈。主妇女月经不调；痛经；经闭；产后瘀滞腹痛；心腹疼痛；症瘕积聚；热痹肿痛；跌打损伤；热入营血；烦躁不安；心烦失眠；痈疮肿毒\" },\n  { \"name\": \"红花\", \"xing\": \"红花 越年生草本，高50-100cm。茎直立，上部分枝，白色或淡白色，光滑无毛。叶互生；无柄；中下部茎生叶披针形、卵状披针形或条椭圆形，长7-15cm，宽2.5-6cm，边缘具大锯齿、重锯齿、小锯齿或全缘，稀羽状深裂，齿顶有针刺，刺长1-1.5mm，向上的叶渐小，披针形，边缘有锯齿，齿顶针刺较长，可达3mm；全部叶质坚硬，革质，两面无毛，无腺点，有光泽。头状花序多数，在茎枝顶端排成伞房花序，为苞叶所围绕；苞片椭圆形或卵状披针形，连先端针刺长2.5-3cm，边缘有或无针刺；总苞片形，直径2.5cm；总苞片4层，外层竖琴状，中部或下部有收缢，收缢以上叶质绿色，边缘无针刺或有篦齿状针刺，收缢以下黄白色；中内层硬膜质，倒披针状椭圆形至长倒披针形，长达2.2cm，先端渐尖；全部苞片无毛，无腺点；小花红色、桔红色，全部为两性，花冠长2.8cm，细管部长2cm，花冠裂片几达檐部基部。瘦果倒卵形，长5.5mm，宽5mm，乳白色，有4棱，无冠毛。花果期5-8月。\", \"wei\": \"味辛；性温\", \"liang\": \"内服：煎汤，3-10g。养血和血宜少用；活血祛瘀宜多用。\", \"zhi\": \"活血能经；祛瘀止痛。主经闭；痛经；产后瘀阻腹痛；胞痹心痛症瘕积聚；跌打损伤；关节疼痛；中风偏竣；斑疹\" },\n  { \"name\": \"西红花\", \"xing\": \"无\", \"wei\": \"甘，平。\", \"liang\": \"3～9g。\", \"zhi\": \"活血化瘀，凉血解毒，解郁安神。用于经闭Y瘕，产后瘀阻，温毒发斑，忧郁痞闷，惊悸发狂。\" },\n  { \"name\": \"桃仁\", \"xing\": \"①桃（《诗经》）又名：毛桃（《纲目》），白桃、红桃。<br>落叶小乔木，高达8米。小枝绿色或半边红褐色，无毛，冬芽有细柔毛。叶互生，在短枝上呈簇生状；叶片椭圆状披针形至倒卵状披针形，中部最阔，长8～15厘米，宽2～3.5厘米，先端长尖，基部阔楔形，边缘具细锯齿，两面无毛；叶柄长7～12毫米，具腺点。花通常单生，直径约2.5～3.5厘米；具短梗；萼片5，基部合生成短萼筒，红色，外面有绒毛；花瓣5，倒卵形，粉红色；雄蕊多数，着生于萼筒边缘；子房1室，花柱细长，柱头小，圆头状。核果近球形，直径5～7厘米，有短绒毛；果肉白色或黄色；核极硬，有不规则的凹点及深沟。种子1枚，扁卵状心形。花期4月，先叶开放。果熟期6～7月。<br>全国各地普遍栽培。<br>②山桃（《尔雅》），又名：{桃（《尔雅》），山毛桃、野桃、花桃。<br>落叶小乔木，高5～9米。叶互生；托叶早落；叶柄长1.5～3厘米；叶片卵状披针形，长4～8厘米，宽2～3.5厘米，中部以上渐尖，近基部最宽，基部呈广楔形或圆形，边缘具细锯齿。花单生；萼片5，多无毛；花瓣5，阔倒卵形，粉红色至白色。核果近圆形；黄绿色，表面被黄褐色柔毛，果肉离核；核小坚硬，表面有网状的凹纹。种子1枚，棕红色。花期3～4月。果期6～7月。<br>多生于石灰岩的山谷中。分布辽宁、河北、河南、山东、山西、四川、云南、贵州、陕西等地。<br>以上两种植物的根及根皮（桃根）、去掉栓皮的树皮（桃茎白皮）、嫩枝（桃枝）、叶（桃叶）、花（桃花）、成熟的果实（桃子）、未成熟的果实（碧桃干）、树脂（桃胶）亦供药用，各详专条。\", \"wei\": \"苦甘，平。<br>①《本经》：味苦，平。<br>②《别录》：甘，无毒。<br>③《千金・食治》：味苦甘辛，平，无毒。\", \"liang\": \"内服：煎汤，1.5～3钱；或入丸、散。外用：捣敷。\", \"zhi\": \"破血行瘀，润燥滑肠。治经闭，Y瘕，热病蓄血，风痹，疟疾，跌打损伤，瘀血肿痛，血燥便秘。<br>①《本经》：主瘀血，血闭Y瘕，邪气，杀小虫。<br>②《别录》：止咳逆上气，消心下坚，除卒暴击血，破Y瘕，通脉，止痛。<br>③孟诜：杀三虫，止心痛。<br>④《医学启源》：治大便血结。<br>⑤李杲：治热入血室，腹中滞血，皮肤血热燥痒，皮肤凝聚之血。<br>⑥《滇南本草》：治血痰。<br>⑦《纲目》：主血滞风痹，骨蒸，肝疟寒热，产后血病。<br>⑧《现代实用中药》：治高血压及慢性盲肠炎，妇人子宫血肿。\" },\n  { \"name\": \"益母草\", \"xing\": \"一年或二年生草本。茎直立，方形，单一或分枝，高60厘米至1米许，被微毛。叶对生；叶形多种，一年根生叶有长柄，叶片略呈圆形，直径4～8厘米，叶缘5～9浅裂，每裂片具2～3钝齿，基部心形；茎中部的叶有短柄，3全裂，裂片近披针形，中央裂片常3裂，两侧裂片常再1～2裂，最终裂片近线形，先端渐尖，边缘疏生锯齿或近全缘；最上部的叶不分裂，线形，近无柄，上面绿色，下面浅绿色，两面均被短柔毛。花多数，生于叶腋，呈轮伞状；苞片针刺状；花萼钟形，先端有5长尖齿，下方2片较上方3片为长；花冠唇形，淡红色或紫红色，长9～12毫米，上下唇几等长，上唇长圆形，全缘，下唇3裂，中央裂片较大，倒心脏形，花冠外被长绒毛，尤以上唇为甚；雄蕊4，2强，着生于花冠内面近裂口的下方；子房4裂，花柱与花冠上唇几等长，柱头2裂。小坚果褐色，三棱状，长约2毫米。花期6～8月。果期7～9月。\", \"wei\": \"辛苦，凉。\", \"liang\": \"内服：煎汤，3～6钱；熬膏或入丸、散。外用：煎水洗或捣敷。\", \"zhi\": \"①治疗急性肾小球性肾炎\" },\n  { \"name\": \"茺蔚子\", \"xing\": \"一年生或二年生草本，高60-100cm。茎直立，四棱形，被微毛。叶对生；叶形多种；叶柄长0.5-8cm。一年生植物基生叶具长柄，叶片略呈圆形，直径4-8cm，5-9浅裂，裂片具2-3钝齿，基部心形；茎中部叶有短柄，3全裂，裂片近披针形，中央裂片常再3裂，两侧裂片再1-2裂，最终片宽度通常在3mm以上，先端渐尖，边缘疏生锯齿或近全缘；最上部叶不分裂，，线形，近无柄，上面绿色，被糙伏毛，下面淡绿色，被疏柔毛及腺点。轮伞花序腋生，具花8-15朵；小苞片针刺状，无花梗；花萼钟形，外面贴生微柔毛，先端5齿裂，具刺尖，下方2齿比上方2齿长，宿存；花冠唇形，淡红色或紫红色，长9-12mm，外面被柔毛，上唇与下唇几等长，上唇长圆形，全缘，边缘具纤毛，下唇3裂，中央裂片较大，倒心形；雄蕊4，二强，着生在花冠内面近中部，花丝疏被鳞状毛，花药2室；雌蕊1，子房4裂，花柱丝状，略长于雄蕊，柱头2裂。小坚果褐色，三棱形，先端较宽而平截，基部楔形，长2-2.5mm，直径约1.5mm。花期6-9月，果期7-10月。\", \"wei\": \"味甘；辛；性微寒；上毒\", \"liang\": \"内服：煎汤，6-9g；或入丸、散；或捣绞取汁。\", \"zhi\": \"服食大量的茺蔚子后可发生中毒。据25例报告，一般服食20-30g后即可于4-10小时发病；但亦有人在10天内连续服至500g而始发病的。临床中毒症状为突然全身无力，下肢不能活动呈瘫痪状态，但神志、言语清楚，苔脉多正常。经中西医综合治疗均获恢复，无1例死亡。\" },\n  { \"name\": \"泽兰\", \"xing\": \"无\", \"wei\": \"苦、辛，微温。\", \"liang\": \"6～12g。\", \"zhi\": \"活血化瘀，行水消肿。用于月经不调，经闭，痛经，产后瘀血腹痛，水肿。\" },\n  { \"name\": \"牛膝\", \"xing\": \"多年生草本，高70-120cm。根圆柱形，直径5-10mm，土黄色。茎有棱角或四方形，绿色或带紫色，有白色贴生或开展柔毛，或近无毛，分枝对生，节膨大。单叶对生；叶柄长5-30mm;叶片膜质，椭圆形或椭圆状披针形，长5-12cm，宽2-6cm，先端渐尖，基部宽楔形，全缘，两面被柔毛。穗状花序项生及腋生，长3-5cm，花期后反折；总花梗长1-2cm，有白色柔毛；花多数，密生，长5mm；苞片宽卵形，长2-3mm，先端长渐尖；小苞片刺状，长2.5-3mm，先端弯曲，基部两侧各有1卵形膜质小裂片，长约1mm；花被片披针形，长3-5mm，光亮，先端急尖，有1中脉；雄蕊长2-2.5mm；退化雄蕊先端平圆，稍有缺刻状细锯齿。胞果长圆形，长2-2.5mm，黄褐色，光滑。种子长圆形，长1mm，黄褐色。花期7-9月，果期9-10月。\", \"wei\": \"苦；酸；性平\", \"liang\": \"内服：煎汤，5-15g；或浸酒；或入丸、散。外用：适量，捣敷；捣汁滴鼻；或研末撒入牙缝。\", \"zhi\": \"补肝肾；强筋骨；活血通经；引敌国（火）下行；利尿通淋。主腰膝酸痛；下肢痿软；血滞经闭；痛经；产后血瘀腹痛；征瘕；胞衣不下；热淋；血淋；跌打损伤；痈肿恶疮；咽喉肿痛\" },\n  { \"name\": \"川牛膝\", \"xing\": \"多年生草本，高50-100cm。主根圆柱状，皮近白色。茎略四棱，多分枝，疏生长糙毛。叶对生；叶柄长5-15mm；叶片椭圆形或狭椭圆形，少数倒卵形，长3-12cm，宽1.5-5.5cm，先端渐尖或尾尖，基部楔形或宽楔形，全缘，上面贴生长糙毛，下面毛较密。复聚伞花序密集成花球团；花球团多数，直径1-1.5cm，淡绿色，平时近白色，在枝端花序轴上交互对生，密集或相距2-3cm；复聚伞花序3-6次分歧；聚伞花序两性，花在中央，不育花在两侧；苞片卵形，长4-5mm，光亮，先端刺芒或钩状；不育花的花被片变成具钩的坚硬芒刺；两性花长3-5mm，花被片披针形，先端刺尖头，内侧3片较窄；花丝基部密生节状束毛，退化雄蕊长方形，长0.3-0.4mm，宽约为长的1／2，先端齿状浅裂；子房圆筒形或倒卵形，长1.3-1.8mm，花柱长约1.5mm，宿存，柱头头状。胞果椭圆形或倒卵形，长2-3mm，直径1-2mm，淡黄色，包裹在宿存花被内。种子椭圆形，透镜状，长1.5-2mm，带红色，光亮。花期6-7月，果期8-9月。\", \"wei\": \"甘；微苦；性平\", \"liang\": \"内服；煎汤，6～10g;或入丸、散；或泡酒。\", \"zhi\": \"活血祛瘀；祛风利湿。主血瘀经闭；难产；胞衣不下；产后瘀血腹痛；热淋；石淋；痛经；风湿腰膝疼痛\" },\n  { \"name\": \"鸡血藤\", \"xing\": \"无\", \"wei\": \"苦、甘，温。\", \"liang\": \"9～15g。\", \"zhi\": \"补血，活血，通络。用于月经不调，血虚萎黄，麻木瘫痪，风湿痹痛。\" },\n  { \"name\": \"王不留行\", \"xing\": \"一年或二年生草本，高30-70cm。全株平滑无毛，惟稍有白粉。茎直立，上部呈二叉状分枝，近基部节间粗壮而较短，节略膨大，表面是乳白色。单叶对生；无柄；叶片卵状椭圆形至卵状披针形，长1.5-7.5cm，宽0.5-3.5cm，先端渐尖，基部圆形或近心形，稍连合抱茎，全缘，两面均呈粉绿色，中脉在下面突起，近基部较宽。疏生聚伞花序着生于枝顶，花便细长，下有鳞片状小苞片2枚；花萼圆筒状，花后增大呈5棱状球形，顶端5齿裂；花瓣5，粉红色，倒卵形，先端有不整齐小齿；雄蕊10，不等长；子房上位，1室，花柱2。蒴果包干宿存花萼内，成熟后先端呈4齿状开裂。种子多数，暗黑色，球形，有明显的疣状突起。花期4-6月，果期5-7月。\", \"wei\": \"苦；性平\", \"liang\": \"内服：煎汤，6～10g。\", \"zhi\": \"活血通经；不乳消痈。主妇女经行腹痛；经闭；乳汁不通；乳痈；痈肿\" },\n  { \"name\": \"月季花\", \"xing\": \"月季花 矮小直立灌木。小枝粗壮而略带钩状的皮刺或无刺。羽状复叶，小叶3-5，宽卵形或卵状长圆形，长2-6cm，宽1-3cm，先端渐尖，基部宽楔形或近圆形，边缘有锐锯齿；两面无毛；叶柄及叶轴疏生皮刺及腺毛，托叶大部附生于叶柄上，边缘有腺毛或羽裂。花单生或数朵聚生成伞房状；花梗长，散生短腺毛；萼片卵形，先端尾尖，羽裂，边缘有腺毛；花瓣红色或玫瑰色，重瓣，直径约5cm，微香；花柱分离，子房被柔毛。果卵圆形或梨形，长1.5-2cm，红色。萼片宿存。花期4-9月。果期6-11月。\", \"wei\": \"甘；温；无毒\", \"liang\": \"内服：煎汤或开水泡服，3-6g，鲜品9-15g。外用：适量，鲜品捣敷患处，或干品研末调搽患处。\", \"zhi\": \"活血调经；解毒消肿。主月经不调；痛经；闭经；跌打损伤；瘀血肿痛；瘰疬；痈肿；烫伤\" },\n  { \"name\": \"凌霄花\", \"xing\": \"1.凌霄 薄叶木质藤本，借气根攀附于其服物上。茎黄褐色具棱状网裂。叶对生，厅数羽状复叶；叶轴长4-3cm；小叶柄长5-10mm，小叶7-9格，卵形至卵状披针形，长4-6cm，宽1.5-3cm，先端尾状渐尖，基部阔楔形，两侧不等大，边缘有粗锯齿，两面无毛，小叶柄着生处有淡黄褐色束毛。花序顶生，圆锥状，花大，直径4-5cm；花萼钟状，不等5裂，裂至筒之中部，裂片披针形；花冠漏斗状钟形，裂片5，圆形，橘红色，开展；雄蕊4，2长2短；子房上位，2室，基部有花盘。蒴果长如豆荚，具子房柄；2瓣裂。种子多数，扁平，有透明的翅。花期7-9月，果期8-10月。<br>2.美洲凌霄 本种形态上写凌霄相似，唯小叶9-11枚，椭圆形至卵状长圆形，先端尾尖。花萼5等裂，分裂较浅，约裂至三分之一，裂片三角形，向外微卷，无凸起的纵棱；花冠为细长的漏斗形，直径较凌霄小，橙红色至浓红色，内有明显的棕红色纵纹，筒部为花萼的3倍。花期7-10月，果期11月。\", \"wei\": \"味酸；性微寒\", \"liang\": \"内服：煎汤，3-6g；或入散剂。外用：适量，研末调涂；或煎汤熏洗。\", \"zhi\": \"清热凉血；化瘀散结；祛风止痒。主血滞经闭；痛经；症瘕；崩中漏下；血热风痒；疮疥陷疹；酒齄鼻。\" },\n  { \"name\": \"土鳖虫\", \"xing\": \"无\", \"wei\": \"咸，寒；有小毒。\", \"liang\": \"3～9g。\", \"zhi\": \"破瘀血，续筋骨。用于筋骨折伤，瘀血经闭，Y瘕痞块。\" },\n  { \"name\": \"马钱子\", \"xing\": \"马钱（《纲目》）\", \"wei\": \"苦，寒，有毒。\", \"liang\": \"内服：入丸、散，1～2分（一日量）。外用：醋磨涂，研末吹喉或调敷。\", \"zhi\": \"①治疗面神经麻痹\" },\n  { \"name\": \"自然铜\", \"xing\": \"无\", \"wei\": \"辛，平。\", \"liang\": \"3～9g，多入丸散服，若入煎剂宜先煎。外用适量。\", \"zhi\": \"散瘀，接骨，止痛。用于跌扑肿痛，筋骨折伤。\" },\n  { \"name\": \"苏木\", \"xing\": \"苏木 灌木或小乔木，高5-10。树干有刺。小枝灰绿色，具圆形突出的皮孔，新枝被柔毛。二回羽状复叶，长达40cm，羽片7-13对，对生，叶轴被柔毛；小叶9-17对，对生，长圆形至长圆状菱形，长约14mm，宽约6mm，先端钝形微凹，基部歪斜，全缘。上面绿色，无毛，下面具腺点，中脉偏斜。圆锥花序项生或腋生。长约与叶相等，被短柔毛；苞片大，披针形，早落；花梗长约15mm，被细柔毛；花托浅钟形；萼片5，稍不等，下面1片比较大，呈兜状；花瓣黄色，阔倒卵形，长约9mm，最上面1片基部带粉红色，具柄；雄蕊10，离生，2轮排列，稍伸出，花丝细，上部扭曲，下部密被柔毛；雌蕊1.花柱细长，子房有灰色绒毛，花柱被毛，柱头截平。荚果木质、稍压扁，近长圆形至长圆状倒卵形，长约7cm，宽3.5-4cm，基部稍狭，先端斜向平截，先端有喙，红棕色，不开裂。种子3-4颗，长圆形，稍扁，长约2cm，褐黄色。花期5-10月，果期7月至翌年3月。\", \"wei\": \"甘；咸；平；无毒\", \"liang\": \"内服：煎汤，3-9g,或研末。外用：适量，研末撒。\", \"zhi\": \"活血祛瘀，消肿定痛。主妇人血滞经闭，痛经，产后瘀阻心腹痛，产后血晕，痈肿，跌打损伤，破伤风\" },\n  { \"name\": \"骨碎补\", \"xing\": \"①槲蕨，又名：崖姜、岩连姜、爬岩姜、肉碎补、石碎补、飞天鼠、牛飞龙、飞来风、飞蛾草。<br>附生草本，高20～40厘米。根状茎肉质粗壮，长而横走，密被棕黄色、线状凿形鳞片。叶二型，营养叶厚革质，红棕色或灰褐色，卵形，无柄，长5～6.5厘米，宽4～5.5厘米，边缘羽状浅裂，很象槲树叶；孢子叶绿色，具短柄，柄有翅，叶片矩圆形或长椭圆形，长20～37厘米，宽8～18.5厘米，羽状深裂，羽片6～15对，广披针形或长圆形，长4～10厘米，宽1.5～2.5厘米，先端急尖或钝，边缘常有不规则的浅波状齿，基部2～3对羽片缩成耳状，两面均无毛，叶脉显著，细脉连成4～5行长方形网眼。孢子囊群圆形，黄褐色，在中脉两侧各排列成2～4行，每个长方形的叶脉网眼中着生1枚，无囊群盖。<br>附生于树上、山林石壁上或墙上。分布浙江、福建、台湾、广东、广西、江西、湖北、四川、贵州、云南等地。<br>②中华槲蕨<br>附生草本，高20～40厘米。根状茎密被棕色有亮光的披针状钻形鳞片。叶二型，营养叶稀少，红棕色，无柄，矩圆披针形，长9～10厘米，宽4～9厘米，羽状深裂，裂片长圆形或三角状披针形，长2～4.5厘米，宽约0.8～1.3厘米，先端钝或急尖，下部裂片缩短，上面被毛，下面无毛；孢子叶绿色，具长柄，柄淡棕红色，有狭翅，叶片长圆形或长圆状披针形，长20～40厘米，宽6.5～13厘米，羽状深裂几达中轴，羽片14～25对，长圆形或广线状披针形，宽1～1.4厘米，先端钝圆或急尖，下部羽片缩短或成耳状，叶片两面均疏被短毛，叶脉显著联结成网状，有内藏细脉。孢子囊群圆形，直径约2.5毫米，黄棕色，在中脉两侧各排列成一行，无囊群盖。<br>生于高山地带的石上或树上。分布青海、甘肃、陕西、四川、云南等地。<br>以上两种植物根茎上的鳞片（骨碎补毛）亦供药用，另详专条。<br>③石莲姜槲蕨，又名：近邻槲蕨。<br>附生多年生草本，高达60厘米。根茎肉质粗肥，横走，密生披针形或卵状披针形鳞片，其边缘有睫毛。叶二型，无毛，营养叶淡棕色，革质，阐卵形，长8～16厘米，宽6～10厘米，羽裂深1/2～2/3；孢子叶柄长8～20厘米，叶片长25～45厘米，宽20～30厘米，矩圆形或矩圆状卵形，羽状深裂达叶轴；裂片互生，下部一二对略短或不缩短，中部的长12～18厘米，宽1.5～2.5厘米，渐尖头，边缘有疏浅缺刻，网状叶脉明显。孢子囊群在主脉两侧各排成整齐的一行，靠近主脉，无囊群盖。<br>附生山区树干或岩石上，分布四川、云南、贵州和广西。<br>④崖姜<br>附生多年生草本，高60～150厘米。根茎肉质粗厚，横走，密生棕色长条形有睫毛的鳞片。叶簇生，无柄，光滑，硬革质，长圆状披针形，中部宽15～25厘米，羽状深裂，向下部渐狭，中部以上的裂片长10～20厘米，宽约3厘米，全缘，无毛，先端长尾状渐尖，基部有关节，叶脉明显，网状，网眼有分离的内藏小脉。孢子囊群生于靠近侧脉的网眼上边和内藏小脉的交叉点上，近圆形或长圆形，成熟时呈断线形，无囊群盖。<br>附生于雨林或季雨林中的岩石或树干上。分布广东、广西，台湾和云南。<br>⑤光亮密网蕨，详猪毛蕨条。<br>⑥大叶骨碎补，又名：硬骨碎补、华南骨碎补。<br>多年生草本，高达1米。根状茎粗壮横走，连同叶柄基部密生披针形、膜质、棕色鳞片。叶近生，纸质，无毛；叶柄及叶轴棕色；叶片三角形，长宽各约60～90厘米，4回或5回羽状分裂，顶部渐尖并为羽裂；羽片互生，有柄，基部一对最大，中部以上逐渐变小；小羽片有短柄，连同小羽轴有狭翅；末回裂片斜三角形，常二裂成不等长的尖齿。孢子囊群生于小脉中部稍下的弯弓处，或生于小脉分叉处；囊群盖盅形。<br>附生于岩石或树干上。分布广东、广西、台湾、云南。<br>⑦海州骨碎补<br>多年生草本，高15～20厘米。根茎长而横走，密生阔披针形的鳞片，边缘有不规则细锯齿。叶远生，叶柄硬直，长约10厘米；叶片三角状五边形，长宽几相等，约8～14匝米，4回羽状细裂，基部一对羽片最大，长宽各约5～7厦米；末回裂片长圆形，宽1.5～2毫米，钝尖，顶部二裂为不等长的粗钝齿，叶脉单一或交叉，每齿有小脉1条。孢子囊群生于小脉顶端，囊群盖盅状，向边缘开口，成熟时孢子囊突出口外，覆盖裂片顶部，仅霉出外侧的长钝齿。<br>附生于石山。分布辽宁、山东、江苏、浙江和台湾。\", \"wei\": \"苦，温。<br>①《日华子本草》：平。<br>②《开宝本草》：味苦，温，无毒。<br>③《广西中药志》：甘微苦涩，温。\", \"liang\": \"内服：煎汤，3～5钱；浸酒或入丸、散。外用：捣敷。\", \"zhi\": \"补肾，活血，止血。治肾虚久泻及腰痛，风湿痹痛，齿痛，耳鸣，跌打闪挫、骨伤，阑尾炎，斑秃，鸡眼。<br>①《药性论》：主骨中毒气，风血疼痛，五劳六极，口（一作’足’）手不收，上热下冷。<br>②《日华子本草》：治恶疮，蚀烂肉，杀虫。<br>③《开宝本草》：主破血，止血，补伤折。<br>④《本草正》：疗骨中邪毒，风热疼痛，或外感风湿，以致两足痿弱疼痛。<br>⑤《本草述》：治腰痛行痹，中风鹤膝风挛气证，泄泻，淋，遗精，脱肛。<br>⑥《广西中药志》：治小儿疳积。<br>⑦《四川中药志》：泄湿，通经。\" },\n  { \"name\": \"血竭\", \"xing\": \"麒麟竭，多年生常绿藤本，长达10-20m。茎被叶鞘并遍生尖刺。羽状复叶在枝梢互生，在下部有时近对生；小叶互生，线状披针形，长约20-30cm，宽约3cm，先端锐尖，基部狭，脉3出平行；叶柄及叶轴具锐刺。肉穗花序，开淡黄色的冠状花，单性，雌雄异株；花被6，排成2轮；雄花雄蕊6，花药长锥形；雌花有不育雄蕊6，雌蕊1，瓶状，子房略呈卵状，密被鳞片，花柱短，柱头3深裂。果实核果状，卵状球形，径约2-3cm，赤褐色，具黄色鳞片，果实内含深赤色的液状树脂，常由鳞片下渗出，干后如血块样。种子1颗。\", \"wei\": \"味甘；咸；性平；小毒\", \"liang\": \"内服：研末，1-1.5g，或入丸剂。外用：适量，研末调敷或入膏药内敷贴。\", \"zhi\": \"散瘀定痛；止血；生肌敛疮。主跌打损伤；内伤瘀痛；痛经；产后瘀阻腹痛；外伤出血不止；瘰疬；臁疮溃久不合及痔疮\" },\n  { \"name\": \"儿茶\", \"xing\": \"落叶乔木，高6～13米。小枝细，有棘刺。叶为二回双数羽状复叶，互生；叶轴基部有棘针双生，扁平状；叶轴上着生羽片10～20对；每羽片上具小叶30～50对，小叶条形，两面被疏毛。8～9月开花，总状花序腋生，花萼基部连合成筒状，上部分裂，有疏毛；花瓣5，长披针形，黄色或白色；雄蕊多数，伸出花冠之外；雌蕊1，子房上位，长卵形。荚果扁而薄，连果梗长6～12厘米，宽1～2厘米，种子7～8粒。\", \"wei\": \"苦、涩，微寒。\", \"liang\": \"0.3～1钱；外用适量。\", \"zhi\": \"清热化痰，敛疮止血。用于肺热咳嗽，咯血，腹泻，小儿消化不良；外用治疮疡久不收口，皮肤湿疹，口疮，扁桃体炎。\" },\n  { \"name\": \"刘寄奴\", \"xing\": \"多年生直立草本，高60～100厘米。茎有明显纵肋，被细毛。叶互生；长椭圆形或披针形，长6～9厘米，宽2～4厘米，先端渐尖，基部狭窄成短柄，边缘具锐尖锯齿，上面绿色，下面灰绿色，有蛛丝毛，中脉显着；上部叶小，披针形，长约1.5厘米；下部叶花后雕落。头状花序，钟状，长约3毫米，密集成穗状圆锥花丛；总苞片4轮，淡黄色，无毛，覆瓦状排列；外层花雌性，管状，雌蕊1；中央花两性，管状，先端5裂，雄蕊5，聚药，花药先端有三角状附属物，基部有尾，雌蕊1，柱头2裂，呈画笔状。瘦果矩圆形。花期7～9月。果期8～10月。\", \"wei\": \"苦，温。\", \"liang\": \"内服：煎汤，1.5～3钱；或入散剂。外用：捣敷或研末撒。\", \"zhi\": \"①治疗急性传染性肝炎\" },\n  { \"name\": \"莪术\", \"xing\": \"多年生草本，全株光滑无毛。叶椭圆状长圆形至长圆状披针形，长25～60cm,宽10～15cm，中部常有紫班；叶柄较叶片为长。花茎由根茎单独发出，常先叶而生；穗状花序长约15cm；苞片多数，下部的绿色，缨部的紫色；花萼白色，顶端3裂；花冠黄色，裂片3，不等大；侧生退化雄蕊小；唇瓣黄色，顶端微缺；药隔基部具叉开的矩。蒴果狼状三角形。花期3～5月。\", \"wei\": \"苦辛，温。入肝、脾经。\", \"liang\": \"内服：煎汤，1.5-3钱；或入丸、散。\", \"zhi\": \"破血行气，消积止痛。用于血瘀腹痛、肝脾肿大、心腹胀痛，积聚，妇女血瘀经闭，跌打损伤作痛饮食积滞。（1）行气止痛，破血消积：用于气滞血瘀之经闭、胸胁痛、腹痛及症瘕肿块等。常配三棱。（2）消食化积：用于饮食积滞之胃腹胀痛，常配焦麦芽、焦槟榔。\" },\n  { \"name\": \"三棱\", \"xing\": \"多年生草本，高60～100厘米，植株质地疏松呈海绵质，绿色。根状茎圆柱形，横走于泥中，下生粗短的块茎及多数须根，茎直立，圆柱形。叶丛生，排成2列，长条形，长60～95厘米，宽8～14毫米，先端钝，全缘，中脉在下面突出成棱，基部鞘状，三棱形，抱茎。6～7月间从叶丛间生出花萼，不分枝或分枝，具叶状苞片，花单性，雌雄同株，花密集成圆头状，排成疏离穗状花序，雄花在上，雌花在下；花被3～4片，雄花具有3雄蕊，雌花具单心皮雌蕊，或少为2个离生的单雌蕊。果为核果状，具棱角。\", \"wei\": \"苦，平。\", \"liang\": \"1～3钱。\", \"zhi\": \"破血，行气，消积，止痛。主治：闭经，瘀血作痛，腹胀或有积块。\" },\n  { \"name\": \"水蛭\", \"xing\": \"1.日本医蛭，体长30-50mm，宽4-6mm。背面呈黄绿色或黄褐色，有5条黄白色的纵纹，但背部和纵纹的色泽变化很大。背中线的一条纵纹延伸至后吸盘上。腹面暗灰色，无斑纹。体环数103。雄性和雌性的生殖孔分别位于第31-32、第36-37环沟，两孔相间5球。阴茎露出时呈细线状。眼5对，排列成马蹄形。口内有3个腭，腭背上有1列细齿，后吸盘呈碗状，朝向腹面。\", \"wei\": \"味咸；苦；性平；有毒\", \"liang\": \"内服：煎汤，3-9g；或入丸、散，每次 0.5-1.5g，大剂量每次3g。\", \"zhi\": \"破血逐瘀；通经消症。主血瘀经闭；症瘕痞块；跌打损伤\" },\n  { \"name\": \"虻虫\", \"xing\": \"1.华虻，雌虫体长16-18mm，灰黑色。前额黄灰色，基胛近卵圆形，黄棕色。触角第1环节基部棕红色，有明显锐有突起，翅透明，翅脉棕色。胸部背板灰色，有5条明显黑灰纵带。腹部圆钝形，有明显的白斑。雄虫与雌虫相似，较雌虫稍大，仅腹部呈圆锥形。<br>2.双斑黄虻，雌虫体长13-17mm，黄绿色。眼大型，中部有一条细窄的黑色横带。前额黄色或略带淡灰色。触角橙黄色，第3节有明显钝角突。翅透明，翅脉黄色。腹部暗黄灰色，多金黄色毛及少数黑毛。背板两侧具大块黄色斑，腹板灰色。雄虫与雌虫相似，但体较小。\", \"wei\": \"味苦；微咸；性凉；有毒\", \"liang\": \"内服：煎汤，1.5g-3g；研末，0.3-0.6g；或入丸剂。外用：适量，研末敷或调搽。\", \"zhi\": \"破血通经；逐瘀消症。主血瘀经闭；产后恶露不尽；干血痨；少腹蓄血；症瘕积块；跌打伤痛；痈肿；喉痹\" },\n  { \"name\": \"斑蝥\", \"xing\": \"1.南方大斑蝥，体长15-30mm。全体被黑毛。头圆三角形，具粗密刺点。复眼大，略呈肾形。触角1对。前胸长稍大于宽。鞘翅端部宽于基部，底色黑色。每翅基部各有2个大黄斑，翅中央前后各有一黄色波纹状横带。翅面黑色部分刻点密集，黄色部分 刻点甚粗。\", \"wei\": \"味辛；性温；大毒\", \"liang\": \"内服：炒炙研末，每次量0.03-0.06g；或入丸剂。外用：适量，研末敷贴发泡，酒、醋浸或制成膏涂。\", \"zhi\": \"1.治疗风湿痛、神经痛等：用斑蝥贴敷穴位治疗四肢关节、腰背部的风湿痛(包括职业性良性关节炎、肌纤维炎、风湿性关节炎、因神经血管疾病或外伤而引起的关节疼痛等)及神经痛(肋间神经痛、三叉神经痛、手术或外伤颜瘢痕区的反射性神经痛等)、传染性肝炎恢复期的肝区痛等，均有一定的近期疗效。据数百例的观察，有效率在90%以上。大多数患者经 1-3次治疗后，症状即消失或有不同程度的改善，尤以对急性风湿痛疗效显着。对增生性关节炎无明显效果，对有明显不可逆性的关节病变亦不适用。\" },\n  { \"name\": \"穿山甲\", \"xing\": \"无\", \"wei\": \"咸，微寒。\", \"liang\": \"5～9g,一般炮炙后用。\", \"zhi\": \"通经下乳，消肿排脓，搜风通络。用于经闭L瘕，乳汁不通，痈肿疮毒，关节痹痛，麻木拘挛。\" }] },\n\n{\n  \"name\": \"化痰止咳平喘药\",\n  \"num\": 52,\n  \"content\": [\n  { \"name\": \"半夏\", \"xing\": \"半夏，又名：三叶半夏。多年生小草本，高15～30厘米。块茎近球形。叶出自块茎顶端，叶柄长6～23厘米，在叶柄下部内侧生一白色珠芽；一年生的叶为单叶，卵状心形；2～3年后，叶为3小叶的复叶，小叶椭圆形至披针形，中间小叶较大，长5～8厘米，宽3～4厘米，两侧的较小，先端锐尖，基部楔形，全缘，两面光滑无毛。肉穗花序顶生，花序梗常较叶柄长；佛焰苞绿色，长6～7厘米；花单性，无花被，雌雄同株；雄花着生在花序上部，白色，雄蕊密集成圆筒形，雌花着生于雄花的下部，绿色，两者相距5～8毫米；花序中轴先端附属物延伸呈鼠尾状，通常长7～10厘米，直立，伸出在佛焰苞外。浆果卵状椭圆形，绿色，长4～5毫米。花期5～7月。果期8～9月。\", \"wei\": \"辛，温，有毒。\", \"liang\": \"内服：煎汤，1.5～3钨；或入丸、散。外用：研末调默。\", \"zhi\": \"①治疗呕吐\" },\n  { \"name\": \"半夏曲\", \"xing\": \"无\", \"wei\": \"《饮片新参》：\\\"苦辛，平。\\\"\", \"liang\": \"内服：煎汤（纱布包煎），2～3钱。\", \"zhi\": \"《饮片新参》：\\\"化痰止咳，消食积，治泄泻。\\\"\" },\n  { \"name\": \"天南星\", \"xing\": \"1.虎掌, 多年生草本。1-2年生块茎近圆球形，三年以上块茎由于侧生2-5个乳头状小块茎而呈扁柿形，直径达6cm。叶自芽眼抽出，2-6丛生；叶片鸟足状分裂，裂片5-13，卵状披针形或椭圆状披针形，中裂片比例裂片长大，长15-18cm，宽约3cm。花序便2-4，亦自芽眼抽出，长15-30cm；佛焰苞为匙状披针形，问下渐变细，色质如叶，宿存响穗花序雌花序轴部分与佛焰苞贴生，长1-3cm，外侧着花；雄花序轴部分游离，长5-7mm；小花密集，黄色；附属器形如鼠尾，长达15cm。浆果卵形，熟时绿白色，易脱落布地，当年发芽长出新株。花期5-7月，果期6-10月。<br>2.大南星，多年生草本。块茎近圆球形，直径2-5cm。叶常单一；叶柄卜部鞘状，下部具膜质鳞叶2-3；叶片鸟足状分裂，裂片11-19，线状长圆形或倒被外形，中裂片比两侧短小。花序柄从叶柄中部分出；佛焰苞管部长3-6cm，绿白色，喉部截形，外线反卷，檐部卵状披针形，有时下弯呈盔状，淡绿色全淡黄色；向穗花序袖与佛焰苞完全分离；肉穗花序两性或雄花序单性；两性花序下部雌花序长约2cm，花密，上都雄花序长约3cm，花疏；单性雄花序长3-5cm，粗3-5mm；附属器基部直径0.5-1cm，长达20cm，伸出佛焰苞喉部后呈之字形上升。果序近圆锥形，浆果熟时红色，佛焰苞枯萎而效果序裸露。种子黄红色。花期4-5月，果期6-9月。<br>3.一把伞南星，多年生草本。块茎近圆球形，直径达6cm。鳞叶紫红色或绿白色，间有褐色斑块。叶单一；柄长达70cm，中部以下具叶鞘；叶片放射状分裂，裂片7-20，披计形或长圆形，长7-24cm ，宽1-4cm，长渐尖或延长为线尾状。花序柄自叶辆中部分出，短于叶柄；佛焰苞颜色多样，绿色问有白色条纹或淡紫色至深紫色中夹杂着绿色、白色条纹；喉部扩展，边缘外卷，檐部宽大，三角状卵形至长圆卵形，光瑞延伸为长达15cm的线尾；肉穗花序；雌花序轮在下部，中性花序轴位于中段，紧接雄花序轴，其上为长约5cm的棒状附属器。果序成熟时裸露，浆果红色。种子1-2，球形，淡褐色。花期4-6月，果期8-9月。<br>4.东北天南星，与天南星及一把伞南星的区别为：本叶；叶柄长17-30cm，下部1/3具鞘，紫色；叶片鸟足状分裂，裂片5，倒卵状被针形或椭圆形，先端短渐尖或锐尖，基部楔形，中裂片具长约2cm的柄，长7-12cm，宽4-7cm，例裂片具长约1cm。共同的柄，全缘。花序柄短于叶柄，佛焰苞绿色或紫色具白色条纹；肉穗花序单件；雄花序年约2cm，花疏；雌花序长约1cm；各附属器具短柄，棒状。浆果红色；种子4颗，红色。肉穗花序轴常于果期增大，果落后紫红色。\", \"wei\": \"味苦；辛；性温；有毒\", \"liang\": \"内服：煎汤，3-9g，一般制后用：或入丸散。外用：生品适量，研末以醋或酒调敷。\", \"zhi\": \"祛风止痉；化痰散结。主中风痰壅；口眼歪任意；半身不遂；手足麻痹；风痰眩晕；癫闲；惊风；破伤风；咳嗽多痰；痈肿；瘰疬；跌打麻痹；毒蛇咬伤\" },\n  { \"name\": \"胆南星\", \"xing\": \"无\", \"wei\": \"苦、微辛，凉。\", \"liang\": \"3～6g。\", \"zhi\": \"清热化痰，息风定惊。用于痰热咳嗽，咯痰黄稠，中风痰迷，癫狂惊痫。\" },\n  { \"name\": \"白附子\", \"xing\": \"无\", \"wei\": \"辛，温；有毒。\", \"liang\": \"一般炮制后用，3～6g。外用生品适量捣烂，熬膏或研末以酒调敷患处。\", \"zhi\": \"祛风痰，定惊搐，解毒散结止痛。用于中风痰壅，口眼歪斜，语言涩謇，痰厥头痛，偏正头痛，喉痹咽痛，破伤风；外治瘰疬痰核，毒蛇咬伤。\" },\n  { \"name\": \"关白附\", \"xing\": \"黄花乌头，又名：山啦叭花、鼠尾草、两头菜、药虱子草、白花子、乌拉花。<br>多年生草本。块根倒卵形或纺锤形，常2个连生。茎直立，高50～120厘米。叶互生，有柄；叶片3～5掌状全裂，裂片再2回羽状分裂，最终裂片线形，先端锐尖，宽约2毫米。总状花序顶生，小花梗长0.5～4厘米；萼片5，花瓣状，淡黄色，外面密被微柔毛，上萼片船状盔形，长1～2厘米，侧萼片圆形；花瓣2，紧贴盔瓣下；雄蕊多数；心皮3个，扁卵形，密被白茸毛。u果3～5，疏被白毛。种子有棱，棱处具翅。花期8～9月。果期10月。\", \"wei\": \"辛甘，热，有毒。<br>①《海药本草》：大温，有小毒。<br>②《蜀本草》：味甘辛，温。<br>③《珍珠囊》：辛苦，纯阳。\", \"liang\": \"内服：0.5～2钱。外用：酌量。\", \"zhi\": \"祛风痰，逐寒湿，定惊痫。治中风痰壅，口眼歪斜，头痛，癫痫，风湿痹痛，破伤风，疮疡疥癣，皮肤湿痒。<br>①《别录》：主心痛，血痹，面上百病，行药势。<br>②《海药本草》：主治疥癣，风疮，头面痕，阴囊下湿，腿无力，诸风冷气。<br>③《日华子本草》：主中风失音，一切冷风气。<br>④王好古：补肝风虚。<br>⑤朱震亨：治风痰。<br>⑥《品汇精要》：主小儿惊风。<br>⑦《本草原始》：身背汗斑疥癣并治之。<br>⑧《本草汇言》：祛风痰，解风毒，善散面口风。<br>⑨《本草述》：主治中风痰饮头痛，行著痹，痿厥疠风，颤振眩晕，痫证悸疝诸证。<br>⑩《本草择要纲目》：治小儿毒暑入心，痰塞心孔，昏迷搐搦。<br>⑾《玉楸药解》：驱风泄湿，逐痹行痰。治中风失音，鼻口偏抖，耳聋，喉痹，行痰止唾。<br>⑿《中药学》：治偏正头痛，破伤风。\" },\n  { \"name\": \"芥子\", \"xing\": \"无\", \"wei\": \"辛，热。\", \"liang\": \"内服：煎汤，1～3钱；或入丸、散。外用：研末调敷。\", \"zhi\": \"温中散寒，利气豁痰，通经络，消肿毒。治胃寒吐食，心腹疼痛，肺寒咳嗽，痛痹，喉痹，阴疽，流痰，跌打损伤。\" },\n  { \"name\": \"皂荚\", \"xing\": \"皂荚 乔木，高达15cm。刺粗壮，通常分枝，长可达16cm，圆柱形。小枝无毛。一回偶数羽状复叶，长12-18cm；小叶6-14片，长卵形、长椭圆形至卵状披针形，长3-8cm，宽1.5-3.5cm，先端钝或渐尖，基部斜圆形或斜楔形，边缘有细锯齿，无毛。花杂性，排成腋生的总状花序；花萼钟状，有4枚披针形裂片；花瓣4，白色；雄蕊6-8；子房条形，沿缝线有毛。荚果条形，不扭转，长12-30，宽2-4cm，微厚，黑棕色，被白色粉霜。花期4-5月，果期9-10月。\", \"wei\": \"辛；咸；温；有毒\", \"liang\": \"内服：1-3g，多入丸、散。外用：适量，研末搐鼻；或煎水洗；或研末掺或调敷；或熬膏涂；或烧烟熏。\", \"zhi\": \"祛痰止咳；开窍通闭；杀虫散结。主痰咳喘满；中风口噤；痰涎壅盛；神昏不语；癫痫；喉痹；二便不通；痈肿疥癣\" },\n  { \"name\": \"皂角刺\", \"xing\": \"1.皂荚 乔木，高达15cm。刺粗壮，通常分枝，长可达16cm，圆柱形。小枝无毛。一回偶数羽状复叶，长12-18cm；小叶6-14片，长卵形、长椭圆形至卵状披针形，长3-8cm，宽1.5-3.5cm，先端钝或渐尖，基部斜圆形或斜楔形，边缘有细锯齿，无毛。花杂性，排成腋生的总状花序；花萼钟状，有4枚披针形裂片；花瓣4，白色；雄蕊6-8；子房条形，沿缝线有毛。荚果条形，不扭转，长12-30，宽2-4cm，微厚，黑棕色，被白色粉霜。花期4-5月，果期9-10月。<br>2．山皂荚 乔木，高可达25m。刺略扁，长5-10cm，常有分枝。幼枝淡紫色。一回偶数羽状复叶，长25-30cm；小叶8-12对，长椭圆形或卵状长椭圆形，长l-4cm，全缘或有疏圆齿，上面有光泽，中助上有短柔毛，下面无毛；长枝上为二回偶数现状复叶，有3-6对羽片；小叶5-10对，狭卵形、卵状长圆形或卵状披针形；叶轴有短柔毛。细长总状花序；花有短梗；杂性异株，花黄绿色；雄蕊花瓣椭圆形，雄蕊8；两性花的雄蕊较小。荚果长25-30cm，宽2-3.5cm，扭曲，并有泡状隆起，种子靠近中部；种子卵状椭形，稍扁，栗褐色。花、果期6-11月。\", \"wei\": \"辛；温\", \"liang\": \"内服：煎汤，3-9g；或入丸、散。外用：适量，醋煎涂，或研末撒，或调敷。\", \"zhi\": \"消毒透脓；搜风；杀虫。主痈疽肿毒；瘰疬；疮疹顽癣；产后缺乳；胎衣不下；疠风\" },\n  { \"name\": \"旋覆花\", \"xing\": \"多年生直立草本，茎高20～60cm，不分枝，有平伏毛。基生叶及下部叶较小，中部叶披针形、长椭圆状披针形或长圆形，长5～10cm ,宽1～3cm，先端锐尖，基部急狭，无柄或半抱茎，全缘，两面有疏毛。头状花序直径2.5～3cm，多个排成伞房花序，总苞半球形，绿黄色；舌状花1层，黄色，管状花多数，密集。花期7～10月，果期8～11月。\", \"wei\": \"无\", \"liang\": \"无\", \"zhi\": \"降气，消痰，行水，止呕。\" },\n  { \"name\": \"金沸草\", \"xing\": \"无\", \"wei\": \"苦、辛、咸，温。\", \"liang\": \"4.5～9g。外用鲜品适量，捣汁涂患处。\", \"zhi\": \"降气，消痰，行水。用于风寒咳嗽，痰饮蓄结，痰壅气逆，胸膈痞满，喘咳痰多；外治疔疮肿毒。\" },\n  { \"name\": \"白前\", \"xing\": \"1.多年生直立半灌木，高0.5-1cm。根茎横生或斜生，空如鹅管状，系极发达，根多而细，呈须状，黄白色或略带红棕。茎圆柱形，表面灰绿色，有细棱。叶对生，具短柄；叶片纸质，披针形或线状披针形，长3-12cm，宽0.3-1.4cm,先端渐尖，基部渐窄，全缘，中脉在叶背明显，侧脉约6对。伞形聚伞花序腋生，有3-8朵，小苞片多数；花萼5深裂，内面基部腺体不多；花冠辐状，5深裂，裂片线形，紫红色，内面具长柔毛；副花冠裂征盾状，肥厚，较花药为短；雄蕊5，与雌蕊合生成蕊柱，花药2室每室具一淡黄色下垂的花粉块；柱头微突，包在花药的薄膜内。蓇葖果单生，窄长披针形，长达9cm。种子披针形，黄棕色。先端具白色丝状绢毛。花期5-8月，果期9-10月。\", \"wei\": \"辛甘；微温；无毒\", \"liang\": \"内服：煎汤3-10g；或入丸、散\", \"zhi\": \"泻肺降气；下痰止嗽。主主冶肺气壅实之咳嗽痰多；气逆喘促；胃脘疼痛；儿疳积；跌打损伤\" },\n  { \"name\": \"猫爪草\", \"xing\": \"多年生小草本。幼株疏被灰白色的细柔毛，后变秃净或稍具柔毛。块根肉质，纺锤形，常数个聚集。茎高5～15厘米，具分枝；基生叶为3出复叶或3深裂，小叶片卵圆形或阔倒卵形，长0.5～1.5厘米，宽0.5～1厘米，先端3浅裂或齿裂，基部楔形，有时裂成线形或线状披针形，中央裂片较两侧者略大；具叶柄，柄长3～6厘米，基部扩大，边缘膜质；茎生叶互生，通常无柄，3裂，裂片线形，长约1.5厘米，宽约1毫米。花单生于茎端，与叶对生，直径达1.5厘米，花柄长0.5～2厘米，有短细毛：萼片5，长圆形或倒卵形，膜质，绿色，边缘淡黄色，向下反曲，外有细毛；花瓣5，阔倒卵形，黄色，无毛；雄蕊多数，花药长圆形，纵裂，花丝扁平；心皮多数，离生，丛集于膨大的花托上；柱头短小，单一。聚合果球形；瘦果扁卵形，细小，表面淡棕色，平滑，顶端有短喙。花期4～5月。果期5～6月。\", \"wei\": \"甘辛，温。\", \"liang\": \"内服：煎汤，0.5～1两。外用：研末撒。\", \"zhi\": \"治疗颈淋巴结结核:以内服猫爪草煎剂（或酊剂）为主，辅以补气养血中药，结合外科切开引流、搔爬手术，局部敷用各种猫爪草制剂，治疗单纯型、混合感染型、溃疡型、瘘管型颈淋巴结结核180例，经2～3个月的治疗，获临床治愈者134例，显着有效者32例，好转者14例。制剂及用法：㈠内服药：猫爪草150克，加水500毫升，文火煎半小时，临睡前冲黄酒2～4两同服，每日1剂。或用25％酊剂，日服3次，每次10毫升。均以3日为一疗程，间隔3～5天给下一疗程。间隔期对体质衰弱者服八珍汤，对有溃疡或瘘管者服益气养荣汤，连服2～3剂。㈡外敷药：10％猫爪草提出液，浸无菌纱条，用于坏死组织或干酪样物质较多的溃疡创面或凄管；30％猫爪草软膏，用于有混合感染或已形成溃疡的患处；或制成猫爪草凡士林纱条，适于引流或填塞瘘管之用。治疗过程中未发现不良副作用。曾对124例在1～2年内随访，观察远期疗效，复发者4例，均为远位复发。猫爪草也可制成注射液，供肌肉注射，每次2～4毫升，每日2次，仍结合局部常规处理。观察110例，治愈率90％。\" },\n  { \"name\": \"川贝母\", \"xing\": \"1.暗紫贝母 多年生草本，高15-25cm。鳞茎球形或圆锥形，由2枚鳞片组成，直径6-8mm。茎直立，单一，无毛。叶在下面的1-2对为对生，上面的1-2枚散生或对生，无柄，条形或条状披针形，长3.6-6.5cm；宽3-7mm，先端急尖，不卷曲。花单生于茎顶，深黄色，有黄褐色小方格；叶状苞片1枚，先端不卷曲；花被片6，2轮，长2.5-2.7cm，内3片倒卵状长圆形，宽约1cm，外3片近长圆形，宽约6mm；蜜腺窝稍凸出或不很明显；雄蕊6，长约为花被片的一半，花药近基着生，花丝具或不具小乳突；柱头3裂，裂片短而外展，长0.5-1mm。蒴果长圆形，长1-1.5cm，宽1-1.2cm，具6棱，棱上的翅很窄，宽约1mm。花期6月，果期8月。 2.卷叶贝母 多年生草本，植物形态变化较大。鳞茎卵圆形，由2枚鳞片组成，直径1-1.5cm叶通常对生，少数在中部兼有散生或轮生；叶片条形至条状披针形，先端稍卷曲或不卷曲。花单生茎顶，紫色至黄绿色，通常有小方格，少数仅有斑点或条纹；每花有3枚叶状苞片，狭长，宽2-4mm；花被片6，长3-4cm，外轮3片，宽1-1.4cm，内轮3片近倒卵形或椭圆状倒卵形，宽可达1.8cm；蜜腺窝在背面明显凸出；雄蕊长约为花被片的3/5，花药近基着生，花丝多少具小乳突；柱头裂片长3-5mm。蒴果棱上具宽1-1.5mm的窄翅。花期5-7月，果期8-10月。 3.棱砂贝母 多年生草本，高17-35cm。鳞茎长卵圆形，由2（-3）枚鳞片组成，直径1-2cm。叶互生，3-5枚（包括叶状苞片）较紧密地生于植株中部或上部； 叶片狭卵形至卵状椭圆形，长2-7cm，宽1-3cm，先端不卷曲。单花顶生，宽钟状，略俯垂，浅黄色，具红褐色斑点或小方格；花被片长3.2-4.5cm，宽1.2-1.5cm，内三片比外三片稍长而宽；雄蕊长约为花被片的一半，花丝不具小乳突；柱头裂片长约1mm。蒴果棱上的翅宽约1mm，宿存花被常多少包住蒴果。花期6-7月，果期8-9月。 4.甘肃贝母 多年生草本，高20-40cm。鳞茎圆锥形，由2枚鳞片组成，直径6-13mm。叶通常最下面的2枚对生，上面的2-3枚散生；叶片条形，长3-7cm，宽3-4mm，先端通常不卷曲。单花顶生，稀为2朵，浅黄色，有黑紫色斑点；叶状苞片1枚，先端稍卷曲或不卷曲；花被片长2-3cm，内3片宽6-7mm，蜜腺窝不很明显；雄蕊长约为花被片的一半；花丝具小乳突；柱头裂片长不及1mm。蒴果棱上具宽约1mm的窄翅。花期6-7月，果期8月。 5.康定贝母 与卷叶贝母相似，但植株和鳞茎常较大。叶除最下面的1-2对为对生外，余多为散生，先端不卷曲。叶状苞片通常1枚，极少为3枚。花具明显的紫色方格斑。\", \"wei\": \"味甘、苦；性微寒\", \"liang\": \"内服：煎汤，3-9g；研末，1-1.5g；或入丸、散。外用：适量，研末撒；或调敷\", \"zhi\": \"清热润肺；化痰止咳；散结消肿。主肺虚；久咳；虚劳咳嗽；燥热咳嗽；肺痈；瘰疬；痈肿；乳痈\" },\n  { \"name\": \"平贝母\", \"xing\": \"平贝母 草本，高40-60cm。鳞茎粗1-1.4cm，由2枚肥厚的鳞瓣组成，周围还有少数小鳞茎。茎基部以上具叶，叶轮生或对生，中部以上兼有少数散生；叶条形，长9-15cm，宽2-6cm，先端不卷曲或稍卷曲。花1-3朵，顶生，俯垂，紫色而具黄色小方格；顶端的花具4-6枚叶状苞片，条状苞片先端极卷曲；花被钟状；花被片6，长圆状倒卵形，钝头，基部上方有蜜腺；雄蕊6，长约为花被片的3/5；花柱具乳头状突起；柱头3深裂。蒴果宽倒卵形，具圆棱。花期5-6月。\", \"wei\": \"味苦、辛；性微寒\", \"liang\": \"内服：煎汤，3-9g；研粉，每次1-2g。\", \"zhi\": \"清热润肺；化痰止咳。主肺热燥咳；干咳少痰；阴虚劳嗽；咯痰带血；瘰疬；乳痈\" },\n  { \"name\": \"伊贝母\", \"xing\": \"1.伊贝母：多年生本草，高30-60cm。鳞茎由2枚鳞片组成，直径1.5-3.5cm，鳞片上端延长的膜质物，鳞茎皮较厚。叶通常散生，有时近对生或近轮生；叶片从下向上由狭卵形至披针形，长约7-12cm，宽2-3.5cm，先端不卷曲。花1-4朵，淡黄色，内有暗红色斑点，每花有1-3枚叶状苞片，先端不卷曲，花被片6，匙状长圆形，长3-4cm，宽1.2-1.6cm，淡黄色，密腺窝在背面明显突出；雄蕊长约为花被片的2/3，花药近基着生，花丝无乳突，柱头裂片长约2mm，蒴果棱上有宽翅，花期5月。<br>2.新疆贝母：草本，高25-40cm。鳞茎粗1-1.5cm。由少肥厚的鳞片组成。叶对生或轮生，叶片披针形或条形，长5-9cm，宽3-10cm，最上部具3枚轮生的叶状苞片，苞片先端极卷曲。单花顶生，花被钟状，花被片6，外面灰紫色，内面紫色，具白色或黄色方格斑纹，基部的上方具有凹陷的蜜腺，雄蕊长为花被片的1/2；花柱略比子房长，柱头3裂，裂片长约为花柱的1/4。蒴果长1.8-3cm，棱上的翅宽4-5mm。花期5-6月，果期7-8月。\", \"wei\": \"味苦、甘；性微寒\", \"liang\": \"内服：煎汤，3-9g。\", \"zhi\": \"清肺；化痰；散结。主肺热咳嗽；痰粘胸闷；劳嗽咯血；瘰疬；痈肿\" },\n  { \"name\": \"浙贝母\", \"xing\": \"浙贝母，多年生草本。高50-80cm。鳞茎扁球形，直径1.5-4cm，由2枚白色肥厚的鳞叶对合组成。叶在茎最下面的对生或散生，渐向上常兼有散生、对生和轮生的；叶片近条形至披针形，长7-11cm，宽1-2.5cm，先端不卷曲或稍弯曲。花1-6朵，淡黄色，有时稍带淡紫色，顶端的花具3-4枚叶状苞片，其余具2-4cm，宽1-1.5cm，内外轮相似，内面具紫色方格斑纹，基部上方具蜜腺；雄蕊6，长约为花被片的2/5；花药近基着生，花丝无小乳突；柱头裂片长1.5-2mm。蒴果卵圆形，6棱，长2-2.2cm，宽约2.5cm，棱上有宽约6-8mm的翅。花期3-4月，果期5月。\", \"wei\": \"味苦；性寒\", \"liang\": \"内服：煎汤，3-10g；或入丸、散。外用：适量，研末撒。\", \"zhi\": \"清热化痰；降气止咳；散结消肿。主风热或痰热咳嗽；肺痈吐脓；瘰疬瘿瘤；疮痈肿毒\" },\n  { \"name\": \"湖北贝母\", \"xing\": \"多年生草本，植株高26～50cm。鳞茎由2枚鳞片组成，直径1.5～3cm。叶3～7枚轮生，中间常兼有对生或散生，矩圆状披针形，先端不卷曲或多少弯曲。花1～4朵，紫色，有黄色小方格；叶状苞片通常3枚，极少为4枚，花梗长1～2cm；花被片长4.2～4.5cm，宽1.5～1.8cm，外花被片稍狭些，蜜腺窝在背面稍凸出。蒴果2～2.5cm，宽2.5～3cm，棱上的翅宽4～7mm。花期4月，果期5～6月。\", \"wei\": \"性寒、味苦。\", \"liang\": \"无\", \"zhi\": \"化痰止咳，散结。用于肺热咳嗽、胸闷痰结、瘰疬、痈肿。\" },\n  { \"name\": \"土贝母\", \"xing\": \"多年生攀援草本，茎细弱，长1～3米，顶端有分叉的卷须。鳞茎肉质，由数个一大一小成为一对、各对交互生、逐渐增加层次的瓣片组成，呈不规则球形，直径达3厘米，白色。单叶互生，叶片掌状5～7裂，长4～7厘米，宽长近相等，基部心形，裂片不规则卵形，边缘有浅裂状疏齿，两面粗糙，被有柔毛，叶柄长1～2厘米。夏季开花，单性，雌雄异株，圆锥花序着生于叶腋，排列疏散，花梗长而纤弱；雄花直径约1.5厘米，花萼淡绿色，基部合生，上部5深裂，裂片窄长，先端渐尖呈细长线状；花冠与花萼相似，但裂片较宽；雄蕊5，花丝1个分离，其余4个基部两两成对连合；雌花子房下位，3室，柱头6个。蒴果圆筒状，成熟后顶端盖裂。有种子4粒，斜方形，表面棕黑色，顶端具膜质翅。\", \"wei\": \"苦，凉。\", \"liang\": \"0.3～1两；外用适量，研末敷患处。\", \"zhi\": \"清热解毒，散结消肿。主治：淋巴结结核，骨结核，乳腺炎，疮痈肿毒；外用治蛇、虫咬伤，外伤出血。\" },\n  { \"name\": \"瓜蒌\", \"xing\": \"多年生草质藤本。茎有棱线，卷须2～3歧。叶互生，叶片宽卵状心形，长宽相近，5～14cm,3～5浅裂至深裂，边缘常再分裂，小裂片较圆，两面稍被毛。雄花生于上端1/3处，3～8朵成总状花序，有时单生，萼片线形，花冠白色，裂片扇状倒三角形，先端流苏长1.5～2cm；雌花单生，花梗长约6cm。果实椭圆形至球形，长7～11cm，果瓤橙黄色。种子扁椭圆形，长11～16mm，宽7～12mm。花期6～8月，果期9～10月。\", \"wei\": \"性寒，味甘，微苦。\", \"liang\": \"无\", \"zhi\": \"清热涤痰，宽胸散结，润肠。用于肺热咳嗽，痰浊黄稠，胸痹心痛，乳痈、肺痈、肠痈肿痛。\" },\n  { \"name\": \"瓜蒌皮\", \"xing\": \"无\", \"wei\": \"甘，寒。\", \"liang\": \"6～9g。\", \"zhi\": \"清化热痰，利气宽胸。用于痰热咳嗽，胸闷胁痛。\" },\n  { \"name\": \"瓜蒌子\", \"xing\": \"无\", \"wei\": \"甘，寒。\", \"liang\": \"9～15g。\", \"zhi\": \"润肺化痰，滑肠通便。用于燥咳痰黏，肠燥便秘。\" },\n  { \"name\": \"竹茹\", \"xing\": \"1.淡竹 植株木质化，呈乔木状。竿高6-18m，直径5-7cm，成长后仍为绿色，或老时为灰绿色，竿环及箨环均甚隆起。箨鞘背面无毛或上部具微毛，黄绿至淡黄色而具有灰黑色之斑点和条纹；箨耳及其Z毛均极易脱落；箨叶长披针形，有皱折，基部收缩；小技具叶1-5片，叶鞘鞘口无毛；叶片深绿色，无毛，窄披针形，宽1-2cm，次脉6-8对，质薄。穗状花序小技排列成覆瓦状的圆锥花序；小穗含2-3花，顶端花退化，颖工或2片，披针形，具微毛；外稃锐尖，表面有微毛；内稃先端有2齿，生微毛，长12-15mm；鳞被数目有变化，3至1枚或缺如，披钍形，长约3mm；花药长7-10mm，开花时，以具有甚长之花丝而垂悬于花外；子房呈尖卵形，顶生一长形之花柱，两者共长约7mm，柱头3枚，各长约smm，呈帚刷状。笋期4-5月，花期10月至次年5月。 2.青竿竹 植株木质化，呈乔木状。植株丛生，无刺。竿直立或近直立，高达15m，径约6cm。顶端不弯垂，竿的节上分枝较多；节间圆柱形，竿的节间和箨光滑无毛。 3.大头典竹 植株木质化，是乔木状。竿高达15m。多少有些作之字形折曲，幼竿被毛和中部以下的竿节上通常具毛环，节间通常较短；箨鞘背部疏被黑褐色、贴生前向刺毛；释片基部较狭；释舌较长，长约5mm；小穗通常呈麦秆黄色；内稃背部被柔毛，脊上具较长而密的缘毛。叶鞘通常被毛；叶舌较长以及外稃背面被疏柔毛。花期3-5月，笋期6-7月。\", \"wei\": \"甘；微寒\", \"liang\": \"内服：煎汤，5-10g；或入丸、散。外用：适量，熬膏贴。\", \"zhi\": \"清热化痰；除烦止呕；安胎凉血。主肺热咳嗽；烦热惊悸；胃热呕呃；妊娠恶阻；胎动不安；吐血；衄血；尿血；崩漏\" },\n  { \"name\": \"竹沥\", \"xing\": \"1.淡竹 植株木质化，呈乔木状。竿高6-18m，直径5-7cm，成长后仍为绿色，或老时为灰绿色，竿环及箨环均甚隆起。箨鞘背面无毛或上部具微毛，黄绿至淡黄色而具有灰黑色之斑点和条纹；箨耳及其Z毛均极易脱落；箨叶长披针形，有皱折，基部收缩；小技具叶1-5片，叶鞘鞘口无毛；叶片深绿色，无毛，窄披针形，宽1-2cm，次脉6-8对，质薄。穗状花序小技排列成覆瓦状的圆锥花序；小穗含2-3花，顶端花退化，颖工或2片，披针形，具微毛；外稃锐尖，表面有微毛；内稃先端有2齿，生微毛，长12-15mm；鳞被数目有变化，3至1枚或缺如，披钍形，长约3mm；花药长7-10mm，开花时，以具有甚长之花丝而垂悬于花外；子房呈尖卵形，顶生一长形之花柱，两者共长约7mm，柱头3枚，各长约smm，呈帚刷状。笋期4-5月，花期10月至次年5月。 2.青竿竹 植株木质化，呈乔木状。植株丛生，无刺。竿直立或近直立，高达15m，径约6cm。顶端不弯垂，竿的节上分枝较多；节间圆柱形，竿的节间和箨光滑无毛。 3.大头典竹 植株木质化，是乔木状。竿高达15m。多少有些作之字形折曲，幼竿被毛和中部以下的竿节上通常具毛环，节间通常较短；箨鞘背部疏被黑褐色、贴生前向刺毛；释片基部较狭；释舌较长，长约5mm；小穗通常呈麦秆黄色；内稃背部被柔毛，脊上具较长而密的缘毛。叶鞘通常被毛；叶舌较长以及外稃背面被疏柔毛。花期3-5月，笋期6-7月。\", \"wei\": \"甘；苦；寒\", \"liang\": \"内服：冲服，30-60g；或入丸剂或熬膏。外用：适量，调敷或点眼。\", \"zhi\": \"清热降火；滑痰利窍。主中风痰迷；肺热痰壅；惊风；癫痫；热病痰多；壮热烦渴；子烦；破伤风\" },\n  { \"name\": \"天竺黄\", \"xing\": \"无\", \"wei\": \"甘，寒。\", \"liang\": \"3～9g。常入丸、散剂。\", \"zhi\": \"清热豁痰，凉心定惊。用于热病神昏，中风痰迷，小儿痰热惊痫、抽搐、夜啼。\" },\n  { \"name\": \"前胡\", \"xing\": \"多年生草本，高60-100cm。根圆锥形，有少数侧根，表面黄褐色至棕黑色，根头处残留多数棕褐色叶鞘纤维。茎直立，圆柱形，上部分枝，被短柔毛，下部无毛。基生叶有长柄，基部扩大成鞘状，抱茎；叶片宽三角状卵形，三出或二至三回羽状分裂，长15-20cm，宽约12cm，第一回羽片2-3对，最下方的1对有长柄，柄长3.5-6cm，其他有短柄或无柄；末回裂片菱状倒卵形，先端渐尖，基部楔形至截形，边缘具不整齐的3-4粗或圆锯齿，有时下部锯齿呈浅裂或深裂状，长1.5-6cm，宽1.2-4cm，下表面叶脉明显突起，两面无毛，或有时在下表面叶脉上以及边缘有稀疏短毛；茎生叶和基生叶相似，较小；茎上部叶无柄，叶片三出分裂，裂片狭窄，基部楔形，中间一枚基部下延。复伞形花序顶生或侧生，伞辐6-18，不等长，长1.5-4.5cm，有柔毛；总苞片1至数片，花后脱落，线状披针形，长0.7-1cm，边缘膜质，有柔毛；小伞形花序有花15-20，花梗不等长，有柔毛；小总苞片7-12，卵状披针形，先端长渐尖，长3-5mm，宽0.6-1mm，与花梗等长或超过，有柔毛；萼齿不显着；花瓣5，白色，广卵形至近圆形；雄蕊5；花柱短，弯曲，花柱基圆锥形。果实卵圆形，背部扁压，长约4mm，宽约3mm，棕色，被稀疏短毛，背棱线形稍突起，侧棱呈翅状，比果体狭，稍厚，棱槽内有油管3-5，合生面有油管6-10，胚乳腹面平直。花期7-9月，果期10-11月。<br>多年生草本，高1-2m。根圆锥形，常数支根，表面黄褐色至棕褐色。茎直立，圆柱形，具浅纵沟纹，光滑，紫色，上部分枝被柔毛。根生叶和茎生叶有长柄，柄长13-36cm，基部膨大成圆形的紫色叶鞘，抱茎外，面无毛；叶片三角形至卵圆形，坚纸质，长10-25cm，一回三全裂或片和顶端叶片有基部联合，沿叶轴呈翅状延长，侧方裂片和顶端叶片有基部联合，沿叶轴呈翅状延长，侧方裂片和顶凋叶片有基部联合，沿叶轴叶翅状延长，翅边缘有锯齿；末回裂片卵形或长圆状披针形，长5-15cm，宽2-5cm，先端锐尖，边缘有白色软骨质锯齿，齿端有尖头，上面深绿色，脉上有短糙毛，下面绿白色，主脉常带紫色，无毛；茎上部叶简化成囊状膨大的紫色叶鞘。复伞形花序顶生和侧生，花序梗长3-8cm，有柔毛；伞辐10-22，长2-4cm；总苞片1-3，卵圆形，阔鞘状，宿存，反折，紫色；小总苞片3-8，线形至披针形，无毛；伞辐及花柄有毛；花深紫色；萼齿明显，线状锥形或三角状锥形；花瓣倒卵形或椭圆状披针形，先端通常不内折成凹头状；花药暗紫色。果实长圆形至卵状圆形，长4-7mm，宽3-5mm，无毛，背棱线形隆起，尖锐，侧棱有较厚的狭翅，与果体近等宽，棱槽内有油管1-3，合生面有油管4-7mm，宽3-5mm，无毛，背棱线形隆起，尖锐，侧棱有较厚的狭翅，与果体近等宽，棱槽内有油管1-3，合生面有油管4-6，胚乳腹面有油管4-6，胚乳腹面凹入。花期8-9月，果期9-11月。\", \"wei\": \"味苦；辛；性微寒\", \"liang\": \"内服：煎汤，5-10g；或入丸、散。\", \"zhi\": \"疏散风热；降气化痰。主外感风热；肺热痰郁；咳喘痰多；痰黄稠粘；哎逆食少；胸膈满闷\" },\n  { \"name\": \"桔梗\", \"xing\": \"无\", \"wei\": \"苦、辛，平。\", \"liang\": \"3～9g。\", \"zhi\": \"宣肺，利咽，祛痰，排脓。用于咳嗽痰多，胸闷不畅，咽痛，音哑，肺痈吐脓，疮疡脓成不溃。\" },\n  { \"name\": \"胖大海\", \"xing\": \"落叶乔木，高30～40米。树皮粗糙而略具条纹。叶互生；叶柄长5～15厘米；叶片革质，卵形或椭圆状披针形，长10～20厘米，宽6～14厘米，先端钝或锐尖，基部圆形或几近截形，全缘，光滑无毛。花杂性同株，成顶生或腋生的圆锥花序；花萼钟状，宿存，裂片披针形；花瓣呈星状伸张；雄花具雄蕊10～15，罕至30，花药及花丝均具疏柔毛，不育心皮被短绒毛；雌花具雌蕊1，子房为5个被短绒毛的心皮组成，具1细长纤弱的子房柄，柱头2～5裂，退化雄蕊为一簇无柄花药。蓇葖果1～5个，着生于果梗，长18～24厘米，基部宽5～6厘米，呈船形，在成熟之前裂开；最初被疏柔毛：旋脱落。种子梭形或倒卵形，长18～25毫米，直径12毫米，深黑褐色，表面具皱纹；子叶大，长12毫米，宽10毫米，半圆形，胚乳丰富。\", \"wei\": \"甘淡，凉。\", \"liang\": \"内服：煎汤，1.5～3钱；或泡茶。\", \"zhi\": \"治疗急性扁桃体炎：取胖大海4～8枚，放入碗内，冲入沸水，闷盖半小时左右（天冷须保暖），徐徐服完；间隔4小时，如法再泡服1次。治疗100例，治愈68例，显着好转21例，效果不佳14例。有的经2～3天即愈。\" },\n  { \"name\": \"罗汉果\", \"xing\": \"无\", \"wei\": \"甘，凉。\", \"liang\": \"9～15g。\", \"zhi\": \"清热润肺，滑肠通便。用于肺火燥咳，咽痛失音，肠燥便秘。\" },\n  { \"name\": \"海藻\", \"xing\": \"①羊栖菜（《漳浦县志》），又名：玉海草、灯笼藻、胡须泡、药茶、鹿尾菜。<br>多年生褐藻，肉质，黄色，高7～40厘米。固着器纤维状似根；主轴圆柱形，直立，直径2～4毫米，从周围长出分枝和叶状突起；分枝很短；叶状突起棍棒状，长3.5～7厘米，先端盾形，有时膨大，中空成气泡，全缘。气囊和生殖托均腋生；气囊纺锤形，长5～10毫米；生殖托圆柱形或椭圆形，长5～15毫米，成丛腋生。<br>生于低潮浅海水激荡处的岩石上。分布辽宁、山东、福建、浙江、广东等沿海地区。<br>②海蒿子<br>多年生褐藻，暗褐色，高30～100厘米。固着器扁平盘状或短圆锥形，直径可达2厘米；主轴圆柱形，幼时短，但逐年增长，两侧有呈钝角或直角的羽状分枝及腋生小枝，幼时其上均有许多短小的刺状突起；叶状突起的形状，大小差异很大、披针形、倒披针形、倒卵形和线形均有，长者可达25厘米，短者只2厘米，宽者可达2.5厘米，有不明显的中脉状突起，并有明显的毛窠斑点，狭者只1毫米，无中脉状突起，也无斑点，全缘或有锯齿。在线形叶状突起的腋部，长出多数具有丝状突起的小枝，生殖托或生殖枝即从丝状突起的腋间生出。气囊生于最终分枝上，有柄，成熟时球形或近于球形，顶端圆或有细尖状凸起，表面有稀疏的毛窠斑点。生殖托单生或总状排列于生殖小枝上，圆柱形，长3～15毫米或更长，直径约1毫米。<br>生于低潮线下海水激荡处的岩石上。分布辽宁、山东等沿海地区。\", \"wei\": \"苦咸，寒。<br>①《本经》：味苦，寒。<br>②《别录》：味咸，无毒。<br>③《药性论》：咸，有小毒。\", \"liang\": \"内服：煎汤，1.5～3钱；浸酒或入丸、散。\", \"zhi\": \"软坚，消痰，利水，泄热。治瘰疬，瘿瘤，积聚，水肿，脚气，睾丸肿痛。<br>①《本经》：主瘿瘤气，颈下核，破散结气，痈肿Y瘕坚气，腹中上下鸣，下十二水肿。<br>②《别录》：疗皮间积聚，暴癀，留气，热结，利小便。<br>③《药性论》：治气痰结满，疗疝气下坠，疼痛核肿，去腹中雷鸣，幽幽作声。<br>④孟诜：主起男子阴气，常食之，消男子癀疾。<br>⑤《海药本草》：主宿食不消，五鬲痰壅，水气浮肿，脚气，奔豚气。<br>⑥《本草蒙筌》：治项间瘰疬，消颈下瘿囊，利水道，通癃闭成淋，泻水气，除胀满作肿。<br>⑦《现代实用中药》：治慢性气管炎等症。\" },\n  { \"name\": \"昆布\", \"xing\": \"①海带<br>多年生大型褐藻，植物体成熟时成带状，长可达6米以上。根状固着器粗纤维状，由数轮叉状分歧的假根组成，假根末端有吸着盘。其上为圆柱状的短柄，长5～15厘米。柄的上部为叶状体，叶状体幼时呈长卵状，后渐伸长成带状，扁平，长2～6米，宽20～50厘米，坚厚，革质状，中部稍厚，两边较薄，有波状皱褶。生殖期在叶状体两面产生孢子囊。<br>生于较冷的海洋中，多附生于大干潮线以下1～3米深处的岩礁上。分布山东，辽宁一带沿海地区。目前已有人工养殖。<br>本植物的根状固着器（海带根）亦供药用，另详专条。<br>②昆布，又名：面其菜、黑昆布、鹅掌菜。<br>多年生大型褐藻。根状固着器由树枝状的又状假根组成，数轮重叠成圆锥状，直径5～15厘米。柄部圆柱状或略扁圆形，中实，长8～100厘米，直径10～15毫米，粘液腔道呈不规则的环状，散生在皮层中。叶状体扁平，革质，微皱缩，暗褐色，厚2～3毫米，1～2回羽状深裂，两侧裂片长舌状，基部楔形，叶缘一般有粗锯齿。孢子囊群在叶状体表面形成，9～11月产生游孢子。<br>生于低潮线附近的岩礁上。分布福建、浙江等沿海地区。<br>③裙带菜（姚可成《食物本草》）<br>多年生大型褐藻，植物体长约1～2米，宽可达1米。根状固着器纤维状，叉状分枝，在柄的下端轮生。柄短，近扁圆柱形，直径约10～15毫米。叶状体扁平，棕褐色，柔革质；中央有明显隆起的主肋，两侧较薄，通常形成多数羽状柔软的裂片，裂片边缘有缺刻，有时不分裂，则呈卵形；上面散布许多黑色小斑，全面密生粘液腺。春季在柄的两侧着生木耳状、厚而富含胶质的重叠折皱，内含孢子囊群，产生多数游孢子。<br>生于低潮线以下1～4米深处的岩石上。分布浙江、福建、辽宁等沿海地区。\", \"wei\": \"咸，寒。<br>①《吴普本草》：酸咸，寒，无毒。<br>②《本草再新》：味苦，性寒，无毒。\", \"liang\": \"内服：煎汤，1～3钱；或入丸、散。\", \"zhi\": \"软坚，行水。治瘰疬，瘿瘤，噎膈，水肿，睾丸肿痛，带下。<br>①《别录》：主十二种水肿，瘿瘤聚结气，痿疮。<br>②《药性论》：利水道，去面肿，去恶疮鼠瘘。<br>③《本草拾遗》：主颓卵肿。<br>④崔禹锡《食经》：治九瘘风热，热瘅，手脚疼痹，以生啖之益人。<br>⑤《本草通玄》：主噎膈。<br>⑥姚可成《食物本草》：裙带菜，主女人赤白带下，男子精泄梦遗。<br>⑦《玉楸药解》：泄水去湿，破积软坚。清热利水，治气臌水胀，瘰疬瘿瘤，癫疝恶疮，与海藻、海带同功。<br>⑧《现代实用中药》：治水肿，淋疾，湿性脚气。又治甲状腺肿，慢性气管炎，咳嗽。\" },\n  { \"name\": \"黄药子\", \"xing\": \"黄独 缠绕草质藤本。块茎卵圆形至长圆形，近于土面，棕褐色，表面密生多数细长须根。茎圆柱形，左旋，无毛。单叶互生；叶柄较叶片稍短；叶片宽卵状心形或卵状心形，长5-16（-26）cm，宽2-14（-26）cm，先端尾状渐尖，边缘全缘或微波状，两面无毛；叶腋内有大小不等的紫褐色的球形或卵圆形珠芽（零余子），直径1-3cm，外有圆形斑点。花单性，雌雄异株；雄花序穗状下垂，常数个丛生于叶腋，有时基部花序延长排列成圆锥状；雄花单生密集，基部有卵形苞片2枚；花被片披针形，新鲜时紫色；雄蕊6，着生于花被基部，花丝与花药近等长；雌花序与雄花序相似，常2至数个丛生叶腋，长20-50cm，退化雄蕊6，长仅为花被片的1/4。蒴果反折下垂，三棱状长圆形，长1.5-3cm，宽0.5-1.5cm，两端圆形，成熟时淡黄色，表面密生紫色小斑点。种子深褐色，扁卵形，通常两两着生于每室中轴的顶端，种翅栗褐色，向种子上方延伸，呈长圆形。花期7-10月，果期8-11月。\", \"wei\": \"苦；寒；小毒\", \"liang\": \"内服：煎汤，3-9g；或浸酒；研末1-2g。外用：适量，鲜品捣敷；或研末调数；或磨汁涂。\", \"zhi\": \"1.治疗甲状腺肿：对各种类型的甲状腺肿，均有一定效果。制剂用量各地不尽相同，观察对象亦有差异。\" },\n  { \"name\": \"海蛤壳\", \"xing\": \"贝壳2片，近圆形。壳长约36.5～56毫米，高几与长相等，宽度约为长度的2/3。壳顶突出，位于背侧中央，尖端向前方弯曲。无小月面，楯面狭长，全部为韧带所占据，韧带黄褐色，不突出壳面。贝壳表面极凸出，生长线在顶部者细密，不甚显着，至腹面渐粗大，凸出壳面。壳面淡黄色或棕红色。壳内面为白色或淡肉色，边缘具有整齐的小齿。小齿愈近背缘愈大。铰合部狭长而平，左、右壳各具3个主齿。外套痕显明，外套窦深，自腹缘向上方斜伸至贝壳的中心部，后端宽，至前端渐狭，呈楔形。前闭壳肌痕细长，呈半月状，后闭壳肌痕大，椭圆形。足扁平，舌状。\", \"wei\": \"咸，平。\", \"liang\": \"内服：煎汤，2～4钱；或入丸、散。\", \"zhi\": \"清热，利水，化痰，软坚。治热痰喘嗽，水肿，淋病，瘿、瘤，积聚，血结胸痛，血痢，痔疮，崩漏，带下。\" },\n  { \"name\": \"海浮石\", \"xing\": \"浮石（《千金方》）<br>非晶质。一般为白色、浅灰色，偶而呈浅红色。具有标准的多孔构造，形似蛀窠，有时具管状构造。表面暗淡或具丝绢光泽。性脆。比重小，在水中可以浮起。为火山喷发出的岩石，主要由玻璃质构成，偶含少量结晶质矿物。<br>】①脊突苔虫<br>固着生活的水生群体动物。雌雄同体。群体常呈树枝状。个体很小，为囊状。体外分泌石灰质及胶状物质，形成群体之骨胳。体前端有口，口缘有马蹄状的突起，其上生多数触手。消化管屈曲成U形，肛门亦在体之前端。<br>常附着于海滨岩礁上。分布我国南方沿海各地。<br>②瘤苔虫<br>与上种近似，群体呈肿瘤状，淡黄褐色。<br>常附着于海藻、柳珊瑚、岩石上。分布同上。\", \"wei\": \"咸，寒。<br>①《本草拾遗》：平，无毒。<br>②朱震亨：咸。<br>③《纲目》：大寒。\", \"liang\": \"内服：煎汤，3～5钱；或入丸、散。外用：研末撒或水飞点眼。\", \"zhi\": \"清肺火，化老痰，软坚，通淋。治痰热喘嗽，老痰积块，瘿瘤，瘰疬，淋病，疝气，疮肿，目翳。<br>①陶弘景：止咳。<br>②《本草拾遗》：主渴。<br>③《日华子本草》：止渴，治淋，杀野兽毒。<br>④《本草衍义》：水飞，治目中翳。<br>⑤朱震亨：清金降火，消积块，化老痰。<br>⑥《纲目》：消瘿瘤结核疝气，下气，消疮肿。<br>⑦《本草正》：消食，消热痰，解热渴热淋，止痰嗽喘急，软坚Y，利水湿。\" },\n  { \"name\": \"瓦楞子\", \"xing\": \"1.魁蚶，贝壳斜卵圆形，坚厚，一般壳长80-104mm，高62-85mm，大者长可达122mm，高102mm。两壳合抱，左壳比右壳稍大，极膨胀，壳顶突出，向内弯曲，稍超过韧带面。韧带梭形，具黑褐色角质厚皮。背部两侧略呈钝角，壳前缘及肤缘均呈圆形；后缘延伸呈截形。放射肋宽，平滑整齐，无明显结节，约42-48条，以43-44条较多见，生长轮脉明显，壳面白色。壳内面白色，铰合部直，铰合齿60-70枚，中间者细小直立，两端渐大而外斜。闭壳肌良明显，前痕小，卵形；后痕大呈梨形，外套痕明显，鳃黄赤色。壳边缘厚，有与放射肋沟相应的齿状突起。<br>2.泥蚶，贝壳卵圆形，极坚厚，壳长43mm左右，高36mm左右，两壳相当膨胀，宽度略小于高度。两壳顶间的距离较远，壳表放射肋发达，共18-21条，肋上具有极显着的断续颗粒状结节，此结节在壳边缘部分不甚明显，壳内面灰白色，边缘具有与壳面放射肋相应的深沟。铰合部直，铰合齿约40个。前闭壳肌痕较小，呈三角形；后闭壳肌痕大，近方形。<br>3.毛蚶，贝壳长卵圆形，质坚厚，壳长54mm左右，高46mm左右，两壳极膨胀，宽为高的3/4-4/5，右壳比左壳稍小，背侧两端略有棱角，壳顶稍偏前方，两壳顶间的距离中等。壳表放射肋30-35条，肋凸较密，呈方形小结节，左壳上较明显。壳表面被有棕褐色绒毛状壳皮，外皮常易磨损脱落，使壳面常有白色。壳内面白色或灰黄色，边缘具有与壳面放射肋相应的齿和沟。铰合部直，铰合齿约50个，中间小而密；两侧大而疏。前闭壳肌痕小略呈马蹄形，后闭壳肌痕为卵圆形。\", \"wei\": \"味甘；咸；性平\", \"liang\": \"内服：煎汤，9-15g，宜打碎行煎；研末，每次1-3g；或入丸、散。外用：适量，煅后研末调敷。\", \"zhi\": \"消痰化瘀；软坚散结；制酸止痛。主瘰疬；瘿瘤；症瘕痞块，顽痰久咳；胃痛吐酸；牙疳；外伤出血；冻疮及烫火伤\" },\n  { \"name\": \"礞石\", \"xing\": \"①绿泥石片岩\", \"wei\": \"咸，平。\", \"liang\": \"内服：煎汤（布包），3～5钱；或入丸、散。\", \"zhi\": \"坠痰，消食，下气，平肝。治顽痰癖积，宿食症瘕，癫狂惊痫，咳嗽喘急，痰涎上壅。\" },\n  { \"name\": \"苦杏仁\", \"xing\": \"落叶乔木，高达6m。叶互生，广卵形或卵圆形，长5～10cm，宽3.5～6cm，先端短尖或渐尖，基部圆形，边缘具细锯齿或不明显的重锯齿；叶柄多带红色，有2腺体。花单生，先叶开放，几无花梗；萼片5，花扣反折；花瓣5，白色或粉红色； 雄蕊多数；心皮1，有短柔毛。核果近圆形，直径约3cm，橙黄色；核坚硬，扁心形，沿腹缝有沟。花期3～4月，果期5～6月。\", \"wei\": \"性温，味苦；有小毒。\", \"liang\": \"无\", \"zhi\": \"降气止咳平喘，润肠通便。\" },\n  { \"name\": \"甜杏仁\", \"xing\": \"植物形态参见\\\"杏仁\\\"条。\", \"wei\": \"①《本萆便读》：\\\"味甘，性平。\\\"\", \"liang\": \"内服：煎汤，2～3钱；或入丸剂。外用：捣敷。\", \"zhi\": \"润肺，平喘。治虚劳咳喘，肠燥便秘。\" },\n  { \"name\": \"紫苏子\", \"xing\": \"一年生草本，高30-200cm。具有特殊芳香。茎直立，多分枝，紫色、绿紫色或绿色，钝四棱形，密被长柔毛。叶对生；叶柄长3-5cm，紫红色或绿色，被长节毛；叶片阔卵形、卵状圆形或卵状三角形，长4-13cm，宽2.5-10cm，先端渐尖或突尖，有时呈短尾状，基部圆形或阔楔形，边缘具粗锯齿，有时锯齿较深或浅裂，两面紫色或仅下面紫色，上下两面均疏生柔毛，沿叶脉处较密，叶下面有细油腺点；侧脉7-8对，位于下部者稍靠近，斜上升。轮伞花序，由2花组成偏向一侧成假总状花序，顶生和腋生，花序密被长柔毛；苞片卵形、卵状三角形或披针形形，全缘，具缘毛，外面有腺点，边缘膜质；花梗长1-1.5mm，密被柔毛；花萼钟状，长约3mm，10脉，外面部密被长柔毛和有黄色腺点，顶端5齿，2唇，上唇宽大，有3齿，下唇有2齿，结果时增大，基部呈囊状；花冠唇形，长3-4mm，白色或紫红色，花冠筒内有毛环，外面被柔毛，上唇微凹，下唇3裂，裂片近圆形，中裂片较大；雄蕊4，二强，着生于花冠筒内中部，几不伸出花冠外，花药2室；花盘在前边膨大；雌蕊1，子房4裂，花柱基底着生，柱头2室；花盘在前边膨大；雌蕊1，子房4裂，花柱基底着生，柱头2裂。小坚果近球形，灰棕色或褐色，直径1-1.3mm，有网纹，果萼长约10mm。花期6-8月，果期7-9月。<br>这一变种与紫苏的区别在于：果萼小，长4-5.5mm，下面被疏柔毛，具腺点；茎被短柔毛；叶较小，卵形，长4.5-7.5cm，宽2.8-5cm，两面被疏柔毛。小坚果较小，土黄色，直径1-1.5mm。花期6-8月，果期7-9月。\", \"wei\": \"味辛；性温\", \"liang\": \"内服：煎汤，5-10；或入丸、散。\", \"zhi\": \"降气；消痰；平喘；润肠。主痰壅气逆；咳嗽气喘；肠燥便秘\" },\n  { \"name\": \"百部\", \"xing\": \"1.直立百部 多年生草本，高30-60cm。块根簇生，肉质，纺锤形。茎直立，不分枝。叶3-4片轮生；有短柄或几无柄；叶片卵形，至椭圆形，长3.5-5.5cm，宽1.8-3.8cm，先端急尖或渐尖，基部楔形；叶脉通常5条，中间3条特别明显。花腋生，多数生于茎下部鳞叶腋内，花梗细长；花被片4，卵状披针形；雄蕊4，紫色，药隔膨大成披针形附属物，花药线形，先端有狭卵状附属物；子房卵形，柱头短。蒴果。花期4-5月，果期7月。 2.蔓生百部 多年生草本，高60-90cm。全株无毛。根肉质，数个至数十个簇生。茎下部直立，上部蔓状。叶3-4片轮生；叶柄长1.5-3cm；叶片卵形或卵状披针形，长4-9cm，宽1.8-4cm，先端锐尖或渐尖，基部圆形或截形，全缘；叶脉5-9条。花梗丝状，长1.5-2.5cm，其基部贴生于叶片中脉上，每梗通常单生1花；花被4片，淡绿色，卵状披针形至卵形；雄蕊4，紫色，花丝短，花药内向，线形，先端有一箭头状附属物；子房卵形，甚小，无花柱。蒴果广卵形面扁，内脏长椭圆形种子数颗。花期5月，果期7月。 3.对叶百部 多年生攀援草本，高达5m。块根肉质，纺锤形或圆柱形，茎缠绕。叶通常对生；叶柄长3-10cm；叶片广卵形，长8-30cm，宽2.5-10cm，基部浅心形，全缘或微波状；叶脉7-15条。花梗腋生，不贴生于叶片中脉上，花单生或2-3朵成总状花序，黄绿色带紫色条纹，花药附属物呈钻状或披针形。蒴果倒卵形而扁。花期5-6月。\", \"wei\": \"甘；苦；微温\", \"liang\": \"内服：煎汤，3-10g；外用：适量，煎水洗；或研末外敷；或浸酒涂擦。\", \"zhi\": \"润肺止咳；杀虫灭虱。主新久咳嗽；肺痨；百日咳；蛲虫病；体虱；癣疥\" },\n  { \"name\": \"紫菀\", \"xing\": \"无\", \"wei\": \"辛，苦，温。\", \"liang\": \"5～9g。\", \"zhi\": \"润肺下气，消痰止咳。用于痰多喘咳，新久咳嗽，劳嗽咳血。\" },\n  { \"name\": \"款冬花\", \"xing\": \"款冬（《楚辞》），又名：菟奚、颗冻（《尔雅》），橐吾、虎须（《本经》），款冻、苦萃（《广雅》），氐冬（《别录》），钻冻（《本草衍义》），八角乌（《植物名实图考》）。<br>多年生草本，高10～25厘米。基生叶广心脏形或卵形，长7～15厘米，宽8～10厘米，先端钝，边缘呈波状疏锯齿，锯齿先端往往带红色。基部心形成圆形，质较厚，上面平滑，暗绿色，下面密生白色毛；掌状网脉，主脉5～9条；叶柄长8～20厘米，半圆形；近基部的叶脉和叶柄带红色，并有毛茸。花茎长5～10厘米，具毛茸，小叶10余片，互生，叶片长椭圆形至三角形。头状花序顶生；总苞片1～2层，苞片20～30，质薄，呈椭圆形，具毛茸；舌状花在周围一轮，鲜黄色，单性，花冠先端凹，雌蕊1，子房下位，花柱长，柱头2裂；筒状花两性，先端5裂，裂片披针状，雄蕊5，花药连合，雌蕊1，花柱细长，柱头球状。瘦果长椭圆形，具纵棱，冠毛淡黄色。花期2～3月。果期4月。\", \"wei\": \"辛，温。<br>①《本经》：味辛，温。<br>②《别录》：甘，无毒。<br>③《医学启源》：辛苦。<br>④《药品化义》：味微苦略辛，性平。\", \"liang\": \"内服：煎汤，0.5～3钱；熬膏或入丸、散。\", \"zhi\": \"润肺下气，化痰止嗽。治咳逆喘息，喉痹。<br>①《本经》.主咳逆上气善喘，喉痹，诸惊痫，寒热邪气。<br>②《别录》：主消渴，喘息呼吸。<br>⑧《药性论》：主疗肺气心促，急热乏劳，咳连连不绝，涕唾稠粘，治肺痿肺痈吐脓。<br>④《日华子本草》：润心肺，益五脏，除烦，补劳劣，消痰止嗽，肺痿吐血，心虚惊悸，洗肝明目及中风。<br>⑤《医学启源》：温肺止嗽。<br>⑥《本草述》：治痰饮，喑证亦用之。<br>⑦《长沙药解》：降逆破塑，宁嗽止喘，疏利咽喉，洗涤心肺而兼长润燥。\" },\n  { \"name\": \"马兜铃\", \"xing\": \"北马兜铃：多年生缠绕草本，长达1米余，全株无毛。根细长，圆柱形，外皮黄褐色，有香气，断面有油点。茎有棱，缠绕成团，捻揉有特殊臭气。叶互生，叶片三角状心形，长3～10厘米。夏日叶腋簇生数朵绿紫色花；花被喇叭状。疏果近圆形或宽倒卵形，长3～7厘米，直径2～4厘米，果梗下垂，成熟时果沿室开裂为6瓣，果梗亦裂成6条丝状。种子多数，扁平三角形，周围有宽翅。\", \"wei\": \"苦，微寒。\", \"liang\": \"3～9g。\", \"zhi\": \"清肺降气，止咳平喘，清肠消痔。用于肺热喘咳，痰中带血，肠热痔血，痔疮肿痛。\" },\n  { \"name\": \"青木香\", \"xing\": \"1.北马兜铃 草质藤本。叶纸质；叶柄柔弱，长2-7cm；叶片卵状心形或三角状心形，长3-13cm，宽3-10cm，先端短尖或钝，基部心形，两侧裂片圆形，下垂或扩展，边全缘；基出脉5-7条。总状花序有花2-8朵生于叶腋；花序梗和花序轴极短或近无；花梗长1-2cm，小苞片卵形，具长柄；花被长2-3cm，基部膨大呈球形，向上收狭呈一长管，内面具腺体状毛，管口扩大呈漏斗状；檐部一侧极短，有时边缘下翻或稍2裂，另一侧渐扩大成舌片；舌片卵状披针形，先端长渐尖具延伸成1-3cm线形而弯扭的尾尖，黄绿色，常具紫色纵脉和网纹；花药贴生于合蕊柱近基部；子房圆柱形，6棱；合蕊柱先端6裂，裂片向下延伸成波状圆环。朔果宽倒卵形或椭圆状倒卵形，长3-6.5cm，先瑞圆形而微凹，6棱，成熟时由基部向上6瓣开裂；果便下垂，随果开裂。种子三角状心形，扁平，有小疣点，具浅褐色膜质翅。花期5-7月，果期8-10月。\", \"wei\": \"辛；苦；性寒；小毒\", \"liang\": \"内服：煎汤，3-9g；研末，1.5-2g，每日2-3次。外用：适量，研末调敷；或磨汁涂。\", \"zhi\": \"行气止痛，解毒消肿，平肝降压。。主胸胁院腹疼痛，疝气痛，肠炎，下痢腹痛，咳嗽痰喘，蛇虫咬伤，痈肿疔疮，湿疹，皮肤瘙痒，高血压病。\" },\n  { \"name\": \"天仙藤\", \"xing\": \"1.北马兜铃 草质藤本。叶纸质；叶柄柔弱，长2-7cm；叶片卵状心形或三角状心形，长3-13cm，宽3-10cm，先端短尖或钝，基部心形，两侧裂片圆形，下垂或扩展，边全缘；基出脉5-7条。总状花序有花2-8朵生于叶腋；花序梗和花序轴极短或近无；花梗长1-2cm，小苞片卵形，具长柄；花被长2-3cm，基部膨大呈球形，向上收狭呈一长管，内面具腺体状毛，管口扩大呈漏斗状；檐部一侧极短，有时边缘下翻或稍2裂，另一侧渐扩大成舌片；舌片卵状披针形，先端长渐尖具延伸成1-3cm线形而弯扭的尾尖，黄绿色，常具紫色纵脉和网纹；花药贴生于合蕊柱近基部；子房圆柱形，6棱；合蕊柱先端6裂，裂片向下延伸成波状圆环。朔果宽倒卵形或椭圆状倒卵形，长3-6.5cm，先瑞圆形而微凹，6棱，成熟时由基部向上6瓣开裂；果便下垂，随果开裂。种子三角状心形，扁平，有小疣点，具浅褐色膜质翅。花期5-7月，果期8-10月。<br>2．马兜铃 草质藤本。根圆柱形。茎柔弱，无毛。叶互生；叶柄长l-2cm，柔弱；叶片卵状三角形、长圆状卵形或戟形，长3-6cm，基部宽1.5-3.5cm，先端钝圆或短渐尖，基部心形，两侧裂片圆形，下垂或稍扩展；基出脉5-7条，各级叶脉在两面均明显。花单生或2朵聚生于叶腋；花便长l-1.5cm；小苞片三角形，易脱落；花被长3-5.5cm，基部膨大呈球形，向上收狭成一长管，管口扩大成漏斗状，黄绿色，口部有紫斑，内面有腺体状毛；檐部一侧极短，另一侧渐延伸成舌片；舌片卵状披针形，顶端钝；花药贴生于合蕊柱近基部；于房圆柱形，6棱；合蕊柱先端6裂，稍具乳头状凸起，裂片先端钝，向下延伸形成波状圆环。蒴果近球形，先端圆形而微凹，具6棱，成熟时由基部向上沿空间6瓣开裂；果梗长2.5-5cm，常撕裂成6条。种子扁平，钝三角形，边线具白色膜质宽翅。花期7-8月，果期9-10月。\", \"wei\": \"苦；温\", \"liang\": \"内服：煎汤，6-10g。外用：适量，煎水洗或捣烂敷。\", \"zhi\": \"行气活血；利水消肿；解毒。主胃痛；疝气痛；妊娠水肿；产后血气腹痛；蛇虫咬伤\" },\n  { \"name\": \"枇杷叶\", \"xing\": \"无\", \"wei\": \"苦，凉。\", \"liang\": \"内服：煎汤，1.5～3钱（鲜者0.5～1两）；熬膏或入丸、散。\", \"zhi\": \"治疗慢性气管炎：取枇杷叶3两、茄梗5两，加水3000毫升煎成2000毫升，再加单糖浆240毫升。日服3次，每次10毫升，20天为一疗程。治疗167例，结果近期控制42例（25％），显效60例（36％），好转35例（20％），无效30例（18％）。据观察，止咳作用强，祛痰作用差；对单纯型气管炎较好，对哮喘则无效。治程中无毒性反应。另有用野批杷叶制成注射剂，每毫升含生药2克。每次用0.5毫升，在二侧定喘穴注射，隔日1次，5次为一疗程。治疗59例，显效14例，好转35例，无效10例。对喘息型患者有较好疗效。\" },\n  { \"name\": \"桑白皮\", \"xing\": \"无\", \"wei\": \"甘，寒。<br>①《本经》：甘，寒。<br>②《别录》：无毒。<br>③《药性论》：平。<br>④《医学启源》：气寒，味苦酸。\", \"liang\": \"内服：煎汤，2～5钱；或入散剂。外用：捣汁涂或煎水洗。\", \"zhi\": \"泻肺平喘，行水消肿。治肺热喘咳，吐血，水肿，脚气，小便不利。<br>①《本经》：主伤中，五劳六极羸瘦，崩中，脉绝，补虚益气。<br>②《别录》：去肺中水气，唾血，热渴，水肿，腹满胪胀，利水道，去寸白，可以缝金疮。<br>③《药性论》：治肺气喘满，水气浮肿，主伤绝，利水道，消水气，虚劳客热，头痛，内补不足。<br>④孟诜：入散用，下一切风气水气。<br>⑤《滇南本草》：止肺热咳嗽。<br>⑧《纲目》：泻肺，降气，散血。。<br>⑦《本草求原》：治脚气痹挛，目昏，黄疸，通二便，治尿数。<br>⑧《贵州民间方药集》：治风湿麻木。\" },\n  { \"name\": \"葶苈子\", \"xing\": \"①独行菜，又名：腺茎独行菜、辣辣根、羊辣罐、拉拉罐、白花草。<br>一年生或二年生草本，高10～30厘米。茎直立，上部多分枝，被有多数微小的头状毛。叶互生；茎下部叶狭长椭圆形，长3～5厘米，宽1～1.5厘米，边缘浅裂或深裂；茎上部叶线形，较小，全缘或前端有疏锯齿；叶基部均有耳，上面疏生微小短毛，下面无毛。长总状花序，顶生；花小；萼4，椭圆形；花瓣通常很小，呈退化状；雄蕊2～4，蜜腺4，短小，三角状广椭圆形；子房扁圆形，2室，柱头头状。短角果，卵状椭圆形，扁平，长2.5毫米，顶端微凹，果柄细，密生头状毛；中央开裂，假隔膜膜质白色。种子倒卵状椭圆形，淡红棕色。花期5～6月。果期6～7月。<br>生于田野、荒地、路旁。分布东北、河北、内蒙古、山东、山西、甘肃、青海、云南、四川等地。<br>②北美独行菜，又名：美洲独行菜。<br>一年生或二年生草本。茎直立，上部分枝，枝上疏生短毛或近于无毛。叶互生；茎下部的叶狭披针形，长2～3.5厘米，宽4～10毫米，先端渐尖，基部渐狭成柄，边缘成羽状浅裂；茎上部的叶线形至线状披针形，较小，边缘羽状浅裂或近于全缘；上面疏生短毛，下面无毛。花紧密排列成顶生总状花序；萼4，线状披针形；花瓣4，白色，广卵形，先端微凹，基部呈爪状；雄蕊2～4，花丝扁平；子房扁卵圆形，2室，柱头头状。短角果，扁平，圆形，长约2.2毫米，先端微凹，略有翅。种子小，卵圆形而扁，棕黄色。花期6月。果期7月。<br>生于山坡、路旁等杂草丛中。分布吉林、辽宁、河北、安徽、浙江、江苏、河南、福建、江西等地。<br>③播娘蒿（《救荒本草》），又名：眉毛蒿、眉眉蒿、婆婆蒿、黄蒿、密密蒿、米米蒿、麦蒿、米蒿。<br>一年生或二年生草本，高30～70厘米，全体灰白色而被叉状或分歧柔毛。茎上部多分枝，较柔细。叶互生；2～3回羽状分裂，最终的裂片狭线形，先端渐尖；在茎下部的叶有柄，渐向上则渐短或近于无柄。总状花序顶生，果序时特别伸长；花小；萼4，十字形排列，线形，先端渐尖，易早脱；花瓣4，黄色，匙形，较花萼稍长，先端微凹，基部渐狭而呈线状；雄蕊6，4强，均伸出于花瓣外，花丝扁平；子房圆柱形，2室，柱头呈扁压头状。长角果，线形，长2～3厘米，宽约1毫米。种子小，卵状扁平，褐色。花期4～6月。果期5～7月。<br>生于田野间。分布黑龙江、吉林、辽宁、内蒙古、河北、山东、安徽、河南、江苏、浙江、陕西、甘肃、湖北、四川、云南等地。\", \"wei\": \"辛苦，寒。<br>①《本经》：味辛，寒。<br>②《别录》：苦，大寒，无毒。<br>③《药性论》：味酸，有小毒。\", \"liang\": \"内服：煎汤，1.5～3钱；或入丸、散。外甩：煎水洗或研末调敷。\", \"zhi\": \"下气行水。治肺壅喘急，痰坎咳嗽，水肿胀满。<br>①《本经》：主Y瘕积聚结气，饮食寒热，破坚逐邪，通利水道。<br>②《别录》：下膀胱水，伏留热气，皮间邪水上出，面目浮肿，身暴中风热痱痒，利小腹。<br>③《药性沦》：利小便，抽肺气上喘息急，止嗽。<br>④《开宝本草》：疗肺壅上气咳嗽，定喘促，除胸中痰饮。<br>⑤《伤寒类要》：治肾瘅、唇干。<br>⑥《纲目》：通月经。\" },\n  { \"name\": \"白果\", \"xing\": \"银杏，又名：鸭脚（《宛陵集》），公孙树（《汝南圃史》），鸭掌树。落叶乔木，高可达40米。树干直立，树皮灰色。枝有长短两种，叶在短枝上簇生，在长枝上互生。叶片扇形，长4～8厘米，宽5～10厘米，先端中间2浅裂，基部楔形，叶脉平行，叉形分歧；叶柄长2.5～7厘米。花单性，雌雄异株；雄花呈下垂的短柔荑花序，4～6个生于短枝上的叶腋内，有多数雄蕊，花药2室，生于短柄的顶端；雌花每2～3个聚生于短枝上，每花有一长柄，柄端两叉，各生1心皮，胚珠附生于上，通常只有1个胚珠发育成熟。种子核果状，倒卵形或椭圆形，长2.5～3厘米，淡黄色，被白粉状蜡质；外种皮肉质，有臭气；内种皮灰白色，骨质，两侧有棱边；胚乳丰富，子叶2。花期4～5月。果期7～10月。\", \"wei\": \"甘苦涩，平，有毒。\", \"liang\": \"内服：煎汤，1.5～3钱；捣汁或入丸、散。外用：捣敷。\", \"zhi\": \"治疗肺结核:对改善症状有一些作用。服药后部分病人的发热、盗汗、咳嗽、气喘、咳血、食欲不振等，可见不同程度的好转。用法：在中秋节前夕，将半青带黄的银杏（选取外表丝毫无损的大颗粒）摘下，不用水洗，亦不去柄，随即浸入生菜油内，浸满100天后即可使用。每日早、中、晚各服1粒（小儿酌减），饭前服，视病情连服1～3个月\" },\n  { \"name\": \"银杏叶\", \"xing\": \"无\", \"wei\": \"甘、苦、涩，平。\", \"liang\": \"9～12g。\", \"zhi\": \"敛肺，平喘，活血化瘀，止痛。用于肺虚咳喘；冠心病，心绞痛，高血脂。\" },\n  { \"name\": \"矮地茶\", \"xing\": \"常绿小灌木，高10～30cm，基部常匍匐状横生，暗红色，有纤细的不定根。茎常单一，圆柱形，表面紫褐色，被短腺毛。叶互生，常3～7片集生茎端叶轮生状；椭圆形或卵形，长3～7cm，宽1.5～3cm，先端短尖，基部楔形，边缘有尖锯齿，两面疏生腺点，下面淡红色，中脉有毛；叶柄密被短腺毛。花序近伞形，腋生或顶生； 花萼5裂，有腺点；花冠5裂，白色，有红棕色腺点；雄蕊5，短于花冠裂片，花药背面有腺点。核果球形，熟时红色，有黑色腺点，具宿存花柱和花萼。花期6～9月，果期8～12月。\", \"wei\": \"性平，味辛、微苦。\", \"liang\": \"无\", \"zhi\": \"化痰止咳，利湿，活血。用于咳嗽、痰中带血、慢性支气管炎、湿热黄疸、跌扑损伤。\" },\n  { \"name\": \"洋金花\", \"xing\": \"①白曼陀罗，又名：风茄儿、山茄子（《纲目》），大颠茄（《生草药性备要》），颠茄、闷陀罗（《广西通志》），野蓖麻、猪颠茄、猪波罗、老鼠愁、白花曼陀罗、金盘托荔枝。<br>一年生草本，全体近于无毛.茎直立，圆柱形，高25～60厘米，基部木质化，上部呈叉状分枝.叶互生，上部的叶近于对生；叶柄长2～6厘米，表面被疏短毛；叶片卵形、长卵形或心脏形，长8～14厘米，宽6～9厘米，先端渐尖或锐尖，基部不对称，圆形或近于阔楔形，全缘或具三角状短齿，两面无毛，或被疏短毛；叶脉背面隆起。花单生于叶腋或上部分枝间；花梗短，直立或斜伸，被白色短柔毛；萼筒状，长4～6厘米，淡黄绿色，先端5裂，裂片三角形，先端尖，花后萼管自近基部处周裂而脱落，遗留的萼管基部宿存，果时增大呈盘状，边缘不反折；花冠漏斗状，长12～16厘米，顶端直径5～7厘米，向下直径渐小，白色，具5棱，裂片5，三角状，先端长尖；雄蕊5，不伸出花冠管外，花药线形、扁平，基部着生；雌蕊1，子房球形，疏生细短刺，2室，胚珠多数，花柱丝状，柱头盾形。蒴果圆球形，表面有疏短刺，成熟后由绿变为淡褐色。种子多数，略呈三角状。花期3～11月。果期4～11月。<br>生长于山坡草地或住宅附近。分布江苏、浙江、福建、广东、广西、湖北，四川等地；上海、南京一带有栽培。<br>②毛曼陀罗，又名：软刺曼陀罗、毛花曼陀罗。<br>一年生草本。形与上种相似，但全体密被白色短柔毛；叶互生或近于对生，叶片广卵形，长8～20厘米，宽5～12厘米，全缘或微呈波状。花白色或淡蓝色，萼管基部宿存，边缘向外反折。蒴果近圆形，密生柔软针刺。花期5～9月。果期6～10月。<br>分布辽宁、河北、江苏、浙江等地；北京、南京、上海等城市均有栽培。<br>以上两种植物的根（曼陀罗根）、叶（曼陀罗叶）、果实（曼陀罗子）亦供药用，各详专条。\", \"wei\": \"辛，温，有毒。<br>①《纲目》：辛，温，有毒。<br>②《生草药性备要》：味甘，性温，有毒。<br>③《本草便读》：辛，温，大毒。\", \"liang\": \"内服：煎汤（或泡水），1～1.5分；入散剂，3～5厘；煎酒或作卷烟吸。外用：煎水洗或研末调敷。\", \"zhi\": \"定喘，祛风，麻醉止痛。治哮喘，惊痫，风湿痹痛，脚气，疮疡疼痛。并作外科手术麻醉剂。<br>①《纲目》：诸风及寒湿脚气，煎汤洗之。又主惊痫及脱肛，并入麻药。<br>②《生草药性备要》：少服止痛，通关利窍，去头风。<br>③《本草便读》：止疮疡疼痛，宣痹着寒哮。<br>④《陆川本草》：治咳嗽，跌打疼痛。\" }] },\n\n{\n  \"name\": \"安神药\",\n  \"num\": 13,\n  \"content\": [\n  { \"name\": \"朱砂\", \"xing\": \"无\", \"wei\": \"甘，微寒；有毒。\", \"liang\": \"0.1～0.5g,多入丸散服，不宜入煎剂。外用适量。\", \"zhi\": \"清心镇惊，安神解毒。用于心悸易惊，失眠多梦，癫痫发狂，小儿惊风，视物昏花，口疮，喉痹，疮疡肿毒。\" },\n  { \"name\": \"水银\", \"xing\": \"①辰砂，详朱砂条。<br>②汞<br>常温下为银白色液体小珠，在-39℃时成等轴晶系之八面体，在350℃挥发成气体。固体时的条痕为银白色，具光亮的金属光泽。比重13.6（液体时）。易挥发。产于辰砂矿的氧化带，常成小珠球存在于矿脉及岩石的洞隙内和浮土中。\", \"wei\": \"辛，寒，有毒。<br>①《本经）：味辛，寒。<br>②《别录》：有毒。\", \"liang\": \"外用：和它药研末调敷。\", \"zhi\": \"杀虫，攻毒。治疥痹，梅毒，恶疮，痔瘘。<br>①《本经》：主疥、瘘、痂、疡、白秃，杀皮肤中虱，堕胎，除热，杀金、银、铜、锡毒。<br>②《本草拾遗》：利水道，去热毒。<br>③《日华子本草》：治天行热疾，催生，下死胎。治恶疮，除风，安神，镇心。<br>④《本草衍义》：治小儿惊热，涎潮。<br>⑤《本草蒙筌》：和大枫子研末，则杀疮虫；佐黄芩为丸。则绝胎孕。<br>⑥《纲目》：镇坠痰逆、呕吐、反胃。<br>⑦《本草汇言》：点搽杨梅恶疮。\" },\n  { \"name\": \"磁石\", \"xing\": \"磁铁矿（《石雅》）\", \"wei\": \"辛咸，平。\", \"liang\": \"内服：煎汤，0.3～1两；或入丸、散。外用：研末掺或调敷。\", \"zhi\": \"潜阳纳气，镇惊安神。治头目眩晕，耳鸣耳聋，虚喘，惊痫，怔忡。\" },\n  { \"name\": \"龙骨\", \"xing\": \"由磷灰石、方解石以及少量粘土矿物组成。<br>1.磷灰石 六方晶系隐晶质，依古代生物骨骼产出。疏松集合体中或有呈晶形小棒状的磷灰石，灰白色。略带油脂状，土状光泽或瓷状光泽。硬度大于指甲，小于小刀。<br>2.方解石 参见方解石条。\", \"wei\": \"甘涩；平；无毒\", \"liang\": \"内服：煎汤，3-5钱；或入丸散。外用：研末撒或调敷。\", \"zhi\": \"镇惊安神；平肝潜阳；固涩；收敛。主惊痫癫狂；心悸怔忡；失眠健忘；头晕目眩；自汗盗汗；遗精遗尿；崩漏带下；久泻久痢；溃疡久不收口及湿疮\" },\n  { \"name\": \"龙齿\", \"xing\": \"无\", \"wei\": \"涩，凉。<br>①《吴普本草》：神农、李氏：大寒。<br>②《药对》：平。<br>③《日华子本草》：涩，凉。\", \"liang\": \"内服：煎汤（宜久煎），3～5钱。\", \"zhi\": \"镇惊安神，除烦热。治惊痫癫狂，烦热不安，失眠多梦。<br>①《本经》：主小儿大人惊痫，癫疾狂走，心下结气，不能喘息，诸痉。<br>②《别录》：小儿惊痫，身热不可近，大人骨间寒热。<br>③《药性论》：镇心，安魂魄。<br>④《日华子本草》：治烦闷，癫痫，热狂。\" },\n  { \"name\": \"琥珀\", \"xing\": \"无\", \"wei\": \"甘，平。\", \"liang\": \"0.5～1钱，多入丸、散剂服。\", \"zhi\": \"镇静，利尿，活血。用于惊风，癫痫，心悸，失眠，小便不利，尿痛，尿血，闭经。\" },\n  { \"name\": \"酸枣仁\", \"xing\": \"酸枣（《本经》），又名：棘（《诗经》），槭（《尔雅》），山枣（陶弘景），野枣（任防《述异记》）。<br>落叶灌木或小乔木，高1～3米。老枝褐色，幼枝绿色；枝上有两种刺，一为针形刺，长约2厘米，一为反曲刺，长约5毫米。叶互生；叶柄极短；托叶细长，针状；叶片椭圆形至卵状披针形，长2.5～5厘米，宽1.2～3厘米，先端短尖而钝，基部偏斜，边缘有细锯齿，主脉3条。花2～3朵簇生叶腋，小形，黄绿色；花梗极短1萼片5，卵状三角形；花瓣小，5片，与萼互生；雄蕊5，与花瓣对生，比花瓣稍长；花盘10浅裂；子房椭圆形，2室，埋于花盘中，花柱短，柱头2裂。核果近球形，直径1～1.4厘米，先端钝，熟时暗红色，有酸味。花期4～5月。果期9～10月。<br>本植物的根皮（酸枣根皮）、棘刺（棘针）、叶（棘叶）、花（棘刺花）亦供药用，各详专条。\", \"wei\": \"甘，平。<br>①《本经》：味酸，平。<br>②《别录》：无毒。<br>③《本草衍义》：微温。<br>④《饮膳正要》：味酸甘，平。\", \"liang\": \"内服：煎汤，2～5钱；或入丸、散。\", \"zhi\": \"养肝，宁心，安神，敛汗。治虚烦不眠，惊悸怔忡，烦渴，虚汗。<br>①《本经》：主心腹寒热，邪结气聚，四肢酸疼，湿痹。<br>②《别录》：主烦心不得眠，脐上下痛，血转久泄，虚汗烦渴，补中，益肝气，坚筋骨，助阴气，令人肥健。<br>③《药性论》：主筋骨风，炒末作汤服之。<br>④《本草拾遗》：睡多生使，不得睡炒熟。<br>⑤王好古：治胆虚不眠，寒也，炒服；治胆实多睡，热也，生用。<br>⑥《本草汇言》：敛气安神，荣筋养髓，和胃运脾。<br>⑦《本草再新》：平肝理气，润肺养阴，温中利湿，敛气止汗，益志定呵，聪耳明目。\" },\n  { \"name\": \"柏子仁\", \"xing\": \"无\", \"wei\": \"甘，平。\", \"liang\": \"3～9g。\", \"zhi\": \"养心安神，止汗，润肠。用于虚烦失眠，心悸怔忡，阴虚盗汗，肠燥便秘。\" },\n  { \"name\": \"灵芝\", \"xing\": \"1.灵芝 担子果一年生，有柄，栓质。菌盖半圆形或肾形，直径10-20cm，盖肉厚1.5-2cm，盖表褐黄色或红褐色，盖边渐趋淡黄，有同心环纹，微皱或平滑，有亮漆状光泽，边缘微钝。菌肉乳白色，近管处淡褐色。菌管长达1cm，每1mm间4-5个。管口近圆形，初白色，后呈淡黄色或黄褐色。菌柄圆柱形，侧生或偏生，偶中生。长10-19cm，粗1.5-4cm，与菌盖色泽相似。皮壳部菌丝呈棒状，顶端膨大。菌丝系统三体型，生殖菌丝透明，薄壁；骨架菌丝黄褐色，厚壁，近乎实心；缠绕菌丝无色，厚壁弯曲，均分枝。孢子卵形，双层壁，顶端平截，外壁透明，内壁淡褐色，有小刺，大小(9-11)μm×(6-7)μm，担子果多在秋季成熟，华南及西南可延至冬季成熟。<br>2.紫芝 与前种的不同点是：紫芝的菌盖多呈紫黑色至近褐黑色；菌肉呈均匀的褐色、深褐色至栗褐色；孢子顶端脐突形，内壁突出的小刺明显，孢子较大，大小(9.5-13.8)μm×(6.9-8.5)μm。\", \"wei\": \"甘；平；无毒\", \"liang\": \"内服：煎汤，10-15g；研末，2-6g；或浸酒。\", \"zhi\": \"益气血；安心神；健脾胃。主虚劳；心悸；失眠；头晕；神疲乏力；久咳气喘；冠心病；矽肺；肿瘤\" },\n  { \"name\": \"首乌藤\", \"xing\": \"无\", \"wei\": \"甘，平。\", \"liang\": \"9～15g；外用适量，煎水洗患处。\", \"zhi\": \"养血安神，祛风通络。用于失眠多梦，血虚身痛，风湿痹痛；外治皮肤瘙痒。\" },\n  { \"name\": \"合欢皮\", \"xing\": \"无\", \"wei\": \"甘，平。\", \"liang\": \"6～12g。外用适量，研末调敷。\", \"zhi\": \"解郁安神，活血消肿。用于心神不安，忧郁失眠，肺痈疮肿，跌扑伤痛。\" },\n  { \"name\": \"合欢花\", \"xing\": \"形态详\\\"合欢皮\\\"条\", \"wei\": \"甘，平。\", \"liang\": \"内服：煎汤，1～3钱；或入丸、散。\", \"zhi\": \"舒郁，理气，安神，活络。治郁结胸闷，失眠，健忘，风火眼疾，视物不清，咽痛，痈肿，跌打损伤疼痛。\" },\n  { \"name\": \"远志\", \"xing\": \"无\", \"wei\": \"苦、辛、温。\", \"liang\": \"3～9g。\", \"zhi\": \"安神益智，祛痰，消肿。用于心肾不交引起的失眠多梦，健忘惊悸，神志恍惚，咳痰不爽，疮疡肿毒，乳房肿痛。\" }] },\n\n{\n  \"name\": \"平肝息风药\",\n  \"num\": 19,\n  \"content\": [\n  { \"name\": \"石决明\", \"xing\": \"无\", \"wei\": \"咸，寒。\", \"liang\": \"3～15g，先煎。\", \"zhi\": \"平肝潜阳，清肝明目。用于头痛眩晕，目赤翳障，视物昏花，青盲雀目。\" },\n  { \"name\": \"珍珠母\", \"xing\": \"1.合渍珠母贝，贝壳为斜四方形，壳质较脆，壳长50-90mm，宽18-32mm，高与长相近，较大个体高可达100mm以上。壳顶位于前方，两侧有耳，前耳较后耳稍小。两壳不等，右壳较平，左壳稍凸，右壳前耳下方有一明显的足丝凹陷。背缘平直；腹缘圆，壳面淡黄褐色，同心生长轮脉极细密，成片状，薄脆易脱落，壳中部常呈磨损状近腹缘的排列紧密，延伸成小舌末端稍翘起，足丝孔大，足丝呈毛发状。壳内面中部珍珠层厚而发达，具极强的珍珠光泽。有的外套膜受刺激后，上皮组织急剧裂殖，形成珍珠囊，且不断分泌珍珠质，才逐渐形成珍珠。壳内面边缘淡黄色，无珍珠层。铰合线直，有一突起主齿，沿铰合线下方有一长齿片。韧带紫褐色，前上掣肌痕明显，位于壳顶下方，闭壳肌痕大，长圆形，前端稍尖，位于壳中央稍近后方。<br>2.珠母贝，贝壳呈不规则圆形，壳质坚厚，一般壳长110-150mm，大者可达200mm左右，高与长近等，左壳稍凸略大于右壳，壳顶位于背缘前端并向前弯，右壳顶前方有一凹陷，为足丝出孔，两壳耳不明显，壳表面棕褐色或绿褐色，壳顶光滑，暗绿色，其余部分被有同心形鳞片，鳞片延伸至壳的边缘呈棘状或锯齿状，中部鳞片常脱落，多数留有淡白色放射状。壳内面珍珠层厚，有虹彩光泽，铰合线直，无齿，韧带强壮，紫褐色，前上掣肌痕较小，闭壳肌痕宽大，长圆形，略呈葫芦状，外套缘黑色，肛门膜具黑色素，肥厚宽大，顶端有一小突起。<br>3.大珠母贝，贝壳近五边形，略圆，壳质坚实厚重，成体壳长超过200mm，大者可达300mm以上，重大4-5kg，是珍珠贝中最大的一种，壳稍平，壳顶位于背缘前端，前耳小，无后耳。壳表面鳞片排列不规则，呈灰黄褐色，放射肋淡褐色，老贝壳体鳞片常脱落，显露珍珠层，放射肋不明显。壳内面具很厚的银白色珍珠层，边缘部黄褐色。铰合部后端稍突出。韧带宽厚，脱落后有一凹痕。闭壳肌痕宽大，的肾形，痕面不平滑，有许多横纹。肛门膜舌形，末端宽圆。<br>4.长耳珠母贝，贝壳近方形，壳长100mm 左右，个体比合浦珠母稍大，壳顶位于前方，无前耳，后耳较长，成翼状突起，右壳较平，左壳稍凸。壳表边缘鳞片层薄，成片翘起。壳内面具银白色珍珠层，闭壳肌痕细长。<br>5.三角帆蚌，贝壳大而扁平，壳质坚硬，外形略呈三角形。左右两壳顶紧接在一起，后背缘长，并向上突起形成大的三角形帆状后翼，前背缘短小，呈尖角状。腹缘近直线，略呈弧形。壳面不平滑，壳顶部刻有粗大的肋脉。生长线同心环状排列，距离宽。贝壳内面平滑，珍珠层乳白色。<br>6.褶纹冠蚌，贝壳较大，略呈不等边三角形。前背缘冠突不明显，后部长高，后背缘向上斜出伸展成为大形的冠。壳的后背部自过错顶起向后有一系列的逐渐粗大的纵肋。腹级长近直线。壳面深黄绿色至黑褐色，壳顶常受侵蚀而丢失表层颜色。珍珠层有光泽。<br>7.背角无齿蚌，贝壳外形呈有角突的卵圆形，前端稍圆，后端呈斜切状，腹缘呈弧形。后背部有自壳顶射出的三条粗肋脉。壳面绿褐色。闭壳肌痕长椭圆形。壳内面珍珠层乳白色。\", \"wei\": \"味甘；咸；性寒\", \"liang\": \"内服：煎汤，10-30g，打碎先煎；右研末，每次1.5-3g；或入丸、散。\", \"zhi\": \"平肝潜阳；安神定惊；清肝明目。主头痛眩晕；心悸失眠；癫狂惊痫；肝热目赤；翳膜遮睛\" },\n  { \"name\": \"牡蛎\", \"xing\": \"①近江牡蛎<br>贝壳2片，坚厚，呈圆形、卵圆形或三角形。左壳附着，较大而厚。右壳（即上壳）略扁平，较左壳（即下壳）小，表面环生极薄而平直的黄褐色或紫褐色鳞片；1～2年的个体，鳞片平、薄、脆，有时呈游离状；2至数年的个体，鳞片平坦，有时在后缘起伏成弱小的水波状；生长多年的个体，鳞片层层相迭，坚厚如石。壳面有灰、青、紫、棕等色彩，内面白色，边缘为灰紫色。韧带紫黑色，闭壳肌痕甚大，淡黄色，大多为卵圆形或肾脏形，位于中部背侧。足退化，无足丝。<br>生活于江河流人海处。杂食性，以细小的浮游生物为食。我国沿海均有分布；广东、福建、山东沿海，并有养殖。<br>②长牡蛎<br>贝壳大型，坚厚，呈长条形，背腹几乎平行，一般壳长比壳高大3倍。左壳附着。右壳较平如盖，鳞片环生，呈波纹状，排列稀疏，层次甚少.壳面淡紫色、灰白色或黄褐色。壳内面瓷白色。闭壳肌痕马蹄形，棕黄色，位于壳的后部背侧。左壳凹下，鳞片较右壳粗大。肉质部软，鳃成直条状，不弯至背后角。<br>我国沿海都分布。为河口及内湾养殖的良种。<br>③大连湾牡蛎<br>贝壳大型，中等厚，前后延长，壳顶至后部渐扩张近似三角形。左壳附着。右壳壳表鳞片起伏成水波状，不如近江牡蛎平伏，放射肋不明显。壳面淡黄色；壳内面白色。闭壳肌痕白色或紫色，位于背后方。肉质部延长形，鳃自前方延伸至后方中央，弯曲度小。<br>分布北方沿海。\", \"wei\": \"咸湿，凉。<br>①《本经》：味咸，平。<br>②《别录》：微寒，无毒。<br>③《本草正》：味微咸微涩，气平。\", \"liang\": \"内服：煎汤，0.3～1两；或入丸、散。外用：研末干撒、调敷或作扑粉。\", \"zhi\": \"敛阴，潜阳，止汗，涩精，化痰，软坚。治惊痫，眩晕，自汗，盗汗，遗精，淋浊，崩漏，带下，瘰疬，瘿瘤。<br>用于惊悸失眠，眩晕耳鸣，瘰疠痰核，瘕痞块，自汗盗汗，遗精崩带，胃痛泛酸。煅牡蛎收敛固涩。用于自汗盗汗，遗精崩带，胃痛吞酸。<br>（1）益阴潜阳：生用治阴虚阳亢之潮热盗汗、头痛眩晕、烦躁失眠等症。<br>（2）软坚散结：生用治瘰疬、肿块。<br>（3）固涩：煅用治多汗、遗精、带下、崩漏、泄泻等，常与龙骨配伍。<br>（4）也可用于胃酸过多，常配乌贼骨。<br>①《本经》：主伤寒寒热，温疟洒洒，惊恚怒气，除拘缓鼠瘘，女子带下赤白。久服强骨节。<br>②《别录》：除留热在关节荣卫，虚热去来不定，烦满；止汗，心痛气结，止渴，除老血。涩大小肠，止大小便，疗泄精，喉痹，咳嗽，心胁下痞热。<br>③《药性论》：主治女子崩中。止盗汗，除风热，止痛。治温疟。又和杜仲服止盗汗。病人虚而多热，加用地黄、小草。<br>④《本草拾遗》：捣为粉，粉身，主大人小儿盗汗，和麻黄根、蛇床子、干姜为粉，去阴汗。<br>⑤《海药本草》：主男子遗精，虚劳乏损，补肾正气，止盗汗，去烦热，治伤寒热痰，能补养安神，治孩子惊痫。<br>⑥《珍珠囊》：软痞积。又治带下，温疟，疮肿，为软坚收涩之剂。<br>⑦《纲目》：化痰软坚，清热除湿，止心脾气痛，痢下，赤白浊，消疝瘕积块，瘿疾结核。<br>⑧《医学衷中参西录》：止呃逆。<br>⑨《现代实用中药》：为制酸剂，有和胃镇痛作用，治胃酸过多，身体虚弱，盗汗及心悸动惕、肉p等。对于怀孕妇及小儿钙质缺乏与肺结核等有效。\" },\n  { \"name\": \"贝齿\", \"xing\": \"无\", \"wei\": \"咸，平。\", \"liang\": \"2～4钱。\", \"zhi\": \"清心安神，平肝明目。用于惊悸心烦不眠，小儿斑疹，目赤云翳。\" },\n  { \"name\": \"代赭石\", \"xing\": \"赤铁矿，三方晶系。晶体常呈薄片状、板状。一般以致密块状、肾状、葡萄状、豆状、鱼子状、土状等集合体最为常见。结晶者呈铁黑色或钢灰色；土状或粉末状者，呈鲜红色。但条痕都呈樱桃红色。结晶者呈金属光泽，土状者呈土状光泽。硬度5.5-6，但土状粉末状者硬度很小，比重5-5.3。在还原焰中烧后有磁性。\", \"wei\": \"苦甘；平；寒；无毒\", \"liang\": \"内服：煎汤，0.3-1两；或入丸、散。\", \"zhi\": \"平肝潜阳；重镇降逆；凉血止血。主头痛；眩晕；心悸；癫狂；惊痫；呕吐；噫气；呃逆；噎膈；咳嗽；气喘；吐血；鼻衄；崩漏；便血；尿血\" },\n  { \"name\": \"刺蒺藜\", \"xing\": \"1．蒺藜 一年生草本。茎通常由基部分枝，平卧地面，具棱条，长可达1m左右；全株被绢丝状柔毛。托叶披针形，形小而尖，长约3mm；叶为偶数羽状复叶，对生，一长一短；长叶长3-5cm；宽l.5-2cm，通常具6-8对小叶；短叶长1-2cm，具3-5对小叶；小叶对生，长圆形，长4-15mm，先端尖或钝，表面无毛或仅沿中脉有丝状毛，背面被以白色伏生的丝状毛。花淡黄色，小型，整齐，单生于短叶的叶腋；花梗长4-10mm，有时达20mm；萼5，卵状披针形，渐尖，长约4mm，背面有毛，宿存；花瓣5，倒卵形，先端略呈截形，与萼片互生；雄蕊10，着生与花盘基部，基部有鳞片状腺体。子房5心皮。果实为离果，五角形或球形，由5个呈星状排列的果瓣组成，每个果瓣具长短棘刺各1对，背面有短硬毛及瘤状突起。花期5-8月，果期6-9月。\", \"wei\": \"味苦；辛；性平\", \"liang\": \"内服：煎汤，6-9g，或入丸、散。外用：适量，水 煎洗；或研末调敷。\", \"zhi\": \"平肝；解郁；祛风明目。主头痛；眩晕；胸胁胀痛；乳房胀痛；乳闭不通；经闭；目赤翳障；风疹瘙痒；白癜风；疮疽；瘰疬\" },\n  { \"name\": \"罗布麻叶\", \"xing\": \"半灌木，高1～1.5m，有乳汗，无毛。枝紫红色或淡红色。叶对生，椭圆状披针形至长圆形，长1～8cm，宽0.5～2.2cm，先端钝圆，有小芒尖，基部宽楔形，边缘有不明显的细锯齿。聚伞花序顶生；花萼5深裂，被短毛；花冠粉红色、浅紫红色，钟形，先端5裂，两面具颗粒状突起；副花冠5；雄蕊5；心皮2，离生。骨突果叉生。种子顶端簇生白色细长毛。花期6～8月，果期9～10月。\", \"wei\": \"性凉，味甘、苦。\", \"liang\": \"3～10克。水煎服；单味浸泡代茶服。\", \"zhi\": \"清泻肝火、平肝熄风。用于肝火炽盛之头痛眩晕、惊风抽搐。本品有降低血压的作用。\" },\n  { \"name\": \"羚羊角\", \"xing\": \"赛加羚羊，身体大小与黄羊相似，长1-1.4m，体重雄兽为37-60kg，雌兽约29-37kg。头型较特别，耳廓短小，眼眶突出。鼻端大，鼻中间具槽，鼻孔呈明显的筒状，整个鼻子呈肿胀鼓起，故谓高鼻羚羊。雄羊具角1对，不分叉，角自基部长出后几乎竖直向上，至生长到整个角的1/3高度时，二角略向外斜，接着又往上，往里靠近再又微微向外，最后二角相向略往内弯。角尖端平滑，而下半段具环棱。角呈半透明状，内蜡色。整个体色呈灰黄色，但体侧较灰白。冬季时毛色显得更淡。\", \"wei\": \"味咸；性寒\", \"liang\": \"内服：煎汤，1.5-3g，宜单煎2h以上；磨汁或研末，0.3-0.6g；或入丸、散。外用：适量，煎汤或磨汁涂敷。\", \"zhi\": \"平肝息风；清肝明目；凉血解毒。主肝风内动惊痫抽搐；筋脉拘挛；肝阳头疼眩晕；肝火目赤肿痛以及血热出血；温病发斑；痈肿疮毒\" },\n  { \"name\": \"山羊角\", \"xing\": \"1.青羊，体长0.9-1.1m，尾长13-17cm，重约30kg。四肢短，蹄狭窄。眶下腺甚为退化，有足腺，无鼠踩腺。雌雄皆有角，角短而直，斜向后上方伸出，二角基部很靠近，尖端略向下弯。余部角有环棱。一般身体色为灰棕色，个体有差异或呈深灰或为棕褐色。喉部后方有一白斑。四肢、腹部、尾几同身色。<br>2.北山羊，个体大，肩高约1m，尾长超过耳长，重40-50kg。雄羊颌下有须，长约15cm，雌羊须很短。无眶下腺，雄羊有尾下腺，前肢有足腺。雌性角小，雄性角发达，长达1m左右，斜向后方生长，形如弯刀，角横切面呈三角形，平面朝前，角上有许多大而显着之横棱。自头枕部沿背脊到尾基部，有一条黑色纵纹。胸部及腹侧黑色，腹面白色。四肢前面由上至下有黑棕色纵纹，尾向体背色，尾尖棕黑色。<br>3.盘羊，体形中等大，健壮，身高1.1m，长约1.5m左右。肩高大于臀高。耳较小，尾短不及耳长。雌雄均有角。雄性角粗大，尤以基部为甚。角往侧面弯曲成360度的圆形螺旋。角鞘外面有明显而狭的环棱。近基部则消失。角长1m。雌性角小，约为雄性角的1/5。体背浅灰棕或暗棕色，胸腹部黄棕色，下腹及鼠踩部白色，臀部有白斑。尾色与体背相似，尾上面并有一棕色中线。\", \"wei\": \"味咸；性寒\", \"liang\": \"内服：煎汤，30-50g；或磨粉；或烧焦研末，3-6g。外用,0.6-0.9g，研末吹耳中。\", \"zhi\": \"清热；镇惊；散瘀止痛。主小儿发热惊痫；头痛；产后腹痛；痛经\" },\n  { \"name\": \"牛黄\", \"xing\": \"无\", \"wei\": \"苦甘，凉。<br>①《本经》：味苦，平。<br>②《吴普本草》：无毒。<br>③《别录》：有小毒。<br>④《药性论》：味甘。<br>⑤《日华子本草》：凉。\", \"liang\": \"内服：入丸、散，0.5～1.5分。外用：研末撒或调敷。\", \"zhi\": \"清心，化痰，利胆，镇惊。治热病神昏、谵语，癫痫发狂，小儿惊风抽搐，牙疳，喉肿，口舌生疮，痈疽，疔毒。<br>①《本经》：主惊痫，寒热，热盛狂妗<br>②《别录》：疗小儿诸痫热，口不开；大人狂癫。又堕胎。<br>③《药性论》：小儿夜啼，主卒中恶。<br>④孙思邀：益肝胆，定精神，除热，止惊痢，辟恶气。<br>⑤《日华子本草》：疗中风失音，口噤，妇人血噤，惊悸，天行时疾，健忘虚乏。<br>⑥《日用本草》：治惊病搐搦烦热之疾，清心化热，利痰凉惊。<br>⑦《纲目》：痘疮紫色，发狂谵语者可用。<br>⑧《会药医镜》：疗小儿急惊，热痰壅塞，麻疹余毒，丹毒，牙疳，喉肿，一切实证垂危者。\" },\n  { \"name\": \"珍珠\", \"xing\": \"1.合渍珠母贝，贝壳为斜四方形，壳质较脆，壳长50-90mm，宽18-32mm，高与长相近，较大个体高可达100mm以上。壳顶位于前方，两侧有耳，前耳较后耳稍小。两壳不等，右壳较平，左壳稍凸，右壳前耳下方有一明显的足丝凹陷。背缘平直；腹缘圆，壳面淡黄褐色，同心生长轮脉极细密，成片状，薄脆易脱落，壳中部常呈磨损状近腹缘的排列紧密，延伸成小舌末端稍翘起，足丝孔大，足丝呈毛发状。壳内面中部珍珠层厚而发达，具极强的珍珠光泽。有的外套膜受刺激后，上皮组织急剧裂殖，形成珍珠囊，且不断分泌珍珠质，才逐渐形成珍珠。壳内面边缘淡黄色，无珍珠层。铰合线直，有一突起主齿，沿铰合线下方有一长齿片。韧带紫褐色，前上掣肌痕明显，位于壳顶下方，闭壳肌痕大，长圆形，前端稍尖，位于壳中央稍近后方。<br>2.珠母贝，贝壳呈不规则圆形，壳质坚厚，一般壳长110-150mm，大者可达200mm左右，高与长近等，左壳稍凸略大于右壳，壳顶位于背缘前端并向前弯，右壳顶前方有一凹陷，为足丝出孔，两壳耳不明显，壳表面棕褐色或绿褐色，壳顶光滑，暗绿色，其余部分被有同心形鳞片，鳞片延伸至壳的边缘呈棘状或锯齿状，中部鳞片常脱落，多数留有淡白色放射状。壳内面珍珠层厚，有虹彩光泽，铰合线直，无齿，韧带强壮，紫褐色，前上掣肌痕较小，闭壳肌痕宽大，长圆形，略呈葫芦状，外套缘黑色，肛门膜具黑色素，肥厚宽大，顶端有一小突起。<br>3.大珠母贝，贝壳近五边形，略圆，壳质坚实厚重，成体壳长超过200mm，大者可达300mm以上，重大4-5kg，是珍珠贝中最大的一种，壳稍平，壳顶位于背缘前端，前耳小，无后耳。壳表面鳞片排列不规则，呈灰黄褐色，放射肋淡褐色，老贝壳体鳞片常脱落，显露珍珠层，放射肋不明显。壳内面具很厚的银白色珍珠层，边缘部黄褐色。铰合部后端稍突出。韧带宽厚，脱落后有一凹痕。闭壳肌痕宽大，的肾形，痕面不平滑，有许多横纹。肛门膜舌形，末端宽圆。<br>4.长耳珠母贝，贝壳近方形，壳长100mm 左右，个体比合浦珠母稍大，壳顶位于前方，无前耳，后耳较长，成翼状突起，右壳较平，左壳稍凸。壳表边缘鳞片层薄，成片翘起。壳内面具银白色珍珠层，闭壳肌痕细长。<br>5.三角帆蚌，贝壳大而扁平，壳质坚硬，外形略呈三角形。左右两壳顶紧接在一起，后背缘长，并向上突起形成大的三角形帆状后翼，前背缘短小，呈尖角状。腹缘近直线，略呈弧形。壳面不平滑，壳顶部刻有粗大的肋脉。生长线同心环状排列，距离宽。贝壳内面平滑，珍珠层乳白色。<br>6.褶纹冠蚌，贝壳较大，略呈不等边三角形。前背缘冠突不明显，后部长高，后背缘向上斜出伸展成为大形的冠。壳的后背部自过错顶起向后有一系列的逐渐粗大的纵肋。腹级长近直线。壳面深黄绿色至黑褐色，壳顶常受侵蚀而丢失表层颜色。珍珠层有光泽。<br>7.背角无齿蚌，贝壳外形呈有角突的卵圆形，前端稍圆，后端呈斜切状，腹缘呈弧形。后背部有自壳顶射出的三条粗肋脉。壳面绿褐色。闭壳肌痕长椭圆形。壳内面珍珠层乳白色。\", \"wei\": \"味甘；咸；性寒\", \"liang\": \"内服：研末，每次0.3-1g，多入丸、散，不入汤剂。外用：适量，研末干撒、点眼或吹喉。\", \"zhi\": \"安神定惊；清肝明目；解毒生肌。主惊悸怔仲；心烦失眠；惊风癫痫；目赤翳障；口舌生疮；咽喉溃腐；疮疡久不收口\" },\n  { \"name\": \"钩藤\", \"xing\": \"1.钩藤 常绿木质藤本，长可达10m。小枝四棱柱形，褐色，季净无毛。叶腋有成对或单生的钩，向下弯曲，先端尖，长约1.7-2cm。叶对生；具短柄；叶片卵形，卵状长圆形或椭圆形，长5-12cm，宽3-7cm，先端渐尖，基部宽楔形，全缘，上面光亮，下面在脉腋内常有束毛，略呈粉白色，干后变褐红色；托叶2深裂，裂片条状钻形，长6-12mm。头状花序单个腋生或为顶生的总状花序式排列，直径2-2.5cm；总花梗纤细，长2-5cm；花黄色，花冠合生，上部5裂，裂片外被粉状柔毛；雄蕊5；子房下位。蒴果倒卵形或椭圆形，被疏柔毛，有宿存萼。种子两端有翅。\", \"wei\": \"甘苦；微寒\", \"liang\": \"内服：煎汤6-30g。不宜久煎；或入散剂。\", \"zhi\": \"用于治疗高血压病有一定疗效。据100余例的观察，服药后多数患者血压均有不同程度的下降，有的可降至正常或接近正常范围。随着血压的下降，头晕、头痛、心慌、气促、失眠等自觉症状亦相应减轻或消失。据部分病例观察，血压下降开始于服药后2-7日，10日之后降压效果即很显着，有时还可继续下降。血压下降的曲线呈斜坡状，显示本品作用温和。个别病例在服药期间有回升现象，但波动的幅度甚小，且不伴有症状恶化。对神经机能失调者疗效甚显着，服药5-10天症状即可明显减轻。病期愈早疗效愈好，属于第三期者多无降压效果，但有些患者血压虽无阴显变化，而症状却有明显改善。治疗中未见副作用。用法：钩藤加水煮沸10-20分钟，使成20%浓度，每次20-30ml，日服3次；或每日用钩藤2两，放入沸水中保持沸点15-20分钟，制成煎液20Oml，中、晚分服，4-6曰为一疗程。根据祖国医学传统经验，钩藤不宜久煎，否则影响效力；现代药理实验亦证明，钩藤煮沸超过20分钟时，降压的有效成分便部分破坏、日用量3-5钱的疗效不满意，而以2-2.5两疗效较好。\" },\n  { \"name\": \"天麻\", \"xing\": \"天麻，又名：赤箭、离母（《本经》），神草（《吴普本草》），独摇芝（《抱朴子》），赤箭脂、定风草（《药性论》），合离（《酉阳杂俎》），合离草、独摇（《本草图经》），白龙皮、赤箭芝（《纲目》），自动草（《湖南药物志》）。\", \"wei\": \"甘，平。\", \"liang\": \"内服：煎汤，1.5～3钱；或入丸、散。\", \"zhi\": \"息风，定惊。治眩晕眼黑，头风头痛，肢体麻木，半身不遂，语言蹇涩，小儿惊痫动风。\" },\n  { \"name\": \"红缘层孔菌\", \"xing\": \"松生拟层孔菌 子实体多年生，木质。菌盖半圆形、扇形或马蹄形，侧生，(4-30)cm×(6-40)cm，厚2.5-20cm，盖面初期有一层橙红色胶样皮壳，后渐变硬，颜色变为灰色、污灰色、黑褐色至黑色，有明显的环棱；盖缘钝，薄或厚，新生的盖缘近白色，渐变灰黄色、红色至红褐色。管口面白色或乳白色，干燥后呈黄色或米黄色；管口小，圆形，每1mm间3-5个，管壁厚；菌管多层，每层厚3-5mm，新鲜之菌管层可与上层剥离。菌肉木栓质至木质，近白色，干燥后呈淡褐色，有环纹。有小囊状体，无色，薄壁。孢子卵形至椭圆形，光滑，无色，(5.5-7.5)μm×(3.5-4)μm。\", \"wei\": \"微苦；平\", \"liang\": \"内服：煎汤，6-15g。\", \"zhi\": \"祛风除湿。主风寒湿痹；关节疼痛\" },\n  { \"name\": \"地龙\", \"xing\": \"1.参环毛蚓，体较大，长110-380mm，宽5-12mm。体背部灰紫色，腹面稍淡。前端较尖，后端较圆，长圆柱形。头部退化，口位在体前端。全体由100多个体节组成。每节有一环刚毛，刚毛圈稍白。第14-16节结构特殊，形成环带，无刚毛。雌性生殖孔1个位于第14节腹面正中，雄性生殖也1对位于第18节腹面两侧，受精囊孔3对位于6-7，7-8，8-9节间。 2.威廉环毛蚓，体长96-150mm，宽5-8mm。背面青黄色或灰青色，背中浅深青色。环带占14-16三节，无刚毛。身体上刚毛较细，前端腹面并不粗而疏。雄生殖孔在18节两侧一浅交配腔内，陷入时呈纵裂缝，内壁有褶皱，褶皱间有刚毛2-3条，在腔底突起上为雄孔，突起前面通常有孔头突。受精囊孔3对，在6-7，7-8，8-9节间，孔在一横裂中的小突起上，无受精囊腔。8-9，9-10节间缺隔膜，盲肠简单。受精囊的盲管内端2/3在平面上，左右弯曲，为纳精囊。 3.通俗环毛蚓，本种身体大小、色泽及内部构造与威廉环毛蚓相似。唯受精囊腔较深广，前后缘均隆肿，外面可见腔内大小乳突各一。雄交配腔亦深广，内壁多皱纹，有平顶乳突3个，位置在腔底，有一突为雄孔所在处，能全部翻出，一如阴茎。\", \"wei\": \"味咸；性寒\", \"liang\": \"内服：煎汤，5-10g；或末，每次1-2g；或入丸、散；或鲜品拌糖或盐化水服。外用：适量，鲜品捣烂敷或取汁涂敷；研末撒或调涂。\", \"zhi\": \"用于高热神昏，惊痫抽搐，关节痹痛，肢体麻木，半身不遂，肺热喘咳，尿少水肿；高血压。\" },\n  { \"name\": \"全蝎\", \"xing\": \"体长约6厘米，分为头胸部及腹部2部。头胸部较短，7节，分节不明显，背面覆有头胸甲，前端两侧各有1团单眼，头胸甲背部中央处，另有1对，如复眼。头部有附肢2对，1对为钳角，甚小；1对为强大的脚须，形如蟹螯。胸部有步足4对，每足分为7节，末端各有钩爪2枚。腹部甚长，分前腹及后腹两部，前腹部宽广，共有7节，第1节腹面有一生殖厣，内有生殖孔；第2节腹面有1对栉板，上有齿16～25个；第3～6节的腹面，各有肺书孔1对。后腹部细长，分为5节和1节尾刺，后腹部各节皆有颗粒排列而成的纵棱数条。尾刺呈钩状，上屈，内有毒腺。\", \"wei\": \"咸辛，平，有毒。\", \"liang\": \"内服：煎汤，全蝎0.8～1.5钱，蝎尾3～5分；或入丸、散。外用：研末调敷。\", \"zhi\": \"①治疗癫痫\" },\n  { \"name\": \"蜈蚣\", \"xing\": \"1.少棘蜈蚣，成体体长110-140mm。头板和第1背板金黄色，自第2背板起墨绿色或暗绿色，末背板有时近于黄褐色，胸腹板和步足淡黄色。背板自4-9节起，有两条不显着的纵沟。腹板在第2-19节间有纵沟。第3、第5、第8、第10、第12、第14、第16、第18、第20体节的两侧各具气门1对。头板前部的两侧各有4个单眼，集成左、右眼群颚肢内部有毒腺；齿板前缘具小齿5个，内侧3小齿相接近。步足21对，最末步足最长，伸向后方，呈尾状；基侧板后端有2小棘；前腿节腹面外侧有2棘，内侧有1棘；背面内侧有1棘和1隅棘；隅棘顶端有2小棘。<br>2.多棘蜈蚣，本种与少棘蜈蚣是两个近似的地理亚种。在形态上大体相似，主要区别是：个体较大；尾足的前股节背面内侧棘数、腹面外侧棘数、腹面内侧棘数均较少棘蜈蚣为多；颚肢齿板的齿数亦多。\", \"wei\": \"味辛；性温；有毒\", \"liang\": \"内服：煎汤，2-5g；研末，0.5-1g；或入丸、散。外用：适量，研末撒、油浸或研末调敷。\", \"zhi\": \"祛风止痉；通络止痛；攻毒散结。主惊风，癫痫；痉挛抽搐；中风口?；破伤风；风湿顽痹；偏正头痛；毒蛇咬伤；疮疡；瘰疬\" },\n  { \"name\": \"僵蚕\", \"xing\": \"无\", \"wei\": \"咸、辛，平。\", \"liang\": \"5～9g。\", \"zhi\": \"祛风定惊，化痰散结。用于惊风抽搐，咽喉肿痛，皮肤瘙痒，颌下淋巴结炎，面神经麻痹。\" },\n  { \"name\": \"僵蛹\", \"xing\": \"家蚕蛾，雌、雄蛾全身均密被白色鳞片。体长1.6-2.3cm。翅展3.9-4.3cm。体翅黄白色至灰白色。前翅外缘顶角后方向内凹切，各横线色稍暗，不甚明显，端线与翅脉灰褐色，后翅较前翅色淡，边缘有鳞毛稍长。雌蛾腹部肥硕，末端钝圆；雄蛾腹部狭窄，末端稍尖。幼虫即家蚕，体色灰白至白色，胸部第2、第3节稍见膨大，有皱纹。腹部第8节背面有一尾角。\", \"wei\": \"味咸；辛；性平\", \"liang\": \"内服：研末，1.5-6g；或制成片剂用。\", \"zhi\": \"清热镇惊；化痰止咳；消肿散结。主高热惊风；痉挛抽搐；癫痫；急性喉炎；肋腺炎；急、慢性支气管炎；荨麻疹；高脂血症\" }] },\n\n{\n  \"name\": \"开窍药\",\n  \"num\": 6,\n  \"content\": [\n  { \"name\": \"麝香\", \"xing\": \"无\", \"wei\": \"辛，温。\", \"liang\": \"0.03～0.1g，多入丸散用。外用适量。\", \"zhi\": \"开窍醒神，活血通经，消肿止痛。用于热病神昏，中风痰厥，气郁暴厥，中恶昏迷，经闭，L瘕，难产死胎，心腹暴痛，痈肿瘰疬，咽喉肿痛，跌扑伤痛，痹痛麻木。\" },\n  { \"name\": \"冰片\", \"xing\": \"无\", \"wei\": \"辛、苦，微寒。\", \"liang\": \"0.15～0.3g，入丸散用；外用研粉点敷患处。\", \"zhi\": \"开窍醒神，清热止痛。用于热病神昏、痉厥，中风痰厥，气郁暴厥，中恶昏迷，目赤，口疮，咽喉肿痛，耳道流脓。\" },\n  { \"name\": \"苏合香\", \"xing\": \"乔木，高10～15米。叶互生；具长柄；托叶小，早落；叶片掌状5裂，偶为3或7裂，裂片卵形或长方卵形，先端急尖，基部心形，边缘有锯齿。花小，单性，雌雄同株，多数成圆头状花序，黄绿色。雄花的花序成总状排列；雄花无花被，仅有苞片；雄蕊多数，花药矩圆形，2室纵裂，花丝短。雌花的花序单生；花柄下垂；花被细小；雄蕊退化；雌蕊多数，基部愈合，子房半下位，2室，有胚珠数颗，花柱2枚，弯曲。果序圆球状，直径约2.5厘米，聚生多数蒴果，有宿存刺状花柱；蒴果先端喙状，成熟时顶端开裂。种子1或2枚，狭长圆形，扁平，顶端有翅。\", \"wei\": \"辛，温。<br>①《别录》：味甘，温，无毒。<br>②《本草正》：味甘辛，性温。\", \"liang\": \"内服：入丸剂。外用：溶于酒精，涂敷。\", \"zhi\": \"通窍，辟秽，开郁，豁痰。治卒然昏倒，痰壅气厥，惊痫，温疟，心腹猝痛，疥癣，冻疮。<br>①《别录》：主辟恶，温疟，痫b。去三虫，除邪，令人无梦魇。<br>②《本草正》：杀虫毒。疗癫痫，止气逆疼痛。<br>③《本草备要》：走窜，通窍开郁，辟一切不正之气。<br>④《玉楸药解》：利水消肿，治胀，疹X，气积血Y，调和脏腑。\" },\n  { \"name\": \"安息香\", \"xing\": \"1.乔木，高10-20m。树皮绿棕色，内皮棕黑色，木质部棕红色，幼枝被棕色星状毛。叶互生；柄长约1cm；叶片长卵形，长达11cm，宽达4.5cm，先端急尖或渐尖.基部阔楔形或近圆形，上面略有光泽，下面密被白色短星状毛，叶缘有不规则的锯齿。由总状花序集成圆锥花序，顶生或腋生，花梗被毛，苞片小，早落；花萼短钟状，5齿裂，裂片披针形，花冠白色，5深裂，裂片披针形，长约为萼筒的3倍，花萼及花瓣外面均被银白色丝状毛，内面棕红色；雄蕊8-10，花药线形，花丝基部联合成管；子房上位，卵形，密被白色茸毛，上部1室，下部2-3室，花柱细长，棕红色。果实扁球形，长约2cm，灰棕色。种子坚果状，红棕色，每室有种子1枚，具6纵纹。\", \"wei\": \"辛；苦；性平\", \"liang\": \"内服：研末，0.3-1.5g；或入丸、散。\", \"zhi\": \"开窍醒神；豁痰辟秽；行气活血；止痛。主中风痰劂；惊痫昏迷，产后血晕；心腹疼痛；风痹肢节痛\" },\n  { \"name\": \"石菖蒲\", \"xing\": \"石菖蒲，多年生草本。根茎横卧，芳香，粗5-8mm，外皮黄褐色，节间长3-5mm，根肉南，具多数须根，根茎上部分枝甚密，因而植株成丛生状，分枝常被纤维状宿存叶基。叶片薄，线形，长20-30（-50）cm，基部对折，中部以上平展，宽7-13mm，先端渐狭，基部两侧膜质，叶鞘宽可达5mm，上延几达叶片中部，暗绿色，无中脉，平行脉多数，稍隆起。花序柄腑生，长4-15cm，三棱形。叶状佛焰苞长13-25cm，为肉穗花序长的2-5倍或更长，稀近等长；肉穗花序圆柱状，长2.5-8.5cm，粗4-7mm，上部渐尖，直立或稍弯。花白色。成熟果穗长7-8cm，粗可达1cm；幼果绿色，成熟时黄绿色或黄白色。花、果期2-6月。\", \"wei\": \"味辛；苦；性微温\", \"liang\": \"内服：煎汤，3-6g，鲜品加倍；或入丸、散。外用：适量，煎水洗；或研末调敷。\", \"zhi\": \"化痰开窍；化湿行气；祛风利痹；消肿止痛。主热病神昏；痰厥；健忘；耳鸣；耳聋；脘腹胀痛；噤口痢；风湿痹痛；跌打损伤；痈疽疥癣\" },\n  { \"name\": \"九节菖蒲\", \"xing\": \"阿尔泰银莲花，又名：菊形双瓶梅。\", \"wei\": \"辛，微温。\", \"liang\": \"内服：煎汤，0.8～1.5钱；或入丸、散。外用：煎水洗浴或研末调敷。\", \"zhi\": \"开窍，豁痰，祛风，宣湿，健胃，解毒。治热病神昏谵语，癫痫痰厥，气闭耳聋，多梦健忘，胸痞呕恶，风湿痹痛，疮疥肿毒。\" }] },\n\n{\n  \"name\": \"补虚药\",\n  \"num\": 74,\n  \"content\": [\n  { \"name\": \"人参\", \"xing\": \"多年生宿根草本，高30～60厘米。主根肥厚，肉质，黄白色，圆柱形或纺锤形，下面稍有分枝；根状茎（芦头）短，直立。茎直立，圆柱形，不分枝；一年生植株茎顶只有一叶，叶具三小叶，俗名三花；二年生茎仍只一叶，但具5小叶，叫巴掌；三年生者具有二个对生的5小叶的复叶，叫二甲子；四年生者增至3个轮生复叶，叫灯台子；五年生者增至4个轮生复叶，叫四匹叶；六年生者茎顶有5个轮生复叶，叫五匹叶；复叶掌状，小叶3～5片，中间3片近等大，有小叶柄；小叶片椭圆形或微呈倒卵形，长4～15厘米，宽2～6.5厘米，先端渐尖，基部楔\", \"wei\": \"甘、微苦，微温。\", \"liang\": \"0.5～3钱，大量可用至1两。\", \"zhi\": \"补气，固脱，生津，安神，益智。用于气短喘促，心悸健忘，口渴多汗，食少无力，一切急慢性疾病及失血后引起的休克、虚脱。\" },\n  { \"name\": \"红参\", \"xing\": \"无\", \"wei\": \"甘、微苦，温。\", \"liang\": \"3～9g。\", \"zhi\": \"大补元气，复脉固脱，益气摄血。用于体虚欲脱，肢冷脉微，气不摄血，崩漏下血；心力衰竭，心原性休克。\" },\n  { \"name\": \"人参叶\", \"xing\": \"无\", \"wei\": \"苦、甘、寒。\", \"liang\": \"3～9g。\", \"zhi\": \"补气，益肺，祛暑，生津。用于气虚咳嗽，暑热烦躁，津伤口渴，头目不清，四肢倦乏。\" },\n  { \"name\": \"西洋参\", \"xing\": \"多年生草木，全体无毛。根肉质，纺锤形，有时呈分歧状。根茎短。茎圆柱形，长约25厘米，有纵条纹，或略具棱。掌状5出复叶，通常3～4枚，轮生于茎端；叶柄长5～7厘米；小叶片膜质，广卵形至倒卵形，长4～9厘米，宽2.5～5厘米，先端突尖，边缘具粗锯齿，基部楔形，最下两小叶最小；小叶柄长约1.5厘米，最下二小叶柄较短或近于无柄。总花梗由茎端叶柄中央抽出，较叶柄稍长或近于等长；伞形花序，花多数，花梗细短，基部有卵形小苞片1枚；萼绿色，钟状，先端5齿裂，裂片钝头，萼筒基部有三角形小苞片1枚；花瓣5，绿白色，矩圆形；雄蕊5，花丝基部稍宽，花药卵形至矩圆形；雌蕊1，子房下位，2室，花柱2，上部分离呈叉状，下部合生；花盘肉质环状。浆果扁圆形，成对状，熟时鲜红色，果柄伸长。花期7月。果熟期9月。\", \"wei\": \"甘微苦，凉。<br>①《本草从新》：苦微甘，寒。<br>②《本草再新》：味甘辛，性凉，无毒。\", \"liang\": \"内服：煎汤（另煎和服），0.8～2钱。\", \"zhi\": \"益肺阴，清虚火，生津止渴。治肺虚久嗽，失血，咽干口渴，虚热烦倦。<br>①《本草从新》：补肺降火，生津液，除烦倦。虚而有火者相宜。<br>②《药性考》：补阴退热。姜制益气，扶正气。<br>③《本草再新》：治肺火旺，咳嗽痰多，气虚呵喘，失血，劳伤，固精安神，生产诸虚。<br>④《本草求原》：清肺肾，凉心脾以降火，消暑，解酒。<br>⑧《医学衷中参西录》：能补助气分，并能补益血分。\" },\n  { \"name\": \"党参\", \"xing\": \"党参，又名：辽参、三叶菜、叶子草。<br>多年生草本。根长圆柱形，直径1～1.7厘米，顶端有一膨大的根头，具多数瘤状的茎痕，外皮乳黄色至淡灰棕色，有纵横皱纹。茎缠绕，长而多分歧，下部疏生白色粗糙硬毛，上部光滑或近于光滑。叶对生、互生或假轮生：具柄，叶柄长0.5～4厘米，被疏柔毛：叶片卵形或广卵形，长1～7厘米，宽0.8～5.5厘米，先端钝或尖，基部截形或浅心形，全缘或微波状，上面绿色，被粗伏毛，下面粉绿色，密被疏柔毛。花单生，具细花梗；花萼绿色，具5裂片，裂片长圆状披针形，先端钝，光滑或稍被茸毛；花冠广钟形，直径2～2.5厘米，淡黄绿色，且有淡紫堇色斑点，先端5裂，裂片三角形至广三角形，直立；雄蕊5，花丝中部以下扩大；子房上位，3室，胚珠多数，花柱短，柱头3，极阔，呈漏斗状。蒴果圆锥形，3室，有宿存花萼。种子小，褐色有光泽。花期8～9月。果期9～10月。\", \"wei\": \"甘，平。<br>①《本经逢原》：甘，平。<br>②《本草再新》：甘，平，无毒。\", \"liang\": \"内服：煎汤，3～5钱，大剂1～2两；熬膏或入丸、散。\", \"zhi\": \"补中，益气，生津。治脾胃虚弱，气血两亏，体倦无力，食少，口渴，久泻，脱肛。<br>①《本经逢原》：清肺。<br>②《本草从新》：补中益气，和脾胃，除烦渴。<br>③《纲目拾遗》：治肺虚，益肺气。<br>④《科学的民间药草》：补血剂。适用于慢性贫血，萎黄病，白血病，腺病，佝偻病。<br>⑤《中药材手册》：治虚劳内伤，肠胃中冷，滑泻久痢，气喘烦渴，发热自汗，妇女血崩、胎产诸病。\" },\n  { \"name\": \"明党参\", \"xing\": \"无\", \"wei\": \"甘、微苦，微寒。\", \"liang\": \"6～12g。\", \"zhi\": \"润肺化痰，养阴和胃，平肝，解毒。用于肺热咳嗽，呕吐反胃，食少口干，目赤眩晕，疔毒疮疡。\" },\n  { \"name\": \"太子参\", \"xing\": \"无\", \"wei\": \"甘、微苦，平。\", \"liang\": \"9～30g。\", \"zhi\": \"益气健脾，生津润肺。用于脾虚体倦，食欲不振，病后虚弱，气阴不足，自汗口渴，肺燥干咳。\" },\n  { \"name\": \"黄芪\", \"xing\": \"多年生草本。茎直立，上部有分枝。奇数羽状复叶互生，小叶12～18对；小叶片广椭圆形或椭圆形，下面被柔毛；托叶披针形。总状花序腋生；花萼钟状，密被短柔毛，具5萼齿；花冠黄色，旗瓣长圆状倒卵形，翼瓣及龙骨瓣均有长爪；雄蕊10，二体；子房有长柄。荚果膜质，半卵圆形，无毛。花期6～7月，果期7～9月。\", \"wei\": \"性温，味甘。\", \"liang\": \"无\", \"zhi\": \"补气固表，托毒排脓，利尿，生肌。用于气虚乏力、久泻脱肛、自汗、水肿、子官脱垂、慢性肾炎蛋白尿、糖尿病、疮口久不愈合。\" },\n  { \"name\": \"红芪\", \"xing\": \"无\", \"wei\": \"甘，温。\", \"liang\": \"9～30g。\", \"zhi\": \"补气固表，利尿托毒，排脓，敛疮生肌。用于气虚乏力，食少便溏，中气下陷，久泻脱肛，便血崩漏，表虚自汗，气虚水肿，痈疽难溃，血虚萎黄，内热消渴，慢性肾炎蛋白尿，糖尿病。\" },\n  { \"name\": \"白术\", \"xing\": \"白术 多年生草本。根茎肥厚，块状。茎高50-80cm，上部分枝，基部木质化。茎下部叶有长柄，叶片3裂或羽状5深裂，裂片卵状披针形至披针形，长5-8cm，宽1.5-3cm，先端长渐尖，基部渐狭，边缘长或短针刺状缘，毛或贴伏的细刺齿，先端裂片较大；茎上部叶柄渐短，狭披针形，分裂或不分裂，长4-10cm，宽1.5-4cm。头状花序单生于枝顶，长约2.5cm，总苞片5-8层，膜质，覆瓦状排列，外面略有微柔毛，外层短，卵形，先端钝，最内层多列，先端钝，伸长；花多数，全为管状花，花冠紫红色，长约1.5cm，雄蕊5，花柱细长。瘦果长圆状椭圆形，密被黄白色绒毛，稍扁，长约7.5mm；冠毛长约1.3cm，羽状，污白色，基部联合。花期9-10月，果期10-12月。\", \"wei\": \"味苦；甘；性温\", \"liang\": \"内服：煎汤，3-15g；或熬膏；或入丸、散。\", \"zhi\": \"健脾益气；燥湿利水；止汗；安胎。主脾气虚弱；神疲乏力；食少少腹胀；大便溏薄；水饮内停；小便不利；水肿；痰饮眩晕；温痹酸痛；气虚自汗；胎动不安\" },\n  { \"name\": \"山药\", \"xing\": \"多年生缠绕草本。块茎肉贸肥厚，略呈圆柱形，垂直生长，长可达1米，直径2～7厘米，外皮灰褐色，生有须根。茎细长，蔓性，通常带紫色，有棱，光滑无毛。叶对生或3叶轮生，叶腋间常生珠芽（名零余子）；叶片形状多变化，三角状卵形至三角状广卵形，长3.5～7厘米，宽2～4.5厘米，通常耳状3裂，中央裂片先端渐尖，两侧裂片呈圆耳状，基部戟状心形，两面均光滑无毛；叶脉7～9条基出；叶柄细长，长1.5～3.5厘米。花单性，雌雄异株；花极小，黄绿色，成穗状花序；雄花序直立，2至数个聚生于叶腋，花轴多数成曲折状；花小，近于无柄，苞片三角状卵形；花被6，椭圆形，先端钝；雄蕊6，花丝很短；雌花序下垂，每花的基部各有2枚大小不等的苞片，苞片广卵形，先端长渐尖；花被6；子房下位，长椭圆形，3室，柱头3裂。蒴果有3翅，果翅长几等于宽。种子扁卵圆形，有阔翅。花期7～8月。果期9～10月。<br>本植物的藤（山药藤）、叶腋间的珠芽（零余子）亦供药用，各详专条。\", \"wei\": \"甘，平。<br>①《本经》：味甘，温。<br>②《别录》：平，无毒。<br>③《药性类明》：味甘，性凉而润。<br>④《药品化义》：生者性凉，熟则化凉为温。\", \"liang\": \"内服：煎汤，3～6钱；或入丸、散。外用：捣敷。\", \"zhi\": \"健脾，补肺，固肾，益精。治脾虚泄泻，久痢，虚劳咳嗽，消渴，遗精、带下，小便频数。<br>补脾养胃，生津益肺，补肾涩精。用于脾虚食少、久泻不止、肺虚喘咳、肾虚遗精、带下、尿频、虚热消渴。麸炒山药补脾健胃。用于脾虚食少，泄泻便溏，白带过多。<br>①《本经》：主伤中，补虚，除寒热邪气，补中益气力，长肌肉，久服耳目聪明。<br>②《别录》：主头面游风，风头（一作’头风’）眼眩，下气，止腰痛，治虚劳羸瘦，充五脏，除烦热，强钥。<br>③《药性论》：补五劳七伤，去冷风，止腰痛，镇心神，补心气不足，患人体虚羸，加而用之。<br>④《食疗本草》：治头疼，助阴力。<br>⑤《日华子本草》：助五脏，强筋骨，长志安神，主泄精健忘。<br>⑥朱震亨：生捣贴肿硬毒，能消散。<br>⑦《伤寒蕴要》：补不足，清虚热。<br>⑧《纲目》：益肾气，健脾胃，止泄痢，化痰涎，润皮毛。\" },\n  { \"name\": \"白扁豆\", \"xing\": \"扁豆 一年生缠绕草质藤本，长达6m。茎常呈淡紫色或淡绿色，无毛或疏被柔毛。三出复叶；叶柄长4-14cm；托叶披针形或三角状卵形，被白色柔毛；顶生小叶柄长1.5-3.5cm，两侧小叶柄较短，长2-3mm，均被白色柔毛；顶生小叶宽三角状卵形，长5-10cm，宽约与长相等，先端尖，基部广楔形或截形，全线，两面均被短柔毛，沿叶脉处较多，基出3主脉，侧卧羽状；侧生小叶斜卵形，两边不均等。总状花序腋生，长15-25cm，直立，花序轴较粗壮；2-4花或多花丛生于花序轴的节上，小苞片舌状，2枚，早落；花萼宽钟状，先端5齿，上部2齿几乎完全合生，其余3齿近相等，边缘密被白色柔毛；花冠蝶形，白色或淡紫色，长约2cm，旗瓣广椭圆形，先端向内微凹，翼瓣斜椭圆形，近基部处一侧有耳状突起，龙骨瓣舟状，弯曲几成直角；雄蕊10，1枚单生，其余9枚的花丝部分连合成管状，将雌蕊包被；子房线形，有绢毛，基部有腺体，花柱近先端有白色髯毛，柱头头状。荚果镰形或倒卵状长椭圆形，扁平，长5-8cm，宽1-3cm，先端较宽，顶上具一向下弯曲的喙，边缘粗糙。种子2-5颗，扁椭圆形，白色、红褐色或近黑色，长8-13mm，宽6-9mm，厚4-7mm，种脐与种脊长而隆起，一侧边缘有隆起的白色半月形种阜。花期6-8月，果期9月。\", \"wei\": \"甘淡；微温；平\", \"liang\": \"内服：煎汤，10-15g；或生品捣研水绞汁；或入丸、散。外用：适量，捣敷。\", \"zhi\": \"用于脾胃虚弱，食欲不振，大便糖泻，白带过多，暑湿吐泻．胸闷腹胀。炒扁豆健脾化湿。用于脾虚泄泻，白带过多。\" },\n  { \"name\": \"扁豆花\", \"xing\": \"扁豆 一年生缠绕草质藤本，长达6m。茎常呈淡紫色或淡绿色，无毛或疏被柔毛。三出复叶；叶柄长4-14cm；托叶披针形或三角状卵形，被白色柔毛；顶生小叶柄长1.5-3.5cm，两侧小叶柄较短，长2-3mm，均被白色柔毛；顶生小叶宽三角状卵形，长5-10cm，宽约与长相等，先端尖，基部广楔形或截形，全线，两面均被短柔毛，沿叶脉处较多，基出3主脉，侧卧羽状；侧生小叶斜卵形，两边不均等。总状花序腋生，长15-25cm，直立，花序轴较粗壮；2-4花或多花丛生于花序轴的节上，小苞片舌状，2枚，早落；花萼宽钟状，先端5齿，上部2齿几乎完全合生，其余3齿近相等，边缘密被白色柔毛；花冠蝶形，白色或淡紫色，长约2cm，旗瓣广椭圆形，先端向内微凹，翼瓣斜椭圆形，近基部处一侧有耳状突起，龙骨瓣舟状，弯曲几成直角；雄蕊10，1枚单生，其余9枚的花丝部分连合成管状，将雌蕊包被；子房线形，有绢毛，基部有腺体，花柱近先端有白色髯毛，柱头头状。荚果镰形或倒卵状长椭圆形，扁平，长5-8cm，宽1-3cm，先端较宽，顶上具一向下弯曲的喙，边缘粗糙。种子2-5颗，扁椭圆形，白色、红褐色或近黑色，长8-13mm，宽6-9mm，厚4-7mm，种脐与种脊长而隆起，一侧边缘有隆起的白色半月形种阜。花期6-8月，果期9月。\", \"wei\": \"平；甘淡；无毒\", \"liang\": \"内服：煎汤，3-9g；或研末；或捣汁。外用：适量，捣敷。\", \"zhi\": \"治疗细菌性痢疾。干白扁豆花100g，制成100%煎液。口服剂量按每次每公斤体重0.5-1ml计算，每6小时1次，7天为一疗程。观察13例，经治3-7天后，痊愈(临床症状消失，大便培养连续二次阴性)7例，进步(临床症状部分消失或减轻)3例，无效3例。治程中未见副作用。据实验证明，每毫升含生药62.5mg的扁豆花煎液在试管内可抑制宋内氏型、弗氏型痢疾杆菌生长。\" },\n  { \"name\": \"扁豆衣\", \"xing\": \"扁豆 一年生缠绕草质藤本，长达6m。茎常呈淡紫色或淡绿色，无毛或疏被柔毛。三出复叶；叶柄长4-14cm；托叶披针形或三角状卵形，被白色柔毛；顶生小叶柄长1.5-3.5cm，两侧小叶柄较短，长2-3mm，均被白色柔毛；顶生小叶宽三角状卵形，长5-10cm，宽约与长相等，先端尖，基部广楔形或截形，全线，两面均被短柔毛，沿叶脉处较多，基出3主脉，侧卧羽状；侧生小叶斜卵形，两边不均等。总状花序腋生，长15-25cm，直立，花序轴较粗壮；2-4花或多花丛生于花序轴的节上，小苞片舌状，2枚，早落；花萼宽钟状，先端5齿，上部2齿几乎完全合生，其余3齿近相等，边缘密被白色柔毛；花冠蝶形，白色或淡紫色，长约2cm，旗瓣广椭圆形，先端向内微凹，翼瓣斜椭圆形，近基部处一侧有耳状突起，龙骨瓣舟状，弯曲几成直角；雄蕊10，1枚单生，其余9枚的花丝部分连合成管状，将雌蕊包被；子房线形，有绢毛，基部有腺体，花柱近先端有白色髯毛，柱头头状。荚果镰形或倒卵状长椭圆形，扁平，长5-8cm，宽1-3cm，先端较宽，顶上具一向下弯曲的喙，边缘粗糙。种子2-5颗，扁椭圆形，白色、红褐色或近黑色，长8-13mm，宽6-9mm，厚4-7mm，种脐与种脊长而隆起，一侧边缘有隆起的白色半月形种阜。花期6-8月，果期9月。\", \"wei\": \"甘苦；温\", \"liang\": \"内服：煎汤，3-9g。\", \"zhi\": \"消暑化湿，健脾和胃。主暑湿内蕴，呕吐泄泻，胸闷纳呆，脚气浮肿，妇女带下\" },\n  { \"name\": \"甘草\", \"xing\": \"1．甘草 多年生草本，高30-100cm。很及根茎粗壮，皮红棕色。茎直立，带木质，有白色短毛和刺毛状腺体。奇数现状复叶长8-20cm；小叶7-17，卵形或宽卵形，长2-5cm，宽1-3cm，先端急尖或钝，基部圆，两面均被短毛和腺体；托叶阔披针形，被白色纤毛。总状花序腋生，花密集；花萼钟状，萼齿5，披针形，外面有短毛和刺毛状腺体；花冠蓝紫色，长1.4-2.5cm，无毛，旗瓣大，卵圆形，有爪，龙骨瓣直，较翼辩短，均有长爪；雄蕊二体，（9＋1）。荚果条形，呈镰刀状或环状弯曲，外面密被刺毛状腺作。种子4-8，肾形。花期7-8月，果期8-9月。\", \"wei\": \"甘；平\", \"liang\": \"内服：煎汤，2-6g，调和诸药用量宜小，作为主药用量宜稍大，可用10g左右；用于中毒抢救，可用30-60g。凡入补益药中宜炙用，入清泻药中宜生用。外用：适量，煎水洗、渍；或研末敷。\", \"zhi\": \"益气补中；缓急止痛；润肺止咳；泻火解毒；调和诸药。主倦怠食少；肌瘦面黄；心悸气短；腹痛便溏；四肢挛急疼痛；脏躁；咳嗽气喘；咽喉肿痛；痈疮肿痛；小儿胎毒；及药物、食物中毒\" },\n  { \"name\": \"大枣\", \"xing\": \"无\", \"wei\": \"甘，温。\", \"liang\": \"6～15g。\", \"zhi\": \"果（大枣）：补中益气，养血安神。用于脾虚食少，乏力便溏，妇人脏躁。\" },\n  { \"name\": \"刺五加\", \"xing\": \"无\", \"wei\": \"辛、微苦，温。\", \"liang\": \"9～27g。\", \"zhi\": \"益气健脾，补肾安神。用于脾肾阳虚，体虚乏力，食欲不振，腰膝酸痛，失眠多梦。\" },\n  { \"name\": \"绞股蓝\", \"xing\": \"绞股蓝 多年生攀缘草本。茎细弱，多分枝，具纵棱和沟槽，无毛或疏被短柔毛。叶互生；叶柄长3-7cm；卷须纤细，2歧，稀单一，无毛或基部被短柔毛；叶片膜质或纸质，鸟足状，具5-9小叶，通常5-7，卵状长圆形或长圆状披针形，中央小叶长3-12cm，宽1.5-4cm，侧生小叶较小，先端急尖或短渐尖，基部渐狭，边缘具波状齿或圆齿状牙齿，上面深绿色，背面淡绿以，两渐狭，边缘具波状齿或圆齿状牙齿，上面深绿以，背面淡绿色，两面均被短硬毛；侧脉6-8对，上面平坦，下面突起，细脉网状。雌雄异株，雄花为圆锥花序，花序穗纤细，多分枝，长10-15（-20）cm，分枝扩展，长3-4（-15）cm，有时基部具小叶，被短柔毛，花梗丝状，长1-4mm；基部具钻状小苞片；花萼筒极短，5裂，裂片三角形；花冠淡绿以，5深裂，裂片卵状披针形，长2.5-3mm，宽约1mm，具1脉，边缘具缘毛状小齿；雄蕊5，联合成柱；雌花为圆锥花序，较雄花小，花萼、花冠均似雄花；子房球形，花柱3短而分叉，柱头2裂，具短小退化雄蕊5。果实球形，径5-6mm，成熟后为黑色，光滑无毛。内含倒垂种子2颗，卵状心形，径约4mm，灰褐色或深褐色，顶端钝，基部心形，压扁状，面具乳突状突起。花期3-11月，果期4-12月。\", \"wei\": \"味苦；微甘；性凉\", \"liang\": \"内服：煎汤，15-30g，研末，3-6g；或泡茶饮。外用：适量，捣烂涂擦。\", \"zhi\": \"清热；补虚；解毒。主体虚乏力；虚劳失精；白细胞减少症；高脂血症；病毒性肝炎；慢性胃肠炎；慢性气管炎\" },\n  { \"name\": \"红景天\", \"xing\": \"多年生草本，高10～20厘米。根粗壮，圆锥形，肉质，褐黄色，根颈部具多数须根。根茎短，粗壮，圆柱形，被多数覆瓦状排列的鳞片状的叶。从茎顶端之叶腋抽出数条花茎，花茎上下部均有肉质叶，叶片椭圆形，边缘具粗锯齿，先端锐尖，基部楔形，几无柄。聚伞花序顶生，花红色。蓇葖果。\", \"wei\": \"性寒，味甘涩。\", \"liang\": \"内服：煎汤，1～3钱，外用：捣敷或研末调敷。\", \"zhi\": \"活血止血，清肺止咳。治咳血，咯血，肺炎咳嗽，妇女白带。外用治跌打损伤，汤火伤。\" },\n  { \"name\": \"沙棘\", \"xing\": \"落叶灌木或乔木，高5～10m，具粗壮棘刺。枝幼时密被褐锈色鳞片。叶互生，线性或线状披针形，两端钝尖，下面密被淡白色鳞片；叶柄极短。花先叶开放，雌雄异株；短总状花序腋生于头年枝上；花小，淡黄色，雄花花被2裂，雄蕊4；雌花花被筒囊状，顶端2裂。果为肉质花被筒包围，近球形，橙黄色。花期3～4月，果期9～10月。\", \"wei\": \"无\", \"liang\": \"无\", \"zhi\": \"止咳祛痰，消食化滞，活血散瘀。\" },\n  { \"name\": \"饴糖\", \"xing\": \"无\", \"wei\": \"甘，温。\", \"liang\": \"内服：烊化冲入汤药中，1～2两；熬膏或入丸剂。\", \"zhi\": \"缓中，补虚，生津，润燥。治劳倦伤脾，里急腹痛，肺燥咳嗽，吐血，口渴，咽痛，便秘。\" },\n  { \"name\": \"蜂蜜\", \"xing\": \"中华蜜蜂，又名：范（《礼记》），蜡蜂（《纲目》）。<br>有母蜂、工蜂和雄蜂三种。工蜂形小，体暗褐色，头、胸、背面密生灰黄色的细毛。头略呈三角形，有复眼1对，单眼3个；触角1对，膝状弯曲；口器发达，适于咀嚼及吮吸。胸部3节，中胸最大；翅2对，膜质透明，后翅中脉分叉。足9对，股节、胫节及跗节等处，均有采集花粉的构造。腹部圆锥状，背面黄褐色，1～4节有黑色环带，末端尖锐，有毒腺和螫针；腹下有蜡板4对，内有蜡腺，分泌蜡质。母蜂俗称蜂王，体最大，翅短小，腹部特长。生殖器发达。雄蜂较工蜂稍大，头呈球状，复眼很大；尾端圆形，无毒腺和螫针。母蜂和雄蜂的口器均退化，足上无采贮花粉的构造，腹下蜡板和蜡腺均无。<br>蜜蜂是一种营群体生活的昆虫。每一蜂群，由1个母蜂、数百个雄蜂和上万个工蜂所组成。母蜂为群体中的核心，专司产卵；工蜂为生殖系统不发育的雌性蜂，专司采蜜、酿蜜、喂饲幼虫、筑巢及防御等职。\", \"wei\": \"甘，平。<br>①《本经》：味甘，平。<br>②《纲目》：生凉，熟温。<br>③《本草汇言》：味甘，气寒，无毒。\", \"liang\": \"内服：冲调，0.3～1两；或入丸剂、膏剂。外用：涂局部。\", \"zhi\": \"补中，润燥，止痛，解毒。治肺燥咳嗽，肠燥便秘，胃脘疼痛，鼻渊，口疮，汤火烫伤，解乌头毒。<br>①《本经》：主心腹邪气，诸惊痫b，安五脏诸不足，益气补中，止痛解毒，和百药。<br>②《别录》：养脾气，除心烦，食饮不下，止肠荩肌中疼痛，口疮，明耳目。<br>③《本草拾遗》：主牙齿疳匿，唇口疮，目肤赤障，杀虫。<br>④《本草衍义》：汤火伤涂之痛止，仍捣薤白相和。<br>⑤《纲目》：和营卫，润脏腑，通三焦，调脾胃。\" },\n  { \"name\": \"蜂胶\", \"xing\": \"1.中华蜜蜂，蜂群由工蜂、蜂王及雄蜂组成。工蜂全体被黄褐色毛。头略呈三角形。胸部3节。翅2对，膜质透明。足3对，有采集花粉的构造。腹部圆锥状，有毒腺和螫针。腹下有蜡板4 对，内有蜡腺，分泌蜡质。蜂王体最大，翅短小，腹部特长，生殖器发达，专营生殖产卵。雄蜂较工蜂稍大，头呈球形，尾无毒腺和螫针，足上无采贮花粉构造，腹无蜡板及蜡腺。\", \"wei\": \"味微甘；性平\", \"liang\": \"外用：适量，制成酊剂或软膏涂敷。内服：制成片剂或醇浸液，1-2g。\", \"zhi\": \"润肤生肌；消炎止痛。主胃溃疡；口腔溃疡；宫颈糜烂；带状疱疹；牛皮屑；银屑病；皮肤裂痛；鸡眼；烧烫伤\" },\n  { \"name\": \"鹿茸\", \"xing\": \"1.梅花鹿，体长约1.5m左右，体重100kg左右。眶下腺明显，耳大直立，颈细长。四肢细长，后肢外侧踝关节下有褐色足迹腺，主蹄狭小，侧蹄小。臀部有明显的白色臀斑，尾短。雄鹿有分叉的角，长全时有4-5叉，眉叉斜向前伸，第二枝与眉叉较远，主干末端再分两小枝。梅花鹿冬毛检疫站棕色，白色斑点不显。鼻面及颊部毛短，毛尖沙黄色。从头顶起沿脊椎到尾部有一深棕色的背线。白色臀斑有深棕色边缘。腹毛淡棕，鼠蹊部白色。四肢上侧同体色，内侧色稍淡。夏毛薄，无绒毛，红棕色，白斑显着，在脊背两旁及体侧下缘排列成纵行，有黑色的背中线。腹面白色，尾背面黑色，四肢色较体色为浅。<br>2.马鹿，体形较大，体长2m，体重超过200kg。肩高约1m，背平直肩部与臀部高度相等。鼻端裸露，耳大呈圆锥形。颈长约占体长1/3，颈下被毛较长。四肢长，两侧蹄较长，能触及地面。尾短，雄性有角，眉叉向前伸，几与主干成直角，主十稍向后略向内弯，角面除尖端外均较粗糙，角基有一小圈瘤状突。冬毛灰褐色。嘴、下颌深棕色，颊棕色，额部棕黑色。耳外黄褐、耳内白色。颈部与身体背面稍带黄褐色，有一黑棕色的背线。四肢外侧棕色，内侧较浅。臀部有黄赭色斑。夏毛较短，没有绒毛，呈赤褐色。\", \"wei\": \"味甘；咸；性温\", \"liang\": \"内服：研粉冲服，1-3g；或入丸剂，亦可浸酒服。\", \"zhi\": \"壮肾阳；益精血；强筋骨；托疮毒。主肾阳虚衰；阳痿滑精；宫冷不孕；虚劳赢瘦；神疲畏寒；眩晕；耳鸣耳聋；腰背酸痛；筋骨痿软；小儿五迟；女子崩漏带下；阴疽\" },\n  { \"name\": \"鹿角\", \"xing\": \"无\", \"wei\": \"咸，温。\", \"liang\": \"内服：煎汤，1.5～3钱；或入丸、散。外用：磨汁涂或研末调敷。\", \"zhi\": \"治疗急性乳腺炎：将鹿角锉为细末，装入胶囊，每粒0.5克。每次2～4粒，日服4～6次。治疗27例，除1例用药3天无效改用他药外，余皆治愈。初起者疗效较好。\" },\n  { \"name\": \"鹿角胶\", \"xing\": \"1.梅花鹿，体长约1.5m左右，体重100kg左右。眶下腺明显，耳大直立，颈细长。四肢细长，后肢外侧踝关节下有褐色足迹腺，主蹄狭小，侧蹄小。臀部有明显的白色臀斑，尾短。雄鹿有分叉的角，长全时有4-5叉，眉叉斜向前伸，第二枝与眉叉较远，主干末端再分两小枝。梅花鹿冬毛检疫站棕色，白色斑点不显。鼻面及颊部毛短，毛尖沙黄色。从头顶起沿脊椎到尾部有一深棕色的背线。白色臀斑有深棕色边缘。腹毛淡棕，鼠蹊部白色。四肢上侧同体色，内侧色稍淡。夏毛薄，无绒毛，红棕色，白斑显着，在脊背两旁及体侧下缘排列成纵行，有黑色的背中线。腹面白色，尾背面黑色，四肢色较体色为浅。<br>2.马鹿，体形较大，体长2m，体重超过200kg。肩高约1m，背平直肩部与臀部高度相等。鼻端裸露，耳大呈圆锥形。颈长约占体长1/3，颈下被毛较长。四肢长，两侧蹄较长，能触及地面。尾短，雄性有角，眉叉向前伸，几与主干成直角，主十稍向后略向内弯，角面除尖端外均较粗糙，角基有一小圈瘤状突。冬毛灰褐色。嘴、下颌深棕色，颊棕色，额部棕黑色。耳外黄褐、耳内白色。颈部与身体背面稍带黄褐色，有一黑棕色的背线。四肢外侧棕色，内侧较浅。臀部有黄赭色斑。夏毛较短，没有绒毛，呈赤褐色。\", \"wei\": \"味甘；咸；性温\", \"liang\": \"内服：开水或黄酒烊化，每次3g，每日9g；或入丸、散、膏剂。\", \"zhi\": \"补益精血；安胎止血。主肾虚；精血不足；虚劳赢瘦；头晕耳鸣；腰膝酸软，阳痿滑精；宫寒不孕；胎动不安；崩漏带下；吐血；衄血；咯血；尿备；阴疽疮疡\" },\n  { \"name\": \"鹿角霜\", \"xing\": \"无\", \"wei\": \"咸，温。\", \"liang\": \"内服：煎汤，1.5～3钱；或入丸、散。\", \"zhi\": \"补虚，助阳。治肾阳不足，腰脊酸痛，脾胃虚寒，呕吐，食少便溏，子宫虚冷，崩漏带下。\" },\n  { \"name\": \"紫河车\", \"xing\": \"无\", \"wei\": \"甘咸，温。\", \"liang\": \"内服：研末，0.8～1.5钱；或入丸剂。\", \"zhi\": \"①治疗支气管哮喘\" },\n  { \"name\": \"脐带\", \"xing\": \"无\", \"wei\": \"味甘；咸；性温\", \"liang\": \"内服：煎汤，1-2条；入丸、散，1-3g。\", \"zhi\": \"益肾；纳气。主肾虚喘咳；虚劳赢弱；气血不足；盗汗久疟\" },\n  { \"name\": \"淫羊藿\", \"xing\": \"①淫羊藿\", \"wei\": \"辛甘，温。\", \"liang\": \"内服：煎汤，1～3钱；浸酒、熬膏或入丸、散。外用：煎水洗。\", \"zhi\": \"①治疗小儿麻痹症\" },\n  { \"name\": \"巴戟天\", \"xing\": \"无\", \"wei\": \"甘，辛，微温。\", \"liang\": \"3～9g。\", \"zhi\": \"补肾阳，强筋骨，祛风湿。用于阳痿遗精，宫冷不孕，月经不调，少腹冷痛，风湿痹痛，筋骨痿软。\" },\n  { \"name\": \"仙茅\", \"xing\": \"多年生草本。根茎延长，长可达30厘米，圆柱状，肉质，外皮褐色；根粗壮，肉质，地上茎不明显。叶3～6片根出，狭披针形，长10～25厘米，先端渐尖，薹部下延成柄，再向下扩大呈鞘状，长4～10厘米，绿白色，边缘膜质；叶脉显明，有中脉；两面疏生长柔毛，后渐光滑。花腋生；花梗长1～2.5厘米，藏在叶鞘内；花杂性，上部为雄花，下部为两性花；苞片披针形，绿色，膜质，被长柔毛；花的直径约1匣米，花被下部细长管状，长约2厘米或更长，上部6裂，裂片披针形，长8～12毫米，内面黄色，外面白色，有长柔毛；雄蕊6，花丝短；子房狭长，被长柔毛。浆果椭圆形，稍肉质，长约1.2厘米，先端有喙，被长柔毛，种子稍呈球形，亮黑色，有喙，表面有波状沟纹。花期6～8月。\", \"wei\": \"辛，温，有毒。\", \"liang\": \"内服：煎汤，1.5～3钱，或入丸、散。外用：捣敷。\", \"zhi\": \"温肾阳，壮筋骨。治阳萎精冷，小便失禁，崩漏，心腹冷痛，腰脚冷痹，痈疽，瘰疬，阳虚冷泻。\" },\n  { \"name\": \"杜仲\", \"xing\": \"落叶乔木，高达20米。小枝光滑，黄褐色或较淡，具片状髓。皮、枝及叶均含胶质。单叶互生；椭圆形或卵形，长7～15厘米，宽3.5～6.5厘米，先端渐尖，基部广楔形，边缘有锯齿，幼叶上面疏被柔毛，下面毛较密，老叶上面光滑，下面叶脉处疏被毛；叶柄长1～2厘米。花单性，雌雄异株，与叶同时开放，或先叶开放，生于一年生枝基部苞片的腋内，有花柄；无花被；雄花有雄蕊6～10枚；雌花有一裸露而延长的子房，子房1室，顶端有2叉状花柱。翅果卵状长椭圆形而扁，先端下凹，内有种子1粒。花期4～5月。果期9月。\", \"wei\": \"甘微辛，温。<br>①《本经》：味辛，平。<br>②《别录》：甘，温，无毒。<br>③《药性论》：味苦。\", \"liang\": \"内服：煎汤，3～5钱；浸酒或入丸、散。\", \"zhi\": \"补肝肾，强筋骨，安胎。治腰脊酸疼，足膝痿弱，小便余沥，阴下湿痒，胎漏欲堕，胎动不安，高血压。<br>①《本经》：主腰脊痛，补中益精气，坚筋骨，强志，除阴下痒湿，小便余沥。<br>②《别录》：主脚中酸痛，不欲践地。<br>③《药性论》：治肾冷臀腰痛，腰病人虚而身强直，风也。腰不利加而用之。<br>④《日华子本草》：治肾劳，腰脊挛。入药炙用。<br>⑤王好古：润肝燥，补肝经风虚。<br>⑥《本草正》：止小水梦遗，暖子宫，安胎气。<br>⑦《玉楸药解》：益肝肾，养筋骨，去关节湿淫。治腰膝酸痛，腿足拘挛。<br>⑧《本草再新》：充筋力，强阳道。\" },\n  { \"name\": \"杜仲叶\", \"xing\": \"落叶乔木，高达20m。树皮灰褐色，粗糙，折断拉开有多数细丝。幼枝有黄褐色毛，后变无毛，老枝有皮孔。单叶互生；叶柄长1-2cm，上面有槽，被散生长毛；叶片椭圆形、卵形或长圆形，长6-15cm，宽3.5-6.5cm，先端渐尖，基部圆形或阔楔形，上面暗绿色，下面淡绿，老叶略有皱纹，边缘有锯齿；侧脉6-9对。花单性，雌雄异株，花生于当年枝基部，雄花无花被，花梗无毛；雄蕊长约1cm，无毛，无退化雌蕊；雌花单生，花梗长约8mm，子房1室，先端2裂，子房柄极短。翅果扁平，长椭圆形，先端2裂，基部楔形，周围具薄翅；坚果位于中央，与果梗相接处有关节。早春开花，秋后果实成熟。\", \"wei\": \"微辛；性温\", \"liang\": \"内服：煎汤，15-30g。\", \"zhi\": \"补肝肾；强筋骨；降血压。主腰背疼痛；足膝酸软乏力；高血压病\" },\n  { \"name\": \"续断\", \"xing\": \"①川续断（《纲目》），又名：鼓捶草、和尚头（《滇南本草》），滋油菜、六汗。\", \"wei\": \"苦辛，微温。\", \"liang\": \"内服：煎汤，2～4钱；或入丸、散。外用：捣敷。\", \"zhi\": \"补肝肾，续筋骨，调血脉。治腰背酸痛，足膝无力，胎漏，崩漏，带下，遗精，跌打损伤，金疮，痔漏，痈疽疮肿。\" },\n  { \"name\": \"肉苁蓉\", \"xing\": \"肉苁蓉 多年生寄生草本，高40-160cm。茎肉质，单一或由基部分为2或3枝，下部宽5-15cm，上部渐变细，宽2-5cm。叶多数，鲜片状，螺旋状排列，淡黄白色，无叶柄；下部叶排列紧密，宽卵形或三勿状卵形，长0.5-1cm，宽1-2cm，上部叶稀疏，线状披针形，长1-4cm，宽0.5-1cm，宽1-2cm，上部叶稀疏，线状披针形，长1-4cm，宽0.5-1cm，两面无毛。穗状花序，长15-50cm；苞片1，线状披针形或卵状披针形，长2-4cm，宽0.5-0.8cm，被疏绵毛或近无毛；小苞片2，卵状披针形，与花萼等长或稍长，被疏绵毛或无毛；花萼钟状，长1-1.5cm，5浅裂，裂片近圆珠笔形；花冠筒状钟形，长3-4cm，裂片5，展开，近半圆形；花黄白色、淡紫色，干后变棕褐色，管内有2条纵向的鲜黄色凸起；雄蕊4，二强，近内藏，花丝上部稍弯曲，基部被皱曲长柔毛，花药箭形，被长柔毛；子房上位，基部有黄色密腺，花柱细长，顶端内折，柱头近球形。蒴果卵形，2裂，褐色。种子多数，微小，椭圆状卵形，表面网状，有光泽。花期5-6月，果期6-7月。\", \"wei\": \"味甘；咸；性温\", \"liang\": \"内服：煎汤，10-15g；或入丸、散；或浸酒。\", \"zhi\": \"补肾阳；益精血；润肠道。主肾阳虚衰；精血不足之阳痿；遗精；白浊；尿频余沥；腰痛脚弱；耳鸣目花；月经衍期；宫寒不孕；肠燥便秘\" },\n  { \"name\": \"锁阳\", \"xing\": \"多年生肉质寄生草本。地下茎粗短，具有多数瘤突吸收根。茎圆柱形，暗紫红色，高20～100厘米，径约3～6厘米，大部埋于沙中，基部粗壮，具鳞片状叶。鳞片状叶卵圆形、三角形或三角状卵形，长0.5～1厘米，宽不及1厘米，先端尖。穗状花序顶生，棒状矩圆形，长5～15厘米，直径2.5～6厘米；生密集的花和鳞状苞片，花杂性，暗紫色，有香气，雄花有2种：一种具肉质花被5枚，长卵状楔形，雄蕊1，花丝短，退化子房棒状；另一种雄花具数枚线形、肉质总苞片，无花被，雄蕊1，花丝较长，无退化子房；雌花具数枚线状、肉质总苞片；其中有1枚常较宽大，雌蕊1，子房近圆形，上部着生棒状退化雄蕊数枚，花柱棒状；两性花多先于雄花开放，具雄蕊雌蕊各1，雄蕊着生子房中部。小坚果，球形，有深色硬壳状果皮。花期6～7月。\", \"wei\": \"甘，温。\", \"liang\": \"内服：煎汤，1.5～3钱；入丸、散或熬膏。\", \"zhi\": \"补肾润肠。治阳痿，尿血，血枯便秘，腰膝痿弱。\" },\n  { \"name\": \"补骨脂\", \"xing\": \"无\", \"wei\": \"辛、苦，温。\", \"liang\": \"6～9g。外用20％～30％酊剂涂患处。\", \"zhi\": \"温肾助阳，纳气，止泻。用于阳痿遗精，遗尿尿频，腰膝冷痛，肾虚作喘，五更泄泻；外用治白癜风，斑秃。\" },\n  { \"name\": \"益智仁\", \"xing\": \"益智，多年生草本，高1-3m。叶柄短；叶片披针形，长20-35cm，宽3-6cm，先端尾状渐尖，基部宽楔形，边缘具脱落性小刚毛，基残痕呈细齿状，两面无毛；叶舌膜质，二裂，长1-2cm，少数达3cm，被淡棕色柔毛。总状花序顶生，长8-15cm，在花蕾时包藏于鞘状的总状苞片内；花序轴被极短的柔毛；小花梗长1-2mm；苞片膜质，棕色；花萼管状，长约1.2cm，先端3浅齿裂，一侧深裂，外被短柔毛；花冠管与萼管几等长，裂片3，长圆形，长约1.8cm，上方1片稍大，先端略呈兜状，白色，外被短柔毛；唇瓣倒卵形，长约2cm，粉红色，并有红色条纹，先端边缘皱波状；侧生退化雄蕊锥状，长约2mm；雄蕊1，花丝扁平，线形，长约1.2cm，花药长6-7mm，药隔先端具圆形鸡冠状附属物；子房下位，密被绒毛。蒴果球形或椭圆形，干时纺锤形，果皮上有明显的纵向维管束条纹，长1.2-cm，直径约1cm，不开裂，果熟时黄绿色或乳黄色。种子多数，不规则扁圆形，被淡黄色假种皮。花期2-4月，果期5-8月。\", \"wei\": \"味辛；性温\", \"liang\": \"内服：煎汤，3-9g；或入丸、散。\", \"zhi\": \"温脾止泻摄涎；暖肾缩尿固精。主脾胃虚寒；呕吐；泄泻；腹中冷育；口多唾涎；肾虚遗尿；尿频；遗精；白浊\" },\n  { \"name\": \"菟丝子\", \"xing\": \"1.菟丝子 一年生寄生草本。茎缠绕，黄色，纤细，直径约1mm，多分枝，随处可生出寄生根，伸入寄主体内。叶稀少，鳞片状，三角状卵形。花两性，多数和簇生成小伞形或小团伞花序；苞片小，鳞片状；花梗稍粗壮，长约1mm；花萼西洋太，长约2mm，中部以下连合，裂片5，三角状，先端钝；花冠白色，壶形，长约3mm，5浅裂，裂片三角状卵形，先端锐尖或钝，向外反折，花冠简基部具鳞片5，长圆形，先端及边缘流苏状；雄蕊5，着生于花冠裂片弯缺微下处，花丝短，花药露于花冠裂片之外；雌蕊2，心皮合生，子房近球形，2室，花柱2，柱头头状。蒴果近球形，稍扁，直径约3mm，几乎被宿存的花冠所包围，成熟时整齐地周裂。种子2-4颗，黄或黄褐色卵形，长约1.4-1.6mm，表面粗糙。花期7-9月，果期8-10月。<br>2.南方菟丝 与菟丝子形态相似，区别点是：雄蕊着生于花冠理解片弯缺处，花丝较长，花冠基部的鳞片先端2裂；蒴果仅下半部被宿存花冠包围，成熟时不整齐地开裂；种子通常4颗，卵圆形，长0.7-2mm，淡褐色。花果期6-8月。<br>3.与菟丝子的主要区别是：茎较粗壮，肉质，直径1-2.5mm，黄色或红色的茎上常带紫红色瘤状斑点。花序穗状，长达3cm，基部常多分枝；花萼碗状，内质，背面常有紫红色瘤状突起；花柱单一，柱头2裂。蒴果卵圆形，长约5mm；种子1-2颗，长3-3.5mm，种皮黄至黄棕色。花期8-10月，果期9-11月。\", \"wei\": \"辛甘；平\", \"liang\": \"内服：煎汤，6-15g；或入丸、散。外用：适量，炒研调敷。\", \"zhi\": \"补肾益精；养肝明目；固胎止泄。主腰膝酸痛；遗精；阳痿；早泄；不育；消渴；淋浊；遗尿；目昏耳鸣；胎动不安；流产；泄泻\" },\n  { \"name\": \"沙苑子\", \"xing\": \"①扁茎黄芪又名：蔓黄芪。<br>多年生高大草本，高可达1米以上，全体被短硬毛。主根粗长，茎略扁，偃卧。单数羽状复叶，互生，具短柄；托叶小，披针形；叶柄短，叶片椭圆形，长6～14毫米，宽3～7毫米，先端钝或微缺，有细尖，基部钝形至钝圆形，全缘，上面绿色，无毛，下面灰绿色。总状花序腋生；总花梗细长；小花3～9朵，小花梗基部有1线状披针形的小苞片；花萼钟形，绿色，先端5裂，外侧被黑色短硬毛，萼筒基部有2枚卵形的小苞片，外侧密被短硬毛；花冠蝶形，黄色，旗瓣近圆形，先端微凹，基部有爪，长约10毫米，宽约8毫米，翼瓣稍短，龙骨瓣与旗瓣等长；雄蕊10，9枚合生，1枚分离；雌蕊超出雄蕊之外，子房上位.密被白色柔毛，有子房柄，花柱无毛，柱头有画笔状白色髯毛。荚果纺锤形，长3～4厘米，先端有较长的尖喙，腹背稍扁，被黑色短硬毛，内含种子20～30粒。种子圆肾形。花期8～9月。果期9～10月。<br>生于山野。分布辽宁、吉林、河北、陕西、甘肃、山西、内蒙古等地。<br>②华黄芪<br>多年生草本，高20～100厘米。茎直立，有条棱，近无毛。单数羽状复叶，长8～12厘米；小叶21～31，椭圆形或卵状椭圆形，长1.5～2厘米，宽5～9毫米，先端钝，有短尖，基部圆形或渐狭，上面无毛，下面疏生短柔毛。总状花序腋生；花多数；萼钟状，膜质，萼齿三角披针形，近无毛；花冠黄色，长约1.5厘米，翼瓣长为龙骨瓣的2／3；子房有长柄。荚果椭圆形，长1～1.5厘米，宽8～10毫米，革质，膨胀，密生横纹，成熟后开裂。种子10～12，肾形，种脐凹陷较深，黄褐色。<br>生山坡、路旁、砂地、河边。分布河北、河南、山东、内蒙古以及东北等地。<br>同属植物直立黄芪，多年生草本，高20～30厘米。叶互生，单数羽状复叶，小叶7～23，椭圆形或长椭圆形。总状花序，花密，多数；翼瓣比旗瓣短，花冠蓝紫色或紫红色。花期7～8月。分布吉林、辽宁、内蒙古、甘肃、宁夏、新疆。其种子亦同等入药。\", \"wei\": \"甘，温。<br>①《纲目》：甘，温，无毒。<br>②《本草汇言》：味甘兼苦。\", \"liang\": \"内服：煎汤，2～3钱；或入丸、散。\", \"zhi\": \"补肝，益肾，明目，固精。治肝肾不足，腰膝酸痛，目昏，遗精早泄，小便频数，遗尿，尿血，白带。<br>①《本草衍义》：补肾。<br>②《纲目》：补肾，治腰痛泄精，虚损劳乏。<br>③《本草从新》：补肾，强阴，益精，明目。治带下，痔漏，阴癀。性能固精。<br>④《医林纂要》：坚肾水，泻邪湿，去Y瘕痔瘘。<br>⑤《会约医镜》：止遗沥，尿血，缩小便。<br>⑥《本草求原》：治肺痿，肾冷，尿多，遗溺，明目，长肌肉。亦治肝肾风毒攻注。\" },\n  { \"name\": \"蛤蚧\", \"xing\": \"形如壁虎而大，全长20余厘米。头部较大，呈三角形；吻端凸圆；鼻孔近吻端；耳孔椭圆形；眼大，突出；口中有许多小齿。全身生密鳞，上唇鳞12～14，第1片达鼻孔；吻鳞宽，其后缘有3片较大的鳞，头及背面鳞细小，成多角形；尾鳞不甚规则，近长方形，排成环状；大而突起的鳞片成行的镶嵌在小鳞片中，行距间约有3排小鳞，分布在躯干部的有10～12纵行左右；在尾部的有6行；尾侧有3对隆起的鳞；胸腹部鳞较大，均匀排列成覆瓦状。指、趾间具蹼；指、趾膨大，底部具有单行褶襞皮瓣，除第1指、趾外，末端均具小爪。雄性有股孔20余枚，左右相连。尾基部较粗，肛后囊孔明显。体背紫灰色，有砖红色及蓝灰色斑点；浸液标本成为深浅相间的横斑，背部约有7～8条，头部、四肢及尾部亦有散在；尾部有深浅相间的环纹7条，色深者较宽；腹面近白色，散有粉红色斑点。尾易断，能再生。\", \"wei\": \"咸，平。\", \"liang\": \"内服：煎汤，1～2钱；或入丸、散。\", \"zhi\": \"补肺益肾，定喘止嗽。治虚劳，肺痿，喘嗽，咯血，消渴，阳痿。\" },\n  { \"name\": \"核桃仁\", \"xing\": \"落叶乔木。羽状复叶互生；小叶5～9，对生，卵形、椭圆形或椭圆状卵形，长6～15cm，宽3～6cm，先端尖，全缘。花单性同株，与叶同时开放；雄？荑花序下垂，花密生，雄蕊6～30；雌花序簇生，直立，生于幼枝的顶端，有花1～3，子房下位，密被毛。核果近球形，外果皮肉质，绿色；内果皮骨质，坚硬，有不规则的浅沟。花期5月，果期10月。\", \"wei\": \"性温，味甘。\", \"liang\": \"无\", \"zhi\": \"温补肺肾，定喘润肠。用于肾虚腰痛、脚软、虚寒喘咳、大便燥结。\" },\n  { \"name\": \"冬虫夏草\", \"xing\": \"子座单个，罕2-3个从寄主前端发出，全长4-11cm，长棒形或圆柱形，基部粗1.5-4mm，向上渐细。头部近圆柱形，褐色，初期内部充实，后变中空，长1-4.5cm，粗2.5-6mm，尖端有1.5-5.5mm的不孕顶部。子囊壳近表面生，基部稍陷于子座内，椭圆形至卵形。子囊多数，细长，产生在子囊壳内。每个子囊内具有子囊孢子，通常1-3个，少数为4个或更多，长线形，有多数横隔，不断裂为小段，大小（160-470）μm×（5-6.5）μm。\", \"wei\": \"甘；温；香\", \"liang\": \"内服：煎汤，5-10g；或入丸、散；或与鸡鸭炖服。\", \"zhi\": \"保肺气；实腠理；补肾益精。主肺虚咳喘；劳嗽痰血；自汗；盗汗；肾亏阳痿；遗精；腰膝酸痛\" },\n  { \"name\": \"胡芦巴\", \"xing\": \"胡芦巴，又名:芸香草（《盛京通志》），香草、苦草、苦朵菜、香苜蓿。<br>一年生草本，高40～50厘米。茎丛生，几光滑或被稀疏柔毛。3出复叶，小叶卵状长卵圆形或宽披针形，长1.2～3厘米，宽1～1.5厘米，近先端有锯齿，两面均有稀疏柔毛，小叶柄长1～2毫米，总柄长6～12毫米；托叶与叶柄连合，狭卵形，先端急尖。花无梗，1～2朵腋生:萼筒状，萼齿5，披针形，比花冠短-半，外被长柔毛；花冠蝶形，初为白色，后渐变淡黄色，基部微带紫晕，旗瓣长圆形，先端具缺刻，基部尖楔形，龙骨瓣偏匙形，长仅旗瓣的1／3，翼瓣耳形，雄蕊10，2体；子房无柄，柱头顶生。荚果细长圆筒状，长6～11厘米，宽0.5厘米左右，被柔毛，并具网脉，先端有长尖。种子棕色，长约4毫米。花期4～6月。果期7～8月。\", \"wei\": \"苦，温。<br>①《珍珠囊》:苦。<br>②《饮膳正要》:味苦，温，无毒。<br>③《玉楸药解》:味苦辛，气温。\", \"liang\": \"内服:煎汤，1～3钱；或入丸、散。\", \"zhi\": \"补肾阳，祛寒湿。治寒疝，腹胁胀满，寒湿脚气，肾虚腰酸，阳痿。<br>①《嘉v本草》:主元脏虚冷气。得附子、硫黄，治肾虚冷，腹胁胀满，面色青黑；得x香子、桃仁，治膀胱气。<br>②《纲目》:治冷气疝瘕，寒湿脚气；益右肾，暖丹田。<br>③《国药的药理学》:为滋养强精药，用子阴痿、遗精及早泄。<br>④《四川中药志》:治寒泻。\" },\n  { \"name\": \"韭菜子\", \"xing\": \"多年生草本，全草有异臭。鳞茎狭圆锥形。叶基生，扁平，狭线形，长15～30cm，宽1.5～6mm。花茎长30～50cm，顶生伞形花序，具20～40朵花；总苞片膜状，宿存；花梗长为花被的2～4倍；花被基部稍合生，裂片6，白色，长圆状披针形，长5～7mm；雄蕊6；子房三棱形。蒴果倒卵形，有三棱。种子6，黑色。花期7～8月，果期8～9月。\", \"wei\": \"性温，味辛、甘。\", \"liang\": \"无\", \"zhi\": \"补肝肾，暖腰膝，助阳，固精。用于阳痿、遗精、遗尿小便频数、腰膝酸软、冷痛、白带过多。\" },\n  { \"name\": \"阳起石\", \"xing\": \"晶体结构属单斜晶系。晶体呈简单的长柱状、针状，有时呈毛发状。常呈细放射状、纤维状的集合体。白色或浅灰色。玻璃光泽，纤维状集合体具丝绢光泽。硬度5.5-6。性脆，针状，毛发状晶体易折断。相对密度2.9-3.0。透闪石石棉为透闪石的纤维状异种。\", \"wei\": \"咸；温\", \"liang\": \"内服：入丸、散，1-1.5钱。\", \"zhi\": \"温肾壮阳。主肾阳虚衰；腰膝冷痹；男子阳痿；女子宫冷；症瘕崩漏\" },\n  { \"name\": \"紫石英\", \"xing\": \"等轴晶系。晶体呈立方体、八面体、十二面体；集合体常呈致密粒状块体出现。颜色很少是无色透明的，大部分被染成各种颜色，如黄、浅绿、浅蓝、紫色及紫黑色等，以浅绿、紫色和紫黑色者为最常见，其色可因加热、压力、X射线、紫外线等而改变，加热时能失去色彩，而受X射线照射后，又恢复原色。条痕白色。玻璃光泽。透明至微透明。解理依八面体。断口呈贝壳状。硬度4。比重3.18。加热后显萤光。<br>此外，少数地区使用的紫色石英为氧化物类石英族矿物石英（Quartz）的紫色透明晶体，习称紫水晶（Amethyst），晶体结构属三方晶系。晶体呈六方双锥、六方柱聚形，柱面具横纹。集合体呈致密块状。淡紫色或深紫色，透明而莹澈，油脂光泽。硬度7，断口贝壳状，相对密度2.5-2.8，具压电性。不溶于一般酸。\", \"wei\": \"甘；辛；温；无毒\", \"liang\": \"内服：煎汤：2-4钱；或入丸、散。\", \"zhi\": \"镇心；安神；降逆气；暖子宫。主心悸；怔忡；惊痫；肺寒咳逆上气；女子宫寒不孕\" },\n  { \"name\": \"海狗肾\", \"xing\": \"1.海狗，体肥壮，形圆而长，至后部渐收削。雄兽身长达2.5m，雌兽身长仅及其半。头略圆，额骨高，眼大，耳过甚小，口吻短。旁有长须。四肢均有5趾，趾间有蹼，形成鳍足。尾甚短小。体深灰褐色，腹部黄褐色。<br>2.斑海豹，体颇粗壮，雄性长1.5-2m，重150kg，雌性长1.4-1.6m，重120kg。头圆颈短，吻宽短，口部触须长，每侧40-50根，呈念珠状，刚硬。齿数34。眼大而圆，无耳壳，鼻孔均有瓣膜，可启闭。前肢较小，上部隐于体内，前、后肢均具5趾长于其余各趾，形成扇形，与尾相连，只向后伸，不能自脚踝处向前弯曲活动。尾短小夹于后鳍足之间。全身密被短毛，体背灰黄色或蓝灰褐色，布有许多不规则的蓝黑色及白色大小不一的斑点。下颌白色无斑。腹部乳黄色，斑点稀少。随年龄增长，毛色变浅或近白色。<br>3.点斑海豹，雄性体长1.6-1.9m，重87-170kg；雌性体长1.5-1.7m，重60-142kg。体具白灰色至深褐色或黑色的斑块、不定型斑点、环斑及污斑等，底色也颇多变异有喜在陆上繁殖等特点。由于过去多年来点斑海参豹与斑海豹经常混淆不清，故近年来已将两者均作为独立种，以俐与其他亚种相区别。本种为鳞脚类中分布最广的一种。\", \"wei\": \"味咸；性热\", \"liang\": \"内服：煎汤，3-9g；或研末；或浸酒。\", \"zhi\": \"温肾壮阳，填精补髓。主虚祛寒；阳痿遗精；早泄；腰膝痿软；心腹疼痛\" },\n  { \"name\": \"海马\", \"xing\": \"无\", \"wei\": \"甘，温。\", \"liang\": \"3～9g。外用适量，研末敷患处。\", \"zhi\": \"温肾壮阳，散结消肿。用于阳痿，遗尿，肾虚作喘，Y瘕积聚，跌扑损伤；外治痈肿疔疮。\" },\n  { \"name\": \"海龙\", \"xing\": \"1.刁海龙，体形狭长而侧扁。体全长37-50cm。体高远大于体宽。躯干部五棱形，尾部前方六棱形，后方逐渐变细，为四棱形，尾端卷曲。头长，与体轴在同一水平线上，或与体轴形成大钝角，吻特别延长，侧扁，约为眶后头长的2倍。眼大而圆，眼眶突出。鼻孔每侧2个，很小。口小，前位，口闭时，口裂几呈垂直状。两颌短小。鳃盖突出，具明显的放射状线纹，鳃孔小，位近头侧背缘。眼眶四周、吻管背腹面及顶部的后端，均被有大小不等粗糙颗粒状棘；颈部背方呈棱脊状，具颈棘2个；腹部中央棱较突出。肛门位于体1/2后方腹面。体无鳞，包被于骨质环中体部骨环25-26；尾部骨环56-57。背鱼较长，41-42条；始于尾环第1节，止于第10或11节。臀鳍4，极短小。胸鳍23，短宽。无尾鳍。体淡黄色，于躯干部上侧棱骨环相接处有一列黑褐色斑点，各鳍色浅。雄体于尾部前方腹面有育儿囊。<br>2.拟海龙，体长形、平扁，一般体长20-22cm，体定大于体高，躯干部近四棱形，尾部前方六棱形，后方渐细，呈四棱形，尾端细尖略卷。头长，与身体在同一水平线上。吻长而侧扁，约为眶后头长的2倍，眼较大而圆，虎眶稍突出。鳃盖上缘嵴纹较突出，止于鳃孔前方，胸鳍基部前方，各具一较大而突出的结，头上除眼嵴上缘各具一小棘外，侨汇无棘刺。体无鳞，骨环体部16-17，尾部51-53。躯干部与尾侧棱及下侧棱完全相连。背鳍很小鳍条5-6，紧处于肛门后方，胸鳍20-22，短宽。无尾鳍。体鱼绿黄色，体侧及腹面均有大小不等的鲜黄斑点，吻侧及下方具有不规则深绿色网纹。各鳍绿黄色。<br>3.尖海龙，体细长，鞭状，一般体长11-20cm，体高及宽近相等。躯干部七棱形，腹部中央棱微凹，尾部四棱形，尾后方渐细，不卷曲。头长而细尖，体长为头长7.4-9.3倍。吻细长，管状，头长为吻长1.7-1.9倍，为眼径6.9-8.4倍，眼大而圆，眼眶微突。鳃盖上线状嵴短小，存在于基部1/3处，鳃孔很小，躯干部上侧棱与尾部上侧棱不相连，躯干部下侧棱与尾部下侧棱相连结，躯干部中侧棱与尾部上侧棱相接近。体无鳞，全为骨环所包，体部骨环19，尾部36-41。背鳍35-45，较长，始于最末体环，止于第9尾环。臀鳍4，短小。胸鳍12-13，扇形。尾鳍9-10，后缘黑褐色，其他鳍淡色。<br>4.蓝海龙，体细，柱状，体高大于体宽，体长为头长8.4-9.8倍。头细尖，为吻长2.1-2.7倍，为眼径1.5-2倍。鳃盖具一完整线状嵴。体上各要夫较尖锐，躯干部与尾部二者的上侧棱不相连续，下侧棱完全连续，躯干部中侧棱与尾部下侧棱几相连续。体为骨环所包，体部骨环12，尾部骨环35-36。背鳍22-23，始于躯干部最末环，止于第5尾环。臀鳍3，胸鳍13，尾鳍10。体黑褐色，体上具不规则横带，杂有淡色斑纹。背鳍上具3-4行不规则黑色斑点。腹面中央棱嵴上有一较宽黑色纵带。尾鳍黑色，其他各鳍淡色。<br>5.低海龙，体细长，柱状，一般体长12-14cm，体较高，大于体宽。头细长，体长为头长7.6-8.1倍，头长吻长2.1-2.2倍，为眼径6.5-6.9倍。鳃盖上具一完整的线状嵴，其上下有放射状细纹。体被骨环所包，体部骨环16，尾部骨环37-39。背鳍25-28，完全位于尾部的1-6尾环间。臀鳍2，胸鳍14-15，尾鳍10。体淡黄褐色或暗褐色。头上眼后有3条放射状黑褐条纹，眼前1条达吻上，吻腹面中央有一黑纵带。体上有黑褐色环带与淡色斑相间隔。尾鳍黑褐色，其他各鳍淡色。<br>6.舒海龙，体细长，鞭状，体高和体宽约相等。头长而尖，体长约为头长4.8-7.0，头长为吻长1.7-1.8倍，为眼径5.3-6.0倍。吻长大于眶后头长。鳃盖线状嵴短小。躯干部上侧棱与尾部上侧棱不相连，躯干中侧棱和尾部上侧棱接近。体为骨环所包，体部骨环19，尾部36-40，始于最末体环，止于第九尾环。臀鳍3-4，胸鳍12-13，尾鳍9-10。体灰褐色。\", \"wei\": \"味甘；咸；性温\", \"liang\": \"内服：煎汤，3-9g；研末，1.5-3g。外用：适量，研末掺敷。\", \"zhi\": \"补肾壮阳；散结消肿。主阳痿；遗精；不育；肾虚作喘；症瘕积聚；瘰疬瘿瘤；跌打损伤；痈肿疔疮\" },\n  { \"name\": \"哈蟆油\", \"xing\": \"形态详\\\"哈士蟆\\\"条。\", \"wei\": \"甘咸，平。\", \"liang\": \"内服：蒸汤，1～3钱；或作丸。\", \"zhi\": \"补肾益精，润肺养阴。治病后、产后虚弱，肺痨咳嗽吐血，盗汗。\" },\n  { \"name\": \"当归\", \"xing\": \"多年生草本，高0.4-1m。根圆柱状，分枝，有多数肉质须根，黄棕色，有深郁香气。茎直立，绿以或带紫色，有纵深沟纹，光滑无毛。叶三出式，二至三回羽状分裂；叶柄长3-11cm，基部膨大成管状的薄膜质鞘；基生叶及茎上部叶轮廓为卵形，长8-18cm，宽15-20cm，小叶片3对，下部的1对小叶柄长0.5-1.5cm，近顶端的1对无柄，末回裂片卵形或卵状披针形，长1-2cm，宽5-15mm，2-3浅裂，边缘有缺刻锯齿，齿端有尖头，叶下面及边缘被稀疏的乳头状白色细毛；茎上部叶简化成囊状鞘和羽状分裂的叶片。复伞形花序顶生，花序梗长4-7cm，密被细柔毛；伞辐9-30；总苞片2，线形，或无；小伞形花序有花13-36；小总苞片2-4，线形，萼齿5，齿形；花瓣长卵形，先端狭尖，内折；花柱短，花柱基圆锥形。果实椭圆形至卵形，长4-6mm，宽3-4mm，背棱线形，隆起，侧棱成宽而薄的翅，与果体等宽或略宽，翅边缘淡紫色，棱槽内油管1，合生面油管2。花期6-7月，果期7-9月。\", \"wei\": \"味甘；辛；苦；性温\", \"liang\": \"内服：煎汤，6-12g；或入丸、散；或浸酒；或敷膏。\", \"zhi\": \"补血；活血；调经止痛；润燥滑肠。主血虚诸证；月经不调；经闭；痛经；症瘕结聚；崩漏；虚寒腹痛；痿痹；肌肤麻木；肠燥便难；赤痢后重；痈疽疮疡；跌扑损伤\" },\n  { \"name\": \"熟地黄\", \"xing\": \"地黄 多年生草本，高10-40cm。全株被灰白色长柔毛及腺毛。根肥厚，肉质，呈块状，圆柱形或纺锤形。茎直立，单一或基部分生数枝。基生叶成丛，叶片倒卵状披针形，长3-10cm，宽1.5-4cm，先端钝，基部渐窄，下延成长叶柄，叶面多皱，边缘有不整齐锯齿；茎生叶较小。花茎直立，被毛，于茎上部呈总状花序；苞片叶状，发达或退化；花萼钟状，先端5裂，裂片三角形，被多细胞长柔毛和白色长毛，个脉10条；花冠宽筒状，稍弯曲，长3-4cm，外面暗紫色，里面杂以黄色，有明显紫纹，先端5浅裂，略呈二唇形；雄蕊4，二强，花药基部叉形；子房上位，卵形，2室，花后变1室，花柱1，柱头膨大。蒴果卵形或长卵形，先端尖，有宿存花柱，外为宿存花萼所包。种子多数。花期4-5月，果期5-6月。\", \"wei\": \"味甘；性温\", \"liang\": \"内服：煎汤，10-30g；或入丸散；或熬膏，或浸酒。\", \"zhi\": \"补血滋润；益精填髓。主血虎萎黄；眩晕心悸；月经不调；崩不止；肝肾阴亏；潮热盗汗；遗精阳痿；不育不孕；腰膝酸软；耳鸣耳聋；头目昏花；须发早白；消渴；便秘；肾虚喘促\" },\n  { \"name\": \"白芍\", \"xing\": \"1.芍药 多年生草本，高40-70cm，无毛。根肥大，纺锤形或圆柱形，黑褐色。茎直立，上部分枝，基部有数枚鞘状膜质鳞片。叶互生；叶柄长达9cm，位于茎顶部者叶柄较短；茎下部叶为二回三出复叶，上部叶为三出复叶；小叶狭卵形、椭圆形或披针形，长7.5-12cm，宽2-4cm，先端渐尖，基部楔形或偏斜，边缘具白色软骨质细齿，两面无毛，下面沿叶脉疏生短柔毛，近革质。花两性，数朵生茎顶和叶腋，直径7-12cm；苞片4-5，披针形，大小不等；萼片4，宽卵形或近圆形，长1-1.5cm，宽1-1.7cm，绿色，宿存；花瓣9-13，倒卵形，长3.5-6cm，宽1.5-4.5cm，白色，有时基部具深紫色斑块或粉红色，栽培品花瓣各色并具重瓣；雄蕊多数，花丝长7-12mm，花药黄色；花盘浅杯状，包裹心皮基部，先端裂片钝圆；心皮2-5，离生，无毛。蓇葖果卵形或卵圆形，长2.5-3cm，直径1.2-1.5cm，先端具椽，花期5-6月，果期6-8月。\", \"wei\": \"苦；酸；微寒\", \"liang\": \"内服：煎汤，5-12g；或入丸、散。大剂量可用15-30g。\", \"zhi\": \"妇康宁片 白芍200g，香附30g，当归25g，三七20g，艾叶（炭）4g，麦冬50g，党参30g，益母草150g。取白芍80g及香附、当归、三七、艾叶粉碎成细粉，过筛，混匀。其余白芍120g及麦冬、党参、益母草加水煎煮2次，合并煎液，滤过，滤液浓缩成膏，加入上述粉末及辅料，混匀，用70％乙醇制粒，干燥，压制成1018片，片心重0.25g,包糖衣。片心呈棕褐色，味微苦。功能调经养血，理气止痛。用于气血两亏，经期腹痛，口服，每次8片，每日2-3次或经前4-5日服用。（卫生部《药品标准·中药成方制剂》(第二册)1989年）\" },\n  { \"name\": \"阿胶\", \"xing\": \"无\", \"wei\": \"甘，平。\", \"liang\": \"内服：黄酒或开水烊化，1.5～3钱；煎汤或入丸、散。\", \"zhi\": \"滋阴补血，安胎。治血虚，虚劳咳嗽，吐血，衄血、便血，妇女月经不调，崩中，胎漏。\" },\n  { \"name\": \"何首乌\", \"xing\": \"多年生缠绕藤本。根细长，末端成肥大的块根，外表红褐色至暗褐色。茎基部略呈木质，中空。叶互生；具长柄；托叶鞘膜质，褐色；叶片狭卵形或心形，长 4-8cm，宽2.5-5cm，先端渐尖，基部心形或箭形，全缘或微带波状，上面深绿色，下面浅绿色，两面均光滑无毛。圆锥花序。小花梗具节，基都具膜质苞片；花小，花被绿白色，5裂，大小不等，外面3片的背部有翅；雄蕊8，不等长，短于花被；雌蕊1，柱头3裂，头状。瘦果椭圆形，有3棱，黑色，光亮，外包宿存花被，花被具明显的3翅。花期8-10月，果期9-11月。\", \"wei\": \"苦；甘；涩；性微温\", \"liang\": \"内服：煎场，10～20g；熬膏、浸酒或入丸、散。外用：适量，煎水洗、研末撒或调涂。\", \"zhi\": \"养血滋阴；润肠通便；截疟；祛风；解毒。主血虚头昏目眩；心悸；失眠；肝肾阴虚之腰膝酸软；须发早白；耳鸣；遗精；肠燥便秘；久疟体虚；风疹瘙痒；疮痈；瘰疬；痔疮\" },\n  { \"name\": \"龙眼肉\", \"xing\": \"无\", \"wei\": \"甘，温。\", \"liang\": \"9～15g。\", \"zhi\": \"补益心脾，养血安神。用于气血不足，心悸怔忡，健忘失眠，血虚萎黄。\" },\n  { \"name\": \"北沙参\", \"xing\": \"无\", \"wei\": \"甘、微苦，微寒。\", \"liang\": \"4.5～9g。\", \"zhi\": \"养阴清肺，益胃生津。用于肺热燥咳，劳嗽痰血，热病津伤口渴。\" },\n  { \"name\": \"南沙参\", \"xing\": \"①轮叶沙参，又名:铃儿草（《别录》），四叶沙参。\", \"wei\": \"甘微苦，凉。\", \"liang\": \"内服:熬汤，3～5钱（鲜者1～3两）；或入丸、散。\", \"zhi\": \"养阴清肺，祛痰止咳。治肺热燥咳，虚痨久咳，阴伤咽干喉痛。\" },\n  { \"name\": \"百合\", \"xing\": \"无\", \"wei\": \"甘，寒。\", \"liang\": \"6～12g。\", \"zhi\": \"养阴润肺，清心安神。用于阴虚久咳，痰中带血，虚烦惊悸，失眠多梦，精神恍惚。\" },\n  { \"name\": \"麦冬\", \"xing\": \"无\", \"wei\": \"甘，微苦，微寒。\", \"liang\": \"6～12g。\", \"zhi\": \"养阴生津，润肺清心。用于肺燥干咳。虚痨咳嗽，津伤口渴，心烦失眠，内热消渴，肠燥便秘；咽白喉。\" },\n  { \"name\": \"天冬\", \"xing\": \"攀援状多年生草本。茎细，有纵槽纹。叶状枝2～3枚簇生叶腋，线形，扁平，长1～3cm，宽1mm左右，叶退化为鳞片，主茎上的鳞状叶常变为下弯的短刺。花1～3朵簇生叶腋，黄白色或白色；花被片6；雌蕊1,子房3室。浆果球形，熟时红色。花期5月。\", \"wei\": \"性寒，味甘、苦。\", \"liang\": \"无\", \"zhi\": \"养阴生津，润肺清心。用于肺燥干咳、虚劳咳嗽、津伤口渴、心烦失眠、内热消渴、肠燥便秘、白喉。\" },\n  { \"name\": \"石斛\", \"xing\": \"①金钗石斛（《本草衍义》）\", \"wei\": \"甘淡微咸，寒。\", \"liang\": \"内服：煎汤（须久煎），2～4钱（鲜者0.5～1两）；熬膏或入丸、散。\", \"zhi\": \"生津益胃，清热养阴。治热病伤津，口干烦渴，病后虚热，阴伤目暗。\" },\n  { \"name\": \"玉竹\", \"xing\": \"多年生草本，高40～65厘米。地下根茎横走，黄白色，直径0.5～1.3厘米，密生多数细小的须根。茎单一，自一边倾斜，光滑无毛，具棱。叶互生于茎的中部以上，无柄；叶片略带革质，椭圆形或狭椭圆形，罕为长圆形，长6～12厘米，宽3～6厘米，先端钝尖或急尖，基部楔形，全缘，上面绿色，下面淡粉白色，叶脉隆起。花腋生，花梗长1～1.4厘米，着生花1～2朵；花被筒状，长1.4～1.8厘米，白色，先端6裂，裂片卵圆形成广卵形，带谈绿色；雄蕊6，着生于花被简的中央，花丝扁平，花药狭长圆形，黄色；子房上位，具细长花柱，柱头头状。浆果球形，直径4～7毫米，成热后紫黑色。花期4～5月。果期8～9月。\", \"wei\": \"甘，平。\", \"liang\": \"内服：煎汤，2～3钱；熬膏或入丸、散。\", \"zhi\": \"治疗心力衰竭：以玉竹为主，治疗风湿性心脏病、冠状动脉粥样硬化性心脏病、肺原性心脏病等引起的Ⅱ～Ⅲ°心力衰竭5例，服药后分别在5～10天内心衰得到控制。其中3例对洋地黄过敏，服用少量即出现明显的洋地黄过量反应，改用玉竹治疗后，心衰控制，从未发生不良反应。用法：玉竹5钱，每日1剂，水煎服。5例均停用洋地黄，仅配合应用氨茶碱及双氢克尿塞。\" },\n  { \"name\": \"黄精\", \"xing\": \"①黄精<br>多年生草本。根茎横走，肥大肉质，黄白色，略呈扁圆柱形。有数个茎痕，茎痕处较粗大，最粗处直径可达2.5厘米，生少数须根。茎直立，圆柱形，单一，高50～80厘米，光滑无毛。叶无柄；通常4～5枚轮生；叶片线状披针形至线形，长7～11厘米，宽5～12毫米，先端渐尖并卷曲，上面绿色，下面淡绿色。花腋生，下垂，花梗长1.5～2厘米，先端2歧，着生花2朵；苞片小，远较花梗短；花被筒状，长8～13毫米，白色，先端6齿裂，带绿白色；雄蕊6，着生于花被管的中部，花丝光滑；雌蕊1，与雄蕊等长，子房上位，柱头上有白色毛。浆果球形，直径7～10毫米，成熟时黑色。花期5～6月。果期6～7月。<br>生于荒山坡及山地杂木林或灌木丛的边缘。分布黑龙江、吉林、辽宁、河北、山东、江苏、河南、山西、陕西、内蒙古等地。<br>②囊丝黄精<br>多年生草本。根茎横生，肥大肉质，近圆柱形，节处较膨大，直径钓1.5厘米。茎圆柱形，高40～80厘米，光滑无毛，有时散生锈褐色斑点。叶无柄，互生；叶片革质，椭圆形，有时为长圆状或卵状椭圆形，长8～14厘米，宽3～6厘米，先端钝尖，两面均光滑无毛，叶脉5～7条。花腋生，总花梗下垂，长约2厘米，通常着花3～5朵或更多，略呈伞形；小花梗长约1厘米；花被绿白色，筒状，长约2厘米，先端6齿裂；雄蕊6，花丝上有柔毛或小乳突；雌蕊1，与雄蕊等长。浆果球形，成熟时暗紫色，直径1～1.5厘米。种子圆球形。花期4～5月。果期6～9月。<br>生山地。分布山东、江苏、安徽、浙江、湖北、江西、湖南、广东、广西、河南等地。<br>③热河黄精，又名：多花玉竹。<br>多年生草本，高30～70厘米。根茎横生，圆柱形，有节。茎直立，单一。叶互生，生于茎中部以上的无柄或有极短的柄；叶片广椭圆形或长卵形，长3～8厘米，宽1～3厘米，先端钝，基部圆形，全缘，下面具灰粉状物。花腋生，总花梗长3～6厘米，着生4～10花，成聚伞花序。花被筒状，乳白色，先端6裂，裂片钝三角形；雄蕊6，着生在花被筒的中央；子房卵圆形，具细长白色花柱。浆果球形，熟时黑色。花期5月。果期6～7月。<br>生于林下、山坡草地。分布东北及河北、山东等地。<br>④滇黄精<br>多年生草本，高可达1米。根茎横生，有节。茎直立，单一。叶4～6片轮生，线形，长8～13厘米，宽1.5～2厘米，先端渐尖而卷曲，基部渐狭；无柄。花1～3朵腋生；花被筒状，淡绿色，6裂。浆果球形，熟时橙红色。花期4～5月。<br>多生于阴湿的山坡林下或灌木丛中。分布云南等地。<br>⑤卷叶黄精，参见老虎姜条。<br>同属植物玫瑰红黄精 （新疆）、甘肃黄精（西北，以上两种参见羊角参条）、弯花柱黄精（宁夏）、红果黄精（青海、甘肃）、长梗黄精（浙江、福建）、深山黄精（浙江、江西）等在少数地区亦作黄精使用。\", \"wei\": \"甘，平。<br>①《别录》：味甘，平，无毒。<br>②《四声本草》：寒。\", \"liang\": \"内服：煎汤，3～5钱（鲜者1～2两）；熬膏或入丸、散。外用：煎水洗。\", \"zhi\": \"补中益气，润心肺，强筋骨。治虚损寒热，肺痨咳血，病后体虚食少，筋骨软弱，风湿疼痛，风癞癣疾。<br>①《别录》：主补中益气，除风湿，安五脏。<br>②《日华子本草》：补五劳七伤，助筋骨，止饥，耐寒暑，益脾胃，润心肺。<br>③《滇南本草》：补虚添精。<br>④《纲目》：补诸虚，止寒热，填精髓，下三尸虫。<br>⑤《本草从新》：平补气血而润。<br>⑥《现代实用中药》：用于间歇热、痛风、骨膜炎、蛔虫、高血压。<br>⑦《四川中药志》：补肾润肺，益气滋阴。治脾虚面黄，肺虚咳嗽，筋骨酸痹无力，及产后气血衰弱。<br>⑧《湖南农村常用中草药手册》：补肾健脾，强筋壮骨，润肺生津。\" },\n  { \"name\": \"枸杞子\", \"xing\": \"①枸杞（《本经》），又名:杞（《诗经》），枸檵（《毛诗传》），枸忌（《本经》），羊乳（《吴普本草》），苦杞、地筋（《广雅》），象柴、纯卢、仙人杖、却老、天精（《抱朴子》），却暑（《别录》），地仙（《日华子本草》），枸棘（《本草衍义》），狗地芽（《草木便方》），红榴榴科，石寿树。\", \"wei\": \"甘，平。\", \"liang\": \"内服:煎汤，2～4钱；熬膏、浸酒或入丸、散。\", \"zhi\": \"滋肾，润肺，补肝，明目。治肝肾阴亏，腰膝酸软，头晕，目眩，目昏多泪，虚劳咳嗽，消渴，遗精。\" },\n  { \"name\": \"墨旱莲\", \"xing\": \"鳢肠（《唐本草》）<br>一年生草本。茎柔弱，直立或匍匐，高达30～60厘米，被毛。叶对生，近无柄，线状矩圆形至披针形，长4～10厘米，宽0.8～2厘米，基部楔形，先端短尖或钝，全缘或稍具齿，叶两面密被白色租毛。头状花序，腋生或顶生，具花梗；总苞绿色，卵形至阔钟形，苞片少数，2列，被小粗毛；花托扁平，有线状鳞片，托上着生少数舌状花及多数管状花；舌状花雌性，约2列，狭线形，发育或不发育，白色，全缘或为2齿裂，子房椭圆形而扁，管状花两性，全发育；花冠4浅裂，裂片卵形，外被疏毛，雄蕊4，药围绕花柱四周；子房椭圆形而扁，花柱柱状，柱头2裂。瘦果黄黑色，长椭圆形而扁，长约3毫米，顶端秃净。揉搓其茎叶有黑色汁液流出。花期夏季。果期9～10月。\", \"wei\": \"甘酸，凉。<br>①《唐本草》：味甘酸，平，无毒。<br>②《滇南本草》：性寒，味咸。\", \"liang\": \"内服：煎汤，0.3～1两；熬膏、捣汁或入丸、散。外用：捣敷、研末撒或捣绒塞鼻。\", \"zhi\": \"凉血，止血，补肾，益阴。治吐血，咳血，衄血，尿血，便血，血痢，刀伤出血，须发早白，白喉，淋浊，带下，阴部湿痒。<br>①《唐本草》：主血痢。针灸疮发，洪血不可止者敷之；汁涂发眉，生速而繁。<br>②《日华子本草》：排脓，止血，通小肠，敷一切疮并蚕。<br>③《滇南本草》：固齿，乌须，洗九种痔疮。<br>④《纲目》：乌须发，益肾阴。<br>⑤《本草述》：疗溺血及肾虚变为劳淋。<br>⑥《生草药性备要》：治跌打伤，理酒顶，化痰，杀，止痒，干水。<br>⑦《分类草药性》：止血，补肾，退火，消肿。治淋、崩。<br>⑧《南宁市药物志》：治目疾、翳膜。\" },\n  { \"name\": \"女贞子\", \"xing\": \"常绿灌木或乔木，高可达25m。树皮灰褐色。枝黄褐色、灰色或紫红色，圆柱形，疏生圆形或长圆形皮孔。单叶对生；叶柄长1-3cm，上面具沟；叶片革质，卵形、长卵形或椭圆形至宽椭圆形，长6-17cm，宽3-8cm，先端锐尖至渐尖或钝，基部圆形，有时宽楔形或渐狭。圆锥花序顶生，长8-20cm，宽8-25cm;花序梗长达3cm；花序基部苞片常与叶同型，小苞片披针形或线形，凋落；花无梗或近无梗；花萼无毛，长1.5-2mm，齿不明显或近截形；花冠长4-5mm，裂片长2-2.5mm,反折；花丝长1.5-3mm，花药长圆形，长1-1.5mm；花柱长1.5-2mm，柱头棒状。果肾形或近肾形，长7-10mm，径4-6mm，深蓝黑色，成熟时呈红黑色，被白粉。花期5-7月，果期7月至翌年5月。\", \"wei\": \"甘；苦；性凉\", \"liang\": \"内服：煎汤，6-15g；或入丸剂。外用：适量，敷膏点眼。清虚热宜生用，补肝肾宜熟用。\", \"zhi\": \"补益肝肾；清虚热；明目。主头昏目眩；腰膝酸软；遗精；耳鸣；须发早白，骨蒸潮热；目暗不明\" },\n  { \"name\": \"桑椹\", \"xing\": \"无\", \"wei\": \"甘，寒。\", \"liang\": \"内服：煎汤，3～5钱；熬膏、生啖或浸酒。外用：浸水洗。\", \"zhi\": \"补肝，益肾，熄风，滋液。治肝肾阴亏，消渴，便秘，目暗，耳鸣，瘰疬，关节不利。\" },\n  { \"name\": \"黑芝麻\", \"xing\": \"无\", \"wei\": \"甘，平。\", \"liang\": \"9～15g。\", \"zhi\": \"补肝肾，益精血，润肠燥。用于头晕眼花，耳鸣耳聋，须发早白，病后脱发，肠燥便秘。\" },\n  { \"name\": \"龟甲\", \"xing\": \"无\", \"wei\": \"咸、甘，微寒。\", \"liang\": \"9～24g，先煎。\", \"zhi\": \"滋阴潜阳，益肾强骨，养血补心。用于阴虚潮热，骨蒸盗汗，头晕目眩，虚风内动，筋骨痿软，心虚健忘。\" },\n  { \"name\": \"龟甲胶\", \"xing\": \"无\", \"wei\": \"咸、甘，凉。\", \"liang\": \"烊化兑服，3～9g。\", \"zhi\": \"滋阴，养血，止血。用于阴虚潮热，骨蒸盗汗，腰膝酸软，血虚萎黄，崩漏带下。\" },\n  { \"name\": \"鳖甲\", \"xing\": \"1.中华鳖，体呈椭圆形或近卵圆形，成体全长约30-40cm。头尖，吻长，形成吻突呈短管状；鼻孔位于吻突前端，上下颌缘覆有角质硬鞘，无齿，眼小；瞳孔圆表，鼓膜不明显，颈部可长达70mm以上，颈基部无颗粒状疣，头、颈可完全缩入甲内。背腹甲均无角质板而被有革质软皮，边缘具柔软的较厚的结缔组织，谷称裙边。背面皮肤有突起小疣，成纵行棱起，背部中央稍凸起，椎板8对，肋板8对，无臀板，边缘无缘板相连。背部骨片没有完全骨质化，肋骨与肋板愈合，其末端突出于肋板外侧。四肢较扁平，前肢5指；内侧三指有外露的爪；外侧二指的爪全被皮肤包裹而不外露，后肢趾爪生长情况亦同，指、趾间具蹼而发达。雄性体较扁而尾较长，末端露出于裙边；雌性尾粗短，不露出裙边。泄殖肛孔纵裂。头颈部上面橄榄绿色，下面黄色，下颌至喉部有黄色斑纹，两眼前后有黑纹，眼后头顶部有10余个黑点。体背橄榄绿色或黑棕色，具黑斑，腹部肉黄色，两侧裙边处有绿色大斑纹，近尾部有两团豌豆大的绿色斑纹。前肢上面橄榄绿色；下面淡黄色，后肢上面色较浅。尾部正中为橄榄绿色，余皆为淡黄色。\", \"wei\": \"味咸；性微寒\", \"liang\": \"内服：煎汤，10-30g，先煎；熬膏；或入丸、散。外用：适量，烧存性，研末掺或调敷。\", \"zhi\": \"滋阴清热；潜阳熄风；软坚散结。主阴虚发热；劳热骨蒸；热病伤阴；虚风内动；小作惊痫；久疟；疟母；症瘕；经闭\" }] },\n\n{\n  \"name\": \"收涩药\",\n  \"num\": 29,\n  \"content\": [\n  { \"name\": \"柿蒂\", \"xing\": \"柿（《礼记》），又名:镇头迦（《纲目》）。\", \"wei\": \"苦涩，平。\", \"liang\": \"内服:煎汤，2～4钱；或入散剂。\", \"zhi\": \"降逆气。止呃忒、呕哕。\" },\n  { \"name\": \"浮小麦\", \"xing\": \"小麦，一年生或越年生草本，高60-100cm。秆直立，通常6-9节。叶鞘光滑，常较节间为短；叶舌膜质，短小；叶片扁平，长披针形，长15-40cm，宽8-14mm，先端渐尖，基部方圆形。穗状花序直立，长3-10cm；小穗两侧扁平，长约12mm，在穗轴上平行排列或近于科行，每小穗具3-9花，仅下部的花结实；颖短，第1颖较第2颖为宽，两者背面均具有锐利的脊，有时延伸成芒；外稃膜质，微裂成3齿状，中央的齿常延伸成芒，内稃与外稃等长或略短，脊上具鳞毛状的窄翼；雄蕊3；子房卵形。颖果长圆形或近卵形，长约6mm，浅褐色。花期4-5月，果期5-6月。\", \"wei\": \"味甘；性凉\", \"liang\": \"内服：煎汤，15-30g；或研末。止汁，宜微炒用。\", \"zhi\": \"除虚热；止汗。主止阴虚发热；盗汗；自汗\" },\n  { \"name\": \"小麦\", \"xing\": \"一年生或二年生草本，高60～100厘米。秆直立，通常具6～9节。叶鞘光滑，常较节间为短；叶舌膜质，短小；叶片扁平，长披针形，长15～40厘米，宽8～14毫米，先端渐尖，基部方圆形。穗状花序直立，长3～10厘米；小穗两侧扁平，长约12毫米，在穗轴上平行排列或近于平行，每小穗具3～9花，仅下部的花结实。小穗节间约1毫米；颖短，革质，第1颖较第2颖为宽，两者背面均具有锐利的脊，有时延伸成芒，具6～9纵脉，外稃膜质，微裂成3齿状，中央的齿常延伸成芒，背面5～9脉，内稃与外稃等长或略短，脊上具鳞毛状的窄翼，翼缘被细毛；雄蕊3枚，花药长1.5～2毫米，丁字着生，花丝细长，子房卵形。颖果矩圆形或近卵形，长约6毫米，浅褐色。花期4～5月。果期5～6月。\", \"wei\": \"甘，凉。\", \"liang\": \"内服：小麦煎汤，1～2两；或煮粥。小麦面冷水调服或炒黄温水调服。外用：小麦炒黑研末调敷。小麦面干撒或炒黄调敷。\", \"zhi\": \"治疗外科感染：取陈小麦2斤，加水3斤，浸泡3天后捣烂、过滤、去渣，滤液沉淀后取沉淀物晒干，小火炒至焦黄研细。临用时将药粉加醋适量调成糊状，外敷疮疖、丹毒等患处，日2次，已溃者敷疮口四周。据数千例观察，有效率在90％以上。\" },\n  { \"name\": \"糯稻根\", \"xing\": \"稻 一年生栽培植物。秆直立，丛生，高约1m左右。叶鞘无毛，下部者长于节间；叶舌膜质而较硬，披针形，基部两侧下延与叶鞘边缘相结合，长5-25mm，幼时具明显的叶耳；叶片扁平，披针形至条状披针形，长30-60cm，宽6-15cm。圆锥花序疏松，成熟时向下弯曲，分枝具角棱，常粗糙；小穗长圆形，两侧压扁，长6-8mm，含3小花，下方两小花退化仅存极小的外稃而位于1两性小花之下；颖极退化，在小穗柄之顶端呈半月形的痕迹；退化外稃长3-4mm，两性小花外稃，有5脉，常具细毛，有芒或无芒，内稃3脉，亦被细毛；鳞被2，卵圆形，长1mm；雄蕊6；花药长2mm；花柱2枚，筒短，柱头帚刷状，自小花两侧伸出。颖果平滑。花、果期6-10月。\", \"wei\": \"甘；平\", \"liang\": \"内服：煎场，15-30g，大剂量可用60-120g。以鲜品为佳。\", \"zhi\": \"养阴除热；止汗。主阴虚发热；自汗盗汗；口渴咽干；肝炎；丝虫病\" },\n  { \"name\": \"五味子\", \"xing\": \"无\", \"wei\": \"酸、甘，温。\", \"liang\": \"1.5～6g。\", \"zhi\": \"收敛固涩，益气生津，补肾宁心。用于久嗽虚喘，梦遗滑精，遗尿尿频，久泻不止，自汗，盗汗，津伤口渴，短气脉虚，内热消渴，心悸失眠。\" },\n  { \"name\": \"乌梅\", \"xing\": \"无\", \"wei\": \"酸、涩，平。\", \"liang\": \"6～12g。\", \"zhi\": \"敛肺，涩肠，生津，安蛔。用于肺虚久咳，久痢滑肠，虚热消渴，蛔厥呕吐腹痛，胆道蛔虫症。\" },\n  { \"name\": \"五倍子\", \"xing\": \"无\", \"wei\": \"酸、涩，寒。\", \"liang\": \"3～6g；外用适量。\", \"zhi\": \"敛肺降火，涩肠止泻，敛汗止血，收湿敛疮。用于肺虚久咳，肺热痰嗽，久泻久痢，盗汗，消渴，便血痔血，外伤出血，痈肿疮毒，皮肤湿烂。\" },\n  { \"name\": \"罂粟壳\", \"xing\": \"无\", \"wei\": \"酸、涩，平；有毒。\", \"liang\": \"3～6g。\", \"zhi\": \"敛肺、涩肠、止痛。用于久咳、久泻，脱肛，脘腹疼痛。\" },\n  { \"name\": \"诃子\", \"xing\": \"无\", \"wei\": \"苦、酸、涩，平。\", \"liang\": \"3～9g。\", \"zhi\": \"涩肠敛肺，降火利咽。用于久泻久痢，便血脱肛，肺虚喘咳，久嗽不止，咽痛音哑。\" },\n  { \"name\": \"石榴皮\", \"xing\": \"石榴（《雷公炮炙论》）又名：楮榴（《广雅》），安石榴（张华《博物志》），丹若（《酉阳杂俎》），金罂（《纲目》），金庞（《群芳谱》），榭榴、海石榴、安息榴、西安榴、钟石榴。<br>落叶灌木或乔木，高2～5米。树皮青灰色；幼枝近圆形或微呈四棱形，枝端通常呈刺状，无毛，叶对生或簇生；叶片倒卵形至长椭圆形，长2.5～6厘米，宽1～1.8厘米，先端尖或微凹；基部渐狭，全缘，上面有光泽，无毛，下面有隆起的主脉，具短柄。花1至数朵，生小枝顶端或腋生，花梗长2～3毫米；花的直径约3厘米；萼筒钟状，肉质而厚，红色，裂片6，三角状卵形；花瓣6，红色，与萼片互生，倒卵形，有皱纹；雄蕊多数，着生于萼管中部，花药球形，花丝细短；雌蕊1，子房下位或半下位，上部6室，具侧膜胎座，下部3室，具中轴胎座，花柱圆形，柱头头状。浆果近球形，果皮肥厚革质，熟时黄色，或带红色，内具薄隔膜，顶端有宿存花萼。种子多数，倒卵形，带棱角。花期5～6月。果期7～8月。<br>本植物的根皮（石榴根）、叶（石榴叶）、花（石榴花）、果实（酸石榴、甜石榴）等亦供药用，各详专条。\", \"wei\": \"酸涩，温，有毒。<br>①《药性论》：味酸，无毒。<br>②《滇南本草》：性寒，味酸涩。<br>③《纲目》：酸涩，沮，无毒。<br>④《广西中药》：味苦涩，性温，有毒。\", \"liang\": \"内服：煎汤，0.8～1.5钱；或入散剂。外用：煎水熏洗或研末调涂。\", \"zhi\": \"涩肠，止血，驱虫。治久泻，久痢，便血，脱肛，滑精，崩漏，带下，虫积腹痛，疥癣。<br>①《别录》：疗下痢，止漏精。<br>②《药性论》：治筋骨风，腰脚不遂，步行挛急疼痛。主涩肠，止赤白下痢。取汁止目泪下，治漏精。<br>③《本草拾遗》：主蛔虫。煎服。<br>④《滇南本草》：治日久水泻，同炒砂糖煨服，又治痢脓血，大肠下血。同马兜铃煎治小儿疳虫。<br>⑤《本草蒙筌》：理虫牙。<br>⑥《纲目》：止泻痢，下血，脱肛，崩中带下。<br>⑦《生草药性备要》：治瘤子疮，洗疝痛。<br>⑧《本草求原》：洗斑疥癞。<br>⑨《科学的民间药草》：驱除钩、绦虫。\" },\n  { \"name\": \"肉豆蔻\", \"xing\": \"肉豆蔻，常绿乔木，高可达20m。叶互生；椭圆状披针形或长圆状披针形，长5-15cm，革质，先端尾状，基部急尖，全缘，上面淡黄棕色，下面色较深，并有红棕色的叶脉；叶柄长6-12mm。花雌雄异株；雄花的总状花序长2.5-5cm；小苞片鳞片状；花疏生，黄白色，椭圆形或壶形，长6mm，下垂；花药9-12个，连合成圆柱状有柄的柱。果实梨形或近于圆球形，下垂，长3.5-6cm，淡红色或黄色，成熟后纵裂成2瓣，显出绯红色假种皮，种子长球形，种皮红褐色，木质。\", \"wei\": \"辛；苦；温\", \"liang\": \"内服：煎汤，1.5-6g；或入丸、散。\", \"zhi\": \"温中涩肠；行气消食。主虚泻；冷痢；脘腹胀痛；食少呕吐；宿食不消\" },\n  { \"name\": \"赤石脂\", \"xing\": \"单斜晶系。很少成结晶状态，多数为胶凝体。白色通常染有浅红、浅褐、浅黄、浅蓝、浅绿等色。新鲜断面具蜡样光泽，疏松多孔的则呈土状光泽。有平坦的贝壳状断口。硬度1-2。比重2.0-2.2，随水分子的含量而有变化。性脆。可塑性强。有土样气味，致密块状者在干燥时可裂成碎块。\", \"wei\": \"甘；涩；酸；温；无毒\", \"liang\": \"内服：煎汤，3-4钱；或入丸、散。外用：研末撒或调敷。\", \"zhi\": \"涩肠；收敛止血；收湿敛疮；生肌。主久泻；久痢；便血；脱肛；遗精；崩漏；带下；溃疡不敛；湿疹；外伤出血\" },\n  { \"name\": \"禹余粮\", \"xing\": \"非晶质。常成葡萄状、肾状、乳房状、块状、土状等集合体。颜色为褐色到黑色，若为土状则为黄褐色或黄色。条痕为黄褐色。半金属光泽或土状光泽，有时作丝绢光泽。不透明。断面为介壳状或土状。硬度1～5.5。比重3.6～4.0。\", \"wei\": \"甘涩，平，\", \"liang\": \"内服：煎汤，3～5钱；或入丸、散。外用：研末撒或调敷。\", \"zhi\": \"涩肠止血。治久泻久痢，妇人崩漏带下，痔漏。\" },\n  { \"name\": \"山茱萸\", \"xing\": \"无\", \"wei\": \"酸、涩，微温。\", \"liang\": \"6～12g。\", \"zhi\": \"补益肝肾，涩精固脱。用于眩晕耳鸣，腰膝酸痛，阳痿遗精，遗尿尿频，崩漏带下，大汗虚脱。内热消渴。\" },\n  { \"name\": \"覆盆子\", \"xing\": \"①掌叶覆盆子<br>落叶灌木，高2～3米。枝细圆，红棕色；幼枝绿色，有白粉，具稀疏、微弯曲的皮刺，长4～5毫米。叶单生或敷叶簇生，长3～5厘米，有达7厘米者，掌状5裂，罕有3裂，中央1片大，长卵形或长椭圆形，先端渐尖，常呈尾状，两侧裂片较小，常不相等，裂片边缘具重锯齿；主脉5出，上被柔毛，下面叶脉上均有柔毛；叶柄细，长3～4.5厘米，有极小的刺；托叶2枚，线状披针形。花单生于小枝顶端，花梗细，长2～3厘米；花萼5，宿存，卵状长圆形，两面有毛；花瓣5，卵圆形；雄蕊多数，花药丁字着生，2室；雌蕊多数，着生在凸出的花托上。聚合果近球形。花期4月。果期6～8月。<br>生于溪旁或山坡林中。分布安徽、江苏、浙江、江西、福建等地。<br>②插田泡，详倒生根条。\", \"wei\": \"甘酸，平。<br>①《别录》：味甘，平，无毒。<br>②《千金・食治》：味甘辛，平。<br>③《药性论》：微热，味甘辛。<br>④孟诜：味酸。\", \"liang\": \"内服：煎汤，1.5～2钱：浸酒、熬膏或入丸、散。\", \"zhi\": \"补肝肾，缩小便，助阳，固精，明目。治阳痿，遗精，溲数，遗溺，虚劳，目暗。<br>①《别录》：主益气轻身，令发不白。<br>②《药性论》：主男子肾精虚竭，女子食之有子。主阴痿。<br>③《日华子本草》：安五脏，益颜色，养精气，长发，强志。疗中风身热及惊。<br>④《开宝本草》：补虚续绝，强阴建阳，悦泽肌肤，安和脏腑，温中益力，疗劳损风虚，补肝明目。<br>⑤《本草衍义》：益肾脏，缩小便。<br>⑥《本草蒙筌》：治肾伤精竭流滑。<br>⑦《本草述》：治劳倦、虚劳，肝肾气虚恶寒，肾气虚逆咳嗽、痿、消瘅、泄泻、赤白浊，鹤膝风，诸见血证及目疾。\" },\n  { \"name\": \"桑螵蛸\", \"xing\": \"1.大刀螂，体形较大，长约8cm。黄褐色或绿色，头三角形，前胸背后板、肩部较发达，后部至前肢基部稍宽。前胸细长。前翅革质，前缘带绿色，末端的较明显的褐色翅脉；后翅比前翅稍长，有深浅不等的黑褐色斑点散布其间。雌虫腹部特别膨大。足3对前胸足粗大，，镰刀状。中足和后足细长。\", \"wei\": \"味甘；咸；性平\", \"liang\": \"内服：煎汤，5-10g；研末，3-5g；或入丸剂。外用：适量，研末撒或油调敷。\", \"zhi\": \"治疗遗尿症。取桑螵蛸、益智仁各1.5两(5-12岁儿童用1两)，水煎，日服1剂。试治 11例，一般连服3-4剂即可见效，再服2-3剂，可巩固疗效。\" },\n  { \"name\": \"金樱子\", \"xing\": \"金樱子 常绿攀援灌木，高达5m。茎无毛，有钩状皮刺和刺毛。羽状复叶，叶柄和叶轴具小皮刺和刺毛；托叶披针形，与叶柄分离，早落。小叶革质，通常3，稀5，椭圆状卵形或披针状卵形，长2.5-7cm，宽1.5-4.5cm，先端急尖或渐尖，基部近圆形，边缘具细齿状锯齿，无毛，有光泽。花单生于侧枝顶端，花梗和萼筒外面均密被刺毛；萼片5；花瓣5；白色直径5-9cm；雄蕊多数，心皮多数，柱头聚生于花托口。果实倒卵形，长2-4cm，紫褐色，外面密被刺毛。花期4-6月，果期7-11月。\", \"wei\": \"酸涩；平；无毒\", \"liang\": \"内服：煎汤，9-15g；或入丸、散，或熬膏。\", \"zhi\": \"固精，缩尿，涩肠，止带。主滑精；滑精；遗尿；尿频；久泻；久痢；白浊；白带；崩漏；脱肛；子宫下垂\" },\n  { \"name\": \"海螵蛸\", \"xing\": \"1.无针乌贼，软体中等大，背腹扁，胴部卵圆形，一般长约157mm，约为宽的2倍。头部长约29mm，眼大，眼后有椭圆形的嗅觉陷，头部中央有口，口吸周围有腕4对和触腕1对。各腕长度相近，顺序为4&gt;1&gt;3&gt;2，内侧有吸盘4行，吸盘大小相似，吸盘腔壁上的角质环外缘具尖锥形小齿；惟雄性左侧第4腕茎化为生殖腕，特点是基部约占全腕1/3处的吸盘特小，中部和顶部吸盘正常。触腕长度一般超过胴长，触腕穗狭小，长约40 ，其上有吸盘20行，大小相近，其角质环外缘具方圆形小齿。头部的腹面有一漏斗器，漏斗管下方体内的墨囊相通，可由漏斗排出黑液御敌。生活时，胴背有明显的白花斑，雄者斑大，雌者斑小。胴部两侧有肉鳍，全缘，前端较狭，向后渐宽，左、右两鳍在末端分离。胴后腹面末端有一腺孔，捕获后常有红褐色液体流出。外套腔背面的内壳长椭圆形，长约为宽的3倍，角质缘发达，末端形成角质板，横纹面呈水波形，末端无骨针。<br>2.金乌贼，体中等大，胴部卵圆形，一般长约200mm，约为宽的1.5倍，头部长约30mm，腕序为4&gt;1&gt;3&gt;2，吸盘4行，其角质环外缘具不规则的钝形小齿，雄性左侧第4腕茎化为生殖腕，特点是基部7列、8列吸盘正常，至9-15列吸盘突然变小，向上的吸盘又正常。触腔略超过胴长，触腕穗呈半月形，约为全腕长度的1/5。吸盘小而密，约10行，大小相近。生活时体表黄褐色，胴背具棕紫色和乳白色相间的细斑，雄性胴背具金黄色的波状横纹，但在生殖季节常显出若干不规则的蓝绿色横纹，腹部由乳白色变成 金绿色，非常鲜艳。内壳长椭圆形，长约为宽的2.5 倍，背面凸，有坚硬的石灰质粒状突起，腹面石灰质松软，中央有一条纵沟，横纹面具环形生长的横纹。末端骨针粗壮。<br>3.针乌贼，体较小胴部狭瘦，后端尖细，一般长约90mm，约为宽的2倍，鳍窄，头部长约12mm。雌雄异形显着，雄性胴部瘦长呈圆锥形，腕序为2&gt;4&gt;1&gt;3，其中第2对腕约为其他各腕长度的2倍以上，且极粗壮，顶端圆，外侧有紫色环纹，腕下面2/3处吸盘为4行，余为2行；雌性胴部胱肥短，腕序为2&gt;1&gt;4&gt;3，第2对和第3对腕相似，下面3/5处吸盘为4行，余为2行。两性的第1对和第3对腕吸盘为4行，顶端吸盘为2行；两性的第4对腕吸盘均为4行，两性的吸盘角质环外缘，基本无齿，惟尖端小吸盘略具方形小齿。雄性左侧第4腕茎化，顶端吸盘极小。触腕细长 ，超过胴长，触腕穗短小，约占全腕长度的1/10，吸盘7-8行，大小悬殊，中央4行最大。生活时背部有极细的黄色斑点。雄性内壳长为宽的6倍；雌性内壳长为宽的4倍，角质缘很窄，背面突起极细小，中央有一条纵肋，末端骨针尖锐。<br>4.白斑乌贼，体型较大，胴部卵圆形，一般长约300mm，约为宽度的1.8倍，肉鳍最大宽度小于胴宽的1/4，位于两侧，全缘，末端分离，腕序为4&gt;3&gt;2&gt;1，吸盘4行，基部的部分吸盘角质环外缘具密休愈合的钝头小齿；顶部的部分吸盘具分离小齿。生活时胴背黄褐色，具细白斑。内壳厚大，长椭圆形，长约为宽的2.5倍，背面颗粒粗大，腹面前凸后凹，横纹面中央有一条浅沟，末端骨针粗壮。<br>5.虎斑乌贼，体型较大，与白斑乌贼相似，主要差别是本种腕基部吸盘角质环外缘光滑无齿，但具很多细纹；顶部吸盘则具有密集的钝形小齿。生活时，体黄褐色，胴背有褐色波状斑纹，状如虎斑。内鳍与胴背交界处环绕着一圈天蓝色的镶边。<br>6.拟目乌贼，体型较大，与白斑乌贼相似，并要差别是腕序为4&gt;1&gt;3&gt;2。生活时，胴背黄褐色 ，并有明显的眼状白斑。触腕长，超过头长和胴长之和。内壳的横纹面较短。\", \"wei\": \"味咸；涩；性温\", \"liang\": \"内服：煎汤，10-30g；研末，1.5-3g。外用：适量，研末撒；或调敷；或吹耳、鼻。\", \"zhi\": \"收敛止血；固精止带；制酸止痛；收湿敛疮。主吐血；呕血；崩漏；便血；衄血；创伤出血；肾虚遗精滑精，赤白带下，胃痛嘈杂；嗳气泛酸；湿疹溃疡\" },\n  { \"name\": \"莲子\", \"xing\": \"莲（《别录》），又名：荷（《诗经》），芙渠（《尔雅》），芙蓉、水芝（崔豹《古今注》）。\", \"wei\": \"甘涩，平。\", \"liang\": \"内服：煎汤，2～4钱；或入丸，散。\", \"zhi\": \"养心，益肾，补脾。涩肠。治夜寐多梦，遗精，淋浊，久痢，虚泻，妇人崩漏带下。石莲子并能止呕、开胃，常用治噤口痢。\" },\n  { \"name\": \"莲须\", \"xing\": \"莲 多年生水生草本。根茎横生，肥厚，节间膨大，内有多数纵行通气孔洞，外生须状不定根。节上生叶，露出水面；叶柄着生于叶背中央，粗壮，圆柱形，多刺；叶片圆形，直径25-90cm，全缘或稍呈波状，上面粉绿色，下面叶脉从中央射出，有1-2次叉状分枝。花单生于花梗顶端，花梗与叶柄等长或稍长，也散生小刺；花直径10-20cm，芳香，红色、粉红色或白色；花瓣椭圆形或倒卵形，长5-10cm，宽3-5cm；雄蕊多数，花药条形，花丝细长，着生于托之一；心皮多数埋藏于膨大的花托内，子房椭圆形，花柱极短。花后结莲蓬，倒锥形，直径5-10cm，有小孔20-30个，每孔内含果实1枚；坚果椭圆形或卵形，长1.5-2.5cm，果皮革质，坚硬，熟时黑褐色。种子卵形，或椭圆形，长1.2-1.7cm，种皮红色或白色。花期6-8月，果期8-10月。\", \"wei\": \"甘；涩；平\", \"liang\": \"内服：煎汤，3-9g；或入入丸、散。\", \"zhi\": \"清心益肾；涩精止血。主遗精；尿频；遗尿；带下；吐血；崩漏\" },\n  { \"name\": \"莲房\", \"xing\": \"干燥花托略呈倒圆锥形，多破裂，顶面圆形而平，径7～10厘米，高3～8厘米。表面紫红色或灰褐色，有纵纹及纵皱，顶面有多数除去果实后留下的圆形孔洞，呈蜂窝状，基部有花梗残基。质松软如海绵。气无，味涩。以个大、紫红色者为佳。\", \"wei\": \"苦涩，温。\", \"liang\": \"内服：煎汤，1.5～3钱；或入丸、散。外用：煎水洗或研末调敷。\", \"zhi\": \"消瘀，止血，去湿。治血崩，月经过多，胎漏下血，瘀血腹痛，产后胎衣不下，血痢，血淋，痔疮脱肛，皮肤湿疮。\" },\n  { \"name\": \"莲子心\", \"xing\": \"无\", \"wei\": \"苦，寒。\", \"liang\": \"内服：煎汤，0.5～1钱；或入散剂。\", \"zhi\": \"清心，去热，止血，涩精。治心烦，口渴，吐血，遗精，目赤肿痛。\" },\n  { \"name\": \"荷叶\", \"xing\": \"无\", \"wei\": \"苦涩，平。\", \"liang\": \"内服：煎汤，1～3钱（鲜者0.5～1两）；或入丸、散。外用：捣敷、研末掺或煎水洗。\", \"zhi\": \"清暑利湿，升发滑阳，止血。治暑湿泄泻、眩晕，水气浮肿，雷头风，吐血，衄血，崩漏，便血，产后血晕。\" },\n  { \"name\": \"荷梗\", \"xing\": \"莲 多年生水生草本。根茎横生，肥厚，节间膨大，内有多数纵行通气孔洞，外生须状不定根。节上生叶，露出水面；叶柄着生于叶背中央，粗壮，圆柱形，多刺；叶片圆形，直径25-90cm，全缘或稍呈波状，上面粉绿色，下面叶脉从中央射出，有1-2次叉状分枝。花单生于花梗顶端，花梗与叶柄等长或稍长，也散生小刺；花直径10-20cm，芳香，红色、粉红色或白色；花瓣椭圆形或倒卵形，长5-10cm，宽3-5cm；雄蕊多数，花药条形，花丝细长，着生于托之一；心皮多数埋藏于膨大的花托内，子房椭圆形，花柱极短。花后结莲蓬，倒锥形，直径5-10cm，有小孔20-30个，每孔内含果实1枚；坚果椭圆形或卵形，长1.5-2.5cm，果皮革质，坚硬，熟时黑褐色。种子卵形，或椭圆形，长1.2-1.7cm，种皮红色或白色。花期6-8月，果期8-10月。\", \"wei\": \"苦；性平\", \"liang\": \"内服：煎汤，9-15g。\", \"zhi\": \"解暑清热；理气化湿。主暑湿胸闷不舒；泄泻；痢疾；淋病；带下\" },\n  { \"name\": \"石莲子\", \"xing\": \"莲 多年生水生草本。根茎横生，肥厚，节间膨大，内有多数纵行通气孔洞，外生须状不定根。节上生叶，露出水面；叶柄着生于叶背中央，粗壮，圆柱形，多刺；叶片圆形，直径25-90cm，全缘或稍呈波状，上面粉绿色，下面叶脉从中央射出，有1-2次叉状分枝。花单生于花梗顶端，花梗与叶柄等长或稍长，也散生小刺；花直径10-20cm，芳香，红色、粉红色或白色；花瓣椭圆形或倒卵形，长5-10cm，宽3-5cm；雄蕊多数，花药条形，花丝细长，着生于托之一；心皮多数埋藏于膨大的花托内，子房椭圆形，花柱极短。花后结莲蓬，倒锥形，直径5-10cm，有小孔20-30个，每孔内含果实1枚；坚果椭圆形或卵形，长1.5-2.5cm，果皮革质，坚硬，熟时黑褐色。种子卵形，或椭圆形，长1.2-1.7cm，种皮红色或白色。花期6-8月，果期8-10月。\", \"wei\": \"甘；涩；微苦；寒\", \"liang\": \"内服：煎汤，9-12g。清湿热生用，清心宁神连心用。\", \"zhi\": \"清湿热；开胃迸食；清心宁神；涩精止泄。主噤口痢；呕吐不食；心烦失眠；遗精；尿浊；带下\" },\n  { \"name\": \"芡实\", \"xing\": \"芡 一年生大型水生草本。全株具尖刺。根茎粗壮而短，具白色须根及不明显的茎。初生叶沉水，箭形或椭圆肾形，长4-10cm，两面无刺；叶辆无刺；后生叶浮于水面，革质，椭圆肾形至国形，直径10-130cm，上面深绿色，多皱褶，下面深紫色，有短柔毛，叶脉凸起，边缘向上折。叶柄及花梗粗壮，长可达25cm。\", \"wei\": \"甘；涩；平；\", \"liang\": \"内服：煎汤，15-30g；或入丸、散，亦可适量煮粥食。\", \"zhi\": \"固肾涩精；补脾止泄。主遗精；白浊；淋浊；带下；小便不禁；大便泄泻\" },\n  { \"name\": \"刺猬皮\", \"xing\": \"1.刺猬，体形肥短，体长16-27cm，体重400-900g。头守而吻尖、眼小，耳短，其长度不超过周围的刺长。体背面及两侧密生尖刺，刺粗而硬，四肢短小，爪较发达，尾短。刺猬脸部色较深为褐色。全身的尖刺颜色变异较大，大致可分为：一为纯白色，为数较少。一为基部白色或土黄色，中间棕色或黑褐色，尖端又为白色，因而整个体背呈土棕色。腹面及四肢有细而硬的白毛。四足浅褐色，尾上也覆有白毛。\", \"wei\": \"味苦；涩；性平\", \"liang\": \"内服：煎汤，3-10g；研末，1.5-3g；或入丸剂。外用：适量，研末调敷。\", \"zhi\": \"化瘀止痛；收敛止血；涩精缩尿。主胃脘疼痛；反胃吐食；便血；肠风下血；痔漏；脱肛；遗精；遗尿\" },\n  { \"name\": \"椿皮\", \"xing\": \"无\", \"wei\": \"苦、涩，寒。\", \"liang\": \"6～9g。\", \"zhi\": \"清热燥湿，收涩止带，止泻，止血。用于赤白带下，湿热泻痢，久泻久痢，便血，崩漏。\" },\n  { \"name\": \"鸡冠花\", \"xing\": \"一年生直立草本，高30-80cm。全株无毛，粗壮。分枝少，近上部扁平，绿色或带红色，有棱纹凸起。单叶互生，具柄；叶片长椭圆形至卵状披针形，长5-13cm，宽2-6cm，先端渐尖或长尖，基部渐窄成柄，全缘。穗状花序顶生，成扁平肉质鸡冠状、卷冠状或羽毛状，中部以下多花；花被片淡红色至紫红色、黄白或黄色；苞片、小苞片和花被片干膜质，宿存；花被片5，椭圆状卵形，端尖，雄蕊5，花丝下部合生成杯状。胞果卵形，长约3mm，熟时盖裂，包于宿存花被内。种子肾形，黑色，光泽。花期5-8月，果期8-11月。\", \"wei\": \"甘；凉；无毒\", \"liang\": \"内服：煎汤，1.5-3钱；或入丸、散。外用：煎水熏洗。\", \"zhi\": \"凉血；止血。主痔漏下血；赤白下痢；吐血；咳血；血淋；妇女崩中；赤白带下\" }] },\n\n{\n  \"name\": \"涌吐药\",\n  \"num\": 4,\n  \"content\": [\n  { \"name\": \"常山\", \"xing\": \"落叶灌木，高可达2米。茎枝圆形，有节，幼时被棕黄色短毛，叶对生，椭圆形，广披针形或长方状倒卵形，长5～17厘米，宽2～6厘米，先端渐尖，基部楔形，边缘有锯齿，幼时两面均疏被棕黄色短毛；叶柄长1～2厘米。伞房花序，着生于枝顶或上部的叶腋；花浅蓝色；苞片线状披针形，早落；花萼管状，淡蓝色。长约4毫米，先端5～6齿，三角形，管外密被棕色短毛；花瓣5～6，蓝色，长圆状披针形或卵形，长约8毫米；雄蕊10～12，花丝长短不等，花药蓝色；雌蕊1，蓝色，子房半下位，1室，花柱4，柱头椭圆形。浆果圆形，径5～6毫米，蓝色，有宿存萼和花柱。花期6～7月。果期8～9月。\", \"wei\": \"苦辛，寒，有毒。\", \"liang\": \"内服：煎汤，1～3钱；或入丸、散。\", \"zhi\": \"①治疗疟疾\" },\n  { \"name\": \"瓜蒂\", \"xing\": \"无\", \"wei\": \"苦，寒，有毒。\", \"liang\": \"内服：煎汤，0.8～1.5钱；或入丸、散。外用：研末搐鼻。\", \"zhi\": \"治疗急性黄痘型传染性肝炎:㈠口服法：取未成熟的甜瓜蒂6克（干品），装入小口瓶内，加开水100毫升，浸10分钟后加热，待瓶口微微出气约3～4分钟，即将瓶口塞紧；10天后取出过滤3～4次，经高压灭菌3～4小时（借以减少副作用）后始可服用。每日2～3次食后服，10个月至3岁小儿每次1毫升，4～12岁2毫升，成人5毫升。或用生瓜蒂50克，玄胡650克，公丁香350克，共研细末，加入白糖350克，淀粉200克，葡萄糖500克，混合制成蜜丸（每丸含瓜蒂25毫克）。日服2次，每次半丸。小儿酌减。㈡鼻腔吸入法：将在7、8月间剪下之瓜蒂把阴干，用文火焙黄，研粉分包，每包0.1～0.15克。用时取1包分成4～6等分，于晨起空腹时每隔20～30分钟从两鼻孔各吸入一等分，经40分钟至1小时许鼻腔便流出黄色分泌液，每隔5～7天（视体质情况）用l包，4包为一疗程。吸入深度以至中鼻道为宜；如吸得过深，会引起上呼吸道刺激症状，个别还可能产生发热。吸药时宜取俯卧、侧卧或坐位。临床共治151例，除年老体弱及小儿单用瓜蒂液或丸口服外，其余均并用鼻腔吸入法；重症患者加用其它中药、静脉输液等。结果治愈（症状消失，肝脾回缩至正常或稳定，肝功能复查2次完全恢复正常）者占93.33％，好转（症状明显减轻，肝功能好转）者占6.67％。平均治愈日数34.77天。普遍在吸药1～2次后食欲增进，黄疸消退；一般吸药3～5次（平均3.17次）即可治愈，计：食欲增加平均6.43天，肝脾回缩正常23.29天，肝功能恢复正常（黄疸指数11.88天，转氨酶及其它项目25.63天），副作用：吸入后鼻粘膜易干燥，有时可引起少量鼻血，另有单用瓜蒂液口服观察103例，结果在10天内治愈昔占46.6％，15天内治愈者达92.2％；肝肿恢复至肋缘下1.5厘米以内，在30天内者占35.92％，在40天内者占97.09％；黄疸在5天内消失者占70.87％，10天内消失者为95.14％；尿三胆试验阳性及肝功能异常的病例，治疗后全部恢复正常。追踪观察1～2年未发现肝硬化或死亡病例。治疗中未见副作用。\" },\n  { \"name\": \"胆矾\", \"xing\": \"三斜晶系。晶体作板状或短柱状，通常为致密块状、钟乳状、被膜状、肾状，有时具纤维状。颜色为天蓝、蓝色，有时微带浅绿。条痕无色或带浅蓝。光泽玻璃状。半透明至透明。断口贝壳状。硬度2.5。比重2.1-2.3。性极脆。\", \"wei\": \"酸；辛；寒；有毒\", \"liang\": \"内服：入丸、散， 1-2分。外用：研末撒或调敷，或以水溶化洗眼。\", \"zhi\": \"涌吐；去腐；解毒。主中风；癫痫；喉痹；喉风；痰涎壅塞；牙疳；口疮；烂弦风眼；痔疮；肿毒\" },\n  { \"name\": \"藜芦\", \"xing\": \"多年生草本，高60～100厘米。根多数，细长，带肉质。茎直立。叶互生，广卵形、椭圆形至卵状披针形，长达30厘米，宽约10厘米，先端渐尖，全缘式带微波状，基部渐狭而下沿呈鞘状，抱茎；上面青绿色，下面灰绿色，两面均无毛，平行脉隆起。顶生大圆锥花序，总轴及枝轴均密被灰白色绵毛；雄花常生于花序轴下部，两性花多生于中部以上；枝轴基部有披针形苞片1枚，背面及边缘密被细绵毛；花多数，花梗基部具1小苞片，背面有细绵毛；花被6，紫黑色，卵形，先端尖或钝，基部渐狭，长5～6毫米，宽约2毫米，上面光滑，下面被绵毛；雄蕊6，花丝丝状；子房卵形，3室，花柱3裂，先端外展。蒴果卵状三角形，长1.5～2厘米，熟时2裂。种子多数。花期7～8月。果期8～9月。\", \"wei\": \"苦辛，寒，有毒。<br>①《本经》：味辛，寒。<br>②《别录》：苦，微寒，有毒。\", \"liang\": \"内服：研末，1～2分；或入丸剂。外用：研末，搐鼻或调敷。\", \"zhi\": \"吐风痰，杀虫毒。治中风痰涌，风痫癫疾，黄疸，久疟，泄痢，头痛，喉痹，鼻息，疥癣，恶疮。<br>用于中风、癫痫、喉痹症见痰涎涌盛。用于疥癣秃疮。此外，以本品研末外渗，有灭虱功效。又近用以杀灭蚊蝇及其幼虫，也作农药杀虫剂及兽医作催吐药使用。<br>①《本经》：主蛊毒，咳逆，泄痢，肠荩头疡，疥瘙，恶疮，杀诸虫毒，去死肌。<br>②《别录》：疗哕逆，喉痹不通，鼻中息肉，马刀，烂疮。<br>③《药性论》：主上气，去积年脓血泄痢。治恶风疮、疥癣、头秃，杀虫。<br>④《本草图经》：大吐上膈风涎，暗风痫病，小儿yJ；用钱匕一字则恶吐人，又用通顶，令人嚏。<br>⑤《四川武隆药植图志》：治毒蛇咬伤及杀虫用。\" }] },\n\n{\n  \"name\": \"攻毒杀虫止痒药\",\n  \"num\": 12,\n  \"content\": [\n  { \"name\": \"雄黄\", \"xing\": \"晶体结构属单斜晶系。晶体细小，呈柱状、短柱状或针状，但较少见。通常多呈粒状，致密块状，有时呈土状、粉末状、皮壳状集合体。橘红色，表面或有暗黑及灰色的锖色。条痕浅橘红色。晶体呈金刚光泽，断口树脂光泽。硬度1.5-2，相对密度3.56，阳光久照会发生破坏而转变为淡橘红色粉末。锤击之有刺鼻蒜臭。\", \"wei\": \"辛；苦；温；有毒\", \"liang\": \"外用：研末撒、调敷或烧烟熏。内服：入丸、散，1-4分。\", \"zhi\": \"燥湿；祛痰；杀虫；解毒。主痈疽疔疮；走马牙疳；喉风喉痹；疥癣；缠腰火丹；湿毒疮；痔疮；蛇虫咬伤；虫积；惊痫；疟疾；哮喘\" },\n  { \"name\": \"硫黄\", \"xing\": \"斜方晶系。晶体的锥面发达，偶而呈厚板状。常见者为致密块状、钟乳状、被膜状、土状等。颜色有黄、浅黄、淡绿黄、灰黄、褐色和黑色等。条痕白色至浅黄色。晶面具金刚光泽，断口呈脂肪光泽。半透明。解理不完全。断口呈贝壳状或参差状。硬度1～2。比重2.05～2.08。性脆。为良好的绝缘体。以手握紧置于耳旁，可闻轻微的爆裂声。在108℃时即熔化，270℃时燃烧。常见于温泉、喷泉、火山口区域；沉积岩中亦常有之。\", \"wei\": \"酸，热，有毒。<br>①《本经》：味酸，温。<br>②《吴普本草》：神农、黄帝、雷公：咸，有毒。医和、扁鹊：无毒。<br>③《别录》；大热，有毒。<br>④《药性论》：味甘，有大毒。\", \"liang\": \"内服：研末，0.5～1钱，或入丸、散。外用：研末撒，调敷或磨汁涂。\", \"zhi\": \"壮阳，杀虫。治阳痿，虚寒泻痢，大便冷秘；外用治疥癣，湿疹，癞疮。<br>①《本经》：主妇人阴蚀，疽痔恶血，坚筋骨，除头秃。<br>②《别录》：疗心腹积聚，邪气，冷癣在胁，咳逆上气，脚冷疼弱无力，及鼻衄恶疮，下部匿疮，止血，杀疥虫。<br>③《药性论》：除冷风，顽痹。生用治疥癣及疗寒热咳逆，炼服主虚损泄精。<br>④《海药本草》：主遗精痔漏，老人风秘等。<br>⑤《日华子本草》：杀腹脏虫。<br>⑥《纲目》：主虚寒久痢滑泄，霍乱，补命门不足，阳气暴绝，阴毒伤寒，小儿慢惊。<br>⑦《纲目拾遗》：天生磺，治膈症。舶上硫黄，灭斑，杀虫，治疮通血，止泻痢。\" },\n  { \"name\": \"白矾\", \"xing\": \"三方晶系。晶形呈细小的菱面体或板状，通常为致密块状、细粒状、土状等。颜色为无色、白色，常带淡黄及淡红等色。条痕白色。光泽玻璃状，解理面上有时微带珍珠光，块状者光泽暗淡或微带蜡状光泽。透明至半透明。解理平行(0001)不完全。断口晶体者呈贝状；块体者呈多片状、参差状，有时土状。硬度3.5-4。比重2.6-2.8。性脆。\", \"wei\": \"酸涩；寒；有毒\", \"liang\": \"内服：入丸、散，0.2-1钱。外用：研末撒或调敷。\", \"zhi\": \"祛痰燥湿；解毒杀虫；止泻止血。主中风；癫痫；喉痹；疥癣湿疮；痈疽肿毒；水火烫伤；口舌生疮；烂弦风眼；聤耳流脓；鼻中息肉；疮痔疼痛；崩漏；衄血；损伤出血；久泻玖痢；带下阴痒；脱肛；子宫下垂\" },\n  { \"name\": \"蛇床子\", \"xing\": \"无\", \"wei\": \"辛、苦，温；有小毒。\", \"liang\": \"3～9g。外用适量，多煎汤熏洗，或研末调敷。\", \"zhi\": \"温肾壮阳，燥湿，祛风，杀虫。用于阳痿，宫冷，寒湿带下，湿痹腰痛；外治外阴湿疹，妇人阴痒；滴虫性阴道炎。\" },\n  { \"name\": \"土荆皮\", \"xing\": \"乔木，高达40m胸围达1.5m.树干直，树皮灰褐色，粗糙，不规则鳞片状开裂。一年生枝淡红褐色或淡红黄色，有光泽，老枝及短枝呈灰色或暗灰色。叶线形，柔软，扁平，长2-5.5cm，宽1.5-4mm，先端锐尖或尖，上面绿色，中脉稍明显，下面蓝绿色，中脉明显，每边有5-14条气孔线，长枝上叶辐射伸展，短枝上叶簇生。雄球花黄色，圆柱状，下垂；雌球花紫红色，直立，椭圆形，长约1.3cm，有短梗。球果卵圆形或倒卵圆形，长6-7.5cm，径4-5cm，熟时淡红褐色；中部种鳞卵状披针形，长2.8-3.5cm，两侧耳状，先端钝有凹缺，脊上密生短柔毛；苞鳞长约种鳞的1/4-1/3，卵状披针形，边缘有细齿。种子卵圆形，白色，种翅三角状披针形，淡黄色或淡褐黄色，有光泽。花期4-5月，果熟期10-11月上旬。\", \"wei\": \"无\", \"liang\": \"外用：适量，浸酒涂擦或研末调敷。\", \"zhi\": \"祛风除湿；杀虫止痒。主疥癣；湿疹；神经性皮炎\" },\n  { \"name\": \"木槿皮\", \"xing\": \"木槿（《尔雅》），又名：舜（《诗经》），朝菌（《庄子》），椴、榇（《尔雅》），日及（《尔雅》郭璞注），藩篱草（《仁斋直指方》），槿树、平条树、白牡丹、清明篱、木桂花树、菜花树、篙沿树、金漆树、白布篱。<br>落叶灌木或小乔木，高3～6米。树皮灰褐色，无毛，嫩杖上有绒毛。叶互生；菱状卵形或卵形，长4～7厘米，宽2.5～5厘米，具有深浅不同的3裂或不裂，叶基楔形，边缘具圆钝或尖锐的齿，主脉3条明显，两面均疏生星状毛，后变光滑；叶柄长1～2厘米，光滑或被有绒毛或星状毛。花单生于叶腋；小苞片6～7，线形，长约为花萼之半；萼片5裂，卵状披针形，有星状毛和细短软毛；花瓣5，淡红色、白色或紫色；雄蕊多数，花丝联合成筒状；子房5室，花柱5裂，柱头头状。蒴果长椭圆形，先端具尖嘴，全体被绒毛。种子黑褐色，背部有长棕色毛。花期6～7月。\", \"wei\": \"甘苦，凉。<br>①《本草拾遗》：平，无毒。<br>②《日华子本草》：凉。<br>③《本草蒙筌》：味苦，气平，无毒。<br>④《纲目》：甘，平，无毒。<br>⑤《南宁市药物志》：辛，平，有小毒。\", \"liang\": \"内服：煎汤，1～3钱。外用：酒浸搽擦斌煎水熏洗。\", \"zhi\": \"清热，利湿，解毒，止痒。治肠风泻血，痢疾，脱肛，白带，疥癣，痔疮。<br>①《本草拾遗》：止肠风泻血，痢后热渴，作次服之，令人得睡，并炒用。<br>②《纲目》：治赤白带下，肿痛疥癣，洗目令明，润燥活血。<br>③《医林纂要》：补肺渗湿，去热，安心神，通利关节。治肺痈，肠痈，衄血，消渴，心烦不眠。<br>④《饮片新参》：治黄疸。<br>⑤《陕西中药志》：煎液可洗治痔疮。\" },\n  { \"name\": \"蜂房\", \"xing\": \"无\", \"wei\": \"甘，平。\", \"liang\": \"3～5g。外用适量，研末油调敷患处，或煎水漱或洗患处。\", \"zhi\": \"祛风，功毒，杀虫，止痛。用于龋齿牙痛，疮疡肿毒，乳痈，瘰疬，皮肤顽癣，鹅掌风。\" },\n  { \"name\": \"蜂蜡\", \"xing\": \"1.中华蜜蜂，蜂群由工蜂、蜂王及雄蜂组成。工蜂全体被黄褐色毛。头略呈三角形。胸部3节。翅2对，膜质透明。足3对，有采集花粉的构造。腹部圆锥状，有毒腺和螫针。腹下有蜡板4 对，内有蜡腺，分泌蜡质。蜂王体最大，翅短小，腹部特长，生殖器发达，专营生殖产卵。雄蜂较工蜂稍大，头呈球形，尾无毒腺和螫针，足上无采贮花粉构造，腹无蜡板及蜡腺。\", \"wei\": \"味甘；淡；性平\", \"liang\": \"内服：溶化和服，5-10g；或入丸剂。外用：适量，溶化调敷。\", \"zhi\": \"解毒；生肌；止痢；止血；定痛。主痈疽发背，溃疡为敛；急心痛；下痢脓血；久泻不止；胎动下血；遗精；带下\" },\n  { \"name\": \"樟脑\", \"xing\": \"樟，常绿乔木，高20-30m。树皮灰褐色或黄褐色，纵裂；小枝淡褐色，光滑；枝和叶均有樟脑味。叶互生，革质，卵状椭圆形以至卵形，长6-12cm，宽3-6cm，先端渐尖，基部钝或阔楔形，全缘或呈波状，上面深绿色有光泽，下面灰绿色或粉白色，无毛，幼叶淡红色，脉在基部以上3出，脉腋内有隆起的腺体；叶柄长2-3cm。圆锥花序腋生；花小，绿白色或淡黄色，长约2mm；花被6裂，椭圆形，长约2mm，内面密生细柔毛；能育雄蕊9，花药4室；子房卵形，光滑无毛，花柱短；柱头头状。核果球形，宽约1cm，熟时紫黑色，基部为宿存、扩大的花被管所包围。花期4-6月。果期8-11月。\", \"wei\": \"辛；热；有小毒\", \"liang\": \"内服：入丸、散，0.06-0.15g，不入煎剂。外用：适量，研末，或溶于酒中，或入软膏敷搽。\", \"zhi\": \"通关窍；利滞气；辟秽浊；杀虫止痒；消肿止痛。主热病神昏；中恶猝倒，痧胀吐泻腹痛；寒湿脚气；疥疮顽癣；秃疮；冻疮；臁疮；水火烫伤；跌打伤痛；牙痛；风火赤眼\" },\n  { \"name\": \"蟾酥\", \"xing\": \"1.中华大蟾蜍，体长一般在10cm以上，体粗壮，头宽大于头长，吻端圆，吻棱显着；鼻孔近吻端；眼间距大于鼻间；鼓膜明显，无犁骨齿，上下颌亦无齿。前技长而粗壮，指、趾略扁，指侧微有缘膜而无蹼，指长顺序3、1、4、2，指关节下瘤多成对，常突2，外侧者大。后肢粗壮而短，胫跗关节前达肩部，左右跟部不相遇，趾侧有缘膜，蹼常发达，内跖变形长而大，外跖突小而圆。皮肤极粗糙，头顶部较平滑，两侧有大而长的耳后膜，其余部分满布大小不等的圆开瘰疣，排列较规则的为头的之瘰疣，斜行排列几与耳后腺平行。此外，沿体侧之瘰疣排列亦较规则，胫部之瘰疣更大，个别标本有不明显这跗褶，腹面皮肤不光滑，有小疣。颜色亦异颇大，生殖季节雄性背面多为黑绿色，体侧有浅色的斑纹；雌性背面色较浅，瘰疣乳黄色，有时自眼后沿体侧有斜行之黑色纵斑，腹面乳黄色，有棕色或黑色细花纹。雄性个体较小，内侧三指有黑色婚垫，无声囊。\", \"wei\": \"味辛；性温；有毒\", \"liang\": \"外用：适量，研末调敷，或掺膏药内贴、心力衰竭、休克等症。\", \"zhi\": \"1.治疗心力衰竭：以蟾酥4-8mg(装胶囊)，饭后用冷开水送服，日服2-3次。治疗2-3级心力衰竭病人13例，其中12例均于用药后2-48小时内症状、体征有所改善。计脉搏减缓者12例，利尿作用显着者4例，水肿消失者5例，肝肿大缩小者6例，12例肺部湿性罗音皆有改善，二联脉及奔马律用药后消失；2例心房纤颤 l例消失，l例无变化。毒性反应为上腹部不适、恶心及呕吐等胃粘膜刺激现象，减小剂量后皆得控制。临床实践证明，瞻酥之强心作用，与洋地黄相似，其优点是无蓄积作用，作用快，利尿作用较洋地黄显着。\" },\n  { \"name\": \"蟾皮\", \"xing\": \"1.中华大蟾蜍，体长一般在10cm以上，体粗壮，头宽大于头长，吻端圆，吻棱显着；鼻孔近吻端；眼间距大于鼻间；鼓膜明显，无犁骨齿，上下颌亦无齿。前技长而粗壮，指、趾略扁，指侧微有缘膜而无蹼，指长顺序3、1、4、2，指关节下瘤多成对，常突2，外侧者大。后肢粗壮而短，胫跗关节前达肩部，左右跟部不相遇，趾侧有缘膜，蹼常发达，内跖变形长而大，外跖突小而圆。皮肤极粗糙，头顶部较平滑，两侧有大而长的耳后膜，其余部分满布大小不等的圆开瘰疣，排列较规则的为头的之瘰疣，斜行排列几与耳后腺平行。此外，沿体侧之瘰疣排列亦较规则，胫部之瘰疣更大，个别标本有不明显这跗褶，腹面皮肤不光滑，有小疣。颜色亦异颇大，生殖季节雄性背面多为黑绿色，体侧有浅色的斑纹；雌性背面色较浅，瘰疣乳黄色，有时自眼后沿体侧有斜行之黑色纵斑，腹面乳黄色，有棕色或黑色细花纹。雄性个体较小，内侧三指有黑色婚垫，无声囊。\", \"wei\": \"味苦；性凉；有毒\", \"liang\": \"内服：煎汤，3-9g；或研末。外用：适量，鲜用，敷贴；或干品研末调敷。\", \"zhi\": \"1.治疗慢性气管炎：取活蟾蜍将皮完整剥下，烤干研末，陈蜜制为丸或装胶囊。每次口服lg，每日2次。10天为一疗程，停药5天，续服第二疗程。观察334例，经第一疗程后，有效率为69.7%，二个疗程的有效率为70%。本品止咳、祛痰作用优于平喘。\" },\n  { \"name\": \"大蒜\", \"xing\": \"大蒜，多年生草本，具强烈蒜臭气。鳞茎大形，球状至扁球状， 通常由多数肉质、瓣状的小鳞茎紧密 地排列而成，外面被数层白色至带紫色的膜质外皮。叶基生；叶片实习，宽条形至条状披针形，扁平，先端长渐尖，比花葶短，宽可达2.5cm，基部鞘状。花葶实心，圆柱状，高达60cm，中部以下被叶鞘；总苞具长7-20cm的长喙；伞形花序密具珠芽，间有数花；小花梗纤细；小苞片大，卵形，膜质；具短尖；花常为淡红色；花被片披针形至卵状披形，长3-4mm，内轮的较短，花丝比花被短，基部合生并与花被片贴生，内轮的基部扩大，扩大部分每侧各具1齿，齿端成长丝状，长超过花被片，外轮的锥形；子房球状；花柱不伸出花被外。花期7月。\", \"wei\": \"味辛；性温\", \"liang\": \"内服：煎汤，1.5-3钱；生食、煨食或捣泥为丸。外用：捣敷、作栓剂或切片灸。\", \"zhi\": \"温中行滞；解毒；杀虫。主脘腹冷痛；痢疾；泄泻；肺痨；百日咳；感冒；痈疖肿毒；肠痈；癣疮；蛇虫咬伤；钩虫病；蛲虫病；带下阴痒；疟疾；喉痹；水肿\" }] },\n\n{\n  \"name\": \"拔都化腐生肌药\",\n  \"num\": 7,\n  \"content\": [\n  { \"name\": \"红粉\", \"xing\": \"无\", \"wei\": \"辛，热；有大毒。\", \"liang\": \"外用适量，研极细粉单用或与其他药味配成散剂或制成药捻。\", \"zhi\": \"拨毒，除脓，去腐，生肌。用于痈疽疔疮，梅毒下疳，一切恶疮，肉暗紫黑，腐肉不去，窦道瘘管，脓水淋漓，久不收口。\" },\n  { \"name\": \"轻粉\", \"xing\": \"无\", \"wei\": \"辛，寒；有毒。\", \"liang\": \"外用适量，研末掺敷患处；内服每次0.1～0.2g,一日1～2次，多入丸剂或装胶囊服，服后漱口。\", \"zhi\": \"外用杀虫，攻毒，敛疮；内服祛痰消积，逐水通便。外治用于疥疮，顽癣，臁疮，梅毒，疮疡，湿疹；内服用于痰涎积滞，水肿膨胀，二便不利。\" },\n  { \"name\": \"砒石\", \"xing\": \"1.砷华 晶体结构属等轴晶系。晶形为八面体，偶尔也有菱形十二面体。歪晶为粒状、板柱状；微晶呈星状、毛发状；集合体呈钟乳状、皮壳状和土状。无色至灰白色，多数带灰蓝、黄或红色色调。条痕白色或带有黄色。有玻璃至金刚样光泽，无晶面可见时则为油脂、丝绢样光泽。解理多组完全，交呈棱角。极脆。硬度为1.5。相对密度为3.7-3.9。能缓慢溶解于水。有剧毒。<br>2.毒砂 晶体结构属单斜或三斜晶系。晶形多呈柱状，有时为短柱、板柱、双锥状或致密粒块、致密块状等集合体。新鲜面呈锡白色至钢灰色。条痕黑色。金属光泽，不透明，晶体解理中等或不完全，块状集合体见不到解理，断口不平坦。硬度5.5-6。相对密度5.9-6.3。性脆，致密块体用铁锤猛击时有火星，可发出蒜臭气。<br>3.雄黄 晶体结构属单斜晶系。晶体细小，呈柱状、短柱状或针状，但较少见。通常多呈粒状，致密块状，有时呈土状、粉末状、皮壳状集合体。橘红色，表面或有暗黑及灰色的锖色。条痕浅橘红色。晶体呈金刚光泽，断口树脂光泽。硬度1.5-2，相对密度3.56，阳光久照会发生破坏而转变为淡橘红色粉末。锤击之有刺鼻蒜臭。<br>4.雌黄 单斜晶系。晶体常呈柱状，往往带有弯曲的晶面，集合体则呈杆状、块状、鸡冠状。柠檬黄色，有时微带浅褐色。条痕与矿物本色相同，惟色彩更为鲜明。光泽视方向不同而变化，由金刚光泽至脂肪光泽，新鲜断面呈强烈的珍珠光泽。半透明。解理完全。硬度1.5-2。比重3.4-3.5。具柔性，薄片能弯曲，但无弹性。\", \"wei\": \"辛；酸；热；有毒\", \"liang\": \"内服：入丸、散，1-2.5厘。外用：研末撒、调敷或入膏药中贴之。\", \"zhi\": \"蚀疮去腐；杀虫；祛痰定喘；截疟。主寒痰哮喘；疟疾；痔疮；瘰疬；走马牙疳；顽癣；溃疡腐肉不脱\" },\n  { \"name\": \"铅丹\", \"xing\": \"无\", \"wei\": \"辛咸，寒，有毒。\", \"liang\": \"外用：研末撒、调敷；或熬膏。内服：入丸、散。\", \"zhi\": \"解毒，生肌，坠痰镇惊。治痈疽，溃疡，金疮出血，口疮，目翳，汤火灼伤，惊痫癫狂，疟疾，痢疾，吐逆反胃。\" },\n  { \"name\": \"密陀僧\", \"xing\": \"等轴晶系。晶体形状常为立方体或八面体。在自然界常见的多为粒状集合体。颜色铅灰色。条痕淡黑灰色。金属光泽。不透明。立方体解理完全。断口呈平坦之半贝壳状或参差状。硬度2-3；解事不行\", \"wei\": \"咸；辛；平；有毒\", \"liang\": \"外用：研末撒或调涂。内服：研末，1-3分；或入丸、散。\", \"zhi\": \"燥湿；杀虫；收敛；防腐；解毒；。主疮疡溃烂久不收收敛；口疮；疥癣；狐臭；汗斑；（黑干）黯；酒鼻；烧烫伤；湿疹\" },\n  { \"name\": \"炉甘石\", \"xing\": \"无\", \"wei\": \"甘，平。\", \"liang\": \"不作内服，外用适量。\", \"zhi\": \"解毒明目退翳，收湿止痒敛疮。用于目赤肿痛，眼缘赤烂，翳膜胬肉，溃疡不敛，脓水淋漓，湿疮，皮肤瘙痒。\" },\n  { \"name\": \"硼砂\", \"xing\": \"晶体结构属单斜晶系。成短柱状晶体。多为粒状、土状块体。通常为白色或微带浅灰、浅黄、浅蓝或浅绿色。条痕白色。玻璃或油脂光泽。半透明至不透明。解理良好，断口呈贝壳状。硬度2-2.5。比重1.69-1.72。性脆，有带甜的咸味。透明的硼砂，久置空气中会成白色粉状。\", \"wei\": \"甘咸；凉；无毒\", \"liang\": \"外用：研极细末撒或调敷。内服：入丸、散，0.5-1钱。\", \"zhi\": \"清热消痰；解毒防腐。主咽喉肿痛；口舌生疮；目赤翳障胬肉；阴部溃疡；骨哽；噎膈；咳嗽痰稠\" }] }];\n\n\n\nmodule.exports = {\n  chinese_medicine: chinese_medicine_data };//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///38\n");

