eval("var acupoint_data = [{\n  \"name\": \"手太阴肺经\",\n  \"num\": 11,\n  \"content\": [\n  { \"name\": \"中府\", \"wei\": \"在胸外上方，前正中线旁开6寸，平第一肋间隙处。\", \"jie\": \"当胸大肌、胸小肌处，内侧深层为第1肋间内、外肌；上外侧有腋动、静脉， 胸肩峰动、静脉；布有锁骨上神经中间支，胸前神经分支及第1肋间神经外侧皮支。\", \"zhi\": \"①咳嗽，气喘，胸满痛；②肩背痛。\", \"cao\": \"向外斜刺或平刺0．5～0．8寸，不可向内深刺，以免伤及肺脏、引起气胸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%B8%AD%E5%BA%9C-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"云门\", \"wei\": \"在胸外侧部，肩胛骨喙突上方，前正中线旁开６寸，锁骨下窝凹陷处。\", \"jie\": \"有胸大肌，皮下有头静脉通过，深部有胸肩峰动脉分支；布有胸前神经的分支臂丛外侧束、锁骨上神经中后支。\", \"zhi\": \"①咳嗽，气喘，胸痛；②肩背痛。\", \"cao\": \"向外斜刺０.５～０.８寸，不可向内深刺，以免伤及肺脏、引起气胸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%BA%91%E9%97%A8-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"天府\", \"wei\": \" 肱二头肌桡侧缘，腋前纹头下３寸处。\", \"jie\": \" 肱二头肌外侧沟中；有头静脉及肱动、静脉分支；分布着臂外侧皮神经及肌皮神经。\", \"zhi\": \"①咳嗽，气喘，鼻衄；②瘿气；③上臂痛。\", \"cao\": \"直刺0．5～l寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%A9%E5%BA%9C-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"侠白\", \"wei\": \"肱二头肌桡侧缘，腋前纹头下４寸，或肘横纹上5寸处。\", \"jie\": \" 肱二头肌外侧沟中；当头静脉及桡动、静脉分支；分布有臂外侧皮神经，当肌皮神经经过处。\", \"zhi\": \"①咳嗽，气喘；②干呕；③上臂痛。\", \"cao\": \"直刺0．5～l寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%BE%A0%E7%99%BD-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"尺泽\", \"wei\": \"在肘横纹中，肱二头肌腱桡侧凹陷处。\", \"jie\": \"在肘关节，当肘二头肌腱之外方，肱桡肌起始部；有桡侧返动、静脉分支及头静脉；布有前臂外侧皮神经，直下为桡神经。\", \"zhi\": \"①咳嗽，气喘，咳血，咽喉肿痛等肺疾；②肘臂挛痛；③急性吐泻，中暑，小儿惊风。\", \"cao\": \"直刺0．8～1．2寸，或点刺出血，尤其用于治疗急性咽喉肿痛及急性吐泻、中暑、小儿惊风等。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%B0%BA%E6%B3%BD-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"孔最\", \"wei\": \"尺泽穴与太渊穴连线上，腕横纹上7寸处\", \"jie\": \"有肱桡肌，在旋前圆肌上端之外缘，桡侧腕长、短伸肌的内缘；有头静脉、桡动、静脉；布有前臂外侧皮神经，桡神经浅支。\", \"zhi\": \"①咳血，咳嗽，气喘，咽喉肿痛；②肘臂挛痛。\", \"cao\": \"直刺0．5～l寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%AD%94%E6%9C%80-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"列缺\", \"wei\": \" 桡骨茎突上方，腕横纹上1．5寸，当肱桡肌与拇长展肌腱之间。<br>简便取穴法：两手虎口自然平直交叉，一手食指按在另一手桡骨茎突上，指尖下凹陷中是穴。\", \"jie\": \"在肱桡肌腱与拇长展肌腱之间，桡侧腕长伸肌腱内侧；有头静脉，桡动、静脉分支；布有前臂外侧皮神经和桡神经浅支的混合支。\", \"zhi\": \"①咳嗽，气喘，咽喉肿痛；②头痛，齿痛，项强，口眼歪斜等头项疾患。\", \"cao\": \"向上斜刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%88%97%E7%BC%BA-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"经渠\", \"wei\": \"桡骨茎突与桡动脉之间凹陷处，腕横纹上 l寸.\", \"jie\": \"桡侧腕屈肌腱的外侧，有旋前方肌当桡动、静脉外侧处；布有前臂外侧皮神经和桡神经浅支混合支。\", \"zhi\": \"①咳嗽，气喘，胸痛，咽喉肿痛；②手腕痛。\", \"cao\": \"避开桡动脉，直刺0．3～0．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%BB%8F%E6%B8%A0-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"太渊\", \"wei\": \"在掌后腕横纹桡侧，桡动脉的桡侧凹陷中.\", \"jie\": \"桡侧腕屈肌腱的外侧，拇展长肌腱内测；有桡动、静脉；布有前臂外侧皮神经和桡神经浅支混合支。\", \"zhi\": \"①咳嗽，气喘；②无脉症；③腕臂痛。\", \"cao\": \"避开桡动脉，直刺0．3～0．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%AA%E6%B8%8A-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"鱼际\", \"wei\": \"第１掌骨中点，赤白肉际处.\", \"jie\": \"有拇短展肌和拇指对掌肌；血管当拇指静脉回流支；布有前臂外侧皮神经和桡神经浅支混合支。\", \"zhi\": \"①咳嗽，咳血；②咽干，咽喉肿痛，失音；③小儿疳积。\", \"cao\": \"直刺0．5～0．8寸。治小儿疳积可用割治法。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%B1%BC%E9%99%85-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"少商\", \"wei\": \"拇指桡侧指甲角旁0．1寸。\", \"jie\": \"有指掌固有动、静脉所形成的动、静脉网；布有前臂外侧皮神经和桡神经浅支混合支，正中神经的掌侧固有神经的末梢神经网。\", \"zhi\": \"①咽喉肿痛，鼻衄；②高热，昏迷，癫狂。\", \"cao\": \"浅刺0．1寸，或点刺出血。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%B0%91%E5%95%86-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" }] },\n\n{\n  \"name\": \"手阳明大肠经\",\n  \"num\": 20,\n  \"content\": [\n  { \"name\": \"商阳\", \"wei\": \"食指桡侧指甲角旁0．1寸.\", \"jie\": \"有指及掌背动、静脉网；布有来自正中神经的指掌侧固有神经，桡神经的指背侧神经。\", \"zhi\": \"①齿痛，咽喉肿痛等五官疾患；②热病，昏迷。\", \"cao\": \"浅刺0．1寸，或点刺出血。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%95%86%E9%98%B3-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"二间\", \"wei\": \"微握拳，当食指桡侧第2掌指关节前凹陷中.\", \"jie\": \"有指屈浅、深肌腱；有来自桡动脉的指背及掌侧动、静脉，布有桡神经的指背侧固有神经，正中神经的指掌侧固有神经\", \"zhi\": \"①鼻衄，齿痛等五官疾患；②热病。\", \"cao\": \"直刺0．2～0．3寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%BA%8C%E9%97%B4-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"三间\", \"wei\": \"微握拳，在食指桡侧第2掌指关节后凹陷处.\", \"jie\": \"有第一骨间背侧肌，深层为拇内收肌横头；有手背静脉网（头静脉其示部），指掌侧有固有动脉；布有桡神经浅支。\", \"zhi\": \"①齿痛，咽喉肿痛；②腹胀，肠鸣；③嗜睡。\", \"cao\": \"直刺0.3～0.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%B8%89%E9%97%B4-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"合谷\", \"wei\": \"在手背，第１、２掌骨间，当第２掌骨桡侧的中点处。简便取穴：以一手的拇指指骨关节横纹，放在另一手拇、食指之间的指蹼缘上，当拇指尖下是穴。又名虎口。\", \"jie\": \"在第一、二掌骨之间，第一骨间背侧肌中，深层有拇收肌横头；有手背静脉网，为头静脉的起部，腧穴近侧正当桡动脉从手背穿向手掌之处；布有桡神经浅支的掌背侧神经，深部有正中神经的指掌侧固有神经。\", \"zhi\": \"①头痛，目赤肿痛，鼻衄，齿痛，口眼歪斜，耳聋等头面五官诸疾；②诸痛症；③热病，无汗，多汗；④经闭，滞产。\", \"cao\": \"直刺0．5～l寸，针刺时手呈半握拳状。孕妇不宜针。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%90%88%E8%B0%B7-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"阳溪\", \"wei\": \"腕背横纹桡侧，当拇短伸肌腱与拇长伸肌腱之间的凹陷中。\", \"jie\": \"当拇短、长伸肌腱之间；有头静脉、桡动脉的腕背支；布有桡神经浅支。\", \"zhi\": \"①手腕痛；②头痛，目赤肿痛，耳聋等头面五官疾患。\", \"cao\": \"直刺0．5～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%98%B3%E6%BA%AA-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"偏历\", \"wei\": \"屈肘，在阳溪穴与曲池穴连线上，腕横纹上3寸处。\", \"jie\": \"在桡骨远端，桡侧腕伸肌腱与拇长展肌腱之间；有头静脉；掌侧为前臂外侧皮神经和桡神经浅支，背侧为前臂背侧皮神经和前臂骨间背侧神经。\", \"zhi\": \"①耳鸣，鼻衄等五官疾患；②手臂酸痛；③腹部胀满，水肿。\", \"cao\": \" 直刺或斜刺0．5～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%81%8F%E5%8E%86-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"温溜\", \"wei\": \"屈肘，在阳溪穴与曲池穴连线上，腕横纹上5寸处。\", \"jie\": \" 在桡侧腕伸肌肌腹与拇长展肌之间；有桡动脉分支及头静脉；布有前臂背侧皮神经与桡神经深支。\", \"zhi\": \"①急性肠鸣腹痛；②疔疮；③头痛，面肿，咽喉肿痛；④肩背酸痛。\", \"cao\": \"直刺0．5～l寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%B8%A9%E6%BA%9C-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"下廉\", \"wei\": \"在阳溪穴与曲池穴连线上，肘横纹下4寸处。\", \"jie\": \" 在桡骨的桡侧，桡侧有腕伸短肌及腕伸长肌，深层有旋后肌；有桡动脉分支；布有前臂背侧皮神经及桡神经深支。\", \"zhi\": \"①肘臂痛；②头痛，眩晕，目痛；③腹胀，腹痛。\", \"cao\": \"直刺0．5～l寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%B8%8B%E5%BB%89-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"上廉\", \"wei\": \" 在阳溪穴与曲池穴连线上，肘横纹下３寸处。\", \"jie\": \"在桡侧腕伸肌肌腹与拇长展肌之间；有桡动脉分支及头静脉；布有前臂背侧皮神经与桡神经深支。\", \"zhi\": \"①肘臂痛，半身不遂，手臂麻木；②头痛；③肠鸣腹痛。\", \"cao\": \" 直刺0．5～l寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%B8%8A%E5%BB%89-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"手三里\", \"wei\": \"在阳溪穴与曲池穴连线上，肘横纹下２寸处。\", \"jie\": \"肌肉、神经同下廉穴，血管为桡返动脉的分支。\", \"zhi\": \"①手臂无力，上肢不遂；②腹痛，腹泻；③齿痛，颊肿。\", \"cao\": \"直刺0．8～1．2寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%89%8B%E4%B8%89%E9%87%8C-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"曲池\", \"wei\": \"屈肘成直角，在肘横纹外侧端与肱骨外上髁连线中点。\", \"jie\": \"桡侧腕长伸肌起始部，肱桡肌的挠侧；有桡返动脉的分支；布有前臂背侧皮神经，内侧深层为桡神经本干。\", \"zhi\": \"①手臂痹痛，上肢不遂；②热病，高血压，癫狂；③腹痛，吐泻；④五官疼痛；⑤瘾疹，湿疹，瘰疬。\", \"cao\": \"直刺0．5～l寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%9B%B2%E6%B1%A0-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"肘髎\", \"wei\": \"屈肘，曲池穴外上方 l寸，当肱骨边缘处。\", \"jie\": \"在桡骨外上髁上缘肱肌起始部，肱三头肌外缘；有桡侧副动脉；布有前臂背侧皮神经及桡神经。\", \"zhi\": \"肘臂部疼痛、麻木、挛急。\", \"cao\": \"直刺0．5～l寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%82%98%E9%AB%8E-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"手五里\", \"wei\": \" 在曲池穴与肩髃穴连线上，曲池穴上3寸处。\", \"jie\": \"在肱骨桡侧，为肱桡肌起点，外侧为肱三头肌前缘；稍深为桡侧副动脉；布有前臂背侧皮神经，深层内侧为桡神经。\", \"zhi\": \"①肘臂挛痛；②瘰疬。\", \"cao\": \"避开动脉，直刺0．5～l寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%89%8B%E4%BA%94%E9%87%8C-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"臂臑\", \"wei\": \"在曲池穴与肩髃穴连线上，曲池穴上7寸，三角肌止点处。\", \"jie\": \"在肱骨桡侧，三角肌下端，肱三头肌外侧头的前缘；有旋肱后动脉的分支及肱深动脉；布有前臂背侧皮神经，深层有桡神经本干。\", \"zhi\": \"①肩臂疼痛不遂，颈项拘挛；②瘰疬；③目疾。\", \"cao\": \"直刺或向上斜刺0．8～1．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%87%82%E8%87%91-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"肩髃\", \"wei\": \"肩峰端下缘，当肩峰与肱骨大结节之间，三角肌上部中央。臂外展或平举时，肩部出现两个凹陷，当肩峰前下方凹陷处。\", \"jie\": \"有旋肱后动、静脉；布有锁骨上神经，腋神经。\", \"zhi\": \"①肩臂挛痛，上肢不遂；②瘾疹。\", \"cao\": \"直刺或向下斜刺0．8～1．5寸。肩周炎宜向肩关节直刺，上肢不遂宜向三角肌方向斜刺。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%82%A9%E9%AB%83-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"巨骨\", \"wei\": \"在锁骨肩峰端与肩胛冈之间凹陷处。\", \"jie\": \" 在斜方肌与冈上肌中;深层有肩胛上动、静脉；布有锁骨上神经分支，副神经分支，深层有肩胛上神经。\", \"zhi\": \"①肩臂挛痛，臂不举；②瘰疬，瘿气。\", \"cao\": \" 直刺，微斜向外下方，进针 0．5～l寸。 直刺不可过深，以免刺入胸腔造成气胸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%B7%A8%E9%AA%A8-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"天鼎\", \"wei\": \"在胸锁乳突肌后缘，扶突穴直下1寸。\", \"jie\": \"在胸锁乳突肌下部后缘，浅层为颈阔肌，深层为中斜角肌起点；有颈外浅静脉;为副神经、颈皮神经在胸锁乳突肌后缘穿出处，深层为膈神经的起点。\", \"zhi\": \"①暴喑气梗，咽喉肿痛；②瘰疬，瘿气。\", \"cao\": \"直刺0．5～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%A9%E9%BC%8E-%E8%A7%A3%E5%89%96%E5%9B%BE-L.jpg\" },\n  { \"name\": \"扶突\", \"wei\": \"在结喉旁约3寸，当胸锁乳突肌的胸骨头与锁骨头之间。\", \"jie\": \"在胸锁乳突肌胸骨头间颈阔肌中，深层为肩胛提肌起始点；深层内侧有颈升动脉；布有耳大神经，颈皮神经，枕小神经及副神经。\", \"zhi\": \"①咽喉肿痛，暴喑；②瘿气，瘰疬；③咳嗽，气喘；④颈部手术针麻用穴。\", \"cao\": \"直刺0．5～0．8寸。注意避开颈动脉，不可过深。一般不使用电针，以免引起迷走神经反应。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%89%B6%E7%AA%81-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"口禾髎\", \"wei\": \" 在上唇部，水沟穴旁0.5寸，当鼻孔外缘直下。\", \"jie\": \"在上颌骨犬齿窝部，上唇方肌止端；有面动、静脉的上唇支；布有面神经、三叉神经第二支下支与眶下神经的吻合丛。\", \"zhi\": \"①鼻塞，鼽衄；②口歪，口噤。\", \"cao\": \"直刺或斜刺0．3～0．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%8F%A3%E7%A6%BE%E9%AB%8E-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"迎香\", \"wei\": \" 在鼻翼外缘中点旁开约0.5寸，当鼻唇沟中。\", \"jie\": \" 在上唇方肌中，深部为梨状孔的边缘; 有面动、静脉及眶下动、静脉分支；布有面神经与眶下神经的吻合丛。\", \"zhi\": \"①鼻塞，鼽衄；②口歪；③胆道蛔虫症。\", \"cao\": \"略向内上方斜刺或平刺0．3～0．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%BF%8E%E9%A6%99-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" }] },\n\n{\n  \"name\": \"足阳明胃经\",\n  \"num\": 45,\n  \"content\": [\n  { \"name\": \"承泣\", \"wei\": \"目正视，瞳孔直下，当眼球与眶下缘之间。\", \"jie\": \"在眶下缘上方，眼轮匝肌中，深层眶内有眼球下直肌，下斜肌；有眶下动、静脉分支，眼动、静脉的分支；布有眶下神经分支及动眼神经下支的肌支，面神经分支。\", \"zhi\": \"①目疾；②口眼歪斜，面肌痉挛。\", \"cao\": \"以左手拇指向上轻推眼球，紧靠眶缘缓慢直刺0．5～1．5寸，不宜提插，以防刺破血管引起血肿。出针时稍加按压，以防出血。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%89%BF%E6%B3%A3-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"四白\", \"wei\": \"目正视，瞳孔直下，当眶下孔凹陷处。\", \"jie\": \"在眶下孔处，当眼轮匝肌和上唇方肌之间； 有面动、静脉分支，眶下动、静脉；布有面神经分支，当眶下神经处。\", \"zhi\": \"①目疾；②口眼歪斜，三叉神经痛，面肌痉挛；③头痛，眩晕。\", \"cao\": \" 直刺或微向上斜刺0．3～0．5寸，不可深刺，以免伤及眼球，不可过度提插捻转。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%9B%9B%E7%99%BD-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"巨髎\", \"wei\": \"目正视，瞳孔直下，平鼻翼下缘处，当鼻唇沟外侧。\", \"jie\": \"浅层为上唇方肌，深层为犬齿肌；有面动、静脉及眶下动、静脉；布有面神经及眶下神经的分支。\", \"zhi\": \"①口角歪斜；②鼻衄，齿痛，唇颊肿。\", \"cao\": \" 斜刺或平刺0．3～0．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%B7%A8%E9%AB%8E-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"地仓\", \"wei\": \"口角旁约0.4寸，上直对瞳孔。\", \"jie\": \" 在口轮匝肌中，深层为颊肌;有面动、静脉；布有面神经和眶下神经分支，深层为颊肌神经的末支。\", \"zhi\": \"①口角歪斜，流涎。②三叉神经痛。\", \"cao\": \" 斜刺或平刺0．5～0．8寸。可向颊车穴透刺。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%9C%B0%E4%BB%93-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"大迎\", \"wei\": \"在下颌角前下方约1.3寸，咬肌附着部前缘。当闭口鼓气时，下颌角前下方出现一沟形的凹陷中取穴。\", \"jie\": \"在咬肌附着部前缘;前方有面动、静脉；布有面神经及颊神经。\", \"zhi\": \"口角歪斜，颊肿，齿痛。\", \"cao\": \"避开动脉，斜刺或平刺0．3～0．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%A7%E8%BF%8E-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"颊车\", \"wei\": \"在下颌角前上方约１横指，按之凹陷处，当咀嚼时咬肌隆起最高点处。\", \"jie\": \"在下颌角前方，有咬肌；有咬肌动、静脉;布有耳大神经，面神经及咬肌神经。\", \"zhi\": \"①齿痛，牙关不利，颊肿；②口角歪斜。\", \"cao\": \"直刺0．3～0．5寸，或平刺0．5～l寸。 可向地仓穴透刺。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%A2%8A%E8%BD%A6-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"下关\", \"wei\": \"在耳屏前，下颌骨髁状突前方，当颧弓与下颌切迹所形成的凹陷中。合口有孔，张口即闭，宜闭口取穴。\", \"jie\": \"当颧弓下缘，皮下有腮腺，为咬肌起始部；有面横动、静脉，最深层为上颌动、静脉；正当面神经颧眶支及耳颞神经分支，最深层为下颌神经。\", \"zhi\": \"①牙关不利，三叉神经痛，齿痛；②口眼歪斜；③耳聋，耳鸣，聤耳。\", \"cao\": \"直刺0．5～l寸。留针时不可作张口动作，以免折针。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%B8%8B%E5%85%B3-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"头维\", \"wei\": \"当额角发际上0．5寸，头正中线旁4.5寸。\", \"jie\": \"在颞肌上缘帽状腱膜中；有颞浅动、静脉的额支；布有耳额神经的分支及面神经额颞支。\", \"zhi\": \" ①头痛；②目眩，目痛。\", \"cao\": \" 平刺0．5～l寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%B4%E7%BB%B4-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"人迎\", \"wei\": \"喉结旁1.5寸，在胸锁乳突肌的前缘，颈总动脉之后。\", \"jie\": \"有颈阔肌，在胸锁乳突肌前缘与甲状软骨接触部；有甲状腺上动脉；当颈内、外动脉分歧处，有颈前浅静脉，外为颈内静脉；布有颈皮神经，面神经颈支，深层颈动脉球，最深层为交感神经干，外侧有舌下神经降支及迷走神经。\", \"zhi\": \"①瘿气，咽喉肿痛，瘰疬；②高血压；③气喘。\", \"cao\": \"避开颈总动脉，直刺0．3～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%BA%BA%E8%BF%8E-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"水突\", \"wei\": \"在颈部，当人迎穴与气舍穴连线的中点，胸锁乳突肌的前缘。\", \"jie\": \"有颈阔肌，在甲状软骨外侧，胸锁乳突肌与肩胛舌骨肌上腹的交叉点；外侧为颈总动脉；布有颈皮神经，深层为交感神经发出的心上神经及交感干。\", \"zhi\": \"①咽喉肿痛；②咳嗽，气喘。\", \"cao\": \"直刺0．3～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%B0%B4%E7%AA%81-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"气舍\", \"wei\": \"人迎穴直下，在锁骨内侧端的上缘，胸锁乳突肌的胸骨头与锁骨头之间。\", \"jie\": \"有颈阔肌，胸锁乳突肌起始部；有颈前浅静脉，深部为颈总动脉；布有锁骨上神经前支，舌下神经的分支。\", \"zhi\": \"①咽喉肿痛，瘿瘤，瘰疬；②气喘，呃逆；③颈项强（见图3-17）。\", \"cao\": \" 直刺0．3～0．5寸。本经气舍至乳根诸穴，深部有大动脉及肺、肝等重要脏器，不可深刺。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%B0%94%E8%88%8D-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"缺盆\", \"wei\": \"在锁骨上窝中央，前正中线旁开4寸。\", \"jie\": \"在锁骨上窝之中点，有颈阔肌，肩胛舌骨肌；上方有颈横动脉；布有锁骨上神经中支，深层正当肩丛的锁骨上部。\", \"zhi\": \"①咳嗽，气喘；②咽喉肿痛，缺盆中痛，瘰疬。\", \"cao\": \"直刺或斜刺0．3～0．5寸。《图翼》：孕妇禁针。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%BC%BA%E7%9B%86-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"气户\", \"wei\": \"在锁骨下缘，前正中线旁开4寸。\", \"jie\": \" 在锁骨下方，胸大肌起始部，深层上方的锁骨下肌；有胸肩峰动、静脉分支，外上方为锁骨下静脉；为锁骨上神经，胸前神经分支分布处。\", \"zhi\": \" ①咳嗽，气喘，呃逆；②胸胁满痛。\", \"cao\": \" 斜刺或平刺0．5～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%B0%94%E6%88%B7-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"库房\", \"wei\": \"在第1肋间隙，前正中线旁开4寸。\", \"jie\": \"在第1肋间隙有胸大肌、胸小肌，深层为肋间内、外肌，有胸肩峰动、静减及胸外侧动、静脉分支；布有胸前神经分支。\", \"zhi\": \"①咳嗽，气喘，咳唾脓血；②胸肋胀痛。\", \"cao\": \" 斜刺或平刺0．5～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%BA%93%E6%88%BF-1-L.gif\" },\n  { \"name\": \"屋翳\", \"wei\": \"在第2肋间隙，前正中线旁开4寸。\", \"jie\": \"在第2肋间隙，有胸大肌，胸小肌，深层为肋间内外肌；有胸肩峰动、静脉分支；布有胸前神经分支。\", \"zhi\": \"①咳嗽，气喘，咳唾脓血；②胸肋胀痛；③乳痈。\", \"cao\": \"斜刺或平刺0．5～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%B1%8B%E7%BF%B3-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"膺窗\", \"wei\": \"在第3肋间隙，前正中线旁开4寸。\", \"jie\": \"第3肋间隙，有胸大肌，深层为肋间内、外肌；有胸外侧动、静脉；布有胸前神经分支\", \"zhi\": \"①咳嗽，气喘；②胸肋胀痛；③乳痈。\", \"cao\": \"斜刺或平刺0．5～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%86%BA%E7%AA%97-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"乳中\", \"wei\": \"在第4肋间隙，乳头中央。\", \"jie\": \"无\", \"zhi\": \"无\", \"cao\": \"本穴不针不灸，只作胸腹部腧穴的定位标志。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%B9%B3%E4%B8%AD-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"乳根\", \"wei\": \"在第5肋间隙，当乳头直下，前正中线旁开４寸。\", \"jie\": \" 在第5肋间隙，胸大肌下部，深层有肋间内、外肌；有肋间动脉，胸壁浅静脉；有第五5肋间神经外侧皮支，深层为肋间神经干。\", \"zhi\": \"①乳痈，乳汁少；②咳嗽，气喘，呃逆；③胸痛。\", \"cao\": \"斜刺或平刺0．5～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%B9%B3%E6%A0%B9-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"不容\", \"wei\": \"脐中上6寸，前正中线旁开2寸。\", \"jie\": \"当腹直肌及其鞘处，深层为腹横肌；有第7肋间动、静脉分支及腹壁上动、静脉；当第7肋间神经分支处。\", \"zhi\": \" 呕吐，胃痛，纳少，腹胀等胃疾。\", \"cao\": \"直刺0．5～0．8寸。过饱者禁针，肝肿大者慎针或禁针，不宜作大幅度提插。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%B8%8D%E5%AE%B9-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"承满\", \"wei\": \"脐中上5寸，前正中线旁开2寸。\", \"jie\": \"当腹直肌及其鞘处，深层为腹横肌；有第7肋间动、静脉分支及腹壁上动、静脉分布；当第7肋间神经分支处。\", \"zhi\": \" 胃痛，吐血，纳少等胃疾。\", \"cao\": \"直刺0．8～l寸。过饱者禁针，肝肿大者慎针或禁针，不宜作大幅度提插。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%89%BF%E6%BB%A1-1-L.gif\" },\n  { \"name\": \"梁门\", \"wei\": \"脐中上4寸，前正中线旁开2寸。\", \"jie\": \"当腹直肌及其鞘处，深层为腹横肌；有第7肋间动、静脉分支及腹壁上动、静脉；当第8肋间神经分支处（右侧深部当肝下缘，胃幽门部）。\", \"zhi\": \"纳少，胃痛，呕吐等胃疾。\", \"cao\": \"直刺0．8～1．2寸。过饱者禁针，肝肿大者慎针或禁针，不宜作大幅度提插。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%A2%81%E9%97%A8-1-L.gif\" },\n  { \"name\": \"关门\", \"wei\": \"脐中上3寸，前正中线旁开2寸。\", \"jie\": \"当腹直肌及其鞘处；有第8肋间动、静脉分支及腹壁上动、静脉分支；布有第8肋间神经分支（内部为横结肠）。\", \"zhi\": \"腹胀，腹痛，肠鸣腹泻等胃肠疾。\", \"cao\": \"直刺0．8～1．2寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%85%B3%E9%97%A8-1-L.gif\" },\n  { \"name\": \"太乙\", \"wei\": \"脐中上2寸，前正中线旁开2寸。\", \"jie\": \"当腹直肌及其鞘处；有第8肋间动、静脉分支及其腹壁下动、静脉分支；布有第8肋间神经分支（内部为横结肠）。\", \"zhi\": \"①胃病；②心烦，癫狂。\", \"cao\": \"直刺0．8～1．2寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%AA%E4%B9%99-1-L.gif\" },\n  { \"name\": \"滑肉门\", \"wei\": \"脐中上1寸，前正中线旁开2寸。\", \"jie\": \"当腹直肌及其鞘处；有第9肋间动、静脉分支及腹壁下动、静分支；布有第9肋间神经分支（内部为小肠）。\", \"zhi\": \"①胃痛，呕吐；②癫狂。\", \"cao\": \"直刺0．8～1．2寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%BB%91%E8%82%89%E9%97%A8-1-L.gif\" },\n  { \"name\": \"天枢\", \"wei\": \"脐中旁开2寸。\", \"jie\": \"当腹直肌及其鞘处；有第9肋间动、静脉分支及腹壁下动、静脉分支；布有第9肋间神经分支（内部为小肠）。\", \"zhi\": \"①腹痛，腹胀，便秘，腹泻，痢疾等胃肠病；②月经不调，痛经。\", \"cao\": \" 直刺 l～1．5寸。《千金》：孕妇不可灸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%A9%E6%9E%A2-1-L.gif\" },\n  { \"name\": \"外陵\", \"wei\": \"脐中下1寸，前正中线旁开2寸。\", \"jie\": \"当腹直肌及其鞘处；布有第10肋间动、静脉分支及腹壁下动、静脉分支；布有第10肋间神经分支（内部为小肠）。\", \"zhi\": \"①腹痛，疝气；②痛经。\", \"cao\": \"直刺 l～l．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%96%E9%99%B5-1-L.gif\" },\n  { \"name\": \"大巨\", \"wei\": \"脐中下2寸，前正中线旁开2寸。\", \"jie\": \"当腹直肌及其鞘处；有第11肋间动、静脉分支，外侧为腹壁下动、静脉；布有第11肋间神经（内部为小肠）。\", \"zhi\": \"①小腹胀满，小便不利，疝气；②遗精，早泄。\", \"cao\": \"直刺 l～1．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%A7%E5%B7%A8-1-L.gif\" },\n  { \"name\": \"水道\", \"wei\": \"脐中下3寸，前正中线旁开2寸。\", \"jie\": \"当腹直肌及其鞘处；有第12肋间动、静脉分支，外侧为腹壁下动、静脉；布有第12肋间神经（内部为小肠）。\", \"zhi\": \"①小腹胀满，小便不利，疝气；②痛经，不孕。\", \"cao\": \" 直刺 l～1．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%B0%B4%E9%81%93-1-L.gif\" },\n  { \"name\": \"归来\", \"wei\": \"脐中下4寸，前正中线旁开2寸。\", \"jie\": \"在腹直肌外缘，有腹内斜肌，腹横肌腱膜；外侧有腹壁下动、静脉；布有髂腹下神经。\", \"zhi\": \"①小腹痛，疝气；②月经不调，带下，阴挺。\", \"cao\": \"直刺 l～l．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%BD%92%E6%9D%A5-1-L.gif\" },\n  { \"name\": \"气冲\", \"wei\": \"在腹股沟稍上方，脐中下5寸，前正中线旁开2寸。\", \"jie\": \"在耻骨结节外上方，有腹外斜肌腱膜，在腹内斜肌、腹膜肌下部；有腹壁浅动、静脉分支，外壁为腹壁下动、静脉；布有髂腹股沟神经。\", \"zhi\": \"①肠鸣腹痛，疝气；②月经不调，不孕，阳萎，阴肿。\", \"cao\": \"直刺0．5～l寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%B0%94%E5%86%B2-1-L.gif\" },\n  { \"name\": \"髀关\", \"wei\": \"在髂前上棘与髌骨外上缘连线上，屈髋时平会阴，居缝匠肌外侧凹陷处。\", \"jie\": \"在缝匠肌和阔筋膜张肌之间；深层有旋股外侧动、静脉分支；布有股外侧皮神经。\", \"zhi\": \"下肢痿痹，腰痛膝冷。\", \"cao\": \" 直刺 l～2寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%AB%80%E5%85%B3-1-L.gif\" },\n  { \"name\": \"伏兔\", \"wei\": \"在髂前上棘与髌骨外上缘连线上，髌骨外上缘上6寸。\", \"jie\": \" 在股直肌的肌腹中有旋股外侧动、静脉分支；布有股前皮神经，股外侧皮神经。\", \"zhi\": \"①下肢痿痹，腰痛膝冷；②疝气，脚气。\", \"cao\": \"直刺 l～2寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%BC%8F%E5%85%94-1-L.gif\" },\n  { \"name\": \"阴市\", \"wei\": \"在髂前上棘与髌骨外上缘连线上，髌骨外上缘上3寸。\", \"jie\": \"在股直肌和股外侧肌之间；有旋股外侧动脉降支；布有股前皮神经，股外侧皮神经。\", \"zhi\": \"①下肢痿痹，膝关节屈伸不利；②疝气。\", \"cao\": \" 直刺 l～l．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%98%B4%E5%B8%82-1-L.gif\" },\n  { \"name\": \"梁丘\", \"wei\": \"屈膝，在髂前上棘与髌骨外上缘连线上，髌骨外上缘上3寸。\", \"jie\": \"在股直肌和股外侧肌之间；有旋股外侧动脉降支；布有股前皮神经，股外侧皮神经。\", \"zhi\": \"①膝肿痛，下肢不遂；②急性胃痛，乳痈，乳痛。\", \"cao\": \"直刺 l～1．2寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%A2%81%E4%B8%98-1-L.gif\" },\n  { \"name\": \"犊鼻\", \"wei\": \"屈膝，在髌韧带外侧凹陷中。\", \"jie\": \"在髌韧带外缘；有膝关节动、静脉网；布有腓肠外侧皮神经及腓总神经关节支。\", \"zhi\": \"膝痛，屈伸不利，下肢麻痹。\", \"cao\": \"向后内斜刺0．5～l寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%8A%8A%E9%BC%BB-1-L.gif\" },\n  { \"name\": \"足三里\", \"wei\": \"犊鼻穴下3寸，胫骨前嵴外一横指处。\", \"jie\": \"在胫骨前肌，趾长伸肌之间；有胫前动、静脉；为腓肠外侧皮神经及隐神经的 皮支分布处，深层当腓深神经。\", \"zhi\": \"①胃痛，呕吐，噎膈，腹胀，腹泻，痢疾，便秘等胃肠诸疾；②下肢痿痹；③心悸，高血压，癫狂；④乳痈；⑤虚劳诸症，为强壮保健要穴。\", \"cao\": \"直刺1～2寸。强壮保健用，常用温灸法。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%B6%B3%E4%B8%89%E9%87%8C-1-L.gif\" },\n  { \"name\": \"上巨虚\", \"wei\": \"在犊鼻穴下6寸，足三里穴下3寸。\", \"jie\": \" 在胫骨前肌中；有胫前动、静脉；布有腓肠外侧皮神经及隐神经的皮支，深层当腓深神经。\", \"zhi\": \"①肠鸣，腹痛，腹泻，便秘，肠痈等肠胃疾患；②下肢痿痹。\", \"cao\": \"直刺 l～2寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%B8%8A%E5%B7%A8%E8%99%9A-1-L.gif\" },\n  { \"name\": \"条口\", \"wei\": \" 上巨虚穴下2寸。\", \"jie\": \"在胫骨前肌中；有胫前动、静脉；布有腓肠外侧皮神经及隐神经的皮支，深层当腓深神经。\", \"zhi\": \"①下肢痿痹，转筋；②肩臂痛；③脘腹疼痛。\", \"cao\": \"直刺 l～1．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%9D%A1%E5%8F%A3-1-L.gif\" },\n  { \"name\": \"下巨虚\", \"wei\": \"上巨虚穴下3寸。\", \"jie\": \"在胫骨前肌与趾长伸肌之间，深层为胫长伸肌；有胫前动、静脉；布有腓浅神经分支，深层为腓深神经。\", \"zhi\": \"①腹泻，痢疾，小腹痛；②下肢痿痹；③乳痈。\", \"cao\": \"直刺l～1．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%B8%8B%E5%B7%A8%E8%99%9A-1-L.gif\" },\n  { \"name\": \"丰隆\", \"wei\": \"外踝尖上８寸，条口穴外1寸，胫骨前嵴外二横指处。\", \"jie\": \"在趾长伸肌外侧和腓骨短肌之间；有胫前动脉分支；当腓浅神经处。\", \"zhi\": \"①头痛，眩晕，癫狂；②咳嗽痰多；③下肢痿痹。\", \"cao\": \"直刺l～1．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%B8%B0%E9%9A%86-1-L.gif\" },\n  { \"name\": \"解溪\", \"wei\": \"足背踝关节横纹中央凹陷处，当拇长伸肌踺与趾长伸肌腱之间。\", \"jie\": \"在拇长伸肌膜与趾长伸肌胫之间；有胫前动、静脉；浅部当腓浅神经，深层当腓深神经。\", \"zhi\": \"①下肢痿痹，踝关节病，垂足；②头痛，眩晕，癫狂；③腹胀，便秘。\", \"cao\": \" 直刺0．5～l寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%A7%A3%E6%BA%AA-1-L.gif\" },\n  { \"name\": \"冲阳\", \"wei\": \"在足背最高处，当拇长伸肌腱和趾长伸肌腱之间，足背动脉搏动处。\", \"jie\": \"在趾长伸肌腱外侧；有足背动、静脉及足背静脉网；当腓浅神经的足背内侧皮神经第2支本干处，深层为腓深神经。\", \"zhi\": \"①胃痛；②口眼歪斜；③癫狂痫；④足痿无力。\", \"cao\": \"避开动脉，直刺0．3～0．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%86%B2%E9%98%B3-1-L.gif\" },\n  { \"name\": \"陷谷\", \"wei\": \"足背第2、3跖骨结合部前，第2、3跖趾关节后凹陷处。\", \"jie\": \"有第2跖骨间肌；有足背静脉网；布有足背内侧皮神经。\", \"zhi\": \"①面肿，水肿；②足背肿痛；③肠鸣腹痛。\", \"cao\": \" 直刺或斜刺0．3～0．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%99%B7%E8%B0%B7-1-L.gif\" },\n  { \"name\": \"内庭\", \"wei\": \"足背第２、３趾间缝纹端。\", \"jie\": \"有足背静脉网；布有腓浅神经足背支。\", \"zhi\": \"①齿痛，咽喉肿痛，鼻衄；②热病；③胃病吐酸，腹泻，痢疾，便秘；④足背肿痛，跖趾关节痛。\", \"cao\": \"直刺或斜刺0．5～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%86%85%E5%BA%AD-1-L.gif\" },\n  { \"name\": \"厉兑\", \"wei\": \" 第２趾外侧趾甲角旁约0.1寸。\", \"jie\": \"有趾背动脉形成的动脉网；布有腓浅神经的足背支。\", \"zhi\": \"①鼻衄，齿痛，咽喉肿痛；②热病，多梦，癫狂。\", \"cao\": \"浅刺0．1寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%8E%89%E5%85%91-1-L.gif\" }] },\n\n{\n  \"name\": \"足太阴脾经\",\n  \"num\": 21,\n  \"content\": [\n  { \"name\": \"隐白\", \"wei\": \"足大趾内侧趾甲角旁0．1寸。\", \"jie\": \"有趾背动脉；为腓浅神经的足背支及足底内侧神经。\", \"zhi\": \"①月经过多，崩漏；②便血，尿血等慢性出血；③癫狂，多梦，惊风。④腹满，暴泄。\", \"cao\": \"浅刺0．1寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%9A%90%E7%99%BD-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"大都\", \"wei\": \"足大趾内侧，第１跖趾关节前下方，赤白肉际处。\", \"jie\": \"在拇展肌止点；有足底内侧动、静脉的分支；布有足底内侧神经的趾底固有神经。\", \"zhi\": \"①腹胀，胃痛，呕吐，腹泻，便秘；②热病，无汗。\", \"cao\": \"直刺0．3～0．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%A7%E9%83%BD-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"太白\", \"wei\": \"第１跖骨小头后缘，赤白肉际凹陷处。\", \"jie\": \"在拇展肌中；有足背静脉网，足底内侧动脉及足跗内侧动脉分支；布有隐神经及腓浅神经分支。\", \"zhi\": \" ①肠鸣，腹胀，腹泻，胃痛，便秘；②体重节痛。\", \"cao\": \"直刺0．5～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%AA%E7%99%BD-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"公孙\", \"wei\": \"第一跖骨基底部的前下方，赤白肉际处。\", \"jie\": \"在拇展肌中；有跗内侧动脉分支及足背静脉网；布有隐神经及腓浅神经分支。\", \"zhi\": \"胃痛，呕吐，腹痛，腹泻，痢疾。\", \"cao\": \"直刺0．6～1．2寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%85%AC%E5%AD%99-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"商丘\", \"wei\": \"内踝前下方凹陷中，当舟骨结节与内踝尖连线的中点处。\", \"jie\": \"有跗内侧动脉，大隐静脉；布有隐神经及腓浅神经分支丛。\", \"zhi\": \"①腹胀，腹泻，便秘，黄疸；②足踝痛。\", \"cao\": \"直刺0．5～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%95%86%E4%B8%98-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"三阴交\", \"wei\": \"内踝尖上3寸，胫骨内侧面后缘。\", \"jie\": \" 在胫骨后缘和比目鱼肌之间，深层有屈趾长肌；有大隐静脉，胫后动、静脉；有小腿内侧皮神经，深层后方有胫神经。\", \"zhi\": \"①肠鸣腹胀，腹泻等脾胃虚弱诸症；②月经不调，带下，阴挺，不孕，滞产，遗精，阳萎，遗尿等生殖泌尿系统疾患；③心悸，失眠，高血压；④下肢痿痹；⑤阴虚诸症。\", \"cao\": \"直刺 l～1．5寸。孕妇禁针。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%B8%89%E9%98%B4%E4%BA%A4-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"漏谷\", \"wei\": \"在内踝尖与阴陵泉的连线上，内踝尖上6。\", \"jie\": \"在胫骨后缘与比目鱼肌之间，深层有屈趾长肌；有大隐静脉，肢后动、静脉；有小腿内侧皮神经，深层内侧后方有胫神经。\", \"zhi\": \"①腹胀，肠鸣；②小便不利，遗精；③下肢痿痹。\", \"cao\": \" 直刺 l～1．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%BC%8F%E8%B0%B7-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"地机\", \"wei\": \"在内踝尖与阴陵泉穴的连线上，阴陵泉穴下3寸。\", \"jie\": \"在胫骨后缘与比目鱼肌之间；前方有大隐静脉及膝最上动脉的末支，深层有胫后动、静脉；布有小腿内侧皮神经，深层后方有胫神经。\", \"zhi\": \" ①痛经，崩漏，月经不调；②腹痛，腹泻，小便不利，水肿。\", \"cao\": \" 直刺 l～1．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%9C%B0%E6%9C%BA-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"阴陵泉\", \"wei\": \"胫骨内侧髁下方凹陷处。\", \"jie\": \"在胫骨后缘和腓肠肌之间，比目鱼肌起点上；前方有大隐静脉，膝最上动脉，最深层有胫后动、静脉；布有小腿内侧皮神经本干，最深层有胫神经。\", \"zhi\": \"①腹胀，腹泻，水肿，黄疸，小便不利；②膝痛。\", \"cao\": \" 直刺1～2寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%98%B4%E9%99%B5%E6%B3%89-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"血海\", \"wei\": \"屈膝，在髌骨内上缘上2寸，当股四头肌内侧头的隆起处。简便取穴法：患者屈膝，医者以左手掌心按于患者右膝髌骨上缘，二至五指向上伸直，拇指约呈45度斜置，拇指尖下是穴。对侧取法仿此。\", \"jie\": \"在股骨内上髁上缘，股内侧肌中间；有股动、静脉肌支；布有股前皮神经及股神经肌支。\", \"zhi\": \"①月经不调，痛经，经闭；②瘾疹，湿疹，丹毒。\", \"cao\": \"直刺 l～1．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%A1%80%E6%B5%B7-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"箕门\", \"wei\": \"在血海穴与冲门穴的连线上，血海穴直上6寸。\", \"jie\": \" 在缝匠肌内侧缘 ，深层有大收肌；有大隐静脉，深层之外方有股动、静脉；布有股前皮神经，深部有隐神经。\", \"zhi\": \"①小便不利，遗尿；②腹股沟肿痛。\", \"cao\": \"避开动脉，直刺0．5～l寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%AE%95%E9%97%A8-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"冲门\", \"wei\": \"在腹股沟外侧，距耻骨联合上缘中点3．5寸，当髂外动脉搏动处的外侧。\", \"jie\": \"在腹股沟韧带中点外侧的上方，在腹外斜肌腱膜及内斜肌下部；内侧为股动、静脉；布有股神经。\", \"zhi\": \"腹痛，疝气，崩漏，带下。\", \"cao\": \"避开动脉，直刺0．5～l寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%86%B2%E9%97%A8-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"府舍\", \"wei\": \"冲门穴上方0．7寸，前正中线旁开4寸。\", \"jie\": \"在腹股沟韧带上方外侧，腹外斜肌腱膜及腹内斜肌下部，深层为腹横肌下部；布有腹壁浅动脉，肋间动、静脉；布有髂腹股沟神经（右当盲肠下部，左当乙状结肠下部）。\", \"zhi\": \"腹痛，积聚，疝气。\", \"cao\": \"直刺 l～1．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%BA%9C%E8%88%8D-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"腹结\", \"wei\": \"府舍穴上3寸，大横穴下1寸。\", \"jie\": \"在腹内、外斜肌及腹横肌肌部；有第11肋间动、静脉；布有第11肋间神经。\", \"zhi\": \"腹痛，腹泻，疝气。\", \"cao\": \"直刺 l～2寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%85%B9%E7%BB%93-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"大横\", \"wei\": \"脐中旁开4寸。\", \"jie\": \"在腹外斜肌肌部及腹横肌肌部；布有第11肋间动、静脉；布有第12肋间神经。\", \"zhi\": \"腹痛，腹泻，便秘。\", \"cao\": \"直刺 l～2寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%A7%E6%A8%AA-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"腹哀\", \"wei\": \"脐中上3寸，前正中线旁开4寸。\", \"jie\": \"在腹内外斜肌及腹横肌肌部；布有第8肋间动、静脉；布有第8肋间神经。\", \"zhi\": \" 消化不良，腹痛，便秘，痢疾。\", \"cao\": \"直刺 l～1．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%85%B9%E5%93%80-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"食窦\", \"wei\": \"在第5肋间隙，前正中线旁开6寸。\", \"jie\": \"在第5肋间隙，前锯肌中，深层有肋间内、外肌；布有胸外侧动、静脉，胸腹壁动、静脉；布有第5肋间神经外侧皮支。\", \"zhi\": \"①胸胁胀痛；②噫气，翻胃，腹胀，水肿。\", \"cao\": \"斜刺或向外平刺0.5～0.8寸。本经食窦至大包诸穴，深部为肺脏，不可深刺。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%A3%9F%E7%AA%A6-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"天溪\", \"wei\": \"在第4肋间隙，前正中线旁开6寸。\", \"jie\": \"在第4肋间隙，胸大肌外下缘，下层为前锯肌，再深层为肋间内、外肌；有胸外侧动、静脉分支，胸腹壁动、静脉；第4肋间动、静脉；布有第四肋间神经。\", \"zhi\": \"①胸胁疼痛，咳嗽；②乳痈，乳汁少。\", \"cao\": \"斜刺或向外平刺0．5～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%A9%E6%BA%AA-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"胸乡\", \"wei\": \"在第3肋间隙，前正中线旁开6寸。\", \"jie\": \"在第3肋间隙，胸大肌、胸小肌外缘，前锯肌中，下层为肋间内、外肌；有胸外侧动、静脉，第3肋间动、静脉；布有第3肋间神经。\", \"zhi\": \"胸胁胀痛。\", \"cao\": \"斜刺或向外平刺0．5～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%83%B8%E4%B9%A1-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"周荣\", \"wei\": \"在第2肋间隙，前正中线旁开6寸。\", \"jie\": \"在第2肋间隙，胸大肌中，下层为胸小肌，肋间内、外肌；有胸外侧动、静脉，第2肋间动、静脉；布有胸前神经分支，正当第1肋间神经。\", \"zhi\": \"①咳嗽，气逆；②胸胁胀满。\", \"cao\": \"斜刺或向外平刺0．5～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%91%A8%E8%8D%A3-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"大包\", \"wei\": \"在侧胸部腋中线上，当第6肋间隙处。\", \"jie\": \"在第6肋间隙，前锯肌中；有胸背动、静脉及第6肋间动、静脉；布有第6肋间神经，当胸长神经直系的末端。\", \"zhi\": \" ①气喘；②胸胁痛；③全身疼痛，急性扭伤，四肢无力。\", \"cao\": \"斜刺或向后平刺0．5～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%A7%E5%8C%85-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" }] },\n\n{\n  \"name\": \"手少阴心经\",\n  \"num\": 9,\n  \"content\": [\n  { \"name\": \"极泉\", \"wei\": \"腋窝正中，腋动脉搏动处.\", \"jie\": \"在胸大肌的外下缘，深层为喙肱肌；外侧为腋动脉；布有尺神经，正中神经，前臂内侧皮神经及臂内侧皮神经。\", \"zhi\": \"①心痛，心悸；②肩臂疼痛，胁肋疼痛，臂丛神经损伤。③瘰疬，腋臭；④上肢针麻用穴。\", \"cao\": \" 避开腋动脉，直刺或斜刺0．3～0．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%9E%81%E6%B3%89-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"青灵\", \"wei\": \"臂内侧，在极泉穴与少海穴的连线上，肘横纹上3寸，肱二头肌的尺侧缘.\", \"jie\": \" 当肱二头肌内侧沟处，有肱三头肌；有贵要静脉，尺侧上副动脉；布有前臂内侧皮神经，尺神经。\", \"zhi\": \"①头痛，振寒，目黄；②胁痛，肩臂疼痛。\", \"cao\": \"直刺0．5～l寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%9D%92%E7%81%B5-%E8%A7%A3%E5%89%96%E5%9B%BE-L.jpg\" },\n  { \"name\": \"少海\", \"wei\": \"屈肘，当肘横纹内侧端与肱骨内上髁连线的中点处.\", \"jie\": \"有旋前圆肌，肱肌；有贵要静脉，尺侧上下副动脉，尺返动脉；布有前臂内侧皮神经，外前方有正中神经。\", \"zhi\": \"①心痛，癔病；②肘臂挛痛，臂麻手颤，头项痛，腋胁痛；③瘰疬。\", \"cao\": \"直刺0．5～l寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%B0%91%E6%B5%B7-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"灵道\", \"wei\": \"腕横纹上1．5寸，尺侧腕屈肌腱的桡侧缘.\", \"jie\": \"在尺侧腕屈肌与指浅屈肌之间，深层为指深屈肌；有尺动脉通过；布有前臂内侧皮神经，尺侧为尺神经。\", \"zhi\": \"①心痛，悲恐善笑；②暴喑；③肘臂挛痛。\", \"cao\": \" 直刺0．3～0．5寸。不宜深刺，以免伤及血管和神经。留针时，不可作屈腕动作。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%81%B5%E9%81%93-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"通里\", \"wei\": \"腕横纹上 1寸，尺侧腕屈肌腱的桡侧缘.\", \"jie\": \"在尺侧腕屈肌与指浅屈肌之间，深层为指深屈肌；有尺动脉通过；布有前臂内侧皮神经，尺侧为尺神经。\", \"zhi\": \"① 心悸，怔仲；②舌强不语，暴喑；③腕臂痛。\", \"cao\": \"直刺0．3～0．5寸。不宜深刺，以免伤及血管和神经。留针时，不可作屈腕动作。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%80%9A%E9%87%8C-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"阴郄\", \"wei\": \"腕横纹上0.5寸，尺侧腕屈肌腱的桡侧缘.\", \"jie\": \"在尺侧腕屈肌与指浅屈肌之间，深层为指深屈肌；有尺动脉通过；布有前臂内侧皮神经，尺侧为尺神经。\", \"zhi\": \"① 心痛，惊悸；②骨蒸盗汗；③吐血，衄血。\", \"cao\": \"直刺0．3～0．5寸。不宜深刺，以免伤及血管和神经。留针时，不可作屈腕动作。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%98%B4%E9%83%84-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"神门\", \"wei\": \"腕横纹尺侧端，尺侧腕屈肌腱的桡侧凹陷处.\", \"jie\": \"在尺侧腕屈肌与指浅屈肌之间，深层为指深屈肌；有尺动脉通过；布有前臂内侧皮神经，尺侧为尺神经。\", \"zhi\": \"①心痛，心烦，惊悸，怔仲，健忘，失眠，痴呆，癫狂痫等心与神志病变；②高血压；③胸胁痛。\", \"cao\": \"直刺0．3～0.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%A5%9E%E9%97%A8-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"少府\", \"wei\": \"在手掌面，第4、5掌骨之间，握拳时当小指与无名指指端之间.\", \"jie\": \"在第4、5掌骨间，有第4蚓状肌，指浅、深屈肌腱，深部为骨间肌；有指掌侧总动、静脉；布有第4指掌侧固有神经。\", \"zhi\": \"①心悸，胸痛；②阴痒，阴痛；③痈疡；④小指挛痛。\", \"cao\": \" 直刺0．3～0．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%B0%91%E5%BA%9C-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"少冲\", \"wei\": \"小指桡侧指甲角旁0．1寸.\", \"jie\": \"有指掌侧固有动、静脉所形成的动、静脉网；布有指掌侧固有神经\", \"zhi\": \"① 心悸，心痛，癫狂；②热病，昏迷。③胸胁痛。\", \"cao\": \" 浅刺0．1寸，或点刺出血。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%B0%91%E5%86%B2-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" }] },\n\n{\n  \"name\": \"手太阳小肠经\",\n  \"num\": 19,\n  \"content\": [\n  { \"name\": \"少泽\", \"wei\": \"小指尺侧指甲角旁0．l寸。\", \"jie\": \"有指掌侧固有动、静脉，指背动脉形成的动、静脉网；布有尺神经手背支。\", \"zhi\": \"①乳痈，乳汁少；②昏迷，热病；③ 头痛，目翳，咽喉肿痛。\", \"cao\": \"浅刺0．1寸或点刺出血。 孕妇慎用。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%B0%91%E6%B3%BD-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"前谷\", \"wei\": \"微握拳，第5指掌关节前尺侧，掌指横纹头赤白肉际。\", \"jie\": \" 有指背动、静脉；布有尺神经手背支。\", \"zhi\": \"①热病；②乳痈，乳汁少；③头痛，目痛，耳鸣，咽喉肿痛。\", \"cao\": \"直刺0．3～0．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%89%8D%E8%B0%B7-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"后溪\", \"wei\": \"微握拳，第5指掌关节后尺侧的远侧掌横纹头赤白肉际。\", \"jie\": \"在小指尺侧，第5掌骨小头后方，当小指展肌起点外缘；有指背动、静脉，手背静脉网；布有尺神经手背支。\", \"zhi\": \" ①头项强痛，腰背痛，手指及肘臂挛痛；②耳聋，目赤；③癫狂痫；④疟疾。\", \"cao\": \"直刺0．5～l寸。治手指挛痛可透刺合谷穴。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%90%8E%E6%BA%AA-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"腕骨\", \"wei\": \"第5掌骨基底与三角骨之间的凹陷处，赤白肉际。\", \"jie\": \"在手背尺侧，小指展肌起点外缘；有腕背侧动脉（尺动脉分支），手背静脉网；布有尺神经手背支。\", \"zhi\": \"①指挛腕痛，头项强痛；②目翳，黄疸；③热病，疟疾。\", \"cao\": \"直刺0．3～0．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%85%95%E9%AA%A8-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"阳谷\", \"wei\": \"腕背横纹尺侧端，当尺骨茎突与三角骨之间的凹陷处。\", \"jie\": \"当尺侧腕伸肌腱的尺侧缘；有腕背侧动脉；布有尺神经手背支。\", \"zhi\": \"①颈颔肿，臂外侧痛，腕痛；②头痛，目眩，耳鸣，耳聋；③热病，癫狂痫。\", \"cao\": \"直刺0．3～0．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%98%B3%E8%B0%B7-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"养老\", \"wei\": \"以手掌面向胸，当尺骨茎突桡侧骨缝凹缘中。\", \"jie\": \"左尺骨背面，尺骨茎突上方，尺侧腕伸肌腱和小指固有伸肌腱之间；布有前臂骨间背侧动、静脉的末支，腕静脉网；有前臂背侧皮神经和尺神经。\", \"zhi\": \"①目视不明；②肩、背、肘、臂酸痛。\", \"cao\": \"直刺或斜刺0．5～0．8寸。强身保健可用温和灸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%85%BB%E8%80%81-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"支正\", \"wei\": \"阳谷穴与小海穴的连线上，腕背横纹上5寸。\", \"jie\": \"在尺骨背面，尺侧腕伸肌的尺侧缘；布有骨间背侧动、静脉；布有前臂内侧皮神经分支。\", \"zhi\": \"①头痛，项强，肘臂酸痛；②热病，癫狂；③疣症。\", \"cao\": \"直刺或斜刺0．５～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%94%AF%E6%AD%A3-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"小海\", \"wei\": \"屈肘，当尺骨鹰嘴与肱骨内上髁之间凹陷处。\", \"jie\": \"尺神经沟中，为尺侧腕屈肌的起始部；有尺侧上、下副动脉和副静脉以及尺返动、静脉；布有前臂内侧皮神经，尺神经本干。\", \"zhi\": \"①肘臂疼痛，麻木；②癫痫。\", \"cao\": \" 直刺0．3～0．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%B0%8F%E6%B5%B7-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"肩贞\", \"wei\": \"臂内收，腋后纹头上l寸。\", \"jie\": \"在肩关节后下方，肩胛骨外侧缘，三角肌后缘，下层是大圆肌；有旋肩胛动、静脉；布有腋神经分支，最深部上方为桡神经。\", \"zhi\": \"①肩臂疼痛，上肢不遂；②瘰疬。\", \"cao\": \" 直刺 l～1．5寸。不宜向胸侧深刺。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%82%A9%E8%B4%9E-1-L.gif\" },\n  { \"name\": \"臑俞\", \"wei\": \"臂内收，腋后纹头直上，肩胛冈下缘凹陷中。\", \"jie\": \"在肩胛骨关节窝后方三角肌中，深层为岗下肌；有旋肱后动、静脉；布有腋神经，深层为肩胛上神经。\", \"zhi\": \"①肩臂疼痛，肩不举；②瘰疬。\", \"cao\": \"直刺或斜刺0．5～1．5寸。不宜向胸侧深刺。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%87%91%E4%BF%9E-1-L.gif\" },\n  { \"name\": \"天宗\", \"wei\": \"肩胛骨冈下窝中央凹陷处，约肩胛冈下缘与肩胛下角之间的上1/3折点处取穴。\", \"jie\": \"在冈下窝中央冈下肌中；有旋肩胛动、静脉肌支；布有肩胛神经。\", \"zhi\": \"①肩胛疼痛，肩背部损伤；②气喘。\", \"cao\": \"直刺或斜刺0．5～l寸。遇到阻力不可强行进针。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%A9%E5%AE%97-1-L.gif\" },\n  { \"name\": \"秉风\", \"wei\": \"肩胛骨冈上窝中央，天宗穴直上，举臂有凹陷处。\", \"jie\": \"在肩胛冈上缘中央，表层为斜方肌，再下为冈上肌；有肩胛动、静脉；布有锁骨上神经和副神经，深层为肩胛上神经。\", \"zhi\": \" 肩胛疼痛，上肢酸麻。\", \"cao\": \"直刺或斜刺0．5～l寸。 宜向锁骨上窝上方刺，不宜向胸部深刺。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%A7%89%E9%A3%8E-1-L.gif\" },\n  { \"name\": \"曲垣\", \"wei\": \"肩胛骨冈上窝内侧端，在臑俞穴与第2胸椎棘突连线的中点处。\", \"jie\": \"在肩胛冈上缘，斜方肌和冈上肌中；有颈横动、静脉降支，深层为肩胛上动、静脉肌支；布有第2胸神经后支外侧皮支、副神经，深层为肩胛上神经肌支。\", \"zhi\": \"肩胛疼痛。\", \"cao\": \"直刺或斜刺0．5～l寸。宜向锁骨上窝上方刺，不宜向胸部深刺。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%9B%B2%E5%9E%A3-1-L.gif\" },\n  { \"name\": \"肩外俞\", \"wei\": \"第1胸椎棘突下旁开3寸。\", \"jie\": \"在肩胛骨内侧角边缘，表层为斜方肌，深层为肩胛提肌和菱形肌；有颈横动、静脉，布有第1神经后支内侧皮支，肩胛背神经和副神经。\", \"zhi\": \"肩背疼痛，颈项强急。\", \"cao\": \"斜刺0．5～0．8寸。 不宜深刺。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%82%A9%E5%A4%96%E4%BF%9E-1-L.gif\" },\n  { \"name\": \"肩中俞\", \"wei\": \"第7颈椎棘突下旁开2寸。\", \"jie\": \"在第1胸椎横突端，在肩胛骨内侧角边缘， 表层为斜方肌，深层为肩胛提肌和菱形肌；有颈横动、静脉；布有第1胸神经后支内侧皮支，肩胛神经和副神经。\", \"zhi\": \"①咳嗽，气喘；②肩背疼痛。\", \"cao\": \"斜刺0．5～0．8寸。 不宜深刺。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%82%A9%E4%B8%AD%E4%BF%9E-1-L.gif\" },\n  { \"name\": \"天窗\", \"wei\": \"扶突穴后，在胸锁乳突肌的后缘，约喉结旁开3.5寸。\", \"jie\": \"在斜方肌前缘，肩胛提肌后缘，深层为头夹肌；有耳后动、静脉及枕动、静脉分支；布有颈皮神经，正当耳大神经丛的发出部及枕小神经。\", \"zhi\": \"①耳鸣，耳聋，咽喉肿痛，暴喑；②颈项强痛。\", \"cao\": \"直刺0．5～l寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%A9%E7%AA%97-1-L.gif\" },\n  { \"name\": \"天容\", \"wei\": \"在下颌角的后方，胸锁乳突肌的前缘凹陷中。\", \"jie\": \"在下颌角后方，胸锁乳突肌停止部前缘，二腹肌后腹的下缘；前方有颈外浅静脉、颈内动、静脉；布有耳大神经的前支，面神经的颈支、副神经，其深层为交感神经于的颈上神经节。\", \"zhi\": \"①耳鸣，耳聋，咽喉肿痛；②头痛，颈项强痛。\", \"cao\": \"直刺0．5～l寸。注意避开血管。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%A9%E5%AE%B9-1-L.gif\" },\n  { \"name\": \"颧髎\", \"wei\": \"目外眦直下，颧骨下缘凹陷处。\", \"jie\": \"在颧骨下颌突的后下缘稍后，咬肌的起始部，颧肌中；有面横动、静分支；布有面神经及眶下神经。\", \"zhi\": \"口眼歪斜，眼睑目闰 动，齿痛，三叉神经痛。\", \"cao\": \"直刺0．3～0．5寸，斜刺或平刺0．5～l寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%A2%A7%E9%AB%8E-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"听宫\", \"wei\": \"\", \"jie\": \"耳屏前，下颌骨髁状突的后方，张口时呈凹陷处。\", \"zhi\": \"①耳鸣，耳聋，聤耳等诸耳疾；②齿痛。\", \"cao\": \"张口，直刺 l～1．5寸。 留针时应保持一定的张口姿势。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%90%AC%E5%AE%AB-1-L.gif\" }] },\n\n{\n  \"name\": \"足太阳膀胱经\",\n  \"num\": 67,\n  \"content\": [\n  { \"name\": \"睛明\", \"wei\": \"目内眦角稍上方凹陷处。\", \"jie\": \"在眶内缘睑内侧韧带中，深部为眼内直肌；有内眦动、静脉和滑车上下动、静脉，深层上方有眼动、静脉本干；布有滑车上、下神经，深层为眼神经，上方为鼻睫神经。\", \"zhi\": \"①目赤肿痛，流泪，视物不明，目眩，近视，夜盲，色盲等目疾；②急性腰扭伤，坐骨神经痛；③心动过速。\", \"cao\": \" 嘱患者闭目，医者左手轻推眼球向外侧固定，左手缓慢进针，紧靠眶缘直刺0．5～l寸。遇到阻力时，不宜强行进针，应改变进针方向或退针。不捻转，不提插（或只轻微地捻转和提插）。 出针后按压针孔片刻，以防出血。针具宜细，消毒宜严。禁灸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%9D%9B%E6%98%8E-1-L.gif\" },\n  { \"name\": \"攒竹\", \"wei\": \"眉头凹陷中，约在目内眦直上。\", \"jie\": \"有额肌及皱眉肌；当额动、静脉处；布有额神经内侧支。\", \"zhi\": \"①头痛，眉棱骨痛；②眼睑目闰 动，眼睑下垂，口眼歪斜，目视不明，流泪，目赤肿痛；③呃逆。\", \"cao\": \"可向眉中或向眼眶内缘平刺或斜刺0．5～0．8寸。禁灸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%94%92%E7%AB%B9-1-L.gif\" },\n  { \"name\": \"眉冲\", \"wei\": \"攒竹穴直上，入发际0.5寸。\", \"jie\": \" 有额肌；当额动、静脉处；布有额神经内侧支。\", \"zhi\": \"①头痛，目眩；②鼻塞，鼻衄。\", \"cao\": \"平刺0．3～0．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%9C%89%E5%86%B2-1-L.gif\" },\n  { \"name\": \"曲差\", \"wei\": \"前发际正中直上0.5寸（神庭穴），旁开1.5寸，即神庭与头维连线的内1/3与中1/3交点。\", \"jie\": \"有额肌；当额动、静脉处；布有额神经内侧支。\", \"zhi\": \"①头痛，目眩；②鼻塞，鼻衄。\", \"cao\": \" 平刺0．5～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%9B%B2%E5%B7%AE-1-L.gif\" },\n  { \"name\": \"五处\", \"wei\": \"发际正中直上1寸，旁开1.5寸，即曲差穴上0.5寸。\", \"jie\": \"有额肌；当额动、静脉处；布有额神经内侧支。\", \"zhi\": \"①头痛，目眩；②癫痫。\", \"cao\": \"平刺0．5～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%BA%94%E5%A4%84-1-L.gif\" },\n  { \"name\": \"承光\", \"wei\": \"前发际正中直上2.5寸，旁开1.5寸，即五处穴后1.5寸。\", \"jie\": \"有帽状腱膜；有额动、静脉，颞浅动、静脉及枕动、静脉的吻合网；当额神经外侧支和枕大神经会合支处。\", \"zhi\": \"①头痛，目眩；②鼻塞；③热病。\", \"cao\": \"平刺0．3～0．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%89%BF%E5%85%89-1-L.gif\" },\n  { \"name\": \"通天\", \"wei\": \"前发际正中直上4寸，旁开1.5寸，即承光穴后1.5寸。\", \"jie\": \"有帽状腱膜；有颞浅动、静脉和枕动、 静脉的吻合网；布有枕大神经分支。\", \"zhi\": \"①头痛，眩晕；②鼻塞，鼻衄，鼻渊。\", \"cao\": \" 平刺0．3～0．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%80%9A%E5%A4%A9-1-L.gif\" },\n  { \"name\": \"络却\", \"wei\": \"前发际正中直上5.5寸，旁开1.5寸，即通天穴后1.5寸。\", \"jie\": \"在枕肌停止处；有枕动、静脉分支；布有枕大 神经分支。\", \"zhi\": \"头晕，目视不明，耳鸣。\", \"cao\": \"平刺0．3～0．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%BB%9C%E5%8D%B4-1-L.gif\" },\n  { \"name\": \"玉枕\", \"wei\": \"后发际正中直上2.5寸，旁开1.3寸，约平枕外粗隆上缘的凹陷处。\", \"jie\": \" 有枕肌；有枕动、静脉；布有枕大神经分支。\", \"zhi\": \"①头项痛，目痛；②鼻塞。\", \"cao\": \"平刺0．3～0．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%8E%89%E6%9E%95-1-L.gif\" },\n  { \"name\": \"天柱\", \"wei\": \"后发际正中直上0.5寸（哑门穴），旁开1.3寸，当斜方肌外缘凹陷中。\", \"jie\": \"在斜方肌起部，深层为头半棘肌：有枕动、静脉干；布有枕大神经干。\", \"zhi\": \" ①后头痛，项强，肩背腰痛；②鼻塞；③癫狂痫，热病。\", \"cao\": \"直刺或斜刺0．5～0．8寸，不可向内上方深刺，以免伤及延髓。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%A9%E6%9F%B1-1-L.gif\" },\n  { \"name\": \"大杼\", \"wei\": \"第１胸椎棘突下，旁开1.5寸。\", \"jie\": \"有斜方肌，菱形肌，上后锯肌，最深层为最长肌；有第1肋间动、静脉后支布有第1胸神经后支的皮支，深层为第1胸神经后支外侧支。\", \"zhi\": \"①咳嗽；②项强，肩背痛。\", \"cao\": \"斜刺0．5～0．8寸。本经背部诸穴，不宜深刺， 以免伤及内部重要脏器。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%A7%E6%9D%BC-1-L.gif\" },\n  { \"name\": \"风门\", \"wei\": \"第2胸椎棘突下，旁开1.5寸。\", \"jie\": \"有斜方肌，菱形肌，上后锯肌，深层为最肌；有第2肋间动、静脉后支；布有2、3胸神经后支的皮支，深层为第3胸神经后支外侧支。\", \"zhi\": \"①感冒，咳嗽，发热，头痛；②项强，胸背痛。\", \"cao\": \"斜刺0．5～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%A3%8E%E9%97%A8-1-L.gif\" },\n  { \"name\": \"肺俞\", \"wei\": \"第3胸椎棘突下，旁开1.5寸。\", \"jie\": \"有斜方肌、菱形肌，深层为最长肌；有第3肋间动、静脉后支；布有第3或第4胸神经后支的皮支，深层为第3胸神经后支外侧支。\", \"zhi\": \"①咳嗽，气喘，咯血等肺疾；②骨蒸潮热，盗汗。\", \"cao\": \"斜刺0．5～0．8寸\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%82%BA%E4%BF%9E-1-L.gif\" },\n  { \"name\": \"厥阴俞\", \"wei\": \" 第4胸椎棘突下，旁开1.5寸。\", \"jie\": \" 有斜方肌、菱形肌，深层为最长肌；布有第4肋间动、静脉后支；正当第4或第5胸神经后支的皮支，深层为第4胸神经后支外侧支。\", \"zhi\": \"①心痛，心悸；②咳嗽，胸闷；③呕吐。\", \"cao\": \"斜刺0．5～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%8E%A5%E9%98%B4%E4%BF%9E-1-L.gif\" },\n  { \"name\": \"心俞\", \"wei\": \"第5胸椎棘突下，旁开1.5寸。\", \"jie\": \"有斜方肌，菱形肌，深层为最长肌；有第5肋间动、静脉后支；布有第5或第6胸神经后支的皮支，深层为第5胸神经后支外侧支。\", \"zhi\": \"①心痛，惊悸，失眠，健忘，癫痫，盗汗等心与神志病变；②咳嗽，吐血。\", \"cao\": \"斜刺0．5～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%BF%83%E4%BF%9E-1-L.gif\" },\n  { \"name\": \"督俞\", \"wei\": \"第6胸椎棘突下，旁开1.5寸。\", \"jie\": \"有斜方肌，背阔肌肌腱，最长肌；有第6肋间动、静脉后支，颈横动脉降支；布有肩胛背神经，第6或第7胸神经后支的皮支，深层为第6胸神经后支外侧支。\", \"zhi\": \"①心痛，胸闷；②寒热、气喘。\", \"cao\": \"斜刺0．5～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%9D%A3%E4%BF%9E-1-L.gif\" },\n  { \"name\": \"膈俞\", \"wei\": \"第7胸椎棘突下，旁开1.5寸。\", \"jie\": \"在斜方肌下缘，有背阔肌，最长肌；布有第7肋间动、静脉后支；布有第7或第8胸神经后支的皮支，深层为第7胸神经后支外侧支。\", \"zhi\": \"①呕吐，呃逆，气喘，吐血等上逆之症；②贫血；③瘾疹，皮肤瘙痒；④潮热，盗汗。\", \"cao\": \"斜刺0．5～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%86%88%E4%BF%9E-1-L.gif\" },\n  { \"name\": \"肝俞\", \"wei\": \"第9胸椎棘突下，旁开1.5寸。\", \"jie\": \"在背阔肌，最长肌和髂肋肌之间；有第9肋间动、静脉后支；布有第9或第10胸神经后支的皮支，深层为第9胸神经后支外侧支。\", \"zhi\": \"①肝疾，胁痛，目疾；②癫狂痫；③脊背痛。\", \"cao\": \"斜刺0．5～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%82%9D%E4%BF%9E-1-L.gif\" },\n  { \"name\": \"胆俞\", \"wei\": \"第10胸椎棘突下，旁开1.5寸。\", \"jie\": \"在背阔肌，最长肌和腱肋肌之间；有第10肋间动、静脉后支；布有第10胸神经后支的皮支，深层为第10胸神经后支的外侧支。\", \"zhi\": \"①黄疸，口苦，胁痛等肝胆疾患；②肺痨，潮热。\", \"cao\": \" 斜刺0．5～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%83%86%E4%BF%9E-1-L.gif\" },\n  { \"name\": \"脾俞\", \"wei\": \"第11胸椎棘突下，旁开1.5寸。\", \"jie\": \"在背阔肌，最长肌和髂肋肌之间；有第11肋间动、静脉后支；布有第11胸神经后支的皮支，深层为第11胸神经后支肌支。\", \"zhi\": \" ①腹胀，纳呆，呕吐，腹泻，痢疾，便血，水肿等脾胃疾患；②背痛。\", \"cao\": \"斜刺0．5～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%84%BE%E4%BF%9E-1-L.gif\" },\n  { \"name\": \"胃俞\", \"wei\": \"第12胸椎棘突下，旁开1.5寸。\", \"jie\": \"在腰背筋膜，最长肌和髂肋肌之间；有肋下动、静脉后支；布有第12胸神经后支的皮支，深层为第12胸神经后支外侧支。\", \"zhi\": \"胃脘痛，呕吐，腹胀，肠鸣等胃疾。\", \"cao\": \"斜刺0．5～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%83%83%E4%BF%9E-1-L.gif\" },\n  { \"name\": \"三焦俞\", \"wei\": \"第1腰椎棘突下，旁开1.5寸。\", \"jie\": \"在腰背筋膜，最长肌和髂肋肌之间；有第1腰动、静脉后支；布有第12神经后支的皮支，深层为第1腰神经后支外侧支。\", \"zhi\": \"①肠鸣，腹胀，呕吐，腹泻，痢疾，水肿等脾胃疾患；②腰背强痛。\", \"cao\": \"直刺0．5～l寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%B8%89%E7%84%A6%E4%BF%9E-1-L.gif\" },\n  { \"name\": \"肾俞\", \"wei\": \"第2腰椎棘突下，旁开1.5寸。\", \"jie\": \"在腰背筋膜，最长肌和髂肋肌之间：有第2腰动、静脉后支；布有第1腰神经后支的外侧支，深层为第1腰丛。\", \"zhi\": \"①腰痛；②遗尿，遗精，阳萎，月经不调，带下等生殖泌尿系疾患。③耳鸣，耳聋。\", \"cao\": \" 直刺0．5～l寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%82%BE%E4%BF%9E-1-L.gif\" },\n  { \"name\": \"气海俞\", \"wei\": \"第3腰椎棘突下，旁开1.5寸。\", \"jie\": \"在腰背筋膜，最长肌和髂肋肌之间；有第2腰动、静脉后支；布有第2腰神经后支的外侧支，深层为第1腰丛。\", \"zhi\": \"①肠鸣腹胀；②痛经，腰痛。\", \"cao\": \"直刺0．5～1寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%B0%94%E6%B5%B7%E4%BF%9E-1-L.gif\" },\n  { \"name\": \"大肠俞\", \"wei\": \"第4腰椎棘突下，旁开1.5寸。\", \"jie\": \"在腰背筋膜，最长肌和髂肋肌之间；有第4腰动、静脉后支；布有第3腰神经皮支，深层为腰丛。\", \"zhi\": \"①腰腿痛；②腹胀，腹泻，便秘。\", \"cao\": \"直刺0.8～1.2寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%A7%E8%82%A0%E4%BF%9E-1-L.gif\" },\n  { \"name\": \"关元俞\", \"wei\": \"第5腰椎棘突下，旁开1.5寸。\", \"jie\": \"有骶棘肌，有腰最下动、静脉后支的内侧支；布有第5腰神经后支。\", \"zhi\": \"①腹胀、腹泻；②腰骶痛；③小便频数或不利，遗尿。\", \"cao\": \"直刺0.8～l.2寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%85%B3%E5%85%83%E4%BF%9E-1-L.gif\" },\n  { \"name\": \"小肠俞\", \"wei\": \"第1骶椎棘突下，旁开1.5寸，约平第1骶后孔。\", \"jie\": \"在骶髂肌起始部和臀大肌起始部之间；有骶外侧动、静脉后支的外侧支；布有第1骶神经后支外侧支，第5腰神经后支。\", \"zhi\": \"①遗精，遗尿，尿血，尿痛，带下；②腹泻，痢疾，疝气；③腰骶痛。\", \"cao\": \"直刺或斜刺0.8～1寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%B0%8F%E8%82%A0%E4%BF%9E-1-L.gif\" },\n  { \"name\": \"膀胱俞\", \"wei\": \"第2骶椎棘突下，旁开1.5寸，约平第2骶后孔。\", \"jie\": \"在骶棘肌起部和臀大肌起部之间；有骶外侧动、静脉后支；布有臀中皮神经分支。\", \"zhi\": \"①小便不利，遗尿；②腰骶痛；③腹泻，便秘。\", \"cao\": \"直刺或斜刺0.8～l.2寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%86%80%E8%83%B1%E4%BF%9E-1-L.gif\" },\n  { \"name\": \"中膂俞\", \"wei\": \"第3骶椎棘突下，旁开1.5寸，约平第3骶后孔。\", \"jie\": \"有臀大肌，深层为骶结节韧带起始部；当臀下动、静脉的分支处，布有臀下皮神经。\", \"zhi\": \"①腹泻，疝气；②腰骶痛。\", \"cao\": \"直刺 l～1．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%B8%AD%E8%86%82%E4%BF%9E-1-L.gif\" },\n  { \"name\": \"白环俞\", \"wei\": \"第4骶椎棘突下，旁开1.5寸，约平第4骶后孔。\", \"jie\": \"在臀大肌，骶结节韧带下内缘；有臀下动、静脉，深层为阴部内动、静脉；布有皮神经，深层为阴部神经。\", \"zhi\": \"①遗尿，遗精，月经不调，带下，疝气；②腰骶痛。\", \"cao\": \"直刺 1～1．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%99%BD%E7%8E%AF%E4%BF%9E-1-L.gif\" },\n  { \"name\": \"上髎\", \"wei\": \"第1骶后孔中，约当髂后上棘与后正中线之间。\", \"jie\": \"在骶棘肌起始部及臀大肌起始部；当额外侧动、静脉后支处；布有第1髂神经后支。\", \"zhi\": \"①大小便不利，月经不调，带下，阴挺，遗精，阳萎；②腰骶痛。\", \"cao\": \"直刺 l～1．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%B8%8A%E9%AB%8E-1-L.gif\" },\n  { \"name\": \"次髎\", \"wei\": \"第2骶后孔中，约当髂后上棘下与后正中线之间。\", \"jie\": \"在臀大肌起始部；当骶外侧动、静脉后支处；为第2骶神经后支通过处。\", \"zhi\": \"①月经不调，痛经，带下等妇科疾患；②小便不利，遗精，疝气；③腰骶痛，下肢痿痹。\", \"cao\": \" 直刺 l～1．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%AC%A1%E9%AB%8E-1-L.gif\" },\n  { \"name\": \"中髎\", \"wei\": \"第3骶后孔中，次髎穴下内方，约当中膂俞与后正中线之间。\", \"jie\": \"在臀大肌起始部；当骶外侧动、静脉后支处；为第3骶神经后支通过处。\", \"zhi\": \"①便秘，腹泻；②小便不利，月经不调，带下；③腰骶痛。\", \"cao\": \" 直刺 l～1．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%B8%AD%E9%AB%8E-1-L.gif\" },\n  { \"name\": \"下髎\", \"wei\": \"第4骶后孔中，中髎穴下内方，约当白环俞与后正中线之间。\", \"jie\": \"在臀大肌起始部；有臀下动、静脉分支；当第4骶神经后支通过处。\", \"zhi\": \"①腹痛，便秘；②小便不利，带下；③腰骶痛。\", \"cao\": \" 直刺 l～1．5寸。\", \"img\": \"www.tcmdoc.cn/Images_XueWei/%E4%B8%8B%E9%AB%8E-1-L.gif\" },\n  { \"name\": \"会阳\", \"wei\": \"尾骨端旁开0.5寸。\", \"jie\": \"有臀大肌；有臀下动、静脉分支；布有尾骨神经；深部有阴部神经干。\", \"zhi\": \"①痔疾，腹泻；②阳萎，带下。\", \"cao\": \"直刺 l～1．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%BC%9A%E9%98%B3-1-L.gif\" },\n  { \"name\": \"承扶\", \"wei\": \"臀横纹的中点。\", \"jie\": \"在臀大肌下缘；有坐骨神经伴行的动、静脉；布有股后皮神经，深层为坐骨神经。\", \"zhi\": \"①腰骶臀股部疼痛；②痔疾。\", \"cao\": \"直刺 l～2寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%89%BF%E6%89%B6-1-L.gif\" },\n  { \"name\": \"殷门\", \"wei\": \"承扶穴与委中穴的连线上，承扶穴下6寸。\", \"jie\": \"在半腱肌与股二头肌之间，深层为大收肌；外侧为股深动、静脉第3穿支；布有股后皮神经，深层正当坐骨神经。\", \"zhi\": \"腰痛，下肢痿痹。\", \"cao\": \"直刺 l～2寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%AE%B7%E9%97%A8-1-L.gif\" },\n  { \"name\": \"浮郄\", \"wei\": \"在腘横纹外侧端，委阳穴上１寸，股二头肌腱的内侧。\", \"jie\": \"在股二头肌键内侧；有膝上外侧动、静脉； 布有股后皮神经，正当腓总神经处。\", \"zhi\": \"①股腘部疼痛、麻木；②便秘。\", \"cao\": \"直刺 l～2寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%B5%AE%E9%83%84-1-L.gif\" },\n  { \"name\": \"委阳\", \"wei\": \"腘横纹外侧端，当股二头肌腱的内侧。\", \"jie\": \"在股二头肌键内侧；有膝上外侧动、静脉； 布有股后皮神经，正当腓总神经处。\", \"zhi\": \"①腹满，小便不利；②腰脊强痛，腿足挛痛。\", \"cao\": \" 直刺 l～1．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A7%94%E9%98%B3-1-L.gif\" },\n  { \"name\": \"委中\", \"wei\": \"腘横纹中点，当股二头肌腱与半腱肌肌腱的中间。\", \"jie\": \"在腘窝正中，有腘筋膜；皮下有股腘静脉，深层内侧为腘静脉，最深层为腘动有股后皮神经，正当胫神经处。\", \"zhi\": \"①腰背痛，下肢痿痹；②腹痛，急性吐泻；③小便不利，遗尿；④丹毒。\", \"cao\": \"直刺 l～1．5寸，或用三棱针点刺腘静脉出血。针刺不宜过快、过强、过深，以免损伤血管和神经。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A7%94%E4%B8%AD-1-L.gif\" },\n  { \"name\": \"附分\", \"wei\": \"第2胸椎棘突下，旁开3寸。\", \"jie\": \"在肩胛冈内端边缘，有斜方肌，菱形肌，深层为髂肋肌；有颈横动脉降支，当第2肋间动、静脉后支；布有第2胸神经后支。\", \"zhi\": \"颈项强痛，肩背拘急，肘臂麻木。\", \"cao\": \"斜刺0．5～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%99%84%E5%88%86-1-L.gif\" },\n  { \"name\": \"魄户\", \"wei\": \"第3胸椎棘突下，旁开3寸。\", \"jie\": \"在肩胛骨脊柱缘，有斜方肌，菱形肌，深层为髂肋肌；有第3肋间动、静脉背侧支，颈横动脉降支；布有第2、3胸神经后支。\", \"zhi\": \"①咳嗽，气喘，肺痨；②项强，肩背痛。\", \"cao\": \"斜刺0．5～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%AD%84%E6%88%B7-1-L.gif\" },\n  { \"name\": \"膏肓\", \"wei\": \"第4胸椎棘突下，旁开3寸。\", \"jie\": \"在肩胛骨脊柱缘，有斜方肌、菱形肌，深层为髂肋肌；有第4肋间动、静脉背侧支及颈横动脉降支；布有第3、4胸神经后支。\", \"zhi\": \"①咳嗽，气喘，肺痨，②肩胛痛；③虚劳诸疾。\", \"cao\": \"斜刺0．5～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%86%8F%E8%82%93-1-L.gif\" },\n  { \"name\": \"神堂\", \"wei\": \"第5胸椎棘突下，旁开3寸。\", \"jie\": \"在肩胛骨脊柱缘，有斜方肌，菱形肌，深层为髂肋肌；有第5肋间动静脉背侧支及颈横动脉降支；布有第4、5胸神经后支。\", \"zhi\": \"①咳嗽，气喘，胸闷；②脊背强痛。\", \"cao\": \"斜刺0．5～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%A5%9E%E5%A0%82-1-L.gif\" },\n  { \"name\": \"譩譆\", \"wei\": \"第6胸椎棘突下，旁开3寸。\", \"jie\": \"在斜方肌外缘，有髂肋肌；有第6肋间动、静脉背侧支；布有第5、6胸神经后支。\", \"zhi\": \" ①咳嗽，气喘；②肩背痛；③疟疾，热病。\", \"cao\": \"斜刺0．5～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%AD%A9%E8%AD%86-1-L.gif\" },\n  { \"name\": \"膈关\", \"wei\": \"第7胸椎棘突下，旁开3寸。\", \"jie\": \"有背阔肌，髂肋肌；有第7肋间动、静脉背侧支；布有第6胸神经后支。\", \"zhi\": \"①胸闷，嗳气，呕吐；②脊背强痛。\", \"cao\": \"斜刺0．5～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%86%88%E5%85%B3-1-L.gif\" },\n  { \"name\": \"魂门\", \"wei\": \"第9胸椎棘突下，旁开3寸。\", \"jie\": \"有背阔肌，髂肋肌；有第9肋间动、静脉背侧支；布有第8、9胸神经后支。\", \"zhi\": \"①胸胁痛，背痛；②呕吐，腹泻。\", \"cao\": \"斜刺0．5～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%AD%82%E9%97%A8-1-L.gif\" },\n  { \"name\": \"阳纲\", \"wei\": \"第10胸椎棘突下，旁开3寸。\", \"jie\": \"有背阔肌，髂肋肌；有第10肋间动、静脉背侧支；布有第9、10胸神经后支。\", \"zhi\": \"肠鸣，腹痛，腹泻，黄疸，消渴。\", \"cao\": \"斜刺0．5～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%98%B3%E7%BA%B2-1-L.gif\" },\n  { \"name\": \"意舍\", \"wei\": \"第11胸椎棘突下，旁开3寸。\", \"jie\": \"有背阔肌，髂肋肌；有第11肋间动、静脉背侧支；布有第10、11胸神经后支。\", \"zhi\": \"腹胀、肠鸣、呕吐、腹泻。\", \"cao\": \"斜刺0．5～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%84%8F%E8%88%8D-1-L.gif\" },\n  { \"name\": \"胃仓\", \"wei\": \"第12胸椎棘突下，旁开3寸。\", \"jie\": \"有背阔肌，髂肋肌；有肋下动、静脉背侧支；布有第12、13胸神经后支。\", \"zhi\": \"①胃脘痛，腹胀，小儿食积，水肿；②背脊痛。\", \"cao\": \"斜刺0．5～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%83%83%E4%BB%93-1-L.gif\" },\n  { \"name\": \"肓门\", \"wei\": \"第1腰椎棘突下，旁开3寸。\", \"jie\": \"有背阔肌，髂肋肌；有第1腰动、静脉背侧支；布有第12胸神经后支。\", \"zhi\": \"①腹痛，痞块，便秘；②乳疾。\", \"cao\": \"斜刺0．5～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%82%93%E9%97%A8-1-L.gif\" },\n  { \"name\": \"志室\", \"wei\": \"第2腰椎棘突下，旁开3寸。\", \"jie\": \"有背阔肌、髂肋肌；有第2腰动、静脉背侧支；布有第12胸神经后支外侧支，第1腰神经外侧支。\", \"zhi\": \"①遗精，阳萎，小便不利；②腰脊强痛。\", \"cao\": \" 斜刺0．5～0．8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%BF%97%E5%AE%A4-1-L.gif\" },\n  { \"name\": \"胞肓\", \"wei\": \"第2骶椎棘突下，旁开3寸。\", \"jie\": \"有臀大肌，臀中肌及臀小肌；正当臀上动、静脉；布有臀上皮神经，深层为臀上神经。\", \"zhi\": \"①肠鸣，腹胀，便秘；②癃闭；③腰脊强痛。\", \"cao\": \"直刺 l～1．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%83%9E%E8%82%93-1-L.gif\" },\n  { \"name\": \"秩边\", \"wei\": \"第4骶椎棘突下，旁开3寸。\", \"jie\": \" 有臀大肌，在梨状肌下缘；正当臀下动、静脉深层当臀下神经及股后皮神经，外侧为坐骨神经。\", \"zhi\": \"①腰骶痛，下肢痿痹；②小便不利，便秘，痔疾。\", \"cao\": \"直刺1．5～2寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%A7%A9%E8%BE%B9-1-L.gif\" },\n  { \"name\": \"合阳\", \"wei\": \"委中穴直下2寸。\", \"jie\": \"在腓肠肌二头之间；有小隐静脉，深层为腓动、静脉；布有腓肠肌内侧皮神经，深层为腓神经。\", \"zhi\": \"①腰脊强痛，下肢痿痹；②疝气，崩漏。\", \"cao\": \" 直刺 l～2寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%90%88%E9%98%B3-1-L.gif\" },\n  { \"name\": \"承筋\", \"wei\": \"合阳穴与承山穴连线的中点，腓肠肌肌腹中央。\", \"jie\": \"在腓肠肌两肌腹之间；有小隐静脉，深层为腓后动、静脉；布有腓肠内侧皮神经，深层为腓神经。\", \"zhi\": \"①腰腿拘急、疼痛；②痔疾。\", \"cao\": \"直刺 l～1．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%89%BF%E7%AD%8B-1-L.gif\" },\n  { \"name\": \"承山\", \"wei\": \"腓肠肌两肌腹之间凹陷的顶端处，约在委中穴与昆仑穴之间中点。\", \"jie\": \"在腓肠肌两肌腹交界下端；有小隐静脉，深层为股后动、静脉；布有腓肠内侧皮神经，深层为腓神经。\", \"zhi\": \"①腰腿拘急、疼痛；②痔疾，便秘。\", \"cao\": \"直刺1～2寸。 不宜作过强的刺激，以免引起腓肠肌痉挛。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%89%BF%E5%B1%B1-1-L.gif\" },\n  { \"name\": \"飞扬\", \"wei\": \"昆仑穴直上7寸，承山穴外下方1寸处。\", \"jie\": \"有腓肠肌及比目鱼肌；布有腓肠外侧皮神经。\", \"zhi\": \"①头痛，目眩；②腰腿疼痛；③痔疾。\", \"cao\": \" 直刺 l～1．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%A3%9E%E6%89%AC-1-L.gif\" },\n  { \"name\": \"跗阳\", \"wei\": \"昆仑穴直上3寸。\", \"jie\": \" 在腓骨的后部，跟腱外前缘，深层为拇长屈肌；有小隐静脉，深层为腓动脉末支；布有腓肠神经。\", \"zhi\": \"①腰骶痛，下肢痿痹，外踝肿痛；②头痛。\", \"cao\": \"直刺0．8～1．2寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%B7%97%E9%98%B3-1-L.gif\" },\n  { \"name\": \"昆仑\", \"wei\": \"外踝尖与跟腱之间的凹陷处。\", \"jie\": \"有腓骨短肌；有小隐静脉及外踝后动、静脉；布有腓肠神经。\", \"zhi\": \"①后头痛，项强，腰骶疼痛，足踝肿痛；②癫痫；③滞产。\", \"cao\": \"直刺0．5～0．8寸。 孕妇禁用，经期慎用。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%98%86%E4%BB%91-1-L.gif\" },\n  { \"name\": \"仆参\", \"wei\": \"昆仑穴直下，跟骨外侧，赤白肉际处。\", \"jie\": \"有腓动、静脉的跟骨外侧支；布有腓肠神 经跟骨外侧支。\", \"zhi\": \"①下肢痿痹，足跟痛；②癫痫。\", \"cao\": \"直刺0．3～0. 5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%BB%86%E5%8F%82-1-L.gif\" },\n  { \"name\": \"申脉\", \"wei\": \"外踝直下方凹陷中。\", \"jie\": \"在腓骨长短肌腱上缘；有外踝动脉网及小隐静脉；布有腓肠神经的足背外侧皮神经分支。\", \"zhi\": \"①头痛，眩晕；②癫狂痫，失眠；③腰腿酸痛。\", \"cao\": \"直刺0．3～0．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%94%B3%E8%84%89-1-L.gif\" },\n  { \"name\": \"金门\", \"wei\": \"申脉穴前下方，骰骨外侧凹陷中。\", \"jie\": \"在腓骨长肌腱和小趾外展肌之间；有足底外侧动、静脉；布有足背外侧皮神经，深层为足底外侧神经。\", \"zhi\": \"①头痛，腰痛，下肢痿痹，外踝痛；②癫痫，小儿惊风。\", \"cao\": \" 直刺0．3～0．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%87%91%E9%97%A8-1-L.gif\" },\n  { \"name\": \"京骨\", \"wei\": \"第5跖骨粗隆下方，赤白肉际处。\", \"jie\": \"在小趾外展肌下方；有足底外侧动、静脉； 布有足背外侧皮神经，深层为足底外侧神经。\", \"zhi\": \"①头痛，项强，腰痛；②癫痫。\", \"cao\": \"直刺0．3～0．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%BA%AC%E9%AA%A8-1-L.gif\" },\n  { \"name\": \"束骨\", \"wei\": \"第5跖骨小头的后缘，赤白肉际处。\", \"jie\": \"在小趾外展肌下方；有第4趾跖侧总动、 静脉；有第4趾跖侧神经及足背外侧皮神经分布。\", \"zhi\": \"①头痛，项强，目眩，腰腿痛；②癫狂。\", \"cao\": \"直刺0．3～0．5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%9D%9F%E9%AA%A8-1-L.gif\" },\n  { \"name\": \"足通谷\", \"wei\": \"第5跖趾关节的前方，赤白肉际处。\", \"jie\": \"有趾跖侧动、静脉；布有趾跖侧固有神经及足背外侧皮神经。\", \"zhi\": \"①头痛，项强，鼻衄；②癫狂。\", \"cao\": \" 直刺0．2～0．3寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%B6%B3%E9%80%9A%E8%B0%B7-1-L.gif\" },\n  { \"name\": \"至阴\", \"wei\": \"足小趾外侧趾甲角旁0.1寸。\", \"jie\": \"有趾背动脉及趾跖侧固有动脉形成的动脉网；布有趾跖侧固有神经及足背外侧皮神经。\", \"zhi\": \"①胎位不正，滞产；②头痛，目痛，鼻塞，鼻衄。\", \"cao\": \"浅刺0．1寸。 胎位不正用灸法。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%87%B3%E9%98%B4-1-L.gif\" }] },\n\n{\n  \"name\": \"足少阴肾经\",\n  \"num\": 27,\n  \"content\": [\n  { \"name\": \"涌泉\", \"wei\": \"足趾跖屈时，约当足底（去趾）前1／3凹陷处。\", \"jie\": \"有趾短屈肌腱，趾长屈肌腱，第二蚓状肌，深层为骨间肌；有来自胫前动脉的足底弓；布有足底内侧神经支。\", \"zhi\": \"①昏厥，中暑，癫狂痫，小儿惊风；②头痛，头晕，目眩，失眠；③咳血，咽喉肿痛，喉痹；④大便难，小便不利；⑤奔豚气；⑥足心热。急救要穴之一。\", \"cao\": \"直刺0.5～0.8寸。降邪宜用灸法或药物贴敷。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%B6%8C%E6%B3%89-1-L.gif\" },\n  { \"name\": \"然谷\", \"wei\": \"内踝前下方，足舟骨粗隆下缘凹陷中。\", \"jie\": \"有足大趾外展肌，有跖内侧动脉及跗内侧动脉分支；布有小腿内侧皮神经末支及足底内侧神经。\", \"zhi\": \"①月经不调，阴挺，阴痒，白浊；②遗精，阳痿；③消渴，腹泻，小便不利；④咳血，咽喉肿痛；⑤小儿脐风，口噤。\", \"cao\": \"直刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%84%B6%E8%B0%B7-1-L.gif\" },\n  { \"name\": \"太溪\", \"wei\": \"内踝高点与跟腱后缘连线的中点凹陷处。\", \"jie\": \"有胫后动、静脉；布有小腿内侧皮神经，当胫神经经过处。\", \"zhi\": \"①头痛，目眩，失眠，健忘，咽喉肿痛，齿痛，耳鸣，耳聋；②咳嗽，气喘，咳血，胸痛：③消渴，小便频数，便秘；④月经不调，遗精，阳痿；⑤腰脊痛，下肢厥冷。\", \"cao\": \"直刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%AA%E6%BA%AA-1-L.gif\" },\n  { \"name\": \"大钟\", \"wei\": \"太溪穴下0.5寸，当跟骨内侧前缘。\", \"jie\": \"有胫后动脉跟内侧支；布有小腿内侧皮神经及胫神经的跟骨内侧神经。\", \"zhi\": \"①痴呆；②癃闭，遗尿，便秘；③月经不调；④咳血，气喘；⑤腰脊强痛，足跟痛。\", \"cao\": \"直刺0.3～0.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%A7%E9%92%9F-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"水泉\", \"wei\": \"太溪穴直下1寸，当跟骨结节内侧上缘。\", \"jie\": \"有胫后动脉跟内侧支；布有小腿内侧皮神经及胫神经的跟骨内侧神经。\", \"zhi\": \"①月经不调，痛经，经闭，阴挺；②小便不利。\", \"cao\": \"直刺0.3～0.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%B0%B4%E6%B3%89-1-L.gif\" },\n  { \"name\": \"照海\", \"wei\": \"内踝高点正下缘凹陷处。\", \"jie\": \"在足大趾外展肌的止点处；后方有胫后动、静脉；布有小腿内侧皮神经，深部为胫神经干。\", \"zhi\": \"①失眠，癫痫；②咽喉干痛，目赤肿痛；③月经不调，带下，阴挺，小便频数，癃闭。\", \"cao\": \"直刺0.5 ～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%85%A7%E6%B5%B7-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"复溜\", \"wei\": \"太溪穴上2寸，当跟腱的前缘。\", \"jie\": \"在比目鱼肌下端移行于跟腱处的内侧；前方有胫后动、静脉；布有腓肠内侧皮神经，小腿内侧皮神经，深层为胫神经。\", \"zhi\": \"①水肿，汗证；②腹胀，腹泻；③腰脊强痛，下肢痿痹。\", \"cao\": \"直刺0.5 ～1寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%8D%E6%BA%9C-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"交信\", \"wei\": \"太溪穴上2寸，胫骨内侧面后缘，约当复溜穴前0.5寸。\", \"jie\": \"在趾长屈肌中；深层为胫后动、静脉；布有小腿内侧皮神经，后方为胫神经本干。\", \"zhi\": \"①月经不调，崩漏，阴挺，阴痒，疝气，五淋；②腹泻，便秘，痢疾。\", \"cao\": \"直刺0.8 ～1.2寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%BA%A4%E4%BF%A1-1-L.gif\" },\n  { \"name\": \"筑宾\", \"wei\": \"太溪穴与阴谷穴的连线上，太溪穴直上5寸，约当腓肠肌内侧肌腹下缘处。\", \"jie\": \"在腓肠肌和趾长屈肌之间；深部有胫后动、静脉；布有腓肠内侧皮神经和小腿内侧皮神经，深部为胫神经干。\", \"zhi\": \"①癫狂；②疝气；③呕吐涎沫，吐舌；④小腿内侧痛。\", \"cao\": \"直刺1～1.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%AD%91%E5%AE%BE-1-L.gif\" },\n  { \"name\": \"阴谷\", \"wei\": \"屈膝，腘窝内侧，当半腱肌腱与半膜肌腱之间。\", \"jie\": \"在半腱肌和半膜肌之间；有膝上内侧动、静脉；布有股内侧皮神经。\", \"zhi\": \"①癫狂；②阳痿，月经不调，崩漏，小便不利；③膝股内侧痛。\", \"cao\": \"直刺1～1.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%98%B4%E8%B0%B7-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"横骨\", \"wei\": \"脐下5寸，耻骨联合上际，前正中线旁开0.5寸。\", \"jie\": \"有腹内、外斜肌腱膜，腹横肌腱膜和腹直肌；有腹壁下动、静脉及阴部外动脉；布有髂腹下神经分支。\", \"zhi\": \"①少腹胀痛；②小便不利，遗尿，遗精，阳痿；③疝气。\", \"cao\": \"直刺1～1.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%A8%AA%E9%AA%A8-1-L.gif\" },\n  { \"name\": \"大赫\", \"wei\": \"脐下4寸，前正中线旁开0.5寸。\", \"jie\": \"有腹内、外斜肌腱膜，腹横肌腱膜和腹直肌；有腹壁下动、静脉肌支；布有第十二肋间神经及髂腹下神经。\", \"zhi\": \"遗精，阳痿，阴挺，带下。\", \"cao\": \"直刺1～1.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%A7%E8%B5%AB-1-L.gif\" },\n  { \"name\": \"气穴\", \"wei\": \"脐下3寸，前正中线旁开0.5寸。\", \"jie\": \"在腹内、外斜肌腱膜，腹横肌腱膜和腹直肌中；有腹壁下动、静脉肌支；布有第十二肋间神经及髂腹下神经。\", \"zhi\": \"①奔豚气；②月经不调，带下；③小便不利；④腹泻。\", \"cao\": \"直刺1～1.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%B0%94%E7%A9%B4-1-L.gif\" },\n  { \"name\": \"四满\", \"wei\": \"脐下2寸，前正中线旁开0.5寸。\", \"jie\": \"肌肉、血管同大赫，布有第十一肋间神经。\", \"zhi\": \"①月经不调，崩漏，带下，产后恶露不净；②遗精，小腹痛；③脐下积、聚、疝、瘕，水肿。\", \"cao\": \"直刺1～1.5寸。利水多用灸法。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%9B%9B%E6%BB%A1-1-L.gif\" },\n  { \"name\": \"中注\", \"wei\": \"脐下1寸，前正中线旁开0.5寸。\", \"jie\": \"肌肉、血管同大赫，布有第十肋间神经。\", \"zhi\": \"月经不调，腹痛，便秘，腹泻。\", \"cao\": \"直刺1～1.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%B8%AD%E6%B3%A8-1-L.gif\" },\n  { \"name\": \"肓俞\", \"wei\": \"脐旁0.5寸。\", \"jie\": \"肌肉、血管同大赫，布有第十肋间神经。\", \"zhi\": \"①腹痛，腹胀，腹泻，便秘；②月经不调；③疝气。\", \"cao\": \"直刺1～1.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%82%93%E4%BF%9E-1-L.gif\" },\n  { \"name\": \"商曲\", \"wei\": \"脐上2寸，前正中线旁开0.5寸。\", \"jie\": \"在腹直肌内缘，有腹壁上动、静脉分支；布有第九肋间神经。\", \"zhi\": \"胃痛，腹痛，腹胀，腹泻，便秘，腹中积聚。\", \"cao\": \"直刺1～1.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%95%86%E6%9B%B2-1-L.gif\" },\n  { \"name\": \"石关\", \"wei\": \"脐上3寸，前正中线旁开0.5寸。\", \"jie\": \"在腹直肌内缘，有腹壁上动、静脉分支；布有第九肋间神经。\", \"zhi\": \"①胃痛，呕吐，腹痛，腹胀，便秘；②不孕。\", \"cao\": \"直刺1～1.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%9F%B3%E5%85%B3-1-L.gif\" },\n  { \"name\": \"阴都\", \"wei\": \"脐上4寸，前正中线旁开0.5寸。\", \"jie\": \"在腹直肌内缘，有腹壁上动、静脉分支；布有第八肋间神经。\", \"zhi\": \"胃痛，腹胀，便秘。\", \"cao\": \"直刺1～1.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%98%B4%E9%83%BD-1-L.gif\" },\n  { \"name\": \"腹通谷\", \"wei\": \"脐上5寸，前正中线旁开0.5寸。\", \"jie\": \"在腹直肌内缘，有腹壁上动、静脉分支；布有第八肋间神经。\", \"zhi\": \"①腹痛，腹胀，胃痛，呕吐；②心痛，心悸，胸痛。\", \"cao\": \"直刺0.5～1寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%85%B9%E9%80%9A%E8%B0%B7-1-L.gif\" },\n  { \"name\": \"幽门\", \"wei\": \"脐上6寸，前正中线旁开0.5寸。\", \"jie\": \"在腹直肌内缘，有腹壁上动、静脉分支；布有第七肋间神经。\", \"zhi\": \"善哕，呕吐，腹痛，腹胀，腹泻。\", \"cao\": \"直刺0.5～1寸。不可向上深刺，以免伤及内脏。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%B9%BD%E9%97%A8-1-L.gif\" },\n  { \"name\": \"步廊\", \"wei\": \"第五肋间隙，前正中线旁开2寸。\", \"jie\": \"在胸大肌起始部，有肋间外韧带及肋间内肌；有第五肋间动、静脉；布有第五肋间神经前皮支，深部为第五肋间神经。\", \"zhi\": \"胸痛，咳嗽，气喘，乳痈。\", \"cao\": \"斜刺或平刺0.5～0.8寸，不可深刺，以免伤及心、肺。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%AD%A5%E5%BB%8A-1-L.gif\" },\n  { \"name\": \"神封\", \"wei\": \"第四肋间隙，前正中线旁开2寸。\", \"jie\": \"在胸大肌中，有肋间外韧带及肋间内肌；有第四肋间动、静脉；布有第四肋间神经前皮支，深部为第四肋间神经。\", \"zhi\": \"胸胁支满，咳嗽，气喘，乳痈。\", \"cao\": \"斜刺或平刺0.5～0.8寸，不可深刺，以免伤及心、肺。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%A5%9E%E5%B0%81-1-L.gif\" },\n  { \"name\": \"灵墟\", \"wei\": \"第三肋间隙，前正中线旁开2寸。\", \"jie\": \"在胸大肌中，有肋间外韧带及肋间内肌；有第三肋间动、静脉；布有第三肋间神经前皮支，深部为第三肋间神经。\", \"zhi\": \"胸胁支满，咳嗽，气喘，乳痈。\", \"cao\": \"斜刺或平刺0.5～0.8寸，不可深刺，以免伤及心、肺。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%81%B5%E5%A2%9F-1-L.gif\" },\n  { \"name\": \"神藏\", \"wei\": \"第二肋间隙，前正中线旁开2寸。\", \"jie\": \"在胸大肌中，有肋间外韧带及肋间内肌；有第二肋间动、静脉；布有第二肋间神经前皮支，深部为第二肋间神经。\", \"zhi\": \"胸胁支满，咳嗽，气喘，乳痈。\", \"cao\": \"斜刺或平刺0.5～0.8寸，不可深刺，以免伤及心、肺。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%A5%9E%E8%97%8F-1-L.gif\" },\n  { \"name\": \"彧中\", \"wei\": \"第一肋间隙，前正中线旁开2寸。\", \"jie\": \"在胸大肌中，有肋间外韧带及肋间内肌；有第一肋间动、静脉；布有第一肋间神经前皮支，深部为第一肋间神经，皮下有锁骨上神经前支。\", \"zhi\": \"胸胁支满，咳嗽，气喘，痰涌。\", \"cao\": \"斜刺或平刺0.5～0.8寸，不可深刺，以免伤及心、肺。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%BD%A7%E4%B8%AD-1-L.gif\" },\n  { \"name\": \"俞府\", \"wei\": \"锁骨下缘，前正中线旁开2寸。\", \"jie\": \"在胸大肌中，有胸内动、静脉的前穿支；布有锁骨上神经前支。\", \"zhi\": \"咳嗽，气喘，胸痛。\", \"cao\": \"斜刺或平刺0.5～0.8寸，不可深刺，以免伤及心、肺。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%BF%9E%E5%BA%9C-1-L.gif\" }] },\n\n{\n  \"name\": \"手厥阴心包经\",\n  \"num\": 9,\n  \"content\": [\n  { \"name\": \"天池\", \"wei\": \"乳头外侧1寸，当第四肋间隙中。\", \"jie\": \"在胸大肌外下部，胸小肌下部起端，深部为第四肋间内、外肌；有胸腹壁静脉，胸外侧动、静脉分支；布有胸前神经肌支及第四肋间神经。\", \"zhi\": \"①咳嗽，痰多，胸闷，气喘，胸痛；②乳痈；③瘰疬。\", \"cao\": \"斜刺或平刺0.3～0.5寸，不可深刺，以免伤及心、肺。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%A9%E6%B1%A0-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"天泉\", \"wei\": \"腋前纹头下2寸，肱二头肌长、短头之间。\", \"jie\": \"在肱二头肌的长短头之间；有肱动、静脉肌支；布有臂内侧皮神经及肌皮神经。\", \"zhi\": \"①心痛，咳嗽，胸胁胀满；②胸背及上臂内侧痛。\", \"cao\": \"直刺1～1.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%A9%E6%B3%89-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"曲泽\", \"wei\": \"肘微屈，肘横纹中，肱二头肌腱尺侧缘。\", \"jie\": \"在肱二头肌腱的尺侧；当肱动、静脉处；布有正中神经的主干。\", \"zhi\": \"①心痛，心悸，善惊；②胃痛，呕血，呕吐；③暑热病；④肘臂挛痛。\", \"cao\": \"直刺1～1.5寸；或点刺出血。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%9B%B2%E6%B3%BD-1-L.gif\" },\n  { \"name\": \"郄门\", \"wei\": \"腕横纹上5寸，掌长肌腱与桡侧腕屈肌腱之间。\", \"jie\": \"在桡侧腕屈肌腱与掌长肌腱之间，有指浅屈肌，深部为指深屈肌；有前臂正中动、静脉，深部为前臂掌侧骨间动、静脉；布有前臂内侧皮神经，其下为正中神经，深层有前臂掌侧骨间神经。\", \"zhi\": \"①心痛，心悸，心烦胸痛；②咳血，呕血，衄血；③疔疮；④癫痫。\", \"cao\": \"直刺0.5～1寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%83%84%E9%97%A8-1-L.gif\" },\n  { \"name\": \"间使\", \"wei\": \"腕横纹上3寸，掌长肌腱与桡侧腕屈肌腱之间\", \"jie\": \"在桡侧腕屈肌腱与掌长肌腱之间，有指浅屈肌，深部为指深屈肌；有前臂正中动、静脉，深部为前臂掌侧骨间动、静脉；布有前臂内侧皮神经，其下为正中神经，深层有前臂掌侧骨间神经。\", \"zhi\": \"①心痛，心悸；②胃痛，呕吐；③热病，疟疾；④癫狂痫。\", \"cao\": \"直刺0.5～1寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%97%B4%E4%BD%BF-1-L.gif\" },\n  { \"name\": \"内关\", \"wei\": \"腕横纹上2寸，掌长肌腱与桡侧腕屈肌腱之间。\", \"jie\": \"在桡侧腕屈肌腱与掌长肌腱之间，有指浅屈肌，深部为指深屈肌；有前臂正中动、静脉，深部为前臂掌侧骨间动、静脉；布有前臂内侧皮神经，其下为正中神经，深层有前臂掌侧骨间神经。\", \"zhi\": \"①心痛，心悸：②胃痛，呕吐，呃逆，③胁痛，胁下痞块；③中风，失眠，眩晕，郁证，癫狂痫，偏头痛；④热病；⑤肘臂挛痛。\", \"cao\": \"直刺0.5～1寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%86%85%E5%85%B3-1-L.gif\" },\n  { \"name\": \"大陵\", \"wei\": \"腕横纹中央，掌长肌腱与桡侧腕屈肌腱之间\", \"jie\": \"在掌长肌腱与桡侧腕屈肌腱之间，有拇长屈肌和指深屈肌腱；有腕掌侧动、静脉网；布有前臂内侧皮神经，正中神经掌皮支，深层为正中神经本干。\", \"zhi\": \"①心痛，心悸；②胃痛，呕吐，口臭；③胸胁满痛：④喜笑悲恐，癫狂痫；⑤臂、手挛痛。\", \"cao\": \"直刺0.3～0.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%A7%E9%99%B5-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"劳宫\", \"wei\": \"掌心横纹中，第二、三掌骨中间。简便取穴法：握拳，中指尖下是穴。\", \"jie\": \"在第二掌骨间，下为掌腱膜，第二蚓状肌及指浅、深屈肌腱，深层为拇指内收肌横头的起点，有骨间肌；有指掌侧总动脉；布有正中神经的第二指掌侧总神经。\", \"zhi\": \"①中风昏迷，中暑；②心痛，烦闷，癫狂痫；③口疮，口臭；④鹅掌风。\", \"cao\": \"直刺0.3～0.5寸。为急救要穴之一。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%8A%B3%E5%AE%AB-1-L.gif\" },\n  { \"name\": \"中冲\", \"wei\": \"中指尖端的中央。\", \"jie\": \"有指掌侧固有动静脉所形成的动、静脉网；为正中神经的指掌侧固有神经分布处。\", \"zhi\": \"①中风昏迷，舌强不语，中暑，昏厥，小儿惊风；②热病。\", \"cao\": \"浅刺0.1寸；或点刺出血。为急救要穴之一。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%B8%AD%E5%86%B2-1-L.gif\" }] },\n\n{\n  \"name\": \"手少阳三焦经\",\n  \"num\": 23,\n  \"content\": [\n  { \"name\": \"关冲\", \"wei\": \"无名指尺侧指甲根角旁0.1寸。\", \"jie\": \"有指掌侧固有动、静脉所形成的动、静脉网；布有尺神经的指掌侧固有神经。\", \"zhi\": \"①头痛，目赤，耳鸣，耳聋，喉痹，舌强；②热病，心烦。\", \"cao\": \"浅刺0.1寸；或点刺出血。为急救要穴之一。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%85%B3%E5%86%B2-1-L.gif\" },\n  { \"name\": \"液门\", \"wei\": \"第四、五掌指关节之间的前缘凹陷中。\", \"jie\": \"有来自尺动脉的指背动脉；布有来自尺神经的手背支。\", \"zhi\": \"①头痛，目赤，耳鸣，耳聋，喉痹；②疟疾；③手臂痛。\", \"cao\": \"直刺0.3～0.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%B6%B2%E9%97%A8-1-L.gif\" },\n  { \"name\": \"中渚\", \"wei\": \"手背，第四、五掌骨小头后缘之间凹陷中，当液门穴后1寸。\", \"jie\": \"有第四骨间肌；皮下有手背静脉网及第四掌背动脉；布有来自尺神经的手背支。\", \"zhi\": \"①头痛，目赤，耳鸣，耳聋，喉痹；②热病；③肩背肘臂酸痛，手指不能屈伸。\", \"cao\": \"直刺0.3～0.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%B8%AD%E6%B8%9A-1-L.gif\" },\n  { \"name\": \"阳池\", \"wei\": \"腕背横纹中，指总伸肌腱尺侧缘凹陷中。\", \"jie\": \"有皮下手背静脉网，第四掌背动脉；布有尺侧神经手背支及前臂背侧皮神经末支。\", \"zhi\": \"①目赤肿痛，耳聋，喉痹：②消渴，口干；③腕痛，肩臂痛。\", \"cao\": \"直刺0.3～0.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%98%B3%E6%B1%A0-1-L.gif\" },\n  { \"name\": \"外关\", \"wei\": \"腕背横纹上2寸，尺骨与桡骨正中间。\", \"jie\": \"在桡骨于尺骨之间，指总深肌与拇长伸肌之间；深层有前臂骨间背侧动脉和掌侧动、静脉；布有前臂背侧皮神经，深层有前臂骨间背侧神经及掌侧神经。\", \"zhi\": \"①热病：②头痛，目赤肿痛，耳鸣，耳聋：③瘰疬，胁肋痛；④上肢痿痹不遂。\", \"cao\": \"直刺0.5～1寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%96%E5%85%B3-1-L.gif\" },\n  { \"name\": \"支沟\", \"wei\": \"腕背横纹上3寸，尺骨与桡骨正中间。\", \"jie\": \"在桡骨于尺骨之间，指总深肌与拇长伸肌之间；深层有前臂骨间背侧动脉和掌侧动、静脉；布有前臂背侧皮神经，深层有前臂骨间背侧神经及掌侧神经。\", \"zhi\": \"①便秘；②耳鸣，耳聋，暴喑；③瘰疬，胁肋疼痛；④热病。\", \"cao\": \"直刺0.5～1寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%94%AF%E6%B2%9F-1-L.gif\" },\n  { \"name\": \"会宗\", \"wei\": \"支沟穴尺侧约1寸，当尺骨桡侧缘。\", \"jie\": \"在尺骨桡侧缘，在小指固有伸肌和尺侧腕伸肌之间；深层有前臂骨间背侧动、静脉；布有前臂背侧皮神经，深层有前臂骨间背侧神经及骨间掌侧神经。\", \"zhi\": \"耳聋，痫证，上肢肌肤痛。\", \"cao\": \"直刺0.5～1寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%BC%9A%E5%AE%97-1-L.gif\" },\n  { \"name\": \"三阳络\", \"wei\": \"支沟穴上1寸，尺骨与桡骨之间。\", \"jie\": \"在指总伸肌与拇长展肌起端之间；有前臂骨间背侧动、静脉；布有前臂背侧皮神经，深层有前臂骨间背侧神经。\", \"zhi\": \"耳聋，暴喑，齿痛，手臂痛。\", \"cao\": \"直刺0.5～1寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%B8%89%E9%98%B3%E7%BB%9C-1-L.gif\" },\n  { \"name\": \"四渎\", \"wei\": \"尺骨鹰嘴下5寸，尺骨与桡骨之间。\", \"jie\": \"在指总伸肌与尺侧腕伸肌之间；深层有前臂骨间背侧动、静脉；布有前臂背侧皮神经，深层有前臂骨间背侧神经。\", \"zhi\": \"耳聋，暴喑，齿痛，手臂痛。\", \"cao\": \"直刺0.5～1寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%9B%9B%E6%B8%8E-1-L.gif\" },\n  { \"name\": \"天井\", \"wei\": \"屈肘，尺骨鹰嘴上1寸凹陷中。\", \"jie\": \"在肱骨下端后面鹰嘴握中，有肱三头肌腱；有肘关节动、静脉网；布有前臂背侧皮神经和桡神经肌支。\", \"zhi\": \"①耳聋；②癫痫；③瘰疬，瘿气；④偏头痛，胁肋痛，颈项肩臂痛。\", \"cao\": \"直刺0.5～1寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%A9%E4%BA%95-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"清冷渊\", \"wei\": \"屈肘，天井穴上1寸。\", \"jie\": \"在肱三头肌下部；有中侧副动、静脉末支；布有前臂背侧皮神经和桡神经肌支。\", \"zhi\": \"头痛，目黄，肩臂痛不能举。\", \"cao\": \"直刺0.8～1.2寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%B8%85%E5%86%B7%E6%B8%8A-1-L.gif\" },\n  { \"name\": \"消泺\", \"wei\": \"肩髎穴与天井穴连线上，清冷渊穴上3寸。\", \"jie\": \"在肱三头肌肌腹之间；有中侧副动、静脉末支；布有前臂背侧皮神经和桡神经肌支。\", \"zhi\": \"头痛，赤痛，项背痛。\", \"cao\": \"直刺1～1.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%B6%88%E6%B3%BA-1-L.gif\" },\n  { \"name\": \"臑会\", \"wei\": \"肩髎穴与天井穴连线上，肩髎穴下3寸，三角肌后缘。\", \"jie\": \"在肱三头肌长头与外侧头之间；有中侧副动、静脉末支；布有前臂背侧皮神经和桡神经肌支，深层为桡神经。\", \"zhi\": \"①瘰疬；②瘿气；③上肢痹痛。\", \"cao\": \"直刺1～1.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%87%91%E4%BC%9A-1-L.gif\" },\n  { \"name\": \"肩髎\", \"wei\": \"肩峰后下方，上臂外展时，当肩髃穴后寸许凹陷中。\", \"jie\": \"在肩峰后下方，三角肌中；有旋肱后动脉肌支；布有腋神经的肌支。\", \"zhi\": \"肩臂挛痛不遂。\", \"cao\": \"直刺1～1.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%82%A9%E9%AB%8E-1-L.gif\" },\n  { \"name\": \"天髎\", \"wei\": \"肩井穴与曲垣穴连线的中点，当肩胛骨上角凹陷处。\", \"jie\": \"有斜方肌、冈上肌；有静横动脉降支，深层为肩胛上动脉肌支；布有第一胸神经后支外侧皮支，副神经，深层为肩胛上神经肌支。\", \"zhi\": \"肩臂痛，颈项强急。\", \"cao\": \"直刺0.5～1寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%A9%E9%AB%8E-1-L.gif\" },\n  { \"name\": \"天牖\", \"wei\": \"乳突后下方，胸锁乳突肌后缘，平下颌角处。\", \"jie\": \"在胸锁乳突肌止部后缘；有枕动脉肌支，耳后动、静脉及颈后浅静脉；布有枕小神经本干，深层为副神经，颈神经。\", \"zhi\": \"①头痛，头眩，项强，目不明，暴聋，鼻衄，喉痹；②瘰疬；③肩背痛。\", \"cao\": \"直刺0.5～1寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%A9%E7%89%96-1-L.gif\" },\n  { \"name\": \"翳风\", \"wei\": \"乳突前下方与耳垂之间的凹陷中。\", \"jie\": \"有耳后动、静脉，颈外浅静脉；布有耳大神经，深层为面神经干从茎乳突穿出处。\", \"zhi\": \"①耳鸣，耳聋：②口眼歪斜，牙关紧闭，颊肿；③瘰疬。\", \"cao\": \"直刺0.5～1寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%BF%B3%E9%A3%8E-1-L.gif\" },\n  { \"name\": \"瘈脉\", \"wei\": \"耳后，当翳风穴与角孙穴沿耳轮连线的下1／3与上2／3交界处。\", \"jie\": \"在耳后肌上；有耳后动、静脉；布有耳大神经耳后支。\", \"zhi\": \"①头痛，耳鸣，耳聋；③小儿惊风。\", \"cao\": \"平刺0.3～0.5寸；或点刺静脉出血。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%98%88%E8%84%89-1-L.gif\" },\n  { \"name\": \"颅息\", \"wei\": \"耳后，当翳风穴与角孙穴沿耳轮连线的上1／3与下2／3交界处。\", \"jie\": \"有耳后动、静脉；布有耳大神经和枕小神经的吻合支。\", \"zhi\": \"①头痛，耳鸣，耳聋；③小儿惊风。\", \"cao\": \"平刺0.3～0.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%A2%85%E6%81%AF-1-L.gif\" },\n  { \"name\": \"角孙\", \"wei\": \"当耳尖发际处。\", \"jie\": \"有耳上肌；颞浅动、静脉耳前支；布有耳颞神经分支。\", \"zhi\": \"①头痛，项强；②目赤肿痛，目翳；③齿痛，颊肿。\", \"cao\": \"平刺0.3～0.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%A7%92%E5%AD%99-1-L.gif\" },\n  { \"name\": \"耳门\", \"wei\": \"耳屏上切迹前，下颌骨髁状突后缘，张口有孔。\", \"jie\": \"有颞浅动、静脉耳前支；布有耳颞神经，面神经分支。\", \"zhi\": \"①耳鸣，耳聋，聤耳；②齿痛，头颔痛。\", \"cao\": \"微张口，直刺0.5～1寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%80%B3%E9%97%A8-1-L.gif\" },\n  { \"name\": \"耳和髎\", \"wei\": \"鬓发后际，平耳廓根前，当颞浅动脉后缘。\", \"jie\": \"有颞肌和颞浅动、静脉；布有耳颞神经分支，面神经颞支。\", \"zhi\": \"①头痛，耳鸣；②牙关紧闭，口歪。\", \"cao\": \"避开动脉，平刺0.3～0.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%80%B3%E5%92%8C%E9%AB%8E-1-L.gif\" },\n  { \"name\": \"丝竹空\", \"wei\": \"眉梢的凹陷处。\", \"jie\": \"有眼轮匝肌；颞浅动、静脉额支；布有面神经颧眶支及耳颞神经分支。\", \"zhi\": \"①癫痫；②头痛，眩晕，目赤肿痛，眼睑瞤动；③齿痛。\", \"cao\": \"平刺0.3～0.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%B8%9D%E7%AB%B9%E7%A9%BA-1-L.gif\" }] },\n\n{\n  \"name\": \"足少阳胆经\",\n  \"num\": 44,\n  \"content\": [\n  { \"name\": \"瞳子髎\", \"wei\": \"目外眦外侧0.5寸，眶骨外缘凹陷中。\", \"jie\": \"有眼轮匝肌，深层为颞肌；当颧眶动、静脉分布处；布有颧面神经和颧颞神经，面神经的额颞支。\", \"zhi\": \"①头痛；②目赤肿痛，羞明流泪，内障，目翳等目疾。\", \"cao\": \"平刺0.3～0.5寸。或三棱针点刺出血。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%9E%B3%E5%AD%90%E9%AB%8E-1-L.gif\" },\n  { \"name\": \"听会\", \"wei\": \"耳屏间切迹前，下颌骨髁状突后缘，张口有孔。\", \"jie\": \"有颞浅动脉耳前支，深部为颈外动脉及面后静脉；布有耳大神经，皮下为面神经。\", \"zhi\": \"①耳鸣，耳聋，聤耳；②齿痛，口眼歪斜。\", \"cao\": \"微张口，直刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%90%AC%E4%BC%9A-1-L.gif\" },\n  { \"name\": \"上关\", \"wei\": \"下关穴直上，颧弓上缘。\", \"jie\": \"在颞肌中；有颧眶动、静脉；布有面神经的颧眶支及三叉神经小分支。\", \"zhi\": \"①耳鸣，耳聋，聤耳；②齿痛，面痛，口眼歪斜，口噤。\", \"cao\": \"直刺0.3～0.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%B8%8A%E5%85%B3-1-L.gif\" },\n  { \"name\": \"颔厌\", \"wei\": \"头维穴与曲鬓穴弧形连线的上1／4与下3／4交界处。\", \"jie\": \"在颞肌中；有颞浅动、静脉额支；布有耳颞神经颞支。\", \"zhi\": \"①头痛，眩晕；②惊痫，瘈疭；③耳鸣，目外眦痛，齿痛。\", \"cao\": \"平刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%A2%94%E5%8E%8C-1-L.gif\" },\n  { \"name\": \"悬颅\", \"wei\": \"头维穴与曲鬓穴弧形连线的中点。\", \"jie\": \"在颞肌中；有颞浅动、静脉额支；布有耳颞神经颞支。\", \"zhi\": \"偏头痛，目赤肿痛，齿痛。\", \"cao\": \"平刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%82%AC%E9%A2%85-1-L.gif\" },\n  { \"name\": \"悬厘\", \"wei\": \"头维穴与曲鬓穴弧形连线的下1／4与上3／4交界处。\", \"jie\": \"在颞肌中；有颞浅动、静脉额支；布有耳颞神经颞支。\", \"zhi\": \"偏头痛，目赤肿痛，耳鸣。\", \"cao\": \"平刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%82%AC%E5%8E%98-1-L.gif\" },\n  { \"name\": \"曲鬓\", \"wei\": \"耳前鬓发后缘直上，平角孙穴。\", \"jie\": \"在颞肌中；有颞浅动、静脉额支；布有耳颞神经颞支。\", \"zhi\": \"头痛连齿，颊颔肿，口噤。\", \"cao\": \"平刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%9B%B2%E9%AC%93-1-L.gif\" },\n  { \"name\": \"率谷\", \"wei\": \"耳尖直上，入发际1.5寸。\", \"jie\": \"在颞肌中；有颞动、静脉顶支；布有耳颞神经和枕大神经会合支。\", \"zhi\": \"①头痛，眩晕；②小儿急、慢惊风。\", \"cao\": \"平刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%8E%87%E8%B0%B7-1-L.gif\" },\n  { \"name\": \"天冲\", \"wei\": \"耳根后缘直上，入发际2寸。\", \"jie\": \"有耳后动、静脉；布有耳大神经支。\", \"zhi\": \"①头痛，癫痫；②牙龈肿痛。\", \"cao\": \"平刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%A9%E5%86%B2-1-L.gif\" },\n  { \"name\": \"浮白\", \"wei\": \"耳根上缘向后入发际横量1寸。\", \"jie\": \"有耳后动、静脉；布有耳大神经分支。\", \"zhi\": \"①头痛，耳鸣，耳聋，齿痛；②瘿气。\", \"cao\": \"平刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%B5%AE%E7%99%BD-1-L.gif\" },\n  { \"name\": \"头窍阴\", \"wei\": \"乳突后上缘，当浮白穴与完骨穴的连线上。\", \"jie\": \"有耳后动、静脉；布有枕大神经和枕小神经会合支。\", \"zhi\": \"①头痛，眩晕，颈项强痛；②耳鸣，耳聋。\", \"cao\": \"平刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%B4%E7%AA%8D%E9%98%B4-1-L.gif\" },\n  { \"name\": \"完骨\", \"wei\": \"耳后，乳突后下方凹陷处。\", \"jie\": \"在胸锁乳突肌附着部上方，有耳后动、静脉分支；布有枕小神经本干。\", \"zhi\": \"①癫痫，头痛，颈项强痛；②喉痹，颊肿，齿痛，口歪。\", \"cao\": \"平刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%AE%8C%E9%AA%A8-1-L.gif\" },\n  { \"name\": \"本神\", \"wei\": \"入前发际0.5寸，督脉（神庭）穴旁开3寸。\", \"jie\": \"在额肌中；有颞浅动、静脉额支和额动、静脉外侧支；布有额神经外侧支。\", \"zhi\": \"①癫痫，小儿惊风，中风；②头痛，目眩。\", \"cao\": \"平刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%9C%AC%E7%A5%9E-1-L.gif\" },\n  { \"name\": \"阳白\", \"wei\": \"目正视，瞳孔直上，眉上1寸。\", \"jie\": \"在额肌中；有额动、静脉外侧支；布有额神经外侧支。\", \"zhi\": \"①头痛；②目眩，目痛，视物模糊，眼睑瞤动。\", \"cao\": \"平刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%98%B3%E7%99%BD-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"头临泣\", \"wei\": \"目正视，瞳孔与风池穴连线上，入前发际0.5寸。\", \"jie\": \"在额肌中；有额动、静脉；布有额神经内、外支会合支。\", \"zhi\": \"①头痛；②目痛，目眩，流泪，目翳；③鼻塞，鼻渊，④小儿惊痫。\", \"cao\": \"平刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%B4%E4%B8%B4%E6%B3%A3-1-L.gif\" },\n  { \"name\": \"目窗\", \"wei\": \"目正视，瞳孔与风池穴连线上，头临泣穴后1寸。\", \"jie\": \"在帽状腱膜中；有颞浅动、静脉额支；布有额神经内、外侧支会合支。\", \"zhi\": \"①头痛；②目痛，目眩，远视，近视；③小儿惊痫。\", \"cao\": \"平刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%9B%AE%E7%AA%97-1-L.gif\" },\n  { \"name\": \"正营\", \"wei\": \"目正视，瞳孔与风池穴连线上，目窗穴后1寸。\", \"jie\": \"在帽状腱膜中；有颞浅动、静脉顶支和枕动、静脉吻合网；布有额神经和枕大神经会合支。\", \"zhi\": \"头痛，头晕，目眩。\", \"cao\": \"平刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%AD%A3%E8%90%A5-1-L.gif\" },\n  { \"name\": \"承灵\", \"wei\": \"目正视，瞳孔与风池穴连线上，正营穴后1.5寸。\", \"jie\": \"在帽状腱膜中；有枕动、静脉分支；布有枕大神经分支。\", \"zhi\": \"①头痛，眩晕，目痛；②鼻渊，鼻衄，鼻窒，多涕。\", \"cao\": \"平刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%89%BF%E7%81%B5-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"脑空\", \"wei\": \"目正视，瞳孔与风池穴连线上，承灵穴后1.5寸，与督脉脑户穴相平处。\", \"jie\": \"在枕肌中；有枕动、静脉分支；布有枕大神经分支。\", \"zhi\": \"①热病；②头痛，颈项强痛；③目眩，目赤肿痛，鼻痛，耳聋；④惊悸，癫痫。\", \"cao\": \"平刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%84%91%E7%A9%BA-1-L.gif\" },\n  { \"name\": \"风池\", \"wei\": \"胸锁乳突肌与斜方肌上端之间的凹陷中，平风府穴。\", \"jie\": \"在胸锁乳突肌与斜方肌上端附着部之间的凹陷中，深部为头夹肌；有枕动、静脉分支；布有枕小神经分支。\", \"zhi\": \"①中风，癫痫，头痛，眩晕，耳鸣等内风为患者；②感冒，鼻塞，鼽衄，目赤肿痛，羞明流泪，耳聋，口眼歪斜等外风为患者；③颈项强痛。\", \"cao\": \"针尖微下，向鼻尖斜刺0.8～1.2寸，或平刺透风府穴。深部中间为延髓，必须严格掌握针刺的角度与深度。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%A3%8E%E6%B1%A0-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"肩井\", \"wei\": \"肩上，大椎穴与肩峰连线的中点。\", \"jie\": \"有斜方肌，深部为肩胛提肌与冈上肌；有颈横动、静脉分支；布有腋神经分支，深部上方为桡神经。\", \"zhi\": \"①颈项强痛，肩背疼痛，上肢不遂；②难产，乳痈，乳汁不下；③瘰疬。\", \"cao\": \"直刺0.5～0.8寸。内有肺尖，慎不可深刺；孕妇禁针。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%82%A9%E4%BA%95-1-L.gif\" },\n  { \"name\": \"渊腋\", \"wei\": \"举臂，腋中线上，第四肋间隙。\", \"jie\": \"有前锯肌和肋间内、外肌；有胸腹壁静脉，胸外侧动、静脉及第四肋间动、静脉；布有第四肋间神经外侧皮支，胸长神经分支。\", \"zhi\": \"①胸满，胁痛；②上肢痹痛，腋下肿。\", \"cao\": \"斜刺或平刺0.5～0.8寸，不可深刺，以免伤及脏器。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%B8%8A%E8%85%8B-1-L.gif\" },\n  { \"name\": \"辄筋\", \"wei\": \"渊腋穴前1寸，第四肋间隙。\", \"jie\": \"在胸大肌外缘，有前锯肌和肋间内、外肌；有胸外侧动、静脉；布有第四肋间神经外侧皮支。\", \"zhi\": \"①胸满，气喘；②胁痛，呕吐，吞酸；③腋肿，肩背痛。\", \"cao\": \"斜刺或平刺0.5～0.8寸，不可深刺，以免伤及脏器。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%BE%84%E7%AD%8B-1-L.gif\" },\n  { \"name\": \"日月\", \"wei\": \"乳头直下，第七肋间隙。\", \"jie\": \"有肋间内、外肌，肋下缘有腹外斜肌腱膜，腹内斜肌，腹横肌；有第七肋间动、静脉；布有第七或第八肋间神经。\", \"zhi\": \"①黄疸，呕吐，吞酸，呃逆等胆府病；②胁痛。\", \"cao\": \"斜刺或平刺0.5～0.8寸，不可深刺，以免伤及脏器。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%97%A5%E6%9C%88-1-L.gif\" },\n  { \"name\": \"京门\", \"wei\": \"侧卧，第十二肋游离端下际处。\", \"jie\": \"有腹内、外斜肌及腹横肌；有第十一肋间动、静脉；布有第十一肋间神经。\", \"zhi\": \"①小便不利，水肿；②腹胀，肠鸣，腹泻；③腰痛，胁痛。\", \"cao\": \"直刺0.5～1寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%BA%AC%E9%97%A8-1-L.gif\" },\n  { \"name\": \"带脉\", \"wei\": \"侧腹，第十一肋骨游离端直下平脐处。\", \"jie\": \"有腹内、外斜肌及腹横肌；有第十二肋间动、静脉；布有第十二肋间神经。\", \"zhi\": \"①月经不调，闭经，赤白带下；②疝气；③腰痛，胁痛。\", \"cao\": \"直刺1～1.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%B8%A6%E8%84%89-1-L.gif\" },\n  { \"name\": \"五枢\", \"wei\": \"侧腹，髂前上棘前0.5寸，约平脐下3寸处。\", \"jie\": \"有腹内、外斜肌及腹横肌；有旋髂浅、深动、静脉；布有髂腹下神经。\", \"zhi\": \"①阴挺，赤白带下，月经不调；②疝气；③少腹痛，腰胯痛。\", \"cao\": \"直刺1～1.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%BA%94%E6%9E%A2-1-L.gif\" },\n  { \"name\": \"维道\", \"wei\": \"五枢穴前下方0.5寸。\", \"jie\": \"在髂前上棘内前方，有腹内、外斜肌及腹横肌；有旋髂浅、深动、静脉；布有髂腹股沟神经。\", \"zhi\": \"①阴挺，赤白带下，月经不调；②疝气；③少腹痛，腰胯痛。\", \"cao\": \"直刺或向前下方斜刺1～1.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%BB%B4%E9%81%93-1-L.gif\" },\n  { \"name\": \"居髎\", \"wei\": \"侧卧，髂前上棘与股骨大转子高点连线的中点处。\", \"jie\": \"浅层为阔筋膜张肌，深部为股外侧肌；有旋髂浅动、静脉分支及旋股外侧动静脉升支；布有股外侧皮神经。\", \"zhi\": \"①腰腿痹痛，瘫痪；②疝气，少腹痛。\", \"cao\": \"直刺1～1.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%B1%85%E9%AB%8E-1-L.gif\" },\n  { \"name\": \"环跳\", \"wei\": \"侧卧屈股，当股骨大转子高点与骶管裂孔连线的外1／3与内2／3交界处。\", \"jie\": \"在臀大肌、梨状肌下缘；内侧为臀下动、静脉；布有臀下皮神经，臀下神经，深部正当坐骨神经。\", \"zhi\": \"①腰胯疼痛，下肢痿痹，半身不遂；②遍身风疹。\", \"cao\": \"直刺2～3寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%8E%AF%E8%B7%B3-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"风市\", \"wei\": \"大腿外侧正中，腘横纹上7寸。或垂手直立时，中指尖下是穴。\", \"jie\": \"在阔筋膜下，股外侧肌中；有旋股外侧动、静脉肌支；布有股外侧皮神经，股神经肌支。\", \"zhi\": \"①下肢痿痹、麻木，半身不遂；②遍身瘙痒。\", \"cao\": \"直刺1～1.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%A3%8E%E5%B8%82-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"中渎\", \"wei\": \"大腿外侧正中，腘横纹上5寸。\", \"jie\": \"在阔筋膜下，股外侧肌中；有旋股外侧动、静脉肌支；布有股外侧皮神经，股神经肌支。\", \"zhi\": \"下肢痿痹、麻木，半身不遂。\", \"cao\": \"直刺1～1.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%B8%AD%E6%B8%8E-1-L.gif\" },\n  { \"name\": \"膝阳关\", \"wei\": \"阳陵泉上3寸，股骨外上髁外上方凹陷中。\", \"jie\": \"在髂胫束后方，股二头肌腱前方；有膝上外侧动、静脉；布有股外侧皮神经末支。\", \"zhi\": \"膝腘肿痛、挛急，小腿麻木。\", \"cao\": \"直刺1～1.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%86%9D%E9%98%B3%E5%85%B3-1-L.gif\" },\n  { \"name\": \"阳陵泉\", \"wei\": \"腓骨小头前下方凹陷中。\", \"jie\": \"在腓骨长、短肌中；有膝下外侧动、静脉；当腓总神经分为腓浅神经及腓深神经处。\", \"zhi\": \"①黄疸，胁痛，口苦，呕吐，吞酸等胆腑病；②膝肿痛，下肢痿痹、麻木；③小儿惊风。\", \"cao\": \"直刺1～1.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%98%B3%E9%99%B5%E6%B3%89-1-L.gif\" },\n  { \"name\": \"阳交\", \"wei\": \"外踝高点上7寸，腓骨后缘。\", \"jie\": \"在腓骨长肌附着部；有腓动、静脉分支；布有腓肠外侧皮神经。\", \"zhi\": \"①惊狂，癫痫，瘈疭；②胸胁满痛；③下肢痿痹。\", \"cao\": \"直刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%98%B3%E4%BA%A4-1-L.gif\" },\n  { \"name\": \"外丘\", \"wei\": \"外踝高点上7寸，腓骨前缘。\", \"jie\": \"在腓骨长肌和趾总伸肌之间，深层为腓骨短肌；有胫前动、静脉肌支；布有腓浅神经。\", \"zhi\": \"①癫狂；②胸胁胀满；③下肢痿痹。\", \"cao\": \"直刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%96%E4%B8%98-1-L.gif\" },\n  { \"name\": \"光明\", \"wei\": \"外踝高点上5寸，腓骨前缘。\", \"jie\": \"在趾长伸肌和腓骨短肌之间；有胫前动、静脉分支；布有腓浅神经。\", \"zhi\": \"①目痛，夜盲；②胸乳胀痛；③下肢痿痹。\", \"cao\": \"直刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%85%89%E6%98%8E-1-L.gif\" },\n  { \"name\": \"阳辅\", \"wei\": \"外踝高点上4寸，腓骨前缘稍前处。\", \"jie\": \"在趾长伸肌和腓骨短肌之间；有胫前动、静脉分支；布有腓浅神经。\", \"zhi\": \"①偏头痛，目外眦痛，咽喉肿痛，腋下肿痛，胸胁满痛；②瘰疬；③下肢痿痹。\", \"cao\": \"直刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%98%B3%E8%BE%85-1-L.gif\" },\n  { \"name\": \"悬钟\", \"wei\": \"外踝高点上3寸，腓骨后缘。\", \"jie\": \"在腓骨短肌与趾长伸肌分歧处；有胫前动、静脉分支；布有腓浅神经。\", \"zhi\": \"①痴呆，中风，半身不遂；②颈项强痛，胸胁满痛，下肢痿痹。\", \"cao\": \"直刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%82%AC%E9%92%9F-1-L.gif\" },\n  { \"name\": \"丘墟\", \"wei\": \"外踝前下方，趾长伸肌腱的外侧凹陷中。\", \"jie\": \"在趾短伸肌起点处；有外踝前动、静脉分支；布有足背外侧皮神经分支及腓浅神经分支。\", \"zhi\": \"①目赤肿痛，目生翳膜；②颈项痛，腋下肿，胸胁痛，外踝肿痛；③下肢痿痹。\", \"cao\": \"直刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%B8%98%E5%A2%9F-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"足临泣\", \"wei\": \"第四、五跖骨结合部的前方凹陷处，足小趾伸肌腱的外侧。\", \"jie\": \"有足背静脉网，第四跖背侧动、静脉；布有足背中间皮神经。\", \"zhi\": \"①偏头痛，目赤肿痛，胁肋疼痛，足跗疼痛；②月经不调，乳痈：③瘰疬。\", \"cao\": \"直刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%B6%B3%E4%B8%B4%E6%B3%A3-1-L.gif\" },\n  { \"name\": \"地五会\", \"wei\": \"第四、五跖骨间，当小趾伸肌腱的内侧缘处。\", \"jie\": \"有足背静脉网，第四跖背侧动、静脉；布有足背中间皮神经。\", \"zhi\": \"①头痛，目赤肿痛，耳鸣，耳聋；②乳痈；③腋肿，胁痛，足跗肿痛。\", \"cao\": \"直刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%9C%B0%E4%BA%94%E4%BC%9A-1-L.gif\" },\n  { \"name\": \"侠溪\", \"wei\": \"足背，第四、五趾间纹头上凹陷处。\", \"jie\": \"有趾背侧动、静脉；布有足背中间皮神经的趾背侧神经。\", \"zhi\": \"①惊悸；②头痛，眩晕，耳鸣，耳聋；③颊肿，目外眦赤痛，胁肋疼痛，膝股痛，足跗肿痛；③乳痈。\", \"cao\": \"直刺0.3～0.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%BE%A0%E6%BA%AA-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"足窍阴\", \"wei\": \"第四趾外侧趾甲根角旁0.1寸。\", \"jie\": \"有趾背侧动、静脉，跖趾侧动、静脉形成的动、静脉网；布有趾背侧神经。\", \"zhi\": \"①头痛，目赤肿痛，耳鸣，耳聋，咽喉肿痛；②胸胁痛，足跗肿痛。\", \"cao\": \"浅刺0.1寸，或点刺出血。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%B6%B3%E7%AA%8D%E9%98%B4-1-L.gif\" }] },\n\n{\n  \"name\": \"足厥阴肝经\",\n  \"num\": 14,\n  \"content\": [\n  { \"name\": \"大敦\", \"wei\": \"足大趾外侧趾甲根角旁约0.1寸。\", \"jie\": \"有趾背动、静脉；布有腓深神经的趾背神经。\", \"zhi\": \"①疝气，少腹痛；②遗尿，癃闭，五淋，尿血；③月经不调，崩漏，缩阴，阴中痛，阴挺；④癫痫，善寐。\", \"cao\": \"浅刺0.1～0.2寸，或点刺出血。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%A7%E6%95%A6-1-L.gif\" },\n  { \"name\": \"行间\", \"wei\": \"足背，当第一、二趾间的趾蹼缘上方纹头处。\", \"jie\": \"有足背静脉网；第一跖背动、静脉；正当腓深神经的趾背神经分为趾背神经的分歧处。\", \"zhi\": \"①中风，癫痫；②头痛，目眩，目赤肿痛，青盲，口歪；③月经不调，痛经，闭经，崩漏，带下，阴中痛，疝气；④遗尿，癃闭，五淋；⑤胸胁满痛；⑥下肢内侧痛，足跗肿痛。\", \"cao\": \"直刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%A1%8C%E9%97%B4-1-L.gif\" },\n  { \"name\": \"太冲\", \"wei\": \"足背，第一、二跖骨结合部之前凹陷中。\", \"jie\": \"在拇长伸肌腱外缘；有足背静脉网，第一跖背动脉；布有腓深神经的跖背侧神经，深层为胫神经足底内侧神经。\", \"zhi\": \"①中风，癫狂痫，小儿惊风：②头痛，眩晕，耳鸣，目赤肿痛，口歪，咽痛；③月经不调，痛经，经闭，崩漏，带下；④胁痛，腹胀，呕逆，黄疸；⑤癃闭，遗尿：⑥下肢痿痹，足跗肿痛。\", \"cao\": \"直刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%AA%E5%86%B2-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"中封\", \"wei\": \"内踝前1寸，胫骨前肌腱内缘凹陷中。\", \"jie\": \"在胫骨前肌腱的内侧；有足背静脉网，内踝前动脉；布有足背内侧皮神经的分支及隐神经。\", \"zhi\": \"①疝气，遗精，小便不利；②腰痛，少腹痛，内踝肿痛。\", \"cao\": \"直刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%B8%AD%E5%B0%81-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"蠡沟\", \"wei\": \"内踝尖上5寸，胫骨内侧面的中央。\", \"jie\": \"在胫骨内侧面下三分之一处；其内后侧有大隐静脉；布有隐神经前支。\", \"zhi\": \"①月经不调，赤白带下，阴挺，阴痒；②小便不利，疝气，睾丸肿痛。\", \"cao\": \"平刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%A0%A1%E6%B2%9F-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"中都\", \"wei\": \"内踝尖上7寸，胫骨内侧面的中央。\", \"jie\": \"在胫骨内侧面中央；其内后侧有大隐静脉；布有隐神经中支。\", \"zhi\": \"①疝气，小腹痛；②崩漏，恶露不尽。\", \"cao\": \"平刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%B8%AD%E9%83%BD-1-L.gif\" },\n  { \"name\": \"膝关\", \"wei\": \"胫骨内上髁后下方，阴陵泉穴后1寸。\", \"jie\": \"在胫骨内侧面下方腓肠肌内侧头的上部；深部有胫后动脉；布有腓肠内侧皮神经，深部为胫神经。\", \"zhi\": \"膝髌肿痛，下肢痿痹。\", \"cao\": \"直刺1～1.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%86%9D%E5%85%B3-1-L.gif\" },\n  { \"name\": \"曲泉\", \"wei\": \"屈膝，当膝内侧横纹头上方，半腱肌、半膜肌止端前缘凹陷中。\", \"jie\": \"在胫骨内髁后缘，半膜肌、半腱肌止点前上方，缝匠肌后缘；浅层有大隐静脉，深层有腘动、静脉；布有隐神经，闭孔神经，深向腘窝可及胫神经。\", \"zhi\": \"①月经不调，痛经，带下，阴挺，阴痒，产后腹痛；②遗精，阳痿，疝气，小便不利；③膝髌肿痛，下肢痿痹。\", \"cao\": \"直刺1～1.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%9B%B2%E6%B3%89-1-L.gif\" },\n  { \"name\": \"阴包\", \"wei\": \"股骨内上髁上4寸，缝匠肌后缘。\", \"jie\": \"在股内肌与逢匠肌，内收长肌中点，深层为内收短肌；有股动、静脉，旋股内侧动脉浅支；布有股前皮神经，闭孔神经浅、深支。\", \"zhi\": \"①月经不调，小便不利，遗尿；②腰骶痛引少腹。\", \"cao\": \"直刺0.8～1.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%98%B4%E5%8C%85-1-L.gif\" },\n  { \"name\": \"足五里\", \"wei\": \"曲骨穴旁开2寸， 直下3寸。\", \"jie\": \"有内收长肌，内收短肌；有股内侧动脉浅支；布有闭孔神经浅、深支。\", \"zhi\": \"①少腹痛，小便不通，阴挺，睾丸肿痛；②瘰疬。\", \"cao\": \"直刺0.8～1.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%B6%B3%E4%BA%94%E9%87%8C-1-L.gif\" },\n  { \"name\": \"阴廉\", \"wei\": \"曲骨穴旁开2寸，直下2寸。\", \"jie\": \"有内收长肌和内收短肌；有旋股内侧动、静脉浅支；布有股神经的内侧皮支，深层为闭孔神经浅、深支。\", \"zhi\": \"月经不调，带下，少腹痛。\", \"cao\": \"直刺0.8～1.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%98%B4%E5%BB%89-1-L.gif\" },\n  { \"name\": \"急脉\", \"wei\": \"耻骨联合下缘中点旁开2.5寸，当气冲穴外下方腹股沟处。\", \"jie\": \"有阴部外动、静脉分支及腹壁下动、静脉的耻骨支，外方有股静脉；布有髂腹股沟神经，深层为闭孔神经的分支。\", \"zhi\": \"少腹痛，疝气，阴挺。\", \"cao\": \"避开动脉，直刺0.5～1寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%80%A5%E8%84%89-1-L.gif\" },\n  { \"name\": \"章门\", \"wei\": \"第十一肋游离端下际。\", \"jie\": \"有腹内、外斜肌及腹横肌；有第十肋间动脉末支；布有第十、十一肋间神经；右侧当肝脏下缘，左侧当脾脏下缘。\", \"zhi\": \"①腹痛，腹胀，肠鸣，腹泻，呕吐；②胁痛，黄疸，痞块，小儿疳疾。\", \"cao\": \"直刺0.8～1寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%AB%A0%E9%97%A8-1-L.gif\" },\n  { \"name\": \"期门\", \"wei\": \"乳头直下，第六肋间隙，前正中线旁开4寸。\", \"jie\": \"在腹内外斜肌腱膜中，有肋间肌；有肋间动、静脉；布有第六、七肋间神经。\", \"zhi\": \"①胸胁胀痛，乳痈；②呕吐，吞酸，呃逆，腹胀，腹泻；③奔豚；④伤寒热入血室。\", \"cao\": \"斜刺或平刺0.5～0.8寸，不可深刺，以免伤及内脏。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%9C%9F%E9%97%A8-1-L.gif\" }] },\n\n{\n  \"name\": \"督脉\",\n  \"num\": 29,\n  \"content\": [\n  { \"name\": \"长强\", \"wei\": \"跪伏或胸膝位，当尾骨尖端与肛门连线的中点处。\", \"jie\": \"在肛尾膈中；有肛门动、静脉分支，棘突间静脉丛的延续部；布有尾神经后支及肛门神经。\", \"zhi\": \"①腹泻，痢疾，便血，便秘，痔疮，脱肛；②癫狂痫，瘈疭，脊强反折。\", \"cao\": \"紧靠尾骨前面斜刺0.8～1寸；不宜直刺，以免伤及直肠。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%95%BF%E5%BC%BA-1-L.gif\" },\n  { \"name\": \"腰俞\", \"wei\": \"正当骶管裂孔处。\", \"jie\": \"在骶后韧带、腰背筋膜中；有骶中动、静脉后支，棘间静脉丛；布有尾神经分支。\", \"zhi\": \"①腹泻，痢疾，便血，便秘，痔疮，脱肛；②月经不调，经闭；③腰脊强痛，下肢痿痹。\", \"cao\": \"向上斜刺0.5～1寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%85%B0%E4%BF%9E-1-L.gif\" },\n  { \"name\": \"腰阳关\", \"wei\": \"后正中线上，第四腰椎棘突下凹陷中；约与髂嵴相平。\", \"jie\": \"在腰背筋膜、棘上韧带及肌间韧带中；有腰动脉后支，棘间皮下静脉丛；布有腰神经后支的内侧支。\", \"zhi\": \"①腰骶疼痛，下肢痿痹；②月经不调，赤白带下；③遗精，阳痿。\", \"cao\": \"向上斜刺0.5～1寸。多用灸法。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%85%B0%E9%98%B3%E5%85%B3-1-L.gif\" },\n  { \"name\": \"命门\", \"wei\": \"后正中线上，第二腰椎棘突下凹陷中。\", \"jie\": \"在腰背筋膜、棘上韧带及肌间韧带中；有腰动脉后支和棘间皮下静脉丛；布有腰神经后支的内侧支。\", \"zhi\": \"①腰脊强痛，下肢痿痹；②月经不调，赤白带下，痛经，经闭，不孕；③遗精，阳痿，精冷不育，小便频数；④小腹冷痛，腹泻。\", \"cao\": \"向上斜刺0.5～1寸。多用灸法。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%91%BD%E9%97%A8-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"悬枢\", \"wei\": \"后正中线上，第一腰椎棘突下凹陷中。\", \"jie\": \"在腰背筋膜、棘上韧带及肌间韧带中；有腰动脉后支和棘间皮下静脉丛；布有腰神经后支的内侧支。\", \"zhi\": \"①腰脊强痛；②腹胀，腹痛，完谷不化，腹泻，痢疾。\", \"cao\": \"向上斜刺0.5～1寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%82%AC%E6%9E%A2-1-L.gif\" },\n  { \"name\": \"脊中\", \"wei\": \"后正中线上，第十一胸椎棘突下凹陷中。\", \"jie\": \"在腰背筋膜、棘上韧带及肌间韧带中；有第十一肋间动脉后支和棘间皮下静脉丛；布有第十一胸神经后支的内侧支。\", \"zhi\": \"①癫痫；②黄疸，腹泻，痢疾，小儿疳疾；③痔疮，脱肛，便血；④腰脊强痛。\", \"cao\": \"向上斜刺0.5～1寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%84%8A%E4%B8%AD-1-L.gif\" },\n  { \"name\": \"中枢\", \"wei\": \"后正中线上，第十胸椎棘突下凹陷中。\", \"jie\": \"在腰背筋膜、棘上韧带及肌间韧带中；有第十肋间动脉后支和棘间皮下静脉丛；布有第十胸神经后支的内侧支。\", \"zhi\": \"①黄疸；②呕吐，腹满，胃痛，食欲不振；③腰背疼痛。\", \"cao\": \"向上斜刺0.5～1寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%B8%AD%E6%9E%A2-1-L.gif\" },\n  { \"name\": \"筋缩\", \"wei\": \"后正中线上，第九胸椎棘突下凹陷中。\", \"jie\": \"在腰背筋膜、棘上韧带及肌间韧带中；有第九肋间动脉后支和棘间皮下静脉丛；布有第九胸神经后支的内侧支。\", \"zhi\": \"①癫狂痫；②抽搐，脊强，背痛，四肢不收，筋挛拘急；③胃痛，黄疸。\", \"cao\": \"向上斜刺0.5～1寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%AD%8B%E7%BC%A9-1-L.gif\" },\n  { \"name\": \"至阳\", \"wei\": \"后正中线上，第七胸椎棘突下凹陷中。\", \"jie\": \"在腰背筋膜、棘上韧带及肌间韧带中；有第七肋间动脉后支和棘间皮下静脉丛；布有第七胸神经后支的内侧支。\", \"zhi\": \"①黄疸；②胸胁支满，咳嗽，气喘；③腰背疼痛，脊强。\", \"cao\": \"向上斜刺0.5～1寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%87%B3%E9%98%B3-1-L.gif\" },\n  { \"name\": \"灵台\", \"wei\": \"后正中线上，第六胸椎棘突下凹陷中。\", \"jie\": \"在腰背筋膜、棘上韧带及肌间韧带中；有第六肋间动脉后支和棘间皮下静脉丛；布有第六胸神经后支的内侧支。\", \"zhi\": \"①咳嗽，气喘；②脊痛，项强；③疔疮。\", \"cao\": \"向上斜刺0.5～1寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%81%B5%E5%8F%B0-1-L.gif\" },\n  { \"name\": \"神道\", \"wei\": \"后正中线上，第五胸椎棘突下凹陷中。\", \"jie\": \"在腰背筋膜、棘上韧带及肌间韧带中；有第五肋间动脉后支和棘间皮下静脉丛；布有第五胸神经后支的内侧支。\", \"zhi\": \"①心痛，心悸，怔忡，失眠，健忘；②中风不语，癫痫；③咳嗽，气喘；④腰脊强，肩背痛。\", \"cao\": \"向上斜刺0.5～1寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%A5%9E%E9%81%93-1-L.gif\" },\n  { \"name\": \"身柱\", \"wei\": \"后正中线上，第三胸椎棘突下凹陷中；约与两侧肩胛冈高点相平。\", \"jie\": \"在腰背筋膜、棘上韧带及肌间韧带中；有第三肋间动脉后支和棘间皮下静脉丛；布有第三胸神经后支的内侧支。\", \"zhi\": \"①身热头痛，咳嗽，气喘；②惊厥，癫狂痫；③腰脊强痛；④疔疮发背。\", \"cao\": \"向上斜刺0.5～1寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%BA%AB%E6%9F%B1-1-L.gif\" },\n  { \"name\": \"陶道\", \"wei\": \"后正中线上，第一胸椎棘突下凹陷中。\", \"jie\": \"在腰背筋膜、棘上韧带及肌间韧带中；有第一肋间动脉后支和棘间皮下静脉丛；布有第一胸神经后支的内侧支。\", \"zhi\": \"①热病，疟疾；②恶寒发热，咳嗽，气喘，骨蒸潮热；③癫狂，脊强。\", \"cao\": \"向上斜刺0.5～1寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%99%B6%E9%81%93-1-L.gif\" },\n  { \"name\": \"大椎\", \"wei\": \"后正中线上，第七颈椎棘突下凹陷中。\", \"jie\": \"在腰背筋膜、棘上韧带及肌间韧带中；有颈横动脉分支和棘间皮下静脉丛；布有第八颈神经后支的内侧支。\", \"zhi\": \"①热病，疟疾；②恶寒发热，咳嗽，气喘，骨蒸潮热，胸痛；③癫狂痫，小儿惊风；④项强，脊痛；⑤风疹，痤疮。\", \"cao\": \"向上斜刺0.5～1寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%A7%E6%A4%8E-1-L.gif\" },\n  { \"name\": \"哑门\", \"wei\": \"正坐，头微前倾，后正中线上，入发际上0.5寸。\", \"jie\": \"在项韧带和项肌中，深部为弓间韧带和脊髓；有枕动、静脉分支及棘间静脉丛；布有第三颈神经和枕大神经支。\", \"zhi\": \"①暴瘖，舌缓不语；②中风，癫狂痫，癔病；③头重，头痛，颈项强急。\", \"cao\": \"正坐位，头微前倾，项部放松，向下颌方向缓慢刺入0.5～1寸；不可向上深刺，以免刺入枕骨大孔，伤及延髓。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%93%91%E9%97%A8-1-L.gif\" },\n  { \"name\": \"风府\", \"wei\": \"正坐，头微前倾，后正中线上，入发际上1寸。\", \"jie\": \"在项韧带和项肌中，深部为环枕后膜和小脑延髓池；有枕动、静脉分支及棘间静脉丛；布有第三颈神经和枕大神经支。\", \"zhi\": \"①中风，癫狂痫，癔病；②眩晕，头痛，颈项强痛；③咽喉肿痛，失音，目痛，鼻衄。\", \"cao\": \"正坐位，头微前倾，项部放松，向下颌方向缓慢刺入0.5～1寸；不可向上深刺，以免刺入枕骨大孔，伤及延髓。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%A3%8E%E5%BA%9C-1-L.gif\" },\n  { \"name\": \"脑户\", \"wei\": \"风府穴直上1.5寸，当枕骨粗隆上缘凹陷处。\", \"jie\": \"在左右枕骨肌之间；有左右枕动、静脉分支；布有枕大神经分支。\", \"zhi\": \"头晕，项强，失音，癫痫。\", \"cao\": \"平刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%84%91%E6%88%B7-1-L.gif\" },\n  { \"name\": \"强间\", \"wei\": \"脑户穴直上1.5寸；或当风府穴与百会穴连线的中点处。\", \"jie\": \"在浅筋膜、帽状腱膜中；有左右枕动、静脉吻合网；布有枕大神经分支。\", \"zhi\": \"头痛，目眩，项强，癫狂。\", \"cao\": \"平刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%BC%BA%E9%97%B4-1-L.gif\" },\n  { \"name\": \"后顶\", \"wei\": \"强间穴直上1.5寸；或百会穴直后1.5寸。\", \"jie\": \"在浅筋膜、帽状腱膜中；有左右枕动、静脉吻合网；布有枕大神经分支。\", \"zhi\": \"头痛，眩晕，癫狂痫。\", \"cao\": \"平刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%90%8E%E9%A1%B6-1-L.gif\" },\n  { \"name\": \"百会\", \"wei\": \"后发际正中直上7寸；或当头部正中线与两耳尖连线的交点处。\", \"jie\": \"在帽状腱膜中；有左右颞浅动、静脉及左右枕动、静脉吻合网；布有枕大神经及额神经分支。\", \"zhi\": \"①中风，痴呆，癫狂痫，癔病，瘈疭；②头风，头痛，眩晕，耳鸣；③惊悸，失眠，健忘；④脱肛，阴挺，腹泻。\", \"cao\": \"平刺0.5～0.8寸；升阳举陷可用灸法。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%99%BE%E4%BC%9A-1-L.gif\" },\n  { \"name\": \"前顶\", \"wei\": \"百会穴前1.5寸；或额前部发际正中直上3.5寸处。\", \"jie\": \"在帽状腱膜中；有左右颞浅动、静脉吻合网；布有额神经分支及枕大神经分支。\", \"zhi\": \"中风，头痛，眩晕，鼻渊，癫痫。\", \"cao\": \"平刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%89%8D%E9%A1%B6-1-L.gif\" },\n  { \"name\": \"囟会\", \"wei\": \"前顶穴前1.5寸；或额前部发际正中直上2寸。\", \"jie\": \"在帽状腱膜中；有左右颞浅动、静脉吻合网；布有额神经分支。\", \"zhi\": \"头痛，眩晕，鼻渊，癫痫。\", \"cao\": \"平刺0.5～0.8寸。小儿前囟未闭者禁针。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%9B%9F%E4%BC%9A-1-L.gif\" },\n  { \"name\": \"上星\", \"wei\": \"囟会穴前1寸；或额前部发际正中直上1寸。\", \"jie\": \"在左右额肌交界处；有额动、静脉分支，颞浅动、静脉分支；布有额神经分支。\", \"zhi\": \"①头痛，目痛，鼻渊，鼻衄；②热病，疟疾；③癫狂。\", \"cao\": \"平刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%B8%8A%E6%98%9F-1-L.gif\" },\n  { \"name\": \"神庭\", \"wei\": \"额前部发际正中直上0.5寸。\", \"jie\": \"在左右额肌交界处；有额动、静脉分支；布有额神经分支。\", \"zhi\": \"①癫狂痫，中风；②头痛，目眩，失眠，惊悸；③目赤，目翳，鼻渊，鼻衄。\", \"cao\": \"平刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%A5%9E%E5%BA%AD-1-L.gif\" },\n  { \"name\": \"印堂\", \"wei\": \"在额部，当两眉 头的中间。\", \"jie\": \"在掣眉间肌中，浅层有滑车上神经分布，深层有面神经颞支和内眦动脉分布。\", \"zhi\": \"头痛、眩晕、鼻衄、鼻渊、小儿惊风、失眠。\", \"cao\": \"提捏局部皮肤，平刺0.3~0.5寸，或用三棱针点刺出血；可灸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%8D%B0%E5%A0%82-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"素髎\", \"wei\": \"鼻尖正中。\", \"jie\": \"在鼻尖软骨中；有面动、静脉鼻背支；布有筛前神经鼻外支（眼神经分支）。\", \"zhi\": \"①昏迷，惊厥，新生儿窒息；②鼻渊，鼻衄，喘息。\", \"cao\": \"向上斜刺0.3～0.5寸；或点刺出血。为急救要穴之一。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%B4%A0%E9%AB%8E-1-L.gif\" },\n  { \"name\": \"水沟\", \"wei\": \"在人中沟的上1／3与下2／3交界处。\", \"jie\": \"在口轮匝肌中；有上唇动、静脉；布有眶下神经支及面神经颊支。\", \"zhi\": \"①昏迷，晕厥，中风，中暑，癔病，癫狂痫，急慢惊风；②鼻塞，鼻衄，面肿，口歪，齿痛，牙关紧闭；③闪挫腰痛。\", \"cao\": \"向上斜刺0.3～0.5寸，强刺激；或指甲掐按。为急救要穴之一。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%B0%B4%E6%B2%9F-1-L.gif\" },\n  { \"name\": \"兑端\", \"wei\": \"上唇正中的尖端，红唇与皮肤交接处。\", \"jie\": \"在口轮匝肌中；有上唇动、静脉；布有眶下神经支及面神经颊支。\", \"zhi\": \"①昏迷，晕厥，癫狂，癔病；②口歪，口噤，口臭，齿痛；③消渴嗜饮。\", \"cao\": \"向上斜刺0.2～0.3寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%85%91%E7%AB%AF-1-L.gif\" },\n  { \"name\": \"龈交\", \"wei\": \"上唇系带与齿龈连接处。\", \"jie\": \"有上唇系带；有上唇动、静脉；布有上颌内槽神经分支。\", \"zhi\": \"①口歪，口噤，口臭，齿衄，齿痛，鼻衄，面赤颊肿；②癫狂，项强。\", \"cao\": \"向上斜刺0.2～0.3寸；或点刺出血。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%BE%88%E4%BA%A4-1-L.gif\" }] },\n\n{\n  \"name\": \"任脉\",\n  \"num\": 24,\n  \"content\": [\n  { \"name\": \"会阴\", \"wei\": \"男性在阴囊根部与肛门连线的中点处；女性在大阴唇后联合与肛门连线的中点处。\", \"jie\": \"在海绵体的中央；有会阴浅、深横肌；有会阴动、静脉分支；布有会阴神经的分支。\", \"zhi\": \"①溺水窒息，昏迷，癫狂痫；②小便不利，遗尿，阴痛，阴痒，脱肛，阴挺，痔疮；③遗精，月经不调。\", \"cao\": \"直刺0.5～1寸；孕妇慎用。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%BC%9A%E9%98%B4-1-L.gif\" },\n  { \"name\": \"曲骨\", \"wei\": \"前正中线上，脐下5寸，当耻骨联合上缘中点处。\", \"jie\": \"在腹白线上；有腹壁下动脉及闭孔动脉的分支；布有髂腹下神经的分支。\", \"zhi\": \"①少腹胀满，小便淋漓，遗尿；②阳痿，阴囊湿痒；③月经不调，痛经，赤白带下。\", \"cao\": \"直刺1～1.5寸；孕妇慎用。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%9B%B2%E9%AA%A8-1-L.gif\" },\n  { \"name\": \"中极\", \"wei\": \"前正中线上，脐下4寸。\", \"jie\": \"在腹白线上，内部为乙状结肠；有腹壁浅动、静脉分支和腹壁下动、静脉分支；布有髂腹下神经的前皮支。\", \"zhi\": \"①遗尿，小便不利，癃闭；②遗精，阳痿，不育；③月经不调，崩漏，阴挺，阴痒，不孕，产后恶露不止，带下。\", \"cao\": \"直刺1～1.5寸；孕妇慎用。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%B8%AD%E6%9E%81-1-L.gif\" },\n  { \"name\": \"关元\", \"wei\": \"前正中线上，脐下3寸。\", \"jie\": \"在腹白线上，深部为小肠；有腹壁浅动、静脉分支和腹壁下动、静脉分支；布有第十二肋间神经前皮支的内侧支。\", \"zhi\": \"①中风脱证，虚劳冷惫；②少腹疼痛，腹泻，痢疾，脱肛，疝气；③五淋，便血，尿血，尿闭，尿频；④遗精，阳痿，早泄，白浊；⑤月经不调，痛经，经闭，崩漏，带下，阴挺，恶露不尽，胞衣不下。\", \"cao\": \"直刺1～1.5寸；多用灸法。孕妇慎用。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%85%B3%E5%85%83-1-L.gif\" },\n  { \"name\": \"石门\", \"wei\": \"前正中线上，脐下2寸。\", \"jie\": \"在腹白线上，深部为小肠；有腹壁浅动、静脉分支和腹壁下动、静脉分支；布有第十一肋间神经前皮支的内侧支。\", \"zhi\": \"①腹胀，腹泻，痢疾，绕脐疼痛；②奔豚，疝气，水肿，小便不利；③遗精，阳痿；④经闭，带下，崩漏，产后恶露不止。\", \"cao\": \"直刺1～1.5寸；孕妇慎用。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%9F%B3%E9%97%A8-1-L.gif\" },\n  { \"name\": \"气海\", \"wei\": \"前正中线上，脐下1.5寸。\", \"jie\": \"在腹白线上，深部为小肠；有腹壁浅动、静脉分支和腹壁下动、静脉分支；布有第十一肋间神经前皮支的内侧支。\", \"zhi\": \"①虚脱，形体羸瘦，脏气衰惫，乏力；②水谷不化，绕脐疼痛，腹泻，痢疾，便秘；③小便不利，遗尿；④遗精，阳痿，疝气；⑤月经不调，痛经，经闭，崩漏，带下，阴挺，产后恶露不止，胞衣不下；⑥水肿，气喘。\", \"cao\": \"直刺1～1.5寸；多用灸法。孕妇慎用。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%B0%94%E6%B5%B7-1-L.gif\" },\n  { \"name\": \"阴交\", \"wei\": \"前正中线上，脐下1寸。\", \"jie\": \"在腹白线上，深部为小肠；有腹壁浅动、静脉分支和腹壁下动、静脉分支；布有第十肋间神经前皮支的内侧支。\", \"zhi\": \"①腹痛，水肿，疝气，小便不利；②月经不调，崩漏，带下。\", \"cao\": \"直刺1～1.5寸。孕妇慎用。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%98%B4%E4%BA%A4-1-L.gif\" },\n  { \"name\": \"神阙\", \"wei\": \"脐窝中央。\", \"jie\": \"在脐窝正中，深部为小肠；有腹壁下动、静脉；布有第十肋间神经前皮支的内侧支。\", \"zhi\": \"①阳气暴脱，形寒神惫，尸厥，风痫；②腹痛，腹胀，腹泻，痢疾，便秘，脱肛；③水肿，鼓胀，小便不利。\", \"cao\": \"一般不针，多用艾炷隔盐灸法。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%A5%9E%E9%98%99-1-L.gif\" },\n  { \"name\": \"水分\", \"wei\": \"前正中线上，脐上1寸。\", \"jie\": \"在腹白线上，深部为小肠；有腹壁下动、静脉；布有第八、九肋间神经前皮支的内侧支。\", \"zhi\": \"①水肿，小便不利；②腹痛，腹泻，胃反吐食。\", \"cao\": \"直刺1～1.5寸；水病多用灸法。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%B0%B4%E5%88%86-1-L.gif\" },\n  { \"name\": \"下脘\", \"wei\": \"前正中线上，脐上2寸。\", \"jie\": \"在腹白线上，深部为横结肠；有腹壁上、下动、静脉交界处的分支；布有第八肋间神经前皮支的内侧支。\", \"zhi\": \"①腹痛，腹胀，腹泻，呕吐，食谷不化；②小儿疳疾，痞块。\", \"cao\": \"直刺1～1.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%B8%8B%E8%84%98-1-L.gif\" },\n  { \"name\": \"建里\", \"wei\": \"前正中线上，脐上3寸。\", \"jie\": \"在腹白线上，深部为横结肠；有腹壁上、下动、静脉交界处的分支；布有第八肋间神经前皮支的内侧支。\", \"zhi\": \"①胃痛，呕吐，食欲不振；②腹胀，腹痛；③水肿。\", \"cao\": \"直刺1～1.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%BB%BA%E9%87%8C-1-L.gif\" },\n  { \"name\": \"中脘\", \"wei\": \"前正中线上，脐上4寸；或脐与胸剑联合连线的中点处。\", \"jie\": \"在腹白线上，深部为胃幽门部；有腹壁上动、静脉；布有第七、八肋间神经前皮支的内侧支。\", \"zhi\": \"①胃痛，腹胀，纳呆，呕吐，吞酸，呃逆，疳疾，黄疸；②癫狂痫，脏燥，尸厥，失眠，惊悸，哮喘。\", \"cao\": \"直刺1～1.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%B8%AD%E8%84%98-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" },\n  { \"name\": \"上脘\", \"wei\": \"前正中线上，脐上5寸。\", \"jie\": \"在腹白线上，深部为肝下缘及胃幽门部；有腹壁上动、静脉分支；布有第七肋间神经前皮支的内侧支。\", \"zhi\": \"①胃痛，呕吐，呃逆，腹胀；②癫痫。\", \"cao\": \"直刺1～1.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%B8%8A%E8%84%98-1-L.gif\" },\n  { \"name\": \"巨阙\", \"wei\": \"前正中线上，脐上6寸；或胸剑联合下2寸。\", \"jie\": \"在腹白线上，深部为肝脏；有腹壁上动、静脉分支；布有第七肋间神经前皮支的内侧支。\", \"zhi\": \"①癫狂痫；②胸痛，心悸；③呕吐，吞酸。\", \"cao\": \"向下斜刺0.5～1寸；不可深刺，以免伤及肝脏。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%B7%A8%E9%98%99-1-L.gif\" },\n  { \"name\": \"鸠尾\", \"wei\": \"前正中线上，脐上7寸；或剑突下，胸剑联合下1寸。\", \"jie\": \"在腹白线上，腹直肌起始部，深部为肝脏；有腹壁上动、静脉分支；布有第六肋间神经前皮支的内侧支。\", \"zhi\": \"①癫狂痫；②胸满，咳喘；③皮肤痛或瘙痒。\", \"cao\": \"向下斜刺0.5～1寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E9%B8%A0%E5%B0%BE-1-L.gif\" },\n  { \"name\": \"中庭\", \"wei\": \"胸剑联合的中点处。\", \"jie\": \"在胸剑联合上；有胸廓内动、静脉的前穿支；布有第五肋间神经前皮支的内侧支。\", \"zhi\": \"①胸腹胀满，噎嗝，呕吐；②心痛，梅核气。\", \"cao\": \"平刺0.3～0.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E4%B8%AD%E5%BA%AD-1-L.gif\" },\n  { \"name\": \"膻中\", \"wei\": \"前正中线上，平第四肋间隙；或两乳头连线与前正中线的交点处。\", \"jie\": \"在胸骨体上；有胸廓内动、静脉的前穿支；布有第四肋间神经前皮支的内侧支。\", \"zhi\": \"①咳嗽，气喘，胸闷，心痛，噎嗝，呃逆；②产后乳少，乳痈。\", \"cao\": \"平刺0.3～0.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E8%86%BB%E4%B8%AD-1-L.gif\" },\n  { \"name\": \"玉堂\", \"wei\": \"前正中线上，平第三肋间隙。\", \"jie\": \"在胸骨体中点；有胸廓内动、静脉的前穿支；布有第三肋间神经前皮支的内侧支。\", \"zhi\": \"①咳嗽，气喘，胸闷，胸痛，乳房胀痛；②喉痹，咽肿。\", \"cao\": \"平刺0.3～0.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%8E%89%E5%A0%82-1-L.gif\" },\n  { \"name\": \"紫宫\", \"wei\": \"前正中线上，平第二肋间隙。\", \"jie\": \"在胸骨体上；有胸廓内动、静脉的前穿支；布有第二肋间神经前皮支的内侧支。\", \"zhi\": \"咳嗽，气喘，胸痛。\", \"cao\": \"平刺0.3～0.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%B4%AB%E5%AE%AB-1-L.gif\" },\n  { \"name\": \"华盖\", \"wei\": \"前正中线上，胸骨角的中点处，平第一肋间隙。\", \"jie\": \"在胸骨角上；有胸廓内动、静脉的前穿支；布有第一肋间神经前皮支的内侧支。\", \"zhi\": \"咳嗽，气喘，胸痛，喉痹。\", \"cao\": \"平刺0.3～0.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%8D%8E%E7%9B%96-1-L.gif\" },\n  { \"name\": \"璇玑\", \"wei\": \"前正中线上，胸骨柄的中央处。\", \"jie\": \"在胸骨柄上；有胸廓内动、静脉的前穿支；布有胸锁上神经前支及第一肋间神经前皮支的内侧支。\", \"zhi\": \"咳嗽，气喘，胸痛，咽喉肿痛。\", \"cao\": \"平刺0.3～0.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E7%92%87%E7%8E%91-1-L.gif\" },\n  { \"name\": \"天突\", \"wei\": \"胸骨上窝正中。\", \"jie\": \"在胸骨切迹中央，左右胸锁乳突肌之间，深层为胸骨舌骨肌和胸骨甲状肌；皮下有颈静脉弓，甲状腺下动脉分支，深部为气管，向下胸骨柄后方为无名静脉及主动脉弓；布有锁骨上神经前支。\", \"zhi\": \"①咳嗽，哮喘，胸痛，咽喉肿痛；②暴瘖，瘿气，梅核气，噎嗝。\", \"cao\": \"先直刺0.2～0.3寸，然后将针尖向下，紧靠胸骨柄后方刺入1～1.5寸。必须严格掌握针刺的角度和深度，以防刺伤肺和有关动、静脉。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%A4%A9%E7%AA%81-1-L.gif\" },\n  { \"name\": \"廉泉\", \"wei\": \"微仰头，在喉结上方，当舌骨体上缘的中点处。\", \"jie\": \"在舌骨上方，左右颏舌骨肌之间，深部为会厌，下方为喉门，有甲状舌骨肌、舌肌；有颈前浅静脉，甲状腺上动、静脉；布有颈皮神经的分支，深层为舌根，有舌下神经及舌咽神经的分支。\", \"zhi\": \"①舌强不语，暴瘖，喉痹，吞咽困难；②舌缓流涎，舌下肿痛，口舌生疮。\", \"cao\": \"向舌根斜刺0.5～0.8寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E5%BB%89%E6%B3%89-1-L.gif\" },\n  { \"name\": \"承浆\", \"wei\": \"颏唇沟的正中凹陷处。\", \"jie\": \"在口轮匝肌和颏肌之间；有下唇动、静脉分支；布有面神经的下颌支及颏神经分支。\", \"zhi\": \"①口歪，齿龈肿痛，流涎；②暴瘖，癫狂。\", \"cao\": \"斜刺0.3～0.5寸。\", \"img\": \"http://www.tcmdoc.cn/Images_XueWei/%E6%89%BF%E6%B5%86-%E4%BD%93%E8%A1%A8%E7%A4%BA%E6%84%8F%E5%9B%BE-L.jpg\" }] }];\n\n\n\nmodule.exports = {\n  acupoint: acupoint_data };//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///59\n");

